import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as D,e as b,q as v}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],C={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",C,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(f,[["render",x],["__scopeId","data-v-efeb0d39"]]),M=JSON.parse(`[{"page_url":"https://pt.wikipedia.org/wiki/Prokhorovka","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Sparrow_in_Gun_Barrel_of_Tank_-_Prokhorovka_%28Battle_of_Kursk%29_-_Russia_%283774259862%29.jpg","page_title":"Prokhorovka","context_page_description":"Prokhorovka, é um assentamento, e o centro administrativo do distrito de Prokhorovsky no distrito de Belgorod Oblast, Rússia, localizado ao longo do rio Psyol, a sudeste da cidade de Kursk. População: 9,761"},{"page_url":"https://sv.wikipedia.org/wiki/Bj%C3%B6rn_Malmroos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Bj%C3%B6rn_Malmroos.jpg","page_title":"Björn Malmroos","context_page_description":"Björn Erik Berthold Malmroos, född 16 januari 1936 i Gävle, död 8 januari 1996 i Malmö, var en svensk friidrottare. Han tävlade för Malmö AI. Han utsågs 1956 till Stor grabb nummer 188 i friidrott.\\nMalmroos var under 1950- och 1960-talet en av Sveriges snabbaste män. Han erövrade åtta individuella SM under sin aktiva tid. Han representerade ofta det svenska landslaget på 100 m, 200 m och korta stafetter."},{"page_url":"https://de.wikipedia.org/wiki/Otto_Weininger","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Otto_Weininger_1903_-_Heliograv%C3%BCre_Paulussen.jpg","page_title":"Otto Weininger","context_page_description":"Otto Weininger war ein österreichischer Philosoph. Er wurde durch sein Werk Geschlecht und Charakter bekannt, das sich durch antisemitische und misogyne Theorien auszeichnet.\\nWeininger, jüdischer Herkunft und zum protestantischen Glauben konvertiert, war in seinen letzten Jahren extrem judenfeindlich eingestellt und Verfechter einer frauen- und körperfeindlichen Geisteshaltung. Er entwickelte eine philosophisch-psychologische Theorie der Geschlechter, in deren Zentrum die Theorie der menschlichen Bisexualität steht. Durch seinen Suizid in Ludwig van Beethovens Sterbehaus in Wien wurde er zu einer geradezu legendenhaften Gestalt, sein Buch zu einem Bestseller mit zahlreichen Auflagen."},{"page_url":"https://id.wikipedia.org/wiki/Museum_Geologi_Tiongkok","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Lufengosaurus-Geological_Museum_of_China.jpg","page_title":"Museum Geologi Tiongkok","context_page_description":"Museum Geologi Tiongkok dibangun pada 1916 dan memiliki 200 ribu spesimen. MGT terletak di kawasan Xisi, Beijing, dibuka pada 1 Oktober 1959 dan menjadi museum ilmiah geologis paling awal di Tiongkok.\\nSaat ini MGT memiliki lebih dari 100.000 spesimen geologi, banyak di antaranya merupakan barang berharga sehingga disebut \\"Harta Karun Nasional\\", seperti fosil \\"Dinosaurus Raksasa Shandong\\", fosil dinosaurus paling lengkap yang masih ada di dunia hasil penggalian di provinsi Liaoning dan juga fosil-fosil burung primitif yang ditemukan di sebelah barat provinsi Liaoning yang sangat penting untuk penelitian burung-burung di wilayah tersebut, fosil-fosil manusia Yunnan Yuanmou yang menunjukkan kondisi fisik manusia di Tiongkok pada zaman yang jauh lebih awal, periuk, mutiara batu, jarum tulang, hiasan tulang yang digali dari lokasi manusia Gua Atas di Zhoukoudian, Beijing, kristal sinabar 237 gram yang dijuluki sebagai \\"Raja Sinabar\\" dan lebih dari 60 produk mineral baru yang ditemukan di Tiongkok.\\nLantai dasar MGT terdiri dari lima ruang pameran seluas 2.500 m² yaitu ruang pameran sumber daya geologi, sejarah global, lapisan paleontologi, batuan mineral dan intan."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%82%E1%80%BB%E1%80%95%E1%80%BA%E1%80%85%E1%80%90%E1%80%84%E1%80%BA_%E1%80%98%E1%80%AE%E1%80%98%E1%80%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Justin_Bieber_in_2015.jpg","page_title":"ဂျပ်စတင် ဘီဘာ","context_page_description":"ဂျပ်စတင် ဒရူး ဘီဘာ သည် ကနေဒါနိုင်ငံသား ခေတ်ပေါ် pop နှင့် R&B တေးသံရှင်ဖြစ်သည်။ ဘီဘာ၏ ယူကျု ပေါ်ရှိ ဗွီဒီယိုအား ၂၀၀၈ ခုနှစ်တွင် စကူတာ ဘရောင်း က တွေ့ရှိခဲ့ပြီး နောက်တွင် ဘီဘာ၏ မန်နေဂျာ ဖြစ်လာသည်။ ဘရောင်းက ဘီဘာအား နာမည်ကျော် တေးသံရှင် အပ်ရှာ နှင့် တွေ့ဆုံရန် စီစဉ်ပေးခဲ့ပြီး မကြာမီတွင် အပ်ရှာနှင့် ဘရောင်းတို့ ပူးတွဲတီထောင်ထားသည့် Raymond Braun Media Group နှင့် လက်မှတ်ရေးထိုး လိုက်သည်။ ထိုနောက်တွင် Island Records နှင့် တေးအယ်လ်ဘမ် ထုတ်ရန် စာချုပ်ချုပ်ဆိုလိုက်သည်။\\nဂျပ်စတင် ဘီဘာ၏ ပွဲထွက် single ‘One Time’ ကို ၂၀၀၉ ခုနှစ်တွင် ကမ္ဘာတလွှား၌ ဖြန့်ချိခဲ့သည်။ ယင်းသီချင်းသည် ကနေဒါနိုင်ငံ၏ အရောင်းရဆုံး ၁၀ စာရင်းတွင် ထိပ်မှလည်းကောင်း နိုင်ငံတကာ ဈေးကွက်တွင် အရောင်းရဆုံး ၃၀ စာရင်းဝင်ခဲ့သည်။ ၂၀၀၉ ခုနှစ် နိုဝင်ဘာ ၁၇ ရက်နေ့တွင် ပထမဦးဆုံးသော အယ်လ်ဘမ် ‘My World’ ကို ထုတ်ဝေရာ အမေရိကန်တွင် ပလက်တီနမ် ဓာတ်ပြား စာရင်းဝင်ခဲ့သည်။ ဂျပ်စတင် ဘီဘာသည်လည်း ဗွေဆော်အယ်လ်ဘမ်မှ သီချင်း ၇ ပုဒ် ‘ဘီလ်ဘော့ဒ် ရေပန်းစားသီချင်း ’ စာရင်းဝင်ခဲ့သည့် ပထမဦးဆုံးသော တေးသံရှင်ဖြစ်သည်။"},{"page_url":"https://pl.wikipedia.org/wiki/Dominik_Merlini","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Kosciol_sw_Boromeusza_w_Warszawie.jpg","page_title":"Dominik Merlini","context_page_description":"Domenico Merlini – działający w Polsce architekt pochodzący z regionu jezior Como i Lugano, z którego wywodzą się najwybitniejsi Komaskowie epoki baroku."},{"page_url":"https://ca.wikipedia.org/wiki/%C5%81ukasz_Piszczek","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/%C5%81ukasz_Piszczek_-_Hertha_BSC_Berlin_%282%29.jpg","page_title":"Łukasz Piszczek","context_page_description":"Łukasz Piszczek és un futbolista polonès que juga de lateral dret pel Borussia Dortmund a Alemanya."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B1%D8%A7_%D8%B3%D8%A7%D8%B1%DA%AF%D8%B3%DB%8C%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/%D5%80%D5%B8%D5%BE%D5%B0%D5%A1%D5%B6%D5%B6%D5%A5%D5%BD_%D4%B9%D5%B8%D6%82%D5%B4%D5%A1%D5%B6%D5%B5%D5%A1%D5%B6_006.JPG","page_title":"آرا سارگسیان","context_page_description":"آرا سارگسیان مجسمه‌ساز اهل ارمنستان بود."},{"page_url":"https://it.wikipedia.org/wiki/Arvaniti","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Lord_Byron_in_Albanian_Dress_by_Phillips%2C_1813.jpg","page_title":"Arvaniti","context_page_description":"Gli Arvaniti, ovvero gli albanesi di Grecia, sono una popolazione albanese di religione cristiano-ortodossa stanziata storicamente in Grecia.\\nEssi si stanziarono dall'Albania e dall'Epiro nell'attuale stato greco tra il XII e il XIII secolo, creando numerosissime comunità, circa 900 ancora oggi esistenti, influenzando e costituendo l'elemento dominante della popolazione di alcune regioni del Peloponneso e dell'Attica fino al XIX secolo.\\nMolti degli attuali arbëreshë di Grecia, pur parlando nell'ambiente domestico la lingua albanese, si identificano oggi come \\"greci\\" e non si considerano generalmente appartenenti all'Albania o alla nazione albanese, questo come risultato di un processo politico preciso di assimilazione partito dal XX secolo per la creazione di uno stato greco \\"puro\\".\\nLe comunità di arvanitë nella Grecia Occidentale e nell'Epiro usano definirsi shqiptarë. Gli arvanitë, al contrario degli arbëreshë in Italia, non sono formalmente riconosciuti come storica minoranza presente sul territorio così come le altre minoranze linguistiche dell'attuale Grecia."},{"page_url":"https://simple.wikipedia.org/wiki/Prypiat","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Pripyat%2C_Ukraine%2C_abandoned_city.jpg","page_title":"Prypiat","context_page_description":"Pripyat is an abandoned city in northern Ukraine. It lies in Kiev Oblast, near the border with Belarus. It was home to Chernobyl nuclear power plant workers. The city was abandoned in 1986 after the Chernobyl accident, the worst nuclear reactor accident in history. Before being abandoned, about 48,000 people lived in the city. The city was founded in the 1970s, when the nuclear power plant opened.\\nThe site today is practically a museum showing the late Soviet era. With entirely abandoned buildings, including abandoned apartment buildings, swimming pools and hospitals, everything inside remains, from records to papers to children's toys and clothing. Pripyat and the surrounding area will not be safe for people to live there for several centuries. Scientists think that the most dangerous radioactive elements will take up to nine hundred years to decay sufficiently to render the area safe.\\nThe city is entirely accessible and is relatively safe on the road, although it is unsafe to go around the city without a radiation dosimeter that measures exposure."},{"page_url":"https://cs.wikipedia.org/wiki/Trdeln%C3%ADk","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Trdeln%C3%ADk_in_trdlo.JPG","page_title":"Trdelník","context_page_description":"Trdelník je sladké pečivo ve tvaru podobném velké duté kremroli, ovšem bez krémové náplně.\\nVyrábí se z kynutého těsta, které se rozválené v pruzích navíjí na bukový válec o průměru 8 až 10 cm, zvaný trdlo, a peče se v žáru dřevěného uhlí. Při pečení se otáčí, potírá mlékem až do té doby, dokud nezíská zlatočervenou barvu. Pak se z válce opatrně stáhne, aby se neporušil tvar."},{"page_url":"https://id.wikipedia.org/wiki/Dior","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Christian_Dior_%28Moscow_exhibition%2C_2011%29_26.jpg","page_title":"Dior","context_page_description":"Christian Dior SE, biasa dikenal sebagai Dior, adalah sebuah produsen barang mewah asal Prancis yang dikendalikan dan dipimpin oleh pebisnis asal Prancis, Bernard Arnault, yang juga memimpin LVMH, produsen barang mewah terbesar di dunia. Dior sendiri memegang 42,36% saham dan 59,01% hak suara LVMH. Sidney Toledano telah menjadi CEO Dior sejak tahun 1997.\\nPerusahaan ini didirikan pada tahun 1946 oleh Christian Dior. Dior saat ini merancang dan menjual produk berbahan kulit, aksesoris mode, alas kaki, perhiasan, jam, parfum, kosmetik, dan produk perawatan kulit, serta juga mempertahankan tradisinya sebagai pencipta haute-couture melalui divisi Christian Dior Couture. Merek Christian Dior terutama digunakan untuk produk yang ditujukan pada wanita, sedangkan produk yang ditujukan untuk pria menggunakan merek Dior Homme, sementara merek baby Dior digunakan untuk produk yang ditujukan pada anak-anak. Produk Dior dijual melalui gerai ritelnya di seluruh dunia, serta melalui toko daring."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B1%8A%E6%A5%BD%E5%AF%BA_(%E5%B2%A1%E5%B1%B1%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Seihitsuzan_Burakuji_05.JPG","page_title":"豊楽寺 (岡山市)","context_page_description":"豊楽寺は岡山県岡山市北区建部町豊楽寺に所在する寺院である。山号は静謐山。宗派は高野山真言宗。本尊は薬師瑠璃光如来。高野山真言宗美作八十八ヶ所第二十一番札所である。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A2%D0%B5%D1%84%D0%B8%D0%BA_%D0%A0%D1%8E%D1%89%D1%8E_%D0%90%D1%80%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Ahmet_Tevfik_R%C3%BC%C5%9Ft%C3%BC_Aras.jpg","page_title":"Тефик Рющю Арас","context_page_description":"Ахмед Тефик Рющю Арас е турски политик от Републиканската народна партия, външен министър на Турция през 1925-1938 година.\\nТефик Рющю бей е роден през 1883 година в Чанаккале. Завършва медицинско училище в Бейрут и работи като лекар в Измир, Истанбул и Солун. Там става член на младотурския Комитет за единство и прогрес, където се запознава с Мустафа Кемал Ататюрк.\\nПрез 1920 година Арас е избран за пръв път в новосъздадения турски парламент, а малко по-късно е сред основателите на Комунистическата партия на Турция. По-късно преминава към кемалистката Републиканска народна партия и от 1925 година до смъртта на Ататюрк през 1938 година е министър на външните работи.\\nСлед въвеждането на фамилиите в Турция, приема името Арас.\\nПрез 1937 година председателства една от сесиите на Общото събрание на Обществото на народите. След оттеглянето си от кабинета е посланик на Турция в Лондон.\\nТефик Рющю Арас умира на 4 януари 1972 година в Истанбул."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B7%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/AzuVealMeal.JPG","page_title":"Азу","context_page_description":"Азу́ — традиционное блюдо татарской кухни, состоящее из обжаренных кусочков мяса, тушёных с помидорами, луком, картофелем в остром соусе. Азу из баранины часто тушится с морковью, нарезанной тонкими кружочками."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AA%E0%A4%BF%E0%A4%A8%E0%A4%BE%E0%A4%82%E0%A4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Lebuh_Armenian_Penang_Dec_2006_001.jpg","page_title":"पिनांग","context_page_description":"पिनांग\\nमलेशिया का एक राज्य है जो मलक्का के जलडमरुमध्य के साथ प्रायद्वीपीय मलेशिया के पश्चिमोत्तर तट पर स्थित है।\\nक्षेत्र के हिसाब से पिनांग पेर्लिस के बाद मलेशिया का दूसरा सबसे छोटा और आठवां सबसे अधिक जनसंख्या वाला राज्य है। पिनांग के निवासी को बोलचाल की भाषा में पेननगाइट के रूप में जाना जाता है।"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_prefeitos_de_Santa_Maria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Manuel_Ribas_Governor_Of_Paran%C3%A1_%281932-1945%29.jpg","page_title":"Lista de prefeitos de Santa Maria","context_page_description":"Esta é a lista de prefeitos e vice-prefeitos do município de Santa Maria, estado brasileiro do Rio Grande do Sul.\\nEntre 1889 e 1928, o município de Santa Maria foi governado por uma série de Intendentes Municipais. Manoel Ribas atuou como Intendente e Prefeito entre 1930 e 1932. Após 1932, o cargo de Intendente Municipal tornou-se Prefeito Municipal.\\nEsta página lista os prefeitos da cidade de Santa Maria, Rio Grande do Sul, durante a República Federativa do Brasil."},{"page_url":"https://de.wikipedia.org/wiki/Brocket_Hall","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Brocket_Hall_cropped.jpg","page_title":"Brocket Hall","context_page_description":"Brocket Hall ist ein Landhaus in Hertfordshire, England, etwa 35 km von London."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%BE%D1%80%D0%BD%D0%BE%D1%81%D0%BE%D1%80%D0%BE%D1%87%D0%B5%D1%87%D0%BD%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Fascist_Rank_Centurion_2.jpg","page_title":"Чорносорочечники","context_page_description":"Добровільна міліція національної безпеки, більше відома як чорносорочечники або сквадристи"},{"page_url":"https://es.wikipedia.org/wiki/Primer_ministro_de_Croacia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Ivica_Ra%C4%8Dan%2C_facingright.jpg","page_title":"Primer ministro de Croacia","context_page_description":"El Presidente del Gobierno de la República de Croacia, también conocido informalmente como Primer Ministro de Croacia, es el jefe de gobierno de Croacia.\\nDesde la creación del título de Primer ministro del Gobierno, han sido nueve las personas que han desempeñado en el cargo, ocho de ellos propuestos por la Unión Democrática Croata.\\nEl Primer ministro es actualmente Andrej Plenković, desde el 19 de octubre de 2016.\\nEl Gobierno de Croacia se reúne en Banski dvori, un edificio histórico situado al oeste de la plaza de St. Mark's, en Zagreb."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A7%E3%83%BC%E3%82%B8%E3%83%BB%E3%82%B9%E3%83%86%E3%82%A3%E3%83%BC%E3%83%B4%E3%83%B3%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/George_Stevens_with_Oscar_for_Giant.jpg","page_title":"ジョージ・スティーヴンス","context_page_description":"ジョージ・スティーヴンスは、アメリカ合衆国の映画監督、映画プロデューサー、脚本家、撮影監督。アカデミー賞受賞者。戦前はジャンルを問わない商業映画で活躍したが、戦後は主にアメリカの家庭を舞台にした重厚なドラマを撮り続けた。"},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Windberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Windberg-Klosterkirche.jpg","page_title":"Kloster Windberg","context_page_description":"Das Kloster Windberg ist eine Abtei des Prämonstratenserordens in Windberg in Niederbayern in der Diözese Regensburg."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D1%80%D0%B5%D0%B4%D1%9A%D0%B0_%D0%BC%D0%B0%D1%88%D0%B8%D0%BD%D1%81%D0%BA%D0%B0_%D1%88%D0%BA%D0%BE%D0%BB%D0%B0_%D0%9D%D0%BE%D0%B2%D0%B8_%D0%A1%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/%D0%A0%D0%BE%D0%B1%D0%BE%D1%82_%D0%A1%D0%9C%D0%A8.jpg","page_title":"Средња машинска школа Нови Сад","context_page_description":"Средња машинска школа у Новом Саду је једна од највћих средњих школа у Војводини. Основана је 1936. године од стране Министарства трговина и индустрије. Током своје дуге историје претрпела је многобројне значајне промене. Од самог настанка, Средња машинска школа прошла је кроз низ реформи. Данас она представља институцију у којој се тренутно образују око 1.500 ђака, док је број запослених већи од 150.\\nШкола је неколико пута мењала назив. Под овим именом постоји од 27. новембра 1990."},{"page_url":"https://ca.wikipedia.org/wiki/Cebrecos","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Cebrecos01.jpg","page_title":"Cebrecos","context_page_description":"Cebrecos és un municipi de la província de Burgos a la comunitat autònoma de Castella i Lleó. Forma part de la comarca de l'Arlanza."},{"page_url":"https://lv.wikipedia.org/wiki/Roterdama","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Rotterdam%2C_Laurenskerk%2C_na_bombardement_van_mei_1940.jpg","page_title":"Roterdama","context_page_description":"Roterdama ir pilsēta Nīderlandes rietumos, Reinas grīvā. Tā ir lielākā Eiropas osta un trešā lielākā osta pasaulē. Liels naftas pārstrādes centrs. Unilever un Mittal Steel Company galvenās mītnes vieta.\\nKatra gada janvārī pilsētā notiek Roterdamas Starptautiskais kinofestivāls. 20. gadsimta 90. gados Roterdama bija viens no hardcore techno rašanās centriem. Futbolā pilsēta slavena ar klubu Feyenoord."},{"page_url":"https://en.wikipedia.org/wiki/Techfest","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Prachi_Desai_at_IIT_Bombay.jpg","page_title":"Techfest","context_page_description":"Techfest is the annual science and technology festival of Indian Institute of Technology Bombay. It also refers to the independent body of students who organize this event along with many other social initiatives and outreach programs around the year. Techfest is known for hosting a variety of events that include competitions, exhibitions, lectures as well as workshops.\\nStarted in 1998 with the aim of providing a platform for the Indian student community to develop and showcase their technical prowess, it has now grown into Asia's Largest Science and Technology Festival with a footfall of 1.75 lakhs in its latest edition. The activities culminate in a grand three-day event in the campus of IIT Bombay which attracts people from all over the World, including students, academia, corporates and the general public."},{"page_url":"https://fr.wikipedia.org/wiki/Cin%C3%A9ma_polonais","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/%D0%A4%D0%95%D0%A0%D0%A2%D0%9D%D0%95%D0%A0_%D0%90%D0%BD%D1%82%D0%BE%D0%BD.jpg","page_title":"Cinéma polonais","context_page_description":"L’histoire du cinéma polonais est presque aussi longue que celle de la cinématographie car inaugurée par l'invention du pléographe par Kazimierz Prószyński en 1894 avant même le célèbre cinématographe des frères Lumière.\\nLe cinéma polonais a acquis une renommée universelle. Les films réalisés au sein de l’Ecole polonaise du cinéma ont eu une forte influence sur des mouvements tels que la Nouvelle Vague, le Néoréalisme et même le cinéma classique hollywoodien. Des réalisateurs polonais comme Paweł Pawlikowski, Andrzej Wajda, Krzysztof Kieślowski, Andrzej Żuławski, Roman Polanski ou Krzysztof Zanussi ont durablement inscrit leurs noms dans le monde du 7ᵉ art."},{"page_url":"https://ast.wikipedia.org/wiki/Lling%C3%BCes_uto-azteques","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Northern-UA-languages.png","page_title":"Llingües uto-azteques","context_page_description":"Les llingües uto-azteques formen una familia de llingües amerindies llargamente espublizada por América del Norte, con aprosimao un millón y mediu de falantes. Tien el so orixe históricu en dalgún llugar asitiáu escontra'l suroeste de los Estaos Xuníos o'l noroeste de Méxicu, y debe el so gran espardimientu a importantes migraciones de los sos falantes escontra tierres mesoamericanas. De fechu la llingua principal del imperiu mexica, el más importante d'América del Norte antes de la llegada de los europeos, yera'l náhuatl, una llingua uto-azteca, motivu pol cual dióse-y orixinalmente esi nome a esta familia de llingües.\\nAnque la denominación tradicional uto-azteca foi criticada por delles razones, lo que xeneró la propuesta del nome yuto-nahua, que sicasí nun llogró aceptación xeneral."},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Europameisterschaften_2016/4_%C3%97_400_m_der_M%C3%A4nner","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/421_4X400_%2828247069435%29.jpg","page_title":"Leichtathletik-Europameisterschaften 2016/4 × 400 m der Männer","context_page_description":"Die 4-mal-400-Meter-Staffel der Männer bei den Leichtathletik-Europameisterschaften 2016 wurde am 9. und 10. Juli 2016 im Olympiastadion der niederländischen Hauptstadt Amsterdam ausgetragen.\\nEuropameister wurde Belgien in der Besetzung Julien Watrin, Jonathan Borlée, Dylan Borlée und Kevin Borlée sowie dem im Vorlauf außerdem eingesetzten Robin Vanderbemden. Den zweiten Platz belegte Polen mit Łukasz Krawczuk, Kacper Kozłowski, Jakub Krzewina und Rafał Omelko sowie dem im Vorlauf außerdem eingesetzten Michał Pietrzak. Bronze ging an Großbritannien in der Besetzung Rabah Yousif, Delano Williams, Jack Green und Matthew Hudson-Smith sowie den im Vorlauf außerdem eingesetzten Nigel Levine und Jarryd Dunn.\\nAuch die nur im Vorlauf eingesetzten Läufer erhielten entsprechendes Edelmetall."},{"page_url":"https://nl.wikipedia.org/wiki/Beleg_van_Maastricht_(1676)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Foto_van_tekening_van_de_ru%C3%AFne_Lichtenberg_en_het_klooster_Slavante_-_Sint_Pieter_-_20328989_-_RCE.jpg","page_title":"Beleg van Maastricht (1676)","context_page_description":"Het Beleg van Maastricht van 1676 was een mislukte poging van Willem III van Oranje om de sinds 1673 door de Fransen bezette vestingstad Maastricht te ontzetten. Het beleg vond plaats tijdens de Hollandse Oorlog van 6 juli tot 27 augustus 1676."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B4%D8%B1%D9%88%D8%B7_%D9%88%D9%8A%D9%84%D8%B3%D9%88%D9%86_%D9%84%D9%84%D8%A5%D9%86%D8%B3%D8%A7%D9%86_%D8%A7%D9%84%D9%85%D8%AA%D8%AD%D8%B6%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Thomas_Woodrow_Wilson%2C_Harris_%26_Ewing_bw_photo_portrait%2C_1919.jpg","page_title":"شروط ويلسون للإنسان المتحضر","context_page_description":"شروط ويلسون للانسان المتحضر هى اربع شروط حددها توماس وودرو ويلسون Thomas Woodrow Wilson رئيس الولايات المتحده الامريكيه الثامن و العشرين للانسان المتحضر او المستنير او المثقف. الرئيس ويلسون بيعتبر أكتر مثقف و متعلم من بين كل رؤسا امريكا، و كان زعيم الحركه التقدميه Progressive Movement، و كان من أكبر انصار الديموقراطيه فى العالم، و هو الرئيس الامريكى الوحيد اللى حصل على شهادة الدكتوراة و اخدها فى التاريخ والعلوم السياسيه من جامعة جونس هوبكينز Johns Hopkins University وأصبح رئيس لجامعة برينستون Princeton University من سنة 1902 لسنة 1924. الرئيس ويلسون ايضاً هو صاحب فكرة تأسيس عصبة الأمم و صاحب المبادئ او النقط الاربعة عشر التى من ضمنها حق الشعوب فى الإستقلال و تحديد مصيرها بنفسها و هى نقط قدمها فى مؤتمر الصلح فى فرنسا سنة 1919 بعد الحرب العالميه الأولى و كان اول رئيس أمريكى يسافر خارج امريكا و هو رئيس، و حصل على جايزة نوبل للسلام سنة 1919.\\nالرئيس ويلسون حدد اربع نقط رئيسيه لازم يتحلى بيها الانسان المتحضر او المستنير و هى:\\nأنه يعرف تاريخ العالم منذ بداية الكون و نشأة الحضارات الى الان.\\nأنه يعرف تاريخ الافكار السائده التي يتماشى عصرنا على مبادئها.\\nأنه يعرف علم من العلوم بمعنى علم Science فى اللغات الأوروبيه.\\nأنه يعرف لغه كويس، ومن الافضل ان تكون اللغة اللغة الام التي نشأ عليها."},{"page_url":"https://es.wikipedia.org/wiki/Banderilla_(tauromaquia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Suerte_de_banderillas.jpg","page_title":"Banderilla (tauromaquia)","context_page_description":"En la tauromaquia, la banderilla es un palo delgado, de unos 70 a 78 centímetros de largo, recubierto y adornado con papel picado arpón, empleado en la lidia avivar al toro.\\nLas banderillas reciben también el nombre coloquial de avivadores o alegradores, porque sirven para reanimar y excitar al toro sin quitarle fuerzas. Antiguamente se clavaban de una en una y no pareadas, como se hace hoy día. Pepe-Hillo ya menciona a fines de siglo XVIII que se consideraba de gran mérito clavarlas a pares, no habiendo variado apenas su técnica desde entonces.\\nNormalmente, son los subalternos quienes realizan este cometido, llamados por ello banderilleros, si bien excepcionalmente puede realizarlo el espada, para lucirse al son de la música o cuando es especialmente diestro en esta suerte. Los banderilleros desempeñan una función muy meritoria ya que logran, a cuerpo limpio, recortar al toro para poder poner el par de la manera más arriesgada posible."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A7%92%E5%B7%9D%E6%9B%B8%E5%BA%97","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Kadokawa_Shoten_%28head_office%29.jpg","page_title":"角川書店","context_page_description":"角川書店是日本著名的出版社之一，總部位於東京千代田區。現是角川集團旗下的事業品牌。"},{"page_url":"https://ca.wikipedia.org/wiki/Expansi%C3%B3_de_l%27antiga_Confederaci%C3%B3_Su%C3%AFssa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/1550_illustration_for_the_1393_Sempacherbrief.jpeg","page_title":"Expansió de l'antiga Confederació Suïssa","context_page_description":"L'expansió de l'antiga Confederació Suïssa és el període de la història de Suïssa que abasta aproximadament des de la creació de les primeres aliances entre regions, a 1291, fins a l'entrada de la Reforma Protestant en la ja madura Antiga Confederació Suïssa, el 1516. Aquesta època es va caracteritzar en els territoris alpins per l'establiment d'aliances, en un principi febles, entre un nombre creixent de regions i el seu progressiu enfortiment fins a formar un estat independent de la resta de les potències.\\nVa començar com una aliança entre les comunitats de les valls dels Alps centrals per facilitar la satisfacció dels interessos comuns com el lliure comerç i per assegurar la pau al llarg de les importants rutes comercials a través de les muntanyes. A finals de l'edat mitjana, aquesta regió pertanyia al Sacre Imperi Romanogermànic i, a causa de la seva importància estratègica, els emperadors Hohenstaufen li havien garantit la condició de reichsfrei a principis del segle xiii."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%AC%E9%9E%8D%E5%B1%B1%E7%AB%99_(%E9%A6%99%E6%B8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Ma_On_Shan_Station_2020_07_part3.jpg","page_title":"馬鞍山站 (香港)","context_page_description":"馬鞍山站為香港的港鐵屯馬綫的一個架空車站，位於沙田區馬鞍山新港城中心與馬鞍山廣場之間一段西沙路地面及架空路段，也是港鐵系統中所有出入口都是連接商場的車站之一。"},{"page_url":"https://en.wikipedia.org/wiki/BR_Standard_Class_7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/70015_Apollo_Lostock_Hall_MPD.jpg","page_title":"BR Standard Class 7","context_page_description":"The BR Standard Class 7, otherwise known as the Britannia Class, is a class of 4-6-2 Pacific steam locomotive designed under Robert Riddles for use by British Railways for mixed traffic duties. 55 were constructed between 1951 and 1954. The design employed results from the 1948 locomotive exchanges undertaken in advance of further locomotive classes being constructed. Three batches were constructed at Crewe Works, before the publication of the 1955 Modernisation Plan.\\nThe Britannia Class design was based on best practice from the pre-nationalisation railway companies in terms of operating efficiency and lower maintenance costs; various weight-saving measures also increased the route availability of a Pacific-type locomotive on the British Railways network. The Britannias received a positive reception from their crews, with those regularly operating the locomotives giving them favourable reports as regards performance. However, operation in some areas of the British Railway network returned negative feedback, primarily due to indifferent operation of the locomotive, with its effects on adhering to timetables."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%A4%9A%E8%81%9E%E5%A4%A9%E7%8E%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/%E5%8C%97%E4%BA%AC%E5%8D%81%E6%96%B9%E6%99%AE%E8%A7%89%E5%AF%BA_%E5%A4%9A%E9%97%BB%E5%A4%A9.JPG","page_title":"多聞天王","context_page_description":"多闻天王，是佛教的护法，“四大天王”之一、“二十诸天”中的第三天王。“多闻”意为常闻佛法、精通佛法，以福、德闻于四方。住须弥山黄金埵，身为绿色，穿甲胄，负责守护北俱卢洲。多闻天王为夜叉王，以夜叉、罗刹等为部众眷属。在印度神话中是北方守护神、知识之神、财神，也是一个很重要的武神，在日本大多写成“毘沙門天”。"},{"page_url":"https://de.wikipedia.org/wiki/UC_97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/German_Submarine%2C_Toronto%2C_from_an_Aeroplane_%28HS85-10-35727%29.jpg","page_title":"UC 97","context_page_description":"SM UC 97 war ein Untersee-Minenleger der Klasse UC III der kaiserlichen deutschen Marine."},{"page_url":"https://sq.wikipedia.org/wiki/Historia_e_Murit_t%C3%AB_Madh_Kinez","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/GreatWallChina2.png","page_title":"Historia e Murit të Madh Kinez","context_page_description":"Historia e Murit të Madh Kinez fillon kur fortifikimet e ndërtuara nga shtetet e ndryshme të lashta kineze gjatë periudhës së Pranverës dhe Vjeshtës dhe Periudhës së Shteteve Ndërluftuese ishin të lidhur nga perandori i parë i Kinës, Qin Shi Huang, për të mbrojtur Dinastinë e tij të sapo-formuar kurndër inkursionte nga nomadët euroaziatikë. Muret ishin ndërtuar prej dheu të ngjeshur, duke përdorur punën e detyruar dhe rreth vitit 212 p.e.s. shtrihej nga Gansu deri në bregdetin jugor të Mançurisë.\\nDinastitë e mëvonshme adoptuan politika të ndryshme kundrejt mbrojtjes së kufirit verior. Dinastia Han, Dinastia Veriore Qi, Dinastia Sui dhe veçanërisht Dinastia Ming ishin midis aty që e rindërtuan, përforcuan dhe i zgjeruan muret, megjithëse ata i ndoqën rrallë rrugët Qin. Hanët i shtrinë fortifikimet më tej në perëndim, Qi-të ndërtuan rreth 1,600 km. muresh të reja, ndërsa Sui-t mobilizuan mbi një milion njerëz në përpjekjet e tyre mur-ndërtuese. Anasjelltas, Dinastia Tang, Dinastia Song, Dinastia Yuan dhe Dinastia Qing më së shumti nuk ndërtuan mure kufiri, duke zgjedhur zgjidhje për kërcënimin nga Azia e Brendshme si fushatat ushtarake dhe diplomacia."},{"page_url":"https://en.wikipedia.org/wiki/Alexander_Nevsky_Cathedral,_Allison_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Saint_Alexander_Nevsky_Orthodox_Cathedral_-_Pittsburgh_01.jpg","page_title":"Alexander Nevsky Cathedral, Allison Park","context_page_description":"Saint Alexander Nevsky Cathedral is a parish of the Diocese of Western Pennsylvania of the Orthodox Church in America. It was founded in the Woods Run section of Pittsburgh's North Side in 1891. It was the first Russian Orthodox community in the Pittsburgh area.\\nThe first pastor of Saint Alexander Nevsky parish was Fr. Victor Toth, brother of St. Alexis Toth, who was canonized by the Orthodox Church in America in 1994.\\nWhen the Urban Redevelopment Authority of Pittsburgh took over the Woods Run area in the late 1960s, the parish relocated to Allison Park, in Pittsburgh's North Hills. The new Church edifice was designed by architect Sergey Padyukov and was consecrated in 1972 by Bishop Theodosius. The iconostasis, designed by parishioner Vladimir Drobashevsky, and adorned with major icons and feast day icons, was constructed in 1978. The second phase of beautification took place in 1984, and the final phase took place in 1996. Fr. Alexander Jasiukowicz of Chicago and Florida was the icon painter for the church. The Saint Alexander Nevsky icon located on the confessional table contains relics of Saint Alexander inside."},{"page_url":"https://es.wikipedia.org/wiki/Gobierno_de_la_Federaci%C3%B3n_de_Rusia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Olga_Vasilyeva_govru.png","page_title":"Gobierno de la Federación de Rusia","context_page_description":"El Gobierno de la Federación de Rusia o Gobierno federal ruso es el órgano político que en este país tiene encomendado por la Constitución el poder ejecutivo federal; sin embargo, la realidad de la arquitectura institucional rusa hace que, de hecho, esta potestad sea ejercida de forma compartida por el Gobierno con el Presidente de la Federación, resultando así una estructura bicéfala del poder ejecutivo.\\nEl Gobierno de la Federación está integrado por el Presidente del Gobierno, nombrado por el Presidente del país previa aprobación de la Duma del Estado, más los vicepresidentes y los ministros federales, nombrados todos estos por el Presidente de la Federación a propuesta del Presidente del Gobierno."},{"page_url":"https://war.wikipedia.org/wiki/Basilichthys_microlepidotus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Basilichthys_microlepidotus.jpg","page_title":"Basilichthys microlepidotus","context_page_description":"An Basilichthys microlepidotus in uska species han Actinopterygii nga syahan ginhulagway ni Leonard Jenyns hadton 1841. An Basilichthys microlepidotus in nahilalakip ha genus nga Basilichthys, ngan familia nga Atherinopsidae. Ginklasipika han IUCN an species komo kulang hin datos. Waray hini subspecies nga nakalista."},{"page_url":"https://en.wikipedia.org/wiki/Scooter_(motorcycle)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Troll001.jpg","page_title":"Scooter (motorcycle)","context_page_description":"A scooter or motor scooter is a type of motorcycle with a step-through frame and a platform for the rider's feet. Elements of scooter design were present in some of the earliest motorcycles, and scooters have been made since at least 1914. Scooter development continued in Europe and the United States between the World Wars.\\nThe global popularity of motor scooters dates from the post-World War II introductions of the Vespa and Lambretta models in Italy. These scooters were intended to provide economical personal transportation. The original layout is still widely used in this application. Maxi-scooters, with larger engines from 250 to 850 cc have been developed for Western markets.\\nScooters are popular for personal transportation partly due to being more affordable, easier to operate, and more convenient to park and store than a car. Licensing requirements for scooters are easier and cheaper than for cars in most parts of the world, and insurance is usually cheaper. The term motor scooter is sometimes used to avoid confusion with kick scooter, but can then be confused with motorized scooters, another distinct kind of scooter."},{"page_url":"https://id.wikipedia.org/wiki/Stadion_%C4%B0zmir_Alsancak","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Alsancak_Stadyumu_%282%29.JPG","page_title":"Stadion İzmir Alsancak","context_page_description":"Stadion Altay Alsancak, adalah sebuah stadion multifungsi di İzmir, Turki. Saat ini sebagian besar digunakan untuk pertandingan sepak bola. Stadion ini memiliki kapasitas 15.358 dan dibangun pada tahun 1929. Stadion ini sebagian dimiliki oleh Altay SK."},{"page_url":"https://fr.wikipedia.org/wiki/Robert_Marcy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Robert_Marcy_sur_sc%C3%A8ne_%C3%A0_Paris_en_novembre_2019.jpg","page_title":"Robert Marcy","context_page_description":"Robert Marx, dit Robert Marcy est un acteur et metteur en scène français, né le 4 juillet 1920 à Paris. Il est également parolier et compositeur de chansons."},{"page_url":"https://af.wikipedia.org/wiki/Kaukasus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Caucasus-political_nl.svg","page_title":"Kaukasus","context_page_description":"Die Kaukasus-bergreeks tussen die Swart- en Kaspiese See vorm een van die geografiese grense tussen Europa en Asië. Dit word verdeel in die Groter Kaukasus in die noorde en die Kleiner Kaukasus in die suide, wat deur die Koeravallei van mekaar geskei word. Die Kleiner Kaukasus word in die suide deur die Araksrivier begrens.\\nDie pieke in sy vergletserde sentrale gedeelte verrys tot 'n hoogte van meer as 5 000 meter, waaronder twee uitgedoofde vulkane, Elbrus en Kasbek. Die risiko van seismiese aktiwiteit is steeds hoog in die gebied.\\nDie Kaukasus-bergreeks strek oor 'n afstand van 1 100 kilometer en oor vier lande, die Russiese Federasie in die noorde, Georgië in die weste, en Armenië en Azerbeidjan in die suide. Die hoogste bergrug vorm grotendeels ook die grenslyn tussen Rusland en Georgië en Azerbeidjan, terwyl die kleiner bergrug Georgië van Turkye en Armenië skei.\\nIn klimatiese opsig vorm die Kaukasus 'n oorgangsgebied tussen die gematigde en subtropiese sone wat onder die invloed van die oseaniese Middellandse Seegebied en die uitgestrekte Siberiese vlaktes met hul kontinentale klimaat staan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%B0%D1%8F_%D1%81%D0%B5%D1%82%D1%8C_%D0%B1%D0%B8%D0%BE%D1%81%D1%84%D0%B5%D1%80%D0%BD%D1%8B%D1%85_%D1%80%D0%B5%D0%B7%D0%B5%D1%80%D0%B2%D0%B0%D1%82%D0%BE%D0%B2_%D0%B2_%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Pendjari.JPG","page_title":"Всемирная сеть биосферных резерватов в Африке","context_page_description":"Всемирная сеть биосферных резерватов в Африке — африканское подразделение Всемирной сети биосферных резерватов, созданной по программе ЮНЕСКО «Человек и биосфера». Часть резерватов в странах Африки входит во региональную сеть Лиги арабских государств. Африканская сеть была создана на региональной конференции по кооперации биосферных резерватов в области сохранения биоразнообразия и устойчивого развития, которая проходила в 1996 году в Дакаре, Сенегал. Последняя встреча в рамках сети прошла в Аккре, Гана, с 24 по 27 сентября 2013 года. Для увеличения эффективности работы региональной сети было создано четыре тематических подпроекта по зонированию и улучшению функционирования биосферных резерватов, по связи биосферных заповедников с местными администрациями, включая социальное и финансовое взаимодействие, по созданию трансграничных международных биосферных заповедников, по логистической поддержке функционирования заповедников.\\nБиосферные резерваты — особо охраняемые природные территории, призванные демонстрировать сбалансированное взаимодействие природы и человека, концепцию устойчивого развития окружающей среды."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%8B%B1%E6%A0%BC%E8%98%AD%E8%B6%B3%E7%90%83%E4%BF%B1%E6%A8%82%E9%83%A8%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/600px_Blu_con_Bande_Gialle2.png","page_title":"英格蘭足球俱樂部列表","context_page_description":"英格兰足球俱乐部列表会列出位于现时有参加英格兰足球联赛系统所属职业联赛的足球俱乐部，以下列表分别按俱乐部所地地区及所属联赛级别排列。"},{"page_url":"https://fr.wikipedia.org/wiki/D%C3%A9p%C3%B4t_de_La_Chapelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/3_Locomotives_SNCF.jpg","page_title":"Dépôt de La Chapelle","context_page_description":"Le dépôt de La Chapelle est un dépôt de locomotives créé par la Compagnie des chemins de fer du Nord en 1845 près de la gare de Paris-Nord, à l'angle de la rue des Poissonniers et de la rue Ordener sur la commune de La Chapelle.\\nÀ partir de 1937, il subit diverses modifications. Il est victime du bombardement du 21 avril 1944, et voit détruite une grande partie de ses emprises, à la fin des années 1960. Sa fermeture est intervenue le 25 janvier 2013."},{"page_url":"https://cs.wikipedia.org/wiki/Bnej_Dror","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/PikiWiki_Israel_9229_Moshav_Bnei_Dror.jpg","page_title":"Bnej Dror","context_page_description":"Bnej Dror je vesnice typu mošav v Izraeli, v Centrálním distriktu, v Oblastní radě Lev ha-Šaron."},{"page_url":"https://af.wikipedia.org/wiki/Capri","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Overlooking_Capri_harbour_from_the_rotunda_in_Villa_San_Michele_Anacapri_BW_2013-05-14_13-55-21.jpg","page_title":"Capri","context_page_description":"Capri is ’n rotseiland en gewilde vakansiebestemming naby die stad Napels in die suide van Italië. Capri is - as een van drie eilande in die Golf van Napels - in die Italiaanse provinsie Kampanië geleë en beslaan 'n oppervlakte van 10,4 km². Die eiland bestaan uit kalksteen en is bergagtig met steil kranse, maar het ook plat stukke. Die hoogste punt is Monte Solaro. Daar is twee dorpe: Capri en Anacapri.\\nIn die somer word die eiland druk deur beide Italiaanse en buitelandse toeriste besoek. Die eiland het twaalf kerke en sewe museums, maar die bekendste aantreklikheid is die Blou Grot. Talle feeste word jaarliks aangebied, waaronder 'n internasionale filmfees.\\n'n Aantal geregte is na die eiland genoem, onder andere:\\nInsalata caprese\\nPizza Caprese\\nTorta Caprese"},{"page_url":"https://es.wikipedia.org/wiki/Severodvinsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/%D0%9C%D1%8D%D1%80%D0%B8%D1%8F_%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BE%D0%B4%D0%B2%D0%B8%D0%BD%D1%81%D0%BA%D0%B0._%D0%A4%D0%BE%D1%82%D0%BE_%D0%90._%D0%A9%D0%B5%D0%BA%D0%B8%D0%BD%D0%BE%D0%B2%D0%B0.jpg","page_title":"Severodvinsk","context_page_description":"Severodvinsk es una ciudad de Rusia perteneciente al óblast de Arcángel. Está situada en el delta del Dvina Septentrional, 35 kilómetros al oeste de Arcángel.\\nFundada en 1936, la ciudad en primer lugar se llamó Sudostroi, y posteriormente Molotovsk. Severodvinsk tenía una población de 193.200 habitantes en el año 2007."},{"page_url":"https://es.wikipedia.org/wiki/Hormicedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Iglesia-santos-julita-y-quirico-hormicedo-6-julio-2014-3.jpg","page_title":"Hormicedo","context_page_description":"Hormicedo es un despoblado situado en la provincia de Burgos, comunidad autónoma de Castilla y León, comarca Odra Pisuerga, ayuntamiento de Villadiego."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D9%83%D8%B3_%DA%A4%D8%A7%D9%84%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Max_Valles.jpg","page_title":"ماكس ڤاليس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nماكس ڤاليس لاعب كورة القدم الامريكيه من امريكا."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B7%D0%B4%D1%96%D0%BB%D1%8C%D0%BD%D1%8F%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/%D0%9A%D0%BE%D0%BB%D0%B8%D1%88%D0%BD%D1%8F_%D0%9E%D0%B4%D0%B5%D1%81%D1%8C%D0%BA%D0%B0_%D0%B3%D1%83%D0%B1%D0%B5%D1%80%D0%BD%D1%96%D1%8F_1927.jpg","page_title":"Роздільнянський район","context_page_description":"Роздільня́нський райо́н — адміністративна одиниця у центральній частині Одеської області. Адміністративний центр — місто Роздільна.\\nУ рамках адміністративно-територіальної реформи 17 липня 2020 року район був укрупнений, до складу ввійшли території Великомихайлівської селищної, Великоплосківської сільської, Затишанської селищної, Захарівської селищної, Лиманської селищної, Новоборисівської сільської, Роздільнянської міської, Степанівської сільської, Цебриківської селищної територіальних громад. Населення 104 163 особи."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%91%D0%B0%D1%80%D1%80-%D0%B4%D0%B5-%D0%A1%D0%B5%D0%BC%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/%C3%89glise_Saint-%C3%89bremond_de_La_Barre-de-Semilly_%286%29.jpg","page_title":"Ла-Барр-де-Семии","context_page_description":"Ла-Барр-де-Семии — Францин гӀала-коммуна, лаьтта Норманди регионехь. Коммунан департамент — Манш. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://en.wikipedia.org/wiki/Troilus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/The_Death_of_Troilus_Achilles_Paris.jpg","page_title":"Troilus","context_page_description":"Troilus is a legendary character associated with the story of the Trojan War. The first surviving reference to him is in Homer's Iliad, which some scholars theorize was composed by bards and sung in the late 9th or 8th century BC.\\nIn Greek mythology, Troilus is a young Trojan prince, one of the sons of King Priam and Hecuba. Prophecies link Troilus' fate to that of Troy and so he is ambushed and murdered by Achilles. Sophocles was one of the writers to tell this tale. It was also a popular theme among artists of the time. Ancient writers treated Troilus as the epitome of a dead child mourned by his parents. He was also regarded as a paragon of youthful male beauty.\\nIn Western European medieval and Renaissance versions of the legend, Troilus is the youngest of Priam's five legitimate sons by Hecuba. Despite his youth he is one of the main Trojan war leaders. He dies in battle at Achilles' hands. In a popular addition to the story, originating in the 12th century, Troilus falls in love with Cressida, whose father Calchas has defected to the Greeks."},{"page_url":"https://it.wikipedia.org/wiki/Sturnira_aratathomasi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Distribution_of_Sturnira_aratathomasi.png","page_title":"Sturnira aratathomasi","context_page_description":"Sturnira aratathomasi è un pipistrello della famiglia dei Fillostomidi diffuso nell'America meridionale."},{"page_url":"https://sv.wikipedia.org/wiki/Buddleja_delavayi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Buddleja_delavayii%2C_Longstock.jpg","page_title":"Buddleja delavayi","context_page_description":"Buddleja delavayi är en flenörtsväxtart som beskrevs av François Gagnepain. Buddleja delavayi ingår i släktet buddlejor, och familjen flenörtsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://la.wikipedia.org/wiki/Silva_Brutia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Panorama_dal_Monte_Curcio_verso_il_Cozzo_del_Principe._Sila_Grande.jpg","page_title":"Silva Brutia","context_page_description":"Silva Brutia seu Sila est alta planities ac globus montaneus Italiae australis."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E3%81%AE%E3%82%A8%E3%83%8D%E3%83%AB%E3%82%AE%E3%83%BC%E8%B3%87%E6%BA%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Power_Grid_of_Japan.svg","page_title":"日本のエネルギー資源","context_page_description":"日本のエネルギー資源では、日本におけるエネルギー資源の産出と利用、関係する諸問題について述べる。2015年の日本の一次エネルギー消費量は429.79 Mtoeで、前年比9%減であった。また世界合計に占める割合は3.9%で、アメリカ、中国、ロシア、インドに次いで5番目に多く、日本に次いで多いのはカナダである。\\n化石燃料の埋蔵量は石炭を除いて非常に乏しく、原油、天然ガス、ウランをはじめとしたエネルギー資源を大量に輸入することで需要を満たしている状況にある。2010年の統計では、国内エネルギー需要の42%は輸入原油に依存しており、世界輸出入総量の14.2%にあたる189Mtの石炭を輸入、また世界輸出入総量の31.3%にあたる1084億m³の天然ガスを輸入している。\\nなお、2010年頃は国内電力需要の4分の1を原子力発電としていたが、2011年の福島第一原子力発電所事故に伴う安全性危機によって原子力発電所稼働率が低下、2012年5月5日までにすべて停止した。2015年8月11日、川内原子力発電所1号機が福島第一原子力発電所事故後に制定された新規制基準での稼働を全国で初めて再開した。原発の再稼働の是非や、再生可能エネルギーの普及促進とともに、将来のエネルギー源構成が議論喚起されている。"},{"page_url":"https://it.wikipedia.org/wiki/Tommaso_da_Vico","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Verona-Busto_di_Tommaso_da_Vico.JPG","page_title":"Tommaso da Vico","context_page_description":"Tommaso da Vico è stato un medico italiano."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A2%85%E5%A4%AB%E4%BA%BA%E5%A9%A6%E5%A5%B3%E6%9C%83%E4%B8%BB%E6%A8%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/HK_TheHelenaMay_FrontEntrance.jpg","page_title":"梅夫人婦女會主樓","context_page_description":"梅夫人婦女會主樓位於香港中環花園道35號。梅夫人婦女會是香港首間為歐籍婦女而設立的宿舍會所。建築物主樓於1993年10月被政府列為法定古蹟。香港女童軍的首個總部亦在此設立。"},{"page_url":"https://id.wikipedia.org/wiki/Hari_Lingkungan_Hidup","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Stamps_of_Indonesia%2C_033-09.jpg","page_title":"Hari Lingkungan Hidup","context_page_description":"Hari Lingkungan Hidup Sedunia diperingati setiap tahun pada tanggal 5 Juni demi meningkatkan kesadaran global akan kebutuhan untuk mengambil tindakan lingkungan yang positif bagi perlindungan alam dan planet Bumi.\\nHari Lingkungan Hidup Sedunia merupakan instrumen penting yang digunakan Perserikatan Bangsa-Bangsa untuk meningkatkan kesadaran tentang lingkungan serta mendorong perhatian dan tindakan politik di tingkat dunia. Hari peringatan ini dipandang sebagai kesempatan bagi semua orang untuk menjadi bagian aksi global dalam menyuarakan proteksi terhadap planet bumi, pemanfaatan sumber daya alam yang berkelanjutan, dan gaya hidup yang ramah lingkungan."},{"page_url":"https://hu.wikipedia.org/wiki/Szomsz%C3%A9dv%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Utvrda_Susedgrad04.JPG","page_title":"Szomszédvár","context_page_description":"Szomszédvár, várrom Horvátországban, a Zágrábhoz tartozó Podsused határában."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%80%B2%E8%97%A4%E9%81%94%E5%93%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/20140713_Tatsuya_Shindou%2Ccoach_of_the_Yokohama_DeNA_BayStars%2C_at_Meiji_Jingu_Stadium.JPG","page_title":"進藤達哉","context_page_description":"進藤 達哉は、富山県高岡市出身の元プロ野球選手。2014年から2016年まで横浜DeNAベイスターズ一軍打撃コーチ兼作戦担当、一軍ヘッドコーチを歴任した。"},{"page_url":"https://en.wikipedia.org/wiki/1901_Michigan_Wolverines_football_team","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Willie_Heston_%28bentley_image%29.jpg","page_title":"1901 Michigan Wolverines football team","context_page_description":"The 1901 Michigan Wolverines football team was an American football team that represented the University of Michigan in the Western Conference during the 1901 Western Conference football season. In their first year under head coach Fielding H. Yost, the team compiled a perfect 11–0 record, outscored its opponents by a combined total of 550 to 0, tied with Wisconsin for the Western Conference championship, and defeated Stanford by a 49 to 0 score in the inaugural Rose Bowl game, the first college bowl game ever played. Northwestern had the best record of a Michigan opponent. The 1901 team was the first of Yost's famed \\"Point-a-Minute\\" teams, so named for their high scoring offense. From 1901 to 1905, Yost's Michigan teams compiled a record of 55–1–1 and outscored their opponents by a combined score of 2,821 to 42.\\nAlthough no system was in place during this era to determine a national champion, the NCAA recognizes as \\"major\\" certain selectors who have sought to establish national championships retrospectively."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D8%AA%D8%A7%D9%85%D9%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/France_Essonne_Etampes_Eglise_Notre-Dame-du-Fort_03.jpg","page_title":"اتامپ","context_page_description":"اتامپ، فرانسه‌ده یئر آلان بیر کومون دیر و متر دنیز سویه‌سیندن اۇجالیقی وار. ۴۰٫۹۲ کیلومتر موربّع ساحه‌سی وار. بۇ شهرین نۆفوسو، ۲۰۱۴-نجی ایلين نۆفوس ساییمی اساسيندا ۲۲۶۷۹ نفر ایمیش."},{"page_url":"https://uk.wikipedia.org/wiki/25_%D1%82%D1%80%D0%B0%D0%B2%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Kremin_2.jpg","page_title":"25 травня","context_page_description":"25 травня — 145-й день року в григоріанському календарі. До кінця року залишається 220 днів."},{"page_url":"https://war.wikipedia.org/wiki/Leucadendron_argenteum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Leucadendron_argenteum_-_Silvertree_Forest_-_Cape_Town_1.JPG","page_title":"Leucadendron argenteum","context_page_description":"An Leucadendron argenteum in uska species han Magnoliopsida nga syahan ginhulagway ni Carl von Linné, ngan ginhatag han pagkayana nga asya nga ngaran ni Robert Brown. An Leucadendron argenteum in nahilalakip ha genus nga Leucadendron, ngan familia nga Proteaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://pl.wikipedia.org/wiki/30_Pu%C5%82k_Piechoty_Obrony_Krajowej","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Hohenmaut_Infanterie-Kaserne.PNG","page_title":"30 Pułk Piechoty Obrony Krajowej","context_page_description":"30 Pułk Piechoty Obrony Krajowej Vysoké Mýto – pułk piechoty cesarsko-królewskiej Obrony Krajowej."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_national_birds","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Regulus_regulus0.jpg","page_title":"List of national birds","context_page_description":"The National bird is a bird that is chosen by a country as a symbol or emblem for that country.\\nThis is a list of national birds, most official, but some unofficial."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Altpreu%C3%9Fische_Landschaften_im_13._Jahrhundert.png","page_title":"Сассовия","context_page_description":"Сассовия — одна из земель Пруссии, где проживало балтское прусское племя сассов. Сассовия находилась между прусскими землями Галиндия, Любавия, на севере граничила с Погезанией, Вармией и Бартией, а на юге — с польской Мазовией."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%99%E1%83%A0%E1%83%98%E1%83%A1%E1%83%98%E1%83%A3%E1%83%9B%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Criciumasc1.png","page_title":"კრისიუმა","context_page_description":"კრისიუმა — მუნიციპალიტეტი ბრაზილიაში, სანტა-კატარინას შტატში; მდებარეობს ზღვის დონიდან 46 მეტრზე. მიეკუთვნება სანტა-კატარინას შტატის სამხრეთ მეზორეგიონს. შედის ეკონომიკურ-სტატისტიკურ მიკრორეგიონ კრისიუმის შემადგენლობაში.\\n2010 წლის მონაცემებით, მოსახლეობა 192 308 ადამიანს შეადგენდა, მოსახლეობის სიმჭიდროვე 815.9 კმ²-ზე. ფართობი 235 701 კმ²-ია."},{"page_url":"https://an.wikipedia.org/wiki/Fernando_Buesa_Arena","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Vitoria_-_Buesa_Arena_01.jpg","page_title":"Fernando Buesa Arena","context_page_description":"O Fernando Buesa Arena, conoixito popularment como Buesa Arena, y d'antis mas como Pabillón Araba ye un pavillón de baloncesto d'a ciudat vasca de Vitoria. Fue inaugurato en 1991 y actualment ye a seu d'o Saski Baskonia que chuga en a Liga ACB."},{"page_url":"https://hu.wikipedia.org/wiki/Jacques_Cassini","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Signature_Cassini_II.jpg","page_title":"Jacques Cassini","context_page_description":"Jacques Cassini francia csillagász, a híres olasz csillagász, Giovanni Domenico Cassini fia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B7%D0%BD%D0%B5%D1%81%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80_(%D0%9D%D0%B0%D0%B1%D0%B5%D1%80%D0%B5%D0%B6%D0%BD%D1%8B%D0%B5_%D0%A7%D0%B5%D0%BB%D0%BD%D1%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE%D0%B3%D0%BB%D0%B0%D0%B2%D1%8B%D0%B5_%D0%BA%D1%83%D0%BF%D0%BE%D0%BB%D0%B0_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE-%D0%B2%D0%BE%D0%B7%D0%BD%D0%B5%D1%81%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%81%D0%BE%D0%B1%D0%BE%D1%80%D0%B0.jpg","page_title":"Вознесенский собор (Набережные Челны)","context_page_description":"Свя́то-Вознесе́нский собо́р г. На́бережные Челны́ — приходский храм Московского Патриархата Казанской епархии, освящённый в честь праздника Вознесения Господня, имеет статус архиерейского подворья. Настоятелем храма является митрополит Феофан, Казанский и Татарстанский. Здание построено в стиле «эклектики».\\nАдрес: Республика Татарстан, г. Набережные Челны, проспект Чулман, 127"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B4%97%E6%BE%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/KidsBathingInASmallMetalTub.jpg","page_title":"洗澡","context_page_description":"洗澡，又名沐浴，是个人卫生活动，但是也可能在社交场合，例如公众浴室、桑拿浴等。\\n沐浴有分洗身和泡澡，前者用水与沐浴乳清洁身体；后者的主要目的并非洗身，而是浸泡身体。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_F4U_Corsair_restants","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/F4U_Corsair.jpg","page_title":"Liste des F4U Corsair restants","context_page_description":"La liste des F4U Corsair existants recense tous les Corsair en état de vol, en restauration, ou en présentation au sol."},{"page_url":"https://en.wikipedia.org/wiki/Pax_Romana","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Impero_romano_sotto_Ottaviano_Augusto_30aC_-_6dC.jpg","page_title":"Pax Romana","context_page_description":"The Pax Romana is a roughly 200-year-long period in Roman history which is identified with increased and sustained inner hegemonial peace and stability. It is traditionally dated as commencing from the accession of Caesar Augustus, founder of the Roman principate, in 27 BC and concluding in 180 AD with the death of Marcus Aurelius, the last of the \\"good emperors\\". Since it was inaugurated by Augustus with the end of the Final War of the Roman Republic, it is sometimes called the Pax Augusta. During this period of approximately two centuries, the Roman Empire achieved its greatest territorial extent and its population reached a maximum of up to 70 million people. According to Cassius Dio, the dictatorial reign of Commodus, later followed by the Year of the Five Emperors and the crisis of the third century, marked the descent \\"from a kingdom of gold to one of iron and rust\\"."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Pers%C3%B6nlichkeiten_der_Stadt_Neapel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Enrico_Caruso_tenor.jpg","page_title":"Liste von Persönlichkeiten der Stadt Neapel","context_page_description":"Diese Liste enthält in Neapel geborene Persönlichkeiten sowie solche, die in Neapel gewirkt haben, dabei jedoch andernorts geboren wurden. Die Liste versammelt Personen mit einem Artikel in der deutschsprachigen Wikipedia und erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BC%D0%B1%D0%B8%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D0%BF%D0%BE%D1%80%D1%82%D1%80%D0%B5%D1%82%D1%8B_%D0%95%D0%BC%D0%B5%D0%BB%D1%8C%D1%8F%D0%BD%D0%B0_%D0%9F%D1%83%D0%B3%D0%B0%D1%87%D1%91%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Pugachev_b.jpg","page_title":"Симбирские портреты Емельяна Пугачёва","context_page_description":"Симбирские портреты Емельяна Пугачёва — подлинные прижизненные изображения предводителя Крестьянской войны 1773—1775 годов, выполненные неизвестным художником в городе Симбирске после военного поражения восставших и пленения Пугачёва.\\nПленённый Пугачёв находился в Симбирске в период с 1-го по 28 октября 1774 года. Во время его нахождения в городе по приказу командующего войсками графа П. И. Панина для императрицы Екатерины II был изготовлен портрет Пугачёва. Очевидцами, а также пленными сообщниками Пугачёва изображение было признано точным и достоверным. Впоследствии многим участникам следствия и охранения самозванца, а также жителям Симбирска захотелось иметь свой экземпляр портрета самозванца. Художник, чьё имя не сохранилось в документах, изготовил несколько копий первого портрета масляными красками, а также несколько рисунков тушью по заказу оренбургского учёного и историографа пугачёвского восстания П. И. Рычкова. На симбирских портретах Пугачёва были основаны большинство позднейших его изображений."},{"page_url":"https://en.wikipedia.org/wiki/Mount_Huxley_(Alaska)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Icy_Bay%2C_Tyndall_Glacier%2C_and_Mount_St._Elias_%2821426102339%29.jpg","page_title":"Mount Huxley (Alaska)","context_page_description":"Mount Huxley is a 12,216-foot glaciated mountain summit located in the Saint Elias Mountains of Wrangell-St. Elias National Park and Preserve, in the U.S. state of Alaska. The remote peak is situated 75 mi northwest of Yakutat, and 8.7 mi west-northwest of Mount Saint Elias. The peak rises above the Columbus Glacier and Bagley Icefield to its north, the Tyndall Glacier to the south, and the Yahtse Glacier to the west. Precipitation runoff from the mountain drains into the Gulf of Alaska. The mountain was named in 1886 by English mountaineeer Harold Ward Topham for Thomas Henry Huxley, an English biologist. The mountain was officially named Huxley Peak in 1917, but the name was officially changed to Mount Huxley in 1968 by the U.S. Board on Geographic Names. The first ascent of the peak was made June 9, 1996 by Paul Claus who landed his plane at 11,500 feet elevation on the western flank and climbed the remaining distance to the summit. The second ascent of Mt. Huxley, and first complete ascent from base to summit, was made in June 2018 by Scott Peters, Andrew Peter, and Ben Iwrey starting from the Columbus Glacier."},{"page_url":"https://pt.wikipedia.org/wiki/Ducado_de_Brunsvique-Luneburgo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Elisabeth_von_Brandenburg_1510-1558.jpg","page_title":"Ducado de Brunsvique-Luneburgo","context_page_description":"O ducado de Brunsvique-Luneburgo foi criado em 1235 a partir dos territórios da Antiga Casa de Guelfo na Saxônia e foi um feudo de Otão I, cujo cognome é Otão, a Criança, um neto de Henrique, o Leão. O nome composto do ducado corresponde às duas maiores cidades do território, Brunsvique e Luneburgo. O ducado foi dividido várias vezes na Alta Idade Média.\\nTodas as linhas Guelfo detiveram o título de Duque de Brunsvique e Luneburgo. Os principados existiram até o fim do Sacro Império Romano-Germânico, em 1806. Após o Congresso de Viena tornou-se Estado sucessor do Reino de Hanôver e do Ducado de Brunsvique."},{"page_url":"https://tr.wikipedia.org/wiki/2015-16_%C5%9E%C4%B1rnak_%C3%A7at%C4%B1%C5%9Fmalar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/%C5%9E%C4%B1rnak_%C3%A7at%C4%B1%C5%9Fmas%C4%B1_%287%29%2C_Eyl%C3%BCl_2015.jpg","page_title":"2015-16 Şırnak çatışmaları","context_page_description":"2015-2016 Şırnak çatışmaları, Türkiye'nin Şırnak il merkezi ile birlikte Cizre, İdil ve Silopi ilçelerinde 2015 yılının ikinci yarısından sonra özyönetim talepleri sonucu başlayan, güvenlik güçleri ile PKK, YDG-H ve YPS mensupları arasında devam eden çatışmalar bütünü. Çatışmaların olduğu bölgelerdeki birçok mahalleye hendekler kazılmış, bu gelişmelerin ardından ildeki birçok mahallede sokağa çıkma yasakları ilan edilmiştir.\\nTürk Silahlı Kuvvetleri, Aralık 2015'te çatışmanın olduğu mahallelere tank ve zırhlı araçlarla birlikte 10 bin asker göndermiştir. Askeri kaynaklar tankların patlayıcı tuzaklanmış barikatları yıkmak için kullanıldığını belirtmiş, ordu birlikleri mahallelere girerek bu barikatların bulunduğu bölgelere top atışları yapmış ve çıkan çatışmalar sonucu aralarında kadın ve çocukların da bulunduğu birçok kişinin yaşamını yitirdiği iddia edilmiştir. İMC TV ve Nokta dergisi'nin de aralarında bulunduğu bazı kaynaklar, meydana gelen bazı sivil ölümlerin tanklardan yapılan top atışlarının evlere isabet etmesi sebebiyle meydana geldiğini bildirmişlerdir."},{"page_url":"https://en.wikipedia.org/wiki/Neufelden","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Neufelden_im_Bezirk_RO.png","page_title":"Neufelden","context_page_description":"Neufelden is a municipality in the district of Rohrbach in the Austrian state of Upper Austria."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%8A%E6%B5%B7%E5%B8%82%E4%BC%98%E7%A7%80%E5%8E%86%E5%8F%B2%E5%BB%BA%E7%AD%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/%E6%AD%A6%E5%BA%B7%E8%B7%AF392%E5%8F%B7%E4%BD%8F%E5%AE%85.jpg","page_title":"上海市优秀历史建筑","context_page_description":"上海市优秀历史建筑是指上海市建成三十年以上，并有下列情形之一的建筑：\\n建筑样式、施工工艺和工程技术具有建筑艺术特色和科学研究价值；\\n反映上海地域建筑历史文化特点；\\n著名建筑师的代表作品；\\n在中国产业发展史上具有代表性的作坊、商铺、厂房和仓库；\\n其他具有历史文化意义的优秀历史建筑。\\n优秀历史建筑的初步名单，由上海市规划管理部门和上海市房屋土地管理部门研究提出，并征求上海市文物管理部门、建筑所有人和所在区人民政府的意见，经专家委员会评审后报上海市人民政府批准确定。在上海市人民政府批准确定前，应当将优秀历史建筑的初步名单公示，征求社会意见。经批准确定的优秀历史建筑，由上海市人民政府公布，并由市房屋土地管理部门设立标志。\\n上海是中国首个将近现代建筑单独作为保护类别的城市。目前上海市人民政府已公布了五批优秀历史建筑共1058处，覆盖全市17个区。"},{"page_url":"https://es.wikipedia.org/wiki/Arge_ochropus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Rose_shoot_pierced_by_female_of_Arge_ochropa_%28Gmelin%29.JPG","page_title":"Arge ochropus","context_page_description":"Arge ochropus, conocida también como \\"falsa oruga del rosal\\" o en su forma adulta “avispa del rosal”, es una especie de insecto himenóptero que pertenece a la familia Argidae.​​"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Mirambeau_(Charente-Maritime)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Map_commune_FR_insee_code_17236.png","page_title":"Mirambeau (Charente-Maritime)","context_page_description":"Mirambeau sī ūi-tī Hoat-kok Poitou-Charentes tōa-khu Charente-Maritime séng ê chi̍t-ê commune."},{"page_url":"https://af.wikipedia.org/wiki/1852","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/The_Wreck_of_the_Birkenhead.jpg","page_title":"1852","context_page_description":"Die jaar 1852 was 'n skrikkeljaar wat volgens die Gregoriaanse kalender op 'n Donderdag begin het. Dit was die 52ste jaar van die 19de eeu n.C. In teenstelling met gewone jare het die jaar 366 dae en 'n 29 Februarie gehad."},{"page_url":"https://vi.wikipedia.org/wiki/%C3%89n_n%C3%BAi_%C4%91%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Ptyonoprogne_rupestris_MHNT.jpg","page_title":"Én núi đá","context_page_description":"Én núi đá là một loài chim trong họ Hirundinidae.\\nLoài chim này dài khoảng 14 cm với trên lưng màu tro nâu và nhạt màu ở dưới, và một cái đuôi ngắn, vuông có mảng trắng đặc trưng trên hầu hết các lông của nó. Nó sống ở vùng núi của Nam Âu, phía tây bắc châu Phi và Nam Á. Nó có thể bị nhầm lẫn với ba loài khác trong chi của nó, nhưng loài này lớn hơn hai loài kia, với đốm đuôi sáng và kiểu bộ lông khác nhau. Nhiều quần thể sống ở châu Âu định cư, nhưng một số sinh sống ở miền Bắc và các nhóm sinh sản ở châu Á nhất di cư, trú đông ở miền Bắc châu Phi, Trung Đông hay Ấn Độ.\\nChúng xây dựng một tổ bám chặt vào đá dưới một vách đá nhô ra hoặc càng ngày chúng càng xây tổ nhiều hơn lên một cấu trúc nhân tạo. Tổ như nửa chiếc tách được làm bằng bùn và gọn gàng với một lớp lót mềm bên trong bằng lông và cỏ khô. Tổ thường đơn độc, mặc dù một vài cặp có thể sinh sản tương đối gần nhau ở vị trí tốt. Mỗi tổ có hai đến năm quả trứng màu trắng nâu có đốm được chủ yếu được chim mái ấp, và cả hai con chim cha và mẹ nuôi chim con. Loài này không tụ tập nhiều con thành đàn lớn khi kiếm mồi, nhưng là thích tụ tập ngoài mùa sinh sản."},{"page_url":"https://nl.wikipedia.org/wiki/Dancing_Lady","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Dancing_Lady.png","page_title":"Dancing Lady","context_page_description":"Dancing Lady is een Amerikaanse muziekfilm uit 1933 onder regie van Robert Z. Leonard. De voornaamste acteurs in de film zijn Joan Crawford, Clark Gable, Franchot Tone, May Robson, Fred Astaire, Nelson Eddy en Ted Healy en zijn Three Stooges.\\nDe film betekende een doorbraak voor Astaire, die als zichzelf te zien is en danst met Crawford. Daarnaast bevat de film het befaamde liedje Everything I Have Is Yours."},{"page_url":"https://en.wikipedia.org/wiki/Ahmad_Shah_I_Wali","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Tomb_of_Empress.jpg","page_title":"Ahmad Shah I Wali","context_page_description":"Ahmed Shah Al Wali Bahamani ruled the Kingdom of Bidar from 1 October 1422 to 17 April 1436 and was a great patron of arts and culture. He brought artisans from Iran, including the metal-worker Abdulla-bin-Kaiser, who was the master of Bidriware, the inlaying of zinc alloy with silver and gold."},{"page_url":"https://en.wikipedia.org/wiki/Brevard,_North_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/NCMap-doton-Brevard.PNG","page_title":"Brevard, North Carolina","context_page_description":"Brevard is a city in Transylvania County, North Carolina, United States, with a population of 7,609 as of the 2010 Census. It is the county seat of Transylvania County.\\nBrevard is located at the entrance to Pisgah National Forest and has become a noted tourism, retirement and cultural center in western North Carolina. A moderate climate, environmental beauty and cultural activities attract relocators to the area.\\nBrevard is also known for its white squirrels. There are several theories of how they came to live there, including an overturned carnival truck and an escaped pet breeding with native squirrels.\\nAlong with nearby Asheville and Hendersonville, Brevard forms the Asheville-Brevard, NC CSA combined statistical area."},{"page_url":"https://en.wikipedia.org/wiki/George_Adkins","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/George_Thomas_Adkins_passport_photo.jpg","page_title":"George Adkins","context_page_description":"George Thomas Augustus Adkins was a New Zealand rugby union player. A prop, Adkins represented South Canterbury at a provincial level, and was a member of the New Zealand national side, the All Blacks, from 1935 to 1936. He never played a full test but was part of the 1935–36 New Zealand rugby union tour of Britain, Ireland and Canada playing against local sides.\\nA draper before serving with the RNZAF in the Pacific during World War II, Adkins was subsequently a senior civil servant with the Department of Labour.\\nAdkins died in Timaru on 24 May 1976."},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Saint-Nazaire_de_B%C3%A9ziers","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Beziers_cloche_2.jpg","page_title":"Cathédrale Saint-Nazaire de Béziers","context_page_description":"La cathédrale Saint-Nazaire et Saint-Celse est une église de style gothique située à Béziers dans le département français de l'Hérault et la région Occitanie. La cathédrale est édifiée dans la partie ouest de l’ancienne ville médiévale, sur un large promontoire qui domine la plaine de l’Orb au même niveau que le Lycée Henri-IV; l'ensemble étant bâti sur les contreforts des anciens remparts de la cité héraultaise. Le point de vue permet d'embrasser du regard la plaine du Languedoc et ses villages alentour jusqu'aux massifs de la montagne noire, du Caroux et des Pyrénées se profilant à l'horizon.\\nLa cathédrale fait l'objet d’un classement au titre des monuments historiques par la liste de 1840."},{"page_url":"https://hu.wikipedia.org/wiki/Nemzetk%C3%B6zi_rep%C3%BCl%C5%91terek_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Malta_International_Airport.jpg","page_title":"Nemzetközi repülőterek listája","context_page_description":"Ez a lista alapvetően olyan repülőtereket tartalmaz, amelyek szerepelnek a Wikidatában és ott nemzetközi repülőtérként vannak megjelölve, ami nem feltétlenül jelenti azt, hogy valóban nemzetközi repülőterek, vagy hogy minden ilyen repülőtér szerepelne a listában."},{"page_url":"https://oc.wikipedia.org/wiki/Stutzheim-Offenheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Stutzheim_01.JPG","page_title":"Stutzheim-Offenheim","context_page_description":"Stutzheim-Offenheim en alemannisch es una comuna francesa del departament del Bas Ren e de la region d'Alsàcia."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%8A%D8%AC_%D9%81%D8%B1%D8%A7%D8%AA%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Ferati_Back.jpg","page_title":"بيج فراتى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبيج فراتى لاعب كورة قدم من سويسرا."},{"page_url":"https://sv.wikipedia.org/wiki/Stora_gillets_byggnad","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Large_Guild_Riga_1918.jpg","page_title":"Stora gillets byggnad","context_page_description":"Stora gillets byggnad är en byggnad i Gamla stan i Riga i Lettland, som uppfördes 1854–1857. Den byggdes för Stora gillet, eller Mariagillet, som fanns 1354–1939.\\nHuset har sina rötter i ett hus från 1200-talet på platsen, som ursprungligen var en handelsgård. Det har över århundradena genomgått åtskilliga ombyggnader. Byggnaden rekonstruerades väsentligen åren 1854–1857 efter ritningar av Karl Beine i engelsk-gotisk stil. Delar i det tidigare huset finns fortfarande kvar, såsom samlingssalen Munsterrummet.\\nÅr 1936, efter Ulmanis statskupp 1934, nationaliserades huset och byggdes om till ett konserthus, samtidigt som Lettlands handelskammare tog över Stora gillets funktioner.\\nI huset finns en stor konsertsal med 669 sittplatser och mindre lokaler med 242, 187 respektive 67 kvadratmeter."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AE%D8%A7%D8%B1%DA%A9%DB%8C%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Kharkov_train_station.jpg","page_title":"خارکیف","context_page_description":"خارکیف ایک ملین آبادی کا شہر ہے جو یوکرین میں واقع ہے۔ اس کی مجموعی آبادی 1,442,910 افراد پر مشتمل ہے، یہ Kharkiv City Municipality میں واقع ہے۔"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D9%8A%D9%88%D8%AA_%D9%84%D9%8A%D8%AA%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/2019_Tour_of_Austria_%E2%80%93_3rd_stage_20190608_%2805%29.jpg","page_title":"اليوت ليتير","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاليوت ليتير لاعب سباق عجل من بلجيكا."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%B1%D9%88%DA%A9%D9%88%D9%BE%D8%AA%D8%B1_%D8%A7%DB%8C%DA%A9%D8%B3%DB%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Ila12_X3_0600_b1.jpg","page_title":"یوروکوپتر ایکس۳","context_page_description":"یوروکوپتر ایکس۳ یک بالگرد ساختِ کارخانهٔ ایرباس هلیکوپترز است. این بالگرد برای نخستین بار در ۶ سپتامبر ۲۰۱۰ میلادی مورد استفاده قرار گرفت."},{"page_url":"https://eo.wikipedia.org/wiki/Hans_von_B%C3%BClow","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Hans_von_B%C3%BClow_Otto_B%C3%B6hler.jpg","page_title":"Hans von Bülow","context_page_description":"Hans Guido Freiherr von Bülow estis germana pianovirtuozo, dirigento kaj kapelmajstro de la 19-a jarcento. Li ankaŭ aperis kiel komponisto. Lia patro estis la verkisto Karl Eduard von Bülow."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D6%87%D5%B8%D5%B6_%D4%B1%D6%80%D5%B8%D5%B6%D5%B5%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Levon_Aronian_2013.JPG","page_title":"Լևոն Արոնյան","context_page_description":"Լևոն Գրիգորի Արոնյան, հայ շախմատիստ, գրոսմայստեր։ 2005 և 2017 թվականների աշխարհի գավաթակիր, Հայաստանի հավաքականի կազմում 37-րդ, 38-րդ և 40-րդ համաշխարհային օլիմպիադաների, 2011 թվականի աշխարհի և 1999 թվականի Եվրոպայի թիմային առաջնությունների հաղթող, բազմաթիվ գերմրցաշարերի, ՖԻԴԵ-ի Մեծ մրցանակի, Վեյկ ան Զեյի մրցաշարի քառակի հաղթող, 2009 և 2013 թվականների Բիլբաո-Մեծ սաղավարտի հաղթող, արագ շախմատի 2009 թվականի աշխարհի չեմպիոն, 2006 և 2007 թվականների Ֆիշերի շախմատի աշխարհի չեմպիոն, 2010 թվականի կայծակնային շախմատի աշխարհի չեմպիոն, 2002 թվականի Հայաստանի չեմպիոն։ 2011 թվականին Մոնակոյում նա մասնակցեց «կույր» և արագ շախմատի «Ամբեր» ավանդական մրցաշարին և դարձավ նրա վերջին հաղթողը ։\\n1998 թվականին 15-ամյա Լևոն Արոնյանը թիմակիցներ Գաբրիել Սարգսյանի, Տիգրան Լ. Պետրոսյանի և Վարուժան Հակոբյանի հետ դարձել է Թուրքիայի Ստամբուլ քաղաքում կայացած 6-րդ մանկական օլիմպիադայի հաղթող։\\nԵրկու տարի անընդմեջ՝ 2005 և 2006 թվականներին, մարզական լրագրողների հարցմամբ ճանաչվել է Հայաստանի լավագույն մարզիկ: 2020 թվականի օգոստոսի 1-ի դրությամբ անհատական վարկանիշով աշխարհում 7-րդն է ։"},{"page_url":"https://pt.wikipedia.org/wiki/Nancy_Astor","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Signature_Nancy_Astor.png","page_title":"Nancy Astor","context_page_description":"Nancy Witcher Astor, Viscondessa Astor foi a primeira mulher a fazer parte da Câmara dos Comuns no Reino Unido, eleita por Plymouth em 1919.\\nFoi casada com Waldorf Astor, 2° Visconde Astor.\\nPor seu feminismo e forte oposição ao nazismo, seu nome esteve listado no Livro Negro, lista que continha o nome de centenas de personalidades britânicas que deveriam ser presas e executadas pelos integrantes da, após a almejada invasão do Reino Unido pela Alemanha Nazista. Nancy foi listada como \\"a maior inimiga da Alemanha\\"."},{"page_url":"https://tr.wikipedia.org/wiki/Kazuo_Ishiguro","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Kazuo_Ishiguro_by_Kubik.JPG","page_title":"Kazuo Ishiguro","context_page_description":"Kazuo Ishiguro, 8 Kasım 1954 doğumlu Japon asıllı İngiliz romancı. Nagazaki kentinde doğan İşiguro 1960 yılında ailesiyle birlikte İngiltere'ye göçtü. University of Kent'i bitirdikten sonra (1978) University of East Anglia'da yaratıcı yazarlık yüksek lisansı yaptı. 1982 yılında İngiliz yurttaşlığına geçti.\\n2005 yılında yazdığı Beni Asla Bırakma (Never Let Me Go) romanı 2010 yılında yönetmen Mark Romanek tarafından aynı adla sinemaya aktarılmıştır.\\n2017 yılında Nobel Edebiyat Ödülü'nü kazanmıştır."},{"page_url":"https://sh.wikipedia.org/wiki/Sumerska_umjetnost","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Gudea_of_Lagash_Girsu.jpg","page_title":"Sumerska umjetnost","context_page_description":"Sumersko-akadska kultura javlja se rano s tim da su neki gradovi najpre u Sumeru imali prednosi i značaj od ostalih. Tako Ur u I Urskoj dinastiji od 2280.- 1600. pne. osnovana je država u Sumeru koja se prostirala sve do sredozemlja. Posle dvadesetak godina pod Saragonom nastala je prva monarhija koju su kasnije proširili Akadi od Sredozemlja do Elama. Posle su vladale dinastije Ura i uspele da postave svoju vladavinu. Period Džemedetski traje od 2900. do 2600. pne. ranodinastički period Ura I od 2500.- 2400. pne. akadski period 2350.- 2170. pne. i period III dinastije Ura 2050.- 1950.pne.\\nSumeri su tvorci klinastog pisma. Imaju malo ostataka iz oblasti arhitekture, jer je njihov građevinski materijal ćerpič i drvo. Neopterećeni životom posle smrti, njihova umetnost je utilitarna i pragmatična.\\nSumerska skulptura je geometrijska i ekspresivna, a ne realistična. Sumerski vajar formu dobija kombinovanjem kupe i valjka, za razliku od Egipćana, čije su skulpture kubične. Ruke i noge su okrugle kao cevi, a duge suknje koje nose su tako glatke i okrugle, kao da su rađene na strugu."},{"page_url":"https://hu.wikipedia.org/wiki/P%C3%A1rizs_metr%C3%B3%C3%A1llom%C3%A1sainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/VillejuifAragon.JPG","page_title":"Párizs metróállomásainak listája","context_page_description":"Párizs metróhálózatán 2017-ben összesen 302 metróállomás volt használatban és további állomások álltak építés vagy tervezés alatt."},{"page_url":"https://en.wikipedia.org/wiki/2007_Formula_One_World_Championship","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Heikki_Kovalainen_2007_Britain_2.jpg","page_title":"2007 Formula One World Championship","context_page_description":"The 2007 FIA Formula One World Championship was the 61st season of FIA Formula One motor racing. It featured the 2007 FIA Formula One World Championship, which began on 18 March and ended on 21 October after seventeen events. The Drivers' Championship was won by Ferrari driver Kimi Räikkönen by one point at the final race of the season, making Räikkönen the third Finnish driver to take the title. An appeal by McLaren regarding the legality of some cars in the final race could have altered the championship standings, but on 16 November, the appeal was rejected by the International Court of Appeal, confirming the championship results. Räikkönen entered the final race in third position in the drivers' standings, but emerged as champion after the chequered flag, a feat first accomplished by Giuseppe Farina in 1950. It has since been accomplished again, by Sebastian Vettel, in 2010.\\nA major talking point of the season had been an espionage controversy involving Ferrari and McLaren, which led to McLaren being excluded from the Constructors' Championship. As a result, Ferrari clinched the championship at the Belgian Grand Prix."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%A5%D5%B0%D5%A1%D5%BD%D5%BF%D5%A1%D5%B6%D5%AB_%D5%AF%D5%A1%D5%A9%D5%B6%D5%A1%D5%BD%D5%B8%D6%82%D5%B6%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Microtus_subterraneus_%28Cologne%2C_Germany%29.jpg","page_title":"Լեհաստանի կաթնասունների ցանկ","context_page_description":"Այս ցանկում ներկայացված են Լեհաստանի տարածքում գրանցված կաթնասունների տեսակները:\\nՀետևյալ պիտակները օգտագործվում են Բնության պահպանության միջազգային միության գնահատումների համաձայն, որտեղ ներկայացված է յուրաքանչյուր տեսակի պահպանման կարգավիճակի մասին:"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8F%B6%E5%8D%A1%E6%8D%B7%E7%90%B3%E5%A8%9C%E4%BA%8C%E4%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Empress_Catherine_The_Great_circa_1845_%28George_Christoph_Grooth%29.jpg","page_title":"叶卡捷琳娜二世","context_page_description":"葉卡捷琳娜二世·阿列克謝耶芙娜，亦稱葉卡捷琳娜大帝，或依照英文譯為凱薩琳二世、凱薩琳大帝，俄羅斯帝國史上在位時間最長的女皇，在位時間長達34年。葉卡捷琳娜出生於普魯士波美拉尼亞斯德丁，出生名為蘇菲亞·弗雷德里卡·奧古斯塔·馮·安哈特-采爾布斯特-多恩堡，通過政變廢黜其夫彼得三世，即位為俄羅斯女皇。\\n葉卡捷琳娜即位和在位時均時常依靠其寵幸貴族的協助，如奧爾洛夫和普譚金。在蘇沃洛夫、魯緬采夫和烏沙科夫等將領支持之下，葉卡捷琳娜治下的俄羅斯帝國通過軍事及外交迅速擴張。在南方，俄羅斯通過俄土戰爭擊敗鄂圖曼帝國並擊潰克里米亞汗國，對黑海及亞速海的廣闊區域進行了殖民；在西方，葉卡捷琳娜前情人斯坦尼斯瓦夫·奧古斯特統治的波蘭-立陶宛聯邦被瓜分。；在東部，俄羅斯開始對阿拉斯加進行殖民，在其子保羅一世統治時期建立俄屬北美。\\n葉卡捷琳娜改革行政區劃，諸多新城鎮在其令下建立起來。她跟隨的彼得大帝，以西歐模式對俄羅斯進行現代化改革，但徵兵制及經濟仍舊以農奴制為基礎，國家及地主的需求越來越依賴於農奴，由此導致了多次叛亂，農民及哥薩克的普加喬夫起義即為一例。\\n葉卡捷琳娜統治時期被稱為「葉卡捷琳娜時代」，通常被認為是俄羅斯帝國及俄羅斯貴族的黃金時代。彼得三世在位時頒布，由葉卡捷琳娜確認延續的《貴族自由宣言》將貴族由強制兵役和國家公務中解放出來。葉卡捷琳娜推動諸多古典主義貴族建築的建設，改變了俄國的面貌。她熱心支持啟蒙時代理念，由此獲得開明專制君主一稱。葉卡捷琳娜亦支持藝術事業，推動了俄羅斯啟蒙時期的發展。這一時期所建立斯莫爾尼宮是歐洲首家由國家資助的女性高等教育機構。"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_partidos_pol%C3%ADticos_por_pa%C3%ADs","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Isamaa_party_logo_transparent.png","page_title":"Lista de partidos políticos por país","context_page_description":"Movimento Popular de Libertação de Angola\\nUnião Nacional para a Independência Total de Angola\\nPartido de Renovação Social\\nFrente Nacional de Libertação de Angola\\nPartido Liberal Democrático\\nPartido da Aliança da Juventude Operária-Camponesa de Angola\\nPartido Social Democrata\\nPartido Renovador Democrático\\nAliança Democrática de Angola\\nPartido Democrático para o Progresso - Aliança Nacional Angolana\\nPartido Nacional Democrático Angolano\\nPartido Democrático Liberal de Angola\\nMovimento de Defesa dos Interesses dos Angolanos\\nPartido Revelação\\nConvergência Ampla de Salvação de Angola - Coligação Eleitoral"},{"page_url":"https://mg.wikipedia.org/wiki/Andrew_Redmayne","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Andrew_Redmayne-Olyroos.jpg","page_title":"Andrew Redmayne","context_page_description":"Andrew Redmayne dia mpilalao baolina kitra mizaka ny zom-pirenen'i Aostralia teraka ny 13 Janoary 1989"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A8%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%B6%E0%A6%A8%E0%A6%BE%E0%A6%B2_%E0%A6%87%E0%A6%A8%E0%A6%B8%E0%A7%8D%E0%A6%9F%E0%A6%BF%E0%A6%9F%E0%A6%BF%E0%A6%89%E0%A6%9F_%E0%A6%85%E0%A6%AC_%E0%A6%AE%E0%A7%8D%E0%A6%AF%E0%A6%BE%E0%A6%A8%E0%A7%87%E0%A6%9C%E0%A6%AE%E0%A7%87%E0%A6%A8%E0%A7%8D%E0%A6%9F_%E0%A6%8F%E0%A6%A8%E0%A7%8D%E0%A6%A1_%E0%A6%9F%E0%A7%87%E0%A6%95%E0%A6%A8%E0%A7%8B%E0%A6%B2%E0%A7%8B%E0%A6%9C%E0%A6%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/NIMT_Greater_Noida_Academic_Block_1.jpg","page_title":"ন্যাশনাল ইনস্টিটিউট অব ম্যানেজমেন্ট এন্ড টেকনোলোজি","context_page_description":"জাতীয় ব্যবস্থাপনা ও প্রযুক্তি বিদ্যায়তনটি প্রতিষ্ঠিত হয়েছিল ১৯৯২ সালে।\\nএনআইএমটি শিক্ষায়তনটি একটি অলাভ জনক প্রতিষ্ঠান। প্রতিষ্ঠানটি ভারতীয় পরিষধ যেমন ভারতীয় আইনজীবী পরিষদ, কারিগরি শিক্ষার সকল ভারতীয় পরিষধ, ভারতীয় নার্সিং পরিষধ, ভারতের ফার্মাসি পরিষধ, জাতীয় শিক্ষক পরিষদ, বিশ্ববিদ্যালয় মঞ্জুরি কমিশন সহ রাজ্য সরকারি বিশ্ববিদ্যালয়সমূহ এবং নিয়ন্ত্রক পরিষদ দ্বারা অনুমোদিত এবং সর্বস্বীকৃত।"},{"page_url":"https://en.wikipedia.org/wiki/Steven_Pinker","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Steven_Pinker_G%C3%B6ttingen_10102010a.JPG","page_title":"Steven Pinker","context_page_description":"Steven Arthur Pinker is a Canadian-American cognitive psychologist, linguist, and popular science author. He is an advocate of evolutionary psychology and the computational theory of mind.\\nPinker's academic specializations are visual cognition and psycholinguistics. His experimental subjects include mental imagery, shape recognition, visual attention, children's language development, regular and irregular phenomena in language, the neural bases of words and grammar, and the psychology of cooperation and communication, including euphemism, innuendo, emotional expression, and common knowledge. He has written two technical books that proposed a general theory of language acquisition and applied it to children's learning of verbs. In particular, his work with Alan Prince published in 1989 critiqued the connectionist model of how children acquire the past tense of English verbs, arguing instead that children use default rules such as adding \\"-ed\\" to make regular forms, sometimes in error, but are obliged to learn irregular forms one by one.\\nPinker is also the author of eight books for general audiences."},{"page_url":"https://it.wikipedia.org/wiki/Caserma_dei_vigili_del_fuoco","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Feuerwehr_Iserlohn_20090801.jpg","page_title":"Caserma dei vigili del fuoco","context_page_description":"Una caserma o stazione dei vigili del fuoco è una struttura costruita appositamente per l'alloggio del personale operativo dei vigili del fuoco, addestrato per lo spegnimento di incendi civili, rurali e industriali, salvaguardia della vita delle persone e animali e cose, emergenze di carattere naturale e non; e per ospitare mezzi, attrezzature e macchinari necessari per le operazioni."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A5%D6%80%D5%B1%D5%A1%D6%80%D6%87%D5%A1%D5%A4%D5%A1%D6%80%D5%B1%D5%A1%D5%B5%D5%AB%D5%B6_%D5%B4%D5%B8%D6%82%D5%BD%D5%BD%D5%B8%D5%B6%D5%A1%D5%B5%D5%AB%D5%B6_%D5%AF%D5%AC%D5%AB%D5%B4%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Korea-Busan-Busan_Tower-01.jpg","page_title":"Մերձարևադարձային մուսսոնային կլիմա","context_page_description":"Մերձարևադարձային մուսսոնային կլիմա, մերձարևադարձային կլիմայի տարատեսակ։"},{"page_url":"https://vi.wikipedia.org/wiki/Vespa_GS","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Vespa_GS_150_VS1.jpg","page_title":"Vespa GS","context_page_description":"Vespa GS là một dòng xe nổi tiếng của hãng Piaggio, với hai loại dung tích cylinder 150 & 160 phân khối, được sản xuất lần đầu tiên vào năm 1955 và kết thúc năm 1964.\\nNhững chiếc Vespa 150 GS đầu tiên được sản xuất có ký hiệu số khung bắt đầu bằng VS1.\\nChiếc Vespa 150 GS VS1 với những đường cong ấn tượng ở đầu đèn, yên xe và nét gấp ở yếm được nhiều người cho rằng là mẫu Vespa đẹp nhất.\\nĐộng cơ xe Vespa 150 GS VS1 là những cải tiến từ nguyên lý động cơ của xe Vespa \\" Sei Giorni \\", một dòng xe thể thao khác của Piaggio. Đầu piston của xe được thay đổi, từ dạng có một gờ nhô lên của \\" Sei Giorni \\" chuyển sang dạng vòm, giúp xe đạt đến tỉ số nén 7:1, hành trình piston và đường kính cylinder đều bằng 57mm, chế hòa khí Dellorto UB23S3, cộng với việc là chiếc xe đầu tiên của Piaggio có 4 cấp số truyền động đã tạo cho chiếc xe một sức mạnh đáng gờm và nó có thể đạt vận tốc 100 km/h.\\nBắt đầu từ năm 1962 Piaggio sản xuất Vespa 160 GS, với số khung mới bắt đầu bằng VSB1T, hành trình piston 60mm, đường kính cylinder 58mm, chế hòa khí Dellorto SI27/23, động cơ đạt tỉ số nén 7,3:1, dung tích thực 158,53cc, vận tốc tối đa 105 km/h."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B8%D1%86_%D0%9A%D0%B8%D1%80%D0%B3%D0%B8%D0%B7%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Greater_Flamingoes_%28Phoenicopterus_roseus%29_in_flight_W_IMG_9635.jpg","page_title":"Список птиц Киргизии","context_page_description":"На территории Киргизии обитают 395 видов птиц."},{"page_url":"https://en.wikipedia.org/wiki/Mauboussin_M.120","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Mauboussin_M127_F-PBTB_Guyct_20.06.65_edited-3.jpg","page_title":"Mauboussin M.120","context_page_description":"The Mauboussin M.120 was a trainer and touring aircraft built in France in the 1930s and again in the years following World War II."},{"page_url":"https://de.wikipedia.org/wiki/Max_Joseph_Custodis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Hattingen_-_Isenberg_-_Isenburg_-_Custodis_10_ies.jpg","page_title":"Max Joseph Custodis","context_page_description":"Max Joseph Hubertus Custodis war ein deutscher Architekt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Aussichtst%C3%BCrmen_in_Rheinland-Pfalz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/L%C3%B6wenburg_%28Monreal%29-03-Bergfried.jpg","page_title":"Liste von Aussichtstürmen in Rheinland-Pfalz","context_page_description":"Die Liste von Aussichtstürmen in Rheinland-Pfalz enthält Bauwerke, welche über für den Publikumsverkehr zugängliche Aussichtsmöglichkeiten verfügen. Sie umfasst Aussichts-, Fernseh- und Wassertürme, Hochhäuser, Kirchtürme, stationäre Fahrgeschäfte und sonstige Aussichtsplattformen – auch ehemalige Türme. Die Listen enthalten keine reisenden Panoramafahrgeschäfte."},{"page_url":"https://hu.wikipedia.org/wiki/880-as_busz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/880-as_busz_%28NWX-473%29.jpg","page_title":"880-as busz","context_page_description":"A 880-as busz a budapesti agglomerációban közlekedő helyközi járat, mely Újpest-Városkapu autóbusz-állomást és Esztergomot köti össze. A buszok Újpest-Városkaputól a 2-es főúton elindulva, majd a Megyeri hídon átkelve érik el a 11-es főutat, melyen végig közlekednek Szentendre, Leányfalu, Tahitótfalu, Dunabogdány, Visegrád, Dömös és Pilismarót településeken keresztül Esztergomig. A járatot a Volánbusz üzemelteti. Betétjáratai a 882, a 884 és a 889. A 880-as busz az ország egyik legszebb tájegységén, a Dunakanyarban közlekedik. A járat adja a Dunakanyar jobb parti autóbusz-közlekedésének gerincét. Pilismarót és Dömös községekről az egyetlen közvetlen eljutási lehetőséget biztosítja Esztergomba. A járat az útvonalán számos dunai révkikötőt érint, így a révek elsősorban a 880-as buszra ráhordó szerepet töltenek be.\\nA vonalon Budapest közigazgatási határán belül a Budapest-bérlettel igénybe vehető."},{"page_url":"https://es.wikipedia.org/wiki/Mar%C3%ADa_Humphreys","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Punta_Cuevas%2C_Chubut.JPG","page_title":"María Humphreys","context_page_description":"María Elizabeth Humphreys fue la primera persona blanca, primera mujer cristiana, y primera argentina descendiente de galeses nacida en el territorio del actual Chubut, Argentina, inmediatamente después de arribar el primer contingente de colonos galeses a la Patagonia. Con su nombre se designaron unas elevaciones donde el padre recibió la noticia, ubicadas entre Madryn y Trelew.​​​​"},{"page_url":"https://ru.wikipedia.org/wiki/Cracking_Art","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/1000_delfini_a_Miano-_1996.jpg","page_title":"Cracking Art","context_page_description":"Cracking Art — художественное движение, зародившееся в середине 1990-х годов в Италии, известное созданием городских инсталляций, характеризующихся гигантскими животными из цветного пластика, пригодного для вторичной переработки.\\nРаботы направления появлялись во многих городах Европы, США, Азии и Австралии. Начало работы в новом городе группа художников называет «Вторжением». Визитной карточкой Cracking Art являются монохромные гигантские улитки."},{"page_url":"https://la.wikipedia.org/wiki/Cuinzier","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Map_commune_FR_insee_code_42079.png","page_title":"Cuinzier","context_page_description":"Cuinzier est commune Francicum 685 incolarum praefecturae Ligeris in regione orientali Rhodano et Alpibus."},{"page_url":"https://es.wikipedia.org/wiki/Ronda_Norte_de_C%C3%A1ceres","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Pictograma_Campo_de_futbol.PNG","page_title":"Ronda Norte de Cáceres","context_page_description":"La Ronda Norte es una ronda de circunvalación administrada por el Ayuntamiento de Cáceres, que comunica la N-521 con la N-630. Es considerada como una de las vías más importantes para el desarrollo urbanístico de la ciudad de Cáceres. Fue abierta al tráfico el 6 de octubre de 2004 tras ser reconocida su necesidad de ejecución en el Plan General de Urbanismo de 1975. Fue financiada por la Junta de Extremadura, que también la ejecutó para luego transferir su titularidad al Ayuntamiento de Cáceres.\\nPlanificada en principio para comunicar las carreteras hacia Trujillo y Plasencia y eliminar el tráfico de paso por el centro de la ciudad, el objetivo principal de la vía, en relación con el desarrollo urbano, es la comunicación de la Universidad y los nuevos polígonos de vivienda del Distrito Norte de Cáceres con los de nuevo crecimiento residencial y comercial de Distrito Oeste."},{"page_url":"https://br.wikipedia.org/wiki/Kourtizanez","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Pompadour6.jpg","page_title":"Kourtizanez","context_page_description":"Ur gourtizanez a veze lavaret e brezhoneg eus ar merc'hed a renk uhel a werzhe o c'horf da dud pinvidik ha galloudus."},{"page_url":"https://ro.wikipedia.org/wiki/Incendiul_de_la_catedrala_Notre-Dame_de_Paris_din_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Incendie_Notre_Dame_de_Paris.jpg","page_title":"Incendiul de la catedrala Notre-Dame de Paris din 2019","context_page_description":"Incendiul de la catedrala „Notre-Dame de Paris” a fost un incendiu violent care s-a declansat în interiorul catedralei \\"Notre-Dame de Paris\\", în seara zilei de 15 aprilie 2019.\\nLuând rapid o mare amploare, flăcările au distrus în întregime turnul-fleșă, care s-a prăbușit, cât și o mare parte din acoperiș precum și șarpanta monumentului. Mulțumită intervenției a sute de pompieri, structura globală a edificiului și cele două turnuri au fost cruțate, însă pagubele sunt considerabile. Intervenția câtorva sute de pompieri, până în dimineața zilei următoare, a putut să salveze structura globală a edificiului, cele două turnuri precum și fațada de apus. Totuși, stricăciunile și pierderile sunt considerabile, atât în interiorul cât și în exteriorul monumentului.\\nIncendiul a provocat o emoție foarte puternică, atât în Franța, cât și în întreaga lume, precum și o importantă acoperire mediatică. Primarul Parisului, Anne Hidalgo, a descris incendiul ca fiind unul „groaznic”. Insula Île de la Cité, pe care se află catedrala Notre-Dame, a fost evacuată.\\nÎn aceeași seară, președintele Republicii Franceze, Emmanuel Macron, a anunțat reconstrucția catedralei."},{"page_url":"https://ro.wikipedia.org/wiki/Prin%C8%9Bul_Waldemar_al_Prusiei_(1889-1945)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Prinzessin_Irene_und_Prinz_Heinrich.png","page_title":"Prințul Waldemar al Prusiei (1889-1945)","context_page_description":"Prințul Waldemar al Prusiei a fost fiul cel mare al Prințului Heinrich al Prusiei și a soției acestuia, Prințesa Irene de Hesse. Atât prin tatăl său cât și prin mama sa a fost strănepot al reginei Victoria a Marii Britanii."},{"page_url":"https://ar.wikipedia.org/wiki/DDEF1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/PBB_GE_DDEF1_221039_s_at_fs.png","page_title":"DDEF1","context_page_description":"DDEF1‏ هوَ بروتين يُشَفر بواسطة جين DDEF1 في الإنسان."},{"page_url":"https://eu.wikipedia.org/wiki/Gamere-Zihiga","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Pastorale_2007_Camou-Cihigue.jpg","page_title":"Gamere-Zihiga","context_page_description":"Gamere-Zihiga Zuberoako udalerria da, Basabürüako Ibarresküinean kokaturik dagoena."},{"page_url":"https://en.wikipedia.org/wiki/Pietro_Torri","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Pietro_Torri_-_Catone_in_Utica_-_italian_titlepage_of_the_libretto_-_Munich_1736.jpg","page_title":"Pietro Torri","context_page_description":"Pietro Torri was an Italian Baroque composer."},{"page_url":"https://en.wikipedia.org/wiki/List_of_bridges_on_the_National_Register_of_Historic_Places_in_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Fremont_Mill_Bridge.jpg","page_title":"List of bridges on the National Register of Historic Places in Iowa","context_page_description":"This is a list of bridges and tunnels on the National Register of Historic Places in the U.S. state of Iowa."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BE%D0%B4%D0%BE%D1%81%D0%BF%D0%B0%D0%B4%D0%B8_%D0%97%D0%B0%D0%BA%D0%B0%D1%80%D0%BF%D0%B0%D1%82%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/%D0%A1%D0%BA%D0%B0%D0%BA%D0%B0%D0%BB%D0%BE.JPG","page_title":"Водоспади Закарпатської області","context_page_description":"Водоспади Івано-Франківської області\\nВодоспади Львівської області\\nВодоспади Чернівецької області"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B6%E3%82%A6%E3%83%90%E3%83%BC%E3%83%BBC16","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Sauber_C16_front-right_2017_Hangar-7_1.jpg","page_title":"ザウバー・C16","context_page_description":"ザウバー・C16 は、ザウバーが1997年のF1世界選手権に投入したフォーミュラ1カー。開発責任者はレオ・レス。1997年の開幕戦から最終戦まで使用された。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BA%99%E5%BA%95%E6%B2%9F%E9%81%97%E5%9D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/National_Museum_of_China_2014.02.01_14-49-27.jpg","page_title":"庙底沟遗址","context_page_description":"庙底沟遗址位于中国河南省三门峡市湖滨区原陕州老城南关附近，是一处新石器时代遗址，1963年被列为第一批河南省文物保护单位，2001年被列为第五批全国重点文物保护单位。\\n庙底沟遗址位于流入黄河的青龙涧河和苍龙涧河之间的黄土塬上，总面积约24万平方米。1956年9月至1957年3月，因建设三门峡大坝，由文化部和中国科学院考古研究所组成黄河水库考古工作队，对该遗址进行了第一次大规模发掘。发掘面积4480平方米。发掘表明，遗址下层属仰韶文化庙底沟类型文化，年代为公元前4000年至公元前3500年，遗址上层属中原龙山文化早期的庙底沟二期文化，年代为公元前2900年至公元前2800年的。2002年因城市建设，河南省文物考古研究所、三门峡市文物考古研究所及郑州大学考古专业组成了联合考古工作队，对其进行大规模抢救性发掘。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Saint-Sauveur-en-Puisaye","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Map_commune_FR_insee_code_89368.png","page_title":"Saint-Sauveur-en-Puisaye","context_page_description":"Saint-Sauveur-en-Puisaye sī ūi-tī Hoat-kok Bourgogne toā-khu Yonne koān ê chi̍t ê commune."},{"page_url":"https://lv.wikipedia.org/wiki/Latvijas_pagastu_uzskait%C4%ABjums","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/L%C4%ABvb%C4%93rzes_pagasts_COA.png","page_title":"Latvijas pagastu uzskaitījums","context_page_description":"Šajā uzskaitījumā apkopoti visi pašreiz esošie Latvijas pagasti. 2016. gadā Latvijas teritorijā bija 497 pagasti.\\nPagasts ir Latvijas teritoriālā vienība kopš 1918. gada decembra. 1937. gadā Latvijā bija 519 pagasti, 1998. gadā — 486 pagasti, bet 2010. gada maijā — 494 pagasti. Laika posmā no 1990. līdz 2009. gadam pagasti bija otrās pakāpes un, pēc rajonu pašvaldību likvidēšanas, pirmās pakāpes pašvaldības. Pēc 2009. gada administratīvi teritoriālās reformas pagasti tika iekļauti novados vai, atsevišķos gadījumos, tika reorganizēti par viena pagasta novadiem. Par pagastiem tika pārdēvēta arī lielākā daļa pilsētu lauku teritoriju."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D9%8A%D8%AE_%D8%A5%D9%8A%D8%B7%D8%A7%D9%84%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Karte_Venedig_MK1888.png","page_title":"تاريخ إيطاليا","context_page_description":"كانت إيطالية منذ فجر تاريخها معبراً للتأثيرات الحضارية القادمة من الشرق منذ أقدم الأزمنة، وتكاد تنعزل عن وسط أوروبا بسلسلة جبال الألب الضخمة، لولا وجود معابر ومفازات جبلية تربطها بما يحيط بها من القارة."},{"page_url":"https://en.wikipedia.org/wiki/White-backed_woodpecker","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Dendrocopos_leucotos_2.jpg","page_title":"White-backed woodpecker","context_page_description":"The white-backed woodpecker is a Eurasian woodpecker belonging to the genus Dendrocopos."},{"page_url":"https://es.wikipedia.org/wiki/Juan_Ignacio_Mar%C3%ADa_de_Castorena_Urs%C3%BAa_y_Goyeneche","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Fama_y_obras_p%C3%B3stumas_del_F%C3%A9nix_de_M%C3%A9xico.jpg","page_title":"Juan Ignacio María de Castorena Ursúa y Goyeneche","context_page_description":"Juan Ignacio María de Castorena Ursúa y Goyeneche fue un sacerdote católico novohispano, se le considera el primer periodista de Hispanoamérica por haber creado la Gaceta de México\\""},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B5%D1%81%D0%BA%D0%B0%D0%B4%D1%80%D0%B5%D0%BD%D0%B8%D1%85_%D0%BC%D1%96%D0%BD%D0%BE%D0%BD%D0%BE%D1%81%D1%86%D1%96%D0%B2_%D0%92%D0%9C%D0%A1_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D1%97_%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/HMS_Birmingham_D86.jpg","page_title":"Список ескадрених міноносців ВМС Великої Британії","context_page_description":"Список ескадрених міноносців ВМС Великої Британії — перелік ескадрених міноносців Королівського флоту Великої Британії, які перебували на озброєнні ВМС Великої Британії з кінця XIX століття до теперішнього часу. Список представлений у хронологічному порядку, починаючи з 1890-х років, коли торпедні міноносці, котрі випускалися британськими суднобудівними компаніями у різних конфігураціях та дизайнах, почали об'єднувати в більш-менш однотипні класи: A, B, C та D. На той час класифікація відбувалася за швидкісними показниками, силовою установкою та кількістю труб. Фактично до 1913 року систематизації кораблів такого класу не було."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_prefeitos_do_Rio_de_Janeiro_(cidade)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Inocencio-Serzedelo-Correia.jpg","page_title":"Lista de prefeitos do Rio de Janeiro (cidade)","context_page_description":"Esta é a lista de governantes da cidade do Rio de Janeiro. No total a cidade já teve 52 governantes desde o fim do império."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D0%B0%D1%8F_%D0%9A%D0%B0%D0%B2%D0%B0%D0%BB%D0%B5%D1%9E%D1%88%D1%87%D1%8B%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/%D0%A4%D0%B5%D1%80%D0%BC%D0%B0_%D0%9C%D0%A2%D0%A4.jpg","page_title":"Малая Кавалеўшчына","context_page_description":"Мала́я Кавале́ўшчына — вёска ў Мёрскім раёне Віцебскай вобласці. Уваходзіць у склад Мёрскага сельсавета.\\nДа 2004 года ўваходзіла ў склад Чэраскага сельсавета."},{"page_url":"https://nl.wikipedia.org/wiki/Amilcare_Ponchielli","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Ponchielli_monument_in_Cremona_Italy.jpg","page_title":"Amilcare Ponchielli","context_page_description":"Amilcare Ponchielli was een Italiaans componist en muziekpedagoog."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%83%B3%E3%83%86%E3%82%A3%E3%82%A2%E3%82%B4%E3%83%BB%E3%83%87%E3%83%BB%E3%83%81%E3%83%AC%E5%A4%A7%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Planetario_USACH_4.jpg","page_title":"サンティアゴ・デ・チレ大学","context_page_description":"サンティアゴ・デ・チレ大学はチリの首都サンティアゴ・エスタシオン・セントラル区に所在する国立大学である。\\nスペイン語圏南アメリカで唯一大学レベル日本語専攻の存在する大学である。"},{"page_url":"https://en.wikipedia.org/wiki/Suzu","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/%E6%B5%A6%E5%AE%89%E3%83%8E%E8%88%9E%28%E5%BE%8C%E3%82%8D%E5%A7%BF%29.jpg","page_title":"Suzu","context_page_description":"Suzu is a round, hollow Japanese Shinto bell that contains pellets that sound when agitated. They are somewhat like a jingle bell in form, though the materials produce a coarse, rolling sound. Suzu come in many sizes, ranging from tiny ones on good luck charms to large ones at shrine entrances. It is, however, classified as a small bell since big bells are referred to as kane. The former is associated with Shinto and shrines while the latter is related to Buddhist temples and ceremonies.\\nAt Shinto shrines, large Suzu drape over entrances, as it is said that ringing them calls kami, allowing one to acquire positive power and authority, while repelling evil. Handheld clustered Suzu, similar to jingle bells, are used musically at Shinto ceremonies. There are ceremonies, for instance, where female performers dance with suzu bells such as those with some sort of short blade at its center. The bell's cool tinkles are also considered psychological air-conditioning for the summer since their clear ringing is considered cool and refreshing."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_v%C4%83n_h%C3%B3a_T%C3%A2y_Ban_Nha_%C4%91%C6%B0%E1%BB%A3c_quan_t%C3%A2m_%E1%BB%9F_Palma_de_Mallorca","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Esgl%C3%A9sia_de_Santa_Margalida_de_Palma.jpg","page_title":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở Palma de Mallorca","context_page_description":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở Palma de Mallorca."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Wuppertaler_Wohnquartier_Rott","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Wuppertal%2C_Thorner_Str._14%2C_Schr%C3%A4gsicht_von_links.jpg","page_title":"Liste der Baudenkmäler im Wuppertaler Wohnquartier Rott","context_page_description":"Die Liste der Baudenkmäler im Wuppertaler Wohnquartier Rott enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Wuppertal-Rott in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Wuppertal eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A1%E0%B5%8D%E0%B4%B0%E0%B4%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Draba_siliquosa_02.jpg","page_title":"ഡ്രബ","context_page_description":"കാബേജ് കുടുംബത്തിലെ ബ്രാസ്സിക്കേസീയിലെ സാധാരണ പൂച്ചെടികളുടെ ഒരു വലിയ ജനുസ്സാണ് ഡ്രബ. സാധാരണയായി ഇത് വെറ്റ്ലോ-ഗ്രാസ്സ് എന്നും അറിയപ്പെടുന്നു."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BB%8D%E9%9C%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/US_Navy_090523-N-5345W-230_Marines_from_the_22nd_Marine_Expeditionary_Unit_%2822_MEU%29_form_an_assembly_line_to_help_transfer_stores_from_the_flight_deck_after_they_were_delivered_to_the_amphibious_dock_landing_ship_USS_Fort_McHen.jpg","page_title":"軍需","context_page_description":"軍需泛指軍隊在和平或者是戰爭時期所需要的物資的總稱。這些物資當中可以概略分成日常生活和戰備所需兩類。"},{"page_url":"https://fr.wikipedia.org/wiki/Joyeuse_Entr%C3%A9e_(1356)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Jan3Brabant.jpg","page_title":"Joyeuse Entrée (1356)","context_page_description":"La Joyeuse Entrée est une charte accordée aux Brabançons, le 3 janvier 1356 à Louvain, par les ducs Jeanne de Brabant et son époux Wenceslas de Luxembourg, successeurs de Jean III.\\nCet acte reprenait de nombreux articles de la charte de Kortenberg et servit de base au droit public brabançon jusqu’à la fin du XVIIIᵉ siècle. Il reprenait l’ensemble des privilèges accordés par les précédents ducs, à côté de clauses nouvelles garantissant l’indivisibilité du duché et la spécificité brabançonne face à des ducs d’origine étrangère."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Maastricht/Grote_Staat","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Maastricht_-_rijksmonument_27059_-_Grote_Staat_39_20100523.jpg","page_title":"Lijst van rijksmonumenten in Maastricht/Grote Staat","context_page_description":"Een overzicht van de 35 rijksmonumenten in de stad Maastricht gelegen aan of bij de Grote Staat."},{"page_url":"https://da.wikipedia.org/wiki/%C3%85sg%C3%A5rdstrand","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Edvard_Munch%27s_house.jpg","page_title":"Åsgårdstrand","context_page_description":"Åsgårdstrand er en by i Horten kommune i Vestfold og Telemark fylke i Norge. Det er også navnet på en tidligere selvstændig kommune og et ladested.\\nÅsgårdstrand ligger ved Oslofjorden, ca. ti kilometer syd for Horten centrum og lige langt nord for Tønsberg. Åsgårdstrand har 2 932 indbyggere per 1. januar 2009, og strækker sig delvis ind i nabokommunen. Byen er fra 2007 klassifiseret som \\"turistby\\", da antal tilrejsende og besøgende er meget højt i forhold til bofaste. Dette medfører at samtlige butikker i den gamle bydel, kan holde søndagsåbent.\\nI småbyidyllen findes gallerier og udsalg for kunsthåndværkere. Her findes hotel, bageriudsalg og caféer med nybagte \\"Krabbelurer\\", købmand, bank, vinstue og pub."},{"page_url":"https://hr.wikipedia.org/wiki/Orf%C5%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Orf%C5%B1%2C_t%C3%B3rendszer_a_leveg%C5%91b%C5%91l.jpg","page_title":"Orfű","context_page_description":"Orfű je selo u južnoj Mađarskoj.\\nZauzima površinu od 32,15 km četvorna."},{"page_url":"https://en.wikipedia.org/wiki/2006_Commonwealth_Games_opening_ceremony","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Comm_Games_2006_flying_tram.JPG","page_title":"2006 Commonwealth Games opening ceremony","context_page_description":"The Opening Ceremony of the 2006 Commonwealth Games was held on 15 March 2006 at the Melbourne Cricket Ground in Melbourne, Victoria, Australia. The ceremony was conceived and produced by Jack Morton Worldwide"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%AA%E3%83%A5%E3%83%AA%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/REmpire_Illyricum.PNG","page_title":"イリュリア","context_page_description":"イリュリアは、古代ギリシア・ローマ時代に現バルカン半島の西部に存在した王国。\\nイリュリア語を話すイリュリア人によって建国され、共和政ローマによって滅ぼされた。\\nイリュリアの正確な姿は、現在の歴史家にも十分にはわかっていない。\\nイリュリア人の勢力範囲とイリュリア王国の領域とは必ずしも一致せず、さらに、\\nイリュリア王国の国境線はあいまいな部分がある。\\n例えば、ダルマティアは言語的にはイリュリア人に分類されるが、イリュリア王国には短期間しか所属していない。"},{"page_url":"https://de.wikipedia.org/wiki/Grammy_Award_for_Best_Rock_Performance_by_a_Duo_or_Group_with_Vocal","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/GreenDay21st.jpg","page_title":"Grammy Award for Best Rock Performance by a Duo or Group with Vocal","context_page_description":"Der Grammy Award for Best Rock Performance by a Duo or Group with Vocal, auf deutsch „Grammy-Award für die beste Rock-Performance eines Duos oder einer Gruppe mit Gesang“, ist ein Musikpreis, der bei den jährlich stattfindenden Grammy Awards verliehen wurde. Ausgezeichnet wurden Gruppen oder Duette von Musikern für besonders hochqualitative Werke, Einzelsongs oder Musikalben der Rockmusik. Seit 2012 ist dieser Preis der Kategorie Best Rock Performance zugeordnet."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%8A%D9%83%D8%AA%D9%88%D8%B1_%D8%A8%D9%88%D9%86%D8%AA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Wiki_ponta.jpg","page_title":"فيكتور بونتا","context_page_description":"فيكتور بونتا. محامي وسياسي روماني. وعضو في الحزب الديمقراطي الاجتماعي ورئيسه مُنذ عام 2010، خلف إميل بوك كرئيس وزراء رومانيا في مايو 2012، استقال من منصبه في يوم 4 نوفمبر 2015 بعد خلفية حريق نادي كوليكتيف وألأذي حصل في 30 أكتوبر 2015."},{"page_url":"https://hu.wikipedia.org/wiki/Antichan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Population_-_Municipality_code_65014.svg","page_title":"Antichan","context_page_description":"Antichan település Franciaországban, Hautes-Pyrénées megyében. Antichan Anla, Créchets, Gembrie, Ilheu, Samuran és Troubat községekkel határos."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%BE%D1%85%D1%83%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Bergbaumuseum_Bochum_Pano.jpg","page_title":"Бохум","context_page_description":"Бо́хум — місто в ФРН, у землі Північний Рейн-Вестфалія, один з великих промислових центрів Рурського індустріального району. Походження назви, за однією з версій, від старонім.: «Büch» або «Büchum», тому й гербом міста є книга. У сучасному вигляді місто дуже розтягнуте у довжину, перетинається багатьма лісовими та водними смугами. Як сучасне місто існує з кінця 1920-х років, коли адміністративною реформою поступово були об'єднані невеликі селища, напр. Герте, Віммельсгаузен і закінчився цей процес у 1975 році приєднанням до Бохума містечка Ваттеншайд.\\nІсторично економіка міста, як і усього Рурського регіону базувалася на видобутку вугілля у шахтах, багато з яких сьогодні закриті і зверху побудовані житлові масиви. Єдине велике підприємство, що є зараз у Бохумі — це три заводи фірми Adam Opel AG.\\nУ місті діють відомий драматичний театр, де грали й ставили відомі актори і режисери Петер Цадек, Райнер Вернер Фассбіндер, Х. Шмідт, Т. Шанцара, Рурський університет, з відомою на весь світ математичною школою, «Thürmer — Saal», де щороку проходить фортепіанний фестиваль «Klavierfestival Ruhr», симфонічний оркестр, який супроводжував напр."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_peixos_d%27Israel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Bep_chaetodon_paucifasciatus.jpg","page_title":"Llista de peixos d'Israel","context_page_description":"Aquesta llista de peixos d'Israel inclou 674 espècies de peixos que es poden trobar actualment a Israel ordenades per l'ordre alfabètic de llur nom científic."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B8%D1%81%D1%82%D0%B5%D1%86%D1%82%D0%B2%D0%BE_%D0%90%D0%BB%D0%B1%D0%B0%D0%BD%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Flag_of_Albania.svg","page_title":"Мистецтво Албанії","context_page_description":"Мистецтво Албанії відображає своїх колишніх конкістадорів, а саме: греків, римлян, і візантійців, що можна простежити в іконопису і в архітектурі церков. У релігійних картинах, мозаїках, і фресках простежується очевидний вплив ісламу. Такі постмодерністські художники, як Анрі Сала, Сіслей Ксхафа, і Хелідон Гіоргі, мають албанське походження. Статуя Ськандербега, встановлена в Тирані, є працею албанського скульптора Одіші Паскалі. Албанія є батьківщиною знаменитого поета Ісмаїла Кадаре. У країні весь рік проводяться різні кінофестивалі, але кіновиробництво і театр в країні недостатньо розвинені.\\nВ Албанії є громадська радіо- і ТВ-мовна станція Radio Televizioni Shqiptar. У національному театрі Албанії були поставлені і зіграні світові класичні п’єси, внаслідок чого він, безсумнівно, вносить свій внесок в культуру і мистецтво країн"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B1%B1%E6%B5%B7%E5%9C%B3%E7%B6%A0%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/%E5%B1%B1%E6%B5%B7%E5%9C%B3%E7%B6%A0%E9%81%93%E4%B8%80%E6%99%AF%EF%BC%8C%E9%B9%BD%E6%B0%B4%E6%BA%AA%E8%88%87%E4%BB%BF%E8%A3%BD%E6%8E%A5%E5%AE%98%E4%BA%AD.JPG","page_title":"山海圳綠道","context_page_description":"台江山海圳綠道，是台南市主要沿嘉南大圳的排水線、古直加弄圳舊圳道，串連台江內海與沿線安南、安定、新市、善化、官田等村落，台江國家公園、台灣歷史博物館、南科史前分館、曾文溪、官田、渡頭三座水橋，種樹築道，整治河川污染，由海佃國小《小台江》、台南社大台江分校、海尾朝皇宮等台江流域社群，共同倡議推動，成為台南市政府的旗艦計畫，整合台江國家公園、六河局、農田水利會等公私部門，從台江國家公園到烏山頭水庫，從安南區至官田區的人行及自行車道。\\n關鍵工程為穿越台南系統交流道連結東西兩端山海圳綠道之連通道。\\n部分路段屬於環島1號線。"},{"page_url":"https://oc.wikipedia.org/wiki/Palais_dau_Rore","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Palais_du_Roure_Avignon.JPG","page_title":"Palais dau Rore","context_page_description":"Lo Palais dau Rore es l'ancian Ostau dei Baroncelli-Javon a Avinhon.\\nFoguèt fondat per Pèire Baroncelli, un florentin que s'installèt a Avinhon en 1469. Au sègle XIX èra proprietat dau baron Folco de Baroncelli-Javon. Foguèt ansin un grand luòc d'activiatat dau Felibritge e es Frederic Mistral que li donèt son nom de Palais dau Rore.\\nEn 1908 foguèt mès en venta e crompat per Jeanne de Flandreysy per èstre sauvat. Foguèt legat a la villa d'avinhon e es ara un musèu."},{"page_url":"https://en.wikipedia.org/wiki/Georg_Jensen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Georg_Jensen_merken.JPG","page_title":"Georg Jensen","context_page_description":"Georg Arthur Jensen was a Danish silversmith and founder of Georg Jensen A/S."},{"page_url":"https://hr.wikipedia.org/wiki/Kalor_Milodanovi%C4%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Mise%C4%8Dna_kronika%2C_II_te%C4%8Daj%2C_br._1%2C_Subatica%2C_si%C4%8Dnja_15._1873.JPG","page_title":"Kalor Milodanović","context_page_description":"Kalor Milodanović je, bio je bački hrvatski novinar i jedan od nositelja hrvatskog nacionalnog preporoda u Bačkoj.\\nBorio se protiv mađarizacije. 23. rujna 1869. godine je zajedno s još nekim subotičkim intelektualcima, nositeljima hrvatskog nacionalnog preporoda u Bačkoj, uputio pismo potpore Ivanu Antunoviću. U tom pismu se izjasnio Dalmatincem.\\nKao preporoditelj nije značajan u promicanju hrvatske svijesti među bunjevačkim Hrvatima, jer je on zapravo promicao tezu da su \\"Bunjevci samo Bunjevci\\" i da nisu ni Hrvati ni Srbi. Tu tezu je promijenio kad je prebjegao u Srbiju, jer se ondje izjasnio Srbinom.\\nPreporoditeljski je bitan utoliko što se borio protiv mađarizacije i što je njegova borba za očuvanje nacionalne samobitnosti išla u tom pravcu da bunjevački Hrvati očuvaju svoj govor. Stoga je bio i pristašom teze da svi Bunjevci trebaju formirati svoj književni standard utemeljen na njihovoj štokavskoj ikavici, njihovom \\"posebnom putu\\", površno to argumentirajući kao posebnošću \\"bunjevačkog jezika\\", jer su tu istu štokavsku ikavicu koristila većina ostalih Hrvata sve do 1800-ih."},{"page_url":"https://pl.wikipedia.org/wiki/Piotr_Wielikij_(1872)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Ironclad_warship_Pyotr_Velikiy.jpg","page_title":"Piotr Wielikij (1872)","context_page_description":"Piotr Wielikij − rosyjski pancernik wieżowy, pierwszy pełnomorski okręt tej klasy w Marynarce Wojennej Imperium Rosyjskiego. Do służby wszedł w 1877. Po modyfikacjach służył podczas I wojny światowej. W Związku Radzieckim był nadal używany, jako jednostka pomocnicza, w okresie międzywojennym i podczas II wojny światowej. Ze składu jednostek floty został skreślony w 1959."},{"page_url":"https://en.wikipedia.org/wiki/Coast_Guard_of_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Adjara_2010_17.JPG","page_title":"Coast Guard of Georgia","context_page_description":"The Georgian Coast Guard is the maritime arm of the Georgian Border Police, within the Ministry for Internal Affairs. It is responsible for the maritime protection of the entire 310 km coastline of Georgia, as well as the Georgian territorial waters. The primary missions of the service are administration of the territorial waters, marine pollution protection, maritime law enforcement, search and rescue, port security and maritime defense. The former Georgian Navy was absorbed into the Coast Guard in 2009.\\nThe Georgian Navy was a branch of the Georgian Defense Ministry armed forces until 2009, when it was merged with the Coast Guard and transferred to the Ministry for Internal Affairs. Before the 2008 South Ossetia war, the Georgian Navy consisted of 19 vessels and 531 personnel of which 181 were officers, 200 NCOs, 114 conscripts and 36 civilians.\\nThe headquarters and a principal Coast Guard base are located at the Black Sea port of Poti. A second smaller base is in Batumi, Adjaria. Besides the Poti-based force, the Coast Guard also includes a special counter-terrorist Detachment."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%BF%91%E4%B8%96%E9%AB%98%E5%B2%A1%E3%81%AE%E6%96%87%E5%8C%96%E9%81%BA%E7%94%A3%E7%BE%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Shoko_Temple_2010.jpg","page_title":"近世高岡の文化遺産群","context_page_description":"近世高岡の文化遺産群とは、富山県高岡市にある、同県と同市がユネスコの世界遺産への登録を目指している文化財の総称。"},{"page_url":"https://fr.wikipedia.org/wiki/Sk%C3%A1lholt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/SkalholtInWinter.jpg","page_title":"Skálholt","context_page_description":"Skálholt est une localité islandaise de la municipalité de Bláskógabyggð située au sud de l'île, dans la région de Suðurland. Le village compte environ 160 habitants."},{"page_url":"https://es.wikipedia.org/wiki/Arciprestazgo_de_Huecha","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Iglesia_de_San_Juan_Bautista_%28Fuendejal%C3%B3n%29.JPG","page_title":"Arciprestazgo de Huecha","context_page_description":"El Arciprestazgo de Huecha es uno de los cinco arciprestazgos que componen la diócesis de Tarazona, junto a los de Tarazona, Calatayud, Alto Jalón y Bajo Jalón.​ En la actualidad el arcipreste es D. José María Sánchez Becerril, párroco de Fuendejalón.\\nEl arciprestazgo lo componen las parroquias:"},{"page_url":"https://nl.wikipedia.org/wiki/Murtin-et-Bogny","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Murtin-et-Bogny_%28Ardennes%29_city_limit_sign_Bogny.JPG","page_title":"Murtin-et-Bogny","context_page_description":"Murtin-et-Bogny is een gemeente in het Franse departement Ardennes en telt 142 inwoners. De plaats maakt deel uit van het arrondissement Charleville-Mézières."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%80%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Gare_de_Pornic_par_Cramos.JPG","page_title":"Порник","context_page_description":"Порни́к — коммуна на западе Франции, находится в регионе Пеи-де-ла-Луар. Департамент — Атлантическая Луара. Входит в состав кантона Порник. Округ коммуны — Сен-Назер. Население — 14 578 чел.\\nКод INSEE коммуны 44131.\\nКоммуна расположена приблизительно в 390 км к юго-западу от Парижа, в 45 км западнее Нанта."},{"page_url":"https://en.wikipedia.org/wiki/Poet_in_the_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Royal_Exchange_%283624902569%29.jpg","page_title":"Poet in the City","context_page_description":"Poet in the City brings poetry to life beyond books, digging out classic and contemporary gems and immersing audiences in the worlds of poets through events, commissions and participation.\\nPoet in the City is a prominent London-based arts organisation founded in 1998 as a project of the Poetry Society; it became an independent charity in 2006.\\nPoet in the City collaborates with leading partners from the arts and beyond, from the Barbican, Kings Place and the Royal Opera House to St Paul's Cathedral, the Francis Crick Institute and St Pancras International. They are experts in creating new audiences for poetry by presenting the art form in a way which is inspiring, celebratory and fun, and work with audiences of all ages, with different interests and backgrounds, and across sectors.\\nPoet in the City was awarded National Portfolio Organisation status in April 2011, in 2014 and again in 2017, meaning the organisation will receive regular funding from Arts Council England 2018 to 2022. It operates a mixed funding model, combining private and business philanthropy, earned income and public subsidy."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%9C%A7%E5%B3%B0%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/TW_THWtc118.png","page_title":"霧峰區","context_page_description":"雾峰区，为中华民国台中市最南端的市辖区，面积约98平方公里，为台中市面积第四大区，区内拥有完整公路系统，为台中市南端交通枢纽，亦为南投县与台中市之间重要的交通孔道。雾峰区因前台湾民意最高机关台湾省议会的设置为台湾民主化的发源地之一；亦为台湾中部较早开发区域，区内富有众多文史艺文设施，素有文化小城美名，因而近年积极发展博物馆文化。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%86%CE%B3%CE%B9%CE%BF%CE%B9_%CE%9A%CF%8D%CF%81%CE%B9%CE%BB%CE%BB%CE%BF%CF%82_%CE%BA%CE%B1%CE%B9_%CE%9C%CE%B5%CE%B8%CF%8C%CE%B4%CE%B9%CE%BF%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Bascanska_ploca.jpg","page_title":"Άγιοι Κύριλλος και Μεθόδιος","context_page_description":"Ο Άγιος Κύριλλος και ο Άγιος Μεθόδιος ήταν αδέλφια, Βυζαντινοί Χριστιανοί θεολόγοι και ιεραπόστολοι. Μέσω του έργου τους επηρέασαν την πολιτιστική ανάπτυξη όλων των Σλάβων, για αυτό πήραν τον τίτλο Απόστολοι των Σλάβων. Πιστώνονται με την επινόηση του Γλαγολιτικού αλφάβητου, του πρώτου αλφάβητου που χρησιμοποιήθηκε για τη μεταγραφή της Παλαιάς Εκκλησιαστικής Σλαβονικής γλώσσας. Μετά το θάνατό τους οι μαθητές τους συνέχισαν το ιεραποστολικό έργο τους μεταξύ άλλων Σλάβων. Και τα δύο αδέλφια τιμώνται στην Ορθόδοξη Εκκλησία ως άγιοι, με τον τίτλο των ισαποστόλων. Το 1880 ο Πάπας Λέων Η΄ εισήγαγε την εορτή τους στο ημερολόγιο της Ρωμαιοκαθολικής Εκκλησίας. Το 1980 ο Πάπας Ιωάννης Παύλος Β΄ τους ανακήρυξε συνπροστάτες αγίους της Ευρώπης, μαζί με το Βενέδικτο τον εκ Νουρσίας."},{"page_url":"https://es.wikipedia.org/wiki/Teplitsya_(Rai%C3%B3n_de_Artsyz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Teplytsia_Flag.png","page_title":"Teplitsya (Raión de Artsyz)","context_page_description":"Invernadero es una localidad del Raión de Artsyz en el Óblast de Odesa de Ucrania. Según el censo de 2001, tiene una población de 1672 habitantes."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Sint_Maartenspoort_(Maastricht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/2018-Maastricht%2C_kantoorgebouw_F_de_Veijestraat.jpg","page_title":"Lijst van gemeentelijke monumenten in Sint Maartenspoort (Maastricht)","context_page_description":"De buurt Sint Maartenspoort in de wijk Maastricht-Centrum in Maastricht heeft 114 gemeentelijke monumenten beschreven in 47 regels."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Vatimont","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Eglise_Vatimont.JPG","page_title":"Vatimont","context_page_description":"Vatimont sī ūi-tī Hoat-kok Lorraine toā-khu Moselle koān ê chi̍t ê commune."},{"page_url":"https://sk.wikipedia.org/wiki/1924","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/SidneyLumet07TIFF.jpg","page_title":"1924","context_page_description":"25. január až 5. február – Zimné olympijské hry, Chamonix, Francúzsko\\n8. február – Gee Jon, odsúdený za surovú vraždu, sa stal prvým popraveným v plynovej komore vo väznici amerického štátu Nevada\\n4. máj až 27. júl – Letné olympijské hry, Paríž, Francúzsko\\n24. jún – otvorenie Košickej mestskej nemocnice"},{"page_url":"https://zh.wikipedia.org/wiki/Sony_Xperia_P","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/2012_Sony_Mobile_LT22i_TW_silver_with_Android_4.1.2_default_face.jpg","page_title":"Sony Xperia P","context_page_description":"Sony Xperia P是索尼行動通訊於2012年推出，採用Android作業系統的中階智慧型手機，屬於Xperia NXT系列，於2012年國際消費電子展發布，比同時發表的Xperia S較為廉宜。\\nSony Xperia P採用一體成型鋁質金屬機身。規格採用1 GHz U8500雙核心處理器、內建16 GB快閃記憶體，4 吋防刮礦物玻璃TFT觸控顯示屏，960 x 540像素，支援1600萬色，並有White Magic技術，提升二倍亮度，並減少耗電量，提供更佳的白色顯示效果，另有BRAVIA顯示引擎。設有後置800萬像素鏡頭，具有自動對焦功能，提供8倍數碼變焦及LED閃光燈。前置30萬像素視訊鏡頭。\\nSony Xperia P推出時採用Android 2.3.7版本操作系統，索尼分別於2012年8月及2013年4月提供Android 4.0及Android 4.1.2的軟體升級。"},{"page_url":"https://pl.wikipedia.org/wiki/Muzeum_Diecezjalne_w_Genui","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Perin_del_vaga%2C_madonna_in_trono_e_santi%2C_1534-36%2C_da_s.giorgio_a_bavari_01.JPG","page_title":"Muzeum Diecezjalne w Genui","context_page_description":"Muzeum Diecezjalne – muzeum sztuki sakralnej, mieszczące się w byłym klasztorze kanoników kapituły katedralnej w Genui. Muzeum jest własnością archidiecezji Genui. W jego zbiorach znajdują się wykopaliska archeologiczne, ozdoby ze srebra, rzeźby, Poliptyk św. Bartłomieja Barnaby da Modena, obrazy pędzla takich artystów jak: Perino del Vaga, Luca Cambiaso, Domenico Fiasella i Gregorio De Ferrari oraz kolekcja tekstyliów."},{"page_url":"https://hsb.wikipedia.org/wiki/Starica","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Staritsa_COA_%28Tver_Governorate%29_%281780%29.png","page_title":"Starica","context_page_description":"Starica je městačko w Ruskej federaciji. Leži w europskim dźělu Ruskeje při rěce Wolga w Twerskej oblasći. Ma něhdźe 8 tysac wobydlerjow.\\nSydlišćo je so w lěće 1297 załožiło."},{"page_url":"https://sv.wikipedia.org/wiki/En_kammarsn%C3%A4rtas_upplevelser","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/C%C3%A9lestine-par-Jeanniot.JPG","page_title":"En kammarsnärtas upplevelser","context_page_description":"En kammarsnärtas upplevelser är en roman av Octave Mirbeau utgiven år 1900.\\nBoken, som kom i svensk översättning av Algot Ruhe 1926, handlar om kammarjungfrun Celestine R. som i dagboksform berättar om sina dekadenta upplevelser.\\nFlera scenbearbetningar av boken har gjorts. En rysk film av M. Martov med titeln Dnevnik gornitchnoi kom 1916. En amerikansk film, The Diary of a Chambermaid, regisserad av Jean Renoir gjordes 1946. År 1964 kom en fransk film, Le journal d'une femme de chambre, med Jeanne Moreau, Georges Géret och Michel Piccolo i rollerna. Regissör var Luis Buñuel. En teaterpjäs har gjorts av Andre Heuse, Andre de Lorde, och Thielly Nores. År 2004 kom en amerikansk teateruppsättning med titeln Diary of a Chambermaid producerad av Antonia Fairchild och regisserad av Adrian Giurgea. Pjäsen hade premiär i New York."},{"page_url":"https://fr.wikipedia.org/wiki/Relations_entre_Oman_et_la_Syrie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Oman-Syria_locator.png","page_title":"Relations entre Oman et la Syrie","context_page_description":"Les relations entre Oman et la Syrie sont les relations internationales entre le sultanat d'Oman et la République arabe syrienne. Oman dispose d'une ambassade à Damas, et la Syrie d'une ambassade à Mascate."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B5%D0%B2,_%D0%98%D0%BE%D1%81%D0%B8%D1%84_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B5%D0%B2_%D0%98%D0%BE%D1%81%D0%B8%D1%84_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87.JPG","page_title":"Дмитриев, Иосиф Александрович","context_page_description":"Иосиф Александрович Дмитриев — чувашский театральный режиссёр, актёр, этнотеатровед, педагог, драматург, поэт, переводчик, идеолог возрождения чувашской традиционной религии.\\nЗаслуженный деятель культуры Республики Казахстан, Заслуженный деятель искусств Чувашской республики."},{"page_url":"https://fr.wikipedia.org/wiki/Universit%C3%A9_Dankook","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/2_dankook_o.jpg","page_title":"Université Dankook","context_page_description":"L’université Dankook est une université privée sud-coréenne, fondée le 1ᵉʳ novembre 1947. Son campus principal est à Yongin."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B5%99%E6%B1%9F%E7%94%BB%E6%B4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Ma_Yuan_Walking_on_Path_in_Spring.jpg","page_title":"浙江画派","context_page_description":"浙江畫派，簡稱浙派，乃明代以江浙地區為中心的職業畫派。在山水畫方面，承繼了南宋院畫馬遠、夏圭的構圖與畫風，並融會北宋郭熙、李唐的大山水意識，以戴進、吳偉、藍瑛為浙派三大名家。在花鳥畫方面，以呂紀為代表，多以富吉祥寓意之禽鳥為題材，用放逸水墨描寫樹石坡渚襯托精筆刻畫的動物形姿。在職業畫與文人畫的抗衡交流中，浙派繪畫與時代進行深度的對話，影響著後繼與之並稱的「吳派」等繪畫流派。浙派繪畫浙派繪畫注重題材的生活意義，深入民間，帶動一股新的審美情趣，頗具市場價值及商業利益，受收藏家喜愛，亦深深影響著東北亞其他地區的繪畫藝術。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%81%D1%8C%D1%86%D0%B5%D1%80%D0%B0%D0%B4%D1%83%D0%B2_(%D0%B3%D0%BC%D0%B8%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Lub_Krasnicki_Goscieradow.png","page_title":"Госьцерадув (гмина)","context_page_description":"Госьцера́дув — сельская гмина в Польше, входит как административная единица в Красницкий повят, Люблинское воеводство. Население — 7411 человек."},{"page_url":"https://fr.wikipedia.org/wiki/Bobcat_Goldthwait","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Bobcat_Goldthwait_Deauville_2012.jpg","page_title":"Bobcat Goldthwait","context_page_description":"Robert Francis Goldthwait, dit Bobcat Goldthwait, également connu sous le nom de Bob Goldthwait, est un acteur, humoriste réalisateur, scénariste et producteur américain, né le 26 mai 1962 à Syracuse, New York."},{"page_url":"https://ro.wikipedia.org/wiki/Festigny,_Marne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Eglise_Saint-Laurent_de_Festigny.JPG","page_title":"Festigny, Marne","context_page_description":"Festigny este o comună în departamentul Marne, Franța. În 2009 avea o populație de 386 de locuitori."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%82%B1%E3%82%A4%E3%83%803301","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Cicada_3301_poster_locations.png","page_title":"シケイダ3301","context_page_description":"シケイダ3301とは、暗号解読者もしくは言語学者を一般から募るために、3回にわたって一連のパズルを投稿した組織に付けられたニックネームである。1回目のインターネット上でのパズルは2012年1月4日に始まり、約1か月間続いた。2回目は1年後の2013年1月4日に始まり、3回目は2014年1月4日にTwitterへの新たなヒントの投稿が確認された後に始まった。表明された目的は、一連の解読されるべきパズルを提示することによって「高度な知的能力を持った人物」を募ることであった。2015年1月4日には新しいパズルは公開されなかったが、2016年1月4日に新しいヒントがTwitterに投稿された。2017年4月、「誤った道に注意せよ。常に7A35090FからPGP署名を検証せよ」という内容の検証されたPGP署名付きのメッセージが発見された。このメッセージは2017年4月以前のすべての署名の無いパズルの正当性を明確に否定した。\\nこのパズルはデータの機密保護、暗号理論、ステガノグラフィーに重点を置いている。\\n「インターネット時代における最も複雑でミステリアスなパズル」と呼ばれ 、「インターネットの最も不気味な未解決ミステリーのトップ5」の一つに挙げられており、その役割については様々な憶測が存在している。多くの者がこのパズルはNSA、CIA、MI6、サイバー傭兵グループの人材採用ツール、または「フリーメイソンの陰謀」 だと推測している。また、シケイダ3301は代替現実ゲームであるという意見もある。しかしながら手柄のために名乗り出たり、収益化を試みた団体や個人は存在しない。"},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Ranskan_merivoimien_aluksista","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Dumondurville.jpg","page_title":"Luettelo Ranskan merivoimien aluksista","context_page_description":"Luettelo Ranskan laivaston aluksista listaa Ranskan merivoimien syyskuussa 2013 palveluksessa olleet alukset.\\nRanskan merivoimat muodostuvat 84 pinta-aluksesta ja kymmenestä sukellusveneestä. Näistä merkittävimpiä ovat lentotukialus, kolme maihinnousutukialusta, yksi maihinnousualus, neljä ilmatorjuntahävittäjää, kuusi sukellusveneidentorjuntafregattia ja yksitoista fregattia. Sukellusvenejoukkoihin kuuluu kuusi hyökkäyssukellusvenettä ja neljä strategista mannertenvälisin ohjuksin varustettua sukellusvenettä. Merivoimien taisteluosien tukena on neljä kevyttä tankkeria. Lueteltujen lisäksi on vielä seitsemän valtamerihinaajaa ja kaksitoista koululaivaa."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CF%81%CF%8E%CF%84%CE%B7_%CE%A4%CF%83%CE%B5%CF%87%CE%BF%CF%83%CE%BB%CE%BF%CE%B2%CE%B1%CE%BA%CE%B9%CE%BA%CE%AE_%CE%94%CE%B7%CE%BC%CE%BF%CE%BA%CF%81%CE%B1%CF%84%CE%AF%CE%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/Czechoslovakia1920-38.jpg","page_title":"Πρώτη Τσεχοσλοβακική Δημοκρατία","context_page_description":"Ως Πρώτη Τσεχοσλοβακική Δημοκρατία είναι γνωστή η μεσοπολεμική Τσεχοσλοβακία. Στην καθομιλουμένη, η χώρα ήταν γνωστή ως Τσεχοσλοβακία. Αποτελούνταν από την Βοημία, τη Μοραβία, την Τσεχική Σιλεσία, την Σλοβακία και την Υποκαρπάθια Ουκρανία.\\nΜετά το 1933, η Τσεχοσλοβακία ήταν η μόνη λειτουργική δημοκρατία στην Κεντρική Ευρώπη. Λόγω πίεσης από την γερμανόφωνη μειονότητα των Σουδητών, οι οποίοι υποστηρίζονταν από την Ναζιστική Γερμανία, η Τσεχοσλοβακία αναγκάστηκε να παραχωρήσει την Σουδητία στην Γερμανία στις 1 Οκτωβρίου 1938 ως μέρος της Σμυφωνίας του Μονάχου. Επίσης αναγκάστηκε να παραχωρήσει μέρη της νότιας Σλοβακίας και την Ρουθηνία των Καρπαθίων στην Ουγγαρία, ενώ η περιοχή του Ζαόλζιε παραχωρήθηκε στην Πολωνία. Αυτό το γεγονός ήταν το τέλος της πρώτης Δημοκρατίας. Αντικαταστάθηκε από την Δεύτερη Τσεχοσλοβακική Δημοκρατία, η οποία διήρκεσε μέχρι τον Μάρτιο του 1939, όταν η Γερμανία κατέλαβε την υπόλοιπη Τσεχοσλοβακία, προσαρτώντας τη μισή Τσεχοσλοβακία στη Γερμανία ενώ το υπόλοιπο παραχωρήθηκε στην ανεξάρτητη Σλοβακία."},{"page_url":"https://lt.wikipedia.org/wiki/Kiduli%C5%B3_pagrindin%C4%97_mokykla","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Mokykla_ruden%C4%AF.jpeg","page_title":"Kidulių pagrindinė mokykla","context_page_description":"Šakių rajono Kidulių pagrindinė mokykla – dieninė, savarankiško mokymosi bendrojo lavinimo mokykla Kiduliuose, Nemuno g. 51, vykdanti priešmokyklinio, pradinio, pagrindinio ir papildomo ugdymo programas lietuvių kalba. Įstaigos kodas 190820942. Steigėjas Šakių rajono savivaldybės taryba.\\nFilialai:\\nKidulių pagrindinės mokyklos Voverių skyrius;\\nKidulių pagrindinės mokyklos Bunikių pradinio ugdymo skyrius;\\nKidulių pagrindinės mokyklos Žygėnų pradinio ugdymo skyrius;\\nKidulių pagrindinės mokyklos Sudargo Martyno Sederevičiaus pagrindinio ugdymo skyrius"},{"page_url":"https://es.wikipedia.org/wiki/Rosell%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Bandera_de_Rossell%C3%B3.svg","page_title":"Roselló","context_page_description":"Roselló, en catalán y oficialmente Rosselló, ​ es un municipio español de la comarca del Segriá, en la provincia de Lérida, Cataluña, situado al norte de la capital comarcal."},{"page_url":"https://de.wikipedia.org/wiki/Hafen_von_Limassol","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Straddle_Carrier_Cyprus.jpg","page_title":"Hafen von Limassol","context_page_description":"Der Hafen von Limassol ist der bedeutendste Hafen Zyperns."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%A2%D3%99%D2%A3%D1%80%D0%B5%D0%BA%D2%AF%D0%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Flag_of_Almenevsky_rayon_%28Kurgan_oblast%29.png","page_title":"Тәңрекүл","context_page_description":"Тәңрекүл — Ҡурған өлкәһенең Әлмән районында урынлашҡан башҡорт ауылы, Тәңрекүл ауыл советының административ үҙәге.\\nПочта индексы — 641141, ОКАТО коды — 37202830001."},{"page_url":"https://hu.wikipedia.org/wiki/Neunkirchen_(Baden-W%C3%BCrttemberg)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Neckarkatzenbach-rathaus1843.jpg","page_title":"Neunkirchen (Baden-Württemberg)","context_page_description":"Neunkirchen település Németországban, azon belül Baden-Württembergben. Lakosainak száma 1867 fő. +/-"},{"page_url":"https://fr.wikipedia.org/wiki/Ghourd_(dune)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Sossusvlei_LandSat7.jpg","page_title":"Ghourd (dune)","context_page_description":"Un ghourd est une dune pyramidale, étoilée, dominante et formée par des convergences de siouf. Ces dunes naissant à la convergence de plusieurs flux éoliens paraissent immobiles. Ces édifices issus de l'accumulation éolienne peuvent dépasser 200–300 m de haut. Au pied d'un ghourd, on trouve des dépressions appelées « chaudrons ». Les ghourds font partie des plus grands édifices dunaires de la planète.\\nEn géomorphologie dynamique, ils font partie des modelés éoliens ou encore des formations superficielles sableuses du domaine aride ou semi-aride."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Denkmale_und_Skulpturen_in_Radebeul","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/MoritzZillerGedenkstelle1.JPG","page_title":"Liste der denkmalgeschützten Denkmale und Skulpturen in Radebeul","context_page_description":"Die Liste der denkmalgeschützten Denkmale und Skulpturen in Radebeul gibt eine Übersicht über heutige Denkmale und Skulpturen in der sächsischen Stadt Radebeul, die unter Denkmalschutz stehen."},{"page_url":"https://ast.wikipedia.org/wiki/Campu_magn%C3%A9ticu_terrestre","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Brunhes_geomagnetism_western_US.png","page_title":"Campu magnéticu terrestre","context_page_description":"El campu magnéticu terrestre, ye'l campu magnéticu que s'estiende dende'l nucleu internu de la Tierra hasta la llende nel que s'atopa col vientu solar; una corriente de partícules enerxétiques que emana del Sol. La so magnitú na superficie de la Tierra varia de 25 a 65 µT o. Puede considerase n'aproximamientu'l campu creáu por un dipolo magnéticu inclináu un ángulu de 15 graos con respectu a la exa de rotación. Sicasí, al contrariu que'l campu d'un imán, el campu de la Tierra camuda col tiempu porque se xenera pol movimientu d'aleaciones de fierro fundíu nel nucleu esternu del planeta tierra. El polu norte magnéticu muévese, pero d'una manera abondo lenta como por que les brúxules sían útiles nel saléu. Al cabu de ciertos periodos de duración aleatoria, el campu magnéticu de la Tierra inviértese. Estes inversiones dexen un rexistru nes roques que dexen a los paleomagnetistas calcular la deriva de continentes nel pasáu y los fondos oceánicos resultancia de la teutónica de plaques.\\nLa rexón percima de la ionosfera —que s'estiende delles decenes de miles de kilómetros nel espaciu— ye llamada la magnetosfera."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%B3%D0%BE%D1%80%D0%B0%D1%84%D0%BE%D0%B1%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Agora_of_the_Competaliasts_01_%28cropped%29.jpg","page_title":"Агорафобия","context_page_description":"Агорафобия е вид тревожно разстройство – фобия, страх, изпитван при преминаване през големи открити пространства. Това състояние може да се придружава или не от пристъпи на паника.\\nПри хората страдащи от агорафобия, страхът може да се проявява при напускане на дома, преминаването през обществени места, смесване с тълпи, пътуване сам. Основният проблем на страдащите е, че нямат възможност за бърз изход от кризисна ситуация."},{"page_url":"https://hu.wikipedia.org/wiki/%C3%89szaki_bronzkor","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Nordic_Bronze_Age.png","page_title":"Északi bronzkor","context_page_description":"Az északi bronzkor egy történelmi korszak és egy bronzkori kultúra neve Skandináviában, Kr. e. 1800–Kr. e. 500 körül. Az elnevezés Oscar Monteliustól származik. Ezt a zsinegdíszes edények kultúráját követő kultúrát általában a proto-római vaskori ősgermán kultúra közvetlen elődjének tekintik."},{"page_url":"https://pl.wikipedia.org/wiki/Tamano","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Tamano_city-office.jpg","page_title":"Tamano","context_page_description":"Tamano – miasto w Japonii, w południowej części wyspy Honsiu, w prefekturze Okayama."},{"page_url":"https://en.wikipedia.org/wiki/Elizabeth_Stride","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/MiddlesexStretcEddowes.Ripper..c.1890.jpg","page_title":"Elizabeth Stride","context_page_description":"Elizabeth \\"Long Liz\\" Stride is believed to have been the third victim of the unidentified serial killer known as Jack the Ripper, who killed and mutilated a minimum of five women in the Whitechapel and Spitalfields districts of London from late August to early November 1888.\\nUnlike the other four canonical Ripper victims, Stride had not been mutilated following her murder, leading some historians to suspect Stride had not actually been murdered by Jack the Ripper. However, Stride's murder occurred less than one hour before the murder of the Ripper's fourth canonical victim, Catherine Eddowes, within walking distance, and her act of murder is suspected to have been disturbed by an individual entering the crime scene upon a two-wheeled cart. In addition, both women had been murdered by slash wounds to the throat, leading most authors and researchers to consider Stride to be the third of the Ripper's canonical five victims.\\nStride was nicknamed \\"Long Liz\\". Several explanations have been given for this pseudonym; some believe it sources from her married surname, while others believe this is a reference to either her height, or her general facial structure."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_bysantinska_monarker","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Phocas_%28emperor%29.jpg","page_title":"Lista över bysantinska monarker","context_page_description":"De bysantinska kejsarna och kejsarinnorna innehade makten i det romerska riket från och med att Konstantin den store bytt huvudstaden till Konstantinopel år 330. Efter kejsardömets slutliga delning in i två administrativa indelningar år 395 och det västromerska rikets fall år 476 fortsatte de bysantinska kejsarna att regera över det östromerska riket från huvudstaden Konstantinopel. Deras rike kallas från och med det västromerska rikets fall 476 oftast för det bysantinska riket för att skilja på antikens romerska rike och den medeltida stat som utvecklades ur de \\"överlevande\\" östliga provinserna. Därav kallas rikets monarker för bysantinska monarker trots att detta inte är en beteckning de själva hade varit bekanta med.\\nKejsare till och med Theodosius I:s död år 395 var antingen medregenter eller kejsare över hela det romerska kejsardömet. Efter 395 regerade kejsarna i den här listan de östliga provinserna fram till det västromerska rikets fall år 476."},{"page_url":"https://fr.wikipedia.org/wiki/Louis-Simon_Auger","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Louis-Simon_Auger_par_Boilly.jpg","page_title":"Louis-Simon Auger","context_page_description":"Louis-Simon Auger, né le 29 décembre 1772 à Paris où il est mort le 2 janvier 1829, est un journaliste, critique littéraire et dramaturge français.\\nCenseur royal, académicien puis secrétaire perpétuel, son activité littéraire a surtout consisté à éditer les classiques et à rédiger des notices dont certaines n’ont pas échappé à la moquerie."},{"page_url":"https://nl.wikipedia.org/wiki/Solid_state_(elektronica)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/RELEcomat.jpg","page_title":"Solid state (elektronica)","context_page_description":"De term solid state wordt gebruikt in de elektronica om onderdelen, schakelingen of apparaten aan te duiden waarin halfgeleider-onderdelen worden gebruikt in plaats van elektronenbuizen en bewegende onderdelen.\\nDe elektronen en andere ladingsdragers bevinden zich daarbij uitsluitend in vaste stoffen, en er wordt geen gebruik gemaakt van elektromechanische onderdelen en bewegende delen.\\nDe term raakte in gebruik in de jaren 1950 en 1960, bij de overgang van elektronenbuizen naar halfgeleidertechnologie.\\nEen vroege vorm van zo een onderdeel is de kristaldetector."},{"page_url":"https://sv.wikipedia.org/wiki/Danska_brigaden","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/The_arrival_of_the_Danish_brigade_on_the_days_of_liberation._%C3%98sterbrogade%2C_Copenhagen._Photo_Flemming_Wolf-Frederiksen.jpg","page_title":"Danska brigaden","context_page_description":"Danska brigaden, Danforce, var en militär enhet bestående av danska flyktingar som utbildades i Sverige 1943–1945. Brigaden var tänkt att användas i Operation rädda Danmark men då operationen ej blev av överfördes brigaden från Helsingborg till Helsingör i Danmark den 5 maj 1945.\\nVid krigets slut omfattade brigaden 3 600 man, och leddes av den danske generalmajoren Kristian Knudtzon."},{"page_url":"https://pl.wikipedia.org/wiki/Port_lotniczy_Kota_Kinabalu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/0318_184743.jpg","page_title":"Port lotniczy Kota Kinabalu","context_page_description":"Port lotniczy Kota Kinabalu – międzynarodowy port lotniczy położony 8 km od Kota Kinabalu. Jest drugim co do wielkości portem lotniczym w Malezji. W 2010 obsłużył ponad 5 mln pasażerów. Jest główną bramą do stanu Sabah i na Borneo. Nowy Terminal 1 ma 64 odpraw dla lotów krajowych i międzynarodowych; 17 zatok dla samolotów mogących pomieścić zarówno szerokie i wąskie samolotów i budynek terminala może obsługiwać 3200 pasażerów na godzinę."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Bristol","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Arnos_Manor_Hotel_2.jpg","page_title":"Grade II* listed buildings in Bristol","context_page_description":"There are 212 Grade II* listed buildings in Bristol, England.\\nIn England and Wales the authority for listing is granted by the Planning Act 1990 and is administered by English Heritage, an agency of the Department for Culture, Media & Sport\\nIn the United Kingdom the term listed building refers to a building or other structure officially designated as being of special architectural, historical or cultural significance."},{"page_url":"https://no.wikipedia.org/wiki/Copenhagen_Jazzhouse","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Copenhagen_Jazzhouse.jpg","page_title":"Copenhagen Jazzhouse","context_page_description":"Copenhagen Jazzhouse er en internasjonal jazzscene i København som ble åpnet i 1991 av jazzklubben med samme navn. Årlig avholdes det om lag 200 konserter på denne jazzklubben, med både danske og internasjonale stjerner."},{"page_url":"https://en.wikipedia.org/wiki/Toxostoma","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Brown_Thrasher-27527-2.jpg","page_title":"Toxostoma","context_page_description":"Toxostoma is a genus of bird in the family Mimidae. All members of this genus are called thrashers, but there are other birds in the family Mimidae also bearing this title. Birds in the genus Toxostoma are considered \\"typical thrashers\\", and this genus makes up the largest group of thrashers, all but a few other species occurring each in their own genus. A group of these birds are commonly referred to as a “threat” of thrashers.\\nThe genus name Toxostoma comes from the Ancient Greek toxon, \\"bow\\" or \\"arch\\" and stoma, \\"mouth\\".\\nThe genus contains the following species:\\nOcellated thrasher\\nBrown thrasher\\nCozumel thrasher\\nBendire's thrasher\\nCurve-billed thrasher\\nLeConte's thrasher\\nCrissal thrasher\\nCalifornia thrasher\\nGrey thrasher\\nLong-billed thrasher\\nA group of thrashers is commonly referred to as a threat."},{"page_url":"https://es.wikipedia.org/wiki/Armada_del_imperio_austr%C3%ADaco","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/SMS_Novara_1868.jpg","page_title":"Armada del imperio austríaco","context_page_description":"La Armada del imperio austríaco era la rama naval de sus fuerzas armadas. Tuvo su origen en la flotilla del danubio del siglo XVI y desde finales del siglo XVIII en la flota del mediterráneo. Con el compromiso de 1867, la marina se vio reformada dando paso a la armada austrohúngara o Marina de Guerra Imperial y Real."},{"page_url":"https://is.wikipedia.org/wiki/Ott%C3%B3_I_(HRR)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Lechfeld1457.jpg","page_title":"Ottó I (HRR)","context_page_description":"Otto I var konungur og keisari þýska ríkisins af ætt Liudolfinger. Hann var einnig konungur Ítalíu. Otto I er gjarnan kallaður Otto hinn mikli."},{"page_url":"https://ca.wikipedia.org/wiki/Ana_Leop%C3%B3ldovna_de_Mecklenburg-Schwerin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Anna_Leopoldovna_by_L.Caravaque_%28c.1740%2C_Russian_museum%29.jpg","page_title":"Ana Leopóldovna de Mecklenburg-Schwerin","context_page_description":"Ana Leopóldovna de Mecklenburg-Schwerin també coneguda com a Ana Kárlovna, regent de Rússia per uns mesos durant la minoria del seu fill Ivan VI.\\nEra filla de la princesa Catalina Ivánovna i del duc Carles Leopold de Mecklemburg-Schwerin. En convertir-se el 1732 al dogma de l'Església grega, rebé el nom d'Anna; el 1739 va contraure matrimoni amb el príncep Antonio Ulrico de Brunswick-Wolfenbüttel, i el 1740 tingué un fill, el príncep Ivan VI, que fou designat per l'emperadriu Anna per a succeir-la en el tron sota la regència de Ernst Johann von Biron. Quan aquest va caure en desgràcia amb la mare del jove emperador per culpa del feldmamariscal Münnich, Anna es va fer proclamar regent, i nomenà primer ministre a Münnich, el qual, no obstant va dimitir del seu càrrec el 13 de març de 1741. Va mantenir relacions amoroses amb el diplomàtic saxó Lynar, que tingué de casar-se amb l'amiga d'Anna, Julia von Mengden."},{"page_url":"https://pl.wikipedia.org/wiki/Latarnia_(architektura)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/2014_Bo%C5%BCk%C3%B3w%2C_ko%C5%9Bci%C3%B3%C5%82_%C5%9B%C5%9B._Piotra_i_Paw%C5%82a_22.JPG","page_title":"Latarnia (architektura)","context_page_description":"Latarnia – cylinder umieszczony na górnym pierścieniu kopuły lub na dachu, z otworami doświetlającymi wnętrze. Budowana zwykle na planie koła lub wieloboku foremnego. Latarnia zazwyczaj przykrywana była hełmem, a jej ściany często zdobione były spływami wolutowymi, pilastrami, kolumienkami lub hermami.\\nW średniowieczu na skrzyżowaniu naw i transeptu budowano doświetlające wieże-latarnie. W renesansie i baroku często stosowane jako zwieńczenie kopuł. W Polsce ze znanych kopuł z latarnią należy wymienić przykrycie Kaplicy Zygmuntowskiej na Wawelu.\\nLatarnią nazywana jest także nadbudówka z oknami nad dachem doświetlająca pomieszczenie pod nim."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9F%E0%B8%B8%E0%B8%95%E0%B8%9A%E0%B8%AD%E0%B8%A5%E0%B9%82%E0%B8%A5%E0%B8%81%E0%B8%AB%E0%B8%8D%E0%B8%B4%E0%B8%87_1991","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/FIFA_Womens_World_Cup_1991.png","page_title":"ฟุตบอลโลกหญิง 1991","context_page_description":"ฟุตบอลโลกหญิง 1991 เป็นการแข่งขันฟุตบอลโลกหญิง ครั้งที่ 1 จัดขึ้นระหว่างวันที่ 16-30 พฤศจิกายน พ.ศ. 2534 จัดขึ้นที่ กว่างโจว สาธารณรัฐประชาชนจีน"},{"page_url":"https://eo.wikipedia.org/wiki/Meuro","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Feldsteinkirche_in_Meuro_bei_Luth_Wittenberg.jpg","page_title":"Meuro","context_page_description":"Meuro [MOJro:] estas parto de la urba komunumo Bad Schmiedeberg en Germanio. Ĝis la 30a de junio 2009 Meuro estis memstara komunumo. Meuro situas en la distrikto Wittenberg de la federacia lando Saksio-Anhalto. La 31-an de decembro 2007 Meuro havis 608 loĝantojn. La lasta urbestro estis Volker Barth, kiu nun estas urbestro de la komunuma parto.\\nVidindas la preĝejo de Meuro."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%BC%BB%E9%B1%BC%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Naso_tonganus.jpg","page_title":"鼻鱼属","context_page_description":"鼻鱼属，是刺尾鱼科的一个属，因前额具有形似独角的长刺而得名。分布于非洲到夏威夷的印度洋和太平洋海域的珊瑚礁海域。"},{"page_url":"https://en.wikipedia.org/wiki/Kabukimono","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Okuni_with_cross_dressed_as_a_samurai.jpg","page_title":"Kabukimono","context_page_description":"Kabukimono or hatamoto yakko were gangs of samurai in feudal Japan. First appearing in the Azuchi-Momoyama period as the turbulent Sengoku period drew to a close, kabukimono were either rōnin, wandering samurai, or men who had once worked for samurai families - who, during times of peace, formed street gangs. Some, however, were also members of more prominent clans — most notably Oda Nobunaga and Maeda Toshiie.\\nThe term \\"kabukimono\\" is often translated into English as \\"strange things\\" or \\"the crazy ones\\", believed to be derived from kabuku, meaning \\"to slant\\" or \\"to deviate\\"; the term is also the origin of the name for kabuki theatre, as kabuki's founder, Izumo no Okuni, took heavy inspiration from the kabukimono.\\nKabukimono would often dress in flamboyant clothing, combining bold colours such as yellow and blue, often accessorised by wearing haori jackets with lead weights in the hem, velvet lapels, wide obi belts, elements of European clothing or even women's clothes.\\nKabukimono also often had uncommon hairstyles and facial hair, either styled up in various fashions, or left to grow long."},{"page_url":"https://en.wikipedia.org/wiki/Kabukimono","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Okuni_with_cross_dressed_as_a_samurai.jpg","page_title":"Kabukimono","context_page_description":"Kabukimono or hatamoto yakko were gangs of samurai in feudal Japan. First appearing in the Azuchi-Momoyama period as the turbulent Sengoku period drew to a close, kabukimono were either rōnin, wandering samurai, or men who had once worked for samurai families - who, during times of peace, formed street gangs. Some, however, were also members of more prominent clans — most notably Oda Nobunaga and Maeda Toshiie.\\nThe term \\"kabukimono\\" is often translated into English as \\"strange things\\" or \\"the crazy ones\\", believed to be derived from kabuku, meaning \\"to slant\\" or \\"to deviate\\"; the term is also the origin of the name for kabuki theatre, as kabuki's founder, Izumo no Okuni, took heavy inspiration from the kabukimono.\\nKabukimono would often dress in flamboyant clothing, combining bold colours such as yellow and blue, often accessorised by wearing haori jackets with lead weights in the hem, velvet lapels, wide obi belts, elements of European clothing or even women's clothes.\\nKabukimono also often had uncommon hairstyles and facial hair, either styled up in various fashions, or left to grow long."},{"page_url":"https://pl.wikipedia.org/wiki/Hekate","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Hecate%2C_Greek_goddess_of_the_crossroads_by_St%C3%A9phane_Mallarm%C3%A9.jpg","page_title":"Hekate","context_page_description":"Hekate – w mitologii grecko-rzymskiej przede wszystkim bogini ciemności, czarów, magii oraz świata istot i zjawisk nadprzyrodzonych."},{"page_url":"https://en.wikipedia.org/wiki/Posterior_vagal_trunk","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Gray793.png","page_title":"Posterior vagal trunk","context_page_description":"The posterior vagal trunk is a branch of the vagus nerve which contributes to the esophageal plexus. It consists primarily of fibers from the right vagus, but also contains a few fibers from the left vagus."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkmale_in_Springe","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Trauerweide_L%C3%BCdersen.JPG","page_title":"Liste der Naturdenkmale in Springe","context_page_description":"Die Liste der Naturdenkmale in Springe nennt die Naturdenkmale in Springe in der Region Hannover in Niedersachsen."},{"page_url":"https://en.wikipedia.org/wiki/Hajj","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Sa%27yee_For_older.jpg","page_title":"Hajj","context_page_description":"The Hajj is an annual Islamic pilgrimage to Mecca, Saudi Arabia, the holiest city for Muslims. Hajj is a mandatory religious duty for Muslims that must be carried out at least once in their lifetime by all adult Muslims who are physically and financially capable of undertaking the journey, and can support their family during their absence.\\nIn Islamic terminology, Hajj is a pilgrimage made to the Kaaba, the \\"House of God\\", in the sacred city of Mecca in Saudi Arabia. It is one of the Five Pillars of Islam, alongside Shahadah, Salat, Zakat and Sawm. The Hajj is a demonstration of the solidarity of the Muslim people, and their submission to God. The word Hajj means \\"to attend a journey\\", which connotes both the outward act of a journey and the inward act of intentions.\\nThe rites of pilgrimage are performed over five to six days, extending from the 8th to the 12th or 13th of Dhu al-Hijjah, the last month of the Islamic calendar. Because the Islamic calendar is lunar and the Islamic year is about eleven days shorter than the Gregorian year, the Gregorian date of Hajj changes from year to year. In 2020 AD, Dhu al-Hijjah extends from 22 July to 19 August."},{"page_url":"https://fr.wikipedia.org/wiki/Poilcourt-Sydney","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Poilcourt-Sydney-FR-08-%C3%A9glise-05.JPG","page_title":"Poilcourt-Sydney","context_page_description":"Poilcourt-Sydney est une commune française, située dans le département des Ardennes en région Grand Est. Le nom Sydney a été ajouté après la Première Guerre mondiale à la suite de l'aide que la ville australienne a apportée à sa reconstruction."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D9%88%D9%85%D8%B1%D8%B2%D8%8C_%D9%86%DB%8C%D9%88%DB%8C%D9%88%D8%B1%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Elephant_Hotel_2007.jpg","page_title":"سومرز، نیویورک","context_page_description":"سومرز آمریکانین نیویوک ایالتینده یئرلشن بیر شهر. ۲۰۱۸-جی ایلده وئریلن معلوماتا گؤره اهالیسینین سایی ۲۱۳۴۵ نفر ایدی."},{"page_url":"https://de.wikipedia.org/wiki/Vasc%C5%93uil","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/2012--DSC_0248-Chateau-de-Vascoeuil.jpg","page_title":"Vascœuil","context_page_description":"Vascœuil ist eine französische Gemeinde mit 353 Einwohnern im Département Eure in der Region Normandie. Sie gehört zum Arrondissement Les Andelys und zum Kanton Romilly-sur-Andelle. Die Einwohner werden Vascœuillais genannt."},{"page_url":"https://de.wikipedia.org/wiki/Little_Smoky_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Peace_River_Watershed.png","page_title":"Little Smoky River","context_page_description":"Der Little Smoky River ist ein rechter Nebenfluss des Smoky River in der kanadischen Provinz Alberta.\\nDer Little Smoky River entspringt am Fuße der Kanadischen Rocky Mountains südöstlich von Grande Cache. Er fließt anfangs in östlicher Richtung. Etwa 20 km südwestlich von Fox Creek ändert der Fluss seine Richtung nach Norden. Nach etwa 350 km erreicht der Little Smoky River südlich von Watino den Smoky River. Am Pegel bei Guy beträgt der mittlere Abfluss des Little Smoky River 48 m³/s."},{"page_url":"https://de.wikipedia.org/wiki/Grenzschichtabl%C3%B6sung","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Flow_separation.jpg","page_title":"Grenzschichtablösung","context_page_description":"Grenzschichtablösung ist ein strömungsmechanischer Effekt, der bewirkt, dass eine Strömung der Kontur eines umströmten Körpers nicht folgt, siehe Abbildung rechts. Stromabwärts der Ablösestellen bildet sich zwischen der laminaren Hauptströmung und der Körperkontur ein verwirbelter Bereich, oft auch als Totwasser oder Nachlauf bezeichnet. Bei genügend großer Ausdehnung des Körpers kann sich die Strömung an anderer Stelle wieder an den Körper anlegen. Der verwirbelte Bereich zwischen Ablöse- und Wiederanlegestelle bildet eine Ablöseblase.\\nGrenzschichtablösungen sind die Ursache von Strömungsabrissen mit oftmals unerwünschten, teilweise dramatischen Auswirkungen. Grenzschichtablösungen an Tragflügeln vermindern den Auftrieb, was bei Flugzeugen zu Abstürzen führen kann. Auch in Strahltriebwerken kann es zu Grenzschichtablösungen kommen, was einen Zusammenbruch der Antriebsleistung zur Folge haben kann. Aerodynamisch bewirken Ablösungen ein Rückstromgebiet, was den Strömungswiderstand erhöht, ein Effekt, der bei Flugzeugen, Autos und Schiffen zumeist unerwünscht, bei Luftbremsen, Fallschirmen oder Treibankern indessen willkommen ist."},{"page_url":"https://de.wikipedia.org/wiki/Kampfgemeinschaft_f%C3%BCr_Rote_Sporteinheit","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Sporteinheit.svg","page_title":"Kampfgemeinschaft für Rote Sporteinheit","context_page_description":"Die Kampfgemeinschaft für Rote Sporteinheit war ein der KPD nahestehender Arbeitersportverband in der Endphase der Weimarer Republik.\\nDie Kampfgemeinschaft entstand 1930 durch den Ausschluss und die Abspaltung kommunistischer Kräfte vom Arbeiter-Turn- und Sportbund sowie anderer Sportgruppen. Es gab beispielsweise in der KG auch eine Naturfreunde-Opposition, in der sich ein Teil der ausgeschlossenen Naturfreunde formiert hatte. Bereits seit 1922 führte eine „Reichsfraktionsleitung“, die den Direktiven der KPD folgte, eine intensive kommunistische Oppositionsarbeit innerhalb des ATSB. Die KG zählte 1931 über 100.000 Mitglieder. Sie war der stärkste Landesverband der Roten Sportinternationale außerhalb der Sowjetunion. KG, ATSB und andere Arbeitersportorganisationen wurden 1933 von den Nationalsozialisten verboten.\\nRotsport richtete zwei deutsche Fußballmeisterschaften aus. Die erste Meisterschaft gewann 1931 der Dresdner SV 1910 mit 3:2 auf dem NNW-Platz in Berlin gegen Sparta 1911 Berlin. Dresden trat mit der folgenden Aufstellung an: Wehmann – Hanisch, Niese – Kunath, Lindner, Bergmann – Achtzig, Petruschke, Müller, Schmolka, Fabel."},{"page_url":"https://eo.wikipedia.org/wiki/Olea%C4%B5oj","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Mendel_I_146_v.jpg","page_title":"Oleaĵoj","context_page_description":"OLEAĴOJ estis laŭdire sanigaj, ĉefe en la Turingia Arbaro memfabrikitaj oleoj, balzamoj, pulvoretoj, piluloj kaj esencoj."},{"page_url":"https://sv.wikipedia.org/wiki/Acropyga_epedana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Acropyga_epedana_casent0006064_head_1.jpg","page_title":"Acropyga epedana","context_page_description":"Acropyga epedana är en myrart som beskrevs av Roy R. Snelling 1973. Acropyga epedana ingår i släktet Acropyga och familjen myror. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://sv.wikipedia.org/wiki/Lasioglossum_fasciatum","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Lasioglossum_fasciatum_m.jpg","page_title":"Lasioglossum fasciatum","context_page_description":"Lasioglossum fasciatum är en biart som beskrevs av Walker 1995. Lasioglossum fasciatum ingår i släktet smalbin, och familjen vägbin. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%8E%D1%80%D0%BC%D0%BE%D0%BD%D1%82_(%D0%B7%D0%B0%D0%BC%D0%BE%D0%BA,_%D0%A0%D0%B5%D0%B9%D0%BD%D0%BB%D0%B0%D0%BD%D0%B4-%D0%9F%D1%84%D0%B0%D0%BB%D1%8C%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/BurgPyrmont.JPG","page_title":"Пюрмонт (замок, Рейнланд-Пфальц)","context_page_description":"Пюрмонт — замок к западу от Мюнстермайфельда рядом с комунной Рёс на сланцевой скале над рекой Эльцбах в южной части нагорья Айфель в Германии. Замок находится в собственности муниципалитета Рёс."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Regensburg-Kumpfm%C3%BChl-Ziegetsdorf-Neupr%C3%BCll","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Regensburg_Zantkreuz_01.jpg","page_title":"Liste der Baudenkmäler in Regensburg-Kumpfmühl-Ziegetsdorf-Neuprüll","context_page_description":"Auf dieser Seite sind die Baudenkmäler der bayerischen Gemeinde Regensburg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://af.wikipedia.org/wiki/Nodosauridae","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Edmontonia_model.jpg","page_title":"Nodosauridae","context_page_description":"Nodosauridae was ’n familie ankilosouriër-dinosourusse van die Laat Jura- tot die Laat Kryt-periode in wat nou Noord-Amerika, Asië, Antarktika en Europa is. Die nodosourides was nes ander ankilosouriërs mediumgroot tot groot, stewig geboude, viervoetige plantvreters. Hulle het ’n pantser met uitsteeksels op die rug gehad."},{"page_url":"https://sv.wikipedia.org/wiki/Collazzone","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/CollazzonePanorama1.JPG","page_title":"Collazzone","context_page_description":"Collazzone är en ort och kommun i provinsen Perugia i regionen Umbrien i Italien. Kommunen hade 3 448 invånare."},{"page_url":"https://la.wikipedia.org/wiki/Villefranque_(Pyrenaeus_Atlanticus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Villefranque_Eglise.JPG","page_title":"Villefranque (Pyrenaeus Atlanticus)","context_page_description":"Villefranque est commune 2155 incolarum praefecturae Pyrenaeorum Atlanticorum in Franciae australis regione Aquitania."},{"page_url":"https://it.wikipedia.org/wiki/Distretto_di_M%C3%A9d%C3%A9a","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Tamesguida.JPG","page_title":"Distretto di Médéa","context_page_description":"Il distretto di Médéa è un distretto della Provincia di Médéa, in Algeria."},{"page_url":"https://it.wikipedia.org/wiki/Ransweiler","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Ransweiler_Kirche_00002.jpg","page_title":"Ransweiler","context_page_description":"Ransweiler è un comune di 293 abitanti della Renania-Palatinato, in Germania.\\nAppartiene al circondario del Donnersberg ed è parte della comunità amministrativa di Rockenhausen."},{"page_url":"https://ca.wikipedia.org/wiki/Capibara","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Wasserschwein_Schaedelskelett-drawing.jpg","page_title":"Capibara","context_page_description":"El capibara, conegut localment com a chigüiro, carpincho, majas o capivara, és el rosegador més gros del món. Viu a Sud-amèrica i és un parent proper dels agutís, les xinxilles, els coipús i els conills porquins. El seu nom comú, que prové del tupí ka'apiûara, significa 'menja-herba', mentre que el seu nom específic, hydrochaeris, deriva dels ètims grecs ὕδωρ, 'aigua' i χοίρος, 'porc'.\\nEls capibares tenen el cap petit i el cos amb forma de barril, amb el pelatge de color marró vermellós a la part superior i marró groguenc a la inferior. Poden fer fins a 130 cm de llargada i pesar fins a 65 kg. Tenen els peus lleugerament palmats, manquen de cua i tenen 20 dents. Les potes posteriors són lleugerament més llargues que les anteriors i el musell és arrodonit, amb els ulls, els narius i les orelles a dalt del cap. Les femelles pesen una mica més que els mascles."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D8%B1%D9%85_%D8%B9%D8%B6%D9%84%D9%8A_%D8%A3%D9%85%D9%84%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Lipoleiomyoma2.jpg","page_title":"ورم عضلي أملس","context_page_description":"الورم العضلي الأملس أو ورم العضلات الملساء ‏ وهو ورم حميد نادرًا ما يتحول إلى ورم خبيث .من الممكن ان يتكوّن في أي عضو، ولكن غالباً ما يظهر في الرحم والأمعاء الدقيقة والمريء."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B0%D1%81%D1%8B%D0%BC%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B8%D0%BC_%D0%A5%D0%B0%D0%BC%D0%B7%D0%B0_%D0%BE%D0%B3%D0%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Pht-Vugar_Ibadov_eurovision_%282%29.jpg","page_title":"Гасымов, Алим Хамза оглы","context_page_description":"Алим Хамза оглы Гасымов — азербайджанский певец, ханенде, актёр, Народный артист Азербайджана. 19 ноября 1999 года Алим Гасымов получил международную музыкальную премию ЮНЕСКО."},{"page_url":"https://eu.wikipedia.org/wiki/Modelo_Zinema","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Modelo_aretoa_-_Zarauzko_Alde_Zaharra_-_ikuspegi_orokorra.jpg","page_title":"Modelo Zinema","context_page_description":"Modelo Zinema Zarauzko zinema da. 1948an eraiki zen, Félix Llanos Goiburuaren diseinuarekin. Ekimen pribatutik sortu zen zinema, 2012an itxi zen publiko eskasia dela eta. Hurrengo urtean Zarauzko udalak erosi zuen, zinema publiko bilakatuz. 2017an eraberritze lanak egin ziren, 2019ra arte iraun zutenak.\\nArkitektura estilo ezberdinak batzen ditu, baina orokorrean itxura arrazionalista du."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%B8%D0%BA%D0%BE%D0%B1%D0%BE%D1%80%D1%81%D1%82%D0%B2%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/TORERO.jpg","page_title":"Бикоборство","context_page_description":"Бикоборството или тавромахия е състезание между човек и бик или между бикове помежду им.\\nТези състезания са традиция в някои страни, в частност на Иберийския полуостров. Произхождат още от Древна Иберия.\\nНай-разпространеният вариант на бикоборството е испанският корида, който е традиционен спектакъл в Испания, Португалия, части от Южна Франция, Мексико, Колумбия, Еквадор, Венецуела и Перу. И докато някои форми понякога се считат за кървав спорт, в някои държави, това е форма на изкуство и културно събитие. В Испания, тореадорите са почти толкова известни, колкото футболните звезди – те получават подкрепата на спонсори и медийно отразяване. В бикоборството се използва специален вид бик, който трябва да се отглежда в голямо ранчо с възможно най-малък досег с хора.\\nСъществуват много исторически арени на Иберийския полуостров, във Франция и в Латинска Америка. Най-голямата е Плаца Мексико в Мексико сити и побира 48 000 души. Най-старите арени са в Бехар и Ронда.\\nБикоборството е противоречиво, поради редица проблеми, включващи отношението към животните, финансиране и религия."},{"page_url":"https://fr.wikipedia.org/wiki/B%C3%A2timent_du_Vieil_h%C3%B4pital_%C3%A0_Svilajnac","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Zgrada_Stare_bolnice_u_Svilajncu.jpg","page_title":"Bâtiment du Vieil hôpital à Svilajnac","context_page_description":"Le bâtiment du Vieil hôpital à Svilajnac se trouve à Svilajnac, dans le district de Pomoravlje, en Serbie. Il est inscrit sur la liste des monuments culturels protégés de la République de Serbie."},{"page_url":"https://ceb.wikipedia.org/wiki/Osternienburger_Land_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Osternienburger_Land_in_ABI.png","page_title":"Osternienburger Land (munisipyo)","context_page_description":"Munisipyo ang Osternienburger Land sa Alemanya. Nahimutang ni sa estado pederal sa Saxony-Anhalt, sa sentro nga bahin sa nasod, 130 km sa habagatan-kasadpan sa Berlin ang ulohan sa nasod. Adunay 9,115 ka molupyo. Naglangkob kin og 139 ka kilometro kwadrado.\\nAng yuta sa Osternienburger Land kay patag.\\nHapit nalukop sa kaumahan ang palibot sa Osternienburger Land. Dunay mga 139 ka tawo kada kilometro kwadrado sa palibot sa Osternienburger Land medyo hilabihan populasyon. Ang klima baybayon. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Enero, sa -4 °C."},{"page_url":"https://ro.wikipedia.org/wiki/Adam_Ma%C5%82ysz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Adam_Ma%C5%82ysz_at_the_2010_Vancouver_Winter_Olympics.jpg","page_title":"Adam Małysz","context_page_description":"Adam Henryk Małysz este un săritor cu schiurile polonez. S-a născut și trăiește în orașul Wisła din sudul Poloniei. Małysz a câștigat 39 de etape de cupă mondială, fiind depășit din acest punct de vedere doar de austriacul Gregor Schlierenzauer și finlandezul Matti Nykänen. Małysz a fost primul săritor cu schiurile care a câștigat Cupa mondială de 3 ori consecutiv.\\nEste poreclit Batman și Mustața Zburătoare."},{"page_url":"https://pt.wikipedia.org/wiki/Bolo_de_casamento","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/At_the_Seattle_Bridal_Show2.jpg","page_title":"Bolo de casamento","context_page_description":"O bolo de casamento é o bolo tradicional servido em festas de casamento após a refeição principal. Na cultura ocidental moderna, o bolo geralmente fica exposto e é servido aos convidados durante a recepção. Tradicionalmente, o bolo de casamento era servido para trazer boa sorte ao casal e seus convidados. Atualmente, no entanto, adquiriu o papel de peça central na decoração do casamento e muitas vezes é substituído por um bolo cenográfico feito de isopor coberto com glace e pasta americana. Alguns bolos são construídos com apenas um nível comestível para que os noivos compartilhem o doce durante o tradicional corte do bolo."},{"page_url":"https://pl.wikipedia.org/wiki/EPSXe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/EPSXe_Emulator_Screenshot.png","page_title":"EPSXe","context_page_description":"ePSXe – emulator konsoli PlayStation. Pierwsza wersja ePSXe została wydana 14 października 2000 roku. Wydano wersje na Microsoft Windows oraz Linuksa, program rozpowszechniany jest na licencji freeware."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%B1%D9%88%D8%B3_%D8%AF%DB%8C%D8%A7%DA%BA_%D9%85%D8%B3%DB%8C%D8%AA%D8%A7%DA%BA_%D8%AF%DB%8C_%D9%84%D8%B3%D9%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/%D0%97%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D1%81%D1%83%D0%BB%D1%82%D0%B0%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%BC%D0%B5%D1%87%D0%B5%D1%82%D0%B8.jpg","page_title":"روس دیاں مسیتاں دی لسٹ","context_page_description":"تھلویں لسٹ روس دیاں مسیتاں دی جزوی لسٹ اے ۔"},{"page_url":"https://en.wikipedia.org/wiki/Atwell,_Western_Australia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Atwell_harvest_park.jpg","page_title":"Atwell, Western Australia","context_page_description":"Atwell is a suburb within the metropolitan area of Perth, Western Australia, situated 21 kilometres south of Perth City, and located in the City of Cockburn local government area."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%90%D0%97-21","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/GAZ-21_%22Volga%22_%28front_view%29.jpg","page_title":"ГАЗ-21","context_page_description":"ГАЗ 23 ГАЗ 22\\nГАЗ-21 «Волга» — советский автомобиль среднего класса, серийно производившийся на Горьковском автомобильном заводе с 1956 по 1970 год. Производство ГАЗ-21 на самом ГАЗе продолжалось до 15 июля 1970 года, но ещё долгое время после этого сборка по сути новых автомобилей продолжалась на авторемонтных заводах, встречаются «ремзаводовские» машины выпуска вплоть до второй половины 1970-х годов. Заводской индекс модели — изначально был М-21, позднее — ГАЗ-21.\\nВсего на ГАЗе было выпущено 639 478 экземпляров всех модификаций."},{"page_url":"https://pl.wikipedia.org/wiki/Hollywood_Boulevard","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Hollywood_Walk_of_Fame.jpg","page_title":"Hollywood Boulevard","context_page_description":"Hollywood Boulevard – ulica w Hollywood w Los Angeles. Zaczyna się przy Laurel Canyon Boulevard, kończy przy Sunset Boulevard. W 1958 roku na Hollywood Blvd powstała Hollywoodzka Aleja Sław, która rozciąga się na odcinku od Gower Street do La Brea Avenue. Przy ulicy znajdują się liczne atrakcje turystyczne: Teatr Chiński Graumana, przed którym są betonowe odciski stóp i dłoni gwiazd Hollywood, Dolby Theatre, w którym odbywa się coroczna ceremonia wręczania Oscarów, Muzeum Figur Woskowych, Teatr El Capitan i wiele innych. Ulica została wpisana do rejestru National Register of Historic Places."},{"page_url":"https://pt.wikipedia.org/wiki/Guanh%C3%A3es","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Capela_Nossa_Senhora_Do_Carmo_em_Guanh%C3%A3es.jpg","page_title":"Guanhães","context_page_description":"Guanhães é um município brasileiro no interior do estado de Minas Gerais, Região Sudeste do país. Localiza-se no Vale do Rio Doce, no leste mineiro, e sua população estimada em 2019 era de 34 319 habitantes."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%91%D1%96%D1%82%D0%B2%D0%B0_%D0%BF%D0%B0%D0%B4_%D0%9F%D0%B0%D0%BB%D1%82%D0%B0%D0%B2%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/King%27s_colour_Karl_XII.jpg","page_title":"Бітва пад Палтавай","context_page_description":"Бі́тва пад Палтавай — найбуйнейшая бітва Вялікай Паўночнай вайны паміж расейскімі войскамі пад камандваньнем Пятра I і швэдзкай арміяй Карла XII. Адбылася раніцай 27 чэрвеня 1709 году каля гораду Палтава і скончылася ўпэўненай перамогай расейцаў. Нягледзячы на тое, што вайна скончылася толькі праз 12 гадоў, Палтаўская бітва безумоўна стала яе пераломным момантам на карысьць расейцам."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%AA%E3%82%B9%E3%83%88%E3%83%AB%E3%83%BB%E3%83%86%E3%83%B3%E3%83%97%E3%83%AB%E3%83%BB%E3%83%9F%E3%83%BC%E3%82%BA%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Bristol_Temple_Meads_from_Bath_Road_bridge.jpg","page_title":"ブリストル・テンプル・ミーズ駅","context_page_description":"ブリストル・テンプル・ミーズ駅は、イギリス・ブリストルで最古かつ最大の鉄道駅である。ブリストルにおける公共交通の重要な乗換拠点となっており、町の多くの場所や郊外の地域へのバスや都心部へのフェリーに乗り換えられるようになっている。ブリストルにおけるもう1つの鉄道のターミナルであるブリストル・パークウェイ駅 はブリストル市街地の北の郊外にある。\\n1840年8月31日、ロンドンのパディントン駅からのグレート・ウェスタン鉄道の西側の終点駅として開業した。テンプル・ミーズ駅を含むこの鉄道全体は、後に多くの作品を生むことになるイザムバード・キングダム・ブルネルによって設計された初期のものであった。その後間もなく、この駅にはブリストル・アンド・エクセター鉄道 ・ブリストル・アンド・グロスター鉄道 ・ブリストル・ハーバー鉄道 ・ブリストル・アンド・サウス・ウェールズ・ユニオン鉄道 も乗り入れてくるようになった。増加する列車を捌くために、駅は1870年代にフランシス・フォックス により、さらに1930年代に再度、P.E.カルバーハウス により拡張された。ブルネルが当初建設した部分は既に営業しておらず、この部分にはかつてロンドンへ移転するまでの大英帝国連邦博物館 が入居していた。駅の歴史的な重要性は有名で、構内の大部分が1級の史跡に指定されている。\\n現在は駅をネットワーク・レールが所有し、グレート・ウェスタン・レールウェイの列車が発着する。同社はロンドンへの列車の大半と近郊の地域輸送、カーディフ・サウサンプトン・ポーツマス・ウェイマス などへの都市間輸送を担っている。またクロスカントリーにより南西イングランドのプリマス・ペンザンス、北のマンチェスター・ピカデリー駅・ヨーク、スコットランドのエディンバラ・アバディーンなどへの長距離列車が運行されている。また、サウスウェスト・トレインズによってウォータールー駅への列車も数本運行されている。\\n2007年3月までの1年間の乗降客数は700万人以上で、6年間でほぼ200万人増加している。この数はネットワーク・レールの駅では38番目、ロンドン以外の駅では16番目である。これに加えて、乗換客数が84万5000人以上いると見積もられている。\\nプラットホームは1番から15番まで番号が振られているが、旅客列車は8線のみに限定されている。大半のホームは東側の乗り場が奇数番号、西側の乗り場が偶数番号を振られている。しかし混乱することに、2番乗り場は旅客用ではなく、また14番乗り場は存在していない。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D1%83%D0%B1%D0%B0%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Dubai_seen_from_USS_Anzio_%28CG_68%29.jpg","page_title":"Дубаи","context_page_description":"Дубаи највећи је и најгушће насељени град у Уједињеним Арапским Емиратима. Он је лоциран на југоисточној обали Персијског залива и престоница је емирата Дубаи, једног од седам емирата од којих је земља сачињена. Абу Даби и Дубаи су једина два емерата која имају моћ ветоа у погледу критичних ствари од националног значаја у Федералном врховном савету земље. Град Дубаи је лоциран на северној обали емирата и центар је метрополитанске области Дубаи-Шарџа-Аџман. Дубаи ће бити домаћин светског сајма Expo 2020.\\nДубаи је постао глобални град и пословни центар Средњег истока. Он је исто тако један од главних транспортних центара за путнике и терет. До 1960-тих, дубајска економија је била базирана на приходима од трговине и, у мањој мери, нафтним истраживачким концесијама, али нафта није била откривена до 1966. Нафтни приход је први пут почео да притиче 1969. године. Дубајски нафтни приход је помогао у убрзавању раног развоја града, али су његове нафтне резерве ограничене и нивои продукције су ниски: тако да у данашње време мање од 5% емиратових прихода потиче од нафте.\\nЕмиратов модел западњачког стила пословања стимулише његову економију."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%DB%8C%D8%AE%DB%8C%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Shaykhahmad.jpg","page_title":"شیخیه","context_page_description":"شیخیه نام گروهی از شیعیان دوازده امامی است که از احمد بن زین الدین احسائی پیروی می‌کنند که بنیان‌گذار مکتب شیخیه یا المدرسة الشیخیة است. پس از احمد احسائی مؤسس این مکتب، شاگرد او سید کاظم رشتی جانشین او شد.\\nپس از سید کاظم رشتی اشخاص مختلفی ادعای جانشینی وی را داشتند، اما از بزرگترین آن‌ها که اجازه‌های مختلفی از سید کاظم رشتی داشت\\nمحمدکریم‌خان کرمانی بود که به مقبولیت اکثر شیخیه رسید و پس از او نیز شیخیه به دو دسته عمده کرمانیه و باقریه تقسیم شدند که شرح آن را در زیر خواهید خواند.\\nعلی محمد باب در هنگام حضور در کربلا از شاگردان سید کاظم رشتی بود اما پس از ادعاهایی که کرد، شیخیه بیشترین مبارزه را با وی کرد"},{"page_url":"https://en.wikipedia.org/wiki/George_Wayne_Anderson","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Fort_McAllister_Now_05.JPG","page_title":"George Wayne Anderson","context_page_description":"Major George Wayne Anderson Jr, was an officer in the Confederate States Army during the American Civil War. He commanded the Republican Blues and later Fort McAllister near Savannah, Georgia before its capture in 1864."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%83%A3%E3%83%AC%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Wellcome_museum_%26_library%3B_study_carrel_Wellcome_L0004787.jpg","page_title":"キャレル","context_page_description":"キャレルは、主に研究・個人学習のために図書館の書庫・書架・閲覧室内などに設けられる個室、または個席のことである。元々は、読み書きや自習のために修道院に設けられる、机付きの個室を示していた。\\n個室だけに限定する場合は、クローズドキャレル 、個席だけに限定する場合は、オープンキャレル と言うが、日本においては単にキャレルといえばオープンキャレルを指すことも度々ある。キャレルで使われる机は、キャレルデスク 、またはキャレルテーブル と言う。主として、専門図書館や大学図書館、日本で言うところの都道府県立図書館相当の図書館に設置されることが多い。\\n現代のキャレルは照明が完備され、コンピュータを使うためのネットワーク環境が整えられていることもある。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B2%E3%82%A2%E3%83%8F%E3%83%AB%E3%83%88%E3%83%BB%E3%82%B0%E3%83%AB%E3%83%BC%E3%83%90%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Gerhard_Gruber_Stummfilmpianist.jpg","page_title":"ゲアハルト・グルーバー","context_page_description":"ゲアハルト・グルーバーは、オーストリアの無声映画伴奏者、ピアニストである。"},{"page_url":"https://fr.wikipedia.org/wiki/C%C3%A9lestin_Delmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Chilefrancia1930.JPG","page_title":"Célestin Delmer","context_page_description":"Célestin Delmer, né le 15 février 1907 à Villejuif et mort le 2 mars 1996 à Saint-Maur-des-Fossés, est un footballeur international français. Il évolue au poste de milieu offensif.\\nMaintes fois sélectionné dans les équipes de Paris et du Nord, Delmer porte à onze reprises les couleurs de l'équipe de France de 1930 à 1934, et fût sélectionné pour les deux premières Coupes du monde et remporte la Coupe de France 1933 avec l'Excelsior Roubaix."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Bohnsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Bohnsdorf_Kleine_Lindenstra%C3%9Fe-001.JPG","page_title":"Liste der Straßen und Plätze in Berlin-Bohnsdorf","context_page_description":"Die Liste der Straßen und Plätze in Berlin-Bohnsdorf beschreibt das Straßensystem im Berliner Ortsteil Bohnsdorf mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Kisny%C3%A1r%C3%A1d","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/HUN_Kisny%C3%A1r%C3%A1d_COA.jpg","page_title":"Kisnyárád","context_page_description":"Kisnyárád sī Magyar Baranya kūn ê chi̍t ê chng-thâu."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_est%C3%A1dios_da_Premier_League","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Double_Decker_Stand_at_Filbert_Street.jpg","page_title":"Lista de estádios da Premier League","context_page_description":"Desde a criação da Premier League, a mais alta divisão do futebol inglês, cinquenta e quatro estádios sediaram partidas oficiais. As partidas da rodada inaugural da Premier League ocorreram em 15 de agosto de 1992 entre onze equipes. Após o desastre de Hillsborough, em 1989, o Relatório Taylor recomendou o fim das arquibancadas abertas e a implantação de arquibancadas com cadeiras numeradas. Contudo após o retorno do Fulham FC à Divisão 1 durante a temporada 200-2911, as arquibancadas abertas foram readmitidas temporariamente. O clube acabou tendo de realizar seus jogos no Loftus Road por conta de atrasos nas reformas de seu estádio, o Craven Cottage.\\nTurf Moor tornou-se o 50º estádio da Premier League ao sediar uma partida entre Burnley e Manchester United, em 19 de agosto de 2009. O estádio Dean Court tornou-se o mais recente estádio a sediar uma partido do campeonato, quando o Bournemouth enfrentou o Aston Villa em 8 de agosto de 2015. O maior estádio da Premier League em capacidade total é o Old Trafford, pertencente ao Manchester United, com capacidade para 75,635 espectadores; enquanto o menor estádio é o Dean Court, com capacidade para 11,700 espectadores."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%85%D1%80%D0%B0%D0%BC%D0%BE%D0%B2_%D0%9F%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%B7%D0%B5%D0%BC%D0%BB%D0%B8_XII%E2%80%94XVII_%D0%B2%D0%B5%D0%BA%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Pskov_StJoachim%26AnneChurch2.jpg","page_title":"Список храмов Псковской земли XII—XVII веков","context_page_description":"В данном списке представлены храмы, построенные в допетровское время на исторической территории бывшей Псковской земли.\\nСтатья включает как сохранившиеся до настоящего времени, так и некоторые ныне разрушенные, но зафиксированные храмы. Для каждой постройки указаны наименование, местонахождение, время постройки первого каменного здания, примечания, фотография.\\nСписок разбит по географическому принципу. Серым цветом отмечены несохранившиеся постройки."},{"page_url":"https://en.wikipedia.org/wiki/Vehicle_rollover","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Rollover%28it%29.JPG","page_title":"Vehicle rollover","context_page_description":"A rollover is a type of vehicle crash in which a vehicle tips over onto its side or roof. Rollovers have a higher fatality rate than other types of vehicle collisions."},{"page_url":"https://en.wikipedia.org/wiki/Transport_in_Liverpool","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Liverpool_City_Region_Motorways.png","page_title":"Transport in Liverpool","context_page_description":"Liverpool in North west England, is a major British city with significant road, rail, and ferry networks, in addition to an international airport and a well-known dock system. As with most other major UK cities, Liverpool's transport infrastructure is centred on its road and rail networks. Public transport services within the city are controlled and run by Merseytravel.\\nThe road network in and around Liverpool is primarily managed by the relevant local authority in which the roads are located, although the major trunk roads are the responsibility of the Highways Agency."},{"page_url":"https://en.wikipedia.org/wiki/Memorial_Art_Gallery","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Bracht-Morning_Star.jpg","page_title":"Memorial Art Gallery","context_page_description":"The Memorial Art Gallery is the civic art museum of Rochester, New York. Founded in 1913, it is part of the University of Rochester and occupies the southern half of the University's former Prince Street campus. It is the focal point of fine arts activity in the region and hosts the biennial Rochester-Finger Lakes Exhibition and the annual Clothesline Festival."},{"page_url":"https://fr.wikipedia.org/wiki/Yvon_Rivard","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Yvon_Rivard_Le_Port_de_t%C3%AAte.png","page_title":"Yvon Rivard","context_page_description":"Yvon Rivard, né le 20 août 1945 à Sainte-Thècle, un petit village de la Mauricie, est un écrivain et professeur québécois."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D0%BE%D0%BC%D1%8F%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%81%D0%BF%D0%B5%D0%BA%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Cross_of_Ispytatelej_and_Kolomiazhskij_prospects.jpg","page_title":"Коломяжский проспект","context_page_description":"Коломя́жский проспект — магистраль в Приморском районе Санкт-Петербурга. Проходит от набережной Чёрной речки до Парашютной улицы. Начальный участок представляет собой Коломяжский путепровод.\\nДо 2 ноября 1973 года назывался Коломяжское шоссе. Название происходит от деревни Коломяги. Строительство шоссе было завершено в 1856 году. По нему совершались регулярные рейсы дилижансов от Гостиного двора."},{"page_url":"https://uz.wikipedia.org/wiki/Br%C3%A9c%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Map_commune_FR_insee_code_35039.png","page_title":"Brécé","context_page_description":"Brécé Fransiyaning Bretan mintaqasida joylashgan kommunadir. Ille-et-Vilaine departamenti Rennes tumani tarkibiga kiradi."},{"page_url":"https://sh.wikipedia.org/wiki/Andong","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Korea-Andong-Sisadan-01.jpg","page_title":"Andong","context_page_description":"Andong je grad u Južnoj Koreji koji administrativno pripada provinciji Gyeongsangbuk-do. Predstavlja najveći grad u sjevernom dijelu provincije sa skoro 185.000 stanovnika. Geografska lokacija mmu je 36°34′N 128°43′E. Kroz grad teče rijeka Nakdong. Andong predstavlja glavnu tržnicu za obližnja poljoprivredna područja.\\nOd 1970-ih se Andong brzo razvijao, iako je broj stanovnika nešto opao kada su se oni počeli iseljavati u Seul i druge veće gradove. Kasnih 1990-ih i početkom 2000-ih je postao kulturno i turističko središte.\\nAndong je poznat po folkloru, odnosno brojnim narodnim tradicijama koje su predmet Andonškog narodnog festivala koji se svake godine održava sredinom oktobra. Jedna od lokalnih specifičnosti su andonške maske.\\nU Andongu od 1970-ih djeluje Andonški nacionalni univerzitet specijaliziran za proučavanje folklora. Također djeluju i Andonški institut za informatičku tehnologiju, Andonški naučni koledž i Katolički koledž Sangji."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D8%A8%D8%AF_%D8%A7%D9%84%D8%AD%D9%85%D9%8A%D8%AF_%D8%A7%D9%84%D8%B4%D9%88%D8%A7%D8%B1%D8%A8%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/%D8%B9%D8%A8%D8%AF%D8%A7%D9%84%D8%AD%D9%85%D9%8A%D8%AF_%D8%A7%D9%84%D8%B4%D9%88%D8%A7%D8%B1%D8%A8%D9%8A.jpg","page_title":"عبد الحميد الشواربي","context_page_description":"عبد الحميد الشواربي هو رجال أعمال مصري الجنسية، هو الرئيس السادس لنادي الزمالك، تولي رئاسة النادي في عام 1955 بعد تنازل الدكتور محمود شوقي عن رئاسة النادي، لكنه لم يقدم للزمالك شيئاً، حيث استمرت رئاسته لنادي 3 شهور فقط ثم استقال من منصبه بعد ذلك."},{"page_url":"https://cs.wikipedia.org/wiki/Barytonsaxofon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Baritone_saxophone.jpg","page_title":"Barytonsaxofon","context_page_description":"Barytonsaxofon je jeden z nižších nástrojů saxofonové rodiny. Na rozdíl od menších saxofonů má u hubičky vícekrát ohnutou trubici, aby nástroj nebyl příliš vysoký.\\nJe laděn in Es a zní o velkou tercdecimu níže než v notovém zápise; zní také o oktávu níže než altsaxofon. Přestože vydává hluboké tóny, je notován nejčastěji v houslovém klíči stejně jako všechny ostatní saxofony. Používá také stejný prstoklad jako ostatní saxofony, ale jako jediný z nich má často přidanou klapku umožňující hrát hluboké a.\\nBarytonsaxofon je nejnižším nástrojem ve většině saxofonových souborů. V sólové hře a v symfonických orchestrech se používá jen málo, důležitější úlohu hraje spíše v dechových orchestrech, saxofonovém kvartetu nebo big bandu.\\nPortály: Hudba\\nAutoritní data: GND: 7694558-3"},{"page_url":"https://de.wikipedia.org/wiki/Tropfstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Stalactites_on_Concrete.JPG","page_title":"Tropfstein","context_page_description":"Tropfsteine sind generell Steine, die als Sinter durch tropfendes Wasser entstehen."},{"page_url":"https://lb.wikipedia.org/wiki/Elsbier","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Rinde_Elsbeere.jpg","page_title":"Elsbier","context_page_description":"D'Elsbier ass eng Lafbamaart aus der Gattung vun de Sorbussen. Si gehéiert zu der Famill vun de Rosaceae.\\nAm Lëtzebuergesche gëtt et nach dës Nimm fir dee Bam: Ilenter, Ielechter/Eelechter/Älechter, Elecher, Eilecher, Ellrécher, Pelagor, wëlle Spier, wëlle Spirebam."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%B0%D1%82%D1%83%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8_%D0%BC%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/001-Batuliya_Monastery_Church.JPG","page_title":"Батулийски манастир","context_page_description":"Батулийски манастир „Свети Николай Чудотворец“ е действащ манастир на Българската православна църква, част от Софийската Мала Света гора."},{"page_url":"https://de.wikipedia.org/wiki/Westerw%C3%A4lder_Seen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Dreifelder_Weiher_im_Fr%C3%BChling.JPG","page_title":"Westerwälder Seen","context_page_description":"Die Westerwälder Seen sind sieben Stauseen auf der Westerwälder Seenplatte im Westerwald, die wegen ihrer geringen Tiefe meist als Weiher oder Teich bezeichnet werden. Sie liegen innerhalb des Städtevierecks Hachenburg, Westerburg, Montabaur und Dierdorf."},{"page_url":"https://ga.wikipedia.org/wiki/Kham","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Tibet_provinces.png","page_title":"Kham","context_page_description":"Is ceann de thrí réigiúin traidisiúnta na Tibéide é Kham. Is iad Ü-Tsang agus Amdo an dá cheann eile."},{"page_url":"https://pl.wikipedia.org/wiki/Hrabstwo_Warren_(New_Jersey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Delaware_Water_Gap.jpg","page_title":"Hrabstwo Warren (New Jersey)","context_page_description":"Warren – hrabstwo w stanie New Jersey w USA. Populacja wynosi 102 437 mieszkańców.\\nPowierzchnia hrabstwa wynosi 940 km². Gęstość zaludnienia wynosi 111 osób/km²."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BB%E3%83%AA%E3%82%AA%E3%83%B3_(%E7%A7%8B%E7%94%B0%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Night_view_of_Akita_City_from_Akita_Port_Tower_SELION_20180823.jpg","page_title":"セリオン (秋田市)","context_page_description":"セリオン は、秋田県秋田市土崎港の秋田港にあるポートタワー、およびタワーを含む施設群である。タワーの正式名称は秋田市ポートタワー。本項ではタワーを指して「セリオン」の名称を用い、周辺の施設やスポットについても併せて記述する。\\nセリオンを含む施設群は道の駅あきた港として道の駅、みなとオアシスあきたとしてみなとオアシスに登録されている。また、「恋人の聖地」に認定されている土崎湊町恋のまちの一部でもある。"},{"page_url":"https://nn.wikipedia.org/wiki/Gr%C3%A5flugesnappar","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/BG-spotted-flycatcher-2.jpg","page_title":"Gråflugesnappar","context_page_description":"Gråflugesnappar er ein trekkfugl i flugesnapparfamilien. Han hekkar i store delar av Europa og Vest-Asia, og overvintrar hovudsakleg i den sørlege delen av Afrika."},{"page_url":"https://hu.wikipedia.org/wiki/Sza%C3%BAdi_gazella","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Compl%C3%A9ments_de_Buffon_%286289273740%29.jpg","page_title":"Szaúdi gazella","context_page_description":"A szaúdi gazella az emlősök osztályának a párosujjú patások rendjébe, ezen belül a tülkösszarvúak családjába és az antilopformák alcsaládjához tartozó kihalt faj. Eredetileg a dorkászgazella alfajaként írták le, de későbbi genetikai vizsgálatok kimutatták, hogy közeli rokonságuk ellenére különálló fajról van szó."},{"page_url":"https://eo.wikipedia.org/wiki/Tago_de_la_Galega_Beletro","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Lu%C3%ADs_Seoane_en_Buenos_Aires_en_1955.jpg","page_title":"Tago de la Galega Beletro","context_page_description":"La Tago de la Galega Beletro estas festotago kreita en 1963 de la Reĝa Galega Akademio por omaĝi verkistojn en la galega kaj samtempe festi tiun lingvon. Ĉiujare oni dediĉas ĝin al nova verkisto, elektita de la Akademio. La omaĝato havu gravan verkaron en la galega, ricevu la apogon de almenaŭ tri membroj de la Akademio kaj estu mortinta minimume dek jarojn. Nur en 1998 oni escepte dediĉis la tagon al tri personoj, nome la mezepokaj menestreloj Johan de Cangas, Martin Codax kaj Meendinho.\\nLa festotago estas la 17a de majo ĉar tiutage en 1883 oni unue eldonis en Vigo la libron Cantares gallegos de Rosalía de Castro, rigardata la fondo-verko de la Renaskiĝo de la galega kiel literatura kaj kultura lingvo.\\nLa Tago de la Galega Beletro estas oficiala festotago en la aŭtonoma komunumo Galegio. Hispanlingvaj ĵurnaloj aperigas siajn kovrilojn en la galega kaj oni kutime okazigas manifestacion en Santiago de Compostela por defendi tiun ĉi lingvon. La galega lingvo, el lingvistika vidpunkto loka varianto de la galega-portugala lingvo, suferadis drastan perdon de parolantoj en la lastaj jardekoj."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BE%8E%E6%8B%89%E5%BE%B7%E5%8F%8D%E5%BA%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/AmadoriRearrangementTrad.svg","page_title":"美拉德反应","context_page_description":"梅納反應，又稱梅納反應、梅拉德反應、梅納反應、羰胺反應，是廣泛分布於食品工業的非酶褐變反應，指的是食物中的還原糖與胺基酸／蛋白質在常溫或加熱時發生的一系列複雜反應，其結果是生成了棕黑色的大分子物質類黑精或稱擬黑素。除產生類黑精外，反應過程中還會產生成百上千個有不同氣味的中間體分子，包括還原酮、醛和雜環化合物，這些物質為食品提供了宜人可口的風味和誘人的色澤。它以法國化學家路易斯·卡米拉·美拉德命名，他在1912年首次描述它，同時試圖重現生物蛋白質合成。\\n「梅納反應」的產物中，包含顏色的變黃變深變黑、香氣的產生、以及味道上的轉變，例如甜味的產生。\\n該反應是一種非酶促褐變的形式，其通常快速從約140℃至170℃中進行。在較高的溫度下，焦糖化和隨後的裂解變得更加明顯。在此過程中，產生了數百種不同的風味化合物。這些化合物又分解成形成更多新的風味化合物等等。每種類型的食物都具有在梅納反應期間形成的非常獨特的風味化合物。 風味科學家多年來一直使用這些相同的化合物來製造人造風味。然而，在另一方面，高溫亦有利於一種稱為丙烯醯胺的致癌物形成，影響健康。"},{"page_url":"https://de.wikipedia.org/wiki/Audi_100_C3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Audi_C3_Avant_rear_20071012.jpg","page_title":"Audi 100 C3","context_page_description":"Der Audi 100 C3, intern und umgangssprachlich auch als Typ 44 bezeichnet, war ein Fahrzeugmodell der oberen Mittelklasse der Audi NSU Auto Union AG. Der Audi 100 C3 tat sich mit einer besonders strömungsgünstigen Karosserie hervor, war Vorreiter des permanenten „quattro“-Allradantriebs in der oberen Mittelklasse und brachte für den Volkswagen-Konzern erstmals den TDI-Motor mit Diesel-Direkteinspritzung und Turbolader in die Serie. Bei der Entwicklung des Audi 100 C3 standen vor allem die Wirtschaftlichkeit, eine hohe Produktqualität und die Langlebigkeit des Fahrzeugs im Fokus. Federführend bei der technischen Entwicklung des Audi 100 C3 war Ferdinand Piëch. Das Design stammte von Hartmut Warkuß. Heute steht der Audi 100 C3 exemplarisch für den Beginn der Entwicklung von Audi zu einer technikbetonten Premiummarke."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_races_chevalines","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/AraAppaloosa_hunter_04.jpg","page_title":"Liste de races chevalines","context_page_description":"La liste de races chevalines, incluant les poneys, s'est enrichie sous l'influence de la sélection naturelle et de l'élevage sélectif de l'espèce equus ferus caballus, le cheval domestique, sous le contrôle humain. L'espèce du cheval s'est divisée en plusieurs centaines de races, réparties sur tous les continents. Le classement de ces races est établi par la Fédération équestre internationale, qui en distingue trois grands types : le cheval de selle destiné à être monté, le cheval de trait destiné à la traction animale, et le poney, arbitrairement défini comme un cheval mesurant moins d'1,48 m de haut, notion controversée. D'autres distinctions peuvent être opérées, notamment entre les races de travail, de couleur, de sport, et d'allures.\\nCette liste comprend les termes utilisés pour décrire des « types » et « lignées » de chevaux, non-considérés comme des races, bien que souvent confondus avec ces dernières. Une race est définie comme une population viable d'animaux issus d'une même lignée, et caractérisés par des morphologies et des aptitudes similaires. Les races de chevaux peuvent être enregistrées dans des registres généalogiques, ou stud-books."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE_%D0%BF%D1%80%D0%B2%D0%B5%D0%BD%D1%81%D1%82%D0%B2%D0%BE_%D1%83_%D0%BE%D0%B4%D0%B1%D0%BE%D1%98%D1%86%D0%B8_2006.","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Yoyogi-National-First-Gymnasium-01.jpg","page_title":"Светско првенство у одбојци 2006.","context_page_description":"Шеснаесто Светско првенство у одбојци 2006. је одржано у Јапану од 17. новембра до 3. децембра 2006. На првенству су учествовале 24 репрезентације које су у предтакмичењу биле подељене у 4 групе по 6 екипа."},{"page_url":"https://de.wikipedia.org/wiki/Melodica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Accordina-carrel.jpg","page_title":"Melodica","context_page_description":"Die Melodica ist ein handliches Harmonikainstrument, das mittels Hineinblasen zum Klingen gebracht wird und über eine Klaviatur gespielt wird."},{"page_url":"https://en.wikipedia.org/wiki/Bank_of_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/ATM_Banque_de_France.jpg","page_title":"Bank of France","context_page_description":"The Bank of France, headquartered in Paris, is the central bank of France. Founded in 1800, it began as a private institution for managing state debts and issuing notes. It is responsible for the accounts of the French government, managing the accounts and the facilitation of payments for the Treasury and some public companies. It also oversees the auctions of public securities on behalf of the European Central Bank.\\nToday, it is an independent institution, and it has been a member of the Eurosystem of central banks since 1999. This consists of the European Central Bank, and the national central banks of all European Union members. Its three main missions, as defined by its statuses, are to drive the French monetary strategy, ensure financial stability and provide services to households, small and medium businesses and the French state."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%BE%E0%AE%B0%E0%AE%BE_%E0%AE%9F_%E0%AE%87%E0%AE%9A%E0%AF%82%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/BarraShopping.jpg","page_title":"பாரா ட இசூக்கா","context_page_description":"பாரா ட இசூக்கா பிரேசிலின் இரியோ டி செனீரோவின் மேற்கு மண்டலத்தில் அத்திலாந்திக்குப் பெருங்கடலோரத்தில் உள்ள ஓர் புறநகர்ப் பகுதி ஆகும். இங்குள்ள கடற்கரைகள், ஏரிகள், ஆறுகளுக்காகவும் வாழ்முறைக்காகவும் பாரா புகழ்பெற்றது.\\nஇரியோ டி செனீரோவின் பரப்பில் 13% ஆகவும் நகர மக்கள்தொகையில் 4.7% ஆக இருந்தபோதும் நகர வரி வருமானத்தில் 30% இங்கிருந்து தான் வருகின்றது. பிரேசிலில் மிகவும் மேம்படுத்தப்பட்ட இடங்களில் இதுவும் ஒன்றாகக் கருதப்படுகின்றது. 2000ஆம் ஆண்டு கணக்கெடுப்பின்படி, இப்பகுதியின் மனித மேம்பாட்டுச் சுட்டெண், 0.959, நாட்டிலேயே மிகவும் உயர்ந்ததாகும். இரியோவின் நகர மையம், தெற்கு மண்டலம் போலல்லாது பாரா ட இசூக்கா 30 ஆண்டுகளுக்குள்ளாகவே கட்டமைக்கப்பட்டுள்ளது. எனவே பெரும் நிழற்சாலைகளுடன் தற்கால சீர்தரங்களின்படி கட்டமைக்கப்பட்டுள்ளது. நவீனத்துவம், நீடிப்புத் திறன், இயற்கை என இப்பகுதி இரியோ டி செனீரோவின் புத்தம்புதிய முகமாக விளங்குகின்றது. இந்நகரப் பகுதியின் திட்ட வடிவமைப்பை, பிரசிலியாவை வடிவமைத்த லூசியோ கோஸ்தா உருவாக்கியுள்ளார். நகரின் பெருந்திட்டத்தில் பல பூங்காக்கள், அங்காடி வளாகங்கள், அடுக்கக குடியிருப்புகள், பெரிய மாளுகைகள் இடம் பெற்றுள்ளன."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_estatales_de_Hamburgo_de_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Dietrich_Wersich_CDU_Parteitag_2014_by_Olaf_Kosinsky-1.jpg","page_title":"Elecciones estatales de Hamburgo de 2015","context_page_description":"Las Elecciones estatales de Hamburgo de 2015 se llevaron a cabo el 15 de febrero de 2015, ​ con el propósito de elegir a los miembros del Parlamento de Hamburgo.\\nDesde la elección de 2011, el SPD gobernaba en mayoría bajo el primer alcalde Olaf Scholz. La edad para votar se había reducido en 2013 a 16 años. Además, la duración de los periodos legislativos se había ampliado de 4 a 5 años, por lo que la próxima elección tendrá lugar en 2020.​\\nLos resultados finales de las elecciones significaron una clara victoria de los socialdemócratas por amplio margen; aunque los 2 partidos dominantes SPD y CDU tuvieron una reducción del número de escaños y votos, así como un notable avance de Los Verdes y La Izquierda.\\nTras las elecciones, se formó una coalición entre el SPD y Los Verdes, la primera de este tipo en Hamburgo desde la formada en 1997. Olaf Scholz fue reelegido como alcalde el 15 de abril gracias al apoyo de esta coalición."},{"page_url":"https://cs.wikipedia.org/wiki/Giglio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Tuscan_archipelago.png","page_title":"Giglio","context_page_description":"Giglio je ostrov v Toskánském souostroví, který tvoří samostatnou italskou obec. Leží 16 km západně od italské pevniny. Na ostrově jsou tři osady: Giglio Porto, Giglio Castello a Giglio Campese, pod jeho správou se také nachází nedaleký ostrůvek Giannutri. Giglio je součástí národního parku Toskánské ostrovy, vyhlášeného roku 1996. Ostrov je tvořen žulou, z místního kamene pocházejí četné římské památky. Místní porost tvoří převážně přestup Smilax aspera a křivatec Gagea granatellii. Na Gigliu se nacházejí četné vinice, produkující víno značky Ansonaco.\\nV římských dobách byl ostrov známý jako Aegilium Insula, zmiňuje se o něm i Gaius Julius Caesar v knize Zápisky o občanské válce. Dosud se zachovalo sídlo rodiny Ahenobarbus, z níž pocházela řada římských konzulů. Na ostrově se také nachází středověký hrad Giglio Castello, na němž sídlila rodina Aldobrandeschi, a kostel San Pietro Apostolo. V roce 1544 ostrov zpustošil pirát a otrokář Chajruddín Barbarossa. V červnu 1646 proběhla v úžině mezi ostrovem a toskánským pobřežím bitva u Ortobello mezi francouzským a španělským loďstvem. Rodákem z Giglia je spisovatel Raffaele Brignetti."},{"page_url":"https://de.wikipedia.org/wiki/Hochschule_f%C3%BCr_Technik_und_Wirtschaft_Dresden","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Logo_HTW_Dresden.png","page_title":"Hochschule für Technik und Wirtschaft Dresden","context_page_description":"Die Hochschule für Technik und Wirtschaft Dresden – Hochschule für angewandte Wissenschaften ist eine Fachhochschule und neben der Technischen Universität die zweitgrößte Hochschule in der Stadt Dresden. Sie bietet 36 Studiengänge aus den fünf Bereichen und acht Fakultäten."},{"page_url":"https://fi.wikipedia.org/wiki/Oopperan_historia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Luigi_cherubini.jpg","page_title":"Oopperan historia","context_page_description":"Oopperan historia kuvaa oopperan kehitystä ja muotoja länsimaisen musiikin historian alalajina. Ooppera on historiansa aikana mukaillut aikansa taidemusiikin esteettisiä ihanteita, mutta se on käynyt läpi myös useita itsenäisiä uudistumiskausia. Näissä uudistuksissa on vuoroin keskitytty enemmän yksittäisten aarioiden ja muiden laulunumeroiden vaikuttavuuteen eli niin sanottuun numero-oopperaan ja vuoroin pyritty kohti musiikin ja draaman yhtenevyyttä niin, että musiikki mahdollisimman tehokkaasti palvelisi tarinankerrontaa. Esimerkkeinä näistä ääripäistä voidaan pitää napolilaista 1700-luvun oopperaa, jossa musiikilliset muodot dominoivat draamallisuutta ja toisaalta wagneriaanista musiikkidraamaa, jossa eri taidemuotojen tuli olla vain draaman välineitä. Suuria oopperan uudistajia ovat omina aikoinaan olleet muiden muassa Christoph Willibald Gluck, Richard Wagner ja Alban Berg."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%99%D7%A1%D7%98%D7%95%D7%A8%D7%99%D7%94_%D7%A9%D7%9C_%D7%A1%D7%A4%D7%A8%D7%93:_%D7%A2%D7%99%D7%93%D7%9F_%D7%94%D7%94%D7%90%D7%A8%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Bandera_de_Espa%C3%B1a_1760-1785.svg","page_title":"היסטוריה של ספרד: עידן ההארה","context_page_description":"ספרד הבורבונית או עידן ההארה בספרד הוא שמה של ספרד במהלך המאה ה-18. בית בורבון עלה לשלטון בספרד לאחר מותו של קרלוס השני, מלך ספרד ללא יורשים, מה שהביא לפרוץ מלחמת הירושה הספרדית, שנמשכה עד 1715. המלכים הבורבונים שלטו שלטון אבסולוטיזם נאור והביאו לרפורמות במדינה, אם כי הממלכה נשארה קתולית אדוקה, והאינקוויזיציה הוסיפה להחזיק בעמדות כח במדינה."},{"page_url":"https://da.wikipedia.org/wiki/Vilhelmsborg_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Vilhelmsborg_Station.jpg","page_title":"Vilhelmsborg Station","context_page_description":"Vilhelmsborg Station er en letbanestation på Odderbanen ved herregården og hestesportscenteret Vilhelmsborg sydøst for Mårslet i Danmark. Den blev oprindeligt etableret som jernbanestation.\\nOdderbanen blev lukket for ombygning til letbane 27. august 2016. Det var forventet, at den ville genåbne som en del af Aarhus Letbane i december 2017, men på grund af manglende sikkerhedsgodkendelse blev genåbningen udskudt på ubestemt tid. Efter en længere proces genåbnede banen så 25. august 2018, efter at den nødvendige godkendelse fra Trafik-, Bygge- og Boligstyrelsen forelå dagen før."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_%C3%B6sterreichischen_Kronen-Banknoten","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/AHK_50_1902_obverse.jpg","page_title":"Liste der österreichischen Kronen-Banknoten","context_page_description":"Von 1892 bis 1924 gab es in Österreich die Kronen-Währung. Allerdings kamen erst 1900 die ersten Kronen-Banknoten heraus."},{"page_url":"https://hu.wikipedia.org/wiki/Kuno_von_Westarp","image_url":"https://upload.wikimedia.org/wikipedia/hu/c/cc/Kunovonwestarp.jpg","page_title":"Kuno von Westarp","context_page_description":"Kuno von Westarp német gróf és vezető konzervatív politikus volt az első világháború során."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D0%B0%D1%9E%D0%BD%D0%BE%D1%87%D0%BD%D0%B0-%D0%97%D0%B0%D1%85%D0%BE%D0%B4%D0%BD%D1%96_%D0%BA%D1%80%D0%B0%D0%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Slowo_-_1934%2C_nr_127_Roman_Skirmunt_-_Panie_z_muru_-_p_3.jpg","page_title":"Паўночна-Заходні край","context_page_description":"Паўно́чна-Захо́дні край, альбо паўно́чна-захо́днія губе́рні, — размоўная, публіцыстычная і афіцыйна-бюракратычная назва шасці губерняў Расійскай імперыі.\\nТэрмін «Паўночна-Заходні край» пачаў першапачаткова ўжывацца ва ўрадавай тэрміналогіі ў адносінах да Віленскага ваеннага генерал-губернатарства пасля скасавання ў Расійскай імперыі ўніяцтва як жаданне паказаць не толькі спадчынна-дынастычны, але і этнаканфесійна «рускі» характар гэтых зямель. Аднак да пачатку сялянскай рэформы і асабліва да паўстання 1863—1864 гадоў тэрмін «Паўночна-Заходні край» выкарыстоўваўся вельмі рэдка і не распаўсюджваўся на Віцебскую і Магілёўскую губерні. Да пачатку 1860-х гг. часцей за ўсё ў расійскай урадавай тэрміналогіі «паўночна-заходнія губерні» не вылучаліся асобна, а разам з «беларускімі» і «паўднёва-заходнімі губернямі» прадстаўляліся сукупна і фігуравалі пад агульнай назвай «заходнія губерні».\\nПадпарадкаванне ў 1863 г. Віцебскай і Магілёўскай губерняў уладзе віленскага ваеннага генерал-губернатара распаўсюдзіла тэрмін «Паўночна-Заходні край» і на гэтыя губерні, што захавалася нават пасля выхаду ў 1869 г. Віцебскай і Магілёўскай губерняў з-пад улады віленскага генерал-губернатара."},{"page_url":"https://it.wikipedia.org/wiki/Chlorophyllum_rachodes","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Lepiota_rhacodes_-_shaggy_parasol_-_large.JPG","page_title":"Chlorophyllum rachodes","context_page_description":"Chlorophyllum rachodes Vellinga, 2002 è un fungo basidiomicete della famiglia Agaricaceae.\\nÈ simile a Macrolepiota procera ma di taglia mediamente più piccola.\\nSebbene in passato fosse considerata commestibile dopo cottura, recenti studi ne hanno dimostrato la tossicità anche da cotta, ragione per cui se ne sconsiglia vivamente il consumo per fini alimentari."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A1%E0%A6%BE%E0%A6%95_%E0%A6%AC%E0%A6%BE%E0%A6%95%E0%A7%8D%E0%A6%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Budapest_postbox.jpg","page_title":"ডাক বাক্স","context_page_description":"ডাক বাক্স হল একটি ছোটখাট বাক্স যা ডাকবিভাগ কর্তৃক চিঠিপত্র সংগ্রহের জন্য ব্যবহৃত হয়। এটি গ্রেট ব্রিটেনে পোস্টবাক্স; মার্কিন যুক্তরাষ্ট্র এবং কানাডাতে কালেকশন বাক্স, মেইলবাক্স, লেটার বাক্স, অথবা ড্রপ বাক্স ইত্যাদি নামেও অভিহিত। ডাক বাক্স স্থাপন করা হয় গণস্থানে বা প্রকাশ্য স্থানে, মাটিতে সংস্থাপন করে বা কোনও কিছুর সঙ্গে ঝুলিয়ে। পত্রপ্রেরক এর ছোট ফোকট দিয়ে চিঠির খাম ঢুকিয়ে দেন। প্রতি দিন নির্দিষ্ট সময়ে ডাক বিভাগের লোক এসে ডাক বাক্সের তালা খুলে চিঠিপত্র সংগ্রহ করে ডাক অফিসের সর্টিঙ বিভাগে নিয়ে যায়।\\nনির্দিষ্ট স্থান থেকে ডাক বাক্স সরিয়ে ফেলা বা চিঠিপত্র ঢোকানোর ফোকট বন্ধ করা বা অথবা কোনওভাবে এর ক্ষতি সাধন করা একটি দণ্ডণীয় অপরাধ।"},{"page_url":"https://sv.wikipedia.org/wiki/Saint-Martin-Lars-en-Sainte-Hermine","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Map_commune_FR_insee_code_85248.png","page_title":"Saint-Martin-Lars-en-Sainte-Hermine","context_page_description":"Saint-Martin-Lars-en-Sainte-Hermine är en kommun i departementet Vendée i regionen Pays de la Loire i västra Frankrike. Kommunen ligger i kantonen Sainte-Hermine som tillhör arrondissementet Fontenay-le-Comte. År 2009 hade Saint-Martin-Lars-en-Sainte-Hermine 414 invånare."},{"page_url":"https://cs.wikipedia.org/wiki/Svat%C3%A1_Kate%C5%99ina_(%C5%A0ebrov-Kate%C5%99ina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Kate%C5%99ina7.JPG","page_title":"Svatá Kateřina (Šebrov-Kateřina)","context_page_description":"Svatá Kateřina je vesnice, část obce Šebrov-Kateřina v okrese Blansko. Nachází se asi 1 km východně od Šebrova. Prochází zde silnice II/379. Je zde evidováno 79 adres. Trvale zde žije 153 obyvatel.\\nSvatá Kateřina je také název katastrálního území o rozloze 2,23 km²."},{"page_url":"https://fi.wikipedia.org/wiki/Jegor_Podomatski","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Podomatsky2010.jpg","page_title":"Jegor Podomatski","context_page_description":"Jegor Podomatski on venäläinen jääkiekkomaalivahti. Podomatski on pelannut Venäjän jääkiekkomaajoukkueessa."},{"page_url":"https://fr.wikipedia.org/wiki/Giovan_Battista_Recco","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Giovan_battista_recco%2C_natura_morta_con_crostacei_e_frutti_di_mare%2C_1645_ca.JPG","page_title":"Giovan Battista Recco","context_page_description":"Giovan Battista Recco est un peintre italien du XVIIᵉ siècle spécialisé dans les natures mortes, appartenant à l'école napolitaine."},{"page_url":"https://de.wikipedia.org/wiki/Josef_Zasche_(Architekt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Asch-Bibliothek.jpg","page_title":"Josef Zasche (Architekt)","context_page_description":"Josef Zasche war ein deutsch-böhmischer Architekt des Jugendstils und der Moderne, der in der ersten Hälfte des 20. Jahrhunderts in Böhmen, insbesondere in Prag wirkte."},{"page_url":"https://ceb.wikipedia.org/wiki/Razor","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Razor_%281%29.JPG","page_title":"Razor","context_page_description":"Bukid ang Razor sa Esklobeniya. Nahimutang ni sa munisipyo sa Občina Bovec, sa kasadpang bahin sa nasod, 70 km sa amihanan-kasadpan sa Ljubljana ang ulohan sa nasod. 2,601 metros ibabaw sa dagat kahaboga ang nahimutangan sa Razor, o 338 ka metros sa ibabaw sa naglibot nga tereyn. Mga 1.6 ka kilometro ang gilapdon sa tiilan niini. Razor mao ang bahin sa Julian Alps.\\nAng yuta palibot sa Razor kay kasagaran kabukiran. Kinahabogang dapit sa palibot ang Triglav, 2,864 ka metros ni kahaboga ibabaw sa dagat, 5.1 km sa habagatan-sidlakan sa Razor. Dunay mga 8 ka tawo kada kilometro kwadrado sa palibot sa Razor may gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Bohinjska Bistrica, 19.8 km sa habagatan-sidlakan sa Razor. Hapit nalukop sa kasagbotan ang palibot sa Razor. Sa rehiyon palibot sa Razor, kabukiran talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 2 °C. Ang kinainitan nga bulan Hulyo, sa 12 °C, ug ang kinabugnawan Enero, sa -8 °C. Ang kasarangang pag-ulan 2,482 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 384 milimetro nga ulan, ug ang kinaugahan Hunyo, sa 144 milimetro."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%81%D1%82%D1%80%D0%B0_%D1%80%D0%BE%D0%BC%D0%B0%D1%88%D0%BA%D0%BE%D0%B2%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Aster_amellus_Sturm6.jpg","page_title":"Астра ромашковая","context_page_description":"А́стра рома́шковая, или италья́нская — вид многолетних травянистых растений рода Астра семейства Астровые, или Сложноцветные.\\nДругие названия на русском языке: Астра дикая, Астра европейская, Астра степная."},{"page_url":"https://az.wikipedia.org/wiki/B%C9%99hm%C9%99nyar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/%C4%B0smailiyye_palace_Bust_of_Bahmanyar_Al-Azerbaijani.JPG","page_title":"Bəhmənyar","context_page_description":"Əbülhəsən Bəhmənyar Azərbaycani — Şərq peripatetizminin görkəmli nümayəndələrindən biri, Azərbaycan fəlsəfi məktəbinin banisi, İbn Sinanın şagirdi. Doğum yeri naməlum olan filosof mənbələrdə bir qayda olaraq \\"əl-Azərbaycani\\" kimi xatırlanır və Azərbaycandan olması vurğulanır. Şagirdi Zəhirəddin əl-Beyhəqi filosofun Azərbaycandan olmasını xüsusilə qeyd edir. Bəzi mənbələr onun əvvəllər zərdüşt olduğunu, daha sonra islamı qəbul etdiyini qeyd edirlər. Bəhmənyar Azərbaycani əksər şərq peripatetikləri kimi öz əsərlərini ərəb dilində yazmışdır. Təkcə Azərbaycanda deyil, ümumilikdə Şərq fəlsəfəsi tarixində yaradıcılığı böyük əhəmiyyətə malik olan filosof həm də yetişdirdiyi dəyərli alimlərlə öz məktəbini yaratmışdır."},{"page_url":"https://tr.wikipedia.org/wiki/1994","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Pauling.jpg","page_title":"1994","context_page_description":"1994 cumartesi günü başlayan yıl. 20. yüzyılın ve 2. milenyumun 94. yılı."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B5%D0%B1%D1%80%D1%9A%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Monument_Zebrnjak_near_Kumanovo.jpg","page_title":"Зебрњак","context_page_description":"Спомен-костурница на брду Зебрњак је било монументално и тријумфално спомен обележје подигнуто у славу и част погинулим српским војницима током Кумановске битке у Првом балканском рату 1912. године. Српска војска је победила турску војску и тиме означила почетак ослобођења Југоисточне Европе од Османског царства. Спомен-обележје је најзначајније остварење београдског архитекте Момира Коруновића и био је најмонументалнији војни меморијал на просторима средишњег Балкана. Споменик је подигнут 1937. године на локалитету самог бојишта — брду Зебрњак код Куманова у тада Вардарској бановини у Краљевини Југославији, а данас Северној Македонији. У спомен-костурници, почивају посмртни остаци 678 погинулих српских војника погинулих у Кумановској бици. Данас се споменик налази у руинираном стању, јер га је бугарски окупатор Македоније порушио током Другог светског рата - 24. маja 1942. Срушена је кула, а преостали остаци капеле и костурнице.\\nПоследњих година Зебрњак је постао место окупљања српске заједнице из Северне Македоније. За санацију овог споменика из буџета Републике Србије одвојено је 70 милиона динара 2012. године."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D8%B3%D9%BE%D8%A7%D8%B1%D8%AA%D8%A7%D8%8C_%D9%88%DB%8C%D8%B3%DA%A9%D8%A7%D9%86%D8%B3%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/SpartaBigBike.jpg","page_title":"اسپارتا، ویسکانسین","context_page_description":"اسپارتا، ویسکانسین آمریکانین ویسکانسین ایالتیندا یئر آلان بیر شهردیر و ۱۷٫۰۹ کیلومتر موربّع ساحه سی وار. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا ۹۵۲۲ نفر و اها‌لی سیخلیغی ۵۶۲٫۲ اینسان کیلومتر موربّع دیر. بۇ شهر متر دنیز سئوییه‌سیندن اۇجالیقیدا یئرلشیر."},{"page_url":"https://de.wikipedia.org/wiki/Lippische_M%C3%BCnzgeschichte","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Bernhard_VII._%28Lippe%29.jpg","page_title":"Lippische Münzgeschichte","context_page_description":"Die Lippische Münzgeschichte beschreibt das Münzwesen in Lippe bis zur Zeit des Ersten Weltkriegs im Jahr 1918."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F_(%D1%81%D0%B5%D1%80%D0%B8%D1%8F_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Pocztapolska5pf1919.jpg","page_title":"Германия (серия марок)","context_page_description":"«Герма́ния» — филателистическое название широко известной серии стандартных почтовых марок Германской империи с изображением аллегорического женского образа Германии, выпускавшейся с некоторыми изменениями в 1899—1920 годах и использовавшейся до 1922 года."},{"page_url":"https://de.wikipedia.org/wiki/Rathaus_Olm%C3%BCtz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Olomouc_town_hall_bay_window.jpg","page_title":"Rathaus Olmütz","context_page_description":"Das Rathaus in Olmütz, der sechstgrößten Stadt Tschechiens und Verwaltungssitz der Olmützer Region, wurde ab dem 14. Jahrhundert errichtet. Das Rathaus auf dem Oberen Platz ist ein geschütztes Kulturdenkmal."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B3%D1%83%D0%B1%D0%B5%D1%80%D0%BD%D0%B0%D1%82%D0%BE%D1%80%D0%B0_%D0%A2%D1%8E%D0%BC%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8_(2014)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Vladimir_Yakushev%2C_May_2011.jpeg","page_title":"Выборы губернатора Тюменской области (2014)","context_page_description":"Досрочные выборы губернатора Тюменской области состоялись 14 сентября 2014 года в единый день голосования."},{"page_url":"https://pl.wikipedia.org/wiki/Chrzest_Polski","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Mieszko1.jpg","page_title":"Chrzest Polski","context_page_description":"Chrzest Polski – tradycyjna nazwa chrztu księcia Polan Mieszka I, który zapoczątkował proces chrystianizacji ziem polskich. Niekiedy uważa się go również za symboliczne wydarzenie, które było początkiem państwa polskiego i polskiego Kościoła katolickiego. Datuje się go zazwyczaj na rok 966, chociaż nie jest to pewne, gdyż źródła średniowieczne różnią się zarówno w opisie okoliczności, w jakich doszło do chrztu, jak też podają różne daty tego wydarzenia."},{"page_url":"https://fr.wikipedia.org/wiki/Cimeti%C3%A8re_Saint-Gervais","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Cimeti%C3%A8re_et_h%C3%B4pital_St-Gervais_sur_plan_Deharme_de_1760.png","page_title":"Cimetière Saint-Gervais","context_page_description":"Le cimetière Saint-Gervais est un ancien cimetière qui était accolé à l’église Saint-Gervais entre sa paroi nord et la rue du Pourtour dans le 4ᵉ arrondissement de Paris."},{"page_url":"https://vi.wikipedia.org/wiki/S%C3%A2n_bay_Amsterdam_Schiphol","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Schiphol-overview.png","page_title":"Sân bay Amsterdam Schiphol","context_page_description":"Sân bay Schiphol là sân bay chính của Hà Lan. Sân bay này tọa lạc tại Tây Nam của Amsterdam, Schiphol là một sân bay chính của châu Âu, cạnh tranh với các sân bay chính khác của châu Âu là Sân bay quốc tế Heathrow ở London, UK, Sân bay quốc tế Frankfurt ở Frankfurt am Main và Sân bay quốc tế Charles de Gaulle ở Roissy-en-France, gần Paris.\\nNăm 2005, Schiphol được xếp thứ tư tại châu Âu về lượng khách phục vụ, sau các sân bay London Heathrow, Paris Charles de Gaulle và Frankfurt International Airport. Có khoảng 35% khách của Schiphol là khách bay xuyên lục địa. Cùng năm, Schiphol được xếp thứ ba về lượng hàng thông chuyển, xếp sau Paris và Frankfurt."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89v%C3%A8nements_d%27%C3%85dalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Adalen-milos.jpg","page_title":"Évènements d'Ådalen","context_page_description":"Les évènements d'Ådalen, aussi appelés coups de feu d'Ådalen ou Ådalen 31, sont une succession d'événements entourant une grève ayant eu lieu en mai 1931, dans la vallée d'Ådalen, en Suède, où cinq personnes ont été tuées par balles, par des militaires appelés en renfort par la police. À l'époque la question de la responsabilité de cette tragédie divisa la Suède. Des lignes éditoriales très contrastées émergèrent entre les journaux d'obédience bourgeoise et travailliste."},{"page_url":"https://sv.wikipedia.org/wiki/Catasetum_albovirens","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Catasetum_albovirens_-_Fl.Br.3-5-088.jpg","page_title":"Catasetum albovirens","context_page_description":"Catasetum albovirens är en orkidéart som beskrevs av João Barbosa Rodrigues. Catasetum albovirens ingår i släktet Catasetum och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://tl.wikipedia.org/wiki/Paglilitis_kay_Saddam_Hussein","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/SaddamHussein_in_court_2004July01_DF-SD-05-03944.jpg","page_title":"Paglilitis kay Saddam Hussein","context_page_description":"Ang paglilitis sa dating Pangulo ng Iraq na si Saddam Hussein ay kasalukuyang ginaganap sa ilalim ng Iraqi Special Tribunal, kung saan sya ay lilitiis sa ibat ibang aligasyon kabilang na ang paglabag sa karapatang pantao sa Iraq, ang digmaang Iran-Iraq, at ang pagsalakay sa Kuwait. Kung matatagpuang nagkasala sa mga kasong tulad ng genocide, maari siyang maparusahan ng kamatayan."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B8%D1%86%D1%96%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Visierlinie.jpg","page_title":"Приціл","context_page_description":"Приці́л — приладдя для наведення зброї на ціль, призначені для контролю положення каналу ствола у просторі стосовно точки прицілювання.\\nПриціл також може бути використаний для спостереження за полем бою та вибору цілі.\\nІснує два види наведення зброї: пряме та непряме:\\nПід час прямого наведення точкою прицілювання є ціль.\\nНепряме наведення виконується візуванням по деякій допоміжній точці, положення якої відоме стосовно цілі.\\nЗа приналежністю до зброї приціли поділяються на артилерійські, авіаційні, стрілецькі, танкові, ракетних комплексів тощо. За принципом дії приціли бувають механічні, оптичні, телевізійні, лазерні, радіолокаційні. Залежно від потреби в участі людини у процесі прицілювання — на автоматичні, напівавтоматичні та неавтоматичні."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D8%A7%D9%86%D8%AF%D8%A7%D9%86_%D8%A7%D9%88%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Mon-Oda.png","page_title":"خاندان اودا","context_page_description":"خاندان اودا یک خاندان از دایمیوهای ژاپنی بود که در اواسط قرن شانزدهم به نیروی سیاسی مهمی در جهت اتحاد ژاپن تبدیل شد. زادگاه اصلی این خاندان در ولایت اچیزن و معبد تسوروگی بوده‌است. نسب این خاندان به خاندان فوجی‌وارا و پس از آن خاندان تایرا نسبت داده شده‌است. خاندان اودا در ولایت اچیزن به عنوان شوگودای در خدمت خاندان شیبا بوده‌است. سپس خاندان اودا به ولایت اُواری مهاجرت کرده و از دوره موروماچی عهده‌دار شوگودای ولایت اُواری شده و به مرور زمان به چندین شاخه تقسیم شده‌است. در دوره سنگوکو، اودا نوبوناگا از «شاخه دانجو نو جو» این خاندان شروع به گسترش قلمروی خود می‌کند اما درست کمی از تسلط بر تمامی خاک ژاپن در حادثه معبد هوننو به همراه پسر ارشدش اودا نوبوتادا جان خود را از دست می‌دهد. پس از مرگ او و پس از درگیری برای جانشینی اش سرانجام تویوتومی هیده‌یوشی به عنوان جانشین او و به نیابت نوه خرد سالِ نوبوناگا اودا هیده‌نوبو در رأس قدرت قرار می‌گیرد. اما هیده‌یوشی حتی بعد از رسیدن اودا هیده‌نوبو به سن بلوغ نیز قدرت را به او بازپس نمی‌دهد. قلعه گیفو متعلق به خاندان اودا مصادره شده و اودا هیده‌نوبو به اراضی جدیدی که از طرف هیده‌یوشی به او داده شده در ولایت مینو منتقل می‌شود."},{"page_url":"https://pt.wikipedia.org/wiki/Alfena","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Sra_do_Amparo_Tapete_de_Flores.jpg","page_title":"Alfena","context_page_description":"Alfena é uma cidade e freguesia portuguesa do concelho de Valongo com 15,7 km² de área e 18 125 habitantes. A sua densidade populacional é de 1154.5 hab/km².\\nA freguesia encontra-se dividida em 21 lugares: Aldeia Nova, Baguim, Barreiro, Cabeda, Codiceira, Costa, Ferraria, Gandra, Igreja, Lombelho, Outeiro, Pedrouços, Punhete, Reguengo, Ribeiro, Rua, Transleça, Trás-do-Casal, Várzea, Vilar e Xisto."},{"page_url":"https://de.wikipedia.org/wiki/Rothenbrunnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Rothenbrunnen_Brunnen.jpg","page_title":"Rothenbrunnen","context_page_description":"Rothenbrunnen ist eine politische Gemeinde in der Region Viamala des Kantons Graubünden in der Schweiz.\\nDer deutsche Name stammt von der warmen jodeisenhaltigen Heil- und Mineralquelle. Die Quelle wurde ab 1888 bis in die 1920er Jahre im Kurhaus für Badekuren genutzt."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BC%D0%B5%D1%99%D0%BE%D1%81%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Flag_of_Tomelloso.png","page_title":"Томељосо","context_page_description":"Томељосо је град у Шпанији, који се налази на северозападу провинције Сијудад Реал. Има 32.532 становника."},{"page_url":"https://de.wikipedia.org/wiki/Kardiomyopathie","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/ARVD-Epsilon_wave.png","page_title":"Kardiomyopathie","context_page_description":"Kardiomyopathien sind eine heterogene Gruppe von Krankheiten des Herzmuskels, die mit mechanischen und/oder elektrischen Funktionsstörungen einhergehen und üblicherweise, aber nicht zwingend, eine unangemessene Hypertrophie oder Dilatation einer oder beider Herzkammern hervorrufen. Ihre Ursachen sind vielfältig und häufig genetisch bedingt. Kardiomyopathien begrenzen sich entweder auf das Herz oder sind Teil einer allgemeinen Systemerkrankung, führen oft zu kardiovaskulär bedingten Todesfällen oder einer fortschreitenden Behinderung durch Herzinsuffizienz.\\n„Cardiomyopathies are a heterogeneous group of diseases of the myocardium associated with mechanical and/or electrical dysfunction that usually exhibit inappropriate ventricular hypertrophy or dilatation and are due to a variety of causes that frequently are genetic. Cardiomyopathies either are confined to the heart or are part of generalized systemic disorders, often leading to cardiovascular death or progressive heart failure–related disability“\\n– American Heart Association, 2006"},{"page_url":"https://nl.wikipedia.org/wiki/Cuffley","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Church_of_St_Andrew_at_Cuffley_-_geograph.org.uk_-_35943.jpg","page_title":"Cuffley","context_page_description":"Cuffley is een plaats in het Engelse graafschap Hertfordshire. Het dorp bevindt zich in het district Welwyn Hatfield. Het dorp telt 4295 inwoners.\\nEr is een treinstation aanwezig dat in de weekenden en avonden verbonden is met King's Cross Station."},{"page_url":"https://en.wikipedia.org/wiki/Lionel_Hampton","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Lionel_Hampton_1948.jpg","page_title":"Lionel Hampton","context_page_description":"Lionel Leo Hampton was an American jazz vibraphonist, pianist, percussionist, and bandleader. Hampton worked with jazz musicians from Teddy Wilson, Benny Goodman, and Buddy Rich to Charlie Parker, Charles Mingus, and Quincy Jones. In 1992, he was inducted into the Alabama Jazz Hall of Fame, and was awarded the National Medal of Arts in 1996."},{"page_url":"https://la.wikipedia.org/wiki/Constantinus_Ioannes_Parhon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Semnatura_C_I_Parhon.PNG","page_title":"Constantinus Ioannes Parhon","context_page_description":"Constantinus Ioannes Parhon fuit politicorum peritus et medicus Dacoromanus."},{"page_url":"https://et.wikipedia.org/wiki/Karikas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Alterkalk-2C-disk_DMR-167985_2000.jpg","page_title":"Karikas","context_page_description":"Karikas on sügava kausikese kujuline laieneva jalaga jooginõu, mis koosneb ketta- või koonusekujulisest alusest ehk kabjast, pungisega tüvesest ja kausikujulisest kupast. Võib olla valmistatud vääris- või muudest metallidest või klaasist."},{"page_url":"https://oc.wikipedia.org/wiki/Le_Parcq","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Le_Parcq_-_%C3%A9glise.JPG","page_title":"Le Parcq","context_page_description":"Le Parcq es una comuna francesa, situada dins lo departament del Pas de Calais e la region del Nòrd-Pas de Calais."},{"page_url":"https://es.wikipedia.org/wiki/San_Blas_(Nayarit)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Bandera_batallon_snblas.jpg","page_title":"San Blas (Nayarit)","context_page_description":"San Blas es una ciudad y puerto del estado mexicano de Nayarit, ubicada de cara al océano Pacífico. Es la cabecera del municipio de San Blas.\\nFue fundado en época de la colonia española y fue uno de los dos principales puertos en el océano Pacífico del Virreinato de Nueva España junto a Acapulco. De San Blas partieron muchas de las expediciones rumbo al océano Pacífico Norte para ampliar el dominio español en esas ignotas tierras a la vez que proteger de invasores los recientes descubrimientos."},{"page_url":"https://pl.wikipedia.org/wiki/Pleizenhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Pleizenhausen01.jpg","page_title":"Pleizenhausen","context_page_description":"Pleizenhausen – miejscowość i gmina w Niemczech, w kraju związkowym Nadrenia-Palatynat, w powiecie Rhein-Hunsrück, wchodzi w skład gminy związkowej Simmern/Hunsrück."},{"page_url":"https://en.wikipedia.org/wiki/Jean_Louis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Marlene_Dietrich_on_the_set_of_The_Montecarlo_Story_%281956%29.jpg","page_title":"Jean Louis","context_page_description":"Jean Louis was a French-born, Hollywood costume designer and an Academy Award winner for Best Costume Design."},{"page_url":"https://fr.wikipedia.org/wiki/Commanderie_Saint-Jean_de_Fribourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Fribourg%2C_Ancienne_commanderie_de_Saint-Jean.JPG","page_title":"Commanderie Saint-Jean de Fribourg","context_page_description":"La Commanderie de Saint-Jean est un édifice religieux situé dans la ville suisse de Fribourg. Elle a été bâtie vers le milieu du XIIIᵉ siècle pour les Hospitaliers de l'ordre de Saint-Jean de Jérusalem. Elle abrite aujourd'hui le Service des biens culturels de l'État de Fribourg. L'ensemble est complété par l'église toute proche de Saint-Jean."},{"page_url":"https://eo.wikipedia.org/wiki/Martigny_(distrikto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Charrat.png","page_title":"Martigny (distrikto)","context_page_description":"La Distrikto Martigny estas administra unuo de Kantono Valezo. Ĝi havis 42257 loĝantojn la 31-an de decembro 2012. Ĝia ĉefurbo estas la samnoma urbo Martigny."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B5%D6%80%D6%87%D5%A1%D5%B6%D5%AB_%D5%B4%D5%A5%D5%BF%D6%80%D5%B8%D5%BA%D5%B8%D5%AC%D5%AB%D5%BF%D5%A5%D5%B6%D5%AB_%D5%AF%D5%A1%D5%B5%D5%A1%D6%80%D5%A1%D5%B6%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Plan_of_the_Yerevan_Metro.png","page_title":"Երևանի մետրոպոլիտենի կայարանների ցանկ","context_page_description":"Սա Երևանի մետրոպոլիտենի կայարանների ցանկն է՝ Երևանում մետրոպոլիտենի գծային համակարգը ։"},{"page_url":"https://en.wikipedia.org/wiki/Amdavad_ni_Gufa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Amdavad_ni_Gufa3.jpg","page_title":"Amdavad ni Gufa","context_page_description":"Amdavad ni Gufa is an underground art gallery in Ahmedabad, India. Designed by the architect Balkrishna Vithaldas Doshi, it exhibits works of the Indian artist Maqbool Fida Husain. The gallery represents a unique juxtaposition of architecture and art. The cave-like underground structure has a roof made of multiple interconnected domes, covered with a mosaic of tiles. On the inside, irregular tree-like columns support the domes. It was earlier known as Husain-Doshi ni Gufa.\\nThere are facilities for special painting exhibitions and for projecting films. Gardens and a café are located above ground."},{"page_url":"https://sl.wikipedia.org/wiki/Ob%C4%8Dina_Radovljica","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Radovljica_bled_okt-28-2006-01.JPG","page_title":"Občina Radovljica","context_page_description":"Občina Radovljica je ena od občin v Republiki Sloveniji. Leži na severozahodu Slovenije. Na zahodu meji na občino Bled, na severu na Žirovnico, na severovzhodu na Tržič, na vzhodu na Naklo, na jugu na mestno občino Kranj ter na jugozahodu na Bohinj."},{"page_url":"https://en.wikipedia.org/wiki/Florrie_R._Burke","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Florrie_R._Burke.jpg","page_title":"Florrie R. Burke","context_page_description":"Florrie R. Burke, M.Ed., MA, LMFT, is a human rights advocate, specializing in combating human trafficking. Secretary of State John Kerry presented Ms. Burke with the inaugural Presidential Award for Extraordinary Efforts to Combat Trafficking in Persons in May 2013. The Award was granted in recognition of “her sustained dedication and unparalleled leadership in combating modern slavery through the development and delivery of comprehensive services, the empowerment of survivors to move from slavery to independence, and the transformation of policy to eradicate all forms of human trafficking.”\\nFlorrie Burke is a consultant on Human Trafficking and Modern Day Slavery to both governmental and non-governmental agencies. With a decade and a half of specialized experience, she is a leading expert on the victim-centered approach in human trafficking cases and collaborative efforts of criminal justice actors and victim care providers. She is a founding member and currently Chair Emeritus of the Freedom Network, serves as advisor to the Freedom Network Training Institute and is on the Steering Committee of the New York Anti-Trafficking Network."},{"page_url":"https://cs.wikipedia.org/wiki/B%C3%ADl%C3%A9_%C3%BAtesy_doversk%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/White_Cliffs_of_Dover_map.png","page_title":"Bílé útesy doverské","context_page_description":"Bílé útesy doverské jsou proslulé útesy na britském pobřeží v hrabství Kent. Jsou asi 110 m vysoké. Rozkládají se v okolí Doveru mezi městy Folkestone na západě a Deal na východě. Nacházejí se na nejužším místě Lamanšského průlivu a od francouzského města Calais je dělí jen 34 km. Právě sem proto směřovali a směřují všichni, kdo se chtějí dostat z evropské pevniny na britské ostrovy, takže přestože se podobné útesy nacházejí i na jiných místech, nejznámější jsou ty poblíž Doveru. Díky strategické poloze a zářivě bílé barvě byly útesy vyhlášené již v antice a patrně podle nich vznikl i původní název Anglie - Albion.\\nBílou barvu skal způsobuje jejich geologické složení - tvoří je čistá křída, místy obsahující valouny pazourku. Útesy jsou součástí kuestového hřbetu North Downs budovaného právě z bílé psací křídy a glaukonitických pískovců, který společně s protilehlým South Downs vytváří podloží jihovýchodního pobřeží Anglie. Zdejší horniny vznikaly na konci druhohor, ve svrchní křídě, kdy se na dně mělkého moře hromadily kalcitové schránky odumřelých mikroorganismů, zejména řas kokolitek."},{"page_url":"https://lt.wikipedia.org/wiki/Jau%C4%8Diaragin%C4%97s","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Bovichtus_variegatus_%28Thornfish%29.gif","page_title":"Jaučiaraginės","context_page_description":"Jaučiaraginės – ešeržuvių žuvų šeima. Paplitusios Australijos, Naujosios Zelandijos ir Pietų Amerikos priekrančių vandenyse, taip pat Tasmanijos ir pietryčių Australijos upėse ir ežeruose.\\nŠeimoje 3 gentys, 10 rūšių."},{"page_url":"https://fi.wikipedia.org/wiki/Tylypahka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Hall_of_Christ_Church%2C_Oxford.jpg","page_title":"Tylypahka","context_page_description":"Tylypahkan noitien ja velhojen koulu on kuvitteellinen taikuuden sisäoppilaitos, joka on keskeinen tapahtumapaikka J. K. Rowlingin luomassa Harry Potter -fantasiakirjasarjassa. Tylypahka on tarkoitettu 11—17-vuotiaille Iso-Britanniassa ja Irlannissa asuville noidille ja velhoille. Noin tuhat vuotta vanha koulu toimii suuressa linnassa jossakin päin Skotlantia.\\nTylypahkan motto on ”Draco dormiens nunquam titillandus”, joka on latinaa ja tarkoittaa ”Älä kutita nukkuvaa lohikäärmettä”. Rowling on kertonut halunneensa Tylypahkan moton olevan sisällöltään hyvä, käytännöllinen ohjenuora.\\nHarry Potter -kirjasarjan kuusi ensimmäistä kirjaa sijoittuvat pääosin kouluun ja kukin osa kattaa suunnilleen yhden kouluvuoden tapahtumat. Harry Potter ja kuoleman varjelukset -kirjassa suurin osa tapahtumista sijoittuu Tylypahkan ulkopuolelle Harry Potterin, Ron Weasleyn ja Hermione Grangerin päätettyä jättää viimeinen kouluvuotensa suorittamatta. Kirjan viimeinen taistelu käydään kuitenkin Tylypahkassa.\\nKirjasarjan mukaan muita Euroopan suuria noitakouluja ovat ainakin Beauxbatons ja Durmstrang."},{"page_url":"https://cs.wikipedia.org/wiki/M%C4%9Bstsk%C3%A1_autobusov%C3%A1_doprava_v_Brn%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Dekstra_LF_38_of_DPMB_%283%29.jpg","page_title":"Městská autobusová doprava v Brně","context_page_description":"Městská autobusová doprava je v městě Brně provozována od roku 1930. Dlouhou dobu však byla pouze doplňkem v brněnské MHD. To se ale změnilo stavbou panelových sídlišť a také masovými dodávkami autobusů Karosa ŠM 11 od 60. let 20. století. V 90. letech proběhla v souvislosti se zavedením přestupného tarifu optimalizace linek, např. byla zrušena souběžná vedení s tramvajovými tratěmi a autobusy přestaly zajíždět do centra města.\\nV lednu 2017 byla převážná část městské autobusové dopravy v Brně provozována Dopravním podnikem města Brna v rámci Integrovaného dopravního systému Jihomoravského kraje na 54 linkách, z toho třech expresních, dvou určených převážně pro tělesně postižené, 11 nočních a čtyřech školních. Některé spoje na určitých linkách ale vykonávají i autobusy dalších dopravců zapojených do IDS JMK. Součástí městské dopravy jsou rovněž dvě nákupní linky s bezplatným provozem, účelová linka pro dopravu zaměstnanců do průmyslové zóny a městské úseky příměstských linek IDS JMK provozovaných různými dopravci.\\nK 31. prosinci 2016 provozoval DPMB celkem 298 autobusů určených pro osobní dopravu."},{"page_url":"https://it.wikipedia.org/wiki/Ben_Bitton","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Ben_Bitton.JPG","page_title":"Ben Bitton","context_page_description":"Ben Bitton בן ביטון è un calciatore israeliano, difensore del Maccabi Tel Aviv in prestito dall'Hapoel Be'er Sheva."},{"page_url":"https://en.wikipedia.org/wiki/1905_French_law_on_the_Separation_of_the_Churches_and_the_State","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Le_Rire_-_S%C3%A9paration_de_l%27Eglise_et_de_l%27Etat.jpg","page_title":"1905 French law on the Separation of the Churches and the State","context_page_description":"The 1905 French law on the Separation of the Churches and State was passed by the Chamber of Deputies on 9 December 1905. Enacted during the Third Republic, it established state secularism in France. France was then governed by the Bloc des gauches led by Emile Combes. The law was based on three principles: the neutrality of the state, the freedom of religious exercise, and public powers related to the church. This law is seen as the backbone of the French principle of laïcité. It is however not applicable in Alsace and Moselle."},{"page_url":"https://de.wikipedia.org/wiki/Uni%C3%A3o_das_Freguesias_de_Barroselas_e_Carvoeiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Brasao_carvoeiro.jpg","page_title":"União das Freguesias de Barroselas e Carvoeiro","context_page_description":"Die União das Freguesias de Barroselas e Carvoeiro ist eine portugiesische Gemeinde im Kreis Viana do Castelo im Nordwesten Portugals."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BA%A6%E7%BF%B0%C2%B7%E9%9B%85%E5%90%84%E5%B8%83%C2%B7%E5%B7%B4%E9%9C%8D%E8%8A%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Johann_Jacob_Bachofen.jpg","page_title":"约翰·雅各布·巴霍芬","context_page_description":"约翰·雅各布·巴霍芬瑞士法学家和人类学家。1841～1845年任巴塞尔大学罗马法史教授，1842～1866年任巴塞尔的刑庭法官。曾论证群婚制与母权制的存在，以及从群婚制到对偶婚的过渡形式。所著《母权论》，被认为是现代社会人类学的奠基作品，巴霍芬第一个试图把家庭作为一种社会组织，科学地写出它的历史，并提出母权先于父权的看法。"},{"page_url":"https://en.wikipedia.org/wiki/Little_Grill_Collective","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Antonia_Begonia_accordion_MACRoCk_2009_Little_Grill_Collective_Harrisonburg_VA_April_2009.jpg","page_title":"Little Grill Collective","context_page_description":"Little Grill Collective is a worker-owned cooperative restaurant in Harrisonburg, Virginia in the United States. It was started in June 2003—in a building that has been operating as a restaurant since the 1930s. It is a member of the Downtown Dining Alliance and the U.S. Federation of Worker Cooperatives. It is known for its quirky, eclectic, down-home atmosphere, with boxes of old Trivial Pursuit cards on the tables."},{"page_url":"https://vi.wikipedia.org/wiki/T%C3%ADnh_to%C3%A1n_song_song","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/NvidiaTesla.jpg","page_title":"Tính toán song song","context_page_description":"Tính toán song song là một hình thức tính toán trong đó nhiều phép tính được thực hiện đồng thời, hoạt động trên nguyên tắc là những vấn đề lớn đều có thể chia thành nhiều phần nhỏ hơn, sau đó được giải quyết tương tranh. Có nhiều hình thức khác nhau của tính toán song song: song song cấp bit, song song cấp lệnh, song song dữ liệu, và song song tác vụ. Song song đã được sử dụng từ nhiều năm qua, chủ yếu là trong lĩnh vực tính toán hiệu năng cao. Gần đây hình thức tính toán này được quan tâm nhiều hơn, do những hạn chế vật lý ngăn chặn việc tăng hiệu năng tính toán chỉ bằng cách tăng tần số. Vì việc tiêu hao điện năng từ máy tính đã trở thành một mối lo ngại trong những năm gần đây, tính toán song song đã trở thành mô hình thống trị trong lĩnh vực kiến trúc máy tính, phần lớn là dưới dạng bộ xử lý đa nhân.\\nCác máy tính song song có thể được phân loại tùy theo cấp độ hỗ trợ cho song song của phần cứng, với những chiếc máy tính đa nhân và đa xử lý có bộ phận đa xử lý trong một máy đơn lẻ, trong khi cụm máy tính, xử lý song song hàng loạt, và điện toán lưới sử dụng nhiều máy tính để xử lý cùng một công việc."},{"page_url":"https://ru.wikipedia.org/wiki/Toyota_Motorsport_GmbH","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Toyota_Monte-Carlo_1999.jpg","page_title":"Toyota Motorsport GmbH","context_page_description":"Toyota Motorsport GmbH — подразделение компании Toyota, базирующееся в Кёльне, Германия. На заводе площадью 30 000 м² работают около 200 человек, которые обеспечивают автоспорт компании Toyota и внешних клиентов.\\nTMG отвечала за европейскую сборную Toyota, и занималась автомобилями Toyota, принимавшими участие в Чемпионатах мира по ралли, начиная с 1970-х и до 1990-х годов. Кроме того, с 1994 года, TMG разработала тюнинг для дорожных автомобилей и выпускала различные спортивные аксессуары. В 1999 году компания прекратила участие в ралли, для того, чтобы подготовиться для перехода на Формулу 1 в 2002 году. С 2002 по 2009 годы, TMG принимала участие в Формуле 1 под названием команды Panasonic Toyota Racing, начиная с Гран-При 139. За эти годы, их автомобили заканчивали заезды на подиуме 13 раз, набрав в общей сложности 278,5 очков. На 4 ноября 2009 года, Toyota объявила о своем выходе из Формулы 1.\\nЭти спортивные автомобили также участвовали в гонке 24 часа Ле-Мана в 1998 и 1999 годах, при этом автомобиль Toyota GT-One в 1999 году финишировал на 2-м месте."},{"page_url":"https://cs.wikipedia.org/wiki/Vojt%C4%9Bch_V%C3%A1clav_Sternberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Vojt%C4%9Bch_V%C3%A1clav_Sternberg_%281868-1930%29.jpg","page_title":"Vojtěch Václav Sternberg","context_page_description":"Vojtěch Václav Sternberg, též ze Sternbergu/ze Šternberka v německojazyčném prostředí Adalbert Sternberg, domácky neformálně Monši, byl rakouský a český šlechtic a politik, na počátku 20. století byl poslancem Říšské rady."},{"page_url":"https://fr.wikipedia.org/wiki/Mat%C3%A9riel_roulant_ferroviaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Yeoman_Class_08.JPG","page_title":"Matériel roulant ferroviaire","context_page_description":"Le matériel roulant ferroviaire est composé de l'ensemble des véhicules, moteurs ou remorqués, conçus pour se déplacer sur une voie ferrée.\\nMis à part quelques locotracteurs ou lignes de métro sur pneumatiques et les expériences de l'aérotrain ou du train à sustentation magnétique, les véhicules ferroviaires sont munis de roues en acier formant avec le rail un système étroitement coordonné.\\nLes rails utilisés sont généralement de type Vignole et, pour les tramways, des rails à gorge.\\nLa stabilité du roulement est assurée par la forme légèrement conique des bandes de roulement et la présence des boudins sur la face intérieure des roues. L'essieu se centre spontanément en adaptant la zone de contact de la roue sur le rail en fonction de la courbure de la voie et des efforts à lui transmettre. Cette stabilité est encore accrue par la cohésion des rames articulées comme les TGV.\\nLe principal avantage des véhicules sur rail conventionnels est le faible coefficient d'adhérence des bandage de roues en acier sur les rails, également en acier, qui permet de déplacer des masses importantes avec de faibles déperditions d'énergie."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%86%D1%91%D0%BB_%D0%9D%D0%B0%D0%B9%D1%81%D0%B2%D1%8F%D1%86%D0%B5%D0%B9%D1%88%D0%B0%D0%B9_%D0%A2%D1%80%D0%BE%D0%B9%D1%86%D1%8B_(%D0%94%D0%B0%D0%BD%D1%8E%D1%88%D0%B0%D0%B2%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Daniu%C5%A1ava._Trinity_church_9.Jpg","page_title":"Касцёл Найсвяцейшай Тройцы (Данюшава)","context_page_description":"Касцёл Найсвяцейшай Тройцы — каталіцкі храм у в. Данюшава Смаргонскага раёна, стаіць на заходняй ускраіне вёскі, на правым беразе ракі Вілія. Помнік архітэктуры эклектычнага стылю. Дзейнічае."},{"page_url":"https://hu.wikipedia.org/wiki/Camillo_Benso_di_Cavour","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Cavour-Vercelli.JPG","page_title":"Camillo Benso di Cavour","context_page_description":"Camillo Benso di Cavour, gróf; olasz politikus. A Szárd–Piemonti Királyság miniszterelnökeként jelentős szerepet játszott az egységes Olaszország létrehozásában. A III. Napóleon francia császárral kötött katonai megállapodása alapján kirobbantotta az 1859. évi piemonti–francia–osztrák háborút, amelynek kimenetele megtörte a Habsburg Birodalom észak-itáliai főhatalmát, és 1860-ra elvezetett Itália államainak a Savoyai-ház koronája alatt történő egyesítéséhez. Az egyesült Olasz Királyság első miniszterelnöke, külügyminisztere és tengerészeti minisztere lett, 1861-ben bekövetkezett haláláig."},{"page_url":"https://de.wikipedia.org/wiki/Quitzow_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Rotes_Rathaus_Berlin_Relief_Raubritter.jpg","page_title":"Quitzow (Adelsgeschlecht)","context_page_description":"Die Quitzow sind ein Uradelsgeschlecht aus der Mark Brandenburg."},{"page_url":"https://en.wikipedia.org/wiki/Marina_Garc%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Marina_Garc%C3%A9s.jpg","page_title":"Marina Garcés","context_page_description":"Marina Garcés Mascareñas is a Spanish philosopher and essayist. She is a professor of Philosophy at the University of Zaragoza and part of a collective project of critical and experimental thinking called Espai en Blanc. She has published several essays on contemporary politics and critical thought, including Filosofía inacabada, Fora de classe. Textos de filosofia de guerrilla, Nova il·lustració radical and Ciutat Princesa"},{"page_url":"https://en.wikipedia.org/wiki/Canaletto","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Canaletto_london.jpg","page_title":"Canaletto","context_page_description":"Giovanni Antonio Canal, commonly known as Canaletto, was an Italian painter from the Republic of Venice, considered important member of the 18th-century Venetian school. Painter of city views or vedute, of Venice, Rome, and London, he also painted imaginary views, although the demarcation in his works between the real and the imaginary is never quite clearcut. He was further an important printmaker using the etching technique. In the period from 1746 to 1756 he worked in England where he painted many views of London and other sites including Warwick Castle and Alnwick Castle. He was highly successful in England, thanks to the British merchant and connoisseur Joseph \\"Consul\\" Smith, whose large collection of Canaletto's works was sold to King George III in 1762."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Germany_(1945%E2%80%931990)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Adenauer_1956.jpg","page_title":"History of Germany (1945–1990)","context_page_description":"After the defeat of Nazi Germany in World War II, Germany was divided between the two global blocs in the East and West, a period known as the division of Germany. Germany was stripped of its war gains and lost territories in the east to Poland and the Soviet Union. At the end of the war, there were some eight million foreign displaced persons in Germany; mainly forced laborers and prisoners; including around 400,000 from the concentration camp system, survivors from a much larger number who had died from starvation, harsh conditions, murder, or being worked to death. Over 10 million German-speaking refugees arrived in Germany from other countries in Central and Eastern Europe. Some 9 million Germans were POWs, many of whom were kept as forced laborers for several years to provide restitution to the countries Germany had devastated in the war, and some industrial equipment was removed as reparations.\\nThe Cold War divided Germany between the Western Allies in the west and Soviets in the east. Germans had little voice in government until 1949 when two states emerged:"},{"page_url":"https://lb.wikipedia.org/wiki/Messier_106","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/NGC_4258GALEX.jpg","page_title":"Messier 106","context_page_description":"De Messier 106 ass eng Spiralgalaxis mat enger Gréisst vu 17.4' × 6.6' an enger visueller Magnitude vu +8.40ᵐ ag am Stärebild Canes Venatici.\\nDen M106 ass eng Galaxis, deen an der Hubble-Sequenz dem Typ Sbp zougewise gëtt, woubäi de p fir engl.: peculiar, d. h. kurious steet. Verschidden Auteure ginn den Typ och mat SABbc un, also tëscht normaler Spiral a Balke-Spiral. Mat enger Distanz vu ronn 24 Millioune Liichtjoer läit d'Galaxis an der Géigend vu ville Galaxiëgruppen.\\nDe Kär vun der Galaxis ass aktiv an als Radioquell zanter den 1950er Jore bekannt."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%94%D1%80%D0%B5%D0%B7%D0%B4%D0%B5%D0%BD%D1%81%D0%BA%D0%B8_%D0%BA%D0%BE%D0%B4%D0%B5%D0%BA%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/L%C3%A1minas_8_y_9_del_C%C3%B3dice_de_Dresden.jpg","page_title":"Дрезденски кодекс","context_page_description":"Дрезденскиот кодекс е најстарата преживеана книга од Америка, која потекнува од 13 век или 14 век. Кодексот бил повторно откриен во градот Дрезден, па според него оваа мајанска книга го добила името. Оваа книга се наоѓа во музејот на Саксонската Државна Библиотека во Дрезден, Германија.\\nКнигата претрпела сериозни оштетувања од вода за време на Втората светска војна. Страниците се 20 см високи, и може да се здиплат во хармоника-стил; а кога е раширен, кодексот е 3,7 метри долг. Кодексот е напишан со мајански хиероглифи и пренесува настани од некои триста или четири стотини години порано, опишувајќи ја локалната историја и астрономски табели."},{"page_url":"https://en.wikipedia.org/wiki/%C5%8Cwani,_Aomori","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Owani_town_hall.JPG","page_title":"Ōwani, Aomori","context_page_description":"Ōwani is a town located in Aomori Prefecture, Japan. As of 31 March 2020, the town had an estimated population of 9,322 people in 4,201 households and a population density of 57 persons per km². The total area of the town is 163.41 square kilometres."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B3%D9%88%D9%84%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Svolvaer%2C_Lofoten%2C_Norway.JPG","page_title":"اسولور","context_page_description":"اسولور یک منطقهٔ مسکونی در نروژ است که در وگان واقع شده‌است. اسولور ۲٫۳۷ کیلومتر مربع مساحت و ۴٬۷۲۰ نفر جمعیت دارد و ۳ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Schlichem","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Schlichemklamm_MichaD_2.jpg","page_title":"Schlichem","context_page_description":"Die Schlichem ist ein 34 km langer Fluss im Zollernalbkreis und dem Landkreis Rottweil in Baden-Württemberg, der nach ungefähr westlichem Lauf bei Epfendorf von rechts in den oberen Neckar mündet."},{"page_url":"https://es.wikipedia.org/wiki/Jo_In-sung","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Zo_In_Sung.jpg","page_title":"Jo In-sung","context_page_description":"Jo In-sung en hangul, 조인성; Corea del Sur, 28 de julio de 1981 es un actor surcoreano conocido inicialmente como modelo de Ziozia, y como actor en las series de televisión What Happened in Bali, y That Winter, The Wind Blows, y en las películas A Dirty Carnival y A Frozen Flower.​"},{"page_url":"https://fr.wikipedia.org/wiki/Hendrik_Goltzius","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Hendrick_Goltzius_013.jpg","page_title":"Hendrik Goltzius","context_page_description":"Hendrik Goltz ou Hendrick Goltz, connu sous la forme latinisée de son nom, Goltzius, est un dessinateur, peintre et graveur néerlandais.\\nSes gravures, très prisées, issues de ses propres dessins ou transposant les œuvres de ses contemporains, contribuèrent efficacement à la diffusion du maniérisme en Europe."},{"page_url":"https://ca.wikipedia.org/wiki/Svenska_Institutet","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Svenska_Institutet_Slottsbacken.jpg","page_title":"Svenska Institutet","context_page_description":"L'Svenska Institutet és una agència governamental sueca que s'encarrega de proporcionar informació sobre Suècia a l'estranger, de promoure els interessos suecs, i d'organitzar intercanvis amb altres països en diferents àmbits de la vida pública, especialment en els àmbits cultural, educatiu i d'investigació.\\nLa seu principal del Svenska Institutet es troba a la Gamla Stan, al centre d'Estocolm. També té una seu a l'estranger, el Centre culturel suédois de París. L'agència compta amb uns noranta empleats, i el govern de Suècia és el que en designa els dirigents.\\nA principis del 2007, l'Svenska Institutet va informar que planejava muntar una \\"ambaixada\\", la \\"Casa de Suècia\\", a Second Life, un món virtual a Internet. Aquesta oficina virtual no expedirà ni passaports ni vises, però donarà informació sobre Suècia."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Nieder%C3%B6sterreich","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Stolpersteinverlegung_in_Pitten_%2803%29.jpg","page_title":"Liste der Stolpersteine in Niederösterreich","context_page_description":"Die Liste der Stolpersteine in Niederösterreich enthält die Stolpersteine im österreichischen Bundesland Niederösterreich, in sieben Gemeinden. Stolpersteine erinnern an das Schicksal der Menschen, die von den Nationalsozialisten ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Steine wurden von Gunter Demnig konzipiert und verlegt. Sie werden im Regelfall vor dem letzten selbstgewählten Wohnort verlegt.\\nEine ernsthafte und umfassende Auseinandersetzung mit der NS-Vergangenheit unter Nutzung des Demnig’schen Projekts findet bislang nur in drei niederösterreichischen Städten statt: in Mödling, in Wiener Neustadt und in Neunkirchen. Zusammen genommen repräsentieren diese drei Städte jedoch nur 4,6 % der niederösterreichischen Bevölkerung. Das Projekt Stolpersteine für Wiener Neustadt zählt aber mit über hundert verlegten Steinen zu den aktivsten Projekten außerhalb Deutschlands.\\nWeiters wurden im Oktober 2018 in St. Pölten „Steine der Erinnerung“, etwas größere Messingplatten, für getötete Juden verlegt.\\nDie Tabellen sind teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D0%BD%D0%B5%D1%81%D1%81%D0%B0%D0%BD%D1%81%D0%BD%D1%8B%D0%B9_%D0%B3%D1%83%D0%BC%D0%B0%D0%BD%D0%B8%D0%B7%D0%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/The_Creation_of_Adam-1.jpg","page_title":"Ренессансный гуманизм","context_page_description":"Ренессансный гуманизм, классический гуманизм — европейское интеллектуальное движение, являющееся важным компонентом Ренессанса. Возникло во Флоренции в середине XIV века, существовало до середины XVI века; с конца XV века перешло в Испанию, Германию, Францию, отчасти в Англию и другие страны.\\nРенессансный гуманизм является первой стадией развития гуманизма, движением, в котором гуманизм впервые выступил как целостная система взглядов и широкое течение общественной мысли, вызвав подлинный переворот в культуре и мировоззрении людей того времени. Основной идеей ренессансных гуманистов было улучшение человеческой природы через изучение античной литературы."},{"page_url":"https://en.wikipedia.org/wiki/Matthias_Dropa","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/St._Michaelis_L%C3%BCneburg_Orgel.JPG","page_title":"Matthias Dropa","context_page_description":"Matthias Dropa was a German organ builder. A pupil of Arp Schnitger, he built organs in Northern Germany, including St. Michaelis, Lüneburg."},{"page_url":"https://de.wikipedia.org/wiki/Alexandra_Wassiljewna_Rodionowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Alexandra_Rodionova_2012.jpg","page_title":"Alexandra Wassiljewna Rodionowa","context_page_description":"Alexandra Wassiljewna Rodionowa ist eine russische Bobsportlerin und ehemalige Rennrodlerin.\\nAlexandra Rodionowa ist Studentin und lebt in Bratsk. Sie rodelt seit 2001 und gehört seit 2003 dem russischen Nationalkader an. Seit der Saison 2002/03 startet sie im Rennrodel-Weltcup. Schon in ihrer ersten Saison wurde sie 14. des Gesamtweltcups, in der darauf folgenden Saison belegte sie den 13. Rang. Mehrfach erreichte sie Plätze unter den besten Zehn, vorderste Platzierung war ein sechster Rang 2007 in Sigulda. Bei der Europameisterschaft 2004 in Oberhof wurde Rodionowa Fünfte mit der Mannschaft, ebenso bei den Rennrodel-Weltmeisterschaften 2005 in Park City. In Einzelrennen wurde sie 2004 und 2007 in Igls. Bei den Olympischen Winterspielen 2006 von Turin belegte sie den 14. Platz, bei den Olympischen Winterspielen 2010 in Vancouver erreichte sie Platz 6."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_K%C3%B6lner_Stadtteil_S%C3%BClz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/K%C3%B6ln-S%C3%BClz_S%C3%BClzburgstrasse_160_Denkmal_6726.JPG","page_title":"Liste der Baudenkmäler im Kölner Stadtteil Sülz","context_page_description":"Die folgende Liste enthält die in der Denkmalliste ausgewiesenen Baudenkmäler auf dem Gebiet des Stadtteils Köln-Sülz, Stadtbezirk Köln-Lindenthal, Nordrhein-Westfalen.\\nHinweis: Die Reihenfolge der Baudenkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Kölner Denkmalliste, die Baudenkmäler und Denkmalbereiche auflistet. Dabei kann es sich beispielsweise um Sakralbauten, Wohn- und Fachwerkhäuser, historische Gutshöfe und Adelsbauten, Industrieanlagen, Wegekreuze und andere Kleindenkmäler sowie Grabmale und Grabstätten, die eine besondere Bedeutung für die Geschichte Kölns haben, handeln. Grundlage für die Aufnahme in die offiziellen Denkmallisten ist das Denkmalschutzgesetz Nordrhein Westfalens."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B0%80%EC%8A%A4%ED%86%B5_%EB%A3%B0%EB%9E%80%EC%B8%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Gaston_Roelants_1968.jpg","page_title":"가스통 룰란츠","context_page_description":"가스통 룰란츠는 전 벨기에의 육상 선수이다. 1960년대에 최고의 3000m 장애물경주 선수와 위대한 크로스컨트리 달리기 선수였던 그는 1962년 유럽 선수권과 1964년 도쿄 올림픽에서 장애물경주 금메달 획득은 물론, 2개의 세계 기록들을 세웠다 - 8분 29.6초와 8분 26.4초.\\n오프벨프에서 태어난 룰란츠는 1960년 로마 올림픽에서 장애물경주 4위를 하고, 1966년 부다페스트에서 열린 유럽 선수권 대회에서 동메달을 딴 후 장거리달리기 선수로서 위대한 성공을 거두었다. 그해에 20km와 1시간 경주에서 각각 58분 6.2초와 20,664m의 세계 기록들을 세웠고, 1972년에 이 종목들의 기록들을 57분 44.4초와 20,878m로 향상시켰다. 그는 2개의 유럽 선수권 마라톤에서 각각 2위와 3위를 하였다. 룰란츠는 5번이나 세계 제일의 장애물경주 선수로 선정되었다.\\n룰란츠는 4개의 국제 크로스컨트리 타이틀을 3초 순위와 함께 우승하면서 기록을 동일하게 하였고 1960년과 1970년 사이에 톱 10위들에서 보모두 9위를 차지하였다. 그의 장기적 경력은 그의 40대 안으로 지속되었고 명수의 순위들에서 자신의 첫해에 5개의 타이틀을 우승하여 27년 동안 장애물경주에서 명수 세계 기록을 보유하였다.\\n벨기에의 중요한 12월 도로 경주는 그의 이름을 땄다."},{"page_url":"https://eu.wikipedia.org/wiki/Igoin-Akolako_Estazio_Megalitikoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Akolako_lepua_II_trikuharria.jpg","page_title":"Igoin-Akolako Estazio Megalitikoa","context_page_description":"Igoin-Akolako Estazio Megalitikoa. Aztarna megalitiko asko ikus daiteke Altzaniako mendilerroan. Guztira hamalau dira ezagutzen direnak."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B5%D0%BB%D1%96%D0%BA%D0%B0%D0%BD_%D1%81%D1%96%D1%80%D0%B8%D0%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Spot-billed_Pelicans_%26_Painted_Storks_nesting_at_Garapadu%2C_AP_W_IMG_5230.jpg","page_title":"Пелікан сірий","context_page_description":"Пеліка́н сі́рий — водоплавний птах родини пеліканових. Зникаючий вид, занесений до Червоного списку Міжнародного союзу охорони природи."},{"page_url":"https://it.wikipedia.org/wiki/Inula_conyzae","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Inula_conyzae_1.jpg","page_title":"Inula conyzae","context_page_description":"La enula baccherina è una pianta erbacea, perenne a fiori gialli, appartenente alla famiglia delle Asteraceae."},{"page_url":"https://la.wikipedia.org/wiki/Br%C3%A9aut%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Eglise_Br%C3%A9aut%C3%A9_05.jpg","page_title":"Bréauté","context_page_description":"Bréauté est commune Francicum 1'318 incolarum praefecturae Sequanae Maritimae in regione Normannia Superiori."},{"page_url":"https://sq.wikipedia.org/wiki/Pan%C3%A7a_Rathat","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/PanchaRathas.jpg","page_title":"Pança Rathat","context_page_description":"Pancha Rathat janë një kompleks monumental në Mahabalipuram, në brengun e Coromandelit në gjirin e Bengalit, në distriktin Kancheepuram të shtetit indian të Tamil Nadu-së. Pancha Rathat janë një shembull i arkitekturës shkëmbore monolitike. Të datuara nga fundi i shekullit të VII, i janë atribuar mbretit Mahendravarman I dhe djalit të tij Narasimhavarman I i mbretërisë Pallava. Një risi e Narasimhavarmanit, strukturat janë pa ndonjë preçedent në arkitekturën indiane. Kompleksi është nën përgjegjësinë e Archaeological Survey of India dhe është pjesë e trashëgimisë botërore të UNESCO-s i bashkuar me mënumentet e tjera të Mahabalipuramit nën emërtimin Grupi i monumenteve në Mahabalipuram.\\nSecili nga pesë monumentet në kompleksin e Pancha Rathave i ngjan një karroce, dhe secila është e skalitur në një gurë të vetëm të gjatë ose monolit prej graniti që shtrihet në drejtimin veri-jug me një pjerrësi të vogël. Megjithëse ndonjëherë gabimisht të referuara si tempuj, strukturat nuk u shenjtëruan kurr pasi nuk u përfunduan ndonjëherë pas vdekjes së Narasimhavarmanit I. Strukturat janë emërtuar sipas pesë Pandavave dhe gruas së tyre të përbashkët Draupadi, të eposit të Mahabharatas."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%AB%98%E5%B2%A1%E5%BE%A1%E8%BB%8A%E5%B1%B1%E7%A5%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Kihunemachi-takaoka_mikurumayama.JPG","page_title":"高岡御車山祭","context_page_description":"高岡御車山祭は、毎年5月1日に行われる富山県高岡市の高岡関野神社の春季例祭。富山県内で最も古く、歴史のある山車祭りで、御車山と呼ばれる7基の山車が優雅な囃子とともに高岡の旧市街を巡行する。4月30日には宵祭りが行われる。国の重要有形民俗文化財と重要無形民俗文化財の両文化財に指定されている。また、ユネスコの無形文化遺産に登録されている。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B8%D1%86_%D0%A8%D1%80%D0%B8-%D0%9B%D0%B0%D0%BD%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Red_brested_flycatcher_by_David_Raju_%28cropped%29.jpg","page_title":"Список птиц Шри-Ланки","context_page_description":"Шри-Ланка — это тропический остров, расположенный недалеко от южной оконечности Индии. Орнитофауна Шри-Ланки очень богата своим разнообразием и было зарегистрировано 505 видов. Помимо многочисленных местных птиц, значительное число мигрирующих видов зимует в стране, чтобы покинуть свои северные гнездовые угодья.\\n26 видов являются эндемиками. Другие местные виды также обитают на соседнем материке, но более 80 из них развились в отдельные расы Шри-Ланки. Некоторые из этих рас сильно отличаются по своим характеристикам оперения от родственных форм в Индии. 26 видов находятся под угрозой исчезновения в глобальном масштабе.\\nРаспространение птиц в Шри-Ланке во многом определяется ее климатическими зонами. Сухая зона — самая большая из трех, охватывающая более половины острова, с длительным сухим и жарким периодом и только одним муссоном. Влажная зона с двумя муссонами находится в юго-западной части острова, где находятся немногие оставшиеся дождевые леса и высокая влажность воздуха. Центральная горная зона возвышается более чем на 2450 м и имеет прохладный умеренный климат."},{"page_url":"https://es.wikipedia.org/wiki/Delut","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Eglise_Delut.JPG","page_title":"Delut","context_page_description":"Delut es una población y comuna francesa, en la región de Lorena, departamento de Mosa, en el distrito de Verdun y cantón de Damvillers."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%B8%E0%B6%BA%E0%B7%92%E0%B6%9A%E0%B7%8A%E2%80%8D%E0%B6%BB%E0%B7%9C%E0%B7%83%E0%B7%9C%E0%B7%86%E0%B7%8A%E0%B6%A7%E0%B7%8A_%E0%B6%94%E0%B7%86%E0%B7%92%E0%B7%83%E0%B7%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Office_365_app_logos.svg","page_title":"මයික්‍රොසොෆ්ට් ඔෆිස්","context_page_description":"මයික්‍රොසොෆ්ට් ඔෆිස් හෙවත් MS Office යනු මෘදුකාංග කට්ටලයකි.OpenOffice.org, IBM ආයතනය සතු Lotus Smartsuite. Core/Novel ආයතනය සතු Perfect Office යන මෘදුකාංග කට්ටල මෙන්ම මෘදුකාංග ගණනාවක් ඇති මෘදුකාංග කට්ටලයකි.\\nමෙම මයික්‍රොසොෆ්ට් ඔෆිස් මෘදුකාංග කට්ටලයේ ප්‍රධාන වශයෙන් ලිපි ලේඛන සැකසීම සඳහා වන Word Processing සඳහා මයික්‍රොසොෆ්ට් වර්ඩ් හෙවත් මයික්‍රොසොෆ්ට් වර්ඩ් යන මෘදුකාංගය ද, පැතුරුම්පත් සඳහා මයික්‍රොසොෆ්ට් එක්සෙල් හෙවත් MS Excel යන මෘදුකාංගය ද, Presentation සඳහා මයික්‍රොසොෆ්ට් පවර්පොයින්ට් හෙවත් MS PowerPoint යන මෘදුකාංගය ද දත්ත ගොනු සඳහා මයික්‍රොසොෆ්ට් ඇක්සස් හෙවත් MS Accessයන මෘදුකාංගය ද ඇත."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D1%83%D0%B0%D0%B4%D0%B0%D0%BD-%D0%BB%D0%B5-%D0%92%D0%B5%D0%B7%D1%83%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Noidans-l%C3%A8s-Vesoul_Eglise.JPG","page_title":"Нуадан-ле-Везуль","context_page_description":"Нуада́н-ле-Везу́ль — муніципалітет у Франції, у регіоні Бургундія-Франш-Конте, департамент Верхня Сона. Населення — 2059 осіб.\\nМуніципалітет розташований на відстані близько 320 км на південний схід від Парижа, 45 км на північ від Безансона, 3 км на захід від Везуля."},{"page_url":"https://de.wikipedia.org/wiki/Czernowitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/ROU_IS_Iasi_CoA.png","page_title":"Czernowitz","context_page_description":"Czernowitz, auch Tschernowitz, in der Westukraine ist die Hauptstadt der Oblast Tscherniwzi und die traditionelle Hauptstadt der Bukowina."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A5%D0%B0%D0%B9%D0%BD%D1%80%D0%B8%D1%85_%D1%86%D1%83_%D0%A9%D0%BE%D0%BB%D0%B1%D0%B5%D1%80%D0%B3_(%D0%92%D0%B5%D1%80%D0%BD%D0%B8%D0%B3%D0%B5%D1%80%D0%BE%D0%B4%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Schloss_Wernigerode_Sammlung_Duncker.jpg","page_title":"Хайнрих цу Щолберг (Вернигероде)","context_page_description":"Хайнрих (XI) фон Щолберг-Щолберг от фамилията Щолберг е граф на Щолберг-Щолберг-Вернигероде-Хонщайн.\\nТой е най-малкият син на граф Волфганг фон Щолберг-Вернигероде и втората му съпруга Геновефа фон Вид, дъщеря на граф Йохан III фон Вид и Елизабет фон Насау-Диленбург.\\nБрат е на Волфганг Ернст, граф цу Щолберг-Щолберг, Бото фон Щолберг, Йохан, граф цу Щолберг-Щолберг, и на Анна фон Щолберг, канонеса в Кведлинбург.\\nХайнрих фон Щолберг се жени между 1 януари 1583 и 24 юни 1583 г. за графиня Адриана фон Мансфелд–Арнщайн, дъщеря на граф Йохан Албрехт VI фон Мансфелд-Арнщайн и първата му съпруга графиня Магдалена фон Шварцбург. Те нямат деца.\\nХайнрих фон Щолберг умира на 16 април 1615 г. на 63 години в Зайгерхюте, Вернигероде, и е погребан в Хасероде."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BB%D1%8D%D0%BA%D0%B1%D1%91%D1%80%D0%BD,_%D0%90%D1%80%D1%82%D1%83%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Arthur_Blackburn_J03069A.JPG","page_title":"Блэкбёрн, Артур","context_page_description":"Артур Сифорт Блэкбёрн — австралийский военный и государственный деятель, бригадир Армии Австралии, участник Первой и Второй мировых войн, кавалер Креста Виктории — высшей награды сил Великобритании и Содружества за храбрость перед лицом врага.\\nАртур Блэкбёрн родился в 1892 году в Южной Австралии. Он получил юридическое образование в Университете Аделаиды. После начала Первой мировой войны он вступил добровольцем в армию и был направлен сначала в Галлиполи, а затем во Францию. 23 июля 1916 года Блэкбёрн с 50 товарищами во время битвы за Позьер атаковал противника, установив связь с батальоном, находящимся на левой стороне захваченной траншеи. За это он был награждён Крестом Виктории. После войны Блэкбёрн вернулся в Австралию, где занялся отстаиванием интересов ветеранов и политической деятельностью, после чего вновь поступил на военную службу. Во время Второй мировой войны он служил на Ближнем Востоке, а затем был отправлен на Яву, где принял командование союзными силами. Там Блэкбёрн был взят японцами в плен. Он пережил войну, вышел в отставку и скончался в 1960 году в Южной Австралии."},{"page_url":"https://en.wikipedia.org/wiki/Athletics_at_the_1912_Summer_Olympics_%E2%80%93_Men%27s_javelin_throw","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/1912_Juho_Saaristo2.JPG","page_title":"Athletics at the 1912 Summer Olympics – Men's javelin throw","context_page_description":"The men's javelin throw was a track and field athletics event held as part of the athletics at the 1912 Summer Olympics programme. It was the second appearance of the event. The competition was held on Saturday, July 6, 1912. Twenty-five javelin throwers from seven nations competed. NOCs could enter up to 12 athletes."},{"page_url":"https://nl.wikipedia.org/wiki/Nintendo_Switch","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Nintendo_Switch_Lite_%28turquoise%29_-_1.jpg","page_title":"Nintendo Switch","context_page_description":"De Nintendo Switch is een spelcomputer van het Japanse bedrijf Nintendo die wereldwijd is uitgekomen op 3 maart 2017. Het systeem is een hybride tussen een handheld en een home console. Nintendo maakt volgens eigen zeggen duidelijk dat de Switch in eerste instantie is gericht op thuisgebruik."},{"page_url":"https://nl.wikipedia.org/wiki/Robert_van_der_Kroft","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Jazzroute-Piet_le_Blanc_by_Robert_van_der_Kroft.jpg","page_title":"Robert van der Kroft","context_page_description":"Robert Theodoor van der Kroft is een Nederlands striptekenaar. Sinds 1975 tekent hij de strip Sjors en Sjimmie. Vanaf 1988 volgde ook Claire, een stripverhaal in het weekblad Flair. Een deel van zijn werk verschijnt onder de naam Wiroja, een acroniem dat verwijst naar het samenwerkingsverband tussen Jan van Die, Wilbert Plijnaar en Robert van der Kroft."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%B3%E3%82%B2%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Shingen_20091101P1.jpg","page_title":"シンゲン","context_page_description":"シンゲン は、日本中央競馬会 に登録されていた競走馬である。\\n馬名は最初の馬主であった花木照人自身が武田家の末裔であるため、その縁のある武田信玄から命名された。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D1%82%D0%BE%D0%BB%D0%BE%D0%BC%D0%B5_%D0%91%D0%B5%D0%BD%D0%B0%D1%81%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Bartolom%C3%A9o-Bennassar.jpg","page_title":"Бартоломе Бенасар","context_page_description":"Проф. Бартоломе Бенасар е френски историк и писател, специалист по нова история на Испания и Латинска Америка. Носител на голямата награда за история на Френската академия на науките. Преподава в Тулузкия университет.\\nРоден е на 8 април 1929 г. в град Ним, Лангедок, Южна Франция."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Berkshire_County,_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Philemon_Sage_House.JPG","page_title":"National Register of Historic Places listings in Berkshire County, Massachusetts","context_page_description":"This is a list of the National Register of Historic Places listings in Berkshire County, Massachusetts.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Berkshire County, Massachusetts, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 172 properties and districts listed on the National Register in the county, including 9 National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://eo.wikipedia.org/wiki/Scherpenheuvel-Zichem","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Belgie_scherpenheuvel_basiliek02.jpg","page_title":"Scherpenheuvel-Zichem","context_page_description":"Scherpenheuvel-Zichem estas municipo en Belgio, en la nederlandlingva provinco Flandra Brabanto kiu ĉirkaŭas la Bruselan Ĉefurban Regionon. Komence de januaro 2016 la municipo havis 22 833 loĝantojn. Ĝi apartenas al la distrikto Loveno.] estas municipo en Belgio, kiu en 1605 ricevis la urbajn rajtojn.\\nEkde 1977 la municipoj Averbode, Messelbroek, Scherpenheuvel, Testelt kaj Zichem apartenas al Scherpenheuvel-Zichem, la ĉefa municipo."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BF%D1%80%D0%B0%D0%B2%D0%BB%D1%96%D0%BD%D0%BD%D1%8F_%D0%BF%D1%80%D0%BE%D1%94%D0%BA%D1%82%D0%B0%D0%BC%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/1_UA_Capability_Maturity_Model.png","page_title":"Управління проєктами","context_page_description":"Управління проєктами — область знань з планування, організації та управління ресурсами з метою успішного досягнення цілей та завершення завдань проєкту. Іноді ототожнюється з управлінням програмами, але програма — це фактично вищий рівень: група пов'язаних та взаємозалежних проєктів.\\nПроєкт — це обмежений часовими рамками процес, що має визначений початок та кінець, зазвичай обмежений датою, але також може обмежуватися фінансуванням або досягненням результатів, який здійснюється для реалізації унікальних цілей та завдань, зазвичай, щоб призвести до вигідних змін або створення доданої вартості. Тимчасова природа проєктів контрастує з бізнесом, які є повторюваною, постійною або частково постійною діяльністю з виробництва продуктів або послуг. На практиці, управління вищезазначеними двома системами часто різниться і таким чином вимагає розвитку окремих технічних навичок та використання розподіленого управління ними.\\nГоловним завданням проєктного управління є досягнення всіх цілей та виконання завдань проєкту, одночасно виконуючи зобов'язання щодо наперед визначених обмежень проєкту. Типовими обмеженнями є межі та зміст проєкту, час, бюджет."},{"page_url":"https://en.wikipedia.org/wiki/Rob_Stewart_(actor)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Rob_Stewart.jpg","page_title":"Rob Stewart (actor)","context_page_description":"Rob Stewart is a Canadian actor born in Toronto, Ontario, Canada, Known for the lead role of Nick Slaughter in the action-comedy television series Tropical Heat and his recurring role as Roan in Nikita. He plays Khlyen in Killjoys."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%8C%D0%B2%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Park_Franko_in_Lviv.jpg","page_title":"Львов","context_page_description":"Львов — город областного подчинения на Украине, областной центр Львовской области. Национально-культурный, образовательный и научный центр, крупный промышленный центр и транспортный узел, в печати и в народе называется столицей Галиции и Западной Украины. По численности населения седьмой город страны.\\nЛьвов основан галицким князем и королём Руси Данилой Романовичем в середине XIII века, предположительно, около 1272 года становится столицей Галицко-Волынского княжества. После первого раздела Речи Посполитой, с 1775 по 1918 год, город был столицей Королевства Галиции и Лодомерии, образованного Габсбургами, считавшими себя преемниками королей Руси и носивших титул королей Галиции и Лодомерии. В ходе распада Австро-Венгрии в 1918 году стал столицей Западно-Украинской Народной Республики, однако по итогам Польско-украинской войны был присоединён к Польше. В июне-сентябре 1941 года был фактической резиденцией Украинского государственного правления, организованного после провозглашения Акта восстановления Украинского государства во время Второй мировой войны.\\nИсторический центр Львова внесён в список Всемирного наследия ЮНЕСКО."},{"page_url":"https://de.wikipedia.org/wiki/Sv%C4%9Btl%C3%ADk","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Wappen_svetlik.jpg","page_title":"Světlík","context_page_description":"Světlík ist eine Gemeinde im Okres Český Krumlov in Tschechien. Sie liegt etwa zehn Kilometer südwestlich von Český Krumlov."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_des_Beaux-Arts","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Plaque_Robert_du_Costal_-_Le_Marec%2C_5_rue_des_Beaux-Arts%2C_Paris_6.jpg","page_title":"Rue des Beaux-Arts","context_page_description":"La rue des Beaux-Arts est une rue du quartier Saint-Germain-des-Prés, l’un des quatre quartiers du 6ᵉ arrondissement de Paris."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%96%B0%E5%9F%8E%E5%A0%A1_(%E6%8B%9C%E7%BD%97%E4%BC%8A%E7%89%B9)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Hofgarten_Bayreuth.jpg","page_title":"新城堡 (拜罗伊特)","context_page_description":"新城堡位於德國巴伐利亞州城市拜羅伊特，是布蘭登堡-拜羅伊特侯爵的宮殿，建於1753年，為18世紀德國建築的主要作品之一。"},{"page_url":"https://en.wikipedia.org/wiki/National_Biodiversity_Centre_(Singapore)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Anthracoceros_albirostris.jpg","page_title":"National Biodiversity Centre (Singapore)","context_page_description":"The National Biodiversity Centre is a branch of the National Parks Board and serves as Singapore’s one-stop centre for biodiversity-related information and activities. It manages all available information and data on biodiversity in Singapore. Diverse biodiversity-related information and data are currently generated, stored and updated by different organisations and individuals. The National Biodiversity Centre will maximize the usefulness of such information and data by linking them in a single meta-database. Having complete and up-to-date information is crucial for many decision-making processes involving biodiversity. This hub of biodiversity information and data at the National Biodiversity Centre will also allow knowledge gaps to be better identified and addressed.\\nThe National Biodiversity Centre takes responsibility for the conservation of both terrestrial and marine flora and fauna in Singapore and represents the National Parks Board in its role as the government's scientific authority on nature conservation."},{"page_url":"https://nl.wikipedia.org/wiki/Corematodus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Corematodus_shiranus.jpg","page_title":"Corematodus","context_page_description":"Corematodus is een geslacht van straalvinnige vissen uit de familie van de cichliden."},{"page_url":"https://de.wikipedia.org/wiki/Krystallpalast_(Leipzig)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Breiterscher_Garten_in_Leipzig.jpg","page_title":"Krystallpalast (Leipzig)","context_page_description":"Der Krystallpalast war über etwa 60 Jahre eine aus zahlreichen Einzelangeboten bestehende Vergnügungsstätte in Leipzig. Sie galt als die größte ihrer Art in Deutschland und war in Sachen Veranstaltungsvielfalt und räumlicher Komplexität einzigartig in Europa. Namensgebendes Herzstück war ein nur aus Glas und Eisen bestehender Bau mit einem Saal, der vornehmlich für Varieté-Veranstaltungen genutzt wurde, weshalb auch oft vom Krystallpalast-Varieté gesprochen wurde. Ein Zentralkuppelbau, die Alberthalle, hatte über 3.000 Plätze.\\nDer gesamte Krystallpalast-Komplex, der in seiner Glanzzeit in seinen verschiedenen Sälen, Restaurants, Bars, Cafés, Salons und Biergärten 15.000 Personen fasste, fiel dem Luftangriff am 4. Dezember 1943 zum Opfer."},{"page_url":"https://it.wikipedia.org/wiki/Gnaphalieae","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Phaenocoma_prolifera_hh.jpg","page_title":"Gnaphalieae","context_page_description":"Gnaphalieae Lecoq & Juillet, 1831 è una tribù di piante spermatofite dicotiledoni appartenenti alla famiglia delle Asteraceae."},{"page_url":"https://en.wikipedia.org/wiki/Sergey_Volkov_(cosmonaut)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Expedition_17_EVA2_Volkov.jpg","page_title":"Sergey Volkov (cosmonaut)","context_page_description":"Sergey Aleksandrovich Volkov is a retired Russian cosmonaut and engineer. He was a member of three missions to the International Space Station, spending more than a year in total in space. During his missions he did four spacewalks lasting more than 23 hours in total.\\nVolkov retired from the Cosmonaut group in February 2017."},{"page_url":"https://vi.wikipedia.org/wiki/Orthophytum","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Orthophytum_sucrei_BotGardBln271207A.jpg","page_title":"Orthophytum","context_page_description":"Orthophytum là một chi thực vật có hoa trong họ Bromeliaceae."},{"page_url":"https://jv.wikipedia.org/wiki/Aksara_Bali","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Palataal.JPG","page_title":"Aksara Bali","context_page_description":"Aksara Bali iku Aksara tradhisional masarakat Bali lan tuwuh ing Bali. Aksara Bali wujud sawijining aksara abugida kang asal saka Aksara Pallawa. Aksara iki mèmper karo aksara Jawa. Prabédané dumunung ing lekukan wangun Aksara.\\nAksara Bali cacahé 47 karakter, 14 ing antarané wujud aksara swara utawa vokal. Aksara wyanjana utawa aksara konsonan cacahé 33 karakter. Aksara wyanjana Bali kang biyasa dipigunakaké cacahé 18 karakter. Uga ana aksara wyanjana Kawi kang dipigunakaké ing tembung-tembung tinamtu, mligi tembung-tembung kang diprabawai Basa Kawi lan Sangskerta.\\nSanadyan ana aksara wyanjana Kawi kang isi intonasi nada tinamtu, pangucapané kerep disetarakan karo aksara wyanjana Bali. Umpamané, aksara dirgha kang kuduné diwaca dawa, kerep diwaca kaya aksara hresua."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9D%E3%83%BC%E3%83%88%E3%82%B9%E3%83%BC%E3%83%80%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/PortSudan_center_harbour.jpg","page_title":"ポートスーダン","context_page_description":"ポートスーダンは、スーダン紅海州の州都であり、人口459,101人の都市である。紅海に面し、スーダンにとって重要な港湾都市となっている。それまでこの地方の主要港湾であったスワーキン港がサンゴ礁の発達などで商船の出入りが困難だったことからそれに変わる港湾として1906年に建設された。また、1906年にイギリスが敷設した紅海とナイル川とを結ぶスーダン鉄道の終点ともなっている。この鉄道は、ナイル川沿岸の豊かな農場から輸出市場へトウモロコシ、綿などを輸送するために使われた。市内にはポートスーダン新国際空港が存在する。ポートスーダンは、その素晴らしいダイビングとビーチのために観光客の間で知られている。また、紅海を挟んでサウジアラビアのジッダに向かう出発点ともなる。"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%BC%D0%B5%D1%88%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Smiley.svg","page_title":"Смешко","context_page_description":"Смешко - поедноставен ликовен и графички приказ на човечкото лице со кој се изразуваат чувства. Ја симболизира насмевката."},{"page_url":"https://de.wikipedia.org/wiki/Nanaimo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Namaimo_aerial_4.jpg","page_title":"Nanaimo","context_page_description":"Nanaimo, British Columbia, ist mit rund 80.000 Einwohnern die zweitgrößte Stadt auf der kanadischen Pazifikinsel Vancouver Island. Die Stadt liegt an der Ostseite der Insel, unmittelbar an der Straße von Georgia und ist Sitz des Regional District of Nanaimo. Die nächsten größeren Gemeinden sind Parksville und Ladysmith."},{"page_url":"https://es.wikipedia.org/wiki/Desembarco_militar","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Abraham-lincoln.png","page_title":"Desembarco militar","context_page_description":"El desembarco en una costa hostil es una de las operaciones militares más complejas y arriesgadas."},{"page_url":"https://nl.wikipedia.org/wiki/Masvingo","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Fort-victoria-1952.jpg","page_title":"Masvingo","context_page_description":"Masvingo, tot 1982 Fort Victoria genoemd, is een stad in Zimbabwe en is de hoofdplaats van de provincie Masvingo.\\nDe stad ligt dichtbij Groot Zimbabwe, het nationaal monument waarnaar het land is genoemd. Masvingo is niet ver van het Lake Mutirikwi, met zijn recreatiegebied, de Kyle dam en het Kyle National Reserve waar veel diersoorten te vinden zijn. Masvingo ligt 290 km ten zuiden van de hoofdstad Harare."},{"page_url":"https://en.wikipedia.org/wiki/List_of_rivers_of_Ponce,_Puerto_Rico","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Ponce_rivers.svg","page_title":"List of rivers of Ponce, Puerto Rico","context_page_description":"This list of rivers of Ponce consists of the 14 rivers in the municipality of Ponce, Puerto Rico. Rivers that either originate in the municipality or that run the bulk of their course through said municipality are listed. Except for two rivers, Río Portugués and Río Jacaguas, all other rivers originate and terminate within the boundaries of the municipality of Ponce. This list does not include quebradas. Only streams recognized as \\"rivers\\" by the United States Geological Survey and the Puerto Rico Department of Natural and Environmental Resources are included here.\\nAll the rivers in the municipality of Ponce run into one of four river basins that then empty into the Caribbean Sea. These four river basins are: Río Matilde, Río Bucaná, Río Inabón, and Río Jacaguas.\\nRío Pastillo and Río Canas merge to form Río Matilde. Río Blanco, Río Prieto, Río San Patricio, Río Bayagán, Río Cerrillos, Río Chiquito, and Río Portugués all run in one manner or other into Río Bucaná. Río Anon feeds into Río Inabón. Río Jacaguas is actually shared between the municipalities of Ponce and Juana Díaz, as it forms the boundary between the two municipalities."},{"page_url":"https://sk.wikipedia.org/wiki/Neufch%C3%A2teau_(obvod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Arrondissement_de_Neufch%C3%A2teau.PNG","page_title":"Neufchâteau (obvod)","context_page_description":"Neufchâteau je obvod v departemente Vosges a regióne Lotrinsko vo Francúzsku. Člení sa ďalej na 9 kantónov a 196 obcí."},{"page_url":"https://pt.wikipedia.org/wiki/Joshua_Tree_(Calif%C3%B3rnia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Joshua_Tree%2C_California_01.jpg","page_title":"Joshua Tree (Califórnia)","context_page_description":"Joshua Tree é uma Região censo-designada localizada no estado americano da Califórnia, no Condado de San Bernardino. O nome refere-se à árvore de Josué, espécie existente no deserto de Mojave."},{"page_url":"https://fr.wikipedia.org/wiki/Chapelle_palatine_d%27Aix-la-Chapelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/AachenerDom1652PortalLoewe.jpg","page_title":"Chapelle palatine d'Aix-la-Chapelle","context_page_description":"La chapelle palatine d’Aix-la-Chapelle était la chapelle privée de Charlemagne située à Aix-la-Chapelle, une ville d'Allemagne dans le Land de Rhénanie-du-Nord-Westphalie. Commencée vers 792, consacrée en 804 et achevée en 805, elle fait partie du palais d'Aix-la-Chapelle. Elle contient les restes de Charlemagne et a été le site de couronnements pendant environ 600 ans. Elle a été intégrée dans l'actuel cathédrale d'Aix-la-Chapelle.\\nLa construction de cet édifice s'est appuyée sur des modèles antérieurs. Cette chapelle était la synthèse accomplie entre l'Antiquité et les dernières innovations techniques et stylistiques de l'époque. Pour ces raisons, elle constitue une référence qui a donné lieu à de nombreuses reprises. Au XXIe siècle, la chapelle est conservée presque intacte, malgré des adjonctions plus tardives et d'importantes réfections du XIXᵉ siècle. En tant que partie de la cathédrale d'Aix-la-Chapelle, elle apparaît sur la liste du patrimoine mondial de l'UNESCO.\\nElle a été nommée à partir du mot latin capa, en référence à la relique de la cape de Martin de Tours qui se trouvait dans l'édifice."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B4%D0%BA%D1%80%D0%B8%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Stenocara_gracilipes_1.jpg","page_title":"Надкрила","context_page_description":"Надкри́ла — потовщена, ущільнена і міцна передня пара крил у комах низки рядів. Виконують переважно захисну функцію. Утворення твердих і міцних надкрил стало ключовим моментом в еволюції комах і дозволило низці груп опанувати такі різні середовища як повітря, деревина, ґрунт і вода, заселити найрізноманітніші екологічні ніші. Надкрила деяких видів комах застосовують у декоративно-ужитковому мистецтві. Вивчення будови та механічних властивостей надкрил може стати у нагоді для конструкторів аерокосмічної техніки та композитних матеріалів."},{"page_url":"https://fr.wikipedia.org/wiki/Vanne_(affluent_de_la_Sienne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/FranceNormandieGuehebertSaintDenisLeVetuLaVanne.jpg","page_title":"Vanne (affluent de la Sienne)","context_page_description":"La Vanne est une rivière française de Normandie, affluent de la Sienne en rive droite, dans le département de la Manche."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%AF%D0%B3%D0%BE%D1%82%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/uk/3/32/Yahotyn_flihel_Shevchenka.jpg","page_title":"Яготин","context_page_description":"Яготи́н — місто в Україні, на Придніпровській низовині, розташоване над річкою Супоєм, районний центр Київської області. 20 051 мешканців."},{"page_url":"https://ca.wikipedia.org/wiki/Antic_Ajuntament_de_les_Corts","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Ajuntament_de_les_Corts.jpg","page_title":"Antic Ajuntament de les Corts","context_page_description":"L'Antic Ajuntament de les Corts és una casa consistorial eclèctica de Barcelona protegida com a Bé Cultural d'Interès Local."},{"page_url":"https://de.wikipedia.org/wiki/Falkenkauz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Ninox_scutulata_MWNH_0647.JPG","page_title":"Falkenkauz","context_page_description":"Der Falkenkauz ist eine mittelgroße Eulenart aus der Gattung der Buschkäuze. Der Name bezieht sich auf den Habitus der Eule, der entfernt an einen Falken erinnert.\\nDer Falkenkauz ist in Asien weitverbreitet und in Teilen seines Verbreitungsgebietes ein Zugvogel. Es werden mehrere Unterarten unterschieden. Die Bestandssituation wird von der IUCN als ungefährdet eingestuft."},{"page_url":"https://de.wikipedia.org/wiki/Deutscher_Tierschutzbund","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Bundesgesch%C3%A4ftsstelle-Deutscher-Tierschutzbund-Bonn.jpg","page_title":"Deutscher Tierschutzbund","context_page_description":"Der Deutsche Tierschutzbund e.V. wurde im Jahre 1881 als Dachorganisation der Tierschutzvereine und Tierheime in Deutschland gegründet mit Sitz in Bonn. Er verfolgt den Tierschutzgedanken und setzt sich gegen den Missbrauch von Tieren ein. Er ist als Interessenverband in der Lobbyliste des Deutschen Bundestages registriert."},{"page_url":"https://nn.wikipedia.org/wiki/Jacmel","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/JacmelView.jpg","page_title":"Jacmel","context_page_description":"Jacmel er ein by i det sørlege Haiti som vart grunnlagd i 1698. Byen er hovudstad i departementet Sud-Est, og hadde eit folketal på om lag 40 000 i 2003.\\nByen har mange historiske bygningar som vart bygde tidleg på 1800-talet, og har vore på lista over føreslåtte verdsarvstader. UNESCO rapporterte at han hadde fått skadar i jordskjelvet i Haiti 2010."},{"page_url":"https://en.wikipedia.org/wiki/Cable_ferry","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Sackville_ferry_gnangarra-21.jpg","page_title":"Cable ferry","context_page_description":"A cable ferry is a ferry that is guided across a river or large body of water by cables connected to both shores. Early cable ferries often used either rope or steel chains, with the latter resulting in the alternate name of chain ferry. Both of these were largely replaced by wire cable by the late 19th century."},{"page_url":"https://fr.wikipedia.org/wiki/Chichoumeille","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Tonyina_amb_samfaina.jpg","page_title":"Chichoumeille","context_page_description":"La chichoumeille est une spécialité culinaire languedocienne ressemblant à la bohémienne. C'est une préparation culinaire à base d'aubergines, d'oignons et de tomates, à l'image des ristes provençales ou bien de la ratatouille quand on y rajoute des courgettes."},{"page_url":"https://pt.wikipedia.org/wiki/Ambrogio_Lorenzetti","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/013_le_vite%2C_ambrogio_lorenzetti.jpg","page_title":"Ambrogio Lorenzetti","context_page_description":"Ambrogio Lorenzetti foi um pintor italiano da Escola Sienesa. Ele trabalhou aproximadamente de 1317 até 1348. Seu irmão foi o pintor Pietro Lorenzetti.\\nSeu trabalho mostra a influência de Simone Martini e Duccio, embora mais naturalista. Os afrescos nas paredes do Salão dos Nove ou Salão da Paz no Palácio Público de Siena são obras-primas da pintura secular do começo do Renascimento. As paredes são pintadas com afrescos que consistem de um grande grupo de figuras alegóricas da virtude na Allegoria do Bom Governo. Nos dois outros painéis, Ambrogio dá uma visão panorâmica dos Efeitos do Bom Governo na Cidade e no Campo, e a Alegoria do Mau Governo e seus Efeitos na Cidade e no Campo. A obra é praticamente uma enciclopédia sobre os incidentes de um pacífico burgo medieval.\\nComo seu irmão, ele provavelmente deve ter morrido de peste bubônica em 1348. Giorgio Vasari inclui sua biografia em sua obra Vidas."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%81%D1%82%D1%80%D1%8E%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D0%B7%D1%91%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/%D0%9C%D0%B0%D1%81%D1%82%D1%80%D1%8E%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D0%B7%D1%91%D1%80%D0%B0.jpg","page_title":"Мастрюковские озёра","context_page_description":"Мастрюковские озёра — группа озёр, находящаяся в Самарской области, недалеко от станций Мастрюково и Задельная. Комплексный памятник природы регионального значения."},{"page_url":"https://fr.wikipedia.org/wiki/Sites_m%C3%A9galithiques_du_Finist%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Kermouster.jpg","page_title":"Sites mégalithiques du Finistère","context_page_description":"Cet article présente une liste de sites mégalithiques du Finistère, en France."},{"page_url":"https://de.wikipedia.org/wiki/Jos%C3%A9_Rujano","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Jos%C3%A9_Rujano%2C_2012_Giro_d%27Italia%2C_Savona.jpg","page_title":"José Rujano","context_page_description":"José Humberto Rujano Guillén ist ein venezolanischer Radrennfahrer."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%8A%E9%96%A2%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Kaminoseki_Yamaguchi_chapter.JPG","page_title":"上関町","context_page_description":"上関町は、山口県南東部にある町。"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9E%D0%A3_%E2%80%9E%D0%92%D0%B8%D0%B4%D0%BE%D0%B5_%D0%9F%D0%BE%D0%B4%D0%B3%D0%BE%D1%80%D0%B5%D1%86%E2%80%9C_-_%D0%9A%D0%BE%D0%BB%D0%B5%D1%88%D0%B8%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Statue_of_Vidoe_Podgorec_-_Kolesino_%281%29.jpg","page_title":"ОУ „Видое Подгорец“ - Колешино","context_page_description":"Видое Подгорец — основно училиште во Колешино, Општина Ново Село.\\nУчилиштето започнало со настава во 1951 година, и тоа под името ЦОУ „Григор Прличев“. Сегашната училишна зграда била изградена во 1969 година. Училиштето било реконструирано во април 2006 година, со донација на Норвешка и владата на Р. Македонија. Во јуни 2006 година се вградило и парно греење со средства од Министерството за образование и Секторот за евроинтеграции при Владата на Р. Македонија. Во јули 2006 година, училиштето го променило името во Видое Подгорец, во чест на големиот македонски писател, роден во Колешино."},{"page_url":"https://es.wikipedia.org/wiki/Haworthia_cooperi_var._pilifera","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Haworthia_cooperi_var_pilifera_-_MBB_2.jpg","page_title":"Haworthia cooperi var. pilifera","context_page_description":"Haworthia cooperi var. pilifera, una variedad de Haworthia cooperi, es una planta suculenta perteneciente a la familia Xanthorrhoeaceae. Es originaria de Sudáfrica.​"},{"page_url":"https://nl.wikipedia.org/wiki/Hugo_Houle","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Dunkerque_-_Quatre_jours_de_Dunkerque%2C_%C3%A9tape_1%2C_7_mai_2014%2C_d%C3%A9part_%28A236%29.JPG","page_title":"Hugo Houle","context_page_description":"Hugo Houle is een Canadees wielrenner die anno 2019 rijdt voor Astana Pro Team.\\nIn 2016 nam Houle deel aan de wegwedstrijd op de Olympische Spelen in Rio de Janeiro, maar reed deze niet uit. Vier dagen later eindigde hij op plek 21 in de tijdrit."},{"page_url":"https://it.wikipedia.org/wiki/Regio_Parco","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Torino_parco_colletta_001.JPG","page_title":"Regio Parco","context_page_description":"Regio Parco è un quartiere semiperiferico che fa parte della Circoscrizione 6 di Torino, collocato nella zona nord-est della città di Torino nei pressi della confluenza della Stura di Lanzo nel fiume Po.\\nÈ delimitato:\\na nord da via Botticelli e dal fiume Stura di Lanzo\\na est dal fiume Po\\na ovest da corso Giulio Cesare\\na sud da via Cimarosa\\nTalvolta viene ricordato insieme ai quartieri Barca e Bertolla dai quali è diviso dal fiume Stura."},{"page_url":"https://sv.wikipedia.org/wiki/Homoranthus_decasetus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Homoranthus_decasetus.jpg","page_title":"Homoranthus decasetus","context_page_description":"Homoranthus decasetus är en myrtenväxtart som beskrevs av Norman Brice Byrnes. Homoranthus decasetus ingår i släktet Homoranthus och familjen myrtenväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Leonardo_Abate","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Chiesa_di_San_Leonardo_Abate%2C_notturna_%28Masi_Torello%29_02.JPG","page_title":"Chiesa di San Leonardo Abate","context_page_description":"La chiesa di San Leonardo Abate è la parrocchiale di Masi Torello, in provincia di Ferrara ed arcidiocesi di Ferrara-Comacchio."},{"page_url":"https://en.wikipedia.org/wiki/Sem,_Norway","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Sem_kirke_TRS.jpg","page_title":"Sem, Norway","context_page_description":"Sem is a village in Tønsberg in Vestfold county, Norway.\\nSem was a former municipality in Vestfold. The parish of Sæm was established as a municipality January 1, 1838. According to the 1835 census the municipality had a population of 3,590. On 1 January 1965 the district Stang with 126 inhabitants was incorporated into the former municipality of Borre. On 1 January 1988 the rest was incorporated into the municipality of Tønsberg. Prior to the merger Sem was about three times the size of Tønsberg, which had a population of 21,948. The village of Sem has a population of 1,981, of which 42 people live within the border of the neighboring municipality Stokke. The village is situated five kilometers west of the city of Tønsberg.\\nOriginally the municipality and the parish were named after the historic Sem Manor. During the Middle Ages, Sem Manor was a royal and feudal overlord residence at the site where Jarlsberg Manor is located today. King Harald Fairhair chose to install his son Bjorn Farmann as the master of the estate. It was here that Bjorn Farmann was killed by Eric Bloodaxe in 927."},{"page_url":"https://pl.wikipedia.org/wiki/Amboy_(Illinois)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Amboy_Il_Downtown4.jpg","page_title":"Amboy (Illinois)","context_page_description":"Amboy – miasto w Stanach Zjednoczonych, w stanie Illinois, w hrabstwie Lee."},{"page_url":"https://bg.wikipedia.org/wiki/Naso_annulatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Naso_annulatus.JPG","page_title":"Naso annulatus","context_page_description":"Naso annulatus е вид бодлоперка от семейство Acanthuridae. Видът не е застрашен от изчезване."},{"page_url":"https://nl.wikipedia.org/wiki/Graham_Stack","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Graham_Stack_16-02-13.png","page_title":"Graham Stack","context_page_description":"Graham Stack is een Ierse voetbaldoelman."},{"page_url":"https://it.wikipedia.org/wiki/Oratorio_della_Purit%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Udine_Oratorio_della_Purit%C3%A1_-_Wandfresco_David_und_die_Kinder_Israel.jpg","page_title":"Oratorio della Purità","context_page_description":"Posta a destra della Cattedrale, fu eretta nel 1757 per volere del cardinale Daniele Dolfin, il quale fece acquistare ed abbattere il precedente teatro appartenente alla famiglia Mantica, in modo che vicino alla cattedrale cittadina non fosse presente un luogo di divertimento. Il progetto fu affidato a Luca Andreoli.\\nDurante la seconda guerra mondiale, gli affreschi del soffitto e delle pareti furono protetti contro eventuali bombardamenti aerei. Nella notte del 7 marzo 1945 durante un'incursione aerea alcuni spezzoni incendiari caddero a grappolo intorno alla chiesa, due ne forarono il tetto, ma si spensero sul pavimento del primo piano, quello sovrastante l'Assunzione.\\nNegli anni cinquanta, però, gli affreschi del figlio Domenico subirono danni dovuti ad infilltrazioni d'acqua. Solo nel luglio 1965 iniziarono lavori di restauro degli affreschi danneggiati, strappati e messi su appositi pannelli, furono restaurati su appositi pannelli e ricollocati in posizione nel 1969. Tutto il complesso pittorico è stato fatto oggetto di un nuovo intervento conservativo nel 1995."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Rzhev,_Summer_1942","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Vazuza%2C_Sychyovka.jpg","page_title":"Battle of Rzhev, Summer 1942","context_page_description":"The Battle of Rzhev in the Summer of 1942 was part of a series of battles that lasted 15 months in the center of the Eastern Front.\\nIt is known in Soviet history of World War II as the First Rzhev–Sychyovka Offensive Operation, which was defined as spanning from 30 July to 23 August 1942. However, it is widely documented that the fighting continued undiminished into September and did not finally cease until the beginning of October 1942.\\nThe Red Army suffered massive casualties for little gain during the fighting, giving the battle a notoriety reflected in its sobriquet: \\"The Rzhev Meat Grinder\\".\\nRzhev lies 140 miles west of Moscow and was captured by the German Wehrmacht in Operation Typhoon in the autumn of 1941, which took them to the gates of Moscow. When the Soviet counteroffensive drove them back, Rzhev became a cornerstone of the Germans' defense. By mid-1942, the city stood at the apogee of a salient that protruded from the front lines, pointing in the general direction of Moscow."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B9%BF%E4%B8%9C%E7%9C%81%E6%B0%94%E8%B1%A1%E7%81%BE%E5%AE%B3%E9%A2%84%E8%AD%A6%E4%BF%A1%E5%8F%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Hail_Red_2015_%28Guangdong%29.png","page_title":"广东省气象灾害预警信号","context_page_description":"廣東省氣象災害預警信號，是根據廣東省人民政府制訂的《廣東省氣象災害預警信號發布規定》發布的氣象預警，其目的是為防禦和減輕突發氣象災害，保護人民生命財產安全。\\n現行的預警信號在2019年1月1日起實施，分為颱風、暴雨、高溫、寒冷、大霧、灰霾天氣、道路結冰、冰雹、森林火險等九類。並按照災害預警重要性程度標註顏色，由低到高依次為白色、藍色、黃色、橙色、紅色。級別越高表明災害越嚴重。\\n氣象預警原稱為「廣東省突發氣象災害預警信號」，於2006年6月1日起實施，及後於2015年1月1日修改樣式。\\n另由於港澳民眾常穿梭於深圳市與珠海市，容易混淆兩地預警信號的問題，深圳市與珠海市制定了地方性的預警信號級別。"},{"page_url":"https://es.wikipedia.org/wiki/Microstomatidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Microstoma_microstoma_%28Slender_argentine%29.gif","page_title":"Microstomatidae","context_page_description":"Los mictostomátidos\\nson una familia de peces marinos incluida en el orden Osmeriformes, distribuidos por los océanos Atlántico, Índico y Pacífico.​ Su nombre procede del griego: mikros + stoma.​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Stadtlauringen","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Schloss_Craheim_2.JPG","page_title":"Liste der Baudenkmäler in Stadtlauringen","context_page_description":"Auf dieser Seite sind die Baudenkmäler des unterfränkischen Marktes Stadtlauringen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 1. Mai 2020 wieder und enthält 159 Baudenkmäler."},{"page_url":"https://es.wikipedia.org/wiki/Jes%C3%BAs_Reina","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Jes%C3%BAs_reina.jpg","page_title":"Jesús Reina","context_page_description":"Jesús Reina es un violinista español. Ha participado como jurado en el programa de Canal Sur Tierra de Talento."},{"page_url":"https://de.wikipedia.org/wiki/Fikellura","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/East_grek_Fikellura_neck_amphora_Antikensammlung_Berlin_2.jpg","page_title":"Fikellura","context_page_description":"Als Fikellura bezeichnet man eine Gattung ostgriechischer Vasen der griechischen Vasenmalerei.\\nDie Fikellura-Keramik ist nach einer Nekropole auf Rhodos benannt, wo man die ersten Exemplare dieser Vasen gefunden hat. Sie besitzen einen weißlichen Überzug und die dargestellte Figuren sind zumeist durch ausgesparte Linien konturiert, was zu dieser Zeit schon anachronistisch war, praktizierte man doch fast überall im griechischen Raum bereits den Schwarzfigurigen Stil. Der Stil entwickelte sich aus dem mittleren Tierfriesstil. Es wird angenommen, dass anfangs nur ein einzelner Maler den Fikellura-Stil geprägt hat. Die am häufigsten genutzte Vasenform waren 25 bis 35 cm hohe Halsamphoren, die vielfach nachlässig getöpfert sind. Daneben wurden auch Oinochoen, Amphoriskoi, Stamnoi und Schalen hergestellt. Die Hälse der Amphoren schmücken Flechtbänder, Mäander oder Mäanderkreuze. Ein charakteristisches Ornament des Fikellura-Stils ist das zu Friesen gereihte Sichelornament, welches auch in der etwa gleichzeitigen klazomenischen Malerei erscheint, dort jedoch polychrom gestaltet. Die Fauna auf Fikellura-Vasen entspricht etwa der des Tierfriesstiles, hinzu kommen Panther und Steinhühner."},{"page_url":"https://ms.wikipedia.org/wiki/Pertempuran_Midway","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/USS_Hammann_sinking_1942-06-06_seen_from_USS_Yorktown.jpg","page_title":"Pertempuran Midway","context_page_description":"Pertempuran Midway merupakan salah satu pertempuran laut yang paling penting di kancah Perang Pasifik semasa Perang Dunia II. Pertempuran ini berlaku dari 4 Jun hingga 7 Jun 1942, kira-kira sebulan selepas Pertempuran Laut Karang, hampir lima bulan selepas penaklukan Jepun terhadap Kepulauan Wake, dan enam bulan selepas serangan Empayar Jepun terhadap Pearl Harbor yang memulakan peperangan rasmi antara Amerika Syarikat dengan Jepun. Semasa pertempuran ini, Tentera Laut Amerika Syarikat mengalahkan serangan Jepun terhadap Atol Midway dan memusnahkan empat kapal induk Jepun dan penjajap berat berbanding sebuah kapal induk dan kapal pemusnah di pihaknya.\\nPertempuran ini merupakan kekalahan hebat bagi Jepun dan dianggap secara umum sebagai pertempuran laut paling penting dalam Perang Dunia II. Pertempuran ini melemahkan tentera laut Jepun secara kekal, terutamanya dengan kehilangan lebih 200 juruterbang tentera laut. Kekuatan industri Amerika membolehkannya menggantikan kapal-kapalnya yang musnah dengan segera, namun Jepun tidak mampu berbuat demikian. Secara strategik, tentera laut A.S. berjaya merampas penguasaan di Pasifik dan membolehkannya mengambil tindakan menyerang."},{"page_url":"https://es.wikipedia.org/wiki/Monse%C3%B1or_Eyzaguirre_(estaci%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Monse%C3%B1or_Eyzaguirre_dise%C3%B1o_inicial.png","page_title":"Monseñor Eyzaguirre (estación)","context_page_description":"Monseñor Eyzaguirre es una estación ferroviaria que forma parte de la red del Metro de Santiago de Chile. Se encuentra subterránea, entre las estaciones Irarrázaval y Ñuñoa de la Línea 3."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%91%A8%E6%9C%89%E5%85%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Zhou_Youguang_1920s.jpg","page_title":"周有光","context_page_description":"周有光（粵拼：zau¹ jau⁵ gwong¹；1906年1月13號—2017年1月14號）係中國嘅作家同教育家，江蘇常州人。早年成日研究經濟學，差唔多50歲時開始研究同設計漢語拼音方案，後嚟佢份方案喺1958年俾中華人民共和國語言學部門通過，同埋喺1982年將佢設計嘅拼音方案列入到拼寫語體中文嘅國際標準（ISO 7098）。2016年1月13號被列爲頂級壽星。\\n周有光喺2017年1月14號喺北京死咗，終年111歲。"},{"page_url":"https://mg.wikipedia.org/wiki/Rudolf_Koppitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/KOPPITZ_R.jpg","page_title":"Rudolf Koppitz","context_page_description":"Rudolf Koppitz dia mpaka sary mizaka ny zom-pirenen'i Aotrisy teraka ny 4 Janoary 1884 ary maty ny 8 Jolay 1936"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%9D%E3%82%8C%E3%81%9E%E3%82%8C%E3%81%AE%E3%82%B7%E3%83%8D%E3%83%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Depardon_2012_a.jpg","page_title":"それぞれのシネマ","context_page_description":"『それぞれのシネマ』は、2007年製作・公開、フランスほか24の国と地域による合作のオムニバス映画である。\\n世界中の映画監督による「映画館」をテーマにした3分間の短編映画で構成されている。1946年に始まったカンヌ国際映画祭の60回記念として製作された。本作は、36人の監督による34本の短編映画からなるが、34本全部での上映・放映とならないことが多々ある。"},{"page_url":"https://it.wikipedia.org/wiki/HMS_Forester_(H74)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/HMS_Forester_1942_IWM_FL_9830.jpg","page_title":"HMS Forester (H74)","context_page_description":"La HMS Forester, è stato un cacciatorpediniere della Classe F della Royal Navy. Venne impostato il 15 maggio 1933 nei cantieri J.S. White & Co., varato il 28 giugno 1934 ed entrò in servizio il 29 marzo dell'anno successivo."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%A5%E3%83%B4%E3%82%A1%E3%83%BC%E3%83%8A%E3%82%A6%E5%9F%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/2007-06-19_Lauerzersee_02.jpg","page_title":"シュヴァーナウ城","context_page_description":"シュヴァーナウ城は、スイスのシュヴィーツ州のラウエルツ湖中にある城。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D1%85%D0%BE%D0%BF%D1%83%D1%82%D0%BD%D1%8B%D0%B5_%D0%B2%D0%BE%D0%B9%D1%81%D0%BA%D0%B0_%D0%90%D1%80%D0%BC%D0%B5%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/B8fnRA7c8Go.jpg","page_title":"Сухопутные войска Армении","context_page_description":"Сухопутные войска Армении — один из видов вооружённых сил Армении, предназначенный для ведения боевых действий преимущественно на суше."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%8A%D9%84%D9%8A%D8%A7%D9%85_%D8%AF%D9%8A%D8%B1%D9%8A%D9%86%D8%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/WilliamDeering.jpg","page_title":"ويليام ديرينغ","context_page_description":"ويليام ديرينغ ‏ هو صناعي أمريكي، ولد في 25 أبريل 1826 في مين في الولايات المتحدة، وتوفي في 9 ديسمبر 1913 في Coconut Grove في الولايات المتحدة."},{"page_url":"https://es.wikipedia.org/wiki/Monumento_a_Juan_Pablo_II_(Madrid)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/PopeJohnPaulIIStatueAlmudena_gobeirne.jpg","page_title":"Monumento a Juan Pablo II (Madrid)","context_page_description":"El monumento a Juan Pablo II es una estatua monumental de bronce que representa al pontífice erigida en Madrid junto a la fachada de la catedral de la Almudena que tiene frente en la calle de Bailén.​\\nLa estatua mide 3,5 metros de altura, sin contar el pedestal.​"},{"page_url":"https://pt.wikipedia.org/wiki/Dhulbahante_(reer_darawiish)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Qabiilka_Daraawiish_%28Dhulbahante%29.png","page_title":"Dhulbahante (reer darawiish)","context_page_description":"O Dhulbahante é um dos principais clãs somalis, compreendendo cerca de maioria da população da Ayn, central de Sanaag e Sool."},{"page_url":"https://tr.wikipedia.org/wiki/Simo_H%C3%A4yh%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Simo_hayha_honorary_rifle.jpg","page_title":"Simo Häyhä","context_page_description":"Simo Häyhä, Kızıl Ordu tarafından Beyaz Ölüm diye bilinen bir Fin keskin nişancısıdır. Kış Savaşı'nda modifiyeli bir Mosin-Nagant kullanarak bir savaşta onaylanmış en yüksek sayıda düşman askeri öldürme rekoruna sahiptir. Ayrıca daha sonrasında hafif makineli bir tüfek olan 9 mm'lik Suomi ile 200 düşman askeri öldürerek teyit edilmiş toplam öldürülen asker sayısını 705'e çıkartmıştır ve bu sayıya 100 günden daha az bir sürede ulaşmıştır."},{"page_url":"https://cs.wikipedia.org/wiki/Labin","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Labin_StariGrad_veduta.jpg","page_title":"Labin","context_page_description":"Labin je město a obec v západním Chorvatsku. Město se nachází se ve vzdálenosti 3 km od západního pobřeží poloostrova Istrie v Istrijské župě a žije v něm 6 893 obyvatel. Ve stejnojmenné opčině žije 11 642 obyvatel."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D1%81%D0%BE%D0%B1%D0%BE_%D0%BE%D1%85%D1%80%D0%B0%D0%BD%D1%8F%D0%B5%D0%BC%D1%8B%D1%85_%D0%BF%D1%80%D0%B8%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D1%82%D0%B5%D1%80%D1%80%D0%B8%D1%82%D0%BE%D1%80%D0%B8%D0%B9_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/2061._St._Petersburg._Suzdalsoe_Upper_Lake.jpg","page_title":"Список особо охраняемых природных территорий Санкт-Петербурга","context_page_description":"В списке особо охраняемых природных территорий в черте города Санкт-Петербурга приведены все 18 существующих на 2019 год и ряд предлагаемых к созданию ООПТ. Из существующих природных территорий 3 объекта являются ботаническими садами и дендрологическими парками, 8 объектов — заказниками и 7 — памятниками природы.\\nМногие ООПТ Санкт-Петербурга также находятся под охраной государства в качестве объектов культурного наследия и/или входят в состав объекта Всемирного наследия ЮНЕСКО «Исторический центр Санкт-Петербурга и связанные с ним комплексы памятников»."},{"page_url":"https://hu.wikipedia.org/wiki/Edo-kor","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Keicho_gold_coinage_Oban_Koban_Ichibuban_1601_1695.jpg","page_title":"Edo-kor","context_page_description":"Az Edo-kor vagy Tokugava-kor a japán történelem 1603 és 1868 közötti korszaka, mikor a japán társadalom a Tokugava-sógunátus és az ország háromszáz daimjójának uralma alatt állt. A korszakot gazdasági növekedés, szigorú társadalmi rend, az elszigetelődés politikája, stabil népesség, béke, a busidó eszmény mint a szamuráj identitás része, valamint a művészet és kultúra élvezete jellemezte. Tokugava Iejaszu 1603-ban vette fel a sóguni címet, ezzel legitimálva helyzetét, majd megalapította Edót, ami a császári fővárossal, Kiotóval szemben Japán de facto fővárosának számított. A korszaknak Edo bukása után a Meidzsi-restauráció vetett véget 1868. május 3-án, amikor is több évszázad után a valódi hatalom, amelyet csaknem ezer évig a sógunok birtokoltak, visszakerült a császárok kezébe."},{"page_url":"https://fr.wikipedia.org/wiki/Oxfam-Magasins_du_monde","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Petits_d%C3%A9jeuners_Oxfam.png","page_title":"Oxfam-Magasins du monde","context_page_description":"Fondée en 1976, Oxfam-Magasins du monde est une association sans but lucratif belge qui promeut le commerce équitable et solidaire pour construire un monde socio-économique plus juste. L'organisation se définit comme un mouvement citoyen d'hommes et de femmes qui se mobilisent pour combattre les injustices et les inégalités économiques et sociales.\\nPour construire et promouvoir une économie alternative, elle possède un réseau de magasins implantés à Bruxelles et en Wallonie qui vendent des produits d'épicerie, d'artisanat et cosmétiques ainsi que des vêtements de seconde main. Elle mène aussi des campagnes et des actions, et sensibilise les écoliers en primaire et en secondaire. L'association est reconnue comme mouvement d'éducation permanente."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B8%D0%BA%D0%BA%D0%BE,_%D0%A5%D1%83%D0%BB%D0%B8%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Juli%C3%A1n_Chicco_%28cropped%29.jpg","page_title":"Чикко, Хулиан","context_page_description":"Хулио Антонио Чикко — аргентинский футболист, полузащитник клуба «Бока Хуниорс»."},{"page_url":"https://pl.wikipedia.org/wiki/HMS_Bulwark_(2001)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/HMS_Bulwark.jpg","page_title":"HMS Bulwark (2001)","context_page_description":"HMS Bulwark – brytyjski okręt desantowy-dok typu Albion, okręt flagowy Royal Navy."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Leiden,_straat_J-O","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Leiden_-_Oude_rijn_31.JPG","page_title":"Lijst van rijksmonumenten in Leiden, straat J-O","context_page_description":"De stad Leiden telt 1236 inschrijvingen in het rijksmonumentenregister. Hieronder alle 465 monumenten waarbij de straat begint met de letter J t/m O:"},{"page_url":"https://de.wikipedia.org/wiki/Tricio","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Tricio_-_Basilica_de_Santa_Maria_de_los_Arcos_08.jpg","page_title":"Tricio","context_page_description":"Tricio ist ein Ort und eine nordspanische Gemeinde mit 380 Einwohnern im Zentrum der Autonomen Gemeinschaft La Rioja. Die Gemeinde gehört zum Weinbaugebiet der Rioja Alta."},{"page_url":"https://nl.wikipedia.org/wiki/Coleoxestia_rubromaculata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Coleoxestia_rubromaculata_-_Flickr_-_Bennyboymothman.jpg","page_title":"Coleoxestia rubromaculata","context_page_description":"Coleoxestia rubromaculata is een keversoort uit de familie van de boktorren. De wetenschappelijke naam van de soort werd voor het eerst geldig gepubliceerd in 1909 door Gounelle."},{"page_url":"https://ht.wikipedia.org/wiki/Andover,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Carnegie_Library%2C_Andover_NY.jpg","page_title":"Andover, New York","context_page_description":"Andover se yon vil nan eta Nou yòk.\\nLi nan konte, rejyon Allegany."},{"page_url":"https://id.wikipedia.org/wiki/Jamie_Maclaren","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Jamie_Maclaren_July_2017.jpg","page_title":"Jamie Maclaren","context_page_description":"Jamie Maclaren adalah seorang pemain sepak bola berkewarganegaraan Australia yang bermain untuk klub SV Darmstadt 98 pada posisi Penyerang.\\nJamie Maclaren bermain untuk klub SV Darmstadt 98 sejak tahun 2017, dan membela tim nasional Australia sejak tahun 2016."},{"page_url":"https://de.wikipedia.org/wiki/Oszillation_(Topologie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Rapid_Oscillation.svg","page_title":"Oszillation (Topologie)","context_page_description":"In der Mathematik kommt der Begriff der Oszillation in der Topologie vor, einem der Teilgebiete der Mathematik. Er tritt ebenfalls in der Analysis und hier insbesondere in Integralrechnung auf. Statt von der Oszillation spricht man auch von der Schwankung oder der Schwankungsbreite. Die Oszillation dient bei der Untersuchung von Stetigkeitsfragen zu Abbildungen von topologischen Räumen in metrische Räume dazu, in einem gewissen Sinne die Unstetigkeit einer Abbildung zu messen. Mit dem Begriff der Oszillation verwandt ist der des Stetigkeitsmoduls von Abbildungen metrischer Räume."},{"page_url":"https://en.wikipedia.org/wiki/Alter_Turm_(St%C3%B6lzinger_Hills)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Rotenburg_-_Rodenberg_1.jpg","page_title":"Alter Turm (Stölzinger Hills)","context_page_description":"The Alter Turm is a hill in Hesse, Germany."},{"page_url":"https://pl.wikipedia.org/wiki/Spichrze_w_Grudzi%C4%85dzu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Grudziadz_spichrze_2008_%2816%29.jpg","page_title":"Spichrze w Grudziądzu","context_page_description":"Spichrze w Grudziądzu – unikatowy zespół obronnych spichrzów nadwiślańskich o średniowiecznej genezie w Grudziądzu."},{"page_url":"https://en.wikipedia.org/wiki/List_of_museums_in_the_Texas_Panhandle","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Helium_monument_time_capsule_in_amarillo_texas_usa.jpg","page_title":"List of museums in the Texas Panhandle","context_page_description":"This article was split from List of museums in Texas\\nThe list of museums in the Texas Panhandle encompasses museums defined for this context as institutions that collect and care for objects of cultural, artistic, scientific, or historical interest and make their collections or related exhibits available for public viewing. Museums that exist only in cyberspace are not included. Also included are non-profit art galleries and exhibit spaces."},{"page_url":"https://es.wikipedia.org/wiki/Route_nationale_125","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Garonne_pont_fronti%C3%A8re_N125-N230.jpg","page_title":"Route nationale 125","context_page_description":"La Route Nationale 125, o también abreviada RN 125 es una carretera nacional francesa que conecta Montréjeau con Puente del Rey en Fos que se convierte en la N-230 al pasar la frontera a España."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%B0%E0%B7%80%E0%B6%BD_%E0%B6%B8%E0%B6%B1%E0%B7%8A%E0%B6%AF%E0%B7%92%E0%B6%BB%E0%B6%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/White_House_1846.jpg","page_title":"ධවල මන්දිරය","context_page_description":"ඇමෙරිකා එක්සත් ජනපදය ජනාධිපතිවරයාගේ නිල නිවස සහ ප්‍රධාන සේවාස්ථානය වන ධවල මන්දිරය පිහිටා ඇත්තේ වොෂින්ටන් නුවර 1600, පෙන්සිල්වේනියා විදියේ හීය.එය එක්සත් ජනපද ජනපති ජෝහ්න් ඇඩම්ස් ගේ සිට සියලුම එක්සත් ජනපද ජනපතිවරුන්ගේ නිල නිවස බවට පත්ව ඇති අතර ජනපතිගේ සහ ඉහල නිලධාරීන්ගේ ක්‍රියාවන් සඳහා ලේඛකයන් විසින් මෙටෝනියම් යන පදය භාවිතා කරනු ලබයි.\\nධවල මන්දිරය අයර්ලන්ත ජාතික ජේම්ස් හෝබන් විසින් වර්ෂ 1792 සහ 1800 අතර කාලයේදී සුදු පැහැති වැලිගල් විශේෂයක් යොදා ගනිමින් නව සම්ප්‍රදායික මෝස්‌තරයකට අනුව නිර්මාණය කරන ලදී.වර්ෂ 1800දී ඇමෙරිකානු එක්සත් ජනපදයේ තෙවැනි ජනාධිපති වන තෝමස් ජෙෆසන් මෙහි පදිංචිය සඳහා පැමිණි පසු එවකට සිටි වස්තු විද්‍යාඥයෙකු වූ බෙන්ජමින් හෙන්රි ලැට්රෝබ් සමග එක්ව ධවල මන්දිරයේ පිටතින් කණු පෙළක් ඉස්තාලය සහ ගබඩාගාරය සැඟවීමේ අරමුණෙන් ඉදිකරන ලදී.\\nවර්ෂ 1814දී, 1812 යුද සමයේදී බ්‍රිතාන්‍ය හමුදාවන් විසින් වොෂින්ටනය ගිනි තබන විට මෙම මන්ධිරයටද ගිනි තබමින් එහි බාහිරය සහ අභ්‍යන්තරය විනාශ කරන ලදී. ප්‍රතිසංස්කරණය ඉතාමත් කඩිනමින් ආරම්භ වූ අතර ජනපති ජේම්ස් මොන්රෝ වර්ෂ 1817 ඔක්තෝම්බර් මස අඩක් නිමකල විධායක නිල නිවසට මාරු වුවේය.ඉදිකිරිම් වර්ෂ 1824දී දකුණු පෝටිකොවත් 1829දී උතුරු පෝටිකොවත් එකතු කරමින් අඛණ්ඩව සිදු කළේය."},{"page_url":"https://de.wikipedia.org/wiki/Wauchula","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Wauchula_City_Hall_old_pano01.jpg","page_title":"Wauchula","context_page_description":"Wauchula ist eine Stadt und zudem der County Seat des Hardee County im US-Bundesstaat Florida mit 5001 Einwohnern."},{"page_url":"https://fr.wikipedia.org/wiki/Remparts_de_Senlis","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Senlis_%2860%29%2C_vestiges_de_la_porte_de_Meaux.jpg","page_title":"Remparts de Senlis","context_page_description":"Cet article présente l'enceinte gallo-romaine et les remparts médiévaux de Senlis, chef-lieu d'arrondissement dans l'Oise, en France."},{"page_url":"https://de.wikipedia.org/wiki/K%C3%BCnstliche_Insel","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Northstar_Offshore_Island_Beaufort_Sea.jpg","page_title":"Künstliche Insel","context_page_description":"Als Künstliche Insel bzw. Künstliche Inselgruppe wird eine von Menschen ganz oder teilweise künstlich erzeugte Insel bzw. Inselgruppe in einem Meer oder einem Binnengewässer bezeichnet. Die Größe variiert dabei von kleinen Aufschüttungen, die beispielsweise eine Säule eines Gebäudes aufnehmen, bis hin zu Inseln, auf denen ganze Städte errichtet werden."},{"page_url":"https://da.wikipedia.org/wiki/%C3%98stbanetorvet_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/%C3%98stbanetorvet_Station_P_pladser%2C_N%C3%B8rre_Stenbro%2C_Aarhus.jpg","page_title":"Østbanetorvet Station","context_page_description":"Østbanetorvet Station er en jernbanestation og letbanestation på Grenaabanen ved Østbanetorvet i Aarhus. Den hed indtil 1983 Østbanegården eller Århus Østbanegård.\\nStationen var endestation for strækningen Aarhus-Ryomgård, der blev indviet i 1877 med forbindelse til Grenaa. Fra 1933 fortsatte togene til Aarhus H, så Østbanegården ikke længere var endestation. Senere blev den krydsningsstation på Aarhus Nærbane, der opstod i 2012 ved sammenlægning af Grenaabanen og Odderbanen.\\nHele nærbanen blev lukket for ombygning til letbane 27. august 2016. Det var forventet, at Grenaabanen ville genåbne som en del af Aarhus Letbane i begyndelsen af 2018, men på grund af manglende sikkerhedsgodkendelse blev genåbningen udskudt på ubestemt tid. Godkendelsen forelå 25. april 2019, og banen genåbnede som letbane 30. april 2019.\\nStationen fortsætter som jernbanestation for godstransport samt veterantog Det er det såkaldte \\"Tram-Train\\" af typen Tango, som kommer til at betjene stationen. Dette tog er en hybrid, som kan fungere som letbanetog i tættere bebyggede områder og som traditionel jernbane udenfor."},{"page_url":"https://it.wikipedia.org/wiki/Kostelec_nad_Orlic%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Kostelec_nad_Orlic%C3%AD_-_Palack%C3%BD%27s_Square.jpg","page_title":"Kostelec nad Orlicí","context_page_description":"Kostelec nad Orlicí è una città della Repubblica Ceca facente parte del distretto di Rychnov nad Kněžnou, nella regione di Hradec Králové."},{"page_url":"https://en.wikipedia.org/wiki/Buz%C4%83u","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/1916_-_Albert_Reich_-_Buzau%2C_palatul_administrativ_p55.jpg","page_title":"Buzău","context_page_description":"The city of Buzău is the county seat of Buzău County, Romania, in the historical region of Muntenia. It lies near the right bank of the Buzău River, between the south-eastern curvature of the Carpathian Mountains and the lowlands of Bărăgan Plain.\\nBuzău is a railway hub in south-eastern Romania, where railways that link Bucharest to Moldavia and Transylvania to the Black Sea coast meet. DN2, a segment of European route E85 crosses the city. Buzău's proximity to trade routes helped it develop its role as a commerce hub in older days, and as an industrial centre during the 20th century.\\nDuring the Middle Ages, Buzău was a market town and Eastern Orthodox episcopal see in Wallachia. It faced a period of repeated destruction during the 17th and 18th centuries, nowadays symbolized on the city seal by the Phoenix bird. In the 19th century, after the end of that era, the city began to recover. The economy underwent industrialization, Buzău became a railway hub, and public education became available. At this time, the Communal Palace, the city's landmark building, and Crâng Park, the main recreational area, were built."},{"page_url":"https://sh.wikipedia.org/wiki/Neukirchen_(Kn%C3%BCll)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Neukirchen_in_HR.svg","page_title":"Neukirchen (Knüll)","context_page_description":"Nojkirhen je grad u njemačkoj saveznoj državi Hesen. Jedno je od 27 opštinskih središta okruga Švalm-Eder. Prema procjeni iz 2010. u gradu je živjelo 7.365 stanovnika. Posjeduje regionalnu šifru 6634017."},{"page_url":"https://de.wikipedia.org/wiki/25._August","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Battle_of_Warsaw_-_Phase_2.png","page_title":"25. August","context_page_description":"Der 25. August ist der 237. Tag des gregorianischen Kalenders, somit bleiben noch 128 Tage bis zum Jahresende."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mammals_of_Canada","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Noaa-walrus31.jpg","page_title":"List of mammals of Canada","context_page_description":"This is a list of the mammal species recorded in Canada. There are approximately 200 mammal species native to Canada. Its large territorial size and variety of ecosystems, ranging from oceanic coasts, to mountains to plains to urban housing, mean that Canada can harbour a great variety of species, including nearly half of the known cetaceans. The most well represented order is that of the rodents, and the smallest that of the Didelphimorphia.\\nStudies of mammals in Canada hearken back to the 1795 northern explorations of Samuel Hearne, whose account is considered surprisingly accurate. The first seminal work on Canadian mammals, however, was John Richardson's 1829 Fauna Boreali-Americana. Joseph Burr Tyrrell was the first to attempt to produce, in 1888, a comprehensive list of Canadian mammalian species. Ernest Thompson Seton and Charles-Eusèbe Dionne's work were also important. Modern Canadian publications with interest in mammalogy include The Canadian Field-Naturalist, the Canadian Journal of Zoology and the French-language Le Naturaliste Canadien.\\nSeveral species of mammal have particular symbolism."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9A%8B%E6%9C%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Votive_plaque_with_Seated_Buddha_Shakyamuni%2C_Attendant_Bodhisattvas%2C_and_Monks%2C_China%2C_Sui_dynasty%2C_581-618_AD%2C_gilt_bronze_-_Arthur_M._Sackler_Museum%2C_Harvard_University_-_DSC00865.jpg","page_title":"隋朝","context_page_description":"隋朝是中國歷史之中，上承南北朝、下啟唐朝的一個重要的朝代，史學家常把它和唐朝合稱隋唐。581年隋文帝楊堅受禪建立隋朝，至619年王世充廢隋恭帝楊侗為止，國祚共39年。楊堅屬於北周的胡漢關隴世家，於北周宣帝繼位後逐漸掌握周廷。幼年的北周靜帝即位後，身為皇太后之父的楊堅控制朝政，先後平定尉遲迥、司馬消難等反楊叛軍。581年北周靜帝禪讓給楊堅，北周亡，楊堅定國號為「隋」。依據五行相生的順序，北周的「木」德之後為「火」德，因此隋朝以火為德運並選取與火德對應的紅色為正色。隋文帝於587年廢除後梁，於589年隋滅陳之戰攻滅南陳，俘虜陳後主。隔年9月，控制嶺南地區的冼夫人歸附隋朝。至此，天下一統，隋朝結束了中國自魏晉南北朝以來的分裂局面，重新建立大一統的國家。\\n隋文帝總結歷朝興亡的原因，維護與農民的關係，調和統治集團內部的關係。這些措施使社會矛盾趨於緩和，經濟、文化得以迅速成長並呈現繁華景象，開創出開皇之治。然而隋文帝晚年剛愎自用，提倡嚴苛重刑，因猜忌而大殺功臣，國力開始衰退。隋文帝的次子楊廣爭奪長子楊勇的太子位獲勝。604年隋文帝去世，楊廣繼位，即隋煬帝。隋煬帝為了鞏固隋朝發展，興建許多大型建設，又東征西討，隋朝發展到極盛。然而隋煬帝好大喜功，忽視民眾感受，嚴重耗費隋朝國力，其中又以三次東征高句麗為最甚，最後引發隋末民變。616年隋煬帝離開東都，前往江都。618年宇文化及等人發動兵變，殺死隋煬帝；隋恭帝楊侑禪讓李淵，李淵正式稱帝，建立唐朝；隔年，王世充擁立的隋恭帝楊侗也被廢，隋朝亡。隋末群雄割據的局面，最終也為唐朝所終結。\\n在政治制度方面，隋朝確立了影響後世深遠的三省六部制，以鞏固中央集權制度；制定出完整的科舉制度，以選拔優秀人才，弱化世族壟斷仕官的能力。另外還建立政事堂議事制度、監察制度、考績制度，這些都強化了政府機制，深刻影響到唐朝與後世的政治制度。在軍事上，繼續推行和改革府兵制；經濟上，一方面實行均田制和租庸調制減輕農民生產壓力，另一方面採取大索貌閱和輸籍制等清差戶口措施，以增加財政收入。這些政策成就了隋初的開皇之治。\\n為了鞏固隋朝發展，隋文帝與隋煬帝還興建了舉世聞名的隋唐大運河、隋長城、馳道以及大興城與東都洛陽。這些都提升了位於關中的隋廷對北方地區、關東地區與江南地區的掌控力，使隋朝各地的經濟、文化與人民能順利交流，還誕生出經濟重鎮江都。外交方面，隋朝的盛世也使得當時周邊國家和境內的少數民族如高昌、倭國、高句麗、新羅、百濟與內屬的東突厥等國都受隋朝文化與典章制度的影響，外交交流以日本的遣隋使最為著名。\\n隋朝結束自魏晉南北朝以來的分裂局面，奠定日後大唐盛世的基礎，對中國歷史的意義重大。隋朝對於外族文化的接受度高，並與漢文化融合，與唐朝合為在中國歷史上比較開放的朝代。"},{"page_url":"https://it.wikipedia.org/wiki/Soumans","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Map_commune_FR_insee_code_23174.png","page_title":"Soumans","context_page_description":"Soumans è un comune francese di 596 abitanti situato nel dipartimento della Creuse nella regione della Nuova Aquitania."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9E%D0%BF%D0%B5%D0%BB_%D0%9A%D0%BE%D1%80%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/2006_montana_gls_1.7d.jpg","page_title":"Опел Корса","context_page_description":"Опел Корса — мал автомобил кој се произведува од страна на германската марка на автомобили Опел од 1982 година. Тој се продава под најразлични други брендови."},{"page_url":"https://no.wikipedia.org/wiki/Skysstasjon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/The_Mail_Coach_-_geograph.org.uk_-_665747.jpg","page_title":"Skysstasjon","context_page_description":"En skysstasjon var en offentlig subsidiert gård der gamle dagers reisende kunne få hest eller vogn for sin videre ferd, ofte kombinert med et gjestgiveri for mat og overnatting."},{"page_url":"https://en.wikipedia.org/wiki/Nava_Brindavana","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Vyasaraja_Navabrindhavan.jpg","page_title":"Nava Brindavana","context_page_description":"Navabrundaavana is located at Anegundi, near Hampi, Karnataka, India. It contains the Brundaavanas of nine Hindu Madhva saints, who belong to the Sri Uttaradi Math, Sri Raghavendra Math, Sri Vyasaraja Math and the Sri SriPadaraja mutt and Other Various Prominent Madhwa Mutts. It is located on an island in the Tungabhadra River. The nine saints are\\nShri Padmanabha Tirtha, direct disciple of Jagadguru Shri Madhvacharya\\nShri Kavindra Tirtha\\nShri Vagisha Tirtha\\nShri Raghuvarya Tirtha\\nShri Vyasatirtha\\nShri Sudhindra Tirtha, Guru of Mantralaya Shri Raghavendra Tirtha\\nShri Srinivaasa Tirtha\\nShri Raama Tirtha\\nShri Govinda Vodeyaru\\nThere are also shrines to Lord Ranganatha and Lord Hanuman inside the premises."},{"page_url":"https://la.wikipedia.org/wiki/Archidux","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Bindenschild_Privilegium_maius_1512.svg","page_title":"Archidux","context_page_description":"Archidux est nobilitatis titulus domui Habsburgensi proprius.\\nArchidux a 1453-1918 erat titulus Austriam regentium, et a 1806 titulus imperatoris Austriae et omnium principum domus Habsurgensis sive Habsurgensis-Lotharingiensis."},{"page_url":"https://ca.wikipedia.org/wiki/Folgefonna","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Bondhusglacier.jpg","page_title":"Folgefonna","context_page_description":"Folgefonna és un terme utilitzat per a designar les tres glaceres situades a la regió de l'altiplà de Hardanger, al comtat de Hordaland, Noruega.\\nLes tres estan situades a la península de Folgefonna als municipis d'Odda, Jondal, Kvinnherad i Etne. La glacera més gran és la més meridional, amb una superfície de 167 km², seguida de la septentrional i la central. En total, Folgefonna cobreix uns 207 km². El 14 de maig de 2005 es va establir el Parc Nacional de Folgefonna, l'objectiu del qual és la protecció de les glaceres i les zones circumdants.\\nLa glacera és la llar d'una estació d'esquí d'estiu, situada a la regió nord. Les branques més grans de Folgefonna són Blomstølskardbreen, Bondhusbreen, i Buarbreen. Des del voltant del 1960, Blomstølskardbreen a l'extrem sud de Folgefonna ha canviat molt poc. Bondhusbreen i Buerbreen, situades més al nord, han estat creixent des de la dècada de 1990, tot i que des de l'any 2000 aquest creixement s'ha aturat bastant. La glacera és una famosa atracció turística. La majoria de les persones que visiten la ciutat d'Odda visiten Buarbreen, una de les branques de la Folgefonna."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D8%B3%D8%A7%D8%A1_%D9%83%D8%B1%D8%AF%D9%8A%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Group_of_determined_looking_YPJ_fighters.jpg","page_title":"نساء كرديات","context_page_description":"النساء الكرديات، لعِبت النساء الكرديات تقليديًا أدوارًا هامة في المجتمع والسياسة الكردية. يختلف الوضع المعاصر للمرأة الكردية اختلافًا كبيرًا بين البلدان التي يعيش فيها الكرد. بشكلٍ عام، تحسنت حقوق ومساواة المرأة الكردية بشكل كبير في القرن الواحد والعشرين بسبب الحركات التقدمية داخل المجتمع الكردي، ومع ذلك، على الرغم من التقدم، لا تزال المنظمات الكردية والدولية لحقوق المرأة تشير إلى وجود مشاكل تتعلق بالمساواة بين الجنسين، والزواج القسري، وجرائم الشرف، وفي كردستان العراق على شكل الخصوص هناك حالات لختان الإناث."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E5%96%AC%E6%B2%BB%C2%B7M%C2%B7%E7%A7%91%E6%BC%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/George-m-cohan-1.jpg","page_title":"喬治·M·科漢","context_page_description":"喬治·M·科漢，是一位美國演員、作曲家、歌手。\\n科漢小時候就開始與他的父母和妹妹一起表演了一場名為「The Four Cohans」的舞台劇。他在百老匯的作品無處不在。科漢在他的一生中發表了300多首歌曲，在美國歌壇享負盛名。\\n他被稱為「百老匯的主人」，他被認為是美國音樂之父。他的音樂生涯在奧斯卡獲獎影片《勝利之歌》和1968年的音樂劇中被描繪出來。並且紐約時代廣場還雕上科漢的雕像紀念他對美國音樂劇的貢獻。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%DB%8C%D9%86_%D9%87%DB%8C%D9%84%D8%8C_%D9%86%DB%8C%D9%88%D8%AC%D8%B1%D8%B3%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Census_Bureau_map_of_Mine_Hill_Township%2C_New_Jersey.png","page_title":"مین هیل، نیوجرسی","context_page_description":"مین هیل شهری در ایالت نیوجرسی کشور ایالات متحده آمریکا است که جمعیت آن در سرشماری سال ۲۰۱۰ میلادی، ۳٬۶۵۱ نفر بوده‌است."},{"page_url":"https://fr.wikipedia.org/wiki/Velaux","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Gare-Velaux.jpg","page_title":"Velaux","context_page_description":"Velaux est une commune du département des Bouches-du-Rhône qui fait partie de la métropole d'Aix-Marseille-Provence.\\nSes habitants sont appelés les Velauxiens et les Velauxiennes."},{"page_url":"https://vi.wikipedia.org/wiki/Petit-Pont","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Petit-Pont_vu_du_pont_au_Double-closeup-20050628.jpg","page_title":"Petit-Pont","context_page_description":"Petit-Pont là một cây cầu nhỏ bắc qua sông Seine ở trung tâm thủ đô Paris của Pháp. Cây cầu này nối Île de la Cité với đoạn nối giữa kè Montebello và kè Saint-Michel."},{"page_url":"https://simple.wikipedia.org/wiki/Odoacer","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Solidus-Odoacer-ZenoRIC_3657cf.jpg","page_title":"Odoacer","context_page_description":"Odoacer was a soldier in the army of the West Roman Empire of Germanic descent. When he forced the last Western Roman Emperor Romulus Augustus to quit his throne in 476, he became King of Italy. That event is considered the end of Ancient history and the beginning of the Middle Ages by historians. After a rule of 17 years, Odoacer would be killed by the Ostrogothic king Theodoric the Great at the age of 62 in 493."},{"page_url":"https://sv.wikipedia.org/wiki/Protea_montana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Protea_montana_rebeccaryen_iNat_39755299a.jpg","page_title":"Protea montana","context_page_description":"Protea montana är en tvåhjärtbladig växtart som beskrevs av Ernst Meyer och Meissn.. Protea montana ingår i släktet Protea och familjen Proteaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ca.wikipedia.org/wiki/Surakarta","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Surakarta_City_Hall.jpg","page_title":"Surakarta","context_page_description":"Surakarta, més coneguda com a Solo o Sala, és una ciutat d'Indonèsia al centre de Java, província de Java Central, amb una població de 520.061 habitants el 2009. La ciutat té una superfície de 44 km² dividits en cinc subdistrictes, i limita amb les regències de Karanganyar i Boyolali al north, Karanganyar i Sukoharjo a l'est i oest, i Sukoharjo al sud. A l'est hi ha el riu Bengawan Solo. La ciutat és seu del sultà de Surakarta que hi té el seu kraton, però només gaudeix de poder cerimonial. Junt amb Yogyakarta, Surakarta és l'hereu del regne de Mataram, dividit en dos regnes el 1755. Té l'aeroport internacional Adisumarmo a 14 km al nord."},{"page_url":"https://tr.wikipedia.org/wiki/Nicki_French","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Nickibrazil.jpg","page_title":"Nicki French","context_page_description":"Nicola \\"Nicki\\" Sharon French İngiliz şarkıcı ve oyuncu. en iyi 1995 yılındaki dans kapağı versiyonu \\"Heart of Eclipse of Heart\\" un ünlüsüdür ve ABD ve İngiltere Top 5'e ulaşmıştır. 2000 Eurovision Şarkı Yarışması'nda Birleşik Krallık'ı temsil etmiştir."},{"page_url":"https://fr.wikipedia.org/wiki/Province_de_Catamarca","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/El_Shinkal_1.jpg","page_title":"Province de Catamarca","context_page_description":"Catamarca est une province du nord-ouest de l'Argentine. Elle est entourée des provinces de Salta au nord, Tucumán et Santiago del Estero à l'est, Córdoba au sud-est, et La Rioja au sud. À l'ouest, elle est contiguë au Chili.\\nSa capitale est la ville de San Fernando del Valle de Catamarca."},{"page_url":"https://es.wikipedia.org/wiki/Campeonato_Europeo_de_Baloncesto_Femenino_de_2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Katowice_Spodek-_Nowa_elewacja.jpg","page_title":"Campeonato Europeo de Baloncesto Femenino de 2011","context_page_description":"El XXXIII Campeonato Europeo de Baloncesto Femenino se celebró en Polonia entre el 18 de junio y el 3 de julio de 2011 bajo la denominación EuroBasket Femenino 2011. El evento fue organizado por la Federación Europea de Baloncesto y la Federación Polaca de Baloncesto.\\nUn total de dieciséis selecciones nacionales afiliadas a FIBA Europa compitieron por el título de campeón europeo, cuyo anterior portador era el equipo de Francia, vencedor del EuroBasket 2009.\\nLa selección de Rusia se adjudicó la medalla de oro al derrotar en la final al equipo de Turquía con un marcador de 59-42. En el partido por el tercer puesto el conjunto de Francia venció al de la República Checa."},{"page_url":"https://no.wikipedia.org/wiki/Moss","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Kart_over_Moss_%281885%29.jpg","page_title":"Moss","context_page_description":"Moss er en by og kommune i landskapet Østfold i Viken fylke på Østlandet i Norge. Den grenser i nord til Vestby, i øst til Våler og i sør til Råde. I vest grenser Moss mot Horten.\\nMoss har et mangfoldig industri- og handelsmiljø, kunstgallerier, variert fjord- og innlandsnatur med Jeløya, Mossemarka og Vansjø. Moss ligger sentralt ved Oslofjordens østside midtveis mellom Oslo og Sverige og har blant annet fergeforbindelse over Oslofjorden til Horten og Vestfold.\\nI Moss ligger også Statens Hus med Fylkesmannen og de fleste av statens øvrige virksomheter for Østfold. Byen er et viktig handels- og servicesenter for sitt oppland, som i første rekke omfatter Råde og Våler i Viken, tidligere i Østfold; samt Son i Viken, tidligere i Akershus. Politisk innbefatter Mosseregionen kommunene Moss, Råde og Våler. Noen ganger regnes også Hobøl og Vestby til omlandet rundt Moss. Moss har tre videregående skoler, Kirkeparken vgs og Malakoff vgs som drives av Østfold fylkeskommune. Kirkeparken og Moss videregående Steinerskole har nylig fått bygget nye lokaler for skolen.\\nGrunnlaget for byen Moss er å finne i en kombinasjonen av gode kommunikasjoner og vannkraft."},{"page_url":"https://en.wikipedia.org/wiki/Ryan_Cresswell","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Ryan_Cresswell.jpg","page_title":"Ryan Cresswell","context_page_description":"Ryan Anthony Cresswell is an English professional footballer who plays as a centre back for Parkgate FC.\\nA graduate of the Sheffield United youth academy, Cresswell failed to break in the first team and was hence loaned to clubs in the lower divisions of English football. In 2008, after being released by Sheffield United, he signed for Bury in League Two. Playing more than 50 matches for the club, he joined Rotherham United two seasons later.\\nCresswell again changed clubs in 2012, penning a contract for Southend United. He was named in the League Two PFA Team of the Year for the 2012–13 season. The following season, he was transferred to Fleetwood Town with whom, he won promotion to League One. In 2014, after failing to make much impact at Fleetwood he again came to League Two, joining Northampton Town"},{"page_url":"https://vi.wikipedia.org/wiki/Euphorbia_retrospina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Euphorbia_retrospina_ies.jpg","page_title":"Euphorbia retrospina","context_page_description":"Euphorbia retrospina là một loài thực vật thuộc họ Euphorbiaceae. Đây là loài đặc hữu của Madagascar. Môi trường sống tự nhiên của chúng là vùng cây bụi khô khu vực nhiệt đới hoặc cận nhiệt đới. Chúng hiện đang bị đe dọa vì mất môi trường sống."},{"page_url":"https://fr.wikipedia.org/wiki/Sn%C3%A6fellsb%C3%A6r","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Snaefellsbaer_map.png","page_title":"Snæfellsbær","context_page_description":"Snæfellsbær est une municipalité située à l'ouest de la péninsule de Snæfellsnes, sur la côte ouest de l'Islande."},{"page_url":"https://en.wikipedia.org/wiki/Episode_6_(Twin_Peaks)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/CalebDeschanelByPhilKonstantin.jpg","page_title":"Episode 6 (Twin Peaks)","context_page_description":"\\"Episode 6\\", also known as \\"Realization Time\\", is the seventh episode of the first season of the American mystery television series Twin Peaks. The episode was written by Harley Peyton, and directed by Caleb Deschanel. \\"Episode 6\\" features series regulars Kyle MacLachlan, Sherilyn Fenn and Eric Da Re, with guest appearances by Chris Mulkey and David Patrick Kelly.\\nFederal Bureau of Investigation agent Dale Cooper and Twin Peaks sheriff Harry Truman continue to investigate a murder in the small mountain town of Twin Peaks; while local businessman Benjamin Horne schemes to burn down the town's sawmill to further his property empire.\\nDeschanel has noted that the episode, like most in the series, was filmed from a relatively short teleplay; he feels that this has contributed to its ability to develop characterization and subtextual inferences in addition to advancing its narrative. Peyton has described writing dialogue for MacLachlan's character Dale Cooper as being particularly tricky, though he found Fenn's character Audrey Horne to be enjoyable to write for."},{"page_url":"https://en.wikipedia.org/wiki/Ernest_Shipman","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Ernest_Shipman_-_Nov_1917_EH.jpg","page_title":"Ernest Shipman","context_page_description":"Ernest G. Shipman was Canada's most successful producer during the silent period. Shipman, whose nickname was \\"Ten Percent Ernie,\\" made seven features from 1919–23."},{"page_url":"https://ca.wikipedia.org/wiki/Revolta_a_Gr%C3%A8cia_de_2008","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Anarchist_posters_-_Stournari_Street_in_Athens_01.JPG","page_title":"Revolta a Grècia de 2008","context_page_description":"La revolta a Grècia de 2008 va ser un conflicte civil iniciat obertament el dissabte 6 de desembre de 2008 arran de la mort, pel tret d'un policia, d'un adolescent de 15 anys anomenat Alexandros Grigorópulos a Exarkhia, un barri cèntric d'Atenes, però que està estretament vinculat a la preexistent situació de descontentament social i de reclams d'ordre econòmic, sumat a l'àmplia percepció de corrupció governamental, que havien provocat mobilitzacions prèvies. Des de l'última setmana de desembre la situació va anar calmant-se progressivament."},{"page_url":"https://sk.wikipedia.org/wiki/Schachendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Csajta01v.jpg","page_title":"Schachendorf","context_page_description":"Schachendorf je obec v Rakúsku v spolkovej krajine Burgenland v okrese Oberwart.\\nŽije tu 797 obyvateľov."},{"page_url":"https://tr.wikipedia.org/wiki/BMW_6_Serisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/BMW_650Ci_convertible_--_06-28-2011.jpg","page_title":"BMW 6 Serisi","context_page_description":"BMW 6 Serisi, BMW'nin lüks coupe modelidir. 1976-1989 yılları arasında üretildikten sonra uzun bir ara vermiştir ama 2004 yılında tekrar üretime başlamıştır. En eski kasası E24, en yeni kasası ise F12 & F13'tür. 2004 yılında tekrar üretime başlayan kasa ise E63-E64}'tür.\\n·"},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_kirker_i_Agder","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Justvik_kirke.JPG","page_title":"Liste over kirker i Agder","context_page_description":"Liste over kirker i Agder lister kirkebygg knyttet til Den norske kirke og andre kirkebygg i Agder etter kommuner."},{"page_url":"https://it.wikipedia.org/wiki/T%C5%8Din","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Toin_Mie_chapter.JPG","page_title":"Tōin","context_page_description":"Tōin è una cittadina giapponese della prefettura di Mie."},{"page_url":"https://en.wikipedia.org/wiki/Tarsus_(eyelids)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Gray894.png","page_title":"Tarsus (eyelids)","context_page_description":"The tarsi are two comparatively thick, elongated plates of dense connective tissue, about 10 mm in length for the upper eyelid and 5 mm for the lower eyelid; one is found in each eyelid, and contributes to its form and support. They are located directly above the lid margins. The tarsus has a lower and upper part making up the palpebrae."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8A%E3%83%9D%E3%83%AC%E3%82%AA%E3%83%B33%E4%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Allegoria_italia_post1861.jpg","page_title":"ナポレオン3世","context_page_description":"ナポレオン3世は、フランス第二共和政の大統領、のちフランス第二帝政の皇帝。本名はシャルル・ルイ＝ナポレオン・ボナパルトであり、皇帝に即位して「ナポレオン3世」を名乗る以前については一般にルイ・ナポレオンと呼ばれている。本項でもそのように記述するものとする。\\nナポレオン・ボナパルトの甥にあたり、1815年のナポレオン失脚後、国外亡命生活と武装蜂起失敗による獄中生活を送ったが、1848年革命で王政が消えるとフランスへの帰国が叶い、同年の大統領選挙でフランス第二共和政の大統領に当選した。第二共和政の大統領の権力は弱く、はじめ共和派、のち王党派が牛耳るようになった国民議会から様々な掣肘を受けたが、1851年に国民議会に対するクーデタを起こし、独裁権力を掌握。1852年に皇帝に即位して「ナポレオン3世」となり、第二帝政を開始した。1850年代は「権威帝政」と呼ばれる強圧支配を敷いたが、1860年代頃から「自由帝政」と呼ばれる議会を尊重した統治へと徐々に移行した。内政面ではパリ改造計画、近代金融の確立、鉄道網敷設などに尽くした。外交ではクリミア戦争によってウィーン体制を終焉させ、ヨーロッパ各地の自由主義ナショナリズム運動を支援することでフランスの影響力を拡大を図った。またアフリカ・アジアにフランス植民地を拡大させた。しかしメキシコ出兵の失敗で体制は動揺。1870年に勃発した普仏戦争でプロイセン軍の捕虜となり、それがきっかけで第二帝政は崩壊し、フランスは第三共和政へ移行した。\\n以降2020年現在までフランスは共和政であるため、彼がフランスにおける最後の君主にあたる。"},{"page_url":"https://sv.wikipedia.org/wiki/White_Star_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/RMS_Oceanic_%281870%29.jpg","page_title":"White Star Line","context_page_description":"White Star Line var ett rederi som ägde bland annat fartygen Britannic, Olympic och Titanic. Företaget startades av den brittiska affärsmannen John Pilkington och Henry Threlfall Wilson i Liverpool 1845. White Star Line slogs ihop med Cunard Line den 10 maj 1934, och 1947 köpte Cunard Line upp de sista delarna av White Star Line för att bli ensamma ägare av rederiet."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%B3%D8%AC%D8%AF_%D8%A7%D9%85%D8%A8%D9%88%D8%B1%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Amburiq_Mosque.jpg","page_title":"مسجد امبورک","context_page_description":"مسجد امبورک مسجدی واقع در شگر در گلگت-بلتستان، پاکستان است. این مسجد یکی از قدیمی‌ترین مساجد در بلتستانو در شبه قاره هند است. میر سید علی همدانی این مسجد را ساخته‌ است. این بنا یکی از معروف‌ترین و برجسته‌ترین جاذبه‌های مهم توریستی در بلتستان است."},{"page_url":"https://nl.wikipedia.org/wiki/Pyrophorus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Pyrophorus_noctilucus_click_beetle.jpg","page_title":"Pyrophorus","context_page_description":"Pyrophorus is een geslacht van kevers uit de familie kniptorren. Het geslacht is voor het eerst wetenschappelijk beschreven in 1820 door Billberg."},{"page_url":"https://cs.wikipedia.org/wiki/Suchoj_Su-25","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Ukrainian_Air_Force_Su-25UB_with_two_MiG-29s_%289-13%29_in_background.jpg","page_title":"Suchoj Su-25","context_page_description":"Suchoj Su-25 je sovětský jednomístný proudový letoun určený k poskytování přímé letecké podpory pozemním jednotkám. Na základě analýz byla zjištěna potřeba specializovaného letadla pro přímou palebnou podporu, podobného jako byl Il-2 Šturmovik nebo Iljušin Il-10 z období druhé světové války a po ní, tj. silně chráněného a s vysokou palebnou silou. Tehdy zavedené stíhací bombardéry nebyly pro takový účel optimální.\\nPrvní prototyp tohoto letounu vzlétl 22. února 1975. Oproti jeho americkému konkurentu Fairchild A-10A je rychlejší, ovšem má i vyšší minimální rychlost, potřebnou pro CAS, ale naopak dokáže nést o dost méně munice a výzbroje, než americký protivník. Navíc sovětský 30 mm kanón byl oproti americké konkurenci velmi problémový a nespolehlivý. Sériová výroba začala až roku 1978 a celkem bylo vyrobeno 1 024 kusů, z nichž mnohé slouží v některých armádách dodnes. Letoun je velmi nenáročný na údržbu, v případě nouze může létat i na motorovou naftu nebo benzin, což se však projeví zkrácením životnosti motoru. Kvůli tomu se mezi piloty a pozemním personálem vžilo pro tento stroj oslovení „prase“.\\nSu-25 používala i Armáda České republiky, kde získal populární přezdívku „hrábě“."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A9%E6%B4%A5%E5%B8%82%E5%8E%86%E5%8F%B2%E9%A3%8E%E8%B2%8C%E5%BB%BA%E7%AD%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/%E7%9D%A6%E5%8D%97%E9%81%9337%E5%8F%B7.jpg","page_title":"天津市历史风貌建筑列表","context_page_description":"天津市历经600多年的建城史和近代租界的城市规划发展，出现了一大批具有较高的历史、文化、科学、艺术和人文价值并反映时代特色和地域特色的建筑和著名建筑师的代表作，市中心城区形成了包括法国、意大利、英国风格等在内的浓郁的异国风情以及民国时期的建筑风格，具有与中国其他城市截然不同的城市风情。尽管一直遭到自然和人为的损毁，这些建筑中完好保留下来的仍有很多。传统上，城市通过设立“文物保护单位”的方法对其进行保护，但随着21世纪初中国城市房地产开发的热潮，这些建筑的存在受到严重威胁。为了平衡对这些建筑的保护同市中心土地开发之间的关系，天津市第十四届人民代表大会常务委员会第二十一次会议于2005年7月20日通过名为《天津市历史风貌建筑保护条例》的地方性法规，受其保护的建筑则称为天津市历史风貌建筑。"},{"page_url":"https://fr.wikipedia.org/wiki/Francis_Drake_(3e_baronnet)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Buckland_Abbey_tower.jpg","page_title":"Francis Drake (3e baronnet)","context_page_description":"Sir Francis Drake, 3e baronnet de l'abbaye de Buckland, dans le Devon, était un homme politique anglais qui a siégé à la Chambre des communes à divers moments entre 1673 et 1700."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D0%BE%D0%B2%D0%B0_%D0%BD%D0%B0%D0%B3%D1%80%D0%B0%D0%B4%D0%B0_%D0%B7%D0%B0_%D1%84%D0%B8%D0%B7%D0%B8%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Nobel_Laureate_David_Morris_Lee_in_2007.jpg","page_title":"Нобелова награда за физика","context_page_description":"Нобелова награда за физика — годишна награда што ја доделува Кралската академија на науките на научници од различни области на физиката. Таа е една од петте Нобелови награди што ја основал во 1895 година пронаоѓачот на динамитот, шведскиот физичар Алфред Нобел. Останатите награди се: Нобелова награда за хемија, Нобелова награда за физиологија или медицина, Нобелова награда за литература, Нобелова награда за мир и Нобелова награда за економија.\\nСпоред тестаментот на Нобел, наградата се исплатува од средствата на Нобеловата задолжбина, а ја доделува комитет од пет члена кои ги избира Кралската академија на науките. Првата Нобелова награда за физика е доделена во 1901 година на Вилхелм Конрад Рентген, од Германија.\\nСекој добитник добива медал, диплома и парична награда која не е иста секоја година. Во 1901 година, Рентген добил 150.782 шведски круни, што е околу 7.731.004 шведски круни во декември 2007 година. Во 2008 година, наградата им е доделена на Макото Кобајаши, Тошихиде Маскава и Јоичиро Намбу, кои поделија износ од десет милиони шведски круни"},{"page_url":"https://en.wikipedia.org/wiki/Halle%E2%80%93Bebra_railway","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Hauptbahnhof_naumburg_saale.jpg","page_title":"Halle–Bebra railway","context_page_description":"The Halle–Bebra railway, also known in German as the Thüringer Bahn, is a 210 kilometre-long railway line from Halle via Erfurt and Gerstungen to Bebra, mainly in Thuringia. As far as Gerstungen the line originally belonged to the Thuringian Railway Company. From Gerstungen to Bebra, it was owned by the Frederick William Northern Railway, named after the Prussian king, Frederick William IV. It is now a two-track, electrified, standard gauge mainline operated by DB Netze. It was opened between 1846 and 1849 and was the first railway line in Thuringia. All types of trains from Regionalbahn to ICE currently run on the line except Interregio-Express. Four of the six largest cities in Thuringia are located on the line."},{"page_url":"https://sq.wikipedia.org/wiki/Turizmi_n%C3%AB_Moldavi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/AIRM_-_Bulevardul_%C8%98tefan_cel_Mare_din_Chi%C8%99in%C4%83u_-_aug_2015.jpg","page_title":"Turizmi në Moldavi","context_page_description":"Turizmi në Republikën e Moldavisë përqendrohet në peizazhet natyrore të vendit dhe historinë e tij. Ture vere u ofrohen turistëve në të gjithë vendin. Vreshtat / bodrumet përfshijnë Cricova, Purcari, Ciumai, Romanești, Cojușna, Mileștii Mici. Në vitin 2015, Moldavia kishte 2.85 milion vizitorë."},{"page_url":"https://cs.wikipedia.org/wiki/Skl%C3%A1rna_a_rafinerie_Josef_Inwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Czech_drinking_glasss_Durit_01.jpg","page_title":"Sklárna a rafinerie Josef Inwald","context_page_description":"Sklárna a rafinerie Josef Inwald je bývalý průmyslový areál v Praze, který se rozkládal jihozápadně od Smíchovského nádraží. Ohraničovaly jej z východu trať 171 do Plzně a ze západu trať 122 do Hostivic. Většina budov byla zbořena při stavbě Zlíchovského tunelu a ulice Dobříšská. Původně patřila sklárna ke Zlíchovu, adresa Sklářská 3213/15. Později byl pozemek a zbylé stavby převedeny do katastru Smíchova."},{"page_url":"https://cs.wikipedia.org/wiki/Helmut_Wick","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Bundesarchiv_Bild_146-1986-013-04%2C_Helmut_Wick_%28cropped%29.jpg","page_title":"Helmut Wick","context_page_description":"Helmut Wick byl německý stíhací pilot německé Luftwaffe, který se zúčastnil za druhé světové války Bitvy o Francii a Bitvy o Británii."},{"page_url":"https://de.wikipedia.org/wiki/1231","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Punta_de_Capdepera_-_Mallorca.jpg","page_title":"1231","context_page_description":"1. Mai: König Heinrich stellt auf dem Hoftag zu Worms das Statutum in favorem principum aus. Es beinhaltet die Festschreibung aller bis zu diesem Zeitpunkt den Fürsten zuerkannten und von ihnen selbst erworbenen Vorrechte in 23 Artikeln. Außerdem bedeutet diese Urkunde eine Garantieerklärung der genannten Privilegien für die Zukunft, wie Selbstständigkeit bei der Verwaltung des eigenen Territoriums, Gerichtsbarkeit und Erhebung von Zöllen. Gemeinsam mit der Confoederatio cum principibus ecclesiasticis bildet es den Ausgangspunkt der föderalistischen Entwicklung im Reich und seinen Nachfolgestaaten. Das Heilige Römische Reich geht durch diese Anerkennung einer föderalen Ordnung einen anderen Weg als die anderen – sich zentralisierenden – europäischen Reiche.\\n15. September: Der bayerische Herzog Ludwig der Kelheimer aus dem Geschlecht der Wittelsbacher wird von einem unbekannten Attentäter auf der Brücke in Kelheim ermordet. Sein Sohn Otto der Erlauchte übernimmt die Regentschaft im Herzogtum Bayern.\\nAuf die Ankündigung Kaiser Friedrichs II., am 1."},{"page_url":"https://fr.wikipedia.org/wiki/Buchillon_(Fribourg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/2012-07-18-Regiono_Arbergo_%28Foto_Dietrich_Michael_Weidmann%29_327.JPG","page_title":"Buchillon (Fribourg)","context_page_description":"Buchillon est une localité et une ancienne commune suisse du canton de Fribourg, située dans le district du Lac."},{"page_url":"https://en.wikipedia.org/wiki/Aleko","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/AZLK%28ALEKO%29-21412_%22Moskvich%22_with_trailer.jpg","page_title":"Aleko","context_page_description":"The Moskvitch-2141, also known under the trade name Aleko, is a Russian mid-size car that was first announced in 1985 and sold in the Soviet Union and its successor states between 1986 and 1997 by the now defunct Moskvitch Company, based in Moscow, Russia. It was replaced by the modernised M-2141-02 Svyatogor and its sedan body version, the M-2142, in 1997–2003.\\nThe Aleko was a huge improvement over previous Moskvitch models, which were durable but old-fashioned saloons and station wagons with rear-wheel drive and a solid rear axle, and had no common parts with them apart from the engine and some other minor details.\\nThe new car had such innovative features as front-wheel drive, a hatchback body style, MacPherson strut front suspension and torsion-crank rear suspension. It had rack-and-pinion steering and a collapsible steering column. The spare tyre was located underneath the boot and was accessible from outside, in the tradition of French cars. The wheelbase went up almost 20 centimetres, the body got 14 centimetres wider, the wheel size went up one inch. The car became more spacious, comfortable and safe."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D0%BE%D0%BC%D0%B1%D1%8C%D0%B5-%D1%81%D1%8E%D1%80-%D0%A1%D1%91%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Colombiers-sur-Seulles.JPG","page_title":"Коломбье-сюр-Сёль","context_page_description":"Коломбье-сюр-Сёль — Францин гӀала-коммуна, лаьтта Лаха Норманди регионехь. Коммунан департамент — Кальвадос. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://ro.wikipedia.org/wiki/George_Stephenson","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/PSM_V12_D280_George_Stephenson.jpg","page_title":"George Stephenson","context_page_description":"George Stephenson a fost un inginer englez care a construit prima cale ferată publică ce utiliza locomotive cu abur.\\nA fost considerat părintele căilor ferate.\\nEcartamentul liniei sale de 1.435 mm este considerat actualmente ecartamentul standard al căilor ferate.\\nUnicul său fiu, Robert Stephenson, a continuat tradiția tatălui, fiind un valoros inginer feroviar."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B0%D0%B9%D1%82%D1%96%D0%BD%D1%81%D0%B2%D1%96%D0%BB%D0%BB_(%D0%9C%D0%B0%D1%81%D1%81%D0%B0%D1%87%D1%83%D1%81%D0%B5%D1%82%D1%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Whitinsville_Shop.jpg","page_title":"Вайтінсвілл (Массачусетс)","context_page_description":"Вайтінсвілл — переписна місцевість в США, в окрузі Вустер штату Массачусетс. Населення — 6704 особи."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%88%E0%B8%B3%E0%B8%99%E0%B8%A7%E0%B8%99%E0%B9%80%E0%B8%8A%E0%B8%B4%E0%B8%87%E0%B8%AD%E0%B8%B1%E0%B8%99%E0%B8%94%E0%B8%B1%E0%B8%9A%E0%B8%97%E0%B8%B5%E0%B9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Omega-exp-omega-labeled.svg","page_title":"จำนวนเชิงอันดับที่","context_page_description":"จำนวนเชิงอันดับที่ ในทฤษฎีเซต เป็นรูปแบบจำนวนที่เพิ่มเติมจากระบบจำนวนธรรมชาติ ซึ่งใช้ในการอธิบายวิธีการจัดอันดับเซตของวัตถุ หากมีชุดของวัตถุที่มีขนาดจำกัด เราสามารถจัดอันดับได้โดยการนับธรรมดา นั่นคือการไล่จับคู่วัตถุในเซตกับจำนวนธรรมชาติ ในทำนองเดียวกันนี้ เราใช้จำนวนเชิงอันดับที่ในการจัดอันดับของวัตถุในเซตใด ๆ ซึ่งอาจมีขนาดเป็นอนันต์ก็ได้\\nจำนวนเชิงอันดับที่ แสดงถึงภาวะเชิงอันดับที่ของเซตอันดับดี หมายถึงเซตที่มีการนิยามความสัมพันธ์ > บนเซต ซึ่งมีสมบัติได้แก่\\nสำหรับ x และ y ใด ๆ ในเซต ความสัมพันธ์ x > y หรือ x = y หรือ y > x จะเป็นจริงหนึ่งความสัมพันธ์เสมอ\\nสำหรับ x y และ z ใด ๆ ในเซต ถ้า x > y และ y > z แล้ว x > z\\nทุกสับเซตมีสมาชิกต่ำสุด นั่นคือ ทุกสับเซตมี x หนึ่งตัว ที่ไม่มี y ในสับเซตที่ x > y\\nเซตอันดับดีสองเซตจะมีภาวะเชิงอันดับที่เดียวกัน ก็ต่อเมื่อมีฟังก์ชันหนึ่งต่อหนึ่งทั่วถึงจากเซตหนึ่งไปอีกเซตที่รักษาการจัดอันดับในเซต\\nจำนวนเชิงอันดับที่ต่างจากจำนวนเชิงการนับ ซึ่งใช้แสดงขนาดของเซตโดยไม่คำนึงการจัดอันดับของสมาชิก ความแตกต่างนี้ไม่ชัดเจนสำหรับเซตจำกัด ซึ่งจำนวนเชิงอันดับที่หนึ่งตัวจะตรงกับจำนวนเชิงการนับหนึ่งตัวเสมอ แต่สำหรับเซตอนันต์ที่มีจำนวนเชิงการนับเดียวกัน อาจมีจำนวนเชิงอันดับที่ต่างกันได้"},{"page_url":"https://en.wikipedia.org/wiki/Merriam_Street_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/MerriamStBridge.jpg","page_title":"Merriam Street Bridge","context_page_description":"Merriam Street Bridge is a truss bridge that spans the east channel of the Mississippi River between Nicollet Island and the east bank of the river in Minneapolis, Minnesota. The bridge was originally built in 1887 by King Iron Bridge Company as one of the four spans of the Broadway Avenue Bridge. When the Broadway Avenue Bridge was reconstructed in 1987, one span was preserved and moved to Nicollet Island. The truss span is actually decorative; the bridge is supported by a beam from underneath.\\nThe original Broadway Avenue Bridge was one of the fanciest bridges on the Mississippi River. It featured finials on each top corner and a band of scrolls, crosses, and lines between them. The horizontal struts and guard railings used X-shapes as a pattern. Each end of the bridge has a hexagonal cast iron plate embossed with the date and the designer of the bridge. The bridge now serves as a connector between parkland on Nicollet Island and the Saint Anthony Main development on the east bank, allowing good opportunities for visitors to stroll across the river."},{"page_url":"https://ca.wikipedia.org/wiki/Herm%C3%ADnia_de_Reuss,_reina_de_Pr%C3%BAssia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Hermine_of_Reuss.jpg","page_title":"Hermínia de Reuss, reina de Prússia","context_page_description":"Hermínia de Reuss, reina de Prússia Greiz 1887 - Frankfurt de l'Oder 1947. Segona esposa del kàiser Guillem II de Prússia morí en estranyes circumstàncies.\\nFilla del príncep sobirà Enric XXII de Reuss-Greiz i de la princesa Ida Matilde Adelaida de Schaumburg-Lippe. Es casà en primeres núpcies amb el príncep Joan Jordi von Schoenaich-Carolath del qual nasqueren cinc fills:\\nSA el príncep Hans Georg von Schoenaich-Carolath nascut el 1907 i mort en acció al front rus el 1943 es casà amb la baronessa Sibylle von Zedlitz und Leipe.\\nSA el príncep Georg Wilhelm von Schoenaich-Carolath nascut el 1909 i mort el 1927.\\nSA la princesa Hermine Caroline von Schoenaich-Carolath nascuda el 1910. Es casà amb Hugo Herbert Hartung mort el 1945 mentre era presoner dels soviètics.\\nSA el príncep Ferdinand Johann von Schoenaich-Carolath nascut el 1913 i mort el 1973. Es casà en primeres núpcies amb Rose Rauch i en segones núpcies amb la baronessa Margret von Seckendorff.\\nSA la princesa Enriqueta de Schoenaich-Carolath nascuda el 1918 i morta el 1972. Es casà amb el príncep Carles Francesc de Prússia."},{"page_url":"https://eu.wikipedia.org/wiki/Fr%C3%A9d%C3%A9ric_Bastiat","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Bastiat.jpg","page_title":"Frédéric Bastiat","context_page_description":"Frédéric Bastiat lapurtar ekonomialari eta politikaria izan zen. Arlo horietan egindakoagatik liberalismoaren erreferentzia bat da."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Kempeleen_julkisista_taideteoksista_ja_muistomerkeist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/fi/0/0e/Kempele_1918_muistomerkki_1.jpg","page_title":"Luettelo Kempeleen julkisista taideteoksista ja muistomerkeistä","context_page_description":"Luettelo Kempeleen julkisista taideteoksista ja muistomerkeistä sisältää Kempeleen kunnassa olevat pysyvät patsaat, muistomerkit ja muistolaatat.\\nLuettelossa on pysyvästi julkisilla paikoilla olevia taideteoksia, muistomerkkejä ja muistolaattoja sekä hautausmailla olevia yleisiä muistomerkkejä ja patsaita. Luettelossa ei mainita rakennusten sisällä ja suljetuilla sisäpihoilla olevia julkisia teoksia eikä yksittäisten hautojen veistoksia. Teokset ovat luettelossa nimensä mukaisessa aakkosjärjestyksessä. Sijaintipaikka on puiston, aukion, rakennuksen tai muun vastaavan nimi ja/tai katuosoite. Alue tarkoittaa kaupunginosaa/kunnanosaa, taajamaa, kylää, osa-aluetta tai asuinaluetta. Karttalinkki osoittaa teoksen sijaintipaikan kymmenien metrien tarkkuudella. Paljastusvuosi on teoksen julkistuksen tai paljastuksen vuosi sijaintipaikalla."},{"page_url":"https://es.wikipedia.org/wiki/Isla_de_Parano%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Paranoa-Island-Brasilia.JPG","page_title":"Isla de Paranoá","context_page_description":"La Isla de Paranoá es la mayor de las tres islas ubicadas en el lago Paranoá en Brasilia, Distrito Federal de Brasil. Posee aproximadamente 1,54 hectáreas de superficie, estando situada cerca de la carretera ML 4 y al norte del lago Paranoá que fue declarado como la \\"Reserva Ecológica del Lago Paranoá\\". Las otras dos islas en el lago son Isla de Retiro y la isla de los clubes."},{"page_url":"https://fr.wikipedia.org/wiki/Die_Kinder_von_Golzow","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Gedenktafel_Hauptstr._16_%28Golzow%29_Kinder_von_Golzow.jpg","page_title":"Die Kinder von Golzow","context_page_description":"Die Kinder von Golzow est un documentaire cinématographique allemand à long terme réalisé par Barbara et Winfried Junge entre 1961 et 2007 d'après une idée du réalisateur de documentaires Karl Gass.\\nLe film suit la vie des élèves d'une classe de l'école de Golzow, dans le Brandebourg, en Allemagne.\\nLe résultat est une œuvre de vingt segments de films, totalisant plus de septante kilomètres de pellicule, soit une durée de quelque 45 heures. Les six premiers segments sont en noir et blanc.\\nLe documentaire, le plus long de l'histoire du cinéma, prend fin avec les deux parties Und wenn sie nicht gestorben sind... et ...dann leben sie noch heute"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D1%96%D0%BA%D0%BE%D0%BB%D1%8C_%D0%A4%D0%BE%D0%BD%D1%82%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Nicole_Fontaine.jpg","page_title":"Ніколь Фонтен","context_page_description":"Ніко́ль Фонте́н — французький політичний діяч і член Європейського парламенту від Іль-де-Франс. Вона є членом партії Союз за народний рух, яка є частиною Європейської народної партія. Фонтейн була Голова Європейського парламенту з 1999 по 2001, а потім була замінений Петом Коксом, з Альянсу лібералів і демократів за Європу, відповідно до угоди між двома групами на початку терміну."},{"page_url":"https://en.wikipedia.org/wiki/Cheadle_and_Gatley_(Stockport_electoral_ward)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Cheadle_%26_Gatley_%28Stockport_Council_Ward%29.png","page_title":"Cheadle and Gatley (Stockport electoral ward)","context_page_description":"Cheadle and Gatley is an electoral ward in the Metropolitan Borough of Stockport. It elects three Councillors to Stockport Metropolitan Borough Council using the first past the post electoral method, electing one Councillor every year without election on the fourth.\\nTogether with Bramhall North, Bramhall South, Cheadle Hulme North, Cheadle Hulme South, Heald Green and Stepping Hill Wards it makes up the Cheadle Parliamentary Constituency.\\nThe ward contains the Cheadle College, which is part of the Cheadle and Marple Sixth Form College."},{"page_url":"https://fr.wikipedia.org/wiki/Sonate_K._548","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Scarlatti%2C_Sonate_K._548_-_ms._Parme_XV%2C35_%28page_4%29.jpg","page_title":"Sonate K. 548","context_page_description":"La sonate K. 548 en ut majeur est une œuvre pour clavier du compositeur italien Domenico Scarlatti."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%81%D1%82%D0%BE%D1%80%D1%96%D1%8F_%D0%BF%D0%BE%D1%88%D1%82%D0%B8_%D1%82%D0%B0_%D0%BF%D0%BE%D1%88%D1%82%D0%BE%D0%B2%D0%B8%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%A8%D1%80%D1%96-%D0%9B%D0%B0%D0%BD%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Second_Stamp.png","page_title":"Історія пошти та поштових марок Шрі-Ланки","context_page_description":"Історія пошти та поштових марок Шрі-Ланки охоплює розвиток поштового зв'язку Шрі-Ланки, острівної держави в Південній Азії. При цьому умовно можна виділити два основних історичних періоди — британського колоніального управління і незалежної держави, в кожен з яких здійснювалися емісії власних поштових марок. З 1949 року незалежна цейлонська держава входить у Всесвітній поштовий союз. Сучасним поштовим оператором країни є Sri Lanka Post."},{"page_url":"https://it.wikipedia.org/wiki/Lech_(fiume)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Lechfall_panorama2.jpg","page_title":"Lech (fiume)","context_page_description":"Il Lech è un fiume affluente di destra del Danubio che scorre in Austria e Germania. Lungo 264 chilometri, il fiume nasce nel Vorarlberg a 2.789 m s.l.m., attraversa il Tirolo e la Baviera meridionale, dove si getta nel Danubio. Poco davanti al confine austro-tedesco riceve le acque del Vils e dopo il confine forma la Lechfall, cascata di 12 metri. Passata Füssen entra nella pianura bavarese, dove formava lo storico confine tra Baviera e Svevia. Continua poi il suo corso verso nord attraverso la Svevia e l'Alta Baviera in una regione chiamata Lechrain. Le principali città che sorgono sul suo corso sono Landsberg e Augusta, in corrispondenza della quale riceve il Wertach. Presso Rain confluisce nel Danubio ad una quota di 392 metri.\\nCon una portata media annuale di 115 m³/s, il Lech è il sesto fiume della Baviera per portata, dietro al Danubio, l'Inn e il suo affluente Salzach, l'Isar ed il Meno.\\nPresso Füssen sorge il celeberrimo castello di Neuschwanstein."},{"page_url":"https://de.wikipedia.org/wiki/Steven_Burns","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Steve_Burns_2009.JPG","page_title":"Steven Burns","context_page_description":"Steven Burns ist ein US-amerikanischer Schauspieler, Entertainer und Musiker.\\nDem breiten Publikum wurde Steven Burns mit der Kinderserie Blue’s Clues – Blau und schlau seit 1996 bekannt. 2002, nach sechs Jahren und über 100 Folgen Blue’s Clues – Blau & Schlau, gab Steven Burns bekannt, zum Jahresende die Rolle des Steve nicht weiter auszuführen, und ein Darstellerwechsel folgte zum Jahre 2003.\\nAls Musiker war er auf Tournee mit den Flaming Lips."},{"page_url":"https://es.wikipedia.org/wiki/Howard_Gordon","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Howard_Gordon_2009.jpg","page_title":"Howard Gordon","context_page_description":"Howard Gordon es un escritor y productor de series estadounidense. Después de graduarse de Princeton de 1984, Gordon se fue a Los Ángeles con su compañero Alex Gansa para continuar su carrera de escritor de series de televisión. Ambos llegaron a la industria con episodio de ABC: por reclutamiento. Juntos trabajaron en la serie Beauty and the Beast como escritores, luego esa serie fue nominada para un Emmy, luego fueron llamados como productores.\\nEn 1990, el equipo de Gansa-Gordon fue firmado en un contrato de dos años para las producciones de \\"Witt-Thomas Productions\\", durante esto crearon varios pilotos. Uno de esos pilotos fue el proyecto que ABC llamó Country Estates, con el cual obtuvieron la atención del famoso productor Chris Carter.\\nPoco tiempo después, Carter invitó a Gordon y Gansa para que se unieran al proyecto de The X-Files como Productores de Supervisión; Gordon escribió y co-escribió varios guiones para varias temporadas de la serie, antes de irse de ella en 1997 para buscar otros proyectos. Después co-escribió un episodio de Buffy la cazavampiros, Gordon creó su propio programa, la corta serie Strange World en el año 1999."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%BB%92%E5%AD%90%E5%B3%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Kurokoshima_%28Hirado%29.jpg","page_title":"黒子島","context_page_description":"黒子島は長崎県北部の平戸瀬戸にある島である。同県平戸市大久保町に属する。"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D8%B1%D9%85%D8%B1%D9%81%D9%88%D8%B1%D8%AF%D9%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Bremerv%C3%B6rde_1.jpg","page_title":"برمرفورده","context_page_description":"برمرفورده آلمانین نیدرزاکسن ایالتینده یئر آلان بیر شهردیر و ۴ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۱۸۷۵۱ نفر دیر. بۇ شهرین ۱۵۰٫۱۸ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%DB%8C%D9%85%DA%86%D9%87_%D8%A7%D9%85%DB%8C%D9%86%E2%80%8C%D8%A7%D9%84%D8%AF%D9%88%D9%84%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Timcheamin.jpg","page_title":"تیمچه امین‌الدوله","context_page_description":"تیمچه امین‌الدوله یا کاروانسرای امین‌الدوله از بناهای معماری و تاریخی مربوط به دوره قاجار است و در بازار کاشان واقع شده و این اثر در تاریخ ۲۹ دی ۱۳۵۳ با شماره ثبت ۱۰۱۶ به‌عنوان یکی از آثار ملی ایران به ثبت رسیده‌است.\\nاستاد علی مریم کاشانی طراح و معمار این بنا بوده است که آن را بین سالهای ۱۲۸۰ تا ۱۲۸۴ هجری قمری ساخته است."},{"page_url":"https://en.wikipedia.org/wiki/1890_Invercargill_mayoral_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/William_Horatio_Hall.jpeg","page_title":"1890 Invercargill mayoral election","context_page_description":"The 1890 Invercargill mayoral election was held on 26 November 1890."},{"page_url":"https://de.wikipedia.org/wiki/Naturpark_Steinhuder_Meer","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Steinhude_Naturparkzentrum.jpg","page_title":"Naturpark Steinhuder Meer","context_page_description":"Der Naturpark Steinhuder Meer erstreckt sich mit dem Steinhuder Meer als Kernstück über ein Gebiet von rund 420 km² Fläche in den Landkreisen Nienburg/Weser und Schaumburg und in der Region Hannover. Letztere ist Träger des 1974 gegründeten Naturparks."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%AD%D9%8A%D8%B1%D9%87_%D9%83%D9%84%D8%A7%D9%88%D8%AA%D8%B2%D9%83%D9%8A%D8%B3%D9%89","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Klautzkesee.JPG","page_title":"بحيره كلاوتزكيسى","context_page_description":"كلاوتزكيسى بحيره فى المانيا."},{"page_url":"https://de.wikipedia.org/wiki/Theodor_Cellarius","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Theodor_Cellarius_1627-1677.jpg","page_title":"Theodor Cellarius","context_page_description":"Theodor Cellarius war ein deutscher Altphilologe und Professor an der Universität Tübingen."},{"page_url":"https://fr.wikipedia.org/wiki/Universit%C3%A9_de_Monastir","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Universit%C3%A9_de_Monastir_5.jpg","page_title":"Université de Monastir","context_page_description":"L'université de Monastir ou UM est une université tunisienne pluridisciplinaire basée à Monastir, avec sa propre autonomie financière et administrative, fondée en 2004 suite à la réforme du système éducatif universitaire.\\nSes principales activités sont liées à l'enseignement supérieur, l'apprentissage et la recherche dans un sens très large, avec pour but la décentralisation des services, la supervision et l'amélioration de la rentabilité du système éducatif supérieur.\\nAvec environ 27 500 étudiants, 2 044 conférenciers et 758 membres du personnel administratif et de soutien, l'université de Monastir propose un large éventail de cours de premier, deuxième et de troisième cycle, soit un nombre moyen de diplômés d'environ 4 700 par an.\\nElle est classée par le U.S. News & World Report au 18ᵉ rang du classement régional 2016 des universités arabes. Selon UniRank, l'université est classée au 3ᵉ rang en Tunisie. En 2020, l'université est classée 301-400 dans le domaine Energy Science & Engineering et la première à l'échelle nationale dans ce domaine selon le Shanghai Ranking's Global Ranking of Academic Subjects 2020."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Cyr-Sainte-Julitte_de_Villejuif","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/%C3%89glise_Saint-Cyr-Sainte-Julitte_-_Villejuif_-_Val-de-Marne_-_France_-_M%C3%A9rim%C3%A9e_PA00079914_%287%29.jpg","page_title":"Église Saint-Cyr-Sainte-Julitte de Villejuif","context_page_description":"L'église Saint-Cyr-Sainte-Julitte est une église catholique située à Villejuif dans le Val-de-Marne, en France. Il s'agit de la principale église de la commune."},{"page_url":"https://sv.wikipedia.org/wiki/Douglas_Ryding","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Douglas_Ryding_f%C3%B6dd_1890.jpg","page_title":"Douglas Ryding","context_page_description":"Erik Douglas Ryding, född 10 februari 1890 i Göteborg, död där 14 juni 1967, var en svensk tecknare.\\nRyding studerade vid Valands målarskola och Slöjdföreningens skola. Hans konst består huvudsakligen av reklamteckningar, skämtbilder, illustrationer och exlibris."},{"page_url":"https://fr.wikipedia.org/wiki/Lacs_Mavora","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/North_Mavora_Lake_%28388784824%29.jpg","page_title":"Lacs Mavora","context_page_description":"Les lacs Mavora sont deux étendues d'eau situées sur l'île du Sud, l'une des deux îles principales de la Nouvelle-Zélande.\\nLes deux lacs sont nommés selon leur disposition relative, Mavora nord et Mavora sud. Le territoire « Te Wāhipounamu/South-West New Zealand World Heritage Area » est entretenu par le Department of Conservation de Nouvelle-Zélande.\\nPlusieurs scènes de la trilogie cinématographique de Peter Jackson adaptant le roman Le Seigneur des anneaux de J. R. R. Tolkien y ont été tournées."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A8%E0%B4%AF%E0%B5%8D%E0%B4%B8%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Augen-gneiss-2.jpg","page_title":"നയ്സ്","context_page_description":"ഒരിനം കായാന്തരിത ശിലയാണ് നയ്സ്. ഉന്നത മർദത്തിലും ഊഷ്മാവിലും ആഗ്നേയശിലകളും അവസാദശിലകളും കായാന്തരീകരണത്തിനു വിധേയമാകുന്നതിന്റെ ഫലമായാണ് നയ്സ് രൂപംകൊള്ളുന്നത്. ശില രൂപം പ്രാപിക്കുന്ന വേളയിൽ ഇരുണ്ടതും നിറം മങ്ങിയതുമായ ധാതുക്കൾ ക്രമീകരിക്കപ്പെടുന്നതിനാൽ ഈ ശിലകളിൽ പാളികൾ സാധാരണമാകുന്നു. പരന്നതും സൂചിപോലുള്ളതുമായ ധാതുക്കൾ സമാന്തരമായി ക്രമീകരിക്കപ്പെടുന്നതിന്റെ ഫലമായും ഇത്തരം പാളികൾ രൂപംകൊള്ളാം. ഷിസ്റ്റുപോലുള്ള പാളീകൃതസ്വഭാവം പ്രദർശിപ്പിക്കുന്ന ഇതര ശിലകളെപ്പോലെ നയ്സ് അതിന്റെ സ്തരവിന്യാസത്തിലൂടെ വളരെപ്പെട്ടെന്നു പൊട്ടിപ്പിളരുന്നില്ല."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D1%82%D0%BE%D1%82-%D0%BB%D0%B5-%D0%9A%D1%80%D0%B5%D0%BD%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Map_commune_FR_insee_code_32279.png","page_title":"Монтот-ле-Крено","context_page_description":"Монто́т-ле-Крено́ — коммуна во Франции, находится в регионе Юг — Пиренеи. Департамент — Жер. Входит в состав кантона Ош-Нор-Уэст. Округ коммуны — Ош.\\nКод INSEE коммуны — 32279."},{"page_url":"https://lt.wikipedia.org/wiki/Upyna_(%C5%A0ilal%C4%97)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/UpynosMokykla.jpg","page_title":"Upyna (Šilalė)","context_page_description":"Upyna – miestelis Šilalės rajone, 20 km į rytus nuo Šilalės ir 6 km į pietus nuo automagistralės A1 Vilnius–Kaunas–Klaipėda, prie Šunijos ir Upynalės upelių santakos. Seniūnijos ir seniūnaitijos centras. Stovi medinė Švč. Mergelės Marijos vardo bažnyčia, Upynos vidurinė mokykla, biblioteka, paštas, liaudies amatų muziejus. Už 2 km į šiaurę, Gudirvėse stūkso gamtos paminklas – Gudirvių akmuo, kur manoma buvo senoji Upynos gyvenvietė. Prie miestelio yra Upynos kaimas.\\nĮ pietus nuo Upynos yra Svystkalnio regykla, ji yra ant kalvos viršūnės 163,5 m aukštyje, virš apylinkių ši kalva iškilusi apie 50 metrų. Nuo šios regyklos geru oru azimutu 205° matyti už 20 kilometrų esantis Tauragės TV bokštas, o su žiūronais galima pamatyti net Tilžės kaminus, esančius už 50 kilometrų, azimutu 225°."},{"page_url":"https://fr.wikipedia.org/wiki/Miguel_%C3%81ngel_Vivas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Miguel_%C3%81ngel_Vivas_%2818110420632%29_%28cropped%29.jpg","page_title":"Miguel Ángel Vivas","context_page_description":"Miguel Ángel Vivas est un réalisateur et scénariste espagnol."},{"page_url":"https://fi.wikipedia.org/wiki/M%C3%BDkonoksen_arkeologinen_museo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Mykon_M_060338.jpg","page_title":"Mýkonoksen arkeologinen museo","context_page_description":"Mýkonoksen arkeologinen museo on arkeologinen museo Mýkonoksen kaupungissa Mýkonoksen saarella Kreikassa. Se esittelee Mýkonokselta ja sen lähialueilta tehtyjä pääosin antiikin aikaisia löytöjä.\\nMuseo on perustettu ja rakennettu vuonna 1902 tuolloin vasta hieman aiemmin vuonna 1898 tehtyjä Ríneian saaren löytöjä varten. Museota laajennettiin vuonna 1972. Museorakennus sijaitsee Mýkonoksen kaupungin keskustan pohjoispuolella lähellä merenrantaa."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Boner","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/A_Wallack_Woman%2C_Transylvania_1865.jpg","page_title":"Charles Boner","context_page_description":"Charles Boner was an English travel writer, poet and translator."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%BC%E3%82%AC%E3%82%B9%E3%83%88%E3%83%BB%E3%83%99%E3%83%AB%E3%83%A2%E3%83%B3%E3%83%882%E4%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/August_Belmont_II_on_May_6%2C_1915.jpg","page_title":"オーガスト・ベルモント2世","context_page_description":"オーガスト・ベルモント2世は、アメリカ合衆国の金融業者、競走馬のオーナーブリーダー。 黎明期のニューヨーク市地下鉄の建設に資金を供給し、その運営会社であるインターボロー・ラピッド・トランジットを長年保有していた。\\nそれ以外にもルイビル・アンド・ナッシュビル鉄道の理事長を務め、また同鉄道の親会社であるサザン・パシフィック鉄道、およびナショナルパーク銀行の取締役も務めた。また、1914年にマサチューセッツ州に作られたケープコッド運河の建設にも資金を提供している。\\nサラブレッド競走馬のオーナーブリーダーとしても著名で、ベルモントパーク競馬場の創設者でもある。"},{"page_url":"https://uk.wikipedia.org/wiki/Peugeot_3008","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Peugeot_3008_BlueHDi_180_EAT8_GT_%28II%29_%E2%80%93_Frontansicht_%281%29%2C_25._November_2018%2C_D%C3%BCsseldorf.jpg","page_title":"Peugeot 3008","context_page_description":"Peugeot 3008 - кросовер, що випускається під маркою Пежо."},{"page_url":"https://ca.wikipedia.org/wiki/Isetta","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Isetta-iso.jpg","page_title":"Isetta","context_page_description":"L'Isetta va ser un dels microcotxes amb més èxit dels que es van produir al període de post guerra, quan les necessitats de transport a curta distància presentaven moltes mancances. Tot i que va ser dissenyat a Itàlia, aquest cotxet es va produir a diferents països sota llicència, incloent-hi Espanya, Bèlgica, França, Brasil, Alemanya i el Regne Unit. La seua forma d'ou o bombolla va fer que rebés distints noms simpàtics allà on es comercialitzava. Al Brasil se'l coneixia com a \\"la pilota de futbol dels camions\\", a Xile com al huevito o a Gran Bretanya com a bubble car, denominació que després es va estendre a vehicles de característiques semblants.\\nL'originalitat i la senzillesa defineixen les característiques tècniques de l'Isetta, a mig camí entre una motocicleta i un cotxe. El motor era un bicilíndric de dos temps i 236 cc que transmetia la força a l'eix posterior mitjançant una cadena. La via posterior era considerablement més estreta que l'anterior per tal que pogués funcionar sense diferencial. La refrigeració era per aire forçat i la potència estava al voltant dels 10CV. El pes total estava per sota dels 330 kg i la velocitat màxima fregava els 80 km/h."},{"page_url":"https://cs.wikipedia.org/wiki/Hybe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Centrum_Quo_vadis_-_Hybe.jpg","page_title":"Hybe","context_page_description":"Hybe jsou obec na Slovensku v okrese Liptovský Mikuláš. V roce 2016 zde žilo 1 485 obyvatel. První písemná zmínka o obci pochází z roku 1239."},{"page_url":"https://lt.wikipedia.org/wiki/Lapi%C5%B3_%C5%A0v._Kry%C5%BEiaus_parapija","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Lapy_-_Kosciol_p.w._Swietego_Krzyza.jpg","page_title":"Lapių Šv. Kryžiaus parapija","context_page_description":"Lapių Šv. Kryžiaus parapija - parapija įkurta 1985 m. gruodžio 1 dieną. Parapija priklauso Lomžos vyskupijai, Lapių dekanatui. Mūrinė Lapių Šv. Kryžiaus bažnyčia pastatyta 1983-1989 metais."},{"page_url":"https://nl.wikipedia.org/wiki/Rafa%C3%ABl_(kunstenaar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/MadonnaDiFoligno.jpg","page_title":"Rafaël (kunstenaar)","context_page_description":"Rafaël was een Italiaanse kunstschilder en architect uit de hoogrenaissance. Naast fresco's, altaarstukken en portretten heeft hij ontwerpen gemaakt voor kerken, palazzo's en wandtapijten.\\nRafaël is de naam waaronder hij nu wereldwijd bekend is. Zijn echte naam naam was Raffaello Sanzio. Sanzio is een variant van Santi, de naam van zijn vader. Als hij zijn werk signeerde, deed hij dit vaak met raphael urbinas, de pseudo-Latijnse vorm van zijn bijnaam Raffaello da Urbino.\\nHij speelt een prominente rol in Le Vite, de beroemde verzameling kunstenaarsbiografieën geschreven door de 16e-eeuwse schilder en schrijver Giorgio Vasari."},{"page_url":"https://el.wikipedia.org/wiki/%CE%92%CF%81%CE%B1%CE%B2%CE%B5%CE%AF%CE%B1_%CF%84%CE%B7%CF%82_%CE%88%CE%BD%CF%89%CF%83%CE%B7%CF%82_%CE%9A%CF%81%CE%B9%CF%84%CE%B9%CE%BA%CF%8E%CE%BD_%CE%9A%CE%B9%CE%BD%CE%B7%CE%BC%CE%B1%CF%84%CE%BF%CE%B3%CF%81%CE%AC%CF%86%CE%BF%CF%85_%CF%84%CE%BF%CF%85_%CE%9B%CE%BF%CF%82_%CE%86%CE%BD%CF%84%CE%B6%CE%B5%CE%BB%CE%B5%CF%82_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/ChristophWaltz82AAMar10.jpg","page_title":"Βραβεία της Ένωσης Κριτικών Κινηματογράφου του Λος Άντζελες 2009","context_page_description":"Τα 35α Βραβεία της Ένωσης Κριτικών Κινηματογράφου του Λος Άντζελες, απονεμήθηκαν\\nγια να τιμήσουν την καλύτερη κινηματογραφική παραγωγή του 2009."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A9%D0%B8%D1%82%D0%BE%D0%BF%D0%BE%D0%B4%D1%96%D0%B1%D0%BD%D0%B0_%D0%B7%D0%B0%D0%BB%D0%BE%D0%B7%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Thyroid-histology.jpg","page_title":"Щитоподібна залоза","context_page_description":"Щитоподібна залоза — непарний орган ендокринної системи, що складається з двох часток, перешийка та рудиментарної пірамідної частки. Розташований на передній поверхні шиї, попереду трахеї, і є периферійним гіпофіз-залежним органом ендокринної системи, який регулює основний обмін і забезпечує кальцієвий гомеостаз крові.\\nУкраїнська назва щитоподібної залози є калькою її латинської назви — glandula thyroidea, яка буквально значить «залоза у формі щита-туреоса»."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B0%D0%BA%D0%BE%D1%82%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Sakotis2.jpg","page_title":"Шакотис","context_page_description":"Шакотис — традиционный литовский, польский и белорусский торт необычной формы из яичного теста, испечённый на открытом огне. Чаще свадебный. В переводе с литовского — «ветвистый». Занесён в Литовский национальный фонд кулинарного наследия.\\nТесто для шакотиса готовится с добавлением большого количества яиц — от 30 до 50 штук на 1 килограмм муки. Выпекают торт на деревянном вертеле, который по мере запекания обмакивают в тесто или поливают им, поворачивая над открытым огнём. Стекая, тесто принимает форму многочисленных «веточек»."},{"page_url":"https://fr.wikipedia.org/wiki/Triceratops","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Human-triceratops_size_comparison.svg","page_title":"Triceratops","context_page_description":"Triceratops est un genre éteint célèbre de dinosaures herbivores de la famille des cératopsidés qui a vécu à la fin du Maastrichtien, au Crétacé supérieur, il y a 68 à 66 millions d'années, dans ce qui est maintenant l'Amérique du Nord.\\nIl a été l'un des derniers dinosaures non-aviens vivant avant leur disparition lors de la grande extinction Crétacé-Tertiaire, il y a 66 Ma.\\nAyant une grande collerette osseuse, trois cornes et quatre grandes pattes, et montrant des similitudes avec le rhinocéros, le tricératops est l'un des dinosaures le plus reconnaissable et le genre le plus connu des cératopsidés. Il a notamment vécu à la même période que le redoutable tyrannosaure dont il était la proie."},{"page_url":"https://sv.wikipedia.org/wiki/Katarina_av_Brandenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Brandenburgikatalin.jpg","page_title":"Katarina av Brandenburg","context_page_description":"Katarina av Brandenburg, tyska: Katharina von Brandenburg, ungerska: Katalin Brandenburgi, född 28 maj 1602 i Königsberg, hertigdömet Preussen, död 27 augusti 1644 i Schöningen, var prinsessa av Brandenburg och regerande furstinna av Transsylvanien 1629-1630."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Aschaffenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/AB_Herstallstra%C3%9Fe_3.jpg","page_title":"Liste der Baudenkmäler in Aschaffenburg","context_page_description":"Auf dieser Seite sind die Baudenkmäler der bayerischen kreisfreien Stadt Aschaffenburg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 1. August 2018 wieder und enthält 397 Baudenkmäler. Die vorigen Stände enthielten: 10. Januar 2018: 395 Baudenkmäler, 8. September 2017: 395 Baudenkmäler, 6. September 2016: 395 Baudenkmäler, 24. November 2015: 396 Baudenkmäler."},{"page_url":"https://en.wikipedia.org/wiki/Fine_Gael","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Michael_Noonan.jpg","page_title":"Fine Gael","context_page_description":"Fine Gael is a liberal-conservative political party in Ireland. Fine Gael is currently the third-largest party in Ireland in terms of members of Dáil Éireann and largest in terms of Irish members of the European Parliament. The party had a membership of 21,000 in 2017. Leo Varadkar succeeded Enda Kenny as party leader on 2 June 2017 and as Taoiseach on 14 June; Kenny had been leader since 2002, and Taoiseach since 2011.\\nFine Gael was founded on 8 September 1933 following the merger of its parent party Cumann na nGaedheal, the National Centre Party and the National Guard. Its origins lie in the struggle for Irish independence and the pro-Treaty side in the Irish Civil War and Michael Collins, in particular, is often identified as the founder of the movement.\\nFine Gael is generally considered to be more of a proponent of market liberalism than its traditional rival, Fianna Fáil. Apart from brief minority governments, Fine Gael has rarely governed Ireland without a coalition that also included the Labour Party, a social-democratic, centre-left party."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Pine_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Bethlehem_Lutheran_Church_Askov_1.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Pine County","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Pine County in Minnesota führt alle Bauwerke und historischen Stätten im Pine County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://es.wikipedia.org/wiki/USS_Constitution","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Announcement_of_launch_of_USS_Constitution.png","page_title":"USS Constitution","context_page_description":"El USS Constitution es una de las primeras fragatas de la Armada de los Estados Unidos que fue botada en 1797; recibió su nombre del mismo Presidente George Washington que la nombró de esta forma en honor a la Constitución de los Estados Unidos de América. Construida con el casco de madera y un aparejo con tres mástiles es, actualmente, ​el navío más antiguo que aún se encuentra en activo y a flote en todo el mundo​ El USS Constitution es una de las primeras seis fragatas de la Armada de los Estados Unidos, construidas gracias a la Ley Naval de 1794. Estas fragatas fueron diseñadas por Joshua Humphreys quien las diseñó para ser los navíos principales de la joven Armada de los Estados Unidos. Por este motivo, el Constitution y los otros fueron diseñados y construidos más grandes, más fuertes y mejor armados que el resto de las fragatas de la época.\\nFue construida en Boston, Massachusetts en los Astilleros de Edmund Hartt. Inicialmente fue asignada para brindar protección a los barcos mercantes de los Estados Unidos durante la Cuasi-Guerra con Francia, y luchar contra los Piratas berberiscos durante la Guerra de Trípoli."},{"page_url":"https://it.wikipedia.org/wiki/Generi_di_Staphylinidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Pella_glooscapi_%28dorsal_view%29.jpg","page_title":"Generi di Staphylinidae","context_page_description":"La famiglia Staphylinidae è fra le più vaste ed articolate dell'ordine Coleoptera. Di seguito se ne riporta la suddivisione fino al livello di sottogenere, elaborata dagli entomologi Alfred F. Newton e Margaret Thayer, aggiornata ai generi scoperti nel 2005, e condivisa dalla maggior parte degli studiosi del settore; dove necessario, sono presenti le integrazioni e le variazioni apportate a livello di tribù e supertribù dal cospicuo lavoro Family-group names in Coleoptera di Pierre Bouchard et al., del 2011.\\nNel 2009 un lavoro di Valery Grebennikov e Newton su basi filogenetiche riportò nell'alveo delle Staphylinidae la ex-famiglia di coleotteri Scydmaenidae, nel rango di sottofamiglia, con il nome di Scydmaeninae. Solo i generi e i sottogeneri sono scritti in corsivo. Per la tribù Oxypodini è tuttora molto incerta l'attribuzione dei generi alle sottotribù."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%B7%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Ardannes_2.png","page_title":"Корзе","context_page_description":"Корзе́ — муніципалітет у Франції, у регіоні Пеї-де-ла-Луар, департамент Мен і Луара. Населення — 1680 осіб.\\nМуніципалітет розташований на відстані близько 250 км на південний захід від Парижа, 100 км на північний схід від Нанта, 16 км на північний схід від Анже."},{"page_url":"https://simple.wikipedia.org/wiki/New_Lanark","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/NewlanarkNL07.jpg","page_title":"New Lanark","context_page_description":"New Lanark is the UNESCO World Heritage Site in the South Lanarkshire, Scotland."},{"page_url":"https://it.wikipedia.org/wiki/Scorching_Ping_Pong_Girls","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Shakunetsu_no_Takky%C5%AB_Musume_logo.png","page_title":"Scorching Ping Pong Girls","context_page_description":"Scorching Ping Pong Girls è un manga scritto e disegnato da Yagura Asano, pubblicato da Shūeisha dal 19 dicembre 2013. Un adattamento anime, prodotto da Kinema Citrus e sottotitolato in italiano da Crunchyroll, è stato trasmesso in Giappone tra il 3 ottobre e il 19 dicembre 2016."},{"page_url":"https://ro.wikipedia.org/wiki/Peter_Rosegger","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Rosegger-geburtshaus.JPG","page_title":"Peter Rosegger","context_page_description":"Peter Rosegger a fost un scriitor și poet austriac din Krieglach. El a fost un fiu al unui fermier montan și a crescut în pădurile și munții din Alpl. Rosegger a devenit cel mai prolific poet, precum și un profesor și vizionar profund.\\nÎn ultimii săi ani de viață a fost onorat de către conducătorii diverselor instituții și universități din Austria și din orașul Graz. El a fost nominalizat de trei ori la Premiul Nobel pentru Literatură. A fost foarte aproape să devină laureat al Premiului Nobel în 1913 și este considerat în prezent ca o comoară națională."},{"page_url":"https://nl.wikipedia.org/wiki/Fibre_optic_gyrokompas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/ClosedLoop.PNG","page_title":"Fibre optic gyrokompas","context_page_description":"Een fibre optic gyrokompas is een kompas dat de faseverschuiving van twee tegen elkaar in roterende lichtstralen meet in een draaiende spoel van glasvezel, gebruik makend van het Sagnac-effect. Het is een toepassing van een interferometer. Het wordt een gyrokompas genoemd, maar is dit feitelijk niet, aangezien het geen gebruik maakt van gyrotollen."},{"page_url":"https://en.wikipedia.org/wiki/History_of_the_Far_North_of_Scotland_Railway_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Welcome_to_Thurso_-_geograph.org.uk_-_623862.jpg","page_title":"History of the Far North of Scotland Railway Line","context_page_description":"The Far North Line was built in several stages through sparsely populated and undulating terrain. Extending to 161 miles, it runs north from Inverness to Wick and Thurso in Caithness, and currently carries a regular passenger train service.\\nIt was completed in 1874, running round the western margin of the firths north of Inverness and then keeping to the coast as far as Helmsdale. From that point it turns inland through Forsinard, returning to the far north-east coast at Wick and Thurso.\\nSome intermediate stations were closed in 1960 but despite the construction of major road bridges across the firths significantly shortening the route by road, the line has seen some revival at the southern end due to housing development, and it has a secure future. The original through route of 1874 remains in use."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%DB%8C%D8%AA%D8%B1_%D8%B2%D9%88%D9%85%D8%AA%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Peter_Zumthor.jpg","page_title":"پیتر زومتور","context_page_description":"پیتر زومتور معمار مینیمالیست سوئیسی و برندهٔ جایزه پریتزکر سال ۲۰۰۹ است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D1%87%D0%B5%D1%80%D0%BD%D1%8F%D1%8F_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Vmlogo2012.png","page_title":"Вечерняя Москва","context_page_description":"«Вече́рняя Москва́» — ежедневная вечерняя столичная газета. Выходит пять дней в неделю, кроме субботы и воскресенья. Газета издается с 1923 года. В 2011 году проект был перезапущен и развивается при поддержке Правительства Москвы как городская газета."},{"page_url":"https://ga.wikipedia.org/wiki/Caol_%C3%8Dle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Sound_of_Islay_-_geograph.org.uk_-_1476457.jpg","page_title":"Caol Íle","context_page_description":"Is sunda ar an Íle, Earra-Gháidheal agus Bód, é Caol Íle."},{"page_url":"https://hu.wikipedia.org/wiki/Sierra_de_la_Macarena_Nemzeti_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/CA%C3%91O_CRISTALES%2C_CA%C3%91%C3%93N_EN_EL_SECTOR_LOS_OCHOS.jpg","page_title":"Sierra de la Macarena Nemzeti Park","context_page_description":"A Sierra de la Macarena Nemzeti Park Kolumbia első, 1948-ban kijelölt természetvédelmi területe a Meta megyében, a Kristály-folyó környékén."},{"page_url":"https://fr.wikipedia.org/wiki/Charles_Maurin","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Charles_maurin.jpg","page_title":"Charles Maurin","context_page_description":"Charles Maurin, né Jean Baptiste Joseph Antonin Charles Maurin le 1ᵉʳ avril 1856 au Puy-en-Velay et mort le 18 juin 1914 à Grasse, est un peintre et graveur libertaire français."},{"page_url":"https://eu.wikipedia.org/wiki/Guadalcanalgo_Kanpaina","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/TulagiGavutuLandings.gif","page_title":"Guadalcanalgo Kanpaina","context_page_description":"Guadalcanalgo Kanpaina Bigarren Mundu Gerrako gatazka luzea izan zen, 1942ko abuztuaren 7tik 1943ko otsailaren 9ra gertatua, Ozeano Bareko Guadalcanal uhartean eta haren inguruan. Aliatuen lehenbiziko ofentsiba nagusia izan zen Japoniar Inperioaren aurka.\\nAbuztuaren 7an, Ozeano Bareko Tulagi, Gavutu, Tanambogo eta Guadalcanal uharteetan lehorreratu ziren estatubatuarrak, Bigarren Mundu Gerrako aliatuen lehorreko lehenengo kontraerasoan. Hasiera batean, operazioaren helburua Gaudalcanalen japoniarrek eraikitzen ari ziren aireportua hartzea zen, hortik Australiara eta Zeelanda Berrira AEBetatik zihoazen ontziei eraso ahal zieten eta. Operazioa azkar prestatu zuten eta aliatuek ez zeukaten informazio zehatzik uharte hauei buruz. Behin aireportua eta Guadalcanal segurtatuta, aliatuek Rabaulgo japoniar basea menderatu nahi zuten, handik iparralderantz jotzeko.\\nHurrengo hilabeteetan, japoniarrak eta estatubatuarrak borrokatu ziren Guadalcanalen inuguruetako itsasoak kontrolatzeko. Alde biek galera handiak izan zituzten bai itsasoan, bai lehorrean."},{"page_url":"https://en.wikipedia.org/wiki/Ken_Livingstone","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/RedKenCarSticker.jpg","page_title":"Ken Livingstone","context_page_description":"Kenneth Robert Livingstone is an English politician who served as the Leader of the Greater London Council from 1981 until the council was abolished in 1986, and as Mayor of London from the creation of the office in 2000 until 2008. He also served as the Member of Parliament for Brent East from 1987 to 2001. A former member of the Labour Party, he was on the party's hard left, ideologically identifying as a democratic socialist.\\nBorn in Lambeth, South London, to a working-class family, Livingstone joined Labour in 1968 and was elected to represent Norwood at the GLC in 1973, Hackney North and Stoke Newington in 1977, and Paddington in 1981. That year, Labour representatives on the GLC elected him as the council's leader. Attempting to reduce London Underground fares, his plans were challenged in court and declared unlawful; more successful were his schemes to benefit women and several minority groups, despite stiff opposition. The mainstream media gave him the moniker \\"Red Ken\\" in reference to his socialist beliefs and heavily criticised him for supporting controversial issues like republicanism, LGBT rights, and a United Ireland."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E4%B8%AD%E6%96%87%E5%A4%A7%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/%E5%A4%A7%E5%A4%8F%E5%A4%A7%E5%AD%A6%E6%A0%A1%E5%BE%BD.jpg","page_title":"香港中文大學","context_page_description":"香港中文大學，簡稱中文大學、中大、港中文，是一所香港公立大學，也是香港第一所研究型大學，於1963年合併新亞書院、崇基學院及聯合書院而成立，其中的組成書院最早源於1845年在清朝中葉成立的基督教教會大學，為香港歷史源流最久遠的高等學院。香港中文大學現已發展成為轄九大書院的書院制大學。\\n該校既是香港的天災監測中心，亦是該地社會科學、國學、工商管理、理學及醫學的主要研究機構。截止2018年10月，香港中文大學的校友、教授及研究人員中，共有5位獲得諾貝爾獎、1位獲得菲爾茲獎、1位獲得圖靈獎，其他獎項包括沃爾夫數學獎、勒諾多文學獎和克魯格人文與社會科學終身成就獎得主以及包括嶺南大學、香港大學等在內的等高校的校長，是唯一具有獲得國際頂級獎項的校友以及諾貝爾獎、菲爾茲獎、圖靈獎及奧斯瓦爾德·維布倫幾何學獎得主專任任教的香港高校。香港教育歷來產生的諾貝爾獎等級的學者中，三分之二是中大的校友、教授。 香港中文大學本科畢業生獲得羅德獎學金的數目為香港最高，也是歷代神童出現最多的本地大學。"},{"page_url":"https://azb.wikipedia.org/wiki/%D9%BE%DB%8C%D8%AA%DB%8C%D9%84%DB%8C%D8%A7%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Pitigliano_z16.jpg","page_title":"پیتیلیانو","context_page_description":"پیتیلیانو ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۳۸۶۷ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۳۱۳ متر یۇکسک‏لیکده یئر آلیب. و توسکانی اوستانیندا یئرلشیب."},{"page_url":"https://en.wikipedia.org/wiki/Bernd_Richter","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Bernhard_Richter.jpg","page_title":"Bernd Richter","context_page_description":"Bernhard \\"Bernd\\" Richter is a German politician and retired Oberstudienrat.\\nFrom 1993 until 1995 Richter was the leader of the ödp, or Ecological Democratic Party.\\nBorn in Prague, he currently lives in the Black Forest town Schramberg."},{"page_url":"https://en.wikipedia.org/wiki/BR-293","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Rs-183_shield.png","page_title":"BR-293","context_page_description":"A BR-293 is an east-west highway in the state of Rio Grande do Sul, Brazil.\\nThe highway connects Pelotas to Quaraí, crossing important cities in the southern tip of Brazil such as Bagé and Santana do Livramento. The highway measures 535.7 km."},{"page_url":"https://ru.wikipedia.org/wiki/Crassadoma_gigantea","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Crassedoma_giganteum_1.jpg","page_title":"Crassadoma gigantea","context_page_description":"Crassadoma gigantea — вид двустворчатых моллюсков, населяющий тихоокеанское побережье Северной Америки от Британской Колумбии до Мексики.\\nПравой створкой мантии моллюск прикрепляется к твёрдому субстрату. Она деформируется согласно рельефа основания. Левая створка выпуклая, массивная, ребристая, коричневой окраски. Между створками проступает мантия розового цвета с малочисленными щупальцами, на кончиках которых находятся глаза. Длина раковины составляет 15—25 см.\\nОбитает на морском дне на глубине до 80 метров. Прикрепляется к подводным камням, кораллам, искусственным сооружениям."},{"page_url":"https://cs.wikipedia.org/wiki/Wengen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/5313_-_Wengen_-_Staubbachf%C3%A4lle_viewed_from_Wegneralpbahn.JPG","page_title":"Wengen","context_page_description":"Wengen je větší vesnice v kantonu Bern, která spadá pod obec Lauterbrunnen ve Švýcarsku. Místo má největší počet obyvatel z okolí i Lauterbrunnen samotného. Wengen leží v nadmořské výšce je 1 274 m n. m. na úpatí hor Eiger, Monch a Jungfrau, 400 m nad údolím Lauterbrunnen.\\nJe významným střediskem cestovního ruchu Jungfrauregionu, a je zapsána na seznamu světového kulturního dědictví UNESCO zároveň s Wengernalpbahn.\\nWengen nemá běžné silniční spojení s okolím a hlavním dopravním spojením je železnice Wengernalpbahn. Wengen má 1 300 stálých obyvatel, v hlavní zimní sezóně se však počet návštěvníků přesahuje 10 000, v letní sezóně přibližně 5 000."},{"page_url":"https://en.wikipedia.org/wiki/St._Olavsleden","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Alsen.StOlavsLeden.JPG","page_title":"St. Olavsleden","context_page_description":"St. Olavsleden, is a pilgrim's way between Selånger outside Sundsvall in Sweden and Nidaros Cathedral in Trondheim in Norway, commemorating Saint Olaf who was King of Norway from 1015 to 1028. St. Olavsleden was one of the Pilgrim's Routes. From the 1970s until 2012, it was called the Mittnordenleden.\\nToday St. Olavsleden stretches 564 km from the Bothnian sea in the east to the Atlantic ocean in the west through two countries and eleven municipalities.\\nThe trail is marked with the St. Olav symbol, which marks all the so-called St. Olav roads, leading towards Nidaros Cathedral. St. Olavsleden passes through the ancient cultural landscape, following as closely as possible the roads and paths that pilgrims of that time and other travelers wandered and rode. The first hundred kilometers the trail mostly follows Ljungan river, and in Jämtland the trail goes along the lakes Revsundssjön and Storsjön, and eventually Indalsälven river. St. Olavsleden crosses the Scandinavian mountains on the border between Sweden and Norway along Swedish county road 322 and in Norway goes through the agricultural landscape near the Trondheim fjord. St."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%88%D9%87%D8%A7%D9%86_%D8%B1%D8%A7%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Mohan_Raman.JPG","page_title":"موهان رامان","context_page_description":"موهان رامان هو ممثل هندي، ولد في 3 أبريل 1956."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%B3%D9%84%D8%A7%D9%84%D8%A7%D8%AA_%D8%A7%D9%84%D9%83%D9%84%D8%A7%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Grupp_3%2C_CESKYTERRIER%2C_DK_UCH_NO_JV-14_NO_UCH_NO_V-15_NORD_JV-14_NORD_UCH_SE_UCH_Sellandafjalls_Teo_%2824310213205%29.jpg","page_title":"قائمة سلالات الكلاب","context_page_description":"الكلب حيوان من الثدييات من فصيلة الكلبيات من اللواحم. دجن هذا الحيوان واستأنس قبل 14000 إلى 150000 سنة. عادة ما يتم وصف هذا الحيوان بالوفاء، ويطلق عليه لقب \\"أفضل صديق للإنسان\\" ذلك لمقدرته العالية على تذكر صاحبه ولو بعد انقطاع طويل عنه. توجد منه سلالات كثيرةٌ مختلفة الطباع والمهمات، منها: كلب الصيد وكلب الحقول وكلب الرعاة وكلب الحراسة والكلب البوليسي وكلب الراعى الالمانى وكلب جراي هاوند وكلب مرافقة المكفوفين وكلب الزلاقات؛ الذي يستعمل لجر العربات على الجليد إلى عصرنا هذا.\\nوسلالة الكلاب هي مجموعة من الكلاب ذات العلاقة الوثيقة ببعضها والمتماثلة بشكل واضح، وهي كلها نويع من فصيلة الكلاب، التي تملك صفات مميزة تجعلها مؤهلة لاحتفاظ البشر فيها.\\nيتم استخدام مصطلح سلالة الكلب أيضا للإشارة إلى السلالات الطبيعية، التي نشأت عبر الزمن استجابة لبيئة معينة التي شملت البشر، مع ضئيلة أو معدومة التربية الانتقائية من قبل البشر. وتوثيق هذه السلالات، يتم تحديدها من مظهرها وغالباً عن طريق أسلوب العمل.\\nعرف الإنسان تربية الكلاب وتهجينها منذ آلاف السنين، أحيانا عن طريق زواج من نفس خطوط الأجداد، بينما في أوقات أخرى عن طريق خلط الكلاب من خطوط مختلفة جدا. تستمر العملية اليوم، مما أدى إلى اتساع وتعدد في المظهر والحجم والسلوك والطباع.. \\"من تشيهواهوا إلى داين الضخم."},{"page_url":"https://ro.wikipedia.org/wiki/Fontaines,_Vend%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/%C3%89glise_Notre-Dame-de-la-Nativit%C3%A9_de_Fontaines.JPG","page_title":"Fontaines, Vendée","context_page_description":"Fontaines este o comună în departamentul Vendée, Franța. În 2009 avea o populație de 829 de locuitori."},{"page_url":"https://cs.wikipedia.org/wiki/Muzeum_du%C5%A1%C3%AD_z_o%C4%8Distce","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Rome_%2829312046%29.jpg","page_title":"Muzeum duší z očistce","context_page_description":"Museo delle anime del Purgatorio je muzeum v Římě, které se nachází na adrese Lungotevere Prati 12, v sakristii Chiesa del Sacro Cuore del Suffragio."},{"page_url":"https://sv.wikipedia.org/wiki/Stockholm%E2%80%93V%C3%A4ster%C3%A5s%E2%80%93Bergslagens_J%C3%A4rnv%C3%A4gar","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Ludvika_stationsomr%C3%A5de_2013c.jpg","page_title":"Stockholm–Västerås–Bergslagens Järnvägar","context_page_description":"Stockholm-Västerås-Bergslagens Järnvägar, SWB var ett enskilt järnvägsbolag som bildades år 1871 för att förverkliga de ej uppnådda önskemål om järnväg som fanns hos allmänna och enskilda intressen i Stockholm och Västmanland, efter att Nils Ericson lagt Västra Stambanan söder om sjön Mälaren. Efter initiala ekonomiska svårigheter, kom bolaget att bli ett av de större privata järnvägsbolagen med ett vidsträckt system. Bolaget förstatligades 1944 och uppgick året efter i Statens Järnvägar."},{"page_url":"https://es.wikipedia.org/wiki/Amherst_(Nueva_York)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Flag_of_Amherst%2C_New_York.svg","page_title":"Amherst (Nueva York)","context_page_description":"Amherst es un pueblo ubicado en el condado de Erie en el estado estadounidense de Nueva York.​ En el año 2000 tenía una población de 116 510 habitantes y una densidad poblacional de 840.9 personas por km²."},{"page_url":"https://tr.wikipedia.org/wiki/Salamandra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Salamandra_atra.jpg","page_title":"Salamandra","context_page_description":"Salamandra, Salamandridae familyasından, Güney Avrupa Kuzey Afrika ve Batı Asya'da yaşayan, 6 türü bulunan bir semender cinsi."},{"page_url":"https://sh.wikipedia.org/wiki/Dededo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Guam_map_Dededo.png","page_title":"Dededo","context_page_description":"Dededo je najmongoljudnije selo na američkoj teritoriji Guam. Prema procjenama američkog Biroa za popis stanovništva iz 2004. godine Dededo je imao 46.000 stanovnika. Selo je smješteno na koraljnom platou Sjevernog Guama."},{"page_url":"https://cs.wikipedia.org/wiki/Hrad_Svat%C3%A9ho_Ond%C5%99eje","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Castillo_de_San_Andr%C3%A9n_1895-1900.jpg","page_title":"Hrad Svatého Ondřeje","context_page_description":"Hrad Svatého Ondřeje je bývalá vojenská pevnost, která se nachází v osadě San Andrés v blízkosti města Santa Cruz de Tenerife. Tato válcová věž byla součástí systému opevnění, které mělo chránit ostrov Tenerife. Roku 1797 zaútočil na město Horatio Nelson, byl však odražen - i díky tomuto opevnění.\\nJe jednou z nejdůležitějších historických památek Tenerife. Současná pevnost byla vystavěna v roce 1706 na ruinách dřívější stavby. V roce 1894 způsobila povodeň dešťové vody kolaps části hradu, pevnost však již nebyla následně dostavěna."},{"page_url":"https://pt.wikipedia.org/wiki/Cyrtopodium_aliciae","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Cyrtopodium_aliciae_1.JPG","page_title":"Cyrtopodium aliciae","context_page_description":"Cyrtopodium aliciae é uma orquídea do gênero Cyrtopodium, de hábito rupícola ou terrestre, encontrada na parte setentrional da Serra do Espinhaço, provavelmente endêmica da Chapada Diamantina, a uma altitude de 900 metros.\\nPossui pseudobulbos grandes, avermelhados, fusiformes alongados com cerca de 25 centímetros. A inflorescência é paniculada, em média de 40 a 90 cm de altura, portando flores muito vistosas e graciosas, de coloração branca pintalgada de púrpura com labelo levemente amarelado, frequentemente confundida com o Cyrtopodium cipoense, entretanto esse se restringe as partes centrais e meridionais da Serra do Espinhaço.\\nCyrtopodium aliciae floresce entre junho e julho, inverno brasileiro."},{"page_url":"https://es.wikipedia.org/wiki/Sylvie_Courvoisier","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Sylvie_Courvoisier-1.jpg","page_title":"Sylvie Courvoisier","context_page_description":"Sylvie Courvoisier es una compositora, pianista y música improvisadora. Ha colaborado con artistas de la escena jazzística neoyorquina como John Zorn, Mark Feldman, Erik Friedlander, Susie Ibarra, entre otros."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%83%B3%E3%83%89%E3%83%BC%E3%83%AB%E3%83%BB%E3%83%91%E3%83%BC%E3%82%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Randall_Park_2015.jpg","page_title":"ランドール・パーク","context_page_description":"ランドール・パークは、アメリカ合衆国の俳優・コメディアンである。"},{"page_url":"https://it.wikipedia.org/wiki/Serrana","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Bandeira_Serrana.png","page_title":"Serrana","context_page_description":"Serrana è un comune del Brasile nello Stato di San Paolo, parte della mesoregione di Ribeirão Preto e della microregione omonima."},{"page_url":"https://en.wikipedia.org/wiki/Changbhakar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/KoreaKart.jpg","page_title":"Changbhakar","context_page_description":"Changbhakar State, also known as Chang Bhakar, was one of the princely states of British Empire in India in the Chhattisgarh States Agency. It included 117 villages and had an area of 2,330 square kilometres with a 1941 population of 21,266 people. Bharatpur was the capital of the princely state."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%97%E1%83%94%E1%83%97%E1%83%A0%E1%83%98%E1%83%AC%E1%83%A7%E1%83%90%E1%83%A0%E1%83%9D%E1%83%A1_%E1%83%9B%E1%83%A3%E1%83%9C%E1%83%98%E1%83%AA%E1%83%98%E1%83%9E%E1%83%90%E1%83%9A%E1%83%98%E1%83%A2%E1%83%94%E1%83%A2%E1%83%98%E1%83%A1_%E1%83%93%E1%83%A0%E1%83%9D%E1%83%A8%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Flag_of_Tetritskaro_Municipality.svg","page_title":"თეთრიწყაროს მუნიციპალიტეტის დროშა","context_page_description":"თეთრიწყაროს მუნიციპალიტეტის დროშა - თეთრიწყაროს მუნიციპალიტეტის სახელმწიფო სიმბოლო გერბთან ერთად. მიღებულია თეთრი წყაროს მუნიციპალიტეტის საკრებულოს მიერ."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%BB%CE%B9%CE%BD%CF%84_%CE%9C%CE%AC%CE%BD%CF%83%CE%B5%CE%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/ClintMansellAndSonusQuartet2009.jpg","page_title":"Κλιντ Μάνσελ","context_page_description":"Ο Κλίντον Ντάριλ \\"Κλιντ\\" Μάνσελ, είναι Άγγλος μουσικός, συνθέτης, και πρώην τραγουδιστής και κιθαρίστας του συγκροτήματος Pop Will Eat Itself.\\nΜετά τη διάλυση του συγκροτήματος το 1996, ο Μάνσελ ασχολήθηκε με την σύνθεση μουσικών θεμάτων για κινηματογραφικά έργα, κυρίως λόγω της φιλίας του με τον σκηνοθέτη Ντάρεν Αρονόφσκι, ο οποίος τον προσέλαβε για να γράψει το θέμα της πρώτης του ταινίας, π. Έγινε όμως κυρίως γνωστός από την σύνθεση του μουσικού θέματος της ταινίας του Αρονόφσκι Ρέκβιεμ για ένα όνειρο, με την εξαιρετικά δημοφιλή κύρια σύνθεσή του, \\"Lux AETERNA\\", το οποίο έκτοτε έχει χρησιμοποιηθεί σε πολλές διαφημίσεις και τρέιλερ ταινιών.\\nΗ σύνθεση του για την ταινία The Fountain ήταν υποψήφια για Χρυσή σφαίρα στην κατηγορία \\"Best Original Score - Motion Picture\\" το 2007."},{"page_url":"https://nds.wikipedia.org/wiki/Gothenborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Aerial_photograph_400D_2012_05_05_8382_DxO.jpg","page_title":"Gothenborg","context_page_description":"Gothenborg is en Dörp un Gemeen in’n Landkreis Stood in Neddersassen. De Gemeen hett 1.177 Inwahners."},{"page_url":"https://de.wikipedia.org/wiki/Jicarilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Chief_Garfield_-_Jicarilla%2C_1904.jpg","page_title":"Jicarilla","context_page_description":"Die Jicarilla, offiziell heute Jicarilla Apache Nation, sind eine Stammesgruppe der Apachen im Südwesten der Vereinigten Staaten und zählen kulturell – zusammen mit den Mescalero, Chiricahua, Lipan und Kiowa Apache – zu den Östlichen Apache.\\nHeute leben die ca. 3.403 Stammesmitglieder als federally recognized tribe im ca. 2.920 km² großen Jicarilla-Reservat nordwestlich von Santa Fe in New Mexico mit dem Verwaltungssitz in Dulce, wobei ihr traditionelles Stammesgebiet ursprünglich rund 200.000 km² umfasste."},{"page_url":"https://nl.wikipedia.org/wiki/Wouter_Jaspers","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Wouter-jaspers.jpg","page_title":"Wouter Jaspers","context_page_description":"Wouter Jaspers is een geluidskunstenaar woonachtig in Berlijn.\\nZijn werk bestaat vooral uit minimale soundscapes en drones waarvoor hij veelal experimenteert met effectapparatuur, gemodificeerde synthesizers en contactmicrofoons, waarbij analoge ruis en veldopnames ten grondslag liggen aan uiteenlopende melodische structuren. Jaspers - toen nog gestationeerd in Tilburg - speelde tussen 2007 en eind 2010 meer dan 400 keer over de hele wereld en was daarmee een van de meest toerende artiesten in de Nederlandse experimentele muziekscene.\\nDe in 2007 op Vatican Analog uitgebrachte cd Babi Yar, an exploration bevat een eerbetoon aan de slachtoffers van de massamoord in Babi Yar in Kiev, Oekraïne, in 1941. Op de cd Exhibition, uitgebracht in het voorjaar van 2008, vertaalt hij veldopnames die hij maakte in Oekraïne, India, Polen en Duitsland om naar nieuwe composities. Voor deze cd reisde hij onder andere af naar Theresienstadt en gebruikte hij opnames uit het radioactief besmette gebied rondom Tsjernobyl."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%93%D1%80%D0%B5%D0%B9%D1%81_%D0%9A%D1%83%D0%BB%D0%B8%D0%B4%D0%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Grace_Coolidge.png","page_title":"Грейс Кулидж","context_page_description":"Грейс Анна Гудхью Кулидж – Америка Құрама Штаттарының президенті Калвин Кулидждің әйелі және 1923-1929 жылдары аралығында АҚШ-тың Бірінші ханымы."},{"page_url":"https://es.wikipedia.org/wiki/Luis_Bol%C3%ADvar","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Luis_Bolivar.JPG","page_title":"Luis Bolívar","context_page_description":"Luis Bolívar Delgado conocido en el mundo taurino como Luis Bolívar es un matador de toros de nacionalidad colombiana, criado en Santiago de Cali, Valle del Cauca. Se le considera el sucesor natural de César Rincón, por ser el torero de mayor proyección en la tauromaquia colombiana después del retiro de Rincón, que es el colombiano que más triunfos ha cosechado en ese ámbito."},{"page_url":"https://fr.wikipedia.org/wiki/G%C3%A9ants_de_Mont-Prama","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Esempi_di_scultura_del_pozzo_sacro_Irru_di_Nulvi.jpg","page_title":"Géants de Mont-Prama","context_page_description":"Les géants de Mont-Prama sont des statues en grès remontant à la période de l'histoire sarde dite de la culture nuragique. Découverts en 1974 par un agriculteur dans l'ouest de la Sardaigne, les fragments des statues ont été exhumés dans la localité de Mont'e Prama, sur le territoire de la commune de Cabras, dans la péninsule du Sinis une région de la province d'Oristano en Italie. D'une hauteur de 2 mètres à 2,5 mètres, elles auraient été taillées au plus tôt vers le Xᵉ siècle av. J.-C., même si cette datation fait débat, en particulier du fait de l'imprécision des premières fouilles. Les circonstances de leur destruction ne sont pas éclaircies et sont parfois mises en relation avec la prise de contrôle de la Sardaigne par les Carthaginois.\\nQuatre campagnes de fouilles archéologiques, effectuées entre 1975 et 1979, sous la direction des archéologues Giovanni Lilliu et Enrico Atzeni, ont permis de mettre au jour plus de 5 000 fragments qui ont été entreposés pendant trente ans au musée archéologique national de Cagliari."},{"page_url":"https://es.wikipedia.org/wiki/Per%C3%ADodo_orbital","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/SolarSystem_Radii_and_Period.svg","page_title":"Período orbital","context_page_description":"El periodo orbital es el tiempo que le toma a un astro recorrer su órbita. Cuando se trata de objetos que orbitan alrededor del sol existen dos tipos:\\nEl periodo sideral es el tiempo que tarda el objeto en dar una vuelta completa alrededor del sol, tomando como punto de referencia una estrella fija. Se considera el auténtico período orbital del objeto y sería el que vería un observador inmóvil que no orbitara alrededor del sol.\\nEl periodo sinódico es el tiempo que tarda el objeto en volver a aparecer en el mismo punto del cielo respecto al sol, cuando se observa desde la Tierra. Este periodo tiene en cuenta que la Tierra, lugar desde el cual es observado el objeto, también orbita en torno al sol. Es, por tanto, el tiempo que transcurre entre dos conjunciones sucesivas con el sol, y es el período orbital aparente.\\nEl período sideral y el sinódico difieren ya que la Tierra, a su vez, da vueltas alrededor del Sol."},{"page_url":"https://en.wikipedia.org/wiki/GABRR2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/PBB_GE_GABRR2_208217_at_fs.png","page_title":"GABRR2","context_page_description":"Gamma-aminobutyric acid receptor subunit rho-2 is a protein that in humans is encoded by the GABRR2 gene.\\nGABA is the major inhibitory neurotransmitter in the mammalian brain where it acts at GABA receptors, which are ligand-gated chloride channels. GABRR2 is a member of the rho subunit family."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Modra","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Modra_church_of_St_Stephen_01.JPG","page_title":"Liste der denkmalgeschützten Objekte in Modra","context_page_description":"Die Liste der denkmalgeschützten Objekte in Modra enthält die 98 nach slowakischen Denkmalschutzvorschriften geschützten Objekte in der Gemeinde Modra im Okres Pezinok."},{"page_url":"https://tl.wikipedia.org/wiki/Palarong_Olimpiko_sa_Tag-init_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Rio_2016_Refugees_1033413-29072016-_dsc1069.jpg","page_title":"Palarong Olimpiko sa Tag-init 2016","context_page_description":"Ang Palarong Olimpiko sa Tag-init 2016, opisyal na kilala bilang Mga Laro ng XXXI Olimpiyada at karaniwang kinilala bilang Rio 2016, ay isang pandaigdigang palarong pampalakasan na ginanap mula 5 hanggang 21 Agosto 2016 sa Rio de Janeiro, Brazil, na may paunang mga kaganapan sa ilang palakasan simula sa ika-3 ng Agosto. Ang Rio ay inihayag bilang punong-abalang lungsod sa ika-121 na sesyon ng IOC sa Copenhagen, Denmark, noong 2 Oktubre 2009.\\nMahigit 11,000 mga atleta mula sa mga 205 Pambansang Lupong Olimpiko ang nakibahagi, kabilang ang mga unang kalahok mula sa Kosovo, South Sudan, at Refugee Olympic Team. May 306 na medalyang ginawad sa 28 pampalakasang Olimpiko na tampok sa palaro, kabilang ang rugby sevens at golf, na idinagdag sa programang Olimpiko noong 2009. Ang mga paligsahang ay ginanap sa 33 mga lugar sa punong-abalang lungsod city at sa limang magkakahiwalay na lugar sa mga lungsod ng Brazil na São Paulo, Belo Horizonte, Salvador, Brasília, at Manaus.\\nIto ang unang Palarong Olimpiko na ginanap sa Timog Amerika."},{"page_url":"https://de.wikipedia.org/wiki/Martin-Luther-King-Kirche_(Hamburg-Steilshoop)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Martin-Luther-King-Kirche_%28Hamburg-Steilshoop%29.Blick_von_Norden.5.31069.ajb.jpg","page_title":"Martin-Luther-King-Kirche (Hamburg-Steilshoop)","context_page_description":"Die evangelisch-lutherische Martin-Luther-King-Kirche in Hamburg-Steilshoop liegt unter der Adresse Gründgensstraße 28 an zentraler Stelle der den Stadtteil prägenden Großwohnsiedlung. Die gelegentlich zu lesende Behauptung, die „Steilshooper Gemeinde [sei] die einzige in Deutschland, die sich nach dem US-amerikanischen Baptistenpastor und Bürgerrechtler Martin Luther King benannt hat“, ist mindestens missverständlich, da es noch wenigstens drei weitere Kirchen in Deutschland gibt, die den gleichen Namen tragen."},{"page_url":"https://eo.wikipedia.org/wiki/Episkopa_bastono","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/DEU_Nordwestmecklenburg_COA.svg","page_title":"Episkopa bastono","context_page_description":"Episkopa bastono estas bastono kun helike-kurba fino, simbolante la Bonan Paŝtiston. Ĝi estas eklezia insigno de la episkopoj en la romkatolika, anglikana kaj kelkaj eŭropaj protestantaj eklezioj; ankaŭ tiu de abatoj kaj abatinoj. Ĝi estis en la malnovaj tempoj simbolo de la laika potenco. Ĝi estas poduktita el metalo aŭ skulptita ligno, ĝi estas ofte tre ornamita.\\nĜia antaŭulo estas plej verŝajne la irbastono aŭ hoka paŝtista bastono. Ĝi estas unuafoje menciita en 633, inter la dokumentoj de la Toleda koncilio kiel simbolon de la episkopa regpotenco. La kutimon transprenis la francaj episkopoj fine de la 8-a jarcento kaj tio disvastiĝis kun la kristanismo. La kapo de la bastono ormis latinan krucon, rondon aŭ tau-an krucon. La hodiaŭa forma konatas ekde la 13-a jarcento.\\nLa bastonoj de la ortodoksaj eklezioj finiĝas per tau-kruco aŭ du kontraŭrigardantaj serpentoj."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B4_%D0%BA%D0%B0%D0%BC%D0%BD%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Miniature_Rock_Garden_for_Home.jpg","page_title":"Сад камней","context_page_description":"Сад камней, также «сэкитэй» — культурно-эстетическое сооружение Японии, разновидность японского сада, появившаяся в период Муромати."},{"page_url":"https://vi.wikipedia.org/wiki/Crataegus_mexicana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/%C3%81rbol_de_Tejocote_en_Cerro_Mesa_Ahumada.jpg","page_title":"Crataegus mexicana","context_page_description":"Crataegus mexicana là loài thực vật có hoa trong họ Hoa hồng. Loài này được Moc. & Sessé ex DC. mô tả khoa học đầu tiên năm 1825."},{"page_url":"https://fi.wikipedia.org/wiki/Selainsodat","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Usage_share_of_web_browsers_%28Source_StatCounter%29.svg","page_title":"Selainsodat","context_page_description":"Selainsodiksi sanotaan verkkoselainten aggressiivista kilpailua johtavasta markkina-asemasta. Sodan asteelle sen katsotaan kiihtyneen kahdesti: 1990-luvun lopussa Internet Explorer vastaan Netscape, ja vuodesta 2004 alkaen Internet Explorer vastaan Mozilla Firefox."},{"page_url":"https://fr.wikipedia.org/wiki/Velay_Express","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Autorail_Billard_A_150_D%2C_n%C2%B0_212_de_1938.png","page_title":"Velay Express","context_page_description":"Le Velay Express, précédemment appelé Voies ferrées du Velay, est un chemin de fer touristique et historique, situé sur les départements de la Haute-Loire et de l'Ardèche. Il est géré par l'association VFV, au statut loi de 1901, qui fait circuler des trains touristiques sur la ligne, à voie métrique, de Raucoules-Brossette à Saint-Agrève, section de l'ancien réseau du Vivarais, en Auvergne. La ligne était auparavant exploitée jusqu'à Dunières, mais cette dernière section a été fermée en 2015."},{"page_url":"https://it.wikipedia.org/wiki/Bassano_Romano","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Panorama_di_Bassano_Romano_2.JPG","page_title":"Bassano Romano","context_page_description":"Bassano Romano è un comune italiano di 4 761 abitanti della provincia di Viterbo nel Lazio. Dista circa 36 km dal capoluogo e 35 km dal GRA di Roma."},{"page_url":"https://hu.wikipedia.org/wiki/1566_az_irodalomban","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Louise_Lab%C3%A9_by_Pierre_Woeiriot.jpg","page_title":"1566 az irodalomban","context_page_description":"Az 1566. év az irodalomban."},{"page_url":"https://de.wikipedia.org/wiki/Holzbergwiesen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Holzberg.jpg","page_title":"Holzbergwiesen","context_page_description":"Die Holzbergwiesen sind ein ehemaliges Naturschutzgebiet in der niedersächsischen Stadt Stadtoldendorf und der Gemeinde Heinade in der Samtgemeinde Eschershausen-Stadtoldendorf im Landkreis Holzminden.\\nDas ehemalige Naturschutzgebiet mit dem Kennzeichen NSG HA 150 ist rund 375 Hektar groß. Es ist nahezu vollständig Bestandteil des FFH-Gebietes „Holzberg bei Stadtoldendorf, Heukenberg“ und des EU-Vogelschutzgebietes „Sollingvorland“. Das Gebiet stand seit dem 16. Mai 1991 unter Naturschutz. Zum 20. Dezember 2018 ging es im Naturschutzgebiet „Holzberg, Denkiehäuser Wald, Heukenberg“ auf. Zuständige untere Naturschutzbehörde war der Landkreis Holzminden.\\nDas ehemalige Naturschutzgebiet liegt südlich von Stadtoldendorf. Es erstreckt sich am Nord-, West- und Südwesthang des Holzberges. Nach Nordwesten wird es vom Eberbach begrenzt. Das Gebiet wird durch Mähweiden und Wiesen, vereinzelt auch Ackerflächen geprägt. In den Grünland­bereichen, die teilweise durch Hecken gegliedert sind, befinden sich zahlreiche Kleingewässer, vielfach in Verbindung mit Kalkquellsümpfen, die zu den seltensten Lebensraumtypen Niedersachsens gehören."},{"page_url":"https://en.wikipedia.org/wiki/Mompha_murtfeldtella","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Mompha_murtfeldtella_%2814275038083%29.jpg","page_title":"Mompha murtfeldtella","context_page_description":"Mompha murtfeldtella is a moth in the family Momphidae. It is found in North America, where it has been recorded from Alabama,\\nCalifornia, Florida, Illinois, Indiana, Kansas, Kentucky, Maine, Maryland, Minnesota, Mississippi, North Carolina, Ohio, Oklahoma, Tennessee, Texas and Wisconsin.\\nThe wingspan is about 10 millimetres. Adults are similar to Mompha circumscriptella, but the white patch on the posterior margin of the basal half of the forewing is much less extensive and the forewing ground color is less uniform. It consists of mottled greyish brown, rust and white, with small dashes of black.\\nThe larvae feed on the reproductive tissue of Oenothera species."},{"page_url":"https://en.wikipedia.org/wiki/University_Bridge_(Saskatoon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/South_Saskatchewan_River.jpg","page_title":"University Bridge (Saskatoon)","context_page_description":"University Bridge spans the South Saskatchewan River between Clarence Avenue and College Drive on the east shore with 25th Street on the west in Saskatoon, Saskatchewan Canada. The bridge is also known as the 25th Street Bridge and is a major commuter route between the two halves of Saskatoon. Between its opening in 1916 and the opening of the Circle Drive Bridge in 1983, it was the northernmost vehicular river crossing in the city. It is named for the fact that it provides access to the University of Saskatchewan.\\nThe University Bridge was originally planned to be of steel truss construction, much like the Traffic Bridge. Instead, a new design was used and Saskatoon saw the start of its first reinforced concrete arch bridge in 1913. Unfortunately the original contractor, R.J. Lecky, badly underbid on the tender, had problems with its concrete, and faced conflict of interest charges. One pier of the bridge had to be rebuilt and, due to the impact of the First World War on the global economy, the company went bankrupt and the provincial government had to finish building the bridge itself. When completed in 1916 it was the longest bridge of its kind in Canada."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Hunderdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Schloss_Au_vorm_Wald.JPG","page_title":"Liste der Baudenkmäler in Hunderdorf","context_page_description":"Auf dieser Seite sind die Baudenkmäler der niederbayerischen Gemeinde Hunderdorf zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%97%E0%A5%8B%E0%A4%B2%E0%A4%BE%E0%A4%B8%E0%A4%BF%E0%A4%A8%E0%A5%80_%E0%A4%AD%E0%A4%BE%E0%A4%B0%E0%A4%A6%E0%A5%8D%E0%A4%B5%E0%A4%BE%E0%A4%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/AlaudaArvensisIUCNver2019_1.png","page_title":"गोलासिनी भारद्वाज","context_page_description":"गोलासिनी भारद्वाज नेपालमा पाइने भारद्वाज प्रजातिको चरा हो। यो प्रजाति युरोपदेखि एसिया हुँदै न्युजिल्यान्ड, अस्ट्रेलिया तथा हवाइयन टापूसम्म पाइने गर्छ। यसको लम्बाई १८ देखि १९ सेन्टिमिटर हुन्छ।"},{"page_url":"https://de.wikipedia.org/wiki/Ostritz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Kirche_ostritz.jpg","page_title":"Ostritz","context_page_description":"Ostritz ist eine sächsische Landstadt im Landkreis Görlitz in der Oberlausitz. Ostritz liegt im äußeren Osten Sachsens am westlichen Neißeufer, direkt an der Grenze zur polnischen Stadt- und Landgemeinde Bogatynia."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D8%B4%D9%8A%D8%AF_%D9%85%D8%A7%D9%87%D8%A7%D8%B2%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Mahazi_Victory_Training_May_2015.jpg","page_title":"رشيد ماهازى","context_page_description":"رشيد ماهازى لاعب كورة قدم من اوستراليا."},{"page_url":"https://fi.wikipedia.org/wiki/Jenna_Ushkowitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Jenna_Ushkowitz_Skidmore_2011_crop.jpg","page_title":"Jenna Ushkowitz","context_page_description":"Jenna Noelle Ushkowitz on korealaissyntyinen yhdysvaltalainen näyttelijä, laulaja, tuottaja ja podcast-juontaja. Hänet tunnetaan parhaiten Tina Cohen-Changin roolista televisiosarjassa Glee."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A9%D1%83%D0%BC%D1%81%D0%BA%D0%B8_%D0%BE%D0%BA%D1%80%D1%8A%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Szymon_Juda_ST.jpg","page_title":"Щумски окръг","context_page_description":"Щумски окръг е окръг в Северна Полша, Поморско войводство. Заема площ от 730,74 км². Административен център е град Щум."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AC%E3%83%AD%E3%83%BB%E3%82%A4%E3%82%BF%E3%83%AA%E3%82%A2%E8%AA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Linguistic_map_of_Italy.png","page_title":"ガロ・イタリア語","context_page_description":"ガロ・イタリア語は、インド・ヨーロッパ語族イタリック語派に属する方言・地方言語。イタリア語の方言とする立場からは北イタリア語と呼称され、異なる存在だと考える勢力からはパダーナ語、チザルピナ語とも呼ばれる。\\nイタリア北部の他にも、スイス南部、サンマリノ、モナコなどでも使われている。\\n別称が示す通りイタリア北部で用いられていることから、中央集権・民族主義の立場を取るイタリアの右翼は標準イタリア語の北部方言と考えている。逆に左派勢力を中心に地方分権を主張する勢力からは異なる言語とされる。後者はファシズムなどに代表されるイタリア民族主義によってその独自性が弾圧されていたと主張するが、彼らの間でもガロ・イタリア語に属する方言を更に別言語とするのか、それともガロ・イタリア語内で標準語の制定などの中央集権化を進めるのかで意見が割れている。"},{"page_url":"https://en.wikipedia.org/wiki/Bez_(dancer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Bez_at_Gulfest_2011.jpg","page_title":"Bez (dancer)","context_page_description":"Mark Berry, better known as Bez, is an English percussionist, dancer, and media personality. He is best known as a member of the rock bands Happy Mondays and Black Grape."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%DB%8C%D8%B3%D9%83%D9%86%D8%AF%D8%B1%D9%8A%D9%87_%D8%B3%D8%A7%D9%88%D8%A7%D8%B4%DB%8C_(%DB%B1%DB%B8%DB%B0%DB%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/View_of_the_French_fortified_heights_to_the_eastward_of_Alexandria.png","page_title":"ایسكندريه ساواشی (۱۸۰۱)","context_page_description":"ایسكندريه ساواشی (۱۸۰۱) بریتانیا ایمپیراتورلوغو و فرانسه قوشونو آراسیندا باش وئرن دؤیوش.ایسکندریه و میصر یئرینده اوز وئرمیش‌دیر"},{"page_url":"https://en.wikipedia.org/wiki/List_of_National_Basketball_Association_annual_three-point_field_goals_leaders","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Stephen_Curry_dribbling_2016_%28cropped%29.jpg","page_title":"List of National Basketball Association annual three-point field goals leaders","context_page_description":"In basketball, a three-point field goal is a field goal made from beyond the three-point line, a designated arc radiating from the basket. A successful attempt is worth three points, in contrast to the two points awarded for shots made inside the three-point line. The National Basketball Association's three-point shooting leader is the player who recorded the most three-point field goals in a given season. The statistic was first recognized in the 1979–80 season when the three-point line was first implemented that season."},{"page_url":"https://en.wikipedia.org/wiki/Montmartre,_Saskatchewan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Exhibition_at_the_Mini_Museum.jpg","page_title":"Montmartre, Saskatchewan","context_page_description":"Montmartre is a village in the Canadian province of Saskatchewan within the Rural Municipality of Montmartre No. 126 and Census Division No. 6. It is 91 km east of the City of Regina on Highway 48.\\nIt is located in the provincial electoral district of Moosomin and the federal electoral district Wascana."},{"page_url":"https://en.wikipedia.org/wiki/Irakli_Logua","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Logua-Irakliy.jpg","page_title":"Irakli Logua","context_page_description":"Irakli Genovich Logua is a Russian professional football player of Abkhaz ethnicity who plays for Forte Taganrog."},{"page_url":"https://sh.wikipedia.org/wiki/Saimaa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Hietasaari%2C_Lake_Saimaa.JPG","page_title":"Saimaa","context_page_description":"Saimaa je najveće finsko jezero koje leži na jugoistoku zemlje."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AA%E3%83%81%E3%83%A3%E3%83%BC%E3%83%89%E3%83%BB%E3%83%89%E3%83%BC%E3%83%B3%E3%83%96%E3%83%83%E3%82%B7%E3%83%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Grand_Prix_Final_2010_Richard_DORNBUSH.jpg","page_title":"リチャード・ドーンブッシュ","context_page_description":"リチャード・ドーンブッシュは、アメリカ合衆国出身の男性フィギュアスケート選手。2010年JGPファイナル優勝、ISUジュニアグランプリ大会で優勝4回。"},{"page_url":"https://sv.wikipedia.org/wiki/Varanus_mertensi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Washington_DC_Zoo_-_Varanus_mertensi_1.jpg","page_title":"Varanus mertensi","context_page_description":"Varanus mertensi är en ödleart som beskrevs av Ludwig Glauert 1951. Varanus mertensi ingår i släktet Varanus och familjen Varanidae. Inga underarter finns listade i Catalogue of Life.\\nArten förekommer i delstaterna Northern Territory, Queensland och Western Australia i Australien. Honor lägger ägg."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CF%8D%CF%81%CE%B1%CF%83%CE%BF%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Tesalia.png","page_title":"Πύρασος","context_page_description":"Η Πύρασος ήταν σημαντική αρχαία πόλη της Φθιώτιδας, του κράτους του Πρωτεσιλάου. Ο Όμηρος αναφέρει ότι εκεί υπήρχαν πολλά λουλούδια και ήταν το τέμενος της Δήμητρας και ότι ο Πρωτεσίλαος, γιος του Ιφίκλου, πήρε άνδρες από τη Φυλακή, τον ανθόσπαρτο Πύρασο, την Ίτωνα, την Ανδρώνα και τον Πτελεό και με 40 μαύρα καράβια έλαβε μέρος στον Τρωικό πόλεμο.\\nΑπό τις πόλεις που αναφέρει ο Όμηρος μόνο η Πύρασος έχει ταυτιστεί ακριβέστερα με τις ανασκαφικές έρευνες του αειμνήστου Δημητρίου Θεοχάρη.\\nΚατά τον Στράβωνα, ο οποίος μιλεί για την τοπογραφία της, το Δημήτριον ήταν ανατολικά του όρους Όθρυς και απείχε 20 σταδίους από τη νεότερή της πόλη Φθιώτιδες Θήβες:\\nΉν δε πόλις ευλίμενος η Πύρασος, εν δυσί σταδίοις έχουσα Δήμητρος άλσος και ιερόν άγιον, διέχουσα Θηβών σταδίους είκοσι. Υπέρκεινται δε Πυράσου μεν αι Θήβαι, των Θηβών δε εν τη μεσογαία το Κρόκιον πεδίον προς τω καταλήγοντι της Όθρυος, δι’ ου ο Άμφρυσος ρει. Τούτου δ’ υπέρκειται ο Ίτωνος, όπου και το της Ιτωνίας ιερόν.\\nΚαι ο Σκύλαξ την αναφέρει ως Δημήτριον.\\nΣτην Πύρασο, υπήρχε το σπουδαίο ιερό της Δήμητρος, από το οποίο φαίνεται να είχε αποκτήσει μεγάλη φήμη η πόλη."},{"page_url":"https://fr.wikipedia.org/wiki/Records_NBA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Tim_duncan_zz.jpg","page_title":"Records NBA","context_page_description":"Cet article concentre la majeure partie des records de la National Basketball Association existants, homologués ou non."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%B3%E3%82%AC%E3%83%AB%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Joey_in_pouch.jpg","page_title":"カンガルー","context_page_description":"カンガルーは、有袋類双前歯目の一群である。\\nカンガルー科 に分類されるが、別の分類ではネズミカンガルー科 Potoridae をカンガルー科に統合し、カンガルー科をカンガルー亜科 Macropodinaeとネズミカンガルー亜科 Potorinae に分ける。\\nオーストラリア大陸、タスマニア島、ニューギニア島に生息している。大型のカンガルー、小型のワラビー、樹上性のキノボリカンガルーなどがいるが、同じカンガルー属 Macropus にオオカンガルーもアカクビワラビーも中間サイズのワラルーもおり、大型カンガルーとワラビーの区別は分類学的なものではない。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%A4%A7%E5%B7%9D%E5%91%A8%E6%98%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/OKAWA_Shumei.jpg","page_title":"大川周明","context_page_description":"大川周明，出生于山形县酒田市，日本作家、思想家、极端民族主义者、大亚细亚主义者、印度教、回教学者。二次大战日本投降后，被东京军事法庭列为甲级战犯疑犯，后因罹患精神病，予以不起诉处分。"},{"page_url":"https://es.wikipedia.org/wiki/L%C3%ADnea_Granada-Fuente_de_Piedra","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Renfe_S599_Atarfe-Santa_Fe_01.jpg","page_title":"Línea Granada-Fuente de Piedra","context_page_description":"La línea Granada-Fuente de Piedra fue una línea de ferrocarril española, de 130,3 km de longitud, que discurría por las provincias andaluzas de Málaga y Granada.​ También fue conocida coliquialmente como la línea Bobadilla-Granada, ​ al ser Bobadilla la estación de donde originalmente partía la línea. Siguiendo la catalogación de Adif, era la línea «426».​\\nInaugurada en 1874​ como un ramal de la línea Córdoba-Málaga, con posterioridad pasó a manos de la Compañía de los Ferrocarriles Andaluces y de RENFE, llegando a estar en servicio durante un siglo y medio. La línea fue cerrada al tráfico en 2015 y parcialmente aprovechada para la adaptación de algunos tramos a la línea de alta velocidad Antequera-Granada. Como consecuencia de ello, quedó alterado el trazado de la línea original. Solo se han mantenido intactos los tramos Bif. Ríofrío-Fuente de Piedra y Bif. Tocón-Bif. La Chana, que se han convertido en las líneas 460 y 464 de Adif, respectivamente."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_rainhas_da_Germ%C3%A2nia_e_imperatrizes_do_Sacro_Imp%C3%A9rio_Romano-Germ%C3%A2nico","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Elisabeth_von_Bayern_%281227%E2%80%931273%29.jpg","page_title":"Lista de rainhas da Germânia e imperatrizes do Sacro Império Romano-Germânico","context_page_description":"Imperatriz do Sacro Império Romano é o título dado à consorte do imperador do Sacro Império Romano-Germânico. Uma vez que a dignidade eletiva de imperador era restrita a homens apenas, nunca houve uma imperatriz reinante, embora mulheres como Teofânia Escleraina ou Maria Teresa da Áustria, que dirigiram o governo, serviram como imperatrizes legítimas."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%83%D1%81%D1%82%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BC%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/%D0%93%D1%83%D1%81%D1%82%D0%B8%D0%BD%D1%8F_%D0%A2%D1%80%D0%B0%D0%BF%D0%B5%D0%B7%D0%BD%D0%B0_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B0..jpg","page_title":"Густинський монастир","context_page_description":"Густи́нський Свято-Троїцький монасти́р — жіночий монастир Української православної церкви Московського патріархату. Розташований у селі Густиня, на правому березі річки Удай біля міста Прилуки Чернігівської області."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A5%E1%83%90%E1%83%9A%E1%83%94%E1%83%91%E1%83%98_%E1%83%90%E1%83%A8%E1%83%A8-%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%94%E1%83%9C%E1%83%90%E1%83%A2%E1%83%A8%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Dianne_Feinstein%2C_official_Senate_photo_2.jpg","page_title":"ქალები აშშ-ის სენატში","context_page_description":"ამერიკის შეერთებული შტატების სენატის დაარსებიდან, 1789 წლიდან, დღემდე მის რიგებში მხოლოდ 56 ქალი წევრს მოითვლიან. პირველი ქალი აშშ-ის ისტორიაში, რომელმაც დაიკავა ადგილი სენატში გახდა რებეკა ლატიმერ ფელტონი ჯორჯიის შტატიდან. 1922 წელს გუბერნატორმა ტომას უილიამ ჰარდვიკმა 87 წლის ფელტონი დანიშნა სენატორად ჯორჯიის შტატიდან, გარდაცვლილი ტომას უოსტონის ნაცვლად. ფელტონი სენატორი გახდა 21 ნოემბერს და მისი უფლებამოსილება გაგრძელდა მხოლოდ ერთი დღე. თავის მხრივ, პირველ, დემოკრატიულად არჩეული ქალი სენატორი გახდა ჰეთი კარაუეი არკანზასის შტატიდან. 1932 წლის აშშ-ის სენატის არჩევნებზე მან დამაჯერებელ გამარჯვებას მიაღწია, მიიღო ამომრჩეველთა 31 133 ხმა, ანუ საერთო რაოდენობის 91,62 %. 1938 წელს მან გაიმეორა თავისი წარმატება, მიიღო 122 883 ხმა ანუ 89,58 % და აირჩიეს მეორე ვადით.\\nსენატში მოხვედრილი 56 ქალიდან 36 დემოკრატიული პარტიის წარმომადგენელია, ხოლო 20 — რესპუბლიკური პარტიის."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B5%D1%80%D0%BB%D0%B8%D0%BD%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/12-01-20-yog-674.jpg","page_title":"Керлинг","context_page_description":"Керлинг или карлинг је зимски олимпијски спорт тек од Нагана 1998, иако се слична игра јавља на сликама из 1565. године, фламанског сликара Питера Бројгела Старијег. У програму Зимских олимпијских игара керлинг се појавио још на првим ЗОИ 1924. године у Шамонију у Француској, након чега је направљена пауза све до 1992. године када је, поново у Француској био демонстрациони спорт на ЗОИ у Абервилу, да би 1998. у Нагану у Јапану, керлинг постао пуноправан зимски олимпијски спорт.\\nБројне су теорије о настанку керлинга у којем две четворочлане екипе настоје да уз помоћ четки и метли сместе по осам камених кугли што ближе средишту куће house означене круговима на леденој површини. Водећи први баца своја два камена према средишту куће, други и трећи играч зову се једноставно second и third, док последњи баца skiper који је уједно и капитен екипе.\\nКерлинг је шкотски национални спорт који се проширио на Канаду, САД, Шведску, Швајцарску, Норвешку, Данску, Немачку и Француску, стоји у напису клизеће камење седам деценија чекало је олимпијско признање.\\nНазив игре настао је према звуку баченог камења – the roaring game."},{"page_url":"https://eo.wikipedia.org/wiki/Alytus","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Map_Alytus.png","page_title":"Alytus","context_page_description":"Alytus estas urbo en la sudo de Litovio. De la jaro 1995 ĝis la 1-a de julio 2010 ĝi estis la administra centro de samnoma distrikto. Dum la jaro 2002, la urbo havis 70 000 loĝantojn."},{"page_url":"https://it.wikipedia.org/wiki/Boris_Bernaskoni","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Boris_Bernaskoni_EM_KA-01.jpg","page_title":"Boris Bernaskoni","context_page_description":"Boris Bernaskoni è un architetto, ingegnere e editore russo.\\nDestinatario di vari premi di architettura e partecipante a varie mostre di architettura. È il fondatore dell'ufficio BERNASKONI. Boris Bernaskoni è membro fondatore del Consiglio Urbano presso il Centro di innovazione di Skolkovo a Mosca. Boris Bernaskoni ha ottenuto il riconoscimento internazionale nel 2008 quando ha vinto un concorso internazionale per il Perm Museum of Modern Art che è stato giurato da Peter Zumthor e ha avuto partecipanti come Coop Himmelbau, Zaha Hadid e Asymptote. Il suo progetto Matrex ha ricevuto grandi consensi alla 15ª Biennale di Architettura di Venezia nel 2016. Nel 2019 Bernaskoni ha partecipato a numerosi eventi al Forum economico mondiale di Davos, tra cui un discorso sull'architettura trasformabile nelle città del futuro al Meeting per gli investimenti sulle tecnologie emergenti del forum e una discussione sulla digitalizzazione urbana presso la Russia House."},{"page_url":"https://de.wikipedia.org/wiki/1st_Armoured_Division_(Vereinigtes_K%C3%B6nigreich)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/1st_Armoured_Division_%28UK%29.png","page_title":"1st Armoured Division (Vereinigtes Königreich)","context_page_description":"Die 1st Armoured Division war eine Panzerdivision der British Army. Sie wurde erstmals im Zweiten Weltkrieg aufgestellt und war von 1976 bis 2015 als Teil der britischen Streitkräfte in Deutschland stationiert. Im Juli 2014 wurde der Verband in 1st Division bzw. 1st Division (Vereinigtes Königreich) umbenannt."},{"page_url":"https://vi.wikipedia.org/wiki/Parornix_anglicella","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Parornix_anglicella-M-Salzburg%2C_Adnet%2C_Waidach-E-MK-21233a.jpg","page_title":"Parornix anglicella","context_page_description":"Parornix anglicella là một loài loài bướm thuộc họ Gracillariidae. Loài này có ở khắp châu Âu bao gồm các nước Albania, Áo, Belarus, Bỉ, Bosnia và Herzegovina, Anh, Bulgaria, Corse, Cộng hòa Séc, Đan Mạch đại lục, Estonia, Phần Lan, Pháp đại lục, Đức, Hungary, Ireland, Ý đại lục, Latvia, Litva, Luxembourg, Macedonia, Na Uy đại lục, Ba Lan, Thổ Nhĩ Kỳ đại lục, România, Trung và Bắc Nga, Sardegna, Sicilia, Slovakia, Thụy Điển, Thụy Sĩ, Hà Lan, Ukraina và Nam Tư. Ngoài khu vực châu Âu, nó cũng có ở Cận Đông và khu vực sinh thái Bắc Mỹ.\\nSải cánh từ 9–11 mm. Cá thể trưởng thành mọc cánh trong hai thế hệ vào tháng tư và tháng năm và tiếp tục vào tháng sáu.\\nSâu bướm thường ăn các loài Crataegus, tuy nhiên chúng cũng ăn các loài Mespilus germanica, Sorbus aucuparia và Fragaria."},{"page_url":"https://en.wikipedia.org/wiki/Osamu_Dazai","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Osamu_Dazai.jpg","page_title":"Osamu Dazai","context_page_description":"Osamu Dazai was a Japanese author who is considered one of the foremost fiction writers of 20th-century Japan. A number of his most popular works, such as The Setting Sun and No Longer Human, are considered modern-day classics in Japan. With a semi-autobiographical style and transparency into his personal life, Dazai's stories have intrigued the minds of many readers.\\nHis influences include Ryūnosuke Akutagawa, Murasaki Shikibu and Fyodor Dostoyevsky. While Dazai continues to be widely celebrated in Japan, he remains relatively unknown elsewhere with only a handful of his works available in English. His last book, No Longer Human, is his most popular work outside of Japan."},{"page_url":"https://ca.wikipedia.org/wiki/Febre_del_cautx%C3%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/AnophelesGambiaemosquito.jpg","page_title":"Febre del cautxú","context_page_description":"La febre del cautxú va ser un període en el qual es va realitzar una extracció i comercialització massiva del cautxú a la regió amazònica entre 1879 i 1912.\\nLa transcendència econòmica i social en països amb territoris amazònics, com Brasil, Perú, Bolívia, Colòmbia i Equador van disparant el seu procés colonitzador, atraient riquesa i causant transformacions culturals i socials, a més de donar gran impuls a ciutats amazòniques com Iquitos al Perú, Belém al Brasil i en especial la ciutat brasilera de Manaus, fins avui la principal ciutat amazònica i capital de l'Estat d'Amazones."},{"page_url":"https://es.wikipedia.org/wiki/Is%C3%B3bol","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Escut_d%27Is%C3%B2vol.svg","page_title":"Isóbol","context_page_description":"Isóbol​ es un municipio español de la comarca de la Baja Cerdaña, en la provincia de Gerona, comunidad autónoma de Cataluña, situado en el centro de la comarca. Además de la capital municipal, comprende las poblaciones de All y Olopte."},{"page_url":"https://pnb.wikipedia.org/wiki/%D9%84%D8%B3%D9%B9_%D8%B4%DB%81%D8%B1_%D8%A8%D9%84%D8%AD%D8%A7%D8%B8_%D8%A2%D8%A8%D8%A7%D8%AF%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Kairo_001.jpg","page_title":"لسٹ شہر بلحاظ آبادی","context_page_description":"ایہ لسٹ شہر بلحاظ آبادی اے۔"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%83%D0%B3%D0%B5%D0%BD%D0%B4%D0%BE%D1%80%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Wappen_von_Rugendorf.png","page_title":"Ругендорф","context_page_description":"Ругендорф — коммуна в Германии, в земле Бавария.\\nПодчиняется административному округу Верхняя Франкония. Входит в состав района Кульмбах. Население составляет 1016 человек. Занимает площадь 17,32 км². Официальный код — 09 4 77 151.\\nКоммуна подразделяется на 7 сельских округов."},{"page_url":"https://simple.wikipedia.org/wiki/Hominin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Male_Bonobo_Lola_ya_Bonobo_2008.jpg","page_title":"Hominin","context_page_description":"Hominini is the tribe of Homininae that comprises humans, and all ancestors of Homo sapiens back to the split from the apes. This branching is now dated at five to eight million years ago, with Sahelanthropus as a key fossil.\\nA less frequent usage includes the two species present-day of the genus Pan. In this case, the subtribe Hominina is the \\"human\\" branch, including genus Homo and its close relatives, but not Pan. All species in this tribe carry the same four blood-types which can be exchanged between species."},{"page_url":"https://nn.wikipedia.org/wiki/Bar%C4%B1%C5%9F_Man%C3%A7o","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Manco_Kosk_Baris_Manco.jpg","page_title":"Barış Manço","context_page_description":"Mehmet Barış Manço, vart kjend som Barış Manço, òg skrive Baris Mancho på somme utgjevingar og fødd Tosun Yusuf Mehmet Barış Manço, var ein tyrkisk rockeartist, låtskrivar og fjernsynsprodusent. Han skreiv kring 200 songar, og somme har vorte omsette til andre språk, inkludert engelsk, fransk, japansk, gresk, italiensk, bulgarsk, rumensk, persisk, urdu og arabisk. Han er framleis ein av dei mest populære artistane i Tyrkia."},{"page_url":"https://it.wikipedia.org/wiki/La_Neuville-Roy","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/WikiEgliseLNR.JPG","page_title":"La Neuville-Roy","context_page_description":"La Neuville-Roy è un comune francese di 1.008 abitanti situato nel dipartimento dell'Oise della regione dell'Alta Francia.\\nIl comune si è chiamato Laneuvilleroy, fino al 26 agosto 2004."},{"page_url":"https://pt.wikipedia.org/wiki/Carboc%C3%A1tion_piramidal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/3MeO-3%2C5-diMe-tricyclo%282%2C1%2C0%2C02%2C5%29pentaan.jpg","page_title":"Carbocátion piramidal","context_page_description":"Um carbocátion piramidal é um tipo de carbocátion com uma configuração específica. Este íon existe como uma terceira classe, além dos íons clássicos e não clássicos. Nesses íons, um único átomo de carbono paira sobre um polígono de quatro ou cinco lados, formando uma pirâmide. O íon piramidal de quatro lados carrega uma carga de 1+ e o piramidal de cinco lados carrega 2+. Nas imagens, o ponto preto na linha vertical representa o átomo de carbono pairando.\\nO número aparente de coordenação de cinco, ou mesmo seis, associado ao átomo de carbono no topo da pirâmide é uma raridade em comparação com o máximo habitual de quatro."},{"page_url":"https://nl.wikipedia.org/wiki/Earle_Foxe","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/The_Honeymoon_%281917%29_-_1.jpg","page_title":"Earle Foxe","context_page_description":"Earle Foxe, was een Amerikaanse acteur. Zijn werkelijke naam was Earl Aldrich Fox.\\nFoxe trok als jongeman naar New York en werd daar een succesvol toneelspeler. In New York speelde hij in enkeles waarna hij in 1922 naar Los Angeles verhuisde en een contract bij Fox Corporation tekende.\\nTussen 1912 en 1946 speelde hij in 148 films."},{"page_url":"https://de.wikipedia.org/wiki/Liebfrauenkirche_(Sint-Niklaas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/OLVkerkbinnen1.jpg","page_title":"Liebfrauenkirche (Sint-Niklaas)","context_page_description":"Die Kirche Unsere Liebe Frau von der Hilfe der Christen ist eine im Stil des Historismus erbaute Kirche in der belgischen Stadt Sint-Niklaas. Die katholische dreischiffige Kreuzkirche wurde von dem Genter Stadtarchitekten Louis Roelandt zusammen mit seinem Schüler Louis Van Overstraeten entworfen, von 1841 bis 1844 erbaut und danach auf das Patrozinium Maria, Hilfe der Christen geweiht. Die Kirche ist in einem Mischstil erbaut. Es dominiert der neuromanisch-byzantinische Stil, der mit gotischen Elementen ergänzt wurde. Vollendet wurde die Kirche erst im Jahr 1896 durch die Errichtung einer sechs Meter hohen Marienstatue auf dem 50 m hohen Kirchturm.\\nVon außen dominiert das ziemlich nüchterne, graue Erscheinungsbild der aus in Gobertange gebrochenem Brabanter Kalkstein erbauten Kirche. Dazu in starkem Kontrast steht der polychrome Innenraum. Dieser wurde letztmals von 1994 bis 1998 restauriert und bildet mit der neobyzantinischen Architektur ein harmonisches Ganzes.\\nDie Liebfrauenkirche steht seit 1973 unter Denkmalschutz.\\nIm Jahr 2014 brütete erstmals ein Wanderfalkenpaar im Turm der Kirche. Leider hatten sie keinen Bruterfolg."},{"page_url":"https://fr.wikipedia.org/wiki/Jean-Antoine_Riqueti_de_Mirabeau","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Mahon_port.jpeg","page_title":"Jean-Antoine Riqueti de Mirabeau","context_page_description":"Jean-Antoine Riqueti de Mirabeau, frère cadet de Victor Riquetti de Mirabeau, oncle du tribun révolutionnaire Honoré-Gabriel Riqueti de Mirabeau, et de André Boniface Louis Riquetti de Mirabeau fut chevalier de l’ordre de Saint-Jean de Jérusalem, gouverneur de la Guadeloupe où il acquiert le titre de bailli."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%A4%A9%E6%B0%B4%E5%9C%8D%E7%AB%99_(%E8%A5%BF%E9%90%B5%E7%B6%AB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/MTR_TIS_%284%29.JPG","page_title":"天水圍站 (西鐵綫)","context_page_description":"天水圍站（粵拼：tin¹ seoi² wai⁴ zaam⁶；英文：Tin Shui Wai Station）係香港一個鐵路車站，響港鐵西鐵綫之上，個站連接輕鐵天水圍站。站響新界屏山北便，響天水圍市鎮南便，係元朗區西鐵四站之一。\\n天水圍站設1個島式月台。設有月台幕門。另外喺車站西面設有側線，畀車務調動用。"},{"page_url":"https://de.wikipedia.org/wiki/Heisterstock","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/N%C3%BCmbrecht-lage-heisterstock.png","page_title":"Heisterstock","context_page_description":"Heisterstock ist ein Ortsteil von Nümbrecht im Oberbergischen Kreis im südlichen Nordrhein-Westfalen innerhalb des Regierungsbezirks Köln."},{"page_url":"https://tr.wikipedia.org/wiki/Dairesel_grafik","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Disk_usage_%28Boabab%29.png","page_title":"Dairesel grafik","context_page_description":"Dairesel grafik, istatistik biliminde betimsel istatistik alanında kategorik verileri görsel bir şekilde betimleyip özetlemek için hazırlanan; içindeki kategori dilimlerini orantısal olarak gösteren bir daire şeklinde sunulan bir gösterim aracıdır.\\nBir daire şeklindeki dairesel grafik içinde bulunan her dilim bir kategoriyi gösterir ve bu dilimin büyüklüğü derece birimi ile o kategoride bulunan veri sayısının toplam veri sayısı oranına aynı oran ile orantılıdır. İlk defa gösterimi 1801'de İngiliz yazarı Playfair'in yayımladığı Statistical Breviary adlı bir kitapta olmuştur ve bu kitapta verilen iki dairesel grafikten birisi 1789'dan önce Osmanlı Devleti'nin değişik kitalarda olan arazilerinin coğrafî alanı verilerini özetlemektedir.\\nDairesel grafik işletme alanında ve kitle iletişim dünyasında en çok kullanılan istatistik aracı olduğu kabul edilmektedir. Fakat bu aletin temellerinin iyi bilinmeden kullanılması bazı istatistikçilerin büyük tenkitlerine yol açmıştır ve bazı istatistik otoriteleri bu veri gösterim aletinin, hatalı intibalara neden olacağı için, hiç kullanılmamasını tavsiye etmişlerdir. Bunlara göre dairesel grafik kullanılmasının şu dezavantajları bulunur:"},{"page_url":"https://hu.wikipedia.org/wiki/M%C3%A9cs_L%C3%A1szl%C3%B3_(k%C3%B6lt%C5%91)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Kir%C3%A1lyhelmec076.JPG","page_title":"Mécs László (költő)","context_page_description":"Mécs László – eredeti nevén Martoncsik József – magyar premontrei szerzetes, költő, lapszerkesztő."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BA%D0%B2%D0%B5%D0%B4%D1%83%D0%BA%D0%B8_%D0%94%D1%80%D0%B5%D0%B2%D0%BD%D0%B5%D0%B3%D0%BE_%D0%A0%D0%B8%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Archscrew2.jpg","page_title":"Акведуки Древнего Рима","context_page_description":"Акведуки Древнего Рима — гидротехнические сооружения\\nсозданные в Древнем Риме для задач управления водными ресурсами.\\nАкведук — в буквальном переводе «водопровод». Хотя в русскоязычной технике, под словом «акведук» обычно подразумевается мост, который служит не для проезда, а для пропуска воды, римские акведуки по большей части проходили в трубопроводах и тоннелях под землей.\\nВ русском языке слово водовод традиционно было калькой из латинского Aquaeductus.\\nДревние римляне строили акведуки по всей своей империи, чтобы доставлять воду в города, часто из отдаленных источников. Акведук снабжал водой общественные бани, туалеты, фонтаны и частные дома. Акведуки также обеспечивали водой шахты, мельницы, фермы и сады.\\nВ римских акведуках вода двигалась только под действием силы тяжести, обычно под очень низким уклоном в трубах из камня, кирпича или римского бетона. Иногда строили напорные акведуки с более крутым уклоном. Большинство трубопроводов были спрятаны под землей, следуя естественным препятствиям на местности; холмы и горы чаще обходили, реже пробивали туннель."},{"page_url":"https://ms.wikipedia.org/wiki/Bondi_Junction,_New_South_Wales","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/6_APARTMENTS_AND_COMMERCIAL_ARE_IN_BONDI_JUNCTION.jpg","page_title":"Bondi Junction, New South Wales","context_page_description":"Bondi Junction adalah subbandar timur Sydney, di negeri New South Wales, Australia. Ia terletak 6 kilometer di sebelah timur pusat perniagaan pusat Sydney dan merupakan sebahagian daripada kawasan pemerintahan tempatan Waverley.\\nBondi Junction adalah kawasan komersial yang telah mengalami banyak perubahan sejak akhir abad ke-20. Terdapat banyak pembangunan komersial dan kediaman utama di sekitar jalan utama dan kawasan sekitarnya, terutamanya persimpangan bas / rel dan pusat membeli-belah yang besar. Sebilangan besar pub asli telah dikelola, terutama Nelson Hotel, dinamakan demikian kerana lokasinya di Nelson Street.\\nPantai Bondi adalah subbandar yang berdekatan di sebelah timur dengan pantai yang terkenal di dunia. Bondi dan Bondi Utara juga merupakan pinggiran bandar yang berdekatan.\\nBondi Junction dan kawasan jirannya terkenal dengan pasukan liga ragbi yang terkenal, Sydney Roosters, yang masih dikenali secara rasmi sebagai Kelab Bola Sepak Liga Ragbi Daerah Suburbs Timur. Rumah kelab pasukan ini berpusat di Spring Street, Bondi Junction."},{"page_url":"https://en.wikipedia.org/wiki/William_Booth_(forger)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Booth%27s_Farm_farmhouse_-_2020-07-22_-_Andy_Mabbett_-_05.jpg","page_title":"William Booth (forger)","context_page_description":"William Booth was an English farmer and forger, who was hung for his crimes. He is the subject of the song \\"Twice Tried, Twice Hung, Twice Buried\\" by John Raven and a book. Several geographical features in Birmingham, near his former home, carry his name."},{"page_url":"https://nn.wikipedia.org/wiki/Ulan-Ude","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Odigitrievsky_Cathedral%2C_Ulan_Ude.jpg","page_title":"Ulan-Ude","context_page_description":"Ulan-Ude er hovudstaden i Republikken Burjatia i Russland. Han ligg rundt 4500 km aust for Moskva og 100 km søraust for Bajkalsjøen. I 2007 hadde byen om lag 340 000 innbyggjarar.\\nHan ligg ved foten av fjellkjedene Khamar-Daban og Ulan-Burgasy-fjella, like ved staden der elva Selenga renn saman med sideelva Uda som deler byen i to."},{"page_url":"https://hr.wikipedia.org/wiki/Audi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Audi_A4_B6_Kombi_front_20071115.jpg","page_title":"Audi","context_page_description":"Audi je njemački proizvođač automobila sa sjedištem u Ingolstadtu. Od 1964., Audi je marka unutar Volkswagen grupe.\\nAutomobili proizvođača Audi se proizvode u Ingolstadtu, Neckarsulmu, Győru, Bratislavi, Sao José dos Pinhais i u Changchunu.\\nAugust Horch, je 1899. osnovao marku Horch i počeo s proizvodnjom automobila, ali je u uskoro izbačen iz svoje kompanije pa je 1909. godine osnovao novu. Međutim, više nije imao pravo na korištenje svog obiteljskog imena pa je svoje prezime Horch preveo na latinski jezik. Riječ audi je imperativ od audire, što i znači „Čuj!“ ili na njemačkom „Horch!“."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%88%D8%AD_%D8%A8%D8%A7%D9%8A%D9%88%D9%86%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Pioneer_plaque_solar_system.svg","page_title":"لوح بايونير","context_page_description":"لوح بايونير هو زوج من الألواح الذهبية مطلى بأكسيد الألومنيوم وُضعت عام 1972 على مركبة بيونير 10 وبيونير 11, تحوي تصويرة في حال تقع المركبتين عند كائنات فضائية ذكية أخرى.\\nكانَت مركبتا بايونير أول التصاميم البشرية التي خرجت من المجموعة الشمسية. اللوح مثبت على هوائي بشكل يحميه من التعرض للغبار النجمي وذلك تجنبا للتلف الذي قد يحصل.\\nو كذلك تم وضع سجلات ذهبية على مركبة فوايجر عام 1977."},{"page_url":"https://en.wikipedia.org/wiki/Sridevi_filmography","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Sridevi.jpg","page_title":"Sridevi filmography","context_page_description":"Sridevi was an Indian film actress who worked in 300 films.\\nHer acting career started in South Indian Cinema at the age of 4, with the Tamil film Kandan Karunai. She then made her transition to adult roles by the age of 13 with Moondru Mudichu. Due to her immense popularity and pan Indian appeal, she was often cited as the first female superstar of Indian Cinema. Regarded as one of the finest actresses of Indian Cinema, Sridevi's performances in films in a variety of genres had earned her praise and awards. She took a sabbatical from film acting in 1997. During her career, she won six Filmfare Awards: three for Hindi films, two for Tamil films and one for Telugu films. Her comeback was with English Vinglish in 2012. After English Vinglish she worked in Tamil film Puli in 2015 and Hindi film Mom in 2017. She received the National Film Award for Best Actress for Mom. Sridevi's last role was a cameo appearance in Zero in 2018."},{"page_url":"https://sv.wikipedia.org/wiki/Pak_Hon-yong","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Pak_Hon-yong.jpg","page_title":"Pak Hon-yong","context_page_description":"Pak Hon-yong, född 28 maj 1900 i Yesan, avrättad i december 1956 i Pyongyang, var en koreansk kommunistisk politiker.\\nUnder det japanska koloniala styret av Korea grundade han Koreas kommunistiska parti 1925, men partiet upplöstes av de japanska myndigheterna och Pak sattes i fängelse i tre år. När han släpptes fri 1928 begav han sig till Sovjetunionen där han stannade tills 1933 då han for till Shanghai. Pak arresterades dock av japanerna i Shanghai och satt sedan i fängelse fram till 1939. Under andra världskriget levde Pak ett stilla liv för att undvika fler fängelsevistelser.\\nEfter krigsslutet framträdde Pak åter i politiken och i september 1945 återupplivade han det koreanska kommunistpartiet i Seoul och blev dess ordförande. Pak ådrog sig dock den amerikanska ockupationsmaktens misstänksamhet och 1946 flydde han till den sovjetkontrollerade norra delen av Korea för att undvika arrest. När Demokratiska folkrepubliken Korea grundades 1948 blev han utnämnd till vice premiärminister och utrikesminister och följande år blev han utsedd till vice ordförande i Koreas arbetarparti."},{"page_url":"https://de.wikipedia.org/wiki/F%C3%A4r%C3%B6er","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Fulmar.Mallemuk.jpg","page_title":"Färöer","context_page_description":"Die Färöer, umgangssprachlich oft Färöer-Inseln, sind eine zu Dänemark gehörende Gruppe aus 18 Inseln mit autonomer Verwaltung. Sie liegen im Nordatlantik zwischen den Britischen Inseln, Norwegen und Island. Entdeckt und besiedelt wurden sie im Mittelalter. Heute sind mit Ausnahme der kleinsten, Lítla Dímun, alle permanent bewohnt.\\nDie gut 50.000 Inselbewohner – die Färinger, auch Färöer genannt – betrachten sich nicht als Dänen, sondern als eigenständiges Volk, das von den Wikingern auf den Färöern abstammt. Sie sprechen die färöische Sprache, die aus dem Altwestnordischen entstanden ist und mit dem Isländischen und dem Norwegischen verwandt ist.\\nNach dem Vertrag von Fámjin aus dem Jahr 2005 bilden die Färinger, wie auch die Grönländer, eine „gleichberechtigte Nation“ innerhalb des Königreichs Dänemark. Ihre Inseln genießen bereits seit 1948 eine weitgehende Autonomie und haben mit dem Løgting eines der ältesten Parlamente der Welt. Es entsendet regelmäßig zwei Abgeordnete ins dänische Folketing und ist mit zwei Delegierten im Nordischen Rat vertreten.\\nDie Färöer sind anders als das Kernland Dänemarks nicht Teil der Europäischen Union und gehören gemäß Art."},{"page_url":"https://uz.wikipedia.org/wiki/Insoniyat_tarixidagi_100_eng_nufuzli_shaxs","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Aesop_pushkin01.jpg","page_title":"Insoniyat tarixidagi 100 eng nufuzli shaxs","context_page_description":"100 nafar eng buyuk tarixiy shaxs — Michael H. Hartning 1978-yil chiqarilgan va 1992-yilda qayta nashr qilingan kitobi. Ushbu kitobda tarixiy shaxslarning qisqacha biografiyalari keltirilgan. Ushbu roʻyxatda insoniyat riojlanishidagi 100 nafar eng taʼsirli shaxslarning reytingi eʼlon qilingan. Shuningdek, 100 talik roʻyxatga kirmagan 87 kishining reytingi ham bor."},{"page_url":"https://de.wikipedia.org/wiki/Schamfilen","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Takelage_tausendfuessler_gorch_fock.jpg","page_title":"Schamfilen","context_page_description":"Schamfilen oder Schamfilung bezeichnet ein unerwünschtes Scheuern von Tauwerk, Segeln oder anderen Ausrüstungsgegenständen, das zu vorzeitiger Abnutzung führt."},{"page_url":"https://de.wikipedia.org/wiki/Oberleitungsbus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Most_Milo%C5%A1e_S%C3%BDkory2.jpg","page_title":"Oberleitungsbus","context_page_description":"Ein Oberleitungsbus – auch Oberleitungsomnibus, Obus, O-Bus, Trolleybus, Trolley oder veraltet gleislose Bahn genannt – ist ein elektrisches Verkehrsmittel beziehungsweise Verkehrssystem im öffentlichen Personennahverkehr. Er ist wie ein im Stadtbusverkehr eingesetzter Stadtlinienbus aufgebaut, wird im Gegensatz zu diesem aber nicht von einem Verbrennungsmotor, sondern von einem oder mehreren Elektromotoren angetrieben. Seinen Fahrstrom bezieht er – ähnlich einer Straßenbahn – mittels Stromabnehmern aus einer über der Fahrbahn gespannten Oberleitung, die jedoch stets zweipolig ausgeführt ist. Oberleitungsbusse sind somit spurgebunden, aber nicht spurgeführt. Die Bezeichnung Oberleitungsbus wird dabei sowohl für das Fahrzeug selbst als auch für die dazugehörige Infrastruktur verwendet.\\nDie ersten Anlagen wurden zu Beginn des 20. Jahrhunderts eröffnet, weltweit existierten Anfang des Jahres 2020 insgesamt 275 Oberleitungsbus-Betriebe in 47 Staaten. Sie sind überwiegend in Mittelosteuropa, den Nachfolgestaaten der Sowjetunion, der Volksrepublik China, Nordkorea, Italien und der Schweiz anzutreffen und werden in der Liste der Oberleitungsbussysteme aufgeführt."},{"page_url":"https://nl.wikipedia.org/wiki/Capitignano","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Ponte_Aquila_Capitignano.jpg","page_title":"Capitignano","context_page_description":"Capitignano is een gemeente in de Italiaanse provincie L'Aquila en telt 680 inwoners. De oppervlakte bedraagt 30,6 km², de bevolkingsdichtheid is 23 inwoners per km²."},{"page_url":"https://fr.wikipedia.org/wiki/Arrelles","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Arrelles_Church.JPG","page_title":"Arrelles","context_page_description":"Arrelles est une commune française, située dans le département de l'Aube en région Grand Est."},{"page_url":"https://en.wikipedia.org/wiki/May_1933","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Flag_of_the_Fatherland_Front_of_Austria.svg","page_title":"May 1933","context_page_description":"The following events occurred in May 1933:"},{"page_url":"https://sv.wikipedia.org/wiki/Engelskt_fullblod","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Horse-racing-4.jpg","page_title":"Engelskt fullblod","context_page_description":"Det engelska fullblodet är en hästras som härstammar från England under 1600- och 1700-talet och som helt framavlats av människan. Det engelska fullblodet har sitt ursprung i tre orientaliska hingstar vid namn Darley Arabian, Godolphin Arabian och Byerley Turk, samt även i mycket små, men även mycket snabba Gallowayponnyer som numera är utdöda. Målet har hela tiden varit att få fram en så snabb häst som möjligt och idag räknas det engelska fullblodet som världens snabbaste hästras, vilket även gjort att rasen idag huvudsakligen avlas till galopphästar och används inom galoppsporten.\\nEngelska fullblod är en fullblodstyp som ibland kan vara något heta att rida men de är mycket atletiska och kraftfulla hästar och används även som ridhästar och tävlas på hög nivå inom ridsportens alla discipliner, samt används för att avla fram sporthästar. Engelska fullblod blir ofta mellan 155 och 165 cm i mankhöjd och de är oftast bruna, fuxar, svarta eller skimmelfärgade, då främst gråskimmel men även vitskimmel förekommer. Fullbloden är mycket muskulösa och har en proportionerlig exteriör."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%BE_%D1%81%D0%B5%D0%BB%D0%BE_(%D0%BE%D0%B1%D1%89%D0%B8%D0%BD%D0%B0_%D0%A1%D1%83%D1%80%D0%B4%D1%83%D0%BB%D0%B8%D1%86%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/%D0%9D%D0%BE%D0%B2%D0%BE_%D0%A1%D0%B5%D0%BB%D0%BE_%28%D0%A1%D1%83%D1%80%D0%B4%D1%83%D0%BB%D0%B8%D1%86%D0%B0%29_-_Novo_Selo_%28Surdulica%29.jpg","page_title":"Ново село (община Сурдулица)","context_page_description":"Ново село е село в община Сурдулица, Пчински окръг, Сърбия. Според преброяването от 2011 г. населението му е 30 жители."},{"page_url":"https://en.wikipedia.org/wiki/2010_United_States_House_of_Representatives_elections_in_California","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/CA-1st.png","page_title":"2010 United States House of Representatives elections in California","context_page_description":"The United States House of Representatives elections in California, 2010 were held on November 2, 2010 to determine who would represent California's various congressional districts in the United States House of Representatives. In the 112th Congress, California has 53 seats in the House, apportioned accordingly after the 2000 United States Census. Representatives were elected to two-year terms; those elected serve in the 112th Congress from January 3, 2011 to January 3, 2013.\\nAccording to CQ Politics, the districts considered the most competitive are the 3rd and 11th, with the 44th, 45th, and 47th as less than safe as well.The Cook Report includes the 18th and 20th.\\nTwo districts elected new Representatives that year. Republican George Radanovich of the 19th district was succeeded by Republican Jeff Denham, and Democrat Diane Watson of the 33rd district was succeeded by Democrat Karen Bass. The partisan balance of the state's congressional delegation did not change."},{"page_url":"https://en.wikipedia.org/wiki/Sergeant_(Sweden_and_Finland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/OR-5_Sergeant_FL_hylsa02.jpg","page_title":"Sergeant (Sweden and Finland)","context_page_description":"Sergeant is a Swedish and Finnish military rank above Överfurir in Sweden and Alikersantti in Finland; and below Översergeant in Sweden and Ylikersantti in Finland."},{"page_url":"https://hu.wikipedia.org/wiki/B%C3%BCkkaljai_k%C5%91kult%C3%BAra","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/13_1_A_Sz%C3%A1zrejtek%C5%B1_Andornakt%C3%A1lya_hat%C3%A1r%C3%A1ban.jpg","page_title":"Bükkaljai kőkultúra","context_page_description":"A Bükkalja kőzettani felépítésének köszönhetően, elsősorban az állékony, de jól faragható vulkáni kőzetekhez, a riolit- és a dácittufához kötődően e tájegység településein jelentős hagyománya van a kő megmunkálásának, a kő népi alkalmazásának. Az építőkő fejtése és a népi építészetben történő felhasználása, a kőfaragás és a kőzetbe vésett, mélyített helyiségek készítése a Kárpát-medencében itt nyúlik vissza a legrégebbi időkig. Az ún. bükkaljai kőkultúra legősibb rétegét a kaptárkövek képviselik."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%98%87%E5%B1%8B%E9%82%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/So_Uk_Shopping_Centre_Level_1_201911.jpg","page_title":"蘇屋邨","context_page_description":"蘇屋邨是香港重建後的公共屋邨，位於九龍長沙灣尖山南面，是香港房屋委員會歷史最悠久的公共屋邨之一。蘇屋邨是房委會前身香港屋宇建設委員會繼北角邨及西環邨後策劃建設的第三個屋邨，當時獲譽為遠東規模最大的地區性住宅計劃。\\n蘇屋邨於2006年開始計劃分兩期重建，於2009年10月22日封閉第一期，2011年完成清拆，2016年9月第1期首6幢樓宇重建完成入伙；至2012年年中全邨遷出，於同年11月26日起封閉待清拆，全邨正式進行重建。重建計劃共分2期進行，共有14幢住宅大廈，項目是由房屋署總建築師進行總體設計，細部設計則以外判服務合約方式判給了周林建築師有限公司作詳細設計，全邨均由瑞安建業有限公司承建，而大廈以非標準型設計，結構外型分別為6幢長型、4幢L型、3幢T型及1幢相連I型大廈；住宅單位則採用構件式單位設計，主要提供1/2人，2/3人，1睡房及2睡房出租公屋單位。單位室內面積由14.1至38 m²不等。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B7%B4%E5%BA%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Baku_Montage.jpg","page_title":"巴库","context_page_description":"巴庫是亞塞拜然的首都、經濟文化中心。巴庫同時也是裏海最大港口，外高加索最大城市。它的海拔是低於海平面28公尺，使它成為世界上海拔最低的首都以及低於海平面的最大城市。面積2192平方公里，人口300萬。巴庫全市分為內城和新城兩部分。\\n在2007年，伊斯蘭會議組織文化部長宣布巴庫為2009年伊斯蘭文化中心。為2015年第一屆歐洲運動會主辦國。巴庫曾先後申辦2016年夏季奧運會和2020年夏季奧運會，但皆因基礎設施不完備沒有入圍。不過由於亞塞拜然歌手艾爾與妮基在2011年歐洲歌唱大賽獲得冠軍，終使巴庫獲得舉辦2012年歐洲歌唱大賽的機會。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0_%D1%81%D0%BA%D1%83%D0%BF%D1%88%D1%82%D0%B8%D0%BD%D0%B0_%D0%A1%D1%80%D0%B1%D0%B0,_%D0%91%D1%83%D1%9A%D0%B5%D0%B2%D0%B0%D1%86%D0%B0_%D0%B8_%D0%BE%D1%81%D1%82%D0%B0%D0%BB%D0%B8%D1%85_%D0%A1%D0%BB%D0%BE%D0%B2%D0%B5%D0%BD%D0%B0_%D1%83_%D0%91%D0%B0%D0%BD%D0%B0%D1%82%D1%83,_%D0%91%D0%B0%D1%87%D0%BA%D0%BE%D1%98_%D0%B8_%D0%91%D0%B0%D1%80%D0%B0%D1%9A%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Great_National_Assembly_Decisions_Poster.jpg","page_title":"Велика народна скупштина Срба, Буњеваца и осталих Словена у Банату, Бачкој и Барањи","context_page_description":"Велика народна скупштина Срба, Буњеваца и осталих Словена у Банату, Бачкој и Барањи је била скупштина одржана у Новом Саду 25. новембра 1918. године, која је прогласила присаједињење Баната, Бачке и Барање Краљевини Србији."},{"page_url":"https://fr.wikipedia.org/wiki/DJ_Assad","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/DJ_Assad.jpg","page_title":"DJ Assad","context_page_description":"DJ Assad, né le 14 décembre 1982 à Meudon, est un DJ, producteur et compositeur français d'origine mauricienne."},{"page_url":"https://lt.wikipedia.org/wiki/Burkina_Faso_v%C4%97liava","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Flag_of_Burkina_Faso.svg","page_title":"Burkina Faso vėliava","context_page_description":"Burkina Faso vėliava buvo įtesinta 1984 metų rugpjūčio 4 dieną po šalyje įvykusio valstybino perversmo.\\nŠią vėliavą sudaro horizontali dvispalvė bei žvaigždės simbolis esantis vėliavos centre. Vėliavos spalvų gamą sudaro raudona ir žalia spalvos bei geltona žvaigždė – visos šios spalvos sudaro Pan-Afrikanistinę spalvų gamą, kurios būdingos daugialiui afrikos šalių, tuo išreiškiant Afrikos šalių vienybę bei nepriklausomybę. Burkina Faso vėliavos žalia spalva simbolizuoja gamtos turtus, žemės ūkį bei šalies gerovę, raudona – žmonių aukas bei kraują, pralietą kovojant už šalies laisvę, geltona žvaigždė – socialistinį šalies raidos kelią ir revoliuciją."},{"page_url":"https://en.wikipedia.org/wiki/V-1_flying_bomb","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Launcher_of_V-1_rocket_in_Historisch-technisches_Informationszentrum_Peenem%C3%BCnde_%281%29.JPG","page_title":"V-1 flying bomb","context_page_description":"The V-1 flying bomb —also known to the Allies as the buzz bomb, or doodlebug, and in Germany as Kirschkern or Maikäfer, as well as by its official RLM aircraft designation of Fi 103—was an early cruise missile and the only production aircraft to use a pulsejet for power.\\nThe V-1 was the first of the so-called \\"Vengeance weapons\\" series deployed for the terror bombing of London. It was developed at Peenemünde Army Research Center in 1939 by the Nazi German Luftwaffe at the beginning of the Second World War, and during initial development was known by the codename \\"Cherry Stone\\". Because of its limited range, the thousands of V-1 missiles launched into England were fired from launch facilities along the French and Dutch coasts. The Wehrmacht first launched the V-1s against London on 13 June 1944, one week after the successful Allied landings in France. At peak, more than one hundred V-1s a day were fired at south-east England, 9,521 in total, decreasing in number as sites were overrun until October 1944, when the last V-1 site in range of Britain was overrun by Allied forces."},{"page_url":"https://ca.wikipedia.org/wiki/Rollinsford","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Strafford-Rollinsford-NH.png","page_title":"Rollinsford","context_page_description":"Rollinsford és una població dels Estats Units a l'estat de Nou Hampshire. Segons el cens del 2007 tenia una població de 2.642 habitants."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A2%E3%82%B9%E3%82%AF%E3%83%AF%E3%83%BB%E3%82%B7%E3%83%86%E3%82%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Moscow-City_02-04-2010.jpg","page_title":"モスクワ・シティ","context_page_description":"モスクワ国際ビジネスセンター・モスクワ・シティまたはモスクワ・シティ、モスクワ国際ビジネスセンターは、ロシアの首都モスクワ中心部における都市再開発プロジェクトおよび地域の名称である。\\n1992年モスクワ市政府によって企画・立案された。ロシアにおいて最大規模の商業・業務・住宅・娯楽コンプレックスの建設を目指している。\\nモスクワ・シティは、クレムリンの西5kmのクラスノ・プレスネンスカヤに位置する。開発地区の西をモスクワ3号環状道路が通り、南をモスクワ川が流れる。総面積は約1㎢である。開発の進度は比較的ゆっくりしているものの、高層建築の林立するモスクワの中心業務地区が形成されつつある。\\n主なビルにはヨーロッパ1位の高さのフェデレーション・タワーの他、OKO、マーキュリー・シティ・タワー、ルネサンス・モスクワ・タワーズ、ユーラシア・タワー、キャピタル・シティなどがある。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Radebeul-K%C3%B6tzschenbroda","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Radebeul_Villa_Mei%C3%9Fner_Stra%C3%9Fe_244.jpg","page_title":"Liste der Kulturdenkmale in Radebeul-Kötzschenbroda","context_page_description":"Die Liste der Kulturdenkmale in Radebeul-Kötzschenbroda gibt eine Übersicht über die Kulturdenkmale im Stadtteil Kötzschenbroda der sächsischen Stadt Radebeul anhand des Stands der Denkmalliste vom 24. Mai 2012. Enthalten sind aktuelle sowie – in einer weiteren Liste – ehemalige Bau-/Kulturdenkmale dieses Stadtteils.\\nEinen Überblick über die Radebeuler Kulturdenkmale gibt die Liste der Kulturdenkmale in Radebeul, eine Zusammenfassung aller Adressen mit Kulturdenkmalen gibt die Liste der Kulturdenkmaladressen in Radebeul. Die Zuordnung der Straßen zum Stadtteil findet sich in der Liste der Straßen und Plätze in Radebeul-Kötzschenbroda.\\nGrundlage der Auflistung sind die angegebenen Quellen. Diese Angaben ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/Outline_of_underwater_diving","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/US_Navy_060329-F-3759D-001_U.S._Navy_divers_assigned_to_the_rescue_and_salvage_ship_USS_Safeguard_%28ARS_50%29_prepare_to_dive.jpg","page_title":"Outline of underwater diving","context_page_description":"The following outline is provided as an overview of and topical guide to underwater diving:\\nUnderwater diving – as a human activity, is the practice of descending below the water's surface to interact with the environment."},{"page_url":"https://it.wikipedia.org/wiki/Contai","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Contai_Railway_Station%2C_Kanthi.jpg","page_title":"Contai","context_page_description":"Contai è una suddivisione dell'India, classificata come municipality, di 77.497 abitanti, situata nel distretto di Midnapore Est, nello stato federato del Bengala Occidentale. In base al numero di abitanti la città rientra nella classe II."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%B2%D0%BB%D0%B8%D0%BD%D0%BE%D0%B3%D0%BB%D0%B0%D0%B7%D0%BA%D0%B0_%D0%BC%D0%B0%D0%BB%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/08_Saturnia_Pavonia_femelle_1991.jpg","page_title":"Павлиноглазка малая","context_page_description":"Павлиноглазка малая, или ночной павлиний глаз малый — вид бабочек из семейства павлиноглазки, широко распространённый по всей Палеарктике."},{"page_url":"https://en.wikipedia.org/wiki/Limba%C5%BEi_Municipality","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Limba%C5%BEu_novada_karte.png","page_title":"Limbaži Municipality","context_page_description":"Limbaži Municipality is a municipality in Vidzeme, Latvia. The municipality was formed in 2009 by merging Katvari Parish, Limbaži Parish, Pāle Parish, Skulte Parish, Umurga Parish, Vidriži Parish, Viļķene Parish and Limbaži town, the administrative centre being Limbaži."},{"page_url":"https://ro.wikipedia.org/wiki/Cintamani","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Goryeo-Kshitigarbha_%28Chijang%29-late.14c.jpg","page_title":"Cintamani","context_page_description":"Cintāmaṇi, scris și Chintamani, este o bijuterie care îți împlinește dorințele, în ambele tradiții: hindusă și budistă, unii afirmând că ar fi echivalentul pietrei filozofale din alchimia europeană. Este una din cele câteva imagini de bijuterii Mani găsite în scriptura budistă.\\nÎn budism, ea este deținută de Bodhisattva Avalokiteshvara și Ksitigarbha. Este, de asemenea, văzută purtată pe spatele lui Lung Ta care este reprezentat pe steagurile de rugăciune tibetane. Prin recitarea Dharani-ului al bijuteriei Cintamani, tradiția budistă susține că se atinge Înțelepciunea lui Buddha, capabil să înțeleagă adevărul lui Buddha, și să schimbe suferințele în Bodhi. Se spune că permite vederea Sfântului Alai al lui Amitabha și adunarea la căpătâiul acestuia, muribund. În tradiția budistă tibetană, Chintamani este uneori descrisă ca o perlă luminoasă și este în posesia mai multor forme diferite ale lui Buddha.\\nÎn hinduism este conectată cu zeii Vishnu și Ganesha. În tradiția hindusă este de multe ori descrisă ca o fabuloasă bijuterie în posesia regelui Naga sau pe fruntea lui Makara.\\nYoga Vasistha, scrisă inițial în secolul 10, conține o poveste despre Cintamani."},{"page_url":"https://en.wikipedia.org/wiki/Cumberland_Apartments","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Cumberland_Apartments_in_Portland%2C_Oregon_%282017%29.jpg","page_title":"Cumberland Apartments","context_page_description":"The Cumberland Apartments is a building complex located in downtown Portland, Oregon, that is listed on the National Register of Historic Places."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%93%A5%E8%BE%BE%E5%8F%B7%E5%88%97%E8%BD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Graue_Maus_in_Bern.jpg","page_title":"哥达号列车","context_page_description":"哥达是曾运营于瑞士苏黎世至意大利米兰间一班长途列车所使用的名称，由瑞士联邦铁路及意大利国家铁路在1961年至2002年间共同开行。其命名源自圣哥达山口的意大利语称谓，这是连接瑞士乌里州和提契诺州的阿尔卑斯山鞍部，也是连接瑞士和意大利的重要通道之一。列车曾先后被纳入全欧快车、欧城列车、城际列车及欧洲夜车等类别，直至2002年停运。"},{"page_url":"https://sco.wikipedia.org/wiki/Arminius","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Herrmann-von-Vorne.JPG","page_title":"Arminius","context_page_description":"Arminius, an aa kent as Armin or Hermann, wis a chieftain o the Germanic Cherusci who defeatit a Roman airmy in the Battle o the Teutoburg Forest. Arminius's influence held an allied coalition o Germanic tribes thegither in opposeetion tae the Romans but efter defeats bi the Roman general Germanicus, nephew of the Emperor Tiberius, his influence waned, and Arminius wis assassinatit on the orders o rival Germanic chiefs. Arminius's victory against the Roman legions in the Teutoburg forest haed a far-reachin effect on the subsequent history o baith the ancient Germanic fowks an on the Roman Empire. The Romans wur tae mak na mair concertit attempts tae conquer an permanently hauld Germania beyond the river Rhine."},{"page_url":"https://pl.wikipedia.org/wiki/Spi%C5%BCowa_Brama","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/The_Bronze_Door.jpg","page_title":"Spiżowa Brama","context_page_description":"Spiżowa Brama – jedna z trzech bram, przez którą można się dostać na teren państwa watykańskiego. Brama znajduje się w kolumnadzie po prawej stronie placu Św. Piotra. Wyrażeniem „za Spiżową Bramą” określa się wydarzenia dziejące się na terenie Watykanu."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BD%8E%E5%9C%B0%E5%BE%B7%E8%AF%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Uerdinger_und_Karlsruher_Linie.png","page_title":"低地德语","context_page_description":"低地德語，又稱低地薩克遜語、古薩克遜語，是低地日耳曼語的一種區域性語言，主要使用者在德國北部、丹麥南部和荷蘭東部，另外亦有使用者在波蘭沿海地區，以及如加拿大等地的移民社群。\\n根據其語言學特徵的不同，可分爲西低地德語和東低地德語。\\n由1999年起，德國根據European Charter for Regional or Minority Languages，認可低地德語為區域性語言。低地德語並未標準化，但在德國，北低地薩克遜語有在電視台和電台廣播中使用。"},{"page_url":"https://sv.wikipedia.org/wiki/Gastrochilus_dasypogon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Gastrochilus_dasypogon_%28Aerides_dasypogon%29.jpg","page_title":"Gastrochilus dasypogon","context_page_description":"Gastrochilus dasypogon är en orkidéart som först beskrevs av James Edward Smith, och fick sitt nu gällande namn av Carl Ernst Otto Kuntze. Gastrochilus dasypogon ingår i släktet Gastrochilus och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B1%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Leopard_Mating_Dance.jpg","page_title":"豹","context_page_description":"豹是貓科豹屬下的一種動物。廣泛分布於非洲和亞洲的各個國家和地區。環境適應能力強，行蹤隱秘，總體生存狀況好於它的貓科親戚獅子和老虎，但是有些豹亞種的現狀並不容樂觀。\\n不同亞種的豹毛色有淺黃，金黃，黃褐等不同。因為其渾身布滿圓形斑紋，所以又名金錢豹或花豹。花豹有時會有黑化現象，即為黑豹，皮膚及毛髮上出現大量黑色素，但還是可隱約見到斑點。"},{"page_url":"https://sv.wikipedia.org/wiki/Albaniens_historia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Berat_UNESCO_2016_Albania.jpg","page_title":"Albaniens historia","context_page_description":"Albanien har uppstått från Balkanhalvöns förhistoria omkring år 3000 före Kristus med första källor från grekisk-romerska historieskrivare. Dagens Albaniens territorium har ingen motsvarighet till antikens territoriella indelningar. Dagens gränser motsvarar däremot delar av de antika romerska provinserna Dalmatia, Macedonia och Moesia Superior. Dessa områden var under romersk kontroll fram tills slavernas intrång på 600-talet efter Kristus. Det förenades med Bulgariska riket på 800-talet.\\nDen albanska statens territoriella kärna skapades under medeltiden, det så kallade Furstendömet Arberien och en siciliansk besittning som kallades Kungadömet Arberien. Området var en del av det serbiska riket och sedan en del av det osmanska riket på 1500-talet. Det förblev under osmansk kontroll som en del av provinsen Rumelien fram tills 1912, då den första albanska staten grundades genom den albanska självständighetsförklaringen efter en kortlivad ockupation av Kungadömet Serbien. Skapandet av det albanska nationella medvetandet skedde tidigare, under 1800-talet, och var en del av ett större fenomen, nämligen nationalismens framväxt under den osmanska tiden."},{"page_url":"https://en.wikipedia.org/wiki/Nemoria_festaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Nemoria_festaria.jpg","page_title":"Nemoria festaria","context_page_description":"Nemoria festaria is a species of emerald moth in the family Geometridae. It is found in North America.\\nThe MONA or Hodges number for Nemoria festaria is 7044."},{"page_url":"https://pt.wikipedia.org/wiki/Osanyin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Caryb%C3%A8%2C_rilievi_degli_orixas%2C_1968%2C_ossaniyn_02.JPG","page_title":"Osanyin","context_page_description":"Osanyin, Ossaniyn, Ossain, Ossanhe ou Ossanha, conforme as religiões africanas, é o orixá das folhas sagradas, ervas medicinais e litúrgicas, identificado no jogo do merindilogun pelo odu iká e representado material e imaterialmente pela cultura jeje-nagô, através do assentamento sagrado denominado igba ossaim. Sua importância é primordial. Nenhuma cerimônia pode ser realizada sem sua interferência. O seu sacerdote é o Babá Olosayin."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_pinturas_de_Eliseu_Visconti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/EliseuVisconti-P267-Risonha.jpg","page_title":"Lista de pinturas de Eliseu Visconti","context_page_description":"Esta é uma lista de pinturas de Eliseu Visconti.\\nEliseo d'Angelo Visconti foi um pintor, desenhista e professor ítalo-brasileiro representante da pintura impressionista no Brasil. Vindo da Itália, imigrou para o Brasil na década de 1870.\\nEstudou no Liceu de Artes e Ofícios no Rio de Janeiro em 1883, com Victor Meirelles e Estêvão Silva. Ni ano seguinte ingressou na Academia Imperial de Belas Artes. Estudou também em Paris na École Nationale et Spéciale des Beaux-Arts aonde cursa arte decorativa na École Guérin. Um de seus principais trabalhos foi a decoração do Theatro Municipal do Rio de Janeiro.\\nA acervo de obras do artista, autenticadas e catalogadas com mais de 1.200 obras, faz parte das principais coleções dos Museus do Brasil.\\nEsta lista é gerada a partir dos dados do Wikidata e é atualizada periodicamente por um robô.\\nEdições feitas no conteúdo da lista serão removidas na próxima atualização!"},{"page_url":"https://sv.wikipedia.org/wiki/Olivpress","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Marokko-162.JPG","page_title":"Olivpress","context_page_description":"En olivpress är en anordning för att tillverka olivolja från oliver.\\nOlivpressar har funnits sedan antiken, men har mekaniserats under industriella revolutionen."},{"page_url":"https://en.wikipedia.org/wiki/West_Slavs","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Slavic_europe.svg","page_title":"West Slavs","context_page_description":"The West Slavs are a subgroup of Slavic peoples who speak the West Slavic languages.\\nThey separated from the common Slavic group around the 7th century, and established independent polities in Central Europe by the 8th to 9th centuries. The West Slavic languages diversified into their historically attested forms over the 10th to 14th centuries.\\nWest Slavic speaking nations today include the Poles, Czechs, Slovaks, Sorbs and ethnic groups Kashubians, Moravians and Silesians. They inhabit a contiguous area in Central Europe stretching from the north of the Baltic Sea to the Sudetes and the Carpathian Mountains in the south, historically also across the Eastern Alps into the Apennine peninsula and the Balkan peninsula.\\nThe West Slavic group can be divided into three subgroups: Lechitic, including Polish, Kashubian and the extinct Polabian and Pomeranian languages as well as Lusatian and Czecho-Slovak.\\nCulturally, West Slavs developed along the lines of other Western European nations due to affiliation with the Roman Empire and Western Christianity."},{"page_url":"https://gl.wikipedia.org/wiki/Folosa_p%C3%A1lida","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Hippolais_pallida_%28J%C3%A1n_Svetl%C3%ADk%29.jpg","page_title":"Folosa pálida","context_page_description":"A folosa pálida, ou fulepa abuada, Hippolais pallida, é unha ave da orde dos paseriformes, suborde dos páseros, infraorde dos paséridos, superfamilia dos silvioideos e familia dos acrocefálidos, pertencente ao xénero Hippolais,"},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%AF%94%E4%BB%80%E5%87%B1%E5%85%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/E7904-Bishkek-Ala-Too-Square.jpg","page_title":"比什凱克","context_page_description":"比什凱克（柯爾克孜文：Бишкек）係吉爾吉斯首都。"},{"page_url":"https://de.wikipedia.org/wiki/Grenze_zwischen_Frankreich_und_der_Schweiz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Pleigne-Blazono.png","page_title":"Grenze zwischen Frankreich und der Schweiz","context_page_description":"Die Grenze zwischen Frankreich und der Schweiz hat eine Länge von 585 Kilometern. Sie erstreckt sich auf der Westseite des Landes im Norden vom Kanton Basel-Stadt bis hin zum Kanton Wallis im Süden."},{"page_url":"https://et.wikipedia.org/wiki/Krimulda_piiskopilinnus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Krimulda_piiskopilinnuse_varemed_01.JPG","page_title":"Krimulda piiskopilinnus","context_page_description":"Krimulda piiskopilinnus oli Riia peapiiskopkonna liivlaste asualadel paiknenud Turaida linnuse abilinnus, mis asub Lätis, Vidzeme kultuuriajaloolises piirkonnas, 50 km kaugusel Riiast ja 30 km kaugusel Võnnust, Koiva jõe ääres asuvas Sigulda linnas. Krimulda linnaosa jääb jõe paremkaldale. Linnus asetseb Koiva jõe ürgoru kõrgel kaldapealsel Sigulda linna loodeosas Krimuldas iela tänava lõpus. Linnuseala jääb u 90 m kõrgusele üle merepinna. Linnusest 300 m lõunas paikneb endine Krimulda mõis, 4 km lääne pool – Kipsalas – seisab kihelkonnakirik ja muinaslinnus. 400 m läände jääb juba praeguse administratiivjaotuse järgi Krimulda piirkonna piir.\\nMuinasajal kuulus Krimulda koivaliivlaste Satezele, Turaida ja Kubesele linnuste piirkonda. Venemaa Keisririigi lõpuni kehtinud ajaloolise haldusjaotuse järgi asus linnus Liivimaa kubermangu Riia maakonna Krimulda kihelkonnas."},{"page_url":"https://de.wikipedia.org/wiki/Heldenallee_(Ebersberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Heldenallee_Baum_58_7120.JPG","page_title":"Heldenallee (Ebersberg)","context_page_description":"Die Heldenallee in Ebersberg ist eine Gedenkstätte für die Gefallenen des Ersten Weltkriegs aus der oberbayerischen Stadt. Sie befindet sich zwischen dem Klostersee und dem Aussichtsturm auf der Ludwigshöhe."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%BE%DB%8C%D8%AA%D8%B1_%D8%AC%DB%8C%D9%85%D8%B2_%D8%AA%D9%88%D9%85%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Peter_James_Thomas.jpg","page_title":"پیتر جیمز توماس","context_page_description":"پیتر جیمز توماس بریتانیالی بیلیم اینسانی. پیتر جیمز توماس هال بیلیم‌یوردو و York St John University و کمبریج بیلیم‌یوردودا درس اوْخویوب."},{"page_url":"https://no.wikipedia.org/wiki/Christian_Frederik_Herbst","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Christian_Frederik_Herbst.jpg","page_title":"Christian Frederik Herbst","context_page_description":"Christian Frederik Herbst var en dansk arkeolog, numismatiker og museumsdirektør."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_op_23_februari","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/%E6%98%8E%E8%8B%B1%E5%AE%97.jpg","page_title":"Lijst van personen overleden op 23 februari","context_page_description":"Dit is een lijst van personen die overleden zijn op 23 februari.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n155 - Polycarpus van Smyrna, bisschop, theoloog, priester, heilige en schrijver bewerken\\n943 - Herbert II van Vermandois, graaf, Lekenabt, religieus dienaar bewerken\\n999 - Paus Gregorius V, Duitse paus en kardinaal, rooms-katholiek priester bewerken\\n1011 - Willigis, Duitse aartsbisschop van Mainz en katholieke aartsbisschop, rooms-katholiek priester bewerken\\n1074 - Rudolf IV van Vexin, Franse graaf van Amiens, Lekenabt bewerken\\n1100 - Song Zhezong, keizer van China en keizer uit de Song-dynastie bewerken\\n1169 - Gerard van Are, Duitse priester bewerken\\n1234 - Guillaume II. des Barres, Franse ridder bewerken\\n1270 - Isabella van Frankrijk, kloosterzuster bewerken"},{"page_url":"https://en.wikipedia.org/wiki/Louis_Am%C3%A9d%C3%A9e_Achard","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Louis_Am%C3%A9d%C3%A9e_Achard_by_Nadar.jpg","page_title":"Louis Amédée Achard","context_page_description":"Louis Amédée Eugène Achard was a prolific French novelist.\\nAchard was born in Marseille. After a short stay near Algiers, where he supervised a farm, he went to Toulouse, and then Marseille, where he became a journalist and wrote for the Sémaphore. He moved to Paris, where he wrote for the Vert-Vert, the Entracte, the Charivari, and the Époque. Achard wrote extensively for the Époque, even writing for his colleagues when they lacked inspiration. He then collaborated in the satirical journal Le Pamphlet, and was gravely wounded in a duel with a man named Fiorentino, whom he had defamed. While still convalescent, he left for Italy with the French Army to cover the war for the Journal des Débats.\\nAchard was a prolific writer. In addition to his journalism, he wrote about thirty plays and about forty books. He is known today primarily for his cloak and dagger novels. Some incorrectly claim that he was the originator of the term, but he did write a novel called la Cape et l'Épée in 1875. Achard also wrote many books on manners. He died, aged 60, in Paris."},{"page_url":"https://la.wikipedia.org/wiki/Iosua_Lederberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Joshua_Lederberg_crop.jpg","page_title":"Iosua Lederberg","context_page_description":"Iosua Lederberg fuit illustris biochemicus Americanus, qui anno 1958 una cum Georgio Wells Beadle et Eduardo Lawrie Tatum Nobelianum Medicinae Praemium accepit, ratione studii geneticae bacteriologiae.\\nEt intellegentiae artificialis et exploratione mundi peritus fuit."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AC%88%E7%81%B0%E8%9D%B6%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Arhopala_ganesa%2C_male.jpg","page_title":"嬈灰蝶屬","context_page_description":"嬈灰蝶屬是灰蝶科翠灰蝶亞科紫灰蝶族中的一個屬。物種分布於印度至日本到澳大利亞及索羅門群島一帶。幼蟲會與螞蟻共生。"},{"page_url":"https://lt.wikipedia.org/wiki/Belford_Ro%C5%A1as","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Belford_Roxo_portico.JPG","page_title":"Belford Rošas","context_page_description":"Belford Rošas – miestas Brazilijos pietryčiuose, Rio de Žaneiro valstijoje; Rio de Žaneiro priemiestis. 508 tūkst. gyventojų. Vyrauja atogrąžų klimatas, vidutinė temperatūra – 18 °C. Yra „Bayer do Brasil“ chemijos gamykla, „Termolite“ ir „Lubrizol“ gamyklų padaliniai.\\nĮkurtas 1990 m., miesto gyventojų greitai pagausėjo. Miestas pavadintas pagal brazilų inžinierių Raimundo Teixeira Belfort Roxo, išsprendusį Rio de Žaneiro vandens trūkumo problemą."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Estill_County,_Kentucky","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Irvine_Grade_School.jpg","page_title":"National Register of Historic Places listings in Estill County, Kentucky","context_page_description":"This is a list of the National Register of Historic Places listings in Estill County, Kentucky.\\nIt is intended to be a complete list of the properties on the National Register of Historic Places in Estill County, Kentucky, United States. The locations of National Register properties for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 8 properties listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted June 19, 2020."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BF%81-%E5%9F%83%E5%B0%94%E6%97%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Hon-Hergies%C3%89glise110507_%2839%29.JPG","page_title":"翁-埃尔日","context_page_description":"翁-埃爾日是法國北部-加來海峽大區諾爾省的一個市鎮，屬於埃爾普河畔阿韋訥區。該市鎮2009年時的人口為858人。"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_presidentes_de_Tuva","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Buyan-Badyrgy.jpg","page_title":"Lista de presidentes de Tuva","context_page_description":"O Presidente da República de Tuva, que hoje é uma República da Rússia, já foi uma república independente de 1921 a 1944, sendo o primeiro país a ser dirigida por uma mulher. Ela chamava-se Khertek Anchimaa-Toka.\\nLogo depois da Segunda Guerra Mundial, o país foi anexado pela União Soviética até 1991, e ganhou autonomia e permanece assim até a atualidade."},{"page_url":"https://fi.wikipedia.org/wiki/Markus_Majaluoma","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Majaluoma_20081127_2.jpg","page_title":"Markus Majaluoma","context_page_description":"Markus Majaluoma on suomalainen lastenkirjailija ja kuvittaja.\\nMajaluoma on suorittanut kuvataideopettajan tutkinnon Taideteollisessa korkeakoulussa 1991. Majaluoman kuvituksille on tyypillistä murretut värit, hahmojen sijoittaminen osaksi laajempaa maisemaa ja hieman karrikoidunnäköiset hahmot. Majaluoma käyttää teoksissaan myös sarjakuvaa. Tunnetuimpia Majaluoman kuvituksia on Heinähattu ja Vilttitossu -sarja. Hänen omia kuvakirjateoksiaan on käännetty ruotsiksi, norjaksi, tanskaksi, ranskaksi, kiinaksi.\\nMajaluoman teos Hulda kulta, luetaan iltasatu oli vuoden 2010 Finlandia Junior -palkintoehdokkaana. Vuonna 2001 ehdolla oli Sinikka ja Tiina Nopolan kirjoittama ja Majaluoman kuvittama teos Rauhallinen Erkki."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D1%80%D1%82%D0%B0%D0%BD%D1%8C%D1%8F%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/%C3%89glise_Saint-Nazaire%2C_Artagnan%2C_Hautes-Pyr%C3%A9n%C3%A9es.JPG","page_title":"Артаньян","context_page_description":"Артанья́н — муніципалітет у Франції, у регіоні Південь-Піренеї, департамент Верхні Піренеї. Населення — 500 осіб.\\nМуніципалітет розташований на відстані близько 640 км на південь від Парижа, 115 км на захід від Тулузи, 20 км на північ від Тарба."},{"page_url":"https://en.wikipedia.org/wiki/Nathan_Road","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Nathan_Road_south_end_%28deep_blue_sky%29.jpg","page_title":"Nathan Road","context_page_description":"Nathan Road is the main thoroughfare in Kowloon, Hong Kong that goes in a south–north direction from Tsim Sha Tsui to Sham Shui Po. It is lined with shops and restaurants and throngs with visitors, and was known in the post–World War II years as the Golden Mile, a name that is now rarely used. It starts on the southern part of Kowloon at its junction with Salisbury Road, a few metres north of Victoria Harbour, and ends at its intersection with Boundary Street in the north. Portions of the Kwun Tong and Tsuen Wan Lines run underneath Nathan Road. The total length of Nathan Road is about 3.6 kilometres."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/G%C3%A1vavencsell%C5%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/G%C3%A1vavencsell%C5%91_Dessewffy_kast%C3%A9ly_homlokzat3.jpg","page_title":"Gávavencsellő","context_page_description":"Gávavencsellő sī Magyar Szabolcs-Szatmár-Bereg kūn ê chi̍t ê chng-thâu."},{"page_url":"https://is.wikipedia.org/wiki/Heimsminjaskr%C3%A1_UNESCO","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Unesco_world_heritage_sites.png","page_title":"Heimsminjaskrá UNESCO","context_page_description":"Heimsminjaskrá UNESCO er skrá yfir staði sem hafa verið útnefndir heimsminjar innan alþjóðlegrar heimsminjaáætlunar UNESCO. Tilgangur skrárinnar er varðveisla staða sem teljast sérstaklega merkilegir frá menningarlegu og/eða náttúrufræðilegu sjónarmiði og eru taldir hluti af menningararfi mannkyns. Áætluninni var hleypt af stokkunum af UNESCO 16. nóvember 1972. Skráin innihélt 1007 staði um allan heim árið 2014. Hún hefur verið gagnrýnd fyrir að vera mjög Evrópumiðuð og eins fyrir hið stranga verndunarsjónarmið sem liggur henni til grundvallar og er skilyrði fyrir að staður sé tekinn á listann. Þetta síðasta atriði leiddi til stofnunar Lista UNESCO yfir óáþreifanlegan menningararf árið 2008.\\n190 lönd hafa undirritað samninginn um verndun menningar- og náttúruarfleifðar heimsins. Hann er því einn viðteknasti alþjóðasamningur heims. Aðildarríkin tilnefna atriði á heimsminjaskrána og tilnefningar eru metnar af Alþjóðaráði um minnisvarða og sögustaði og Alþjóðlegu náttúruverndarsamtökunum. Þessir aðilar mæla síðan með tilnefningum við Heimsminjaráðið skipað fulltrúum 21 aðildarlands sem kjörnir eru af allsherjarþingi UNESCO."},{"page_url":"https://en.wikipedia.org/wiki/Holland_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Kyoto_Garden_Holland_Park_London_6662_pano_3.jpg","page_title":"Holland Park","context_page_description":"Holland Park is an area of Kensington, on the western edge of Central London, that contains a street and public park of the same name. It has no official boundaries but is roughly bounded by Kensington High Street to the south, Holland Road to the west, Holland Park Avenue to the north, and Kensington Church Street to the east. Adjacent districts are Notting Hill to the north, Earl's Court to the south, and Shepherd's Bush to the northwest.\\nThe area is principally composed of tree-lined streets with large Victorian townhouses, and contains many shops, cultural tourist attractions such as the Design Museum, luxury spas, hotels, and restaurants, as well as the embassies of several countries. The street of Holland Park is formed from three linked roads constructed between 1860 and 1880 in projects of master builders William and Francis Radford, who were contracted to build and built over 200 houses in the area. Notable nineteenth-century residential developments in the area include the Royal Crescent and Aubrey House."},{"page_url":"https://en.wikipedia.org/wiki/HMS_Tracker_(D24)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/HMS_Tracker_%28D24%29.jpg","page_title":"HMS Tracker (D24)","context_page_description":"HMS Tracker was a Attacker-class escort carrier that was built in the United States, but served in the Royal Navy during World War II."},{"page_url":"https://de.wikipedia.org/wiki/Edme_Mentelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Edme_Mentelle_AGE_V08_1801.jpg","page_title":"Edme Mentelle","context_page_description":"Edme Mentelle war ein französischer Kartograph, Professor für Geographie und Geschichte und Dichter.\\nMentelle war von 1760 bis 1792 Professor für Geschichte und Geografie an der École Militaire in Paris, von 1794 bis 1795 unterrichtete er Geografie an der École normale supérieure. 1795 wurde er in die Académie des sciences morales et politiques gewählt."},{"page_url":"https://es.wikipedia.org/wiki/Plat%C3%B3n_conversando_con_sus_disc%C3%ADpulos","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/MANNapoli_124545_plato%27s_academy_mosaic.jpg","page_title":"Platón conversando con sus discípulos","context_page_description":"Platón conversando con sus discípulos es un mosaico romano del siglo I conservado en el Museo Arqueológico Nacional de Nápoles.​​ En dicha imagen el ambiente social del entorno de Platón aparece reflejeado como una forma idealizada de recreación del debate intelectual protagonizado por los comensales de El Banquete.​"},{"page_url":"https://vi.wikipedia.org/wiki/Stapelia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Stapelia_variegata.jpg","page_title":"Stapelia","context_page_description":"Stapelia là chi thực vật có hoa trong họ Apocynaceae."},{"page_url":"https://de.wikipedia.org/wiki/Liste_alter_Synagogen_in_Nordrhein-Westfalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Blomberg_Ehem.-Synagoge_Siebenb%C3%BCrgen-1a_6.jpg","page_title":"Liste alter Synagogen in Nordrhein-Westfalen","context_page_description":"Von den rund 350 Synagogen, die sich in den 1930er Jahren auf dem Gebiet des heutigen Bundeslandes Nordrhein-Westfalen befanden, konnten nur wenige der Zerstörung durch die Nationalsozialisten während der Novemberpogrome 1938 entgehen. Bei den erhaltenen Gotteshäuser handelt es sich meist um Gebäude, die von ihren Gemeinden zuvor aufgegeben worden waren, oder deren Vernichtung aufgrund der Nähe der angrenzenden Häuser nicht oder nur unvollständig vollzogen wurde.\\nDie folgende Liste führt die heute noch vorhandenen alten Synagogen in Nordrhein-Westfalen auf. Ehemalige Gotteshäuser, die durch Umbau zu Wohn- oder Geschäftshäusern bzw. Lagerhallen in einer Weise verändert wurden, welche die ursprüngliche Funktion unkenntlich macht, finden hierbei keine Berücksichtigung."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E7%99%BD%E9%A9%AC%E9%95%87_(%E6%B5%A6%E6%B1%9F%E5%8E%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Baima_Square_in_Pujiang%2C_Zhejiang_2019-09.jpg","page_title":"白马镇 (浦江县)","context_page_description":"白馬鎮，中國浙江省金華市浦江縣下轄的一個鎮。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_materieel_van_de_Nederlandse_landmacht","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Vector-commando-jeep.jpg","page_title":"Lijst van materieel van de Nederlandse landmacht","context_page_description":"Deze lijst van materieel van de Nederlandse landmacht geeft een overzicht van typen, aantallen hoofduitrustingsstukken en details van het materieel dat in gebruik is binnen de Koninklijke Landmacht. Gebruikte afkortingen: kN, MLC, CBRN en MLU."},{"page_url":"https://eu.wikipedia.org/wiki/Ve%C3%B0rf%C3%B6lnir","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/AM_738_4to_Vedrfolnir.png","page_title":"Veðrfölnir","context_page_description":"Veðrfölnir edo Veðrlaufnir, eskandinaviar mitologian, munduko zuhaitza den Yggdrasilen tontorrean, arrano baten begien erdian eserita dagoen belatza da.\\nVeðrfölnir izenak \\"tontorrak zuritua izan zena\\" esan nahi du."},{"page_url":"https://hu.wikipedia.org/wiki/Alba_Feh%C3%A9rv%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/AR%C3%89V_Sportcentrum_a_2010-es_%C3%A1tfest%C3%A9s_el%C5%91tt_3.jpg","page_title":"Alba Fehérvár","context_page_description":"Az Alba Fehérvár székesfehérvári férfi kosárlabdaklub, az 1951-ben alakult Székesfehérvári Építők, majd az Alba Regia Építők jogutódja. Ötszörös magyar bajnok, négyszeres kupagyőztes, egyszeres Közép-európai Kosárlabda Liga győztes."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A7%E3%83%BC%E3%83%80%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Rao_Jodha.jpg","page_title":"ジョーダー","context_page_description":"ジョーダーは、北インドのラージャスターン地方、マールワール王国の君主。"},{"page_url":"https://fr.wikipedia.org/wiki/Palais_El_Mechouar","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Mosqu%C3%A9e_du_Mechouar_Tlemcen.jpg","page_title":"Palais El Mechouar","context_page_description":"Le palais El Mechouar, est un complexe palatial royal zianide, situé à Tlemcen en Algérie. Construit au Moyen Âge par les sultans zianides en 1248. Mechouar — littéralement « aile du Conseil », « lieu de mouchawara », soit « conseils consultatifs » — doit son nom à la salle où se réunissaient les ministres autour du sultan de Tlemcen. L'usage du terme mechouar s'étend pour désigner en Andalousie et au Maghreb un palais-citadelle. Le complexe du Mechouar est un exemple d'art mauresque et andalou, et plus particulièrement du style zianide.\\nEn 2010, des fouilles engagées sur le site historique d'El Mechouar ont permis, à l'occasion de l'évènement culturel \\"Tlemcen capitale de la culture islamique 2011\\", de reconstituer et reconstruire le palais royal à l'endroit même où se trouvaient les ruines en intégrant toutes les structures et décors découverts. Le mur d'enceinte a, quant à lui, été restauré."},{"page_url":"https://en.wikipedia.org/wiki/Homalocantha_anatomica","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Muricidae_-_Homalocantha_anatomica.jpg","page_title":"Homalocantha anatomica","context_page_description":"Homalocantha anatomica is a species of sea snail, a marine gastropod mollusk in the family Muricidae, the murex snails or rock snails."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%95%9D","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Dysprosium-sulfate.jpg","page_title":"镝","context_page_description":"镝是一种化学元素，符号为Dy，原子序为66。镝属于稀土元素，其外观具银色金属光泽。镝在大自然中不以单质出现，而是包含在多种矿物之中，例如磷钇矿。自然形成的镝由7种同位素组成，其中丰度最高的是¹⁶⁴Dy。\\n1886年保罗·埃米尔·勒科克·德布瓦博德兰首次辨认出镝元素，但要直到1950年代离子交换技术的发展后，才有纯态的镝金属被分离出来。由于其热中子吸收截面很高，所以在核反应堆中被用作控制棒；其磁化率亦很高，所以可用于数据储存技术上，以及做Terfenol-D材料的成分。可溶镝盐具有微毒性，不可溶镝盐则无毒。"},{"page_url":"https://de.wikipedia.org/wiki/Fiji_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Fijian_river_raft%2C.jpg","page_title":"Fiji Museum","context_page_description":"Das Fiji Museum ist ein 1955 eröffnetes Völkerkundemuseum in Suva, Fidschi, gelegen in den Botanischen Gärten Thurston Gardens.\\nDas Museum beherbergt eine große archäologische Sammlung im zeitlichen Umfang von 3.700 Jahren sowie als Volkskundemuseum Relikte der indigenen Kulturgeschichte. Besonderheiten sind z. B. Ausstellungsobjekte wie das Heckruder der HMS Bounty oder das mit dem Namen „Ratu Finau“ bekannte zweite noch heute erhaltene Drua, einem fidschianischen Doppel-Auslegerkanu.\\nBedeutende Direktoren, die das Museum zu einer Forschungseinrichtung ausbauten, waren R. A. Derrick, B. Palmer, and Fergus Clunie, heutige Direktorin ist Sagale Buadromo.\\nRechtsgrundlage ist der Fiji Museum Act and the Preservation of Objects of Archaeological & Palaeontological Interest Act. Dem Museum wurde durch den Staat Fidschi auch die Abwicklung neuerer archäologischer und anthropologischer Forschungsgesuche insbesondere ausländischer Institutionen übertragen.\\nDas Museum beheimatete das Sekretariat der Pacific Islands Museums Association bis 2006, das danach seinen Sitz in Port Vila, Vanuatu hat."},{"page_url":"https://fr.wikipedia.org/wiki/1re_%C3%A9tape_du_Tour_d%27Espagne_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Mark_Cavendish_-_seconde_%C3%A9tape_du_Tour_de_Romandie_2010C.jpg","page_title":"1re étape du Tour d'Espagne 2010","context_page_description":"La 1ʳᵉ étape du Tour d'Espagne 2010 s'est déroulée le 28 août 2010. Séville est la ville de départ et la ville d'arrivée. Il s'agit d'un contre-la-montre par équipes qui s'est effectué en nocturne dans Séville sur 13 km. La victoire est revenue à l'équipe américaine Team HTC-Columbia. Le Britannique Mark Cavendish s'empare du premier maillot rouge de cette Vuelta."},{"page_url":"https://sco.wikipedia.org/wiki/Exodus_(baund)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Exodus1.JPG","page_title":"Exodus (baund)","context_page_description":"Exodus is an American thrash metal baund formed in 1980 in Richmond, Californie bi guitarist Gary Holt, current Metallica guitarist Kirk Hammett, an drummer Tom Hunting.\\nSpannin a career o 30 years, Exodus haes gone throu numerous line-up chynges, twa extendit hiatuses an haes seen the daiths o twa umwhile baund members. Wi nine studio albums, twa live albums an twa compilations, Exodus haes released a tot o thirteen albums syne thair debut in 1985. Gary Holt remains the anerlie steady member o the baund, appearin on aw thair releases. Tho drummer Tom Hunting is ane o the foondin baund members, he haes made twa depairturs frae Exodus but is currently the baund's active drummer."},{"page_url":"https://it.wikipedia.org/wiki/Koz%C3%A1rov","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Koz%C3%A1rov_CoA.png","page_title":"Kozárov","context_page_description":"Kozárov è un comune della Repubblica Ceca facente parte del distretto di Blansko, in Moravia Meridionale."},{"page_url":"https://pl.wikipedia.org/wiki/Miasta_w_Kanadzie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Toronto_-_ON_-_Toronto_Skyline2.jpg","page_title":"Miasta w Kanadzie","context_page_description":"Według danych oficjalnych pochodzących z 2011 roku Kanada posiadała ponad 310 miast o ludności przekraczającej 7 tys. mieszkańców. Stolica kraju Ottawa znajduje się dopiero na czwartym miejscu spośród największych miast, Toronto jako jedyne miasto liczyło ponad 5 milionów mieszkańców; 2 miasta z ludnością 1÷5 mln.; 8 miast z ludnością 500÷1000 tys.; 40 miast z ludnością 100÷500 tys.; 46 miast z ludnością 50÷100 tys.; 63 miasta z ludnością 25÷50 tys. oraz reszta miast poniżej 25 tys. mieszkańców."},{"page_url":"https://eu.wikipedia.org/wiki/Skomelno","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Skomelno_RO_CZ.png","page_title":"Skomelno","context_page_description":"Skomelno Txekiar Errepublikako udalerri bat da. 212 biztanle ditu eta 2,88 kilometro koadroko azalera. Rokycanyko barrutian dago."},{"page_url":"https://vi.wikipedia.org/wiki/Cymbidium_mannii","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Cymbidium_bicolor_subsp._pubescens_%28as_Cymbidium_pubescens%29_-_Edwards_vol_27_%28NS_4%29_pl_38_%281841%29.jpg","page_title":"Cymbidium mannii","context_page_description":"Cymbidium bicolor là một loài thực vật có hoa trong họ Lan. Loài này được Rchb.f. mô tả khoa học đầu tiên năm 1872."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A7%D0%B5%D0%BC%D0%B5%D1%80%D1%81%D0%BA%D0%B8_%D0%BC%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/%D0%A7%D0%B5%D0%BC%D0%B5%D1%80%D1%81%D0%BA%D0%B8_%D0%BC%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%80_2.jpg","page_title":"Чемерски манастир","context_page_description":"Чемерски манастир — нов манастир во бошавското село Чемерско, сместен во самото село."},{"page_url":"https://af.wikipedia.org/wiki/Tigrisrivier","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Tigr-euph.png","page_title":"Tigrisrivier","context_page_description":"Die Tigris is die oosterse een van die twee groot riviere wat Mesopotamië begrens. Die ander een is die Eufraat, wat oor die berge van Anatolië deur Irak vloei. Die oorspronklike Sumeriese naam was idigna of idigina, wat vertaal kan word as \\"die vinnig vloeiende rivier, die rivier wat vloei\\", teenoor sy eweknie, die Eufraat, wat stadiger vloei sodat dit meer slik laat opbou en 'n hoër stroombed het as die Tigris. In Pahlavi beteken tigr \\"pyl\\". Dit is blykbaar nie die oorspronklike naam van die rivier nie, maar 'n nabootsing van die inheemse Sumeriese naam.\\n'n Ander naam vir hierdie rivier sedert die tyd van die Persiese Ryk, is Arvand, wat dieselfde betekenis het. Vandag verwys die naam Arvand na die laer deel van die Tigris in Persies.\\nDie Tigris is ongeveer 1 900 km lank en ontspring in die Taurus-berge van Oos-Turkye en vloei meestal in 'n suidoostelike rigting totdat dit naby Al-Kurna in Suid-Irak by die Eufraat aansluit. Die twee riviere vorm saam die Sjatt al-Arab-waterweg, wat in die Persiese Golf uitmond. Baie sytakke sluit by die rivier aan, onder meer die Dijala en die Bo- sowel as die Onder-Zab-rivier."},{"page_url":"https://nl.wikipedia.org/wiki/Finland_op_het_Eurovisiesongfestival_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/20150511_ESC_2015_Pertti_Kurikan_Nimip%C3%A4iv%C3%A4t_4405.jpg","page_title":"Finland op het Eurovisiesongfestival 2015","context_page_description":"Finland nam deel aan het Eurovisiesongfestival 2015 in Wenen, Oostenrijk. Het was de 49ste deelname van het land op het Eurovisiesongfestival. Yle was verantwoordelijk voor de Finse bijdrage voor de editie van 2015."},{"page_url":"https://fr.wikipedia.org/wiki/Neuhausen-Nymphenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Dom-Pedro-Platz_4_Christuskirche_Muenchen-1.jpg","page_title":"Neuhausen-Nymphenburg","context_page_description":"Neuhausen-Nymphenburg est un des vingt-cinq secteurs de la ville allemande de Munich."},{"page_url":"https://cs.wikipedia.org/wiki/Anton%C3%ADn_Hrazd%C3%ADra","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Hrazdira_A.jpg","page_title":"Antonín Hrazdíra","context_page_description":"Antonín Hrazdíra byl český a československý politik KSČ, po sametové revoluci ministr vnitra České socialistické republiky, v 90. letech poslanec České národní rady a Poslanecké sněmovny za KSČM, pak politik za Levý blok a Stranu demokratického socialismu."},{"page_url":"https://nn.wikipedia.org/wiki/Mette_Bergmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/1994_Mette_Bergmann.JPG","page_title":"Mette Bergmann","context_page_description":"Mette Bergmann er ein norsk tidlegare diskoskastar frå Kråkerøy i Fredrikstad. Frå 1984 til 2000 vann ho NM i diskoskast 17 gonger på rad. Den beste plasseringa hennar frå internasjonale meisterskap er bronseplassen i EM i 1994. Bergmann har hatt den norske rekorden i diskos for kvinner sidan 1984 og forbetra han mange gonger. Den gjeldande rekorden på 69,68 m. sette ho i Florø i 1995. Sleggjekast for kvinner vart NM-øving i 1996 og ho deltok i dei fem fyrste NM-tevlingane i øvinga og tok medalje kvar gong; ein gull, to sylv og to bronse. Bergmann er utdanna sjukepleiar."},{"page_url":"https://cs.wikipedia.org/wiki/Melanismus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Melsquir.jpg","page_title":"Melanismus","context_page_description":"Melanismus je termín používaný pro výrazné rozvinutí tmavého pigmentu melaninu na kůži a srsti živočichů. Jedná se v podstatě o opak albinismu. Svůj původ má ve starořeckém slovu melas/melanos – černý.\\nNa rozdíl od albínů jsou melaničtí jedinci obvykle lépe přijímaní ostatními zástupci svého druhu. Mají i podstatně větší šanci na přežití, neboť tmavé zbarvení je lépe kamufluje ve tmě a nijak zvlášť je nehendikepuje za světla. Tmavá mutace je tudíž běžnější u lesních forem a druhů, než u živočichů žijících v otevřené krajině. Melaničtí jedinci jsou odolnější vůči nepříznivým vlivům slunečního záření. Má se zato, že jsou rovněž odolnější vůči některým chorobám. Negativem je nižší schopnost zisku vitamínu D ze slunečního záření.\\nNěkteří jedinci mají jen částečný melanismus. V tom případě jde dobře vidět jak tmavá srst tak i kresba a barva obvyklá.\\nZvláštní formou melanismu je tzv. industriální nebo průmyslový melanismus. Ten vznikl přizpůsobením některých druhů živočichů na silně znečištěné prostředí v průmyslových oblastech. Došlo u nich ke genové mutaci, která zajišťovala tmavší zbarvení."},{"page_url":"https://en.wikipedia.org/wiki/Yoshiyuki_Tsuruta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Yoshiyuki_Tsuruta_1928b.jpg","page_title":"Yoshiyuki Tsuruta","context_page_description":"Yoshiyuki Tsuruta was a Japanese swimmer. He won a gold medal in the Amsterdam Olympics and the Los Angeles Olympics."},{"page_url":"https://fr.wikipedia.org/wiki/Valentin_Spitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Valentin_Spitz_%282018%29.jpg","page_title":"Valentin Spitz","context_page_description":"Valentin Spitz, né le 22 mars 1986, est un écrivain, psychanalyste et journaliste français.\\nAprès avoir été journaliste à RTL et Europe 1 et I-Télé de 2007 à 2016, puis chroniqueur dans La Nouvelle Édition de 2016 à 2017 où il réalise des portraits, il devient psychothérapeute."},{"page_url":"https://es.wikipedia.org/wiki/Interestatal_88_(oeste)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Ronald-Reagan-Toll-%28IL%29-map.png","page_title":"Interestatal 88 (oeste)","context_page_description":"La Interestatal 88 es una intraestatal de peaje en el estado de Illinois. Pasa desde una interchange en la Interestatal 80 cerca de Silvis y Moline a una interchange con las interestatales 290 y 294 en Hillside cerca de Chicago. La Interestatal 88 tiene 140,6 millas de longitud.​La autopista también es llamada como Ronald Reagan Memorial Tollway mantenida por el Illinois State Toll Highway Authority ​"},{"page_url":"https://fy.wikipedia.org/wiki/Gentile_Bellini","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Yenieri-aturkishjanissary-gentilebellini.jpg","page_title":"Gentile Bellini","context_page_description":"Gentile Bellini wie in Fenesiaansk keunstskilder en tekener fan 'e Fenesiaanske Skoalle. Hy stamme út in foaroansteand Fenesiaansk laach fan keunstskilders, en waard, alteast yn 'e earste helte fan syn karriêre, heger oanslein as syn jongere broer Giovanni Bellini. Tsjintwurdich wurdt Giovanni lykwols rûnom beskôge as de bettere skilder. Fan 1474 ôf wie Gentile Bellini de offisjele portrettist fan 'e doge fan 'e Republyk Feneesje, mar de measten fan dy portretten binne letter by in brân ferlern gien. Bellini syn bekendste skilderij is syn portret fan 'e Osmaanske sultan Mehmed II, dat datearret út 1479."},{"page_url":"https://nl.wikipedia.org/wiki/%C5%A0koda_Holding","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Emil_Skoda.jpg","page_title":"Škoda Holding","context_page_description":"Škoda Investments, a.s., tot 2010 Škoda Holding, a.s. geheten is een Tsjechische bedrijf uit Pilsen. Sinds de splitsing in 2010 volledig werd, is Škoda Investments geen productiebedrijf meer maar berheert slechts vastgoed."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_Sant_Feliu_de_Llobregat","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Casal_de_Joves.jpg","page_title":"Llista de monuments de Sant Feliu de Llobregat","context_page_description":"Llista de monuments de Sant Feliu de Llobregat inclosos en l'Inventari del Patrimoni Arquitectònic Català i inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments històrics per ser una construcció o altra obra material produïda per l'activitat humana que configura una unitat singular de les més rellevants del patrimoni cultural català. S'inclouen a la llista els següents:\\nDeclarat bé cultural d'interès nacional: només n'hi ha un, la torre Abadal.\\nCatalogat com a bé cultural d'interès local: són els inclosos en el Catàleg del patrimoni arquitectònic de Sant Feliu de Llobregat de 1989 que van passar a BCIL per la disposició addicional de la Llei del patrimoni català de 1993."},{"page_url":"https://ca.wikipedia.org/wiki/Plat%C3%B3_de_Bactriana","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Plato_Tetradrachm_MZ.jpg","page_title":"Plató de Bactriana","context_page_description":"Platófou un rei grec de Bactriana que va regnar per un temps breu a Bactriana i Paropamisades en algun moment vers la meitat del segle II aC. L'estil de les monedes de Plató suggereix que era parent, probablement germà segons l'edat calculada per la seva imatge, d'Eucràtides I de Bactriana el Gran, que va pujar al poder vers el 170 aC.\\nAlgunes monedes de Plató porten inscripcions que han estat interpretades com a dates de l'era indogrega que comença el 186 aC; si fos així hauria governat vers el 140 aC; Osmund Bopearachchi, el situa vers 145-140 aC, ja que no s'han trobat monedes seves a les ruïnes d'Ai Khanoum, una ciutat de Bactriana destruïda durant el regnat d'Eucràtides; anteriorment s'havia suggerit com a data el 166 aC, sent rei associat al seu germà, però més aviat sembla que el va intentar succeir al ser aquest assassinat."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_dos_condes_de_Art%C3%A9sia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Guillaume_Cliton.jpg","page_title":"Lista dos condes de Artésia","context_page_description":"Os condes de Artésia governaram o Condado de Artésia desde o século IX até a abolição do condado em 1790 pela Revolução Francesa."},{"page_url":"https://pl.wikipedia.org/wiki/Devon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Crazywell_cross_1.JPG","page_title":"Devon","context_page_description":"Devon – hrabstwo ceremonialne i niemetropolitalne w Anglii, w regionie South West England, położone we wschodniej części Półwyspu Kornwalijskiego, pomiędzy Kornwalią na zachodzie a hrabstwami Somerset i Dorset na wschodzie. Jest jedynym hrabstwem położonym nad dwoma akwenami morskimi – kanałem La Manche na południu i Kanałem Bristolskim na północy – z oddzielną linią brzegową.\\nJako hrabstwo ceremonialne liczy 3485 km², będąc czwartym pod względem wielkości hrabstwem Anglii, podczas gdy jednostka administracyjna liczy 3255 km² i jest trzecia pod względem wielkości. Liczba ludności hrabstwa ceremonialnego wynosi 1 133 800, a administracyjnego – 746 400. Stolicą hrabstwa jest Exeter, położony na wschodzie.\\nDevon jest hrabstwem o profilu rolniczo-przemysłowym, z dużym udziałem turystyki w gospodarce regionu. Największym miastem jest Plymouth, będący jednym z dwóch miast w hrabstwie posiadających status city, zlokalizowany na południowo-zachodnim krańcu hrabstwa. Kolejnym większym ośrodkiem miejskim jest konurbacja Torbay na południowym wybrzeżu, w skład której wchodzą miasta Torquay, Paignton i Brixham, będąca ważnym ośrodkiem turystycznym."},{"page_url":"https://cs.wikipedia.org/wiki/Secure_Digital","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Application_Performance_Class_1.png","page_title":"Secure Digital","context_page_description":"Secure Digital je paměťová karta používaná v přenosných zařízeních včetně digitálních fotoaparátů, přenosných počítačů a mobilních telefonů či tabletů."},{"page_url":"https://en.wikipedia.org/wiki/Achaemenid_conquest_of_the_Indus_Valley","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Tomb_of_Darius_I_Image_of_Darius_I.jpg","page_title":"Achaemenid conquest of the Indus Valley","context_page_description":"The Achaemenid conquest of the Indus Valley refers to the Achaemenid military conquest and occupation of the territories of the North-western regions of the Indian subcontinent, from the 6th to 4th centuries BC. The conquest of the areas as far as the Indus river is often dated to the time of Cyrus the Great, in the period between 550-539 BCE. The first secure epigraphic evidence, given by the Behistun Inscription, gives a date before or about 518 BCE. Achaemenid penetration into the area of the Indian subcontinent occurred in stages, starting from northern parts of the River Indus and moving southward. These areas of the Indus valley became formal Achaemenid satrapies as mentioned in several Achaemenid inscriptions. The Achaemenid occupation of the Indus Valley ended with the Indian campaign of Alexander the Great circa 323 BCE. The Achaemenid occupation, although less successful than that of the later Greeks, Sakas or Kushans, had the effect of acquainting India to the outer world."},{"page_url":"https://pl.wikipedia.org/wiki/Nieder-Beerbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/M%C3%BChltal_-_Burg_Frankenstein_-_Kapelle_02_ies.jpg","page_title":"Nieder-Beerbach","context_page_description":"Nieder-Beerbach – część miejscowości w gminie Mühltal w Niemczech, w kraju związkowym Hesja, w rejencji Darmstadt, w powiecie Darmstadt-Dieburg."},{"page_url":"https://hu.wikipedia.org/wiki/Vlagyimir_Nyikitovics_Jerohin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Vladimir_Yerokhin_1958.jpg","page_title":"Vlagyimir Nyikitovics Jerohin","context_page_description":"Vlagyimir Nyikitovics Jerohin szovjet válogatott labdarúgóhátvéd.\\nA szovjet válogatott tagjaként részt vett az 1958-as labdarúgó-világbajnokságon."},{"page_url":"https://sk.wikipedia.org/wiki/Frasseto","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Map_commune_FR_insee_code_2A119.png","page_title":"Frasseto","context_page_description":"Frasseto je francúzska obec, ktorá sa nachádza v departemente Corse-du-Sud, v regióne Korzika."},{"page_url":"https://en.wikipedia.org/wiki/Saint_Thomas_Becket_window_in_Chartres_Cathedral","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Chartres_18_-02b.jpg","page_title":"Saint Thomas Becket window in Chartres Cathedral","context_page_description":"Saint Thomas Becket window in Chartres Cathedral is a 1215-1225 stained-glass window in Chartres Cathedral, located behind a grille in the Confessors' Chapel, second chapel of the south ambulatory. 8.9 m high by 2.18 m wide, it was funded by the tanners' guild. The furthest left of five lancet windows in the chapel, it is difficult to view and is heavily corroded by glass oxidisation, which has made its left side especially hard to read.\\nIt is contemporary with the current cathedral, built after an 1194 fire. It was classed as a monument historique in the first listing in 1840. The window was restored by Gaudin in 1921 and by Lorin's workshop in 1996. It is split vertically into eleven equal registers by ten horizontal leadwork pieces."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B3%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%9F%D0%B5%D1%80%D0%B5%D0%B2%D1%96%D0%B7%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/ED72-002_at_Krak%C3%B3w_G%C5%82%C3%B3wny.jpg","page_title":"Регіональний Перевізник","context_page_description":"Регіональний Перевізник, також POLREGIO, раніше PKP Регіональний Перевізник, — залізничний оператор у Польщі, що відповідає за регіональні та міжрегіональні перевезення пасажирів. Кожен день він обслуговує приблизно 3000 регіональних поїздів. Протягом 2002 року було перевезено 215 млн пасажирів.\\nКомпанія була заснована після поділу Польської Національної Залізниці на декілька компаній, які відповідають вимогам Європейського Союзу."},{"page_url":"https://simple.wikipedia.org/wiki/Prime_Minister_of_Syria","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Coat_of_arms_of_Syria.svg","page_title":"Prime Minister of Syria","context_page_description":"The Prime Minister of Syria is the head of government of the Syrian Arab Republic.\\nThe Prime Minister is appointed by the President of Syria. He works with other ministers and members of the government that the new Prime Minister recommends.\\nThe People's Council of Syria then approve the legislative program of the new government, before the new government formally take office. There are no constitutional limits on a Prime Minister's term, and several of them served multiple non-consecutive terms."},{"page_url":"https://pl.wikipedia.org/wiki/Veit_Harlan","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Bundesarchiv_Bild_183-2007-1022-508%2C_Hamburg%2C_Prozess_gegen_Veit_Harlan.jpg","page_title":"Veit Harlan","context_page_description":"Veit Harlan – niemiecki reżyser i aktor, autor narodowosocjalistycznych filmów propagandowych."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E7%B5%90%E5%A9%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Catholic_wedding_in_India.jpg","page_title":"結婚","context_page_description":"結婚（粵拼：git³ fan¹）係男女之間組織家庭，男方做女方老公，而女方做男方個老婆，結咗婚之後，佢哋會性交，會有仔女；同同居唔同；報稅又唔同身份；申請公屋同宿舍都方便啲。有啲地方亦容許男方同男方，或者女方同女方結婚。"},{"page_url":"https://en.wikipedia.org/wiki/Contact_lens","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Contact_Grain.jpg","page_title":"Contact lens","context_page_description":"Contact lens, or simply contacts, are thin lenses placed directly on the surface of the eyes. Contact lenses are ocular prosthetic devices used by over 150 million people worldwide, and they can be worn to correct vision or for cosmetic or therapeutic reasons. In 2010, the worldwide market for contact lenses was estimated at $6.1 billion, while the US soft lens market was estimated at $2.1 billion. Multiple analysts estimated that the global market for contact lenses would reach $11.7 billion by 2015. As of 2010, the average age of contact lens wearers globally was 31 years old, and two-thirds of wearers were female.\\nPeople choose to wear contact lenses for many reasons. Aesthetics and cosmetics are the main motivating factors for people who want to avoid wearing glasses or to change the appearance of their eyes. Others wear contact lenses for functional or optical reasons. When compared with spectacles, contact lenses typically provide better peripheral vision, and do not collect moisture or perspiration. This can make them preferable for sports and other outdoor activities."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D1%82%D0%B5%D1%80_(%D0%BC%D0%B8%D1%84%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Earliest_appearance_of_Krodo_Sachsenchronik_1492.jpg","page_title":"Ситер (мифология)","context_page_description":"Ситер — предполагаемый германский бог. Изображался стоящим на острой колючей спине окуня, как на пьедестале, с непокрытой головой, в левой руке он держит колесо, а в правой — ведро с водой, в котором находятся цветы и фрукты.\\nОписание этого божества, не зафиксированного средневековыми источниками, содержится в трактате Ричарда Верстегена об англосаксонском язычестве, опубликованном впервые в 1605 году, ставшим популярным и неоднократно переизданным. Верстеген, умелый гравёр, снабдил свою работу иллюстрациями, показывавшими «идолы» древних божеств: на эти гравюры явно повлияла современная ему литература об эмблемах. Разработанные им образы богов, в том числе и Ситера, неоднократно воспроизводились в работах XVII—XIX веков. Ситер, альтернативным именем которого было «Кродо» или «Кротто», был показан, как германский вариант Сатурна: именно от него, а не от Сатурна якобы происходило название субботы в германских языках. Наряду с другими германскими божествами, символизировавшими дни недели, Ситер нередко упоминался в художественной литературе, в том числе в драме: его изображение появлялось на сцене в пьесах, где действие происходило в англо-саксонской Англии."},{"page_url":"https://en.wikipedia.org/wiki/Jonas_Erikson_Sundahl","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Forbach_ch%C3%A2teau_Barrabino.jpg","page_title":"Jonas Erikson Sundahl","context_page_description":"Jonas Erikson Sundahl was a Swedish-born architect who spent most of his working life at and around Zweibrücken in the German Palatinate. Most of his designs were in the then-modern Baroque style."},{"page_url":"https://de.wikipedia.org/wiki/Friedrich_Opferkuh","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Palais-Ferstel.jpg","page_title":"Friedrich Opferkuh","context_page_description":"Friedrich Opferkuh war ein österreichischer Steinmetzmeister und Bildhauer."},{"page_url":"https://es.wikipedia.org/wiki/Antoine_Laurent_Dantan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/2347.Place_de_la_Republique_dessen_Mitte_ein_Brunnen_kr%C3%B6nt-Arles.JPG","page_title":"Antoine Laurent Dantan","context_page_description":"Antoine Laurent Dantan, llamado Dantan el Viejo, nacido el 8 de diciembre de 1798 en Saint-Cloud, donde murió el 25 de mayo de 1878, es un escultor académico francés. A veces se confunde con su hermano Jean-Pierre Dantan, también escultor y dibujante hoy más conocido."},{"page_url":"https://pt.wikipedia.org/wiki/Le_Bar-sur-Loup","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/Bar-sur-Loup.jpg","page_title":"Le Bar-sur-Loup","context_page_description":"Le Bar-sur-Loup é uma comuna francesa na região administrativa da Provença-Alpes-Costa Azul, no departamento Alpes Marítimos. Estende-se por uma área de 14,47 km², com 2543 habitantes, segundo os censos de 1999, com uma densidade de 175 hab/km²."},{"page_url":"https://ru.wikipedia.org/wiki/Lepidoptera_%D0%B2_10-%D0%BC_%D0%B8%D0%B7%D0%B4%D0%B0%D0%BD%D0%B8%D0%B8_%D0%A1%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D1%8B_%D0%BF%D1%80%D0%B8%D1%80%D0%BE%D0%B4%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Agapeta.hamana.6985.jpg","page_title":"Lepidoptera в 10-м издании Системы природы","context_page_description":"В 10-м издании Системы природы шведского натуралиста Карла Линнея классифицируются членистоногие, включая насекомых, паукообразных и ракообразных, среди них класс «Insecta» и отряд Чешуекрылые. Чешуекрылые насекомые — бабочки — были объединены под названием Lepidoptera.\\nЛинней делил эту группу на 3 рода — Papilio, Sphinx и Phalaena. Первые два вместе с семью подотделами третьего рода, используются как базис для названий 9 надсемейств: Papilionoidea, Sphingoidea, Bombycoidea, Noctuoidea, Geometroidea, Tortricoidea, Pyraloidea, Tineoidea и Alucitoidea."},{"page_url":"https://en.wikipedia.org/wiki/Mersin_Archaeological_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Mersin_Archaeological_Museum%2C_1.jpg","page_title":"Mersin Archaeological Museum","context_page_description":"Mersin Archaeological Museum is a museum in Mersin, Turkey"},{"page_url":"https://fy.wikipedia.org/wiki/P%C3%BBsjkinmuseum","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Gmii.jpg","page_title":"Pûsjkinmuseum","context_page_description":"It Poesjkinmuseum is it grutste museum foar Jeropeeske keunst yn Moskou en stiet tsjinoer de Kristus Ferlosserkatedraal."},{"page_url":"https://vi.wikipedia.org/wiki/Decaisnina_congesta","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Decaisnina_congesta_Dist_world3.png","page_title":"Decaisnina congesta","context_page_description":"Decaisnina congesta là một loài thực vật có hoa trong họ Loranthaceae. Loài này được Barlow mô tả khoa học đầu tiên năm 1983."},{"page_url":"https://en.wikipedia.org/wiki/GR_10_(France)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Saint_Etienne_de_Ba%C3%AFgorry_GR10_Harrieta.jpg","page_title":"GR 10 (France)","context_page_description":"The GR 10 is a French GR footpath, or hiking trail, that runs the length of the Pyrenees Mountains. It roughly parallels the French–Spanish border on the French side. Those attempting the entire trail often choose to walk it from west to east, from Hendaye on the Bay of Biscay to Banyuls-sur-Mer on the Mediterranean Sea, but it can just as easily be traversed east to west."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Bagneaux-sur-Loing","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Gare_de_Bagneaux-sur-Loing.JPG","page_title":"Station Bagneaux-sur-Loing","context_page_description":"Station Bagneaux-sur-Loing is een spoorwegstation aan de spoorlijn Moret-Veneux-les-Sablons - Lyon-Perrache. Het ligt in de Franse gemeente Bagneaux-sur-Loing in het departement Seine-et-Marne."},{"page_url":"https://sv.wikipedia.org/wiki/Krigsh%C3%B6gskolan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/%C3%96stermalmsgatan_87_maj_2018_%2811%29.jpg","page_title":"Krigshögskolan","context_page_description":"Krigshögskolan var en militärhögskola inom svenska armén som verkade i olika former åren 1866–1961. Skolan var förlagd i Stockholms garnison i Stockholm."},{"page_url":"https://en.wikipedia.org/wiki/Heikki_Kovalainen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Renault_R27_Kovalainen_Australian_GP_2007.jpg","page_title":"Heikki Kovalainen","context_page_description":"Heikki Johannes Kovalainen is a Finnish racing driver. He raced in Formula One between 2007 and 2013 for the Renault, McLaren, Team Lotus, Caterham and Lotus F1 teams, scoring a single victory at the 2008 Hungarian Grand Prix. In August 2020, Kovalainen was listed as the 8th fastest driver from 1983 to 2020 by F1. Since then, he has raced in the Japanese Super GT series, where he won the championship in 2016.\\nHe was supported by the Renault Driver Development programme early in his racing career, during which he won the World Series by Nissan championship and finished runner-up in the GP2 series. Renault signed him on as a full-time Formula One test driver for 2006, and then promoted him to a race seat for 2007. He gained his first podium by finishing second in the Japanese Grand Prix that year.\\nHe moved to McLaren for the 2008 season, where he partnered Lewis Hamilton. His second season in Formula One saw him achieve his first pole position at Silverstone and his first victory at the Hungaroring, becoming the 100th driver to win a Formula One Grand Prix. He remained with the team for the 2009 season."},{"page_url":"https://es.wikipedia.org/wiki/Instituto_Tecnol%C3%B3gico_de_Tlalnepantla","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/ITTLA.jpg","page_title":"Instituto Tecnológico de Tlalnepantla","context_page_description":"El Instituto Tecnológico de Tlalnepantla es una institución de nivel superior, que forma parte del Tecnológico Nacional de México. Goza de un gran prestigio y tradición, y se considera el primero en el ranking de los tecnológicos en México, brindando una excelente educación. Desde el año 2011 ha sido una de las universidades con más demanda, por ser una institución de gran calidad y formadora de estupendos profesionales de todas la carreras."},{"page_url":"https://ru.wikipedia.org/wiki/STS-131","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/STS-131_launching_from_Kennedy_Space_Center.jpg","page_title":"STS-131","context_page_description":"STS-131 — космический полёт MTKK «Дискавери» по программе «Спейс Шаттл». 33-й полет шаттла к Международной космической станции."},{"page_url":"https://pt.wikipedia.org/wiki/Mar_de_B%C3%B3tnia","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Bottenhavet.png","page_title":"Mar de Bótnia","context_page_description":"O mar Botniano ou mar de Bótnia é uma parte do golfo de Bótnia, no mar Báltico. Fica entre o estreito de Kvarken, a norte, e o mar de Alanda e o mar do Arquipélago, a sul. Juntos, o mar e a baía de Bótnia formam uma entidade geográfica maior, o golfo de Bótnia, situado entre a Suécia, a oeste, a Finlândia, a leste, o mar de Åland e, ao sul, o mar do Arquipélago. A superfície total do mar de Bótnia é de, aproximadamente, 79 000 km². As maiores cidades costeiras são, do sul para o norte, Rauma e Pori, na Finlândia, e Gävle e Sundsvália, na Suécia."},{"page_url":"https://da.wikipedia.org/wiki/Dogo_Argentino","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Male_fawn_Boxer_undocked.jpg","page_title":"Dogo Argentino","context_page_description":"Dogo Argentino kaldes også argentinsk mastiff og er en stor og muskuløs hunderace af Molossertypen, der er forbudt i flere lande, herunder Danmark. Den er avlet som storvildt jagthund og bliver undertiden uddannet til eftersøgnings- og redningshunde, politihunde, servicehunde og militært arbejde\\nDogo Argentino er ikke velegnet til førstegangsejere."},{"page_url":"https://es.wikipedia.org/wiki/7,62_%C3%97_51_mm_OTAN","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/NATO_7.62x51.jpg","page_title":"7,62 × 51 mm OTAN","context_page_description":"El 7,62 × 51 mm OTAN es un cartucho para fusil desarrollado en los años 1950 y 1960 para ser el cartucho de arma larga estándar de los países de la OTAN. Las especificaciones del cartucho 7,62 × 51 mm OTAN no son idénticas a la del .308 Winchester comercial. Se pueden usar sin problemas tanto la versión 7,62 OTAN como la versión 308 Winchester en fusiles con una recámara 308. Debido a que el 308 produce una presión más alta, no se recomienda usarla en armas con una recámara de 7,62 x 51 mm OTAN, mismo si no produce resultados catastróficos. ​\\nTampoco se debe confundir el 7,62 OTAN con el 7,62x54mmR, un cartucho de pestaña que es un poco más alto y que comparte básicamente el mismo rendimiento balístico."},{"page_url":"https://eo.wikipedia.org/wiki/Saint-Michel-de-Maurienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Croixdestetes.jpg","page_title":"Saint-Michel-de-Maurienne","context_page_description":"Saint-Michel-de-Maurienne estas komunumo de Francio. Ĝi situas en la departemento Savojo, en la regiono Aŭvernjo-Rodano-Alpoj, kaj en la samnoma historia regiono Savojo. Fine de 2017 en la komunumo vivis 2 461 loĝantoj."},{"page_url":"https://en.wikipedia.org/wiki/Lorenzo_Mariani","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Harvard_yard_winter_2009j.JPG","page_title":"Lorenzo Mariani","context_page_description":"Lorenzo Mariani is a stage director of opera in Italy, the United States, Israel, Finland, and across the world. From 2005 to 2012 Mariani has been artistic director of the Teatro Massimo in Palermo. The Teatro Massimo is the largest theatre in Italy."},{"page_url":"https://sw.wikipedia.org/wiki/Sinaloa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Ulama_37_%28Aguilar%29.jpg","page_title":"Sinaloa","context_page_description":"Sinaloa ni moja kati ya majimbo 31 ya Mexiko upande wa magharibi ya nchi. Upande wa magharibi ni Ghuba ya California. Imepakana Sonora, Chihuahua, Durango na Nayarit.\\nMji mkuu na mji mkubwa ni Culiacán. Jimbo lina wakazi wapatao 2,208,652 wanaokalia katika eneo la kilomita za mraba zipatazo 58,238.\\nUtalii na kilimo huajiri watu wengi.\\nGavana wa jimbo ni Jesús Aguilar Padilla.\\nLugha rasmi ni Kihispania."},{"page_url":"https://it.wikipedia.org/wiki/Mont_(Nuova_Aquitania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Eglise_de_Mont_%28Pyr%C3%A9n%C3%A9es-Atlantiques%29.JPG","page_title":"Mont (Nuova Aquitania)","context_page_description":"Mont è un comune francese di 1.117 abitanti situato nel dipartimento dei Pirenei Atlantici nella regione della Nuova Aquitania."},{"page_url":"https://it.wikipedia.org/wiki/Tranvia","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Broadway_Sydney_1910.jpg","page_title":"Tranvia","context_page_description":"Con il termine tranvia, si intende l'infrastruttura di trasporto terrestre, idonea alla circolazione di tram sia per il trasporto di persone che di merci."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Game_%26_Watch_games","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Vermin_-_Game%26Watch_-_Nintendo.jpg","page_title":"List of Game & Watch games","context_page_description":"This is a list of Game & Watch games released by Nintendo, along with their format and date of release, if known. See lists of video games for related lists. Several of these games were collected and re-released as ports for the Game & Watch Gallery series for Game Boy, Game Boy Color, and Game Boy Advance. The games also were re-released as stand-alone games for the Nintendo Mini Classics series in the late 1990s. Digital versions of the games were created as DSiWare which was released for Nintendo DSi in 2009 and for Nintendo 3DS in 2011."},{"page_url":"https://ca.wikipedia.org/wiki/Infern_-_Cant_Vint-i-tres%C3%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Inferno_Canto_23_verses_92-94.jpg","page_title":"Infern - Cant Vint-i-tresè","context_page_description":"El cant vint-i-tresè de l'Infern de Dante Alighieri té lloc en la sisena fossa del vuitè cercle, on són castigats els hipòcrites; som al matí del 9 d'abril de 1300, o segons altres comentaristes el 26 de març de 1300.\\nDesprés dels dos anteriors, el cant tanca l'episodi del fossat dels estafadors, on Dante i Virgili són testimonis de les aventures d'un grup de diables, que els són assignats, malgrat ells mateixos i com a escorta no sol·licitada. La primera part del cant segueix l'estil dels dos anteriors, clarament còmic, amb un ritme ràpid i nombrosos personatges, clar exemple de la ductilitat poètica de Dante. La segona part, amb un to i un ambient completament diferent, està dedicada al fossat dels hipòcrites, abans del final amb sorpresa que torna a un estil més burlesc i que tanca el passatge dels diables de la fossa anterior."},{"page_url":"https://en.wikipedia.org/wiki/List_of_HSC_ferry_routes","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Leonora_Christina_IMO_9557848_-_7.JPG","page_title":"List of HSC ferry routes","context_page_description":"This is a list of high-speed craft ferry routes.\\nMany routes are operated by catamarans, as catamarans are a faster craft than a similar sized monohulls.\\nIn the 1990s monohull HSCs with capacity for cars and buses have taken over many routes."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%87%D8%A7%D8%B1%D9%88%D9%86_%D8%B1%D8%A7%D8%B2%D9%8A%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Aharon_Razel.jpg","page_title":"اهارون رازيل","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاهارون رازيل عازف مزيكا من اسرائيل."},{"page_url":"https://en.wikipedia.org/wiki/List_of_indoor_arenas_in_the_United_States","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/AlliantOUTSIDE.jpg","page_title":"List of indoor arenas in the United States","context_page_description":"This is a list of indoor arenas in the United States."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%91%D1%83%D1%85%D0%B0%D1%80%D0%B5%D1%81%D1%82_%D1%81%D0%BE%D0%BB%D1%8B%D1%85%D1%8B_(1918)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Harta_administrativa_Romania_1918_05_07.PNG","page_title":"Бухарест солыхы (1918)","context_page_description":"1918 елгы Бухарест солыхы — 1918 елда Бухарестта Дүртлек берлеге илләре белән Румыния арасында имзаланган солых килешүе. Әлеге солых килешүе Дүртлек илләренең Румыниягә каршы сугыш хәрәкәтләрен туктата. 1918 елның 5 мартында кул куелган прелиминар килешү шартларын яңадан раслый."},{"page_url":"https://ca.wikipedia.org/wiki/Tomba_de_Vix","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Vix01.JPG","page_title":"Tomba de Vix","context_page_description":"La Tomba de Vix és una sepultura principesca de les anomenades de carro que va aparèixer en excavar la necròpoli d'un oppidum hallstàttic situat al costat de la ciutat francesa de Vix, al nord de la Borgonya, França. Forma part d'un important complex prehistòric dels períodes cèltics de cultura Hallstatt i La Téne, que comprèn un assentament fortificat important i diversos túmuls funeraris. Ha arribat intacta fins als nostres dies, i entre l'aixovar funerari, destaca una gegantesca cràtera de bronze d'origen grec, la qual cosa confirma l'existència de relacions econòmiques entre el Mediterrani i el centre d'Europa ja al Segle VI aC."},{"page_url":"https://de.wikipedia.org/wiki/Ganzkow_(Brunn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/2007-05-19_Ganzkow_%2853%29.jpg","page_title":"Ganzkow (Brunn)","context_page_description":"Ganzkow ist ein Ortsteil der Gemeinde Brunn im Landkreis Mecklenburgische Seenplatte in Mecklenburg-Vorpommern."},{"page_url":"https://no.wikipedia.org/wiki/Goro_Adachi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Adachi_Goro.JPG","page_title":"Goro Adachi","context_page_description":"Goro Adachi var en japansk skihopper.\\nHan representerte Japan under Vinter-OL 1932 i Lake Placid, der han ble nummer 8 i det individuelle hopprennet."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkmale_in_Deidesheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/ND-7332-509_Felsblock_am_Gemminger_Hinkelstein_0007.jpg","page_title":"Liste der Naturdenkmale in Deidesheim","context_page_description":"Die Liste der Naturdenkmale in Deidesheim nennt die im Stadtgebiet von Deidesheim ausgewiesenen Naturdenkmale."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B5%D1%80%D1%80%D0%B8_II_(%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3_%D0%9B%D0%BE%D1%82%D0%B0%D1%80%D0%B8%D0%BD%D0%B3%D0%B8%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Frederick_II_of_Lorraine.png","page_title":"Ферри II (герцог Лотарингии)","context_page_description":"Ферри II Лотарингский — герцог Лотарингии с 1206 года. Сын Ферри I де Бич и его жены Людмилы Польской, дочери князя Мешко Старого."},{"page_url":"https://sv.wikipedia.org/wiki/Karl_Staaffs_park","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Karl_Staafs_park_2013%2C_A_01.jpg","page_title":"Karl Staaffs park","context_page_description":"Karl Staaffs park är en park på Norrmalm i centrala Stockholm belägen vid korsningen Birger Jarlsgatan och Regeringsgatan. Platsen där torget och Eriksbergsplan på andra sidan Birger Jarlsgatan ligger var tidigare känt som Träsktorget där skampålen för offentliga bestraffningar en tid var placerad.\\nDen lilla parken hade ursprungligen namnet Spårvägsparken efter en på platsen belägen avlösningskiosk för spårvagnspersonal och AB Stockholms Spårvägars huvudkontor i närheten. En mindre byggnad ritad av Nils Cronholm inrymde från 1912 John A. Bergendahls biograf Birger Jarl.\\nPå 1940-talet uppsattes en porträttbyst av Sveriges f.d. statsminister Karl Staaff, vilket föranledde byte till det nuvarande namnet år 1980. Granitbysten som utförts av Carl Eldh 1921 stod ursprungligen i en plantering på Sveavägen utanför Adolf Fredriks kyrka men flyttades vid gatans omdaning.\\nVåren 2013 fattades beslutet att parken skall bebyggas med bostäder, då Stockholms stad sålde en markanvisning för 171 miljoner kronor."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_l%27Ari%C3%A8ge","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Ch%C3%A2teau_de_Lagarde_%C3%A0_Seix_%28Ari%C3%A8ge%29.jpg","page_title":"Liste des monuments historiques de l'Ariège","context_page_description":"Cet article recense les monuments historiques de l'Ariège, en France.\\nPour les monuments historiques de la commune de Mirepoix, voir la liste des monuments historiques de Mirepoix."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Br%C3%A2znic","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/RO_HD_Braznic_7.jpg","page_title":"Biserica de lemn din Brâznic","context_page_description":"Biserica de lemn din Brâznic, comuna Ilia, județul Hunedoara a fost ctitorită aproximativ între 1650-1700. Are hramul „Sf.Cuvioasă Paraschiva”. Figurează pe lista monumentelor istorice, cod LMI HD-II-m-A-03271."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%AE%D0%B4%D0%B8%D1%82_%D0%9B%D0%B5%D0%B9%D1%81%D1%82%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Judith_Leyster_-_Blompotje_1654.jpg","page_title":"Юдит Лейстер","context_page_description":"Юдит Лейстер — голландська художниця першої половини 17 століття, єдина жінка-художниця гільдії Св. Луки міста Гарлем на той час."},{"page_url":"https://ms.wikipedia.org/wiki/Kementerian_Dalam_Negeri_Persekutuan_(Jerman)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Siegelmarke_Reichsministerium_des_Innern_W0255488.jpg","page_title":"Kementerian Dalam Negeri Persekutuan (Jerman)","context_page_description":"Kementerian Dalam Negeri Persekutuan, disingkatkan BMI, adalah sebuah kementerian peringkat kabinet bagi Republik Persekutuan Jerman. Pejabat utamanya terletak di Berlin, dengan satu lagi pejabat di Bonn. Menteri Dalam Negeri terkini ialah Horst Seehofer."},{"page_url":"https://fr.wikipedia.org/wiki/Mononyme","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Tintorettoselfportrait.jpg","page_title":"Mononyme","context_page_description":"Un mononyme est un nom unique identifiant généralement une personne, comme Voltaire ou Colette. Il peut s'agir soit d'un pseudonyme comme c'est le cas pour Voltaire, soit d'un nom de convenance, comme c'est le cas pour Colette, soit du vrai prénom utilisé seul, par exemple pour le chanteur Renaud."},{"page_url":"https://en.wikipedia.org/wiki/Cheonghaejin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Chunghaejin_04.jpg","page_title":"Cheonghaejin","context_page_description":"Cheonghaejin was a major military headquarters and trading hub located on Wando island, South Jeolla province of South Korea, and established by Korean general Jang Bogo in 828 ACE during the Silla kingdom period. It traded mainly with Tang Dynasty China and Japan, and served as a military hub to combat various pirate factions."},{"page_url":"https://en.wikipedia.org/wiki/Chinese_aircraft_carrier_Liaoning","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Aircraft_Carrier_Liaoning_CV-16.jpg","page_title":"Chinese aircraft carrier Liaoning","context_page_description":"Liaoning is a Chinese Type 001 aircraft carrier. The first aircraft carrier commissioned into the People's Liberation Army Navy Surface Force, she was originally classified as a training ship, intended to allow the Navy to experiment, train and gain familiarity with aircraft carrier operations. Following upgrades and additional training in late 2018, the Global Times announced that the ship would shift to a combat role in 2019.\\nOriginally laid down in 1985 for the Soviet Navy as the Kuznetsov-class aircraft cruiser Riga, she was launched on 4 December 1988 and renamed Varyag in 1990. After the dissolution of the Soviet Union in 1991, construction was halted and the ship was put up for sale by Ukraine. The stripped hulk was purchased in 1998 and towed to the Dalian naval shipyard in northeast China.\\nThe ship was rebuilt and commissioned into the People's Liberation Army Navy as Liaoning on 25 September 2012. Its Chinese ship class designation is Type 001. In November 2016, the political commissar of Liaoning, Commodore Li Dongyou, stated that Liaoning was combat ready."},{"page_url":"https://de.wikipedia.org/wiki/Kaiserstein_(Gestein)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Karlskirche_Vienna_June_2006_474.jpg","page_title":"Kaiserstein (Gestein)","context_page_description":"Der Kaiserstein ist ein besonders dichter und widerstandsfähiger Leithakalk aus den Brüchen von Kaisersteinbruch. Diese Steinbrüche lagen bis 1921 auf ungarischem Boden, so ist vom „harten ungarischen Stein“ zu lesen, im Gegensatz zum „weichen ungarischen Stein“, wie der Margarethener Stein bezeichnet wurde. Das war aus Konkurrenzgründen mitunter abwertend gemeint, vor allem von Seiten des Eggenburger Steinmetzhandwerkes mit dem Zogelsdorfer Stein. Trotzdem heirateten mehrere Eggenburger Gesellen in die italienisch-schweizerischen Meisterfamilien im kaiserlichen Steinbruch ein und waren danach sehr erfolgreich.\\nDie Ausgrabung des römischen Gutshofs, Grabsteine, unter anderem im Schloss Königshof, bezeugen, dass bereits die Römer hier dieses Gestein gebrochen und bearbeitet haben. Steinmetzmeister Friedrich Opferkuh forschte nach dem „Römersteinbruch“ von Kaisersteinbruch und ortete ihn im Waldbruch."},{"page_url":"https://pl.wikipedia.org/wiki/Kim_Yang_G%C5%8Fn","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Kim_Yang-Gon.jpg","page_title":"Kim Yang Gŏn","context_page_description":"Kim Yang Gŏn – północnokoreański polityk. Ze względu na przynależność do najważniejszych gremiów politycznych Korei Północnej, uznawany za członka ścisłej elity władzy KRLD."},{"page_url":"https://en.wikipedia.org/wiki/Kaposv%C3%A1r_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Kaposv%C3%A1ri_j%C3%A1r%C3%A1s.png","page_title":"Kaposvár District","context_page_description":"Kaposvár is a district in the central-eastern part of Somogy County. Kaposvár is also the name of the town where the district and county seat is found. The district is located in the Southern Transdanubia Statistical Region."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BB%D0%B5%D1%80%D0%BE_(%D0%BE%D0%B4%D0%B5%D0%B6%D0%B4%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Spanish_lady_in_green_by_A.Golovin_%281906-7%29.jpg","page_title":"Болеро (одежда)","context_page_description":"Болеро́ — предмет верхней одежды; короткая, открытая спереди курточка без застёжки, укороченный жакет длиной выше талии с полукруглыми бортами и рукавом различной длины, узким по всей длине или с буфами, либо вовсе без него. В более широком смысле — любой укороченный жакет. Может иметь воротник, в том числе, переходящий в лацканы-апаш, а также застёжку на крючках либо на одну-две пуговицы.\\nЭтот предмет одежды заимствован из испанского национального костюма, где традиционно шился из льна, шерсти а также бархата либо атласа и носился поверх белой блузки. Своё название получил благодаря одноимённому народному танцу. Во Франции распространился в середине XIX века как дань императрице Евгении, испанке по происхождению. В те времена шился с баской и оторачивался бахромой. Вновь вернулся в моду в 1890-х, но уже без баски и в укороченном виде.\\nВ качестве детского костюма носился как девочками, так и мальчиками — наравне с зуавами и матроской.\\nВ XX веке зачастую надевался поверх платья для создания эффекта костюма-двойки. Этот приём использовали испанец Кристобаль Баленсиага, Кристиан Диор, Жак Фат и другие парижские кутюрье."},{"page_url":"https://af.wikipedia.org/wiki/Drummond_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/StateLibQld_1_146779_Drummond_Castle_%28ship%29.jpg","page_title":"Drummond Castle","context_page_description":"Die Drummond Castle was 'n stoomskip van Donald Currie and Co redery wat in een van die rampspoedigste skeepSrampe in die Suid-Afrikaanse geskiedenis betrokke was. Die skip is in 1881 te water gelaat en het 3 663 ton water verplaas. Dit was een van die gewildste en modernste skepe van die redery. Dit was ook voorsien van elektriese krag - een van die eerstes.\\nOp 16 Junie 1896 het die Drummond Castle op sy vaart na Engeland by Kaap Ushant op die Franse kus op 'n rif geloop en sy bodem oopgeskeur. Hy het binne 4 minute gesink en van die 245 mense aan boord is net drie gered, insluitende een passasier. Aan boord van die skip was ook goudmonsters van die Vrystaatse Goudveld wat tesame met die eienaars Donaldson en Haines vergaan het."},{"page_url":"https://en.wikipedia.org/wiki/HCLS1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/PBB_GE_HCLS1_gnf1h09285_s_at_fs.png","page_title":"HCLS1","context_page_description":"Hematopoietic lineage cell-specific protein is a protein that in humans is encoded by the HCLS1 gene."},{"page_url":"https://hu.wikipedia.org/wiki/T%C3%B6r%C3%B6kk%C3%BAt-forr%C3%A1s_(Solym%C3%A1r)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Feld%C3%BAltT%C3%B6r%C3%B6kk%C3%BAt02.jpg","page_title":"Törökkút-forrás (Solymár)","context_page_description":"A Törökkút-forrás egy foglalt karsztforrás Pest megyében, Solymár belterületén, a Budai-hegység északi részén található Zsíros-hegy hegytömbjének keleti lejtőjén. Régen hosszú időn keresztül e forrás látta el ivóvízzel a településen élőket, foglalása és vizének kiépített vezetéken történő elvezetése biztosan több évszázados múltra tekint vissza; a helyi hagyomány török eredetűnek tartja, de egyes kutatók nem zárják ki a római eredetét sem. A forrás látogatható, de megközelítési útvonala kiépítetlen és elhanyagolt."},{"page_url":"https://id.wikipedia.org/wiki/Prasasti_Sanggurah","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Minto_stone.jpg","page_title":"Prasasti Sanggurah","context_page_description":"Prasasti Sanggurah merupakan prasasti berangka tahun 982 Masehi yang ditemukan di daerah Malang dan menyebut nama penguasa daerah itu, Sri Maharaja Rakai Pangkaja Dyah Wawa Sri Wijayalokanamottungga. Prasasti berbentuk tablet ini disebut juga Prasasti Minto karena dihadiahkan oleh Raffles kepada Lord Minto, keduanya pernah memimpin Hindia Belanda ketika Britania Raya menguasai Belanda pada dasawarsa kedua abad ke-19. Raffles sendiri memperolehnya sebagai hadiah dari Kolonel Colin Mackenzie, yang mengambilnya setelah melihat batu bertulis ini.\\nPrasasti bertinggi 2 meter dengan bobot 3,8 ton ini dianggap penting karena menyebut raja Medang, yang berpusat di Jawa Tengah, sebagai penguasa daerah Malang, di Jawa Timur, meskipun angka tahunnya tidak bersepakat dengan prasasti lainnya. Isinya dianggap dapat membantu memecahkan misteri pindahnya pusat kekuasaan dari Jawa Tengah ke wilayah timur Pulau Jawa.\\nSetelah berpuluh-puluh tahun berada di tangan pewaris keluarga Lord Minto di Roxburghshire, Skotlandia, benda bersejarah ini akan dikembalikan ke Indonesia dan disimpan di Museum Nasional."},{"page_url":"https://en.wikipedia.org/wiki/1921_Auckland_East_by-election","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/George_Warren_Russell.jpg","page_title":"1921 Auckland East by-election","context_page_description":"The 1921 Auckland East by-election was a by-election in the New Zealand electorate of Auckland East, an urban seat at the top of the North Island.\\nThe by-election was held on 2 December 1921, and was precipitated by the resignation of sitting Liberal member of parliament and former Mayor of Auckland, Arthur Myers."},{"page_url":"https://de.wikipedia.org/wiki/Kilian_Kesselring","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Kilian_Kesselring_%281583%E2%80%931650%29_Generalwachtmeister_der_Landgrafschaft_Thurgau%2C_Ehegerichtsschreiber.jpg","page_title":"Kilian Kesselring","context_page_description":"Kilian Kesselring war ein Schweizer Generalwachtmeister und Ehegerichtsschreiber."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Winterswijk_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Woning_bij_de_synagoge_te_Winterswijk.jpg","page_title":"Lijst van rijksmonumenten in Winterswijk (plaats)","context_page_description":"De plaats Winterswijk telt 30 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://en.wikipedia.org/wiki/Borgue,_Dumfries_and_Galloway","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Castle_Haven%2C_Borgue.jpg","page_title":"Borgue, Dumfries and Galloway","context_page_description":"Borgue is a village and parish in the Stewartry of Kirkcudbright in Dumfries and Galloway, Scotland. It lies 5 miles south-west of Kirkcudbright and 6 miles south of Gatehouse of Fleet. The name Borgue is from Old Norse borg 'stronghold'.\\nBorgue Parish Church was built in 1814 and designed by architect Walter Newall with alterations dating from 1897-98. Due to a dwindling congregation it closed in August 2018. The churchyard contains the late C19 Gothic mausoleum of the Gordons of Earlston.\\nAccording to folk tradition, Borgue was once the home of a boy who could consort with the fairies."},{"page_url":"https://fr.wikipedia.org/wiki/Ferrari_599_GTB_Fiorano","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Ferrari599_A6_1.JPG","page_title":"Ferrari 599 GTB Fiorano","context_page_description":"La Ferrari 599 GTB Fiorano est une voiture de sport produite par le constructeur italien Ferrari. Apparue en 2006, elle remplace les Ferrari 575M GTC et Ferrari 575M Maranello commercialisées en 2002, et succède, plus généralement, à la lignée des Ferrari 550 Maranello introduite en 1996.\\nEn 2012, la Ferrari 599 GTB Fiorano est remplacée par la Ferrari F12berlinetta."},{"page_url":"https://es.wikipedia.org/wiki/Salinas_de_Im%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Salinas_de_Im%C3%B3n_3.jpg","page_title":"Salinas de Imón","context_page_description":"Las salinas de Imón eran las mayores salinas de la zona y durante mucho tiempo las de mayor producción en la península ibérica. A día de hoy se encuentran abandonadas. Se encuentran en la localidad homónima de Imón, perteneciente al término municipal de Sigüenza."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D5%B8%D6%82%D5%AC%D5%AB%D5%B8_%D4%BF%D5%AC%D5%B8%D5%BE%D5%AB%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Julije_Klovic_2.jpg","page_title":"Ջուլիո Կլովիո","context_page_description":"Ջուլիո Կլովիո, 1498, Grižane-Belgrad, Պրիմորսկո Գորանսկա, Խորվաթիա - հունվարի 3, 1578, Հռոմ, Պապական մարզ, իտալացի գեղանկարիչ-մանրանկարիչ խորվաթական ծագմամբ:"},{"page_url":"https://de.wikipedia.org/wiki/Orgeln_der_Lutherkirche_(Asseln)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Asseln_Nordempore.jpg","page_title":"Orgeln der Lutherkirche (Asseln)","context_page_description":"Die beiden Orgeln der Lutherkirche in Asseln wurden in den Jahren 1906 sowie 1982 von der Orgelbaufirma P. Furtwängler & Hammer bzw. von deren Nachfolgefirma Emil Hammer Orgelbau errichtet. Die Hauptorgel mit 24 Registern befindet sich auf der südlichen Empore. Die Chororgel mit 11 Registern befindet sich in einer Mauernische im Chorraum."},{"page_url":"https://cs.wikipedia.org/wiki/Cloisonn%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/F%C3%ADbula_aquiliforme_%28M.A.N._Madrid%29_01.jpg","page_title":"Cloisonné","context_page_description":"Cloisonné, česky též přihrádkový email, je smaltová technika výzdoby kovových uměleckořemeslných předmětů – šperků, váz, mís, lustrů ap. Název cloisonné bývá užíván i pro předměty takto zdobené. Tato zdobná technika má tradici zejména v Číně a Japonsku, existovala však již ve starém Egyptě, velmi rozšířena byla též v Byzanci a jí inspirované Evropě za doby stěhování národů a následně v románském i gotickém umění, kdy plynule přešla v méně náročnou techniku tzv. jamkového emailu – champlevé."},{"page_url":"https://hu.wikipedia.org/wiki/USS_Barry_(DDG_52)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/USS_Barry_approaches_Souda_Bay.jpg","page_title":"USS Barry (DDG 52)","context_page_description":"Az USS Barry (DDG 52) egy irányított rakétákkal felszerelt romboló, az Amerikai Haditengerészet által üzemeltetett Arleigh Burke osztály második egysége. Az osztályt Arleigh Burke tengernagyról nevezték el, aki a második világháború egyik leghíresebb amerikai rombolóparancsnoka volt, míg a Barry névadója John Barry amerikai tengerésztiszt, akit a Haditengerészet Atyjának is neveznek.\\nA hajó építését 1990. február 26-án kezdték a Virginia állambeli Norfolkban, az Ingalls Shipbuilding hajóépítő vállalatnál. 1991. május 10-én bocsátották vízre és 1991. június 8-án kapta meg jelenlegi nevét. 1992. december 12-én állt hivatalosan szolgálatba az Atlanti Flotta állományában, első parancsnoka Gary Roughead volt.\\nSzolgálati ideje alatt a Barry és legénysége számos díjat és kitüntetést kapott, többek között a Battenberg Kupát háromszor kapta meg - 1994, 1996 és 1998 -, ezzel a Barry az egyetlen Arleigh Burke osztályú romboló, amelyik ezt a kitüntetést megkapta. A 90-es évektől kezdve elismerésként Battenberg Barry néven is emlegették."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_flag_s%C5%82u%C5%BCb_mundurowych_w_Europie","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Flag_of_Belarus_Customs.png","page_title":"Lista flag służb mundurowych w Europie","context_page_description":"Przedstawione są tutaj flagi, sztandary, proporce oraz bandery używane przez służby mundurowe państw europejskich.\\nLista flag używanych przez służby mundurowe państw europejskich w kolejności alfabetycznej:"},{"page_url":"https://nl.wikipedia.org/wiki/Astrio","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Chiesa_SS._Vito%2C_Modesto_e_Crescenzia_-_Astrio_-_Breno_%28Foto_Luca_Giarelli%29.jpg","page_title":"Astrio","context_page_description":"Astrio is een plaats in de Italiaanse gemeente Breno."},{"page_url":"https://en.wikipedia.org/wiki/St_Nicholas%27_Church,_Berden","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Berden_St_Nicholas_exterior_-_11_from_the_north_east.jpg","page_title":"St Nicholas' Church, Berden","context_page_description":"St Nicholas' Church is a Grade I listed parish church in the village of Berden, Essex, England.\\nOf the Early English Gothic style, the church has a Norman nave with 13th-century transepts and a tower dated to the 15th century. It underwent major restoration in 1868.\\nThe church held a 20th-century 38-year revival of a \\"Boy Bishop\\" miracle play. It contains memorials to significant families of the local Berden Hall and Berden Priory, and to a murdered Berden parish constable.\\nSt Nicholas’ is part of a joint benefice—sharing a common priest— in the Deanery of Saffron Walden of the Diocese of Chelmsford. Other churches in the group are St Mary the Virgin at Manuden; St Simon and St Jude at Quendon; and All Saints at Rickling."},{"page_url":"https://el.wikipedia.org/wiki/BMW_507","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/BMW_507_3.JPG","page_title":"BMW 507","context_page_description":"Η BMW 507 ήταν ένα διθέσιο ανοικτό αυτοκίνητο που παρήχθη από τη γερμανική αυτοκινητοβιομηχανία BMW, μεταξύ του 1956 και του 1959. Το μοντέλο παρουσιάστηκε για πρώτη φορά το 1955 στη Διεθνή Έκθεση Αυτοκινήτου της Φρανκφούρτης και προοριζόταν κυρίως για την αγορά των ΗΠΑ. Λόγω του υψηλού κόστους παραγωγής, ωστόσο, και της συνεπακόλουθης εξαιρετικά υψηλής εμπορικής τιμής, οι πωλήσεις του ήταν ελάχιστες, γεγονός που οδήγησε την εταιρεία σε σοβαρές ζημιές και στη διακοπή της παραγωγής της 507, αφού είχαν κατασκευαστεί μόλις 252 αντίτυπα."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%8A%E0%B8%B2%E0%B8%A7%E0%B9%80%E0%B8%81%E0%B8%B2%E0%B8%AB%E0%B8%A5%E0%B8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Kim_Dae-jung_%28Cropped%29.png","page_title":"ชาวเกาหลี","context_page_description":"ชาวเกาหลี เป็นชนชาติพันธุ์กลุ่มหนึ่งซึ่งพูดภาษาเดียวกัน ผลการศึกษาด้านภาษาศาสตร์ และมานุษยวิทยา และแหล่งตำนานต่างๆ แสดงให้เห็นว่า เกาหลีแตกต่างจากจีน หรือญี่ปุ่น ลักษณะเด่นทางร่างกายที่เหมือนกันทำให้เชื่อว่าเกาหลีสืบเชื้อสายมาจากชาวมองโกลหลายเผ่าที่อพยพจากเอเชียกลางเข้ามายังคาบสมุทรเกาหลีในปัจจุบัน\\nชาวเกาหลีรวมกันเป็นชนชาติเดียวกันตั้งแต่ตอนต้นคริสต์ศักราช ในคริสต์ศตวรรษที่เจ็ด ชาวเกาหลีรวมกันเป็นชาติเดียวรวมอยู่ใต้การปกครองเดียวกันเป็นครั้งแรกในสมัยอาณาจักรชิลลา ยังส่งผลให้เกิดความรุ่งเรืองทางวัฒนธรรมอย่างใหญ่หลวง\\nชาวเกาหลีต่อสู้มาอย่างสัมฤทธิ์ผลเป็นเวลาหลายพันปี เพื่อดำรงเอกลักษณ์ทางวัฒนธรรม และการเมืองของตน แม้จะเผชิญกันเพื่อนบ้านอย่างจีน และความโน้มเอียงที่จะรุกรานของญี่ปุ่นเมื่อไม่นานมานี้ก็ตาม ชาวเกาหลีเป็นชนชาติที่ภาคภูมิใจ ด้วยมีประวัติศาสตร์ที่ยาวนานที่สุดชาติหนึ่งของโลก"},{"page_url":"https://sco.wikipedia.org/wiki/Metiria_Turei","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Metiria_Turei.jpg","page_title":"Metiria Turei","context_page_description":"Metiria Turei is a New Zealand politeecian, an a member o the kintra's pairlament in Wellington, representin the Green Pairty. She is a leet member o the pairlament unner the proportional representation seestem."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A7%D0%B0%D0%B2%D1%96%D0%B7%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/HugoChavez1824.jpeg","page_title":"Чавізм","context_page_description":"Чавiзм— палітычная ідэалогія левага толку, на аснове ідэй і практыкі Уга Чавеса, якая спалучае ў сабе элементы папулізму, хрысціянскага сацыялізму, патрыятызму і баліварыянізму."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_FFH-Gebiete_in_Bayern","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Eckersdorf-Oberwaiz_-_Teufelsloch_%28Naturschutzgebiet%29_1.1.16_%284%29.JPG","page_title":"Liste der FFH-Gebiete in Bayern","context_page_description":"Die Liste der FFH-Gebiete in Bayern zeigt die 674 FFH-Gebiete des deutschen Bundeslandes Bayern.\\nTeilweise überschneiden sie sich mit bestehenden Natur- und Landschaftsschutzgebieten."},{"page_url":"https://en.wikipedia.org/wiki/The_Amazing_Race_4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Aerial_view_of_the_Brisbane_CBD_%285275318079%29.jpg","page_title":"The Amazing Race 4","context_page_description":"The Amazing Race 4 is the fourth installment of the American reality television show The Amazing Race. The show features twelve teams, divided in pairs usually based on pre-existing relationships. These teams then race around the world. Season 4 premiered on May 29, 2003 and concluded on August 21, 2003.\\nThen-married couple Reichen Lehmkuhl and Chip Arndt were the winners of the Race and were the first gay couple to win the competition.\\nThe complete season was released on DVD on November 29, 2011."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A6%E3%82%A7%E3%82%B9%E3%83%88%E3%83%90%E3%83%BC%E3%82%B8%E3%83%8B%E3%82%A2%E5%B7%9E%E9%81%B8%E5%87%BA%E3%81%AE%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E4%B8%8A%E9%99%A2%E8%AD%B0%E5%93%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Johnson_N._Camden.jpg","page_title":"ウェストバージニア州選出のアメリカ合衆国上院議員","context_page_description":"ウェストバージニア州選出のアメリカ合衆国上院議員は、ウェストバージニア州から選出されたアメリカ合衆国上院議員である、同州の議員は第1部及び第2部から構成される。\\n現在のウェストバージニア州選出の上院議員は、共和党のシェリー・ムーア・カピトと民主党のジョー・マンチンが務める。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_im_Kreis_Siegen-Wittgenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Wappen_Kreis_Siegen.png","page_title":"Liste der Wappen im Kreis Siegen-Wittgenstein","context_page_description":"Diese Liste beinhaltet alle in der Wikipedia gelisteten Wappen des Kreises Siegen-Wittgenstein in Nordrhein-Westfalen, inklusive historischer Wappen. Alle Städte, Gemeinden und Kreise in Nordrhein-Westfalen führen ein Wappen. Sie sind über die Navigationsleiste am Ende der Seite erreichbar."},{"page_url":"https://pt.wikipedia.org/wiki/Yulee","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/YuleeFLM.png","page_title":"Yulee","context_page_description":"Yulee é uma Região censo-designada localizada no estado americano de Flórida, no Condado de Nassau."},{"page_url":"https://nn.wikipedia.org/wiki/MESSENGER","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Messenger.jpg","page_title":"MESSENGER","context_page_description":"MESSENGER var ein NASA-sonde skoten opp 3. august 2004. Han gjekk i bane kring Merkur mellom 17. mars 2011 og 30. april 2015, då han var tom for drivstoff og styrta inn i Merkur på eit venta tidspunkt. Romsonden karaktiserte den mineralske samansetninga til merkuroverflata, den geologiske historia til planeten, naturen til magnetfeltet, storleiken på og forholda i planetkjernen, leita etter flyktige stoff ved polområda og studerte naturen til eksosfæren og magnetosfæren over ein periode på meir enn fire år. Ferda var den første til Merkur på over 30 år - den førre ferda til Merkur var Mariner 10, som avslutta oppdraget ved Merkur i 1975.\\nNamnet til sonden kjem av at guden Merkur, som var opphavet til Merkur sitt namn, var dei romerske gudane sin bodbringar."},{"page_url":"https://es.wikipedia.org/wiki/Reserva_biol%C3%B3gica_Montecano","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/GreenBottle_Blue_Tarantula.JPG","page_title":"Reserva biológica Montecano","context_page_description":"La Reserva Biológica Montecano ubicada en San José de Cocodite, Península de Paraguaná, en el estado Falcón, Venezuela, es un área con 1600 hectáreas de extensión. en la que se preservan especies animales y vegetales características de Paraguaná. El nombre de la reserva se debe a una planta existente en el sitio conocida como Barba de palo, la misma es propia de lugares húmedos siendo abundante su crecimiento en la reserva. En 2009 se inauguró dentro de la reserva la Escuela de Formación Ambiental y Eco-turística “Esteban Cuauro”.​\\nEn 1987 se firmó un convenio con la Universidad Nacional Experimental Francisco de Miranda, la junta comunal de Cocodite y el Instituto Venezolano de Investigaciones Científicas para el manejo de Montecano, iniciando estas actividades bajo la administración de Bioma. Desde 1995 el instituto falconiano para la investigación, la conservación y el desarrollo sostenible de las zonas áridas y costeras y el Centro de Investigaciones en Ecología y Zonas Áridas están encargados de cuidarla y mantenerla."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%B9%CF%8C%CF%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Hache_221.1_Prespective.fond.JPG","page_title":"Νιόρ","context_page_description":"H Νιόρ είναι κοινότητα στα κέντρο-δυτικά της Γαλλίας, πρωτεύουσα του νομού Ντε-Σεβρ, στην περιοχή Νέα Ακουιτανία.\\nΕίναι χτισμένη στις όχθες του ποταμού Σεβρ Νιορταίζ.\\nΗ πόλη είναι είναι ένα σημαντικό διοικητικό και εμπορικό κέντρο. Είναι η έδρα των κεντρικών γραφείων των κυριότερων γαλλικών αμοιβαίων ασφαλιστικών εταιρειών και θεωρείται η περιφερειακή πρωτεύουσα της κοινωνικής οικονομίαςκαι από τα κύρια χρηματοοικονομικά κέντρα στη Γαλλία.\\nΗ Νιόρ έχει πληθυσμό 59.005 κατοίκους. Η πόλη είναι επίσης έδρα της αστικής κοινότητας Νιορταί, με 149.220 κατοίκους. Η αστική περιοχή περιλαμβάνει 77 κοινότητες και 156.789 κατοίκους.\\nΟι κάτοικοι ονομάζονται Νιορταί."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BE%D0%BA_%D0%98%D0%B4%D0%B0%D0%BD%D1%8C%D1%8F-%D0%B0-%D0%92%D0%B5%D0%BB%D1%8C%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/P8103386crw_%287906305776%29.jpg","page_title":"Замок Иданья-а-Велья","context_page_description":"Замок Иданья-а-Велья — средневековый замок во фрегезии Иданья-а-Велья поселка Иданья-а-Нова округа Каштелу-Бранку Португалии."},{"page_url":"https://en.wikipedia.org/wiki/Hydroxyzine","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Hydroxyzine-3d-sticks.png","page_title":"Hydroxyzine","context_page_description":"Hydroxyzine, sold under the brand names Atarax and others, is a medication of the antihistamine type. It is used in the treatment of itchiness, anxiety, and nausea, including that due to motion sickness. It is used either by mouth or injection into a muscle.\\nCommon side effects include sleepiness, headache, and a dry mouth. Serious side effects may include QT prolongation. It is unclear if use during pregnancy or breastfeeding is safe. Hydroxyzine works by blocking the effects of histamine. It is a first generation antihistamine in the piperazine family of chemicals.\\nIt was first made by Union Chimique Belge in 1956 and was approved for sale by Pfizer in the United States later that year. In 2017, it was the 99th most commonly prescribed medication in the United States, with more than seven million prescriptions."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%B7%D1%8B%D0%BC%D1%8F%D0%BD%D0%BD%D1%8B%D0%B9_(%D0%B2%D1%83%D0%BB%D0%BA%D0%B0%D0%BD_%D0%BD%D0%B0_%D0%9A%D0%B0%D0%BC%D1%87%D0%B0%D1%82%D0%BA%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/ISS-38_Kliuchevskoi_Volcano_on_Kamchatka.jpg","page_title":"Безымянный (вулкан на Камчатке)","context_page_description":"Безымя́нный — действующий вулкан на Камчатке, близ Ключевской сопки, примерно в 40 км от посёлка Ключи Усть-Камчатского района."},{"page_url":"https://de.wikipedia.org/wiki/N%C3%96LB_Mh","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/NoeLB50_Krauss.jpg","page_title":"NÖLB Mh","context_page_description":"Die Reihe Mh der Niederösterreichischen Landesbahnen ist eine Schmalspur-Stütztenderlokomotive, die ursprünglich für die Bergstrecke der Mariazellerbahn konstruiert wurde."},{"page_url":"https://hr.wikipedia.org/wiki/Systembolaget","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Systembolaget_logo.svg","page_title":"Systembolaget","context_page_description":"Systembolaget Aktiebolag je švedska državna tvrtka koja ima monopol na maloprodaju alkohola, vina i piva koje sadrži više od 3,5% alkohola. U Systembolagetu se mogu također kupiti i bezalkoholna pića koja sadrže manje od 0,5% alkohola. Dobna granica za kupovanje alkohola je 20 godina. U 410 prodavaonica diljem Švedske radi oko 3000 prodavača. Systembolaget također surađuje sa oko 520 prodavaonica u manjim mjestima."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D9%83%D8%B3%D8%A7%D9%86%D8%AF%D8%B1%D8%A7_%D9%84%D9%88%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Alexandra_Louis.jpg","page_title":"الكساندرا لويس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nالكساندرا لويس محاميه من فرنسا."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%BE%D1%81%D0%BE%D0%B2%D0%BE_(%D0%9C%D0%B0%D0%BA%D0%B5%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B8_%D0%91%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/%D0%A1%D1%83%D1%88%D0%B5%D1%9A%D0%B5_%D0%BD%D0%B0_%D0%BF%D0%B5%D1%87%D1%83%D1%80%D0%BA%D0%B8_%D0%B2%D0%BE_%D1%81%D0%B5%D0%BB%D0%BE_%D0%9A%D0%BE%D1%81%D0%BE%D0%B2%D0%BE_3792.jpg","page_title":"Косово (Македонски Брод)","context_page_description":"Косово је насеље у Северној Македонији, у средишњем делу државе. Косово припада општини Македонски Брод."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D0%BB%D0%BE_%D0%91%D0%B5%D0%B9%D0%BB%D0%B8%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/%D0%94%D0%B5%D0%BB%D0%BE_%D0%91%D0%B5%D0%B9%D0%BB%D0%B8%D1%81%D0%B0_-_%D0%9E%D0%B1%D1%89%D0%B0%D1%8F_%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%B0_%D0%B7%D0%B0%D1%81%D0%B5%D0%B4%D0%B0%D0%BD%D0%B8%D1%8F_%D1%81%D1%83%D0%B4%D0%B0.jpg","page_title":"Дело Бейлиса","context_page_description":"Де́ло Бе́йлиса — судебный процесс по обвинению еврея Менахема Менделя Бейлиса в ритуальном убийстве 12-летнего ученика приготовительного класса Киево-Софийского духовного училища Андрея Ющинского 12 марта 1911 года.\\nОбвинение в ритуальном убийстве было инициировано активистами черносотенных организаций и поддержано рядом крайне правых политиков и чиновников, включая министра юстиции Ивана Щегловитова. Местные следователи, считавшие, что речь идёт об уголовном убийстве из мести, были отстранены от дела. Через 4 месяца после обнаружения трупа Ющинского Бейлис, работавший неподалеку от этого места на заводе приказчиком, был арестован в качестве подозреваемого и провёл в тюрьме 2 года.\\nПроцесс состоялся в Киеве 23 сентября — 28 октября 1913 года и сопровождался, с одной стороны, активной антисемитской кампанией, а с другой — общественными протестами всероссийского и мирового масштаба. Бейлис был оправдан. Исследователи считают, что истинными убийцами были скупщица краденого Вера Чеберяк и уголовники из её притона, однако этот вопрос так и остался неразрешённым. Дело Бейлиса стало самым громким судебным процессом в дореволюционной России."},{"page_url":"https://pl.wikipedia.org/wiki/Surtsey","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Surtsey_location.gif","page_title":"Surtsey","context_page_description":"Surtsey – wyspa wulkaniczna u południowych wybrzeży Islandii, jednocześnie ze względu na położenie geograficzne najdalej na południe wysunięta część tego kraju. Powstała na skutek podmorskiej erupcji wulkanicznej, która rozpoczęła się na głębokości 130 metrów i wyłoniła się na powierzchnię 14 listopada 1963. Erupcja mogła rozpocząć się kilka dni wcześniej, a zakończyła się 5 czerwca 1967, kiedy to wyspa osiągnęła największą powierzchnię – 2,7 km². Od tego czasu wpływy fal i wiatru powodują erozję i stałe zmniejszanie się powierzchni wyspy.\\nNowa wyspa została nazwana imieniem boga ognia Surtra z mitologii nordyckiej i podczas jej tworzenia była obiektem intensywnych badań wulkanologów, a od zakończenia erupcji stanowiła przedmiot zainteresowania botaników i biologów, obserwujących stopniowy rozwój życia na początkowo jałowej powierzchni. Podmorskie kominy wulkaniczne, które utworzyły wyspę Surtsey stanowią część podmorskiego systemu wulkanicznego archipelagu wysp Vestmannaeyjar znajdującego się na śródoceanicznym grzbiecie nazywanym Grzbietem Śródatlantyckim. W 1973 w archipelagu tym miał miejsce wybuch wulkanu Eldfell na wyspie Heimaey."},{"page_url":"https://en.wikipedia.org/wiki/Muqarrab_Khan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Aurangzeb_au_si%C3%A8ge_de_Satara.jpg","page_title":"Muqarrab Khan","context_page_description":"Muqarrab Khan of Golconda was the most experienced commander in Golconda, during the reign of Abul Hasan Qutb Shah. Muqarrab Khan is known to have been an ally of Afzal Khan and defended Golconda's southern realms against Maratha raids.\\nMuqarrab Khan was a political rival of Abul Hasan Qutb Shah's viziers Madanna and Akkanna.\\nAfter Abul Hasan Qutb Shah, escaped from his administrative duties by retreating into the Golconda Fort along with 1000 women who were known for their mastery in music and song. Muqarrab Khan had become the de facto ruler of Golconda."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%85%D8%A7%D8%B1%D8%B3%D8%A9_%D9%85%D8%AE%D8%AA%D8%A8%D8%B1%D9%8A%D8%A9_%D8%AC%D9%8A%D8%AF%D8%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Scanning_electron_microscope2.jpg","page_title":"ممارسة مختبرية جيدة","context_page_description":"الممارسة المخبرية الجيدة أو الممارسة المعملية الجيدة اختصاراً GLP من Good Laboratory Practice معنى المُمَارَسَةُ - مُمَارَسَةُ:هو إرشاد يتم نشره بواسطة جهة عامة أو منظمة مواصفات قياسية مثل المنظمة العالمية للمواصفات القياسية أو المعهد البريطاني للمواصفات القياسية. و المواصفات القياسية تتكون من أسلوب ممارسة و مواصفات. و أسلوب الممارسة يشرح الممارسات المثلى المختارة.\\nالمَعْمَلُ - المختبَر هو المكان الذي تُجرى فيه التجارب العمليّة. والجمع: معاملُ. أو بمعنى اخر\\nالمختبرات هي جهة علمية فنية تقوم بفحص واختبار السلع والمنتجات للكشف عن خواصها وتركيبها والتأكد من مطابقتها للمواصفات القياسية أو التأكد من دقة ومعايرة أجهزة القياس."},{"page_url":"https://hu.wikipedia.org/wiki/Moncalvillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Moncalvillo_de_la_sierra.png","page_title":"Moncalvillo","context_page_description":"Moncalvillo település Spanyolországban, Burgos tartományban. Lakosainak száma 98 fő."},{"page_url":"https://de.wikipedia.org/wiki/NGC_4032","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/NGC4032_-_SDSS_DR14.jpg","page_title":"NGC 4032","context_page_description":"NGC 4032 ist eine Irreguläre Galaxie vom Hubble-Typ Im im Sternbild Coma Berenices am Nordsternhimmel. Sie ist schätzungsweise 55 Millionen Lichtjahre von der Milchstraße entfernt und hat einen Durchmesser von etwa 25.000 Lichtjahren.\\nIm selben Himmelsareal befinden sich u. a. die Galaxien NGC 4042, NGC 4053, NGC 4055, NGC 4056.\\nDas Objekt wurde am 27. April 1785 von Wilhelm Herschel entdeckt."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B2%E0%B8%A2%E0%B8%8A%E0%B8%B7%E0%B9%88%E0%B8%AD%E0%B9%82%E0%B8%9A%E0%B8%A3%E0%B8%B2%E0%B8%93%E0%B8%AA%E0%B8%96%E0%B8%B2%E0%B8%99%E0%B9%83%E0%B8%99%E0%B8%88%E0%B8%B1%E0%B8%87%E0%B8%AB%E0%B8%A7%E0%B8%B1%E0%B8%94%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%99%E0%B8%84%E0%B8%A3%E0%B8%A8%E0%B8%A3%E0%B8%B5%E0%B8%AD%E0%B8%A2%E0%B8%B8%E0%B8%98%E0%B8%A2%E0%B8%B2_(%E0%B8%95%E0%B8%B3%E0%B8%9A%E0%B8%A5%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B8%95%E0%B8%B9%E0%B8%8A%E0%B8%B1%E0%B8%A2_%E0%B8%AD%E0%B8%B3%E0%B9%80%E0%B8%A0%E0%B8%AD%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%99%E0%B8%84%E0%B8%A3%E0%B8%A8%E0%B8%A3%E0%B8%B5%E0%B8%AD%E0%B8%A2%E0%B8%B8%E0%B8%98%E0%B8%A2%E0%B8%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Ayutpchedisuriyothai0605a.jpg","page_title":"รายชื่อโบราณสถานในจังหวัดพระนครศรีอยุธยา (ตำบลประตูชัย อำเภอพระนครศรีอยุธยา)","context_page_description":"ต่อไปนี้เป็นรายชื่อโบราณสถานในตำบลประตูชัย อำเภอพระนครศรีอยุธยา จังหวัดพระนครศรีอยุธยา รวบรวมโดยกรมศิลปากร"},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D1%8B%D1%8F%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B3%D0%B0%D0%BB%D0%B5%D1%80%D1%8D%D1%8F_(%D0%9F%D0%B0%D1%80%D0%BC%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Tizian_083b.jpg","page_title":"Нацыянальная галерэя (Парма)","context_page_description":"Нацыяна́льная галерэ́я Па́рмы — невялікая карцінная галерэя ў месьце Парма са статусам нацыянальнай. Месьціцца ў палацы дэля Пілёта па адрасе П’яца дэль Пілёта, 6."},{"page_url":"https://en.wikipedia.org/wiki/Luis_Russell","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Luis_Russell_1.jpg","page_title":"Luis Russell","context_page_description":"Luis Russell was a pioneering Panamanian jazz pianist, orchestra leader, composer, and arranger."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9C%D7%90%D7%9E%D7%91%D7%90%D7%95%D7%96%D7%90%D7%95%D7%A8%D7%95%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Lambeosaurus_Royal_Tyrrell_1.jpg","page_title":"לאמבאוזאורוס","context_page_description":"לאמבֵּאוֹזאורוס הוא סוג דינוזאור אשר חי בעידן הקרטיקון, ממשפחת בעלי מקור הברווז. ידועים כיום שלושה מינים של לאמבאוזאורים:\\nL. lambei\\nL. magnicristatus\\nL. paucidens\\nהלאמבאוזאורים היו בינוניים-גדולים: אורכם נע בין 9 ל-10 מטר ומשקלם בין 3 ל-5 טון.\\nהלאמבאוזאורים היו דינוזאורים בעלי אגן דמוי עוף הולכים על שניים. הם היו אוכלי צמחים יעילים, מצוידים בשיניים מיוחדות לטחינת מזונם ולחיים שריריות מאוד. הם חיו בעדרים והיו בעלי מערכת חברתית מפותחת.\\nללאמבאוזאורוס הייתה כרבולת ארוכה וחלולה על הראש. ייתכן שדרכה נשפו אוויר כדי להשמיע קול כמו חצוצרה, בדומה לקול שמשמיעים הפילים דרך החדק שלהם. משערים כי הקולות שהשמיעו הלאמבאוזאורים שימשו אותם להעברת מסרים כדוגמת מציאת מזון ואזהרה מפני אויבים לחבריהם בעדר.\\nגלגלות של לאמבאוזאורוס מעידות שהנזר דמוי הכרבולת על ראשו של הזכר היה ארוך מזה של הנקבה. ייתכן שכרבולות וקרניים שימשו את הזכרים בדינוזאורים כדי למצוא חן בעיני הנקבות."},{"page_url":"https://en.wikipedia.org/wiki/Turner_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Turner_Stadium.jpg","page_title":"Turner Stadium","context_page_description":"The Turner Stadium, officially the Yaakov Turner Toto Stadium Be'er-Sheva, is a football stadium in Be'er Sheva, Israel. It is the home ground of Hapoel Be'er Sheva. It was named after former Be'er Sheva mayor Yaakov Turner. The stadium also serves the Israel national football team for some home matches."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_slott_och_herrg%C3%A5rdar_i_S%C3%B6dermanland","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/H%C3%A4sselbyholm.jpg","page_title":"Lista över slott och herrgårdar i Södermanland","context_page_description":"Lista över slott och herrgårdar i Södermanland.\\nListan visar ett urval av de viktigaste slotten och herrgårdarna och redovisar även numera försvunna egendomar. Listan bygger huvudsakligen på Historiskt-geografiskt och statistiskt lexikon öfver Sverige i 7 band, Stockholm 1856–1870 och Carl Martin Rosenbergs Geografiskt-statistiskt handlexikon öfver Sverige, Stockholm 1882–1883 samt Slott och herresäten i Sverige, Allhems förlag, Malmö, 1966–1971."},{"page_url":"https://nl.wikipedia.org/wiki/Arsenal_FC_in_het_seizoen_2001/02","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Arsene_Wenger_JHayes_%28cropped%29.jpg","page_title":"Arsenal FC in het seizoen 2001/02","context_page_description":"Arsenal FC was aan het einde van het seizoen 2001/2002 voor de tweede keer kampioen van de Premier League, met 87 punten en een voorsprong van 7 punten op Liverpool. Het was de twaalfde landstitel in de clubgeschiedenis. Arsenal won de Premier League vooral door een ongeslagen reeks neer te zetten van 21 wedstrijden, vanaf 23 december 2001 verloor het namelijk geen duel meer. Thierry Henry scoorde 24 doelpunten en won daarmee zijn eerste Premier League Golden Boot. Freddie Ljungberg werd door zijn collega's verkozen tot speler van het jaar en Arsène Wenger werd uitgeroepen tot coach van het jaar. Arsenal pakte dit seizoen een dubbel omdat ook de FA Cup gewonnen werd. In de vijfde ronde werd men door Blackburn Rovers uit de League Cup geknikkerd, met zware 4–0 cijfers. Blackburn Rovers zou de secundaire beker later op het seizoen winnen. Men was reeds uitgeschakeld na de groepsfase van de UEFA Champions League en speelde dus geen rol meer in de knock-outfase. Giovanni van Bronckhorst werd aangeworven, maar de Nederlander had moeite om een plaats te veroveren op de linksachter. Arsenal ging winkelen bij regionale rivaal Tottenham Hotspur en kocht er aanvoerder Sol Campbell weg."},{"page_url":"https://vi.wikipedia.org/wiki/Khoai","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Dioscorea_sp._MHNT.BOT.2013.22.35.jpg","page_title":"Khoai","context_page_description":"Khoai là tên gọi để chỉ những loài thực vật trong chi Dioscorea mà củ của chúng có thể ăn được. Chúng là các loài cây thân thảo, lâu năm, dây leo được trồng trọt để lấy củ ở châu Phi, châu Á, Mỹ Latinh, Caribe và châu Đại Dương. Có rất nhiều loại khoai được trồng trọt. Mặc dù khoai lang cũng là một loại khoai nhưng nó không thuộc họ Dioscoreaceae mà thuộc họ Bìm bìm."},{"page_url":"https://it.wikipedia.org/wiki/Porsche_996","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Porsche_996_Coup%C3%A9_1.JPG","page_title":"Porsche 996","context_page_description":"La Porsche 996 è un'autovettura sportiva prodotta dalla casa automobilistica tedesca Porsche. È la quarta generazione della 911 fabbricata dal 1997 al 2005."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%88%D8%B1%D9%8A%D8%B1%D9%88%D8%BA%D8%A7%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Torreorgaz.png","page_title":"توريروغاز","context_page_description":"بلدية توريروغاز، هي بلدية تقع في مقاطعة قصرش والتي تقع في منطقة إكستريمادورا، غرب إسبانيا.\\nيبلغ عدد سكانها 1.670 نسمة وفقاً لإحصائية سنة."},{"page_url":"https://de.wikipedia.org/wiki/Bullfell_Beck","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Water_Treatment_Plant%2C_Bullfell_Beck_-_geograph.org.uk_-_97713.jpg","page_title":"Bullfell Beck","context_page_description":"Der Bullfell Beck ist ein Wasserlauf im Lake District, Cumbria, England. Er entsteht an der Ostseite des Bowscale Fell und fließt in östlicher Richtung bis zu seiner Mündung in den River Glenderamackin."},{"page_url":"https://it.wikipedia.org/wiki/Sermide_e_Felonica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Municipio%2C_torre%2C_campanile%2C_Sermide.JPG","page_title":"Sermide e Felonica","context_page_description":"Sermide e Felonica è un comune sparso italiano di 7 309 abitanti della provincia di Mantova in Lombardia."},{"page_url":"https://pt.wikipedia.org/wiki/Louis_Dunn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Dunn-corporal-350.jpg","page_title":"Louis Dunn","context_page_description":"Louis Gerhardus Dunn foi um engenheiro mecânico estadunidense nascido na África do Sul.\\nSua contribuição foi fundamental para o desenvolvimento dos primeiros mísseis e veículos de lançamento dos Estados Unidos."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%B4%D8%AF%D8%A9_%D9%87%D9%86%D8%AF%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Maulsari_%28Mimusops_elengi%29_trees_in_Kolkata_W_IMG_2848.jpg","page_title":"قشدة هندي","context_page_description":"القِشْدَةُ الهِنْدِيُّ هو شجرة اسمها العلمي هو .Mimusops Elengi L تنتمي إلى عائلة Sapotaceae\\nهو شجرةٌ متوسطة الحجم، دائم الخضرة، يوجد في الغابات الاستوائية في جنوب وجنوب شرق أسِيا وشَمال أُستُرالْيا.\\nأسمائه الإنجِليزية هي Spanish cherry و Medlar\\nوزهرته تعد الزهرة المحلية في محافظة يالا في تايلاند."},{"page_url":"https://fr.wikipedia.org/wiki/Zelenikovo_(village)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Zelenikovo-view.jpg","page_title":"Zelenikovo (village)","context_page_description":"Zelenikovo est un village du nord de la Macédoine du Nord, chef-lieu de la municipalité de Zelenikovo. Le village comptait 1906 habitants en 2002. Il possède une gare sur la ligne Skopje-Vélès."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D1%82%D0%B8_%D0%94%D1%83%D1%85_(%D0%9A%D1%80%D0%B0%D0%B3%D1%83%D0%B5%D0%B2%D0%B0%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Wiki_%C5%A0umadija_XI_Stara_crkva_%28Kragujevac%29_609.jpg","page_title":"Свети Дух (Крагуевац)","context_page_description":"„Свети Дух“ е православна църква в Крагуевац, изградена в 1818 година.\\nВ двора на църквата, която според преданието била първата изградена по тези земи църква по-висока от местната джамия, са се провеждали на открито импровизираните народни събрания на християните от санджака, т.нар. Стара скупщина.\\nИменно там, в двора на тази Стара църква, пред Старата скупщина е прогласена през 1835 г. първата конституция на прогласеното в Ташмайдан 5 години по-рано автономно Княжество Сърбия."},{"page_url":"https://es.wikipedia.org/wiki/Lek_alban%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/ALB-10l%281939%29.jpg","page_title":"Lek albanés","context_page_description":"El lek es la moneda de Albania. Se divide en 100 qindarkë. El código ISO 4217 para esta unidad monetaria es ALL y su abreviatura L."},{"page_url":"https://en.wikipedia.org/wiki/Honda_Shadow","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Honda_Shadow.jpg","page_title":"Honda Shadow","context_page_description":"The Honda Shadow refers to a family of cruiser-type motorcycles made by Honda since 1983. The Shadow line features motorcycles with a liquid-cooled 45 or 52-degree V-twin engine ranging from 125 to 1,100 cc engine displacement. The 250 cc Honda Rebel is associated with the Shadow line in certain markets."},{"page_url":"https://eo.wikipedia.org/wiki/Syzygium_aqueum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Eugenia_sp_Blanco1.145.jpg","page_title":"Syzygium aqueum","context_page_description":"Syzygium aqueum, blanka jamboso aŭ blanka sizigio, estas planto el la familio de mirtacoj. La fruktoj similas al tiuj de Syzgium smarangense, kiuj havas pli grandajn fruktojn.\\nSyzygium aqueum estas 3-20 m alta, ĉiamverda arbo kun malalta trunko kiu funde ĉe la grundo disbranĉiĝas. La krono estas maldensa kaj nesimetria. La folioj kontraŭsidaj, 1-5 mm longa kaj kun tigoj, ovoformaj aŭ elipsaj-oblongaj, helverda ĉe la supra flanko, flave verda ĉe la malsupra flanko kaj 5-25 × 2,5-16 cm grandaj. La odorantaj floroj kreskas kiel tri ĝis sep floroj en maldensaj floraroj. La kvaropa kaliko kaj korolo estas palflavaj, flave-blankaj aŭ rozkoloraj. Ekzistas multegaj, ĝis 2 cm longaj stamenoj, kiuj havas la saman koloron kiel la floro. La stiluso superas la stamenojn.\\nLa fruktoj estas maldikŝelaj, glataj, brilaj, vaksecaj kaj ili estas en matura stato blankaj, verdaj, rozkoloraj aŭ ruĝegaj. Ili estas 1,6-2 × 2,5-3,4 cm grandaj kaj sonoril- aŭ pirformaj kun maldika kolo kaj larĝa fino. la fino estas konkava, portas la restaĵojn de la kaliko kaj havas 3 cm longan tigon."},{"page_url":"https://de.wikipedia.org/wiki/Shire_of_Herberton","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Herberton_LGA_Qld.png","page_title":"Shire of Herberton","context_page_description":"Der Shire of Herberton war ein Verwaltungsbezirk in Queensland, Australien. Er umfasste die Städte Mount Garnet, Ravenshoe und Herberton. Am 17. März 2008 ging er im Tablelands Regional Council auf."},{"page_url":"https://en.wikipedia.org/wiki/2005_Azores_subtropical_storm","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Unnamed_SS_2005-10-04_1220Z.jpg","page_title":"2005 Azores subtropical storm","context_page_description":"The 2005 Azores subtropical storm was the 19th nameable storm and only subtropical storm of the record-breaking 2005 Atlantic hurricane season. It was not officially named by the US National Hurricane Center as it was operationally classified as a non-tropical low. The storm developed in the eastern Atlantic Ocean out of a low-pressure area that gained subtropical characteristics on October 4. The storm was short-lived, crossing over the Azores later on October 4 before becoming extratropical again on October 5. No damages or fatalities were reported during that time. After being absorbed into a cold front, the system went on to become Hurricane Vince, which affected the Iberian Peninsula.\\nMonths after the hurricane season, when the National Hurricane Center was performing its annual review of the season and its named storms, forecasters Jack Beven and Eric Blake identified this previously unnoticed subtropical storm. Despite its unusual location and wide wind field, the system had a well-defined centre convecting around a warm core, the hallmark of a subtropical storm."},{"page_url":"https://fr.wikipedia.org/wiki/Dr%C3%B4me_proven%C3%A7ale","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Lez-Taulignan.JPG","page_title":"Drôme provençale","context_page_description":"L'appellation Drôme provençale concerne une région touristique du département de la Drôme, et qui en occupe approximativement le tiers sud.\\n42 % des communes de la Drôme font partie de la Drôme provençale.\\nCe nom lui a été donné à la fin des années 1980, en raison de sa proximité géographique culturelle et climatique avec la Provence voisine et de l'attractivité touristique de celle-ci. Ce territoire dit de Drôme provençale était au XIIᵉ siècle inclus dans un marquisat de Provence rattaché au comté de Toulouse et issu du démantèlement du Royaume d'Arles, dont les territoires les plus au Nord allaient jusqu'à Valence. Contrairement à ce que semble indiquer son nom, il a en revanche appartenu depuis le début du XIVᵉ siècle à la province du Dauphiné, comme le reste de l'actuel département de la Drôme."},{"page_url":"https://pl.wikipedia.org/wiki/Ryczyw%C3%B3%C5%82_(wojew%C3%B3dztwo_mazowieckie)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/POL_Radomka_river.jpg","page_title":"Ryczywół (województwo mazowieckie)","context_page_description":"Ryczywół – dawne miasto, obecnie wieś w Polsce położona w województwie mazowieckim, w powiecie kozienickim, w gminie Kozienice. Leży nad Radomką dopływem Wisły.\\nRyczywół uzyskał lokację miejską przed 1370 rokiem, zdegradowany w 1869 roku. Był miastem królewskim Korony Królestwa Polskiego, położonym w drugiej połowie XVI wieku w powiecie radomskim województwa sandomierskiego.\\nW latach 1975–1998 miejscowość położona była w województwie radomskim, a przed 1975 w województwie kieleckim.\\nRyczywół jest siedzibą rzymskokatolickiej parafii św. Katarzyny."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D8%A7%D8%A8_(%D9%85%D8%AF%D9%8A%D9%86%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Rab1.jpg","page_title":"راب (مدينة)","context_page_description":"راب هي مدينة تقع في جزيرة راب في كرواتيا. يبلغ عدد سكانها 8065 نسمة وذلك حسب إحصائيات سنة 2011. يبلغ ارتفاع المدينة عن سطح البحر قرابة 0 متر."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%99%D0%BE%D0%B7%D0%B5%D1%84_%D0%95%D1%84%D1%84%D0%BD%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Effner-Ofen_1.jpg","page_title":"Йозеф Еффнер","context_page_description":"Йозеф Еффнер — німецький ландшафтний архітектор і декоратор."},{"page_url":"https://de.wikipedia.org/wiki/Skyscraper_(1959)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/666fifth-front.jpg","page_title":"Skyscraper (1959)","context_page_description":"Skyscraper ist ein US-amerikanischer Kurzfilm von Shirley Clarke aus dem Jahr 1959."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_st%C3%A1tn%C3%ADch_fos%C3%ADli%C3%AD_americk%C3%BDch_st%C3%A1t%C5%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Mammoth_mg_2791.jpg","page_title":"Seznam státních fosílií amerických států","context_page_description":"Většina amerických států má svoji státní zkamenělinu. Tou se stává většinou dobře známá, početná nebo pro stát jinak významná fosílie některého pravěkého živočicha či rostliny. Kromě toho se rozlišuje ještě kategorie jako státní dinosaurus, státní drahokam apod."},{"page_url":"https://fr.wikipedia.org/wiki/Passeport_timorais","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/East_Timor_Electronic_Passport.jpg","page_title":"Passeport timorais","context_page_description":"Le passeport timorais est un document de voyage international délivré aux ressortissants timorais, et qui peut aussi servir de preuve de la citoyenneté timoraise."},{"page_url":"https://sv.wikipedia.org/wiki/F%C3%B6rimpedans","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Explanation_about_short-circuit_%28with_example%29_for_designing_electrical_installations.JPG","page_title":"Förimpedans","context_page_description":"Förimpedans är en elektrisk egenskap i elnät som används för att dimensionera area och längd för elektriska ledare och säkringar. Syftet med att veta förimpedansen är att kontrollera utlösningsvillkoret, det vill säga att säkringen som skyddar ledningen löser tillräckligt snabbt vid en kortslutning till fas, nolla eller skyddsjord."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D1%80%D0%BE%D0%BF%D0%B8%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/%D0%94%D0%B5%D1%80%D0%B5%D0%B2%D0%BD%D1%8F_%D0%92%D0%BE%D1%80%D0%BE%D0%BF%D0%B8%D0%BD%D0%BE_%D0%BD%D0%B0_%D0%BA%D0%B0%D1%80%D1%82%D0%B5_1850_%D0%B3%D0%BE%D0%B4%D0%B0.jpg","page_title":"Воропино","context_page_description":"Воро́пино — деревня в Шатурском муниципальном районе Московской области, в составе сельского поселения Пышлицкое. Расположена в юго-восточной части Московской области в 3,5 км к западу от озера Дубового. Население — 53 чел. Деревня известна с 1622 года. Деревня известна с 1622 года. Входит в культурно-историческую местность Ялмать."},{"page_url":"https://sv.wikipedia.org/wiki/Mauritz_Gripenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Villa_elfvik_spring.jpg","page_title":"Mauritz Gripenberg","context_page_description":"Alexander Mauritz Sebastian Gripenberg, född 10 januari 1869 i Sankt Petersburg, död 30 december 1925 i Helsingfors, var en finländsk militär och arkitekt. Han var kusins son till Lennart Gripenberg.\\nGripenberg genomgick Finska kadettkåren och blev sedermera attaché vid ryska beskickningen i Stockholm, där han erhöll majors avsked 1897. Han utexaminerades som arkitekt vid Kungliga Konstakademien i Stockholm 1899. Han tjänstgjorde vid överstyrelsen för allmänna byggnaderna 1899–1903, bedrev egen arkitektverksamhet 1903–1908 och var byggnadsinspektör i Helsingfors 1908–1925. Han var dessutom verkställande direktör i konsthantverksföretaget Ab Iris 1900–1902. Han representerade 1917 såväl Aktiva kommittén som Militärkommittén i Berlin, varefter han blev finländsk militärattaché där."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%97%E0%A5%81%E0%A4%9C%E0%A4%B0%E0%A4%BE%E0%A4%A8%E0%A4%B5%E0%A4%BE%E0%A4%B2%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Gtdmc.jpg","page_title":"गुजरानवाला","context_page_description":"गुजरानवाला पाकिस्तानको पञ्जाब प्रदेशमा रहेको एक प्रमुख सहर हो। यो सहर नजिकैको पञ्जाब प्रान्तको राजधानी लाहोरबाट उत्तरतर्फ रहेको छ। यो सहर पाकिस्तानको ७औँ बढी जनघनत्व भएको महानगरीय क्षेत्र हो भने यो जनसङ्ख्याको हिसाबले पाकिस्तानको ५औँ सबैभन्दा ठूलो सहर हो। यो सहरको स्थापना १८औँ शताब्दीमा भएको थियो। यो सहर उत्तरी पञ्जाबका नजिकैका अन्य पुरानो सहरहरूको तुलनामा आधुनिक सहर हो। यो सहर सन् १७६३ देखि सन् १७९९ सम्म, सुरचकिया मिस्लको राजधानीको रूपमा रहेको थियो। गुजरानवाला सिख महाराजा रञ्जित सिंहको जन्मस्थल पनि हो।\\nगुजरानवाला पाकिस्तानी सहरहरू कराची र फैसलाबादपछिको तेस्रो ठूलो औद्योगिक केन्द्र हो र यस सहरले पाकिस्तानको राष्ट्रिय कुल ग्राहस्थ उत्पादनको ५% योगदान गर्दछ।यो सहर उत्तर-पूर्वी पञ्जाब प्रान्तको ठूला सहरी केन्द्रहरूको सञ्जालमा आबद्ध छ जुन पाकिस्तानको अत्याधिक उच्च औद्योगिक क्षेत्रहरू हुन्। यस सहरको छिमेकको निर्यात केन्द्रित अर्थतन्त्र रहेको औद्योगिक सहरहरू सियालकोट र गुजरातसँग यसको सुनौलो त्रिभुज भनिने सम्बन्ध रहेको छ।"},{"page_url":"https://en.wikipedia.org/wiki/List_of_number-one_singles_from_the_2000s_(New_Zealand)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Guy_Sebastian_performing_at_a_function_in_2009.jpg","page_title":"List of number-one singles from the 2000s (New Zealand)","context_page_description":"In New Zealand, the Recording Industry Association of New Zealand compiles the top forty singles chart each week. Sales of songs determined 75% of the sorting information, and radio airplay figures were responsible for 25%. From 18 April 2004 to 29 May 2007 the sales/radio airplay split was 50:50. Downloads of songs were included from 29 May 2007. The reporting period is from Monday to Sunday, with the week's chart published the next Monday. Before 18 April 2004, the chart week was from Sunday to Saturday, with the chart published on Sunday. Afterwards, the chart week was from Monday to Sunday, with the charts published on Monday. This meant there was a one-day charting period for 18 April 2004, with the next chart published on 19 April 2004. As a result, Usher spent three weeks and one day at number one with \\"Yeah!\\" instead of four complete weeks.\\nA total of 170 singles topped the chart in the 2000s, including 23 by New Zealand artists. Twenty artists had three or more number-one singles; the most successful was Akon, whose seven number-ones totalled twenty-three weeks on top of the chart."},{"page_url":"https://de.wikipedia.org/wiki/Heilbad_Heiligenstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Heine-Heiligenstadt.jpg","page_title":"Heilbad Heiligenstadt","context_page_description":"Heilbad Heiligenstadt ist die Kreisstadt des Landkreises Eichsfeld in Thüringen und ein anerkanntes Sole-Heilbad."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%95%D1%88%D0%B5%D0%B2%D0%B0%D0%BD%D0%BD_(%D0%94%D1%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Chapelle_Echevannes_%28Doubs%29.jpg","page_title":"Ешеванн (Ду)","context_page_description":"Ешеванн — Францин гӀала-коммуна, лаьтта Бургунди — Франш-Конте регионехь. Коммунан департамент — Ду. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://es.wikipedia.org/wiki/Villamart%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Avenidadelaferia.jpg","page_title":"Villamartín","context_page_description":"Villamartín es un municipio español de la provincia de Cádiz, Andalucía. Según el INE, en 2016 contaba con 12 267 habitantes. Se encuentra al norte de la provincia, a una altitud de 169 metros y a 80 kilómetros de la capital, Cádiz."},{"page_url":"https://uz.wikipedia.org/wiki/Pradines_(Loire)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Map_commune_FR_insee_code_42178.png","page_title":"Pradines (Loire)","context_page_description":"Pradines Fransiyaning Rhône-Alpes mintaqasida joylashgan kommunadir. Loire departamenti Roanne tumani tarkibiga kiradi."},{"page_url":"https://es.wikipedia.org/wiki/Jakubov_u_Moravsk%C3%BDch_Bud%C4%9Bjovic","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Center_of_Jakubov_u_Moravsk%C3%BDch_Bud%C4%9Bjovic%2C_T%C5%99eb%C3%AD%C4%8D_District.JPG","page_title":"Jakubov u Moravských Budějovic","context_page_description":"Jakubov u Moravských Budějovic es una localidad del distrito de Třebíč en la región de Vysočina, República Checa, con una población estimada a principio del año 2018 de 632 habitantes.\\nSe encuentra ubicada al sureste de la región, cerca de la orilla de los ríos Jihlava y Svratka, y de la frontera con Austria y la región de Moravia Meridional.​"},{"page_url":"https://en.wikipedia.org/wiki/Anitschkow_cell","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Anitschkow_Myocytes_in_an_Aschoff_Body%2C_Rheumatic_Myocarditis.jpg","page_title":"Anitschkow cell","context_page_description":"In pathology, Anitschkow cells are often cells associated with rheumatic heart disease. Anitschkow cells are enlarged macrophages found within granulomas associated with the disease.\\nThe cells are also called caterpillar cells, as they have an ovoid nucleus and chromatin that is condensed toward the center of the nucleus in a wavy rod-like pattern that to some resembles a caterpillar. Larger Anitschkow cells may coalesce to form multinucleated Aschoff giant cells. Anitschkow cells were named after the Russian pathologist Nikolay Anichkov.\\nSquamous epithelial cells with nuclear changes resembling Anitschkow cells have also been observed in recurrent aphthous stomatitis, iron deficiency anemia, children receiving chemotherapy, as well as in healthy individuals."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D1%8F-%D0%9B%D1%83%D0%BA%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Rafting-Start_slalom_staza.jpg","page_title":"Баня-Лука","context_page_description":"Ба́ня-Лу́ка — город в Боснии и Герцеговине, фактическая столица Республики Сербской с 1995 года.\\nПосле подписания Дейтонских мирных соглашений и Парижского Договора 1995 года столица Республики Сербской была переведена из города Пале в Баня-Луку, крупнейший деловой и экономический центр сербской Боснии с населением 218 тыс. человек.\\nТопоним в переводе с сербского означает банская пристань."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_U.S._state_trees","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Tsuga_heterophylla1.jpg","page_title":"List of U.S. state trees","context_page_description":"This is a list of U.S. state trees."},{"page_url":"https://de.wikipedia.org/wiki/Nicola_Bonifacio_Logroscino","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Quinto_Fabio_libretto_cover_1738.jpg","page_title":"Nicola Bonifacio Logroscino","context_page_description":"Nicola Bonifacio Logroscino war ein italienischer Komponist und Kapellmeister."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Doma%C5%BElice","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/DomazliceNamestiMiru41.JPG","page_title":"Liste der denkmalgeschützten Objekte in Domažlice","context_page_description":"Grundlage dieser Liste der denkmalgeschützten Objekte in Domažlice ist die ÚSKP-Liste, die von der tschechischen Denkmalschutzbehörde NPÚ seit 1987 geführt wird und an die seit dem Jahre 1850 geschaffenen Listen anschließt.\\nDie folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalbehörde."},{"page_url":"https://pl.wikipedia.org/wiki/Zdzis%C5%82aw_Soczewi%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Zdzislaw_Soczewinski.png","page_title":"Zdzisław Soczewiński","context_page_description":"Zdzisław Soczewiński – polski bokser startujący w kategorii piórkowej, trener."},{"page_url":"https://ru.wikipedia.org/wiki/NGC_6675","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/NGC6675.jpg","page_title":"NGC 6675","context_page_description":"NGC 6675 — галактика в созвездии Лира.\\nЭтот объект входит в число перечисленных в оригинальной редакции «Нового общего каталога»."},{"page_url":"https://fi.wikipedia.org/wiki/Cseszneky","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Cseszneky_comital_big.jpg","page_title":"Cseszneky","context_page_description":"Cseszneky de Milvány et Csesznek on vanha unkarilainen aatelissuku, johon on kuulunut useita Unkarin historian merkkihenkilöitä. Vanhimmat tunnetut merkinnät suvusta ovat vuodelta 1215. Suku nousi keskiajalla huomattavaan asemaan Keski-Euroopassa. Csesznekyn suvun jäsenten vaikutus näkyi Unkarin julkisessa elämässä 1900-luvulle asti."},{"page_url":"https://it.wikipedia.org/wiki/Aeronautical_Division,_U.S._Signal_Corps","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/ChandlerKirtlandLewisGun.jpg","page_title":"Aeronautical Division, U.S. Signal Corps","context_page_description":"L'Aeronautical Division, Signal Corps è stata la prima organizzazione militare al mondo di aeromobili più pesanti dell'aria, e l'antenato della United States Air Force. Componente del Signal Corps e come tale appartenendo all'esercito statunitense, mise in campo il primo aereo militare a motore nel 1909, creò scuole per addestrare i propri aviatori, e diede origine ad un sistema di valutazione per le qualifiche dei piloti. Organizzò e schierò il primo reparto permanente americano di aviazione, il 1st Aero Squadron, nel 1913. L'Aeronautical Division addestrò come piloti 51 ufficiali e 2 elementi di truppa, subendo 13 perdite umane in incidenti di volo. In tale arco di tempo, l'Aeronautical Division ebbe nel suo organico materiale 29 aerei prodotti da fabbricanti esterni, ne costruì un trentesimo assemblando pezzi di ricambio e prese in locazione un aereo civile per un breve periodo nel 1911."},{"page_url":"https://sv.wikipedia.org/wiki/Barcelona","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Barcelona_36_2013.jpg","page_title":"Barcelona","context_page_description":"Barcelona är en stad och kommun belägen vid Kataloniens kust mellan floderna Llobregats och Besòs mynningar, 110 kilometer söder om franska gränsen. Barcelona är huvudstad i den autonoma regionen Katalonien men även för provinsen Barcelona samt grevskapet Barcelonès. Invånarantalet uppgick år 2009 till 1 638 103. Inkluderas de närmaste förstäderna är invånarantalet ungefär 3 miljoner, med satellitstäder cirka 5 miljoner.\\nStaden är Spaniens näst största stad, efter Madrid, samt den mest industrialiserade. Barcelona är även en av västvärldens mest tätbefolkade storstäder. Staden har utvecklats till en viktig turistdestination, och 2015 besökte drygt 8 miljoner Barcelona. Både katalanska och spanska är officiella språk.\\nBarcelona är en viktig kulturstad med antika rötter. I staden finns ett stort antal museer och historiska byggnader, inklusive basilikan Sagrada Família och Palau Nacional. Estadi Olímpic Lluís Companys var huvudarena vid sommar-OS 1992, och Palau Sant Jordi har två gånger stått värd för sim-VM. Barcelonas två främsta fotbollsklubbar är FC Barcelona och RCD Espanyol."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%BC%E3%82%B3%E3%83%83%E3%82%AF%E5%9B%BD%E9%9A%9B%E7%A9%BA%E6%B8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Phu_Quoc_International_Airport.JPG","page_title":"フーコック国際空港","context_page_description":"フーコック国際空港は、ベトナムのキエンザン省フーコック島にある国際空港である。"},{"page_url":"https://sv.wikipedia.org/wiki/Craibiodendron","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Craibiodendron_yunnanensis_-_Kunming_Botanical_Garden_-_DSC02883.JPG","page_title":"Craibiodendron","context_page_description":"Craibiodendron är ett släkte av ljungväxter. Craibiodendron ingår i familjen ljungväxter.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://it.wikipedia.org/wiki/Condensazione","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Zibold_condenser_%28section%29.jpg","page_title":"Condensazione","context_page_description":"La condensazione è la transizione di fase dalla fase aeriforme alla fase liquida di una sostanza. Tale trasformazione si può eseguire:\\na temperatura costante per compressione, se la temperatura dell'aeriforme è inferiore a quella critica;\\nper raffreddamento con una fonte esterna;\\nper espansione adiabatica.\\nLa condensazione può avvenire generalmente in due modi:\\ncondensazione volumetrica: avviene normalmente nei fenomeni naturali, come per esempio nelle nuvole;\\ncondensazione su superfici: usata soprattutto per aspetti tecnici e ingegneristici, per esempio negli scambi di calore.\\nIn ogni caso l'operazione di condensazione è esotermica, cioè avviene sottraendo calore alla sostanza che si vuole condensare."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BA%D0%B8_%D0%BD%D0%B0_%D0%B3%D0%B5%D1%80%D0%B1%D0%B0%D1%85_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/COA_of_Dovhe.png","page_title":"Замки на гербах України","context_page_description":"Міські герби, що найчастіше використовуються на землях України, за різновидами геральдичних фігур поділяються на кілька груп. До найдавнішої групи відносяться герби із зображенням архітектурних споруд. Це є німецька традиція, яка використовувалась на землях України тривалий час. Зображення фортечної брами з однією, двома і трьома вежами та великою кількістю архітектурних деталей було найпоширенішим символом на гербах, які мали твердиню. Зокрема, фортечну стіну з вежами використовували у своїх гербах Хмільник, Брацлав, Львів, Городок, Рава-Руська, Сокаль, Богородчани, Кути, Гусятин, Кременець, Підгайці, Язлівець, Ізяслав, Нова Ушиця, Чернівці, Хотин, Звенигородка, Корсунь-Шевченківський, Житомир, Рівне.\\nЕлементи замкової архітектури на гербах присутні також у гербах двох областей України Тернопільській та Чернівецькій, а також у гербах Бершадського, Любомльського, Хотинського, Переяслав-Хмельницького, Сквирського, Буського районів."},{"page_url":"https://de.wikipedia.org/wiki/Emmanuel_Fr%C3%A9miet","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/VBRITTO-orsay-fremiet-elephant.jpg","page_title":"Emmanuel Frémiet","context_page_description":"Emmanuel Frémiet war einer der bedeutendsten französischen Bildhauer des 19. Jahrhunderts und fertigte zumeist Tierskulpturen im Stil des Naturalismus und des Neoklassizismus an."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BA_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%BF%D0%B0%D0%BF%D1%8B_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%98%D0%BE%D0%B0%D0%BD%D0%BD%D0%B0_%D0%9F%D0%B0%D0%B2%D0%BB%D0%B0_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/%D0%A0%D0%BE%D0%B6%D0%B4%D0%B5%D1%81%D1%82%D0%B2%D0%B0_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%8B_%D0%A1%D0%B8%D1%85%D0%BE%D0%B2.jpg","page_title":"Парк имени папы римского Иоанна Павла II","context_page_description":"Парк и́мени па́пы ри́мского Иоа́нна Па́вла II — парк во Львове, в крупнейшем жилом массиве Сихов.\\nВ 2001 году на месте будущего парка, возле греко-католического собора Рождества Богородицы, провёл мессу римский папа Иоанн Павел II. Позже ему на этом месте установили памятник. Возникла идея разбить парк имени римского иерарха. В 2005 году посаженная аллея парка была уничтожена неизвестными вандалами. В июне 2006 года львовский городской совет определил границы парка в 1,38 га.\\n28 сентября 2007 года возле Собора Рождества Пресвятой Богородицы парк имени Ивана Павла ІІ был торжественно открыт. Первые саженцы вишни посадили приходской священник Орест Фредына и представители блока «Наша Украина — Народная самооборона». Городские власти обещали выделить в течение 2007 года 500 тысяч гривен на проведение освещения в парке и приобретение инвентаря. Было запланировано посадить здесь саженцы можжевельника, кизильника, липы, райских яблок, граба, рябины, вишни, фруктовые деревья. В заново утверждённых границах площадь парка составляет 3 гектара."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%8B%82%E7%83%AD%E9%BC%93%E6%89%8B%E7%B3%BB%E5%88%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/DrumMania_V7_20170726_125157.jpg","page_title":"狂热鼓手系列","context_page_description":"DrumMania是由日本遊戲機公司KONAMI推出的Bemani系列打鼓機遊戲，已經推出了三個系列。主機可對應的另一款吉他機遊戲 GuitarFreaks進行連線聯玩。\\n第一個系列已推出18代作品，使用傳統6鼓主機，由第11代開始，改以「V」命名。最後一代是2011年3月發行的第18代 DrumMania V8。\\n第二個系列 DrumMania XG，使用新式9鼓主機有別於第一個系列作品，模擬玩法更接近真實電子鼓；最後一代是2012年2月發行的 DrumMania XG3。\\n第三個系列 GITADORA，沿用XG的新式9鼓主機，但介面設計有大幅度修改，最新一代是2019年10月發行的 GITADORA NEX+AGE。"},{"page_url":"https://sh.wikipedia.org/wiki/%C5%A0avnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/SavnikWeapon.png","page_title":"Šavnik","context_page_description":"Šavnik je gradić i općinski centar u sjeverozapadnom dijelu Crne Gore i centar južnog dijela Durmitorskog kraja."},{"page_url":"https://fr.wikipedia.org/wiki/Statue_de_Cecil_Rhodes_(Le_Cap)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Cecil_Rhodes_Company%27s_Gardens.jpg","page_title":"Statue de Cecil Rhodes (Le Cap)","context_page_description":"La statue de Cecil Rhodes située dans les jardins de la Compagnie au centre de la ville du Cap, Cap-Occidental en Afrique du Sud, rend hommage à Cecil Rhodes, magnat des mines, fondateur de la De Beers, fondateur de la Rhodésie et premier ministre de la colonie du Cap. Œuvre réalisée en 1908 par Henry Pegram, cette statue en bronze fut inaugurée le 28 juin 1910, juchée sur un piédestal en granit réalisé par Herbert Baker."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Denkm%C3%A4lern_von_Mathematikern,_Naturwissenschaftlern,_Medizinern_und_Technikern","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Jonathan_Zenneck%2C_Denkmal%2C_Cuxhaven.jpg","page_title":"Liste von Denkmälern von Mathematikern, Naturwissenschaftlern, Medizinern und Technikern","context_page_description":"Die Liste von Denkmälern von Mathematikern, Naturwissenschaftlern, Medizinern und Technikern gibt einen Überblick über Denkmäler im engeren Sinne, also über Bauwerke, Skulpturen, Plastiken und dergleichen, die an bestimmte Personen und Personengruppen im Bereich Mathematik, Naturwissenschaften, Medizin und Technik erinnern.\\nGedenktafeln, Informationstafeln oder Grabmale werden nicht aufgeführt."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%92%82%E4%BA%9E%E7%93%A6%E7%B4%8D%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Inkas_ruines_-Tiwanaku_-_Bolivia.jpg","page_title":"蒂亞瓦納科","context_page_description":"蒂亚瓦纳科是一个重要的南美洲文明遗迹，位于今玻利维亚，曾是蒂亚瓦纳科文化的中心。"},{"page_url":"https://en.wikipedia.org/wiki/Insure%2B%2B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Parasoft_Logo_2017.png","page_title":"Insure++","context_page_description":"Insure++ is a memory debugger computer program, used by software developers to detect various errors in programs written in C and C++. It is made by Parasoft, and is functionally similar to other memory debuggers, such as Purify, Valgrind and Dr Memory."},{"page_url":"https://pl.wikipedia.org/wiki/Przeci%C4%85ganie","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Przeciagacz.png","page_title":"Przeciąganie","context_page_description":"Przeciąganie – obróbka wiórowa, w której cały naddatek na obróbkę skrawany jest podczas jednego przejścia narzędzia, zwanego przeciągaczem, przeprowadzana na obrabiarkach zwanych przeciągarkami. Przeciąganie stosuje się do obróbki dokładnych otworów wielobocznych, wielorowkowych, rowków wpustowych oraz do obróbki powierzchni kwadratowych zewnętrznych. Ze względu na znaczne koszty narzędzi przeciąganie znajduje zastosowanie wyłącznie w produkcji masowej lub wielkoseryjnej."},{"page_url":"https://sv.wikipedia.org/wiki/Pernattia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Pernattia_pusilla_%2812210042703%29.jpg","page_title":"Pernattia","context_page_description":"Pernattia är ett släkte av fjärilar. Pernattia ingår i familjen ädelspinnare.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://eo.wikipedia.org/wiki/Nowogard","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Nowogard_Nowogardzki_Dom_Kultury.jpg","page_title":"Nowogard","context_page_description":"Nowogard estas urbo en Okcidenta Pomerio en Pollando.\\nĜi apartenas al komunumo Nowogard en distrikto Goleniowski."},{"page_url":"https://en.wikipedia.org/wiki/Folly_Theater","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Carnahan-obama.jpg","page_title":"Folly Theater","context_page_description":"The Standard Theatre, now known as the Folly Theater and also known as the Century Theater and Shubert's Missouri, is a former vaudeville hall in downtown Kansas City, Missouri. Built in 1900, it was designed by Kansas City architect Louis S. Curtiss. The theater was associated with the adjoining Edward Hotel, which was also designed by Curtiss; the hotel was demolished in 1965."},{"page_url":"https://fr.wikipedia.org/wiki/Coll%C3%A9giale_Saint-Martin_de_Colmar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Coll%C3%A9giale_Saint-Martin_-_horloge_%28Colmar%29.jpg","page_title":"Collégiale Saint-Martin de Colmar","context_page_description":"La collégiale Saint-Martin, appelée fréquemment « cathédrale Saint-Martin de Colmar », est l'édifice religieux le plus important de la ville de Colmar, en Alsace, et l'une des plus grandes églises gothiques du Haut-Rhin. Deuxième plus grand édifice catholique en Alsace après la cathédrale de Strasbourg."},{"page_url":"https://en.wikipedia.org/wiki/Industry_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Bush_Terminal_Company_1920.jpg","page_title":"Industry City","context_page_description":"Industry City is a historic intermodal shipping, warehousing, and manufacturing complex on the Upper New York Bay waterfront in the Sunset Park neighborhood of Brooklyn, New York City. The northern portion, commonly called \\"Industry City\\" on its own, hosts commercial light manufacturing tenants across 6,000,000 square feet of space between 32nd and 41st Streets, and is operated by a private consortium. The southern portion, known as \\"Bush Terminal\\", is located between 40th and 51st Streets and is operated by the New York City Economic Development Corporation as a garment manufacturing complex.\\nFounded by Bush Terminal Company head Irving T. Bush in the early 1900s, Bush Terminal was the first facility of its kind in New York City and the largest multi-tenant industrial property in the United States. The warehouses were built circa 1892–1910, the railroad from 1896 to 1915, and the factory lofts between 1905 and 1925. During World War I, Bush Terminal was used as a United States Navy base, though it returned to private ownership after the war."},{"page_url":"https://de.wikipedia.org/wiki/NWE_Nr._71_und_72","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Parisot_29_-_COTE-D%27OR_-_CHATILLON-SUR-SEINE_-_La_Sous-Pr%C3%A9fecture_-_Ancien_Couvent_des_B%C3%A9n%C3%A9dictines_du_Puits_d%27Orbe.JPG","page_title":"NWE Nr. 71 und 72","context_page_description":"In den Wirren des Zweiten Weltkrieges gelangten zwei 1890 von der französischen Firma Schneider & Cie hergestellte dreifach gekuppelte Schmalspurlokomotiven nach Deutschland. Übernommen wurden sie bei der Nordhausen-Wernigeroder Eisenbahn-Gesellschaft als Nr. 71 und 72. Die Deutsche Reichsbahn reihte die Lokomotiven unter der Baureihe 99.563 ein."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D1%96%D1%86%D0%B5%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_(%D1%84%D1%96%D0%BB%D1%8C%D0%BC,_1928)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Cop_lobby_card.jpg","page_title":"Поліцейський (фільм, 1928)","context_page_description":"Поліцейський — американська кримінальна драма режисера Дональда Кріспа 1928 року. Фільм був номінований на премію «Оскар» за найкращий адаптований сценарій."},{"page_url":"https://es.wikipedia.org/wiki/Jambal%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Panor%C3%A1mica_de_Jambal%C3%B3.jpg","page_title":"Jambaló","context_page_description":"Jambaló es un municipio y, al mismo tiempo, un resguardo indígena de Colombia. Está ubicado al nororiente del departamento del Cauca, a 80 kilómetros de la ciudad de Popayán. Limita por el norte con los municipios de Caloto y Toribío, por el oriente con el municipio de Páez, por el sur con el municipio de Silvia y por el occidente con los municipios de Caldono y Santander de Quilichao. La cabecera municipal es el centro urbano más poblado del territorio y también se llama \\"Jambaló\\"; se localiza en el extremo sur, sobre los límites con el municipio de Silvia; no obstante, en el área rural es donde habita la mayor parte de la población.\\nAl ser Jambaló también resguardo indígena, el 97,7%​ de sus habitantes son de las etnias nasa y misak, y al menos una tercera parte de ellos hablan las lenguas nasa yuwe y namtrik. Como resguardo indígena fue establecido en 1702 cuando el cacique Juan Tama de la Estrella alinderó el territorio, es decir, estableció sus límites geográficos, luego de recibir el título de manos del virrey de Quito. El martes 12 de julio de 1904, bajo la ordenanza número 38 de la Gobernación del Cauca fue erigido municipio."},{"page_url":"https://pl.wikipedia.org/wiki/Nalanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Nalanda_Univercity.JPG","page_title":"Nalanda","context_page_description":"Nalanda – buddyjski klasztor i uniwersytet założony w V wieku, w północno-wschodnich Indiach, na terenie dzisiejszego stanu Bihar. Jedna z najstarszych placówek edukacyjnych na świecie, jednocześnie obok Wikramasili największa i najsławniejsza tzw. mahāvihāra. W 2016 roku obiekt wpisano na listę światowego dziedzictwa UNESCO.\\nKompleks został zlokalizowany w miejscu narodzin i śmierci Sāriputty, jednego z najważniejszych uczniów Buddy Siakjamuniego. Za rządów króla Aśoki wybudowano tu świątynię, wokół której w okresie późniejszym powstały zabudowania zakonne.\\nSwój rozkwit i znaczenie uniwersytet zawdzięczał władcom z dynastii Guptów i Palów. Dzięki ich patronatowi wykładali w nim najsłynniejsi buddyjscy uczeni, a do Nalandy ściągali studenci z całej Azji Wschodniej, Południowo-Wschodniej, Środkowej, a także z Persji i innych krajów niebuddyjskich.\\nPo siedmiu wiekach działalności, klasztor został zburzony w wyniku XII-wiecznego, muzułmańskiego najazdu."},{"page_url":"https://sh.wikipedia.org/wiki/La_Chaux-de-Fonds","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/La_Chaux-de-Fonds1841.png","page_title":"La Chaux-de-Fonds","context_page_description":"La Chaux-de-Fonds je glavni grad distrikta La Chaux-de-Fonds u kantonu Neuchâtel, na sjeverozapadu Švicarske, nekoliko kilometara od Francuske.\\nGrad se nalazi na Jurskim planinama, na 1000 metara nadmorske visine, a poslije Ženeve i Lausanne je treći grad po veličini u Švicarskoj s većinskim stanovništvom koje govori francuski jezik. Gradovi La Chaux-de-Fonds i Le Locle su 2009. godine upisani na UNESCO-v popis mjesta svjetske baštine u Europi kao \\"izvanredan primjer gradova koji su svoju industriju temeljili na proizvodnji satova, te su urbanizirani prema načelima urarske racionalne organizacije\\"."},{"page_url":"https://et.wikipedia.org/wiki/Glandorf_(Saksamaa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/GlandorfSt.Johannes.jpg","page_title":"Glandorf (Saksamaa)","context_page_description":"Glandorf on vald Saksamaal Alam-Saksimaal Osnabrücki kreisis.\\nValla pindala on 59,88 km². 31. detsembril 2017 elas seal 6665 inimest. Vald asub Teutoburgi metsa lähedal, 24 km Osnabrückist lõunas. Nimi \\"Glandorf\\" tuleneb Glanathorpe'st – mis tähendab asulat Glane oja ääres – ja on esmakordselt mainitud 1070. aastal.\\nValda kuuluvad Glandorf, Averfehrden, Schierloh, Schwege, Sudendorf, Westendorf ja Laudiek.\\nGlandorfi maamärk on tuuleveski, mis on ehitatud, järgides Hollandi tuulikuehituse näiteid. See ehitati 1840. aastal. 2000. aastast korraldatakse tuulikus abiellumisi."},{"page_url":"https://en.wikipedia.org/wiki/Rulewo","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/10.11.13_Rulewo_pa%C5%82ac_%281%29.jpg","page_title":"Rulewo","context_page_description":"Rulewo is a village in the administrative district of Gmina Warlubie, within Świecie County, Kuyavian-Pomeranian Voivodeship, in north-central Poland. It lies approximately 5 kilometres south of Warlubie, 19 km north-east of Świecie, 58 km north of Toruń, and 63 km north-east of Bydgoszcz.\\nThe village has a population of 260."},{"page_url":"https://sv.wikipedia.org/wiki/Urban_IV","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/SMN_Chiostro_Grande_e06_Mauro_Soderini%2C_San_Tommaso_d%27Aquino_presenta_l%27uffizio_del_Corpus_Domini_a_Urbano_IV.JPG","page_title":"Urban IV","context_page_description":"Urban IV, född Jacques Pantaléon cirka 1195 i Troyes, Frankrike, död 2 oktober 1264 i Perugia, Italien, var påve från den 29 augusti 1261 till sin död, 2 oktober 1264."},{"page_url":"https://pl.wikipedia.org/wiki/Hrabstwo_Jefferson_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Jefferson_County_Courthouse_in_Steubenville.jpg","page_title":"Hrabstwo Jefferson (Ohio)","context_page_description":"Hrabstwo Jefferson – hrabstwo w stanie Ohio w Stanach Zjednoczonych. Obszar całkowity hrabstwa obejmuje powierzchnię 410,87 mil². Według danych z 2010 r. hrabstwo miało 69 709 mieszkańców. Hrabstwo powstało 29 lipca 1797 roku i nosi imię Thomasa Jefferson, który w tym czasie był wiceprezydentem Stanów Zjednoczonych."},{"page_url":"https://en.wikipedia.org/wiki/Raggal","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Raggal%2C_dorpszicht_vanaf_Sankt_Gerold_foto2_2009-06-02_19.23.JPG","page_title":"Raggal","context_page_description":"Raggal is a municipality in the district of Bludenz in the Austrian state of Vorarlberg."},{"page_url":"https://sh.wikipedia.org/wiki/Arcachon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Moulleau.JPG","page_title":"Arcachon","context_page_description":"Arkašon je naseljeno mesto u Francuskoj u regionu Akvitanija, u departmanu Žironda.\\nPo podacima iz 1990. godine broj stanovnika u mestu je bio 11.770, a gustina naseljenosti je iznosila 1,557 stanovnika/km²."},{"page_url":"https://fr.wikipedia.org/wiki/Citadelle_de_Poenari","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Citadelle_de_Arefu.jpg","page_title":"Citadelle de Poenari","context_page_description":"Le château de Poenari ou citadelle de Poenarie aujourd'hui en ruine, est situé en Roumanie dans la région de Vâlcea du comté d'Argeș entre les Carpates et la plaine du Danube.\\nIl domine à environ 800 mètres de haut sur une falaise desservie par la route Transfăgăraș et en contrebas de laquelle s'écoule l'Argeș, au sud du lac Vidraru."},{"page_url":"https://en.wikipedia.org/wiki/P%C5%99%C3%ADtomnost","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Titulni_strana_casopisu_pritomnost_z_roku_1924.JPG","page_title":"Přítomnost","context_page_description":"Přítomnost is a Czech political-cultural magazine published in Prague."},{"page_url":"https://pl.wikipedia.org/wiki/Rosegg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Rosegg_Ortsansicht_mit_Pfarrkirche_hl._Michael_und_Marktgemeindeamt_31122010_6184.jpg","page_title":"Rosegg","context_page_description":"Rosegg – gmina targowa w Austrii, w kraju związkowym Karyntia, w powiecie Villach-Land. Według Austriackiego Urzędu Statystycznego liczyła 1808 mieszkańców."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8F%A4%E4%BB%A3%E3%82%AE%E3%83%AA%E3%82%B7%E3%82%A2%E3%81%AE%E5%BD%AB%E5%88%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Cavalcade_south_frieze_Parthenon_BM.jpg","page_title":"古代ギリシアの彫刻","context_page_description":"古代ギリシアの彫刻では、古代ギリシア時代に制作された彫刻について説明する。\\n現代の学芸員は、文献の乏しい暗黒時代からヘレニズム時代まで、古代ギリシア彫刻を幾つかの区分に分けて識別している。全ての時代で、大量のテラコッタ製の人物像と金属や他の素材で作られた少数の彫刻が存在した。\\nギリシア人は、芸術の追究にとって人間の姿形が最も重要な主題であると、ごく早期に決定した。彼らの神々が人間の姿形になっていることを見ても、芸術において聖なるものと世俗的なものの区別はほとんどなく、ヒトの肉体は世俗的かつ神聖なものだった。アポローンまたはヘラクレスの男性裸体像は、その年の古代オリンピックのボクシング優勝者のもので、表現方法にわずかな違いが見られる程度である。彫像は元々は単体だったが、ヘレニズム時代では集団のものが支配的な形となった。レリーフ彫刻は、「高い」位置のため彼らがほぼ自立しているようで、やはり重要視された。"},{"page_url":"https://en.wikipedia.org/wiki/John_Leslie_(bishop_of_Kilmore,_Elphin_and_Ardagh)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/CastleLeslieSummer2006.jpg","page_title":"John Leslie (bishop of Kilmore, Elphin and Ardagh)","context_page_description":"John Powell Leslie was a bishop in the Church of Ireland. His great-grandfather was Charles Leslie, a noted Non-Juror member of the Church of Ireland and one of the most prominent Jacobite propagandists after the 1688 Glorious Revolution."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%BA%D0%B0%D0%BD%D0%B0%D1%82%D0%BD%D0%BE%D0%B9_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B8_%D0%B2_%D0%9A%D0%B0%D0%B2%D0%B0%D0%BB%D0%B5%D0%B7%D0%B5_(1976)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Cermis_view.jpg","page_title":"Катастрофа канатной дороги в Кавалезе (1976)","context_page_description":"Катастрофа канатной дороги в Кавалезе 1976 года — наиболее тяжкая авария канатной дороги в истории. 9 марта 1976 года произошёл обрыв стального поддерживающего троса канатной дороги, когда полностью загруженный вагончик канатной дороги спускался с горы Чермис возле итальянского горнолыжного курорта Кавалезе в Доломитах, 40 км к северо-востоку от Тренто."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1909","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Malverde2.jpg","page_title":"Lijst van personen overleden in 1909","context_page_description":"Dit is een lijst van personen die overleden zijn in 1909.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Coprates_quadrangle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/48057_1560craterlayersclose.jpg","page_title":"Coprates quadrangle","context_page_description":"The Coprates quadrangle is one of a series of 30 quadrangle maps of Mars used by the United States Geological Survey Astrogeology Research Program. The Coprates quadrangle is also referred to as MC-18. The Coprates quadrangle contains parts of many of the old classical regions of Mars: Sinai Planum, Solis Planum, Thaumasia Planum, Lunae Planum, Noachis Terra, and Xanthe Terra.\\nThe name Coprates refers to an old name for a river in Persia.\\nThe Coprates quadrangle goes from 45° to 90° west longitude and 0° to 30° south latitude on Mars. Coprates quadrangle is famous for depicting the \\"Grand Canyon of Mars\\", the Valles Marineris Canyon System. Signs of water exist in this quadrangle, with ancient river valleys and networks of stream channels showing up as inverted terrain and lakes inside of Valles Marineris."},{"page_url":"https://sk.wikipedia.org/wiki/Uli%C4%8Dsk%C3%A9_Kriv%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Ulicske_Krive%2C_cerkiew.jpg","page_title":"Uličské Krivé","context_page_description":"Uličské Krivé je obec na Slovensku v okrese Snina."},{"page_url":"https://en.wikipedia.org/wiki/Old_Somerby","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Oldsomerby1.jpg","page_title":"Old Somerby","context_page_description":"Old Somerby is a village and civil parish in the South Kesteven district of Lincolnshire, England, 3 miles south-east of Grantham. It lies on the B1176 road about 1 mile east of its junction with the A52 and B6403, and 0.2 miles from the East Coast Main Line."},{"page_url":"https://fr.wikipedia.org/wiki/Hyderabad","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/St._Francis_Xavier_Cathedral%2C_Hyderabad_1.jpg","page_title":"Hyderabad","context_page_description":"Hyderabad parfois appelée Hyderabad de l'Inde ou Haïdarabad est la capitale et la plus grande ville de l'État indien du Telangana, créé le 2 juin 2014 à partir de l'Andhra Pradesh. Elle reste capitale commune des deux États jusqu'en 2024.\\nHyderabad est connue pour son histoire, sa culture et son architecture largement influencées par la situation de la ville à la frontière entre l'Inde du Nord et l'Inde du Sud et par le fait que les hindous et les musulmans y ont coexisté paisiblement pendant des siècles."},{"page_url":"https://de.wikipedia.org/wiki/Geowanderweg_Sonsbeck","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/FW-Sonsbeck_Station_08.jpg","page_title":"Geowanderweg Sonsbeck","context_page_description":"Der Geowanderweg Sonsbeck ist ein 1,2 km langer Lehrpfad über die eiszeitliche Stauchmoränenlandschaft der Sonsbecker Schweiz im Kreis Wesel."},{"page_url":"https://cs.wikipedia.org/wiki/Noto","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Palazzo_Ducezio-pjt.jpg","page_title":"Noto","context_page_description":"Noto je obec a město na jihovýchodě Sicílie, na území volného sdružení obcí Siracusa. Leží 32 km jihovýchodně od správního centra sdružení obcí Syrakus, na úpatí pohoří Iblei a dává jméno údolí, které je obklopuje. V roce 2002 bylo Noto a jeho barokní stavby zařazeno na Seznam světového dědictví UNESCO."},{"page_url":"https://cs.wikipedia.org/wiki/Kulov%C3%A9_panorama","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Globe_panorama.jpg","page_title":"Kulové panorama","context_page_description":"Kulové panorama nebo sférické panorama nebo v jistém případě malá planeta je prezentace panoramatické fotografie v rovinném charakteristickém zkreslení. V obrazu jsou zastoupeny všechny úhly pohledu, které jsou vidět z místa pořízení. Oproti panoramatu cylindrickému je doplněno vrchlíkem i podstavou, tedy pohledem kolmo nad fotoaparát a pod fotoaparát."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%B1%DA%86%D9%85%D8%A7%D9%82%DB%8C%E2%80%8C%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Cordyceps.jpg","page_title":"سرچماقی‌ها","context_page_description":"سرچُماقی‌ها سرده‌ای از قارچ‌های کیسه‌ای هستند که ۴۰۰ گونه از آن‌ها تاکنون تشریح شده‌است.\\nتمامی سرچماقی‌ها زندگی انگلی دارند و بر بدن حشرات و بندپایان می‌رویند. چند گونه از آن‌ها نیز بر تنه سرچماقی‌های دیگر زندگی می‌کنند. شناخته‌شده‌ترین گونه آن قارچ کرم ابریشم است که در پزشکی سنتی تبت و چین کاربرد دارد."},{"page_url":"https://cs.wikipedia.org/wiki/Z%C3%A1suvka_(elektrotechnika)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Z%C3%A1chrann%C3%A1_slu%C5%BEba_Karlovy_Vary.JPG","page_title":"Zásuvka (elektrotechnika)","context_page_description":"Zásuvka je elektrotechnická součástka, která slouží pro připojení elektrických spotřebičů k elektrorozvodné síti. Zásuvka tvoří nejčastěji nepohyblivou část zásuvkového propojení, připevněnou ke stěně budovy, rozváděči nebo stroji. Může být ale i pohyblivou součástí prodlužovačky nebo volné rozbočky. Do ní se zastrkuje vidlice. Vidlice je součástí pohyblivého přívodu k jinému elektrickému zařízení, nebo je přímo částí tohoto zařízení. Obdobné spojení datových, telekomunikačních, obecně slaboproudých rozvodů, případně kombinace silových a slaboproudých rozvodů se jmenuje konektorové spojení."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%8D%A1%E7%B1%B3%E6%8B%89%C2%B7%E5%B7%B4%E5%88%97%E9%9C%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Camila_Vallejo_Dowling_BCN.jpg","page_title":"卡米拉·巴列霍","context_page_description":"卡米拉·安東妮婭·阿瑪蘭塔·巴列霍·道靈是智利的一個地理學者和政治家。她是智利共產黨的黨員。她曾是2011年智利學生示威遊行的主要領導人之一，當時她擔任智利大學生聯合會主席和智利學生聯盟的主要發言人。2014年起，她任代表聖地亞哥的拉弗羅里達選區的智利眾議院議員。"},{"page_url":"https://fr.wikipedia.org/wiki/Ansellia_africana","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Starr_070727-7720_Unknown_orchidaceae.jpg","page_title":"Ansellia africana","context_page_description":"Ansellia africana est une espèce monotypique d'orchidées communément connue sous le nom d’Orchidée léopard. Le genre Ansellia a été nommé en l'honneur de John Ansell, un assistant botaniste anglais, qui a trouvé les premiers spécimens en 1841 sur l'île de Fernando Po en Afrique de l'Ouest. Ce genre est connu sous l'abréviation Aslla dans le commerce horticole."},{"page_url":"https://oc.wikipedia.org/wiki/Mesnac","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Mesnac1.JPG","page_title":"Mesnac","context_page_description":"Mesnac es una comuna francesa, situada dins lo departament de Charanta e la region de Novela Aquitània, ancianament de Peitau-Charantas."},{"page_url":"https://eo.wikipedia.org/wiki/Godfried_Bomans","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/1980_Sango_kaj_Amo.jpeg","page_title":"Godfried Bomans","context_page_description":"Jan Arnold Godfried Bomans estis nederlanda verkisto kaj radi/televidila gravulo.\\nLa libroj de Bomans longtempe estis la plej legataj en Nederlando.\\nBomans antaŭ ĉio estis populara pro la romano Erik, of het Klein Insectenboek, kaj post la Dua Mondmilito, per la komiksoj pri Pa Pinkelman el la gazeto De Volkskrant, kaj pli poste per la kolumnoj sur la frontpaĝo de tiu gazeto, la artikoloj en la magazino Elsevier kaj aperoj en radio- kaj televido-programoj. En oktobro 2000 la vidvino de Godfried Bomans donis lian arkivon al la \\"Letterkundig Museum\\".\\nBomans estis kompetentulo pri la verkoj de Charles Dickens. Li ludis grandan rolon dum la ekesto de la nederlanda traduko de la kompletaj verkoj de Dickens, kiuj dum la 1950-aj jaroj en poŝformato eldoniĝis de \\"Spectrum\\". La longe atendata biografio de Dickens neniam eldoniĝis."},{"page_url":"https://da.wikipedia.org/wiki/Ruslands_nationalsang","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Russian_Anthem_Music_Sheet.InstrumentalSimple.svg","page_title":"Ruslands nationalsang","context_page_description":"Den Russiske Føderations Statshymne\\ner Den Russiske Føderations nationalsang. Den har samme melodi som den gamle sovjetiske nationalsang af Aleksandr Aleksandrov fra 1939, men ny tekst af Sergej Mikhalkov, som sammen med Gabriel El-Registan havde skrevet teksten til den originale sovjetiske nationalsang. Fra 1944 erstattede den Internationale som en ny, mere sovjetisk og russisk nationalsang. Den samme melodi, men uden teksten efter opgøret med Stalins eftermæle, blev anvendt efter 1956. En ny tekst blev skrevet af Sergej Mikhalkov i 1970, som lagde mindre vægt på Anden Verdenskrig og mere vægt på kommunismens sejr, blev godkendt i 1977.\\nDen Russiske SFSR var den eneste Sovjetrepublik, der ikke havde sin egen nationalsang. Den tekstløse \\"Den Patriotiske Sang\\" komponeret i 1833 af Mikhail Glinka blev officielt indført i 1990 af den Russiske SFSR's Øverste Sovjet og stadfæstet i 1993 efter Sovjetunionens sammenbrud af Ruslands præsident Boris Jeltsin. Denne hymne viste sig at være upopulær både hos det russiske folk, mange politikere og offentlige personligheder pga. melodien og den manglende tekst, som gjorde det svært at inspirere russiske atleter under sportkonkurrencer."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%BB%D1%8C%D0%B3%D0%B0_(%D0%BA%D0%BD%D1%8F%D0%B3%D0%B8%D0%BD%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%9A%D0%BD%D1%8F%D0%B3%D0%B8%D0%BD%D1%96_%D0%9E%D0%BB%D1%8C%D0%B7%D1%96.jpg","page_title":"Ольга (княгиня)","context_page_description":"О́льга — руська княгиня із династії Рюриковичів. Дружина київського князя Ігоря, по загибелі якого зійшла на київський стіл. Мати Святослава Ігоровича. Ліквідувала Древлянське племінне княжіння, упорядкувала збирання данини, організувавши по всій країні князівські погости і осередки судочинства. У зовнішній політиці підтримувала дружні стосунки із Візантією, 946 або 957 відвідала Константинополь, де уклала угоду з імператором Костянтином VII Багрянородним і прийняла християнство. У 964 році передала владу синові. Похована за християнським звичаєм.\\nХрещене ім'я — Олена; також — О́льга-Оле́на. Канонізована католицькою і православною церквами як свята Ольга. Інші імена — Вольга, сканд. Хельга, Алогія.\\nУ сучасній українській традиції очолює перелік найвідоміших жінок давньої та сучасної України."},{"page_url":"https://id.wikipedia.org/wiki/Aiko,_Putri_Toshi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Princess_Aiko_cropped_1_Crown_Prince_Naruhito_Crown_Princess_Masako_and_Princess_Aiko_20160801.jpg","page_title":"Aiko, Putri Toshi","context_page_description":"Aiko adalah anak tunggal Naruhito, Kaisar Jepang ke-126. Dia adalah cucu Akihito, Kaisar Jepang ke-125."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%9B%B8%E5%9D%8A%E8%A1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/SyuFongGaai.jpg","page_title":"書坊街","context_page_description":"書坊街（粵拼：syu¹ fong¹ gaai¹）；第個名係學院前（hok⁶ jyun² cin⁴），佢係廣東省廣州市嘅其中一條街，喺越秀區嘅惠福東路同大南路之間嘅位。據話1960年代，呢度經有賣觀賞魚嘅檔口，喺20世紀八、九十年代係廣州無人不知、無人不曉嘅金魚街，同高第街一樣出名。芳村觀賞魚市場未搞起陣，呢度係廣州觀賞魚及用品用具嘅主要街市，北方及東南亞嘅商販都來過呢度入貨。最旺陣100米左右嘅小巷中有數十家做觀賞魚及用品生意嘅鋪頭，行人都要側身先至行到。\\n2010年越秀區政府以迎亞運改造街區為由，清拆咗書坊街，盛極一時嘅金魚街咁就冇咗。"},{"page_url":"https://es.wikipedia.org/wiki/Chimayche","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Location_of_the_province_Mariscal_Luzuriaga_Ancash.PNG","page_title":"Chimayche","context_page_description":"El chimayche, es uno de los géneros musicales de la música andina del Perú propio de la sierra norte de la región Ancash. Originado en el antiguo centro poblado de Vilcabamba, distrito de Casca, provincia de Mariscal Luzuriaga.\\nEsta variante del huayno ancashino es ampliamente practicada en Sihuas, Pomabamba y Mariscal Luzuriaga.​"},{"page_url":"https://sk.wikipedia.org/wiki/Julie_R%C3%A9camierov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Juliette_R%C3%A9camier_%281777-1849%29_signature_1830.jpg","page_title":"Julie Récamierová","context_page_description":"Julie Récamierová bola saloniérka, autorka epištol a členka spoločenskej skupiny „Merveilleuses“ v období Direktoriátu. Obvykle býva zaraďovaná aj medzi preciózky. Počas direktoriátu bola neprehliadnuteľnou iniciátorkou a šíriteľkou novoantického štýlu, ktorý sa stal typický pre obdobie prvého cisárstva vo Francúzsku pod názvom empír. Bola členkou protinapoleonskej opozície."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%90%95%E5%AE%AB%E5%BA%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Former_Residence_of_Lv_Gong_21_2015-04.JPG","page_title":"吕宫府","context_page_description":"呂宮府位於江蘇省常州市天寧區前北岸64號，為清代狀元呂宮晚年居於常州的府第，原東西分別鄰管幹貞故居和東坡書院，南北則貫通前後北岸，分別至顧塘河和白雲溪河。建築原有八進，今存後五進，中路每進為面闊五間的硬山造磚木結構廳堂，東西兩側以夾弄貫穿相連，唯第三進以均為二層的主樓和廂樓相連成院。原建築年久失修已成危房，現狀為2006年10月至2007年5月翻建復原，現為常州國家非物質文化遺產博覽苑。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B5%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D0%B9_%D0%BC%D1%96%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3_(%D0%A2%D0%BE%D0%BC%D1%81%D1%8C%D0%BA%D0%B0_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/%D0%93%D0%9E_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4_%D0%9A%D0%B5%D0%B4%D1%80%D0%BE%D0%B2%D1%8B%D0%B9.png","page_title":"Кедровий міський округ (Томська область)","context_page_description":"Кедро́вий міський округ — адміністративна одиниця Томської області Російської Федерації.\\nАдміністративний центр — місто Кедровий."},{"page_url":"https://fr.wikipedia.org/wiki/Mairy-sur-Marne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Mairy-sur-Marne_-_%C3%A9glise_Saint-L%C3%A9ger_%2801%29.JPG","page_title":"Mairy-sur-Marne","context_page_description":"Mairy-sur-Marne est une commune française, située dans le département de la Marne en région Grand Est."},{"page_url":"https://it.wikipedia.org/wiki/20_Exitos_De_Oro","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/BeatlesVara1964_%28retouched%29.png","page_title":"20 Exitos De Oro","context_page_description":"20 Exitos De Oro è una raccolta dei Beatles uscita solamente in Perù nel 1982."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E4%BA%AC%E9%83%BD%E8%BF%8E%E5%AE%BE%E9%A6%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Kyoto_State_Guest_House_Main_Gate.JPG","page_title":"京都迎宾馆","context_page_description":"京都迎賓館是日本的一座國家迎賓館，位於京都府京都市上京區京都御苑。"},{"page_url":"https://ro.wikipedia.org/wiki/Z%C4%83voi,_Cara%C8%99-Severin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Banat_Josephinische_Landaufnahme_pg122.jpg","page_title":"Zăvoi, Caraș-Severin","context_page_description":"Zăvoi este satul de reședință al comunei cu același nume din județul Caraș-Severin, Banat, România."},{"page_url":"https://en.wikipedia.org/wiki/Uncontacted_peoples","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Gallery-1491391768-north-sentinel-island.jpg","page_title":"Uncontacted peoples","context_page_description":"Uncontacted peoples are communities or groups of indigenous peoples living without sustained contact to neighbouring communities and the world community. In 2013 there were thought to be roughly 100 uncontacted peoples worldwide, half of whom live in the Amazon rainforest.\\nExisting knowledge of indigenous peoples in isolation comes mostly from encounters with neighbouring communities like other indigenous peoples, and from aerial footage."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%88%D9%8A%D9%84%D9%8A%D8%B3_%D9%84%D9%8A%D9%87_%D9%87%D9%88%D9%85%D9%8A%D8%B1%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Noyelles-l%C3%A8s-Humi%C3%A8res_%C3%A9glise.jpg","page_title":"نويليس ليه هوميريس","context_page_description":"نويليس ليه هوميريس ‏ هي بلدية تقع في إقليم باد كاليه من منطقة نور با دو كاليه في شمال فرنسا. تبلغ مساحة هذه المدينة 1.16، وترتفع عن سطح البحر 109 م، يبلغ عدد سكانها 56 نسمة حسب إحصاء المعهد الوطني للإحصاء والدراسات الاقتصادية سنة 2009 م. وترأس Gérard Cucheval البلدية خلال فترة."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B2%82%E6%B0%B4%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/%E9%9D%92%E5%B2%9B%E6%B2%82%E6%B0%B4%E8%B7%AF%E5%8D%97%E4%BE%A7.jpg","page_title":"沂水路","context_page_description":"沂水路是中国青岛市市南区一条城市支路，全长约400米，东北起自江苏路，西南止于总督府广场。该路始建于德国租借时期，时名迪德里希路，日本第一次统治时期更名为赤羽町，回归国统后改现名。沿路有许多德国租借时代留下的德式建筑，西南端11号正对广场的就是当年的最高政府机关——胶澳总督府，最南端是英国驻青岛的总领事馆，总督府以东路段两侧有美国驻青岛的总领事馆，以及一批高级别墅。东北端正对着位于高地上的江苏路基督教堂。"},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_f%C3%B6rfattarmuseer_i_Sverige","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Albert_Engstr%C3%B6ms_atelje_04.JPG","page_title":"Lista över författarmuseer i Sverige","context_page_description":"Lista över författarmuseer i Sverige är en ofullständig förteckning över bevarade tidigare författarbostäder eller -uppväxtmiljöer."},{"page_url":"https://nl.wikipedia.org/wiki/Osiek_(stad)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Osiek_church.jpg","page_title":"Osiek (stad)","context_page_description":"Osiek is een stad in het Poolse woiwodschap Świętokrzyskie, gelegen in de powiat Staszowski. De oppervlakte bedraagt 17,44 km², het inwonertal 1931.\\nOsiek is onderdeel van gemeente Osiek."},{"page_url":"https://en.wikipedia.org/wiki/%C3%89toile_Sportive_du_Sahel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Abdul_Kader_Keita_2011_%281%29.jpg","page_title":"Étoile Sportive du Sahel","context_page_description":"The Étoile Sportive du Sahel, is a sports club from Sousse in the Sahel region of Tunisia, known primarily for its football and basketball team. The club also has sections for handball, volleyball, judo and wrestling. ESS was founded on 11 May 1925 after a general meeting under the chairmanship of Chedly Boujemla, Ali Laârbi and Ahmed Zaklaoui, at the headquarters of the Association of the ancient French-Arab School in Laroussi Zarouk Street, in the heart of the ancient city of Sousse. The aim of the meeting was to establish a sports education society. The Tunisian flag was chosen in the selection of the colors of the team. The red shirt with the star and the white shorts. The French colonial authorities prevented the use of these colors, but with the insistence of the team leaders they prevailed and in the latter they played this kit. In English the name means Sport Star of the Sahel\\nIn Tunisia, Étoile du Sahel is considered to be one of the best clubs. For many years it had a reputation of playing entertaining football. In fact, the club has evolved recently into a more professional outfit capable of winning trophies at home and abroad."},{"page_url":"https://de.wikipedia.org/wiki/Kustwacht_Caribisch_Gebied","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Cutters2.jpg","page_title":"Kustwacht Caribisch Gebied","context_page_description":"Die Kustwacht voor het Koninkrijk der Nederlanden in het Caribisch Gebied ist die Küstenwache des Königreichs der Niederlande für das Gebiet der Niederländischen Karibik."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_Santa_Mar%C3%ADa_(Bendones)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Santa_Mar%C3%ADa_de_Bendones_detalle_Ventana.JPG","page_title":"Iglesia de Santa María (Bendones)","context_page_description":"La iglesia de Santa María de Bendones, situada en el centro de la aldea Bendones, parroquia perteneciente al municipio de Oviedo, es un templo construido entre 792 y 842, considerado una de las joyas del arte prerrománico asturiano.\\nFue declarada monumento nacional en diciembre del año 1958. La iglesia se ubica a sólo 5 kilómetros de la capital del concejo, en dirección a Pola de Laviana. Es una construcción de la primera mitad del siglo IX."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E7%B3%BB%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Edgar_Injap_Sia.png","page_title":"日系人","context_page_description":"日系人とは、日本以外の国に移住し当該国の国籍または永住権を取得した日本人、およびその子孫のこと。2017年時点で約380万人存在すると推定されている。日本に居住する日系人は約30万人存在する。"},{"page_url":"https://en.wikipedia.org/wiki/Bed%C5%99ichov_(Jablonec_nad_Nisou_District)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Bedrichov-rybnik.jpg","page_title":"Bedřichov (Jablonec nad Nisou District)","context_page_description":"Bedřîchov is a village in the Liberec Region of the Czech Republic. It is located about 8 km north-northwest of Jablonec nad Nisou and has a population of 286.\\nThere is a ski area at Bedřichov, which was used during the 2009 Nordic World Ski Championships in Liberec. It is popular for cross-country skiing and downhill skiing."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AF%E0%A7%81%E0%A6%95%E0%A7%8D%E0%A6%A4%E0%A6%B0%E0%A6%BE%E0%A6%B7%E0%A7%8D%E0%A6%9F%E0%A7%8D%E0%A6%B0%E0%A7%87%E0%A6%B0_%E0%A6%AE%E0%A6%B8%E0%A6%9C%E0%A6%BF%E0%A6%A6%E0%A7%87%E0%A6%B0_%E0%A6%A4%E0%A6%BE%E0%A6%B2%E0%A6%BF%E0%A6%95%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/ISCNY_pic.jpg","page_title":"যুক্তরাষ্ট্রের মসজিদের তালিকা","context_page_description":"এই নিবন্ধটি হচ্ছে মার্কিন যুক্তরাষ্ট্রের উলেখ্যযোগ্য মসজিদের ও ইসলামিক ভবনের একটি তালিকা।"},{"page_url":"https://de.wikipedia.org/wiki/Lois_Wilson","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Loiswilson.jpg","page_title":"Lois Wilson","context_page_description":"Lois Wilson war eine US-amerikanische Schauspielerin."},{"page_url":"https://en.wikipedia.org/wiki/SS_Pere_Marquette","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Pere_Marquette_carferry_1896.jpg","page_title":"SS Pere Marquette","context_page_description":"The SS Pere Marquette was the world's first steel train ferry. It sailed on Lake Michigan and provided a service between the ports of Ludington, Michigan, and Manitowoc, Wisconsin, for the Pere Marquette Railway from 1897 to 1930. The railway used the name Pere Marquette for many of its ships and ferries, adding a number to the end of the name."},{"page_url":"https://ro.wikipedia.org/wiki/Bari","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Izlo%C5%A1ci_zbirke_u_Bariju.jpg","page_title":"Bari","context_page_description":"Situat pe coasta Adriaticii, orașul Bari este capitala regiunii italiene Apulia și a provinciei Bari. Conform datelor din 2004, are o populație de 328.458 locuitori."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%B7%D0%BE%D0%B3%D0%B5%D0%BB%D1%96%D0%BD-%D1%87%D0%BE%D1%80%D0%B1%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Ezo_Gelin_soup.jpg","page_title":"Езогелін-чорба","context_page_description":"Езогелін чорба або Суп нареченої — традиційний суп турецької кухні. Основними інгредієнтами супу є булгур та червона сочевиця. Походження супу приписують нареченій Езо з Газіантепу."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D1%96%D0%B2%D0%B0%D0%BA%D0%BE%D0%B2_%D0%92%D0%BE%D0%BB%D0%BE%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%A2%D0%B5%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Vladimir_Spivakov_2012.jpg","page_title":"Співаков Володимир Теодорович","context_page_description":"Володи́мир Теодо́рович Співако́в — російський скрипаль та диригент, засновник і керівник оркестру «Віртуози Москви». Народний артист СРСР, посол Доброї волі ЮНЕСКО, «Артист Миру»."},{"page_url":"https://fr.wikipedia.org/wiki/Titanoeca_americana","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Common_Spiders_U.S._493_Titanoeca_americana.png","page_title":"Titanoeca americana","context_page_description":"Titanoeca americana est une espèce d'araignées aranéomorphes de la famille des Titanoecidae."},{"page_url":"https://en.wikipedia.org/wiki/Angle","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/ExternalAngles.svg","page_title":"Angle","context_page_description":"In plane geometry, an angle is the figure formed by two rays, called the sides of the angle, sharing a common endpoint, called the vertex of the angle.\\nAngles formed by two rays lie in a plane, but this plane does not have to be a Euclidean plane. Angles are also formed by the intersection of two planes in Euclidean and other spaces. These are called dihedral angles. Angles formed by the intersection of two curves in a plane are defined as the angle determined by the tangent rays at the point of intersection. Similar statements also hold in space. For example, the spherical angle formed by two great circles on a sphere is the dihedral angle between the planes determined by the great circles.\\nAngle is also used to designate the measure of an angle or of a rotation. This measure is the ratio of the length of a circular arc to its radius. In the case of a geometric angle, the arc is centered at the vertex and delimited by the sides. In the case of a rotation, the arc is centered at the center of the rotation and delimited by any other point and its image by the rotation."},{"page_url":"https://en.wikipedia.org/wiki/List_of_national_parks_of_Iceland","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Karl-Kerling-J%C3%B6kuls%C3%A1rglj%C3%BAfur-National-Park-Iceland-20030605.jpg","page_title":"List of national parks of Iceland","context_page_description":"Since 2008, Iceland has three national parks. Prior to 2008 there were four national parks in Iceland; in that year Jökulsárgljúfur and Skaftafell were merged and incorporated into Vatnajökull National Park.\\nVatnajökull National Park and Snæfellsjökull National Park are supervised by the Ministry for the Environment and Natural Resources, Þingvellir National Park is supervised by the Ministry for the Prime Minister."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Dyer%2C_Arkansas_view_from_mountain.jpg","page_title":"ديير","context_page_description":"ديير ‏ هي مدينة تقع في مقاطعة كروفورد، أركنسو بولاية أركنساس في الولايات المتحدة. تبلغ مساحتها 6.8، وترتفع عن سطح البحر 131 م، بلغ عدد سكانها 876 نسمة في عام 2010 حسب إحصاء مكتب تعداد الولايات المتحدة وتصل الكثافة السكانية فيها 129.5 نسمة/كم²."},{"page_url":"https://es.wikipedia.org/wiki/Plaza_Ernesto_Tornquist","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Iglesia_Santa_Rosa_de_Lima%2C_Tornquist%2C_provincia_de_Bs_As.jpg","page_title":"Plaza Ernesto Tornquist","context_page_description":"La Plaza Ernesto Tornquist se encuentra ubicada en la ciudad de Tornquist, cabecera del partido homónimo, Provincia de Buenos Aires, República Argentina.\\nEs el punto central de la ciudad y alrededor de ella se encuentran los edificios e instituciones más importantes. Combina varios estilos arquitectónicos como: el art decó, el neogótico, entre otros."},{"page_url":"https://en.wikipedia.org/wiki/Estadio_Uno","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Albertok.jpg","page_title":"Estadio Uno","context_page_description":"Estadio Uno was a Uruguayan television program. It aired from 1970 to 2017 on Televisión Nacional Uruguay Channel 5."},{"page_url":"https://sv.wikipedia.org/wiki/Ryo_Kawasaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Ryo_Kawasaki_Dec-15%2C_2018_in_Zagreb%2C_Croatia_%28cropped%29.jpg","page_title":"Ryo Kawasaki","context_page_description":"Ryo Kawasaki, född 25 februari 1947 i Kōenji, Suginami, Tokyo, Japan, död 13 april 2020 i Tallinn, Estland, var en japansk gitarrist, kompositör och dataprogrammerare. Hans intresse för musik väcktes tidigt i livet och fortsatte genom hans ungdom, samtidigt som han studerade kvantmekanik på Nippons universitet. Som 22-åring albumdebuterade han och var under det tidiga 1970-talet flitig studiomusiker i Japan. 1973 reste han till USA och anlände till New York där han började uppträda flitigt som jazzgitarrist. Efter ett tag kontaktades han av Gil Evans som bjöd in honom att medverka på skivan Plays Jimi Hendrix där man gjorde jazztolkningar av Hendrix låtar. Hans USA-debut som soloartist blev albumet Juice 1976 på RCA Records, och han var då en av de första japanska musikerna som fick skivkontrakt på ett större amerikanskt bolag. Samma år turnerade han med Elvin Jones band och spelade även med Chico Hamilton. På 1980-talet bildade han sin egen fusiongrupp The Golden Dragon och gav ett flertal konserter med dem."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%8F%D0%B5%D0%BD%D0%B5-%D0%92%D1%96%D1%80%D1%83%D0%BC%D0%B0%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Coat_of_arms_of_S%C3%B5meru_Parish.png","page_title":"Ляене-Вірумаа","context_page_description":"Ля́ене-Ві́румаа — повіт в Естонії, розташований в північно-східній частині країни. З півночі омивається водами Фінської затоки. Межує з повітами Іда-Вірумаа на сході, Йиґевамаа на півдні і Гар'юмаа і Ярвамаа на заході. Адміністративний центр — місто Раквере. Повіт в адміністративному відношенні поділяється на 2 міста і 13 волостей. Південна частина повіту лежить у межах Пандівереської височини. Там розташовується обширна карстова зона, звідки беруть початок багато річок."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Looz/Partie_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Borgloon_Kanunnikenhuis_2.JPG","page_title":"Liste des monuments historiques de Looz/Partie 1","context_page_description":"Cette page regroupe une partie des monuments classés de la ville de Looz."},{"page_url":"https://es.wikipedia.org/wiki/Zubizuri","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Bilboko_Zubizuriko_zorua.jpg","page_title":"Zubizuri","context_page_description":"Zubizuri, también conocido como puente peatonal del Campo de Volantín, aunque popularmente llamado puente de Calatrava, es un puente en arco sobre la ría del Nervión, en la ciudad vasca de Bilbao, en el norte de España. Une el Campo de Volantín, en la margen derecha, con Uribitarte, en la izquierda."},{"page_url":"https://simple.wikipedia.org/wiki/Uwe_Seeler","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Uwe_Seeler.JPG","page_title":"Uwe Seeler","context_page_description":"Uwe Seeler is a former German football player. He has played for Hamburger SV and West Germany national team."},{"page_url":"https://tr.wikipedia.org/wiki/Savur-Moh%C4%B1la","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Saur-Mogila_Ukrainian_2S5_Giatsint-S.png","page_title":"Savur-Mohıla","context_page_description":"Savur-Mohıla veya Saur-Mogila, Ukrayna-Rusya sınırındaki Rostov Oblastı'nda yer alan Snizhne kentinin yaklaşık 5 kilometre uzaklığında yer alan anıt. Ukraynalı mimar Anatoly Ignashchenko tarafından Büyük Vatanseverlik Savaşı sırasında Savur-Mohıla'nın kurtuluşunun 20. yıldönümünü anısına inşa edilmiştir.\\nII. Dünya Savaşı sırasında Savur-Mohıla, Sovyet birliklerinin Ağustos 1943'te yükseklik bakımından stratejik olması sebebiyle Nazi kuvvetlerinden kontrol altına almayı başardığı yoğun mücadele noktalarından biriydi. 1963 yılında burada hayatını kaybeden askerleri anmak üzere tepeye yerleştirilmek üzere bir anma kompleksi inşa edildi. Çelik ve beton kullanılarak Sovyet askeri ve bir dikilitaş içeren anıta buradaki çatışmada yaşamını yitiren katılan piyadelerin, tankçıların, topçuların ve havacıların isimleri yazıldı."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AB%8B%E6%9C%A8%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/%E7%AB%8B%E6%9C%A8%E7%A5%9E%E7%A4%BE%E5%86%85%E7%A8%B2%E8%8D%B7%E7%A5%9E%E7%A4%BE.jpg","page_title":"立木神社","context_page_description":"立木神社は、滋賀県草津市草津にある神社。東海道の草津宿にあったため厄除開運・交通安全の神社として信仰を集めている。"},{"page_url":"https://sh.wikipedia.org/wiki/Neufra","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Karte_Neufra.png","page_title":"Neufra","context_page_description":"Nojfra je opština u njemačkoj saveznoj državi Baden-Virtemberg. Jedno je od 25 opštinskih središta okruga Zigmaringen. Prema procjeni iz 2010. u opštini je živjelo 1.904 stanovnika. Posjeduje regionalnu šifru 8437082, NUTS i LOCODE kod."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%A9%D7%97%D7%A7%D7%99%D7%9D_%D7%94%D7%90%D7%99%D7%A8%D7%95%D7%A4%D7%99%D7%99%D7%9D_(2015)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/The_opening_ceremony_of_the_first_European_games_14.jpg","page_title":"המשחקים האירופיים (2015)","context_page_description":"המשחקים האירופיים הראשונים נערכו בבאקו בירת אזרבייג'ן בין 12 ל-28 ביוני 2015, בהשתתפות כ-6,000 ספורטאים מ-50 מדינות אירופיות, שהתחרו ב-20 ענפים."},{"page_url":"https://pl.wikipedia.org/wiki/Cerkiew_Podwy%C5%BCszenia_Krzy%C5%BCa_%C5%9Awi%C4%99tego_w_Huwnikach","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Huwniki%2C_cerkiew_Podwy%C5%BCszenia_Krzy%C5%BCa_%C5%9Awi%C4%99tego_%28HB1%29.jpg","page_title":"Cerkiew Podwyższenia Krzyża Świętego w Huwnikach","context_page_description":"Cerkiew Podwyższenia Krzyża Świętego w Huwnikach – murowana filialna cerkiew greckokatolicka, znajdująca się w Huwnikach.\\nZbudowana w 1825, w stylu klasycyzującym, jednonawowa. Wybudowana jako rzymskokatolicka kaplica grobowa rodziny Tyszkowskich, których prochy spoczywają w katakumbach świątyni. Wewnątrz zachowana polichromia figuralno-geometryczna z 1913 wykonana przez Andrija Demkowycza.\\nObok cerkwi znajduje się murowana dzwonnica zbudowana w 1825 na planie kwadratu z brogowym dachem krytym gontem.\\nCerkiew należała do greckokatolickiej parafii w Makowej."},{"page_url":"https://sv.wikipedia.org/wiki/Keytesville","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/MOMap-doton-Keytesville.png","page_title":"Keytesville","context_page_description":"Keytesville är administrativ huvudort i Chariton County i Missouri. Orten har fått sitt namn efter grundaren James Keyte. Han hade emigrerat till Missouri från England och var först verksam som metodistpredikant i Saint Louis. Därifrån flyttade han till Chariton som var den första huvudorten i Chariton County. Keyte erbjöd att skaffa mark i syfte att grunda en ny huvudort när Chariton drabbades av en översvämning. Keytesville utsågs till huvudort år 1831."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Jugend-Sommerspiele_2018/Turnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/2018-10-14_Gymnastics_at_2018_Summer_Youth_Olympics_%E2%80%93_Boys%27_Artistic_Gymnastics_%E2%80%93_Apparatus_finals_%E2%80%93_Vault_%E2%80%93_Victory_ceremony_%28Martin_Rulsch%29_42.jpg","page_title":"Olympische Jugend-Sommerspiele 2018/Turnen","context_page_description":"Bei den Olympischen Jugend-Sommerspielen 2018 in Buenos Aires wurden vom 7. bis zum 15. Oktober 12 Wettbewerbe im Gerätturnen ausgetragen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D0%B4%D0%B5%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Fodele.jpg","page_title":"Фоделе","context_page_description":"Фо́деле — деревня в Греции на севере Крита. Расположена в 3 километрах от Паралия-Фоделе и побережья Критского моря, в 18 километрах к северо-западу от Ираклиона, в 87 километрах к юго-востоку от Ханьи. Входит в общину Малевизи в периферийной единице Ираклион в периферии Крит. Население 457 жителей согласно переписи 2011 года.\\nСевернее Фоделе проходит национальная дорога EO90, часть европейского маршрута E75."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%81%D1%81%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/800px-Maison-de-Balzac_hi-res.jpg","page_title":"Пасси","context_page_description":"Пасси́ — район Парижа на правом берегу Сены, прилегающий к Булонскому лесу. Как и многие другие кварталы, Пасси стал частью города 1 января 1860 года и дал название 16-му округу. Сейчас границы квартала выходят далеко за границы прежней деревни и обозначают место проживания самых обеспеченных парижан — здесь проживают политики, аристократы, преуспевшие деловые люди, знаменитости.\\nУже в 1939 году французский поэт и прозаик Леон-Поль Фарг писал о Пасси: «Пасси — это большая провинция, где семьи знакомы друг с другом, наблюдают друг за другом и ненавидят друг друга по той причине, что на чай у одной из семей собралось большее количество поэтов или политиков, чем у других. Ни пролетарии, ни бедняки не имеют доступа к этой вечной садовой вечеринке, которая проходит между площадью Виктора Гюго и Сеной».\\nВ рассказе И. А. Бунина «В Париже» из цикла «Тёмные аллеи» упоминаются переулки в районе улицы Пасси, как местонахождение русской столовой, в которой происходят некоторые события рассказа."},{"page_url":"https://lt.wikipedia.org/wiki/Povilas_Ivanovi%C4%8Dius_Sapiega","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Pava%C5%82_Ivanavi%C4%8D_Sapieha._%D0%9F%D0%B0%D0%B2%D0%B0%D0%BB_%D0%86%D0%B2%D0%B0%D0%BD%D0%B0%D0%B2%D1%96%D1%87_%D0%A1%D0%B0%D0%BF%D0%B5%D0%B3%D0%B0_%281709%29.jpg","page_title":"Povilas Ivanovičius Sapiega","context_page_description":"Povilas Ivanovičius Sapiega – 1555–1558 m. Palenkės vaivada ir 1558–1579 m. Naugarduko vaivada. Dėl ilgaamžiškumo buvo vadinamas Nestoru."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%95%A0%ED%85%A1%EC%BD%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Glifo_Jaltenco.png","page_title":"할텡코","context_page_description":"할텡코는 멕시코 멕시코주에 위치한 도시로 면적은 3.3km², 인구는 26,359명이다."},{"page_url":"https://ms.wikipedia.org/wiki/Todd_McFarlane","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Todd_McFarlane_by_Gage_Skidmore.jpg","page_title":"Todd McFarlane","context_page_description":"Todd McFarlane adalah seorang kartunis negara Kanada, penulis, pereka permainan dan pengusaha, paling dikenali untuk karyanya dalam buku komik, seperti siri fantasi Spawn.\\nPada akhir 1980-an dan awal 1990-an, McFarlane menjadi bintang buku komik kerana karyanya dalam siri Marvel Comics 'Spider-Man. Pada tahun 1992, ia membantu membentuk Image Comics, meletakkan okultisme watak anti-hero Spawn dari portfolio SMA-nya dan meng-perbaharui dirinya untuk tahun 1990-an. Spawn adalah seorang pahlawan yang popular pada 1990-an dan mendorong tren dalam penciptaan watak sendiri dalam buku komik.\\nDalam beberapa tahun terakhir, McFarlane telah jarang melukis buku komik kerana memberi fokus pada usaha keusahawanan, seperti McFarlane Toys dan Todd McFarlane Entertainment, sebuah studio filem dan animasi. Pada bulan September 2006, diumumkan bahawa McFarlane akan menjadi Pengarah Seni 38 Studios, lebih dikenali Green Monster Games, diasaskan oleh kumpulan bola lisut Curt Schilling.McFarlane pernah menjadi co-pemilik National Hockey League Edmonton Oilers tetapi menjual sahamnya kepada Daryl Katz. Dia juga seorang pengumpul sejarah pembuatan bola."},{"page_url":"https://en.wikipedia.org/wiki/Eurovision_Song_Contest","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Eurovision_Song_Contest_1980_-_Johnny_Logan_4.jpg","page_title":"Eurovision Song Contest","context_page_description":"The Eurovision Song Contest is an international song competition, organised annually by the European Broadcasting Union and featuring participants representing primarily European countries. Each participating country submits an original song to be performed on live television and radio, transmitted to national broadcasters via the EBU's Eurovision and Euroradio networks, with competing countries then casting votes for the other countries' songs to determine a winner.\\nBased on the Sanremo Music Festival held in Italy since 1951, Eurovision has been held every year since 1956, with the exception of the cancelled 2020 edition, making it the longest-running annual international televised music competition. Active members of the EBU, as well as invited associate members, are eligible to compete in the contest, and as of 2019, 52 countries have participated at least once. Originally consisting of a single evening event, the contest has expanded greatly as new countries joined, leading to the introduction of relegation procedures in the 1990s and eventually the creation of semi-finals in the 2000s."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AA%E3%83%83%E3%83%97%E3%82%B7%E3%83%A5%E3%82%BF%E3%83%83%E3%83%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/LP_Goldener_Hahn.JPG","page_title":"リップシュタット","context_page_description":"リップシュタット は、ドイツ連邦共和国ノルトライン＝ヴェストファーレン州アルンスベルク行政管区のゾースト郡に属す大規模郡都市である。本市は1975年からこの郡に属している。この街は、1185年に計画都市として建設された、ヴェストファーレンで最も古い意図的に建設された都市である。リップシュタットは、ドルトムントの東約 60 km、ビーレフェルトの南約 40 km、パーダーボルンの西約 30 km に位置する。"},{"page_url":"https://sv.wikipedia.org/wiki/Sn%C3%A4ckan_8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Sn%C3%A4ckan_8%2C_2018i.jpg","page_title":"Snäckan 8","context_page_description":"Snäckan 8 är en kontors- och affärsfastighet i kvarteret Snäckan vid Tegelbacken 4 på Norrmalm i Stockholms innerstad. Byggnaden, även kallad KPMG-huset, uppfördes 1970–1973 efter ritningar av Erik Thelaus arkitektkontor och är grönklassad av Stadsmuseet i Stockholm, vilket innebär att bebyggelsen bedöms ”vara särskilt värdefull från historisk, kulturhistorisk, miljömässig eller konstnärlig synpunkt”. För närvarande planeras rivning och en ny byggnad med kontor och galleria på platsen och med Sveriges Kommuner och Landsting som största hyresgäst."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%90%D7%92%D7%95%D7%91%D7%A8_%D7%94%D7%A9%D7%9C%D7%99%D7%A9%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Portrait_Roi_de_france_Dagobert_II_%28i.e_III%29.jpg","page_title":"דאגובר השלישי","context_page_description":"דאגובר השלישי היה שליט פרנקי מהשושלת המרובינגית."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B1%85%ED%81%AC%EC%8A%A4_(%EA%B0%80%EC%88%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Banks_-_Apollo_Stage_-_Roskilde_Festival_2014.jpg","page_title":"뱅크스 (가수)","context_page_description":"뱅크스는 미국의 싱어송라이터이다."},{"page_url":"https://nn.wikipedia.org/wiki/Iveland_kyrkje","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Iveland_kirke.jpg","page_title":"Iveland kyrkje","context_page_description":"Iveland kyrkje er ei krosskyrkje i Iveland kommune i Aust-Agder fylke. Kyrkja vart vigsla den 27. august 1837, men stod under tak år før, som vi ser av årstalet i vindfløya.\\nKyrkja vart oppført av Anders Thorsen Syrtveit etter ei typeteikning av slottsarkitekt Linstow. Ho vart restaurert til hundreårsjubileet etter planar av Domenico Erdmann."},{"page_url":"https://no.wikipedia.org/wiki/Kaldnes_bru","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/T%C3%B8nsbergKanalbro20080120-1.jpg","page_title":"Kaldnes bru","context_page_description":"Kaldnes bru er ei gangbru i Tønsberg by som krysser Kanalen og forbinder Kaldnes på Nøtterøy-sida med Tønsberg sentrum. Brua ble tatt i bruk i 2005. Den er ei klaffebru med en lengde på 130 meter og en seilingshøyde på 5 meter."},{"page_url":"https://fr.wikipedia.org/wiki/Biblioth%C3%A8que","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Nlc_phaseii_southeast_001b.jpg","page_title":"Bibliothèque","context_page_description":"Une bibliothèque est le lieu où est conservée et lue une collection organisée de livres. Il existe des bibliothèques privées et des bibliothèques publiques. Les bibliothèques proposent souvent d'autres documents ainsi que des accès à internet et sont parfois appelées médiathèques ou informathèques.\\nLa majorité des bibliothèques autorisent le prêt de leurs documents gratuitement. D'autres, comme la Bibliothèque publique d'information notamment, permettent la consultation sur place seulement. Elles peuvent alors être divisées en salles de lectures, ouvertes au public, et en magasins bibliothécaires, fermés, pour le stockage de livres moins consultés. D'autres espaces, ouverts ou non au public, peuvent s'ajouter.\\nEn 2010, avec plus de 144,5 millions de documents, dont 21,8 millions de livres, la plus grande bibliothèque du monde est la bibliothèque du Congrès à Washington D.C.. Néanmoins, la collection cumulée de livres des deux bibliothèques nationales russes atteint 32,5 millions de volumes et la collection de la British Library 150 millions d'articles."},{"page_url":"https://de.wikipedia.org/wiki/Memminger_Stra%C3%9Fe_(Kempten)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Altes_Krankenhaus_KE_%281%29.JPG","page_title":"Memminger Straße (Kempten)","context_page_description":"Die Memminger Straße ist eine aus der Kemptener Innenstadt führende Straße. Sie basiert auf einer alten Landstraße nach Memmingen. Mit über drei Kilometern ist sie zusammen mit der Lindauer Straße und der Kaufbeurer Straße eine der langen Innerortsstraßen."},{"page_url":"https://sq.wikipedia.org/wiki/Amerika_(kontinent)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/LocationAmericas.png","page_title":"Amerika (kontinent)","context_page_description":"Amerika - paraqet një tërësi teritoriale e cila përfshin në vete dy kontinente të cilët janë te njohur si Amerika Veriore dhe Amerika Jugore.\\nEdhe pse nuk është term për emertim të Shtetet e Bashkuara të Amerikës shpesh herë këto shtete që gjenden në Amerikën e Veriut në gjuhën jo zyrtare të përditshme emërtohen-njihen si Amerikë.\\nEmri Amerikë vie nga zbuluesi i sajë Ameriko Vespuçi.\\nKontinenti i Amerikës shtrihet në Hemisferen Perendimore dhe ka shtrirje meridionale. Shtrihet në të dy gjersitë gjeografike. Shtrihet mes gjersisë veriore gjeografike 83º dhe 56º të gjersisë gjeografike jugore. Kontinenti i Amerikës është i vendosur mes Oqeanit Atlantik në lindje dhe Oqeanit Paqësor në perëndim. Sot këto oqeane shërbejnë “urë” lidhëse natyrore mes Amerikës, Evropës, Afrikëa, Azisë dhe Australisë. Kontinenti i Amerikës me sipërfaqe prej 42 milion km2 është kontinenti i dytë në botë pas Azisë. Ajo perbëhet prej dy pjesëve të mëdha tokësore në atë Veriore dhe Jugore. Shtrirja e Amerikës mes Oqeanit Atlantik, Oqeanit Paqesor, oqeanit të Ngrirë të Veriut ka bërë që viset bregdetare të jenë të pasura me ishuj, dete, gjire, dhe ngushtica të shumta."},{"page_url":"https://en.wikipedia.org/wiki/Subaru_Impreza","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Subaru_IMPREZA_G4_1.6i-L_EyeSight_%28DBA-GK3%29_interior.jpg","page_title":"Subaru Impreza","context_page_description":"The Subaru Impreza is a compact car that has been manufactured by Subaru since 1992. It was introduced as a replacement for the Leone, with the predecessor's EA series engines replaced by the new EJ series. It is now in its fifth generation.\\nSubaru has offered 4-door sedan and 5-door body variants since 1992. The firm also offered a coupe from 1995 until 2001, and a 5-door wagon from the Impreza's introduction in the form of a hatchback. Mainstream versions have received \\"boxer\\" flat-four engines ranging from 1.5- to 2.5-liters, with the performance-oriented Impreza WRX and WRX STI models uprated with the addition of turbochargers. Since the third generation series, some markets have adopted the abbreviated Subaru WRX name for these high-performance variants. The first three generations of Impreza were also available with an off-road appearance package called the Outback Sport, exclusive to the North American market. For the fourth generation, this appearance package was renamed the XV, and is sold internationally. Colloquially, the car is sometimes referred to as Scooby.\\nThe Impreza was a major rival to the Mitsubishi Lancer."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD-%D0%A1%D0%B5%D0%B7%D0%B5%D1%80_(%D0%9F%D1%80%D0%B8%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%A8%D0%B0%D1%80%D0%B0%D0%BD%D1%82%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/STC4.jpg","page_title":"Сен-Сезер (Приморская Шаранта)","context_page_description":"Сен-Сезе́р — коммуна во Франции, находится в регионе Пуату — Шаранта. Департамент коммуны — Шаранта Приморская. Входит в состав кантона Бюри. Округ коммуны — Сент.\\nКод INSEE коммуны — 17314."},{"page_url":"https://ca.wikipedia.org/wiki/James_Prescott_Joule","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Joule%27s_Apparatus_%28Harper%27s_Scan%29.png","page_title":"James Prescott Joule","context_page_description":"James Prescott Joule FRS fou un físic i cerveser anglès. Estudià la naturalesa de la calor i en descobrí la relació amb el treball mecànic. Això dugué a la teoria de la conservació de l'energia, que dugué al seu torn al desenvolupament de la primera llei de la termodinàmica; arribà a formular, amb independència del seu contemporani Mayer, el principi de conservació de l'energia. La unitat d'energia del SI, el joule, li deu el seu nom. Treballà amb Lord Kelvin per desenvolupar l'escala absoluta de temperatura –analitzà les variacions de temperatura d'un gas no perfecte en expandir-se–, féu observacions sobre la magnetostricció, i descobrí la relació entre el flux d'un corrent per una resistència i la calor dissipada, i arribà a formular la llei que duu el seu nom, l'anomenada llei de Joule, sobre la calor originada pel pas d'un corrent elèctric. Després de nombrosos experiments, obtingué el valor numèric de l'equivalent mecànic de la calor. Contribuí a explicar la teoria cinètica dels gasos. Fou «possiblement l'últim autodidacta que féu una contribució significativa al progrés de la ciència»."},{"page_url":"https://eu.wikipedia.org/wiki/Bodilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Bretagne_Finistere_Bodilis1_tango7174.jpg","page_title":"Bodilis","context_page_description":"Bodilis Bretainiako eta Finistère departamenduko udalerria da."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%B8%E0%B7%92%E0%B6%B1%E0%B7%92%E0%B7%83%E0%B7%8A_%E0%B6%AF%E0%B6%AD%E0%B7%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Gray997.png","page_title":"මිනිස් දත්","context_page_description":"මිනිස් දත් යනු මිනිස් මුඛය තුළ පිහිටි කුඩා, චුර්ණිකෘත, දැඩි, සුදට හුරු ව්‍යුහයන්ය. ඒවායේ යාන්ත්‍රික ක්‍රියාව ආහාර ද්‍රව්‍ය කැපීම සහ ඇඹරීම මගින් ආහාර ගිලීමට හා ජිරණයට සුදානම් කරයි. දත් වල මුල් උඩු හනුව සහ යටිහනුව තුළ ගිලී විදුරුමස මගින් ආවරණය වී පවතී. දත් නිර්මාණය වී ඇත්තේ විචල්‍ය ඝනත්වයක් හා දෘඩතාවක් ඇති පටක වලිනි.\\nදත් ක්‍ෂීරපායින්ට ඉතාම ලාක්‍ෂනික ලක්‍ෂණයකි. අනෙකුත් ක්‍ෂිරපායීන් මෙන්ම මිනිසාටද ද්විවාර දන්තිනයකි, එනම් ජිවිත කාලය තුළ කට්ටල දෙකක් ලෙස ඇතිවන දත් පවතී. සාමාන්‍යයෙන් පළමු දත් කට්ටලය ඇතිවීම මාස 6 දී පමණ ඇරඹෙන නමුත් ඇතැම් ළදරුවන් ඉපදෙන විටම ඇසට පෙනෙන දතක් හෝ කිහිපයක් සහිතව උපදී. එවැනි දත් නවජ දත් ලෙස හඳුන්වයි. මාස හයේදී පමණ සිදුවන සාමාන්‍ය දත්න විදාරණය ඇතැම් විට වේදනාකාරී විය හැකිය.\\nදන්ත ක්‍ෂතිය යනු මුහුණෙහි, මුඛයෙහි සහ විශේෂයෙන් දත්වල, තොල් වල, හා පටක ආශ්‍රිතව සිදුවන ඉරීම් වේ."},{"page_url":"https://id.wikipedia.org/wiki/Pauline_Frederick","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/The_Woman_on_the_Index_2.jpg","page_title":"Pauline Frederick","context_page_description":"Pauline Frederick adalah aktris panggung berkebangsaan Amerika Serikat."},{"page_url":"https://en.wikipedia.org/wiki/Budapest%27s_Palace_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Pollack_Mihaly_ter_5.jpg","page_title":"Budapest's Palace District","context_page_description":"Budapest's Palotanegyed forms an inner part of Pest, the eastern half of Budapest. Known until the communist period as the ‘Magnates’ Quarter’, it consists of the western part of the city's Eighth District, or Józsefváros, which was named on 7 November 1777 after Joseph II, Holy Roman Emperor and Archduke of Austria, who reigned 1765-1790. Józsefváros developed immediately east of the medieval walls of Pest and was originally called Lerchenfeld or the Alsó-Külváros. The Palotanegyed's borders are the Múzeum körút to the west, Rákóczi út to the north, the József körút to the east and Üllői út to the south."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D1%8D%D0%BD%D0%BA%D0%B0%D0%BC%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Escudo_Cuencam%C3%A9.JPG","page_title":"Куэнкаме","context_page_description":"Куэнкаме — населённый пункт и муниципалитет в Мексике, входит в штат Дуранго. Население 9 человек."},{"page_url":"https://fr.wikipedia.org/wiki/Timbre_de_France_d%27usage_courant","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Mouchon_type2.jpg","page_title":"Timbre de France d'usage courant","context_page_description":"Les timbres de France d'usage courant ont une durée d'émission généralement assez longue, contrairement aux séries spéciales, qui ont une durée de disponibilité dans les bureaux de poste beaucoup plus brève.\\nCet article présente les timbres de France d'usage courant de 1849 à 1940."},{"page_url":"https://it.wikipedia.org/wiki/Corrado_II_di_Lussemburgo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Conrad_II%2C_Count_of_Luxembourg.png","page_title":"Corrado II di Lussemburgo","context_page_description":"Corrado II di Lussemburgo fu conte di Lussemburgo dal 1131, alla sua morte."},{"page_url":"https://cs.wikipedia.org/wiki/Sv%C3%ADdovec","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/PP_Sv%C3%ADdovec_7.jpg","page_title":"Svídovec","context_page_description":"Svídovec je přírodní památka ev. č. 1879 jihozápadně od obce Rohozec v okrese Brno-venkov. Oblast spravuje AOPK KS Brno. Geomorfologicky náleží do Žernovické hrásti v Hornosvratecké vrchovině.\\nDůvodem ochrany je významná lokalita kalcifilních druhů, lada navazující na rozsáhlé hlavně bukové porosty."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%9Awi%C4%85tynia_Dhake%C5%9Bwari_w_Dhace","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Dhakeshwari_temple_statue_by_Ragib_Hasan.jpg","page_title":"Świątynia Dhakeśwari w Dhace","context_page_description":"Świątynia Dhakeśwari w Dhace – świątynia hinduistyczna w Dhace.\\nCentralnie położony kompleks świątynny pochodzi prawdopodobnie z XI wieku n.e. Ta najstarsza świątynia\\npoświęcona jest dziesięcioramiennej bogini Dhakeśwari i prawdopodobnie od niej miasto Dhaka wzięło swoją nazwę. W 1996 świątynia otrzymała miano Dhakeshwari Jatiya Mandir w nawiązaniu do jej pozycji w hinduistycznym środowisku Bangladeszu. Kompleks świątynny leży przy Dhakeshwari Road i znajduje się ok. 500 m od Salimullah Hall, Uniwersytetu w Dhace. Charakterystyczna monumentalna brama wejściowa, nazywana bramą Nahabatkhana."},{"page_url":"https://eo.wikipedia.org/wiki/Kilo_(%C5%9Dipo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Nachbau_Wikingerschiff_Roskilde.jpg","page_title":"Kilo (ŝipo)","context_page_description":"La kilo estas la plej grava, mezŝipe instalita, malsupra trabego de ŝipo aŭ boato. Ĝi iras de la antaŭa ĝis la posta parto de ŝipo kaj sur kiu sin apogas la tuta ĉarpentaĵo. La kilo estas kvazaŭe la spino de la ŝipo. Krom apogigi la ŝipotrunkan ĉarpentaĵon, ĝi havas la funkcion malplialtigi la gravitocentron de la ŝipo, por ke ĝi estu pli stabila en la akvo - kilo do malpliigas la ŝanceliĝon de la ŝipo kaj rezulte malhelpas sinkadon, sed ĝi aliflanke igas la ŝipon pli peza kaj malpli rapida. Ĉe modernaj velboatoj, kiuj principe estas laŭeble malpezaj por esti rapidaj, sed rezulte ankaŭ tre ŝanceliĝemas, oni aldonas plian pezon meze sub la ŝipotrunko, kiu tiam konsideriĝas parto de la kilo.\\nKontraste al tio, stabiligilo de velboato estas malpeza kaj ofte movebla breto el ŝtalo, ligno aŭ vitrofibro-fortigita plasto sub la ŝipa trunko, instalita paralele al la veturdirekto, kiu malhelpas flankenpuŝiĝon per la vento, kaj do stabiligas la ŝipan direkton. Ekzistas kombinoj el la du funkcioj, nomeblaj \\"moveblaj kiloj\\" aŭ \\"stabiligilo-kiloj\\", kiuj kaj atentas pri aparta pezo kaj pri stabiligo de la vojdirekto, kaj estas moveblaj."},{"page_url":"https://fr.wikipedia.org/wiki/Luiz_Henrique_Mandetta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Luiz_Henrique_Mandetta_em_29_de_maio_de_2019_%28recorte%29.jpg","page_title":"Luiz Henrique Mandetta","context_page_description":"Luiz Henrique Mandetta, né le 30 novembre 1964 à Campo Grande, est un médecin orthopédiste et un homme politique brésilien. Il est ministre de la Santé dans le gouvernement de Jair Bolsonaro du 1ᵉʳ janvier 2019 au 16 avril 2020."},{"page_url":"https://vec.wikipedia.org/wiki/Monthey","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Monthey_VS.png","page_title":"Monthey","context_page_description":"Monthey ła xe 'na sità del Canton Vałexe de 15.299 abitanti. Xe kive famoxe łe sosietà de projetasion de montagne ruse."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%BE%D1%83%D1%8D%D0%BB%D0%BB,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81_%D0%A0%D0%B0%D1%81%D1%81%D0%B5%D0%BB%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Lowell_in_his_study_at_elmwood.jpg","page_title":"Лоуэлл, Джеймс Расселл","context_page_description":"Джеймс Расселл Лоуэлл — американский поэт, педагог, эссеист и дипломат."},{"page_url":"https://fr.wikipedia.org/wiki/London_Overground","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/508301_at_Euston.jpg","page_title":"London Overground","context_page_description":"London Overground est un réseau de transport ferroviaire, principalement en surface, qui dessert l'agglomération de Londres. London Overground couvre le Grand Londres et le comté d'Hertfordshire, il s'agit d'un réseau ferroviaire de banlieue, bien que les fréquences de passage tendent à se rapprocher de celles des fréquences du Tube."},{"page_url":"https://id.wikipedia.org/wiki/Poso_Kota,_Poso","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Kecamatan_Poso_Kota.png","page_title":"Poso Kota, Poso","context_page_description":"Poso Kota, adalah sebuah kecamatan yang merupakan salah satu bagian dari Kota Poso, yang merupakan ibu kota Kabupaten Poso, Sulawesi Tengah, Indonesia."},{"page_url":"https://ca.wikipedia.org/wiki/Gungwiller","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Map_commune_FR_insee_code_67178.png","page_title":"Gungwiller","context_page_description":"Gungwiller és un municipi francès, situat a la regió del Gran Est, al departament del Baix Rin. L'any 2006 tenia 297 habitants.\\nForma part del cantó d'Ingwiller, del districte de Saverne i de la Comunitat de comunes de l'Alsace Bossue."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Valkenburg_(Limburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Valkenburg-Plateau_Heyerveldweg.JPG","page_title":"Lijst van rijksmonumenten in Valkenburg (Limburg)","context_page_description":"De plaats Valkenburg telt 63 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://de.wikipedia.org/wiki/Punktierter_Gilbweiderich","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/2018-06-01_%28106%29_Lysimachia_punctata_%28dotted_loosestrife%29_at_Bichlh%C3%A4usl_in_Frankenfels%2C_Austria.jpg","page_title":"Punktierter Gilbweiderich","context_page_description":"Der Punktierte Gilbweiderich, auch Punkte-Gilbweiderich, Goldfelberich oder Drüsiger Gilbweiderich genannt, ist eine Pflanzenart in der Unterfamilie der Myrsinengewächse innerhalb der Familie der Primelgewächse. Er wird gelegentlich als Zierpflanze in Gärten kultiviert.\\nDer Punktierte Gilbweiderich unterscheidet sich vom ähnlichen Gewöhnlichen Gilbweiderich durch seine Behaarung und die andere Form des Blütenstandes."},{"page_url":"https://de.wikipedia.org/wiki/Vignogn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Blick_vom_Hitzeggerkopf_Degen_Surcasti.jpg","page_title":"Vignogn","context_page_description":"Vignogn war bis am 31. Dezember 2012 eine politische Gemeinde in der Talschaft Val Lumnezia im Bezirk Surselva des Kantons Graubünden in der Schweiz.\\nAm 1. Januar 2013 fusionierte sie mit den Gemeinden Cumbel, Degen, Lumbrein, Morissen, Suraua, Vella und Vrin zur neuen Gemeinde Lumnezia."},{"page_url":"https://tr.wikipedia.org/wiki/Beyonc%C3%A9_%C5%9Fark%C4%B1lar%C4%B1_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Billy_Joel_-_Perth_7_November_2006.jpg","page_title":"Beyoncé şarkıları listesi","context_page_description":"Amerikalı şarkıcı Beyoncé'nin şarkıları listesi."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%84%A1%E5%8B%95%E5%AF%BA_(%E8%B1%8A%E5%BE%8C%E9%AB%98%E7%94%B0%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/%E7%84%A1%E5%8B%95%E5%AF%BA.jpg","page_title":"無動寺 (豊後高田市)","context_page_description":"無動寺は、大分県豊後高田市黒土にある天台宗の寺院。山号は威王山。"},{"page_url":"https://en.wikipedia.org/wiki/Endorsements_in_the_2016_Italian_constitutional_referendum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Fiat_Sergio_Marchionne.jpg","page_title":"Endorsements in the 2016 Italian constitutional referendum","context_page_description":"This page lists individuals and organisations who publicly expressed an opinion regarding the 2016 Italian constitutional referendum."},{"page_url":"https://fr.wikipedia.org/wiki/District_de_Homs","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Homs_District.png","page_title":"District de Homs","context_page_description":"Le district de Homs est un district du gouvernorat de Homs, en Syrie. Il a pour capitale Homs."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A7%D0%B0%D0%BF%D1%98%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Botaurus_stellaris_%28Marek_Szczepanek%29.jpg","page_title":"Чапји","context_page_description":"Чапји — семејство долгоноги птици од редот на пеликановидните кои живеат крај вода, и има околу 64 вида. Класификацијата на поодделни видови задава тешкотии, па понекогаш може да се сместат во нови редови и семејства. Тие се слични со штрковите, ибисите и лажичарките, а се разликуваат од нив по начинот на летање, бидејќи летаат со згрчен врат."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D8%B1%D9%8A%D9%86%D9%8A_(%D9%86%D9%8A%D9%88%D9%8A%D9%88%D8%B1%D9%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Aerial_-_Greene%2C_NY_from_SW_01_-_white_balanced_%289641627522%29.jpg","page_title":"غريني (نيويورك)","context_page_description":"غريني ‏ هي بلدة أمريكية تقع في الولايات المتحدة في مقاطعة تشينانغو، نيويورك. يقدر عدد سكانها بـ 5,604 نسمة."},{"page_url":"https://vi.wikipedia.org/wiki/Gi%E1%BB%91ng_ch%C3%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Bella_z_Milhostovskych_poli_2.jpg","page_title":"Giống chó","context_page_description":"Giống chó là nhóm các con chó nhà có liên quan chặt chẽ và tương tự nhau, đó là tất cả các loài có những đặc điểm đặc trưng được lựa chọn và duy trì bởi con người. Các giống chó cũng là dùng để chỉ giống tự nhiên hoặc các giống mà phát sinh thông qua thời gian để đáp ứng với một môi trường cụ thể trong đó có con người, với ít hoặc không có giống chọn lọc của con người.\\nGiống chó không được khoa học xác định phân loại sinh học, mà là các nhóm xác định bởi các câu lạc bộ của người có sở thích chơi chó được gọi là câu lạc bộ giống. Một giống chó được đại diện bởi một số lượng đủ của các cá nhân để ổn định chuyển đặc điểm cụ thể của nó qua nhiều thế hệ. Một con chó được cho là thuần chủng nếu cha mẹ của họ đã được thuần chủng và nếu con chó đáp ứng các tiêu chuẩn của giống chó này. Sự khác biệt di truyền rõ ràng giữa các giống chó đã làm chó giống cụ thể đối tượng tốt cho nghiên cứu y học và di truyền của con người."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%A8%D7%9C%D7%95%D7%98%D7%94_%D7%92%D7%A8%D7%99%D7%96%D7%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Giselle_-Carlotta_Grisi_-1841_-2.jpg","page_title":"קרלוטה גריזי","context_page_description":"קרלוטה גריזי הייתה רקדנית בלט איטלקיה. גריזי נולדה בויזינאדה, איסטריה. היא למדה בבית הספר לבלט של תיאטרון לה סקאלה במילאנו, ואחר כך השתלמה אצל מנהל הבלט ז'יל פרו. היא נודעה בייחוד בהופעתה בבלט הקלאסי ז'יזל, שנוצר למענה."},{"page_url":"https://en.wikipedia.org/wiki/Madonna_of_the_Dry_Tree","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Madonna_of_the_Dry_Tree_detail.jpg","page_title":"Madonna of the Dry Tree","context_page_description":"Madonna of the Dry Tree is a small oil-on-oak panel painting dated c. 1462–1465 by the Early Netherlandish painter Petrus Christus. Unusually innovative and dramatic, it presents the Virgin Mary holding the Christ Child while standing on a disembodied dead tree trunk and surrounded by a crown of thorns.\\nThe painting's imagery is thought to be derive from the Book of Ezekiel, with the dry tree a symbol of the withered Tree of Knowledge in the Garden of Eden, brought to life by the Virgin and the birth of Christ. The 15 golden \\"A\\"s hanging from the branches of the tree represent the first letter of the Angelic Salutation, the Ave Maria. The Christ Child holds an orb crowned with a cross. The iconography may draw from the Confraternity of Our Lady of the Dry Tree in Bruges, to which both Christus and his wife Gaudicine belonged."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B0%B7%E3%81%A8%E7%82%8E%E3%81%AE%E6%AD%8C%E3%81%AE%E4%B8%96%E7%95%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Dubrovnik_from_walls.JPG","page_title":"氷と炎の歌の世界","context_page_description":"氷と炎の歌の世界では、ジョージ・R・R・マーティン著のファンタジー小説シリーズである『氷と炎の歌』の中に現れる、架空の世界について述べる。小説に基づき、HBOドラマシリーズ『ゲーム・オブ・スローンズ』が放映されている。\\n『氷と炎の歌』の物語は、ウェスタロスと呼ばれる大陸と、エッソスと呼ばれる大陸を主とした架空世界を舞台としている。物語には3つの主要な筋があり、次第に絡み合うようになる。第一は諸名家によるウェスタロスの王座を巡る争い、第二はウェスタロスの国境となる巨大な氷の〈壁〉の北での〈異形〉と呼ばれる脅威の増大、第三は13年前の内戦で殺された王の娘であるデナーリス・ターガリエンのウェスタロスへの帰還と玉座を求める野望である。なお、ドラマシリーズでは、内戦は17年前に起きたことになっている。\\nウェスタロス以外にも二つの大陸がある。巨大なエッソス大陸は、ウェスタロスから〈狭い海〉を隔てた東側に位置する。エッソスの、ウェスタロスに最も近い西部には独立した都市国家群である自由都市群がある。エッソスの南岸沿いはまとめて夏の海の土地と呼ばれており、奴隷商人湾や、ウェスタロスの旧王家であるターガリエン家の古の故郷である、ヴァリリアの廃墟がある。\\nエッソスの南には、ソゾリオス大陸がある。黒い肌の人間が住み、ジャングルが多く、疫病がはびこり、ほとんど探検もされていない、ということ以外はこの大陸について知られていない。\\n本シリーズの第1部から第3部には岡部宏之による旧版と、酒井昭伸による新訳語を用いた改訂新版が存在し、両版の間では多くの名称の日本語訳が変更されているため、以下においては新訳語を用い、最初に使用された箇所では括弧内に旧訳語を示す。'\\n以下の内容は、第5部終了時点でのものである。"},{"page_url":"https://ru.wikipedia.org/wiki/Filmfare_Award_%D0%B7%D0%B0_%D0%BB%D1%83%D1%87%D1%88%D1%83%D1%8E_%D0%B4%D0%B5%D0%B1%D1%8E%D1%82%D0%BD%D1%83%D1%8E_%D0%BC%D1%83%D0%B6%D1%81%D0%BA%D1%83%D1%8E_%D1%80%D0%BE%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/AamirKhan01.jpg","page_title":"Filmfare Award за лучшую дебютную мужскую роль","context_page_description":"Filmfare Award за лучшую дебютную мужскую роль или для лучший мужской дебют — номинация старейшей и наиболее престижной кинопремии Болливуда Filmfare Awards, сравниваемой по значимости с «Оскаром», предназначенная для награждения актёров за наилучшее исполнение дебютной мужской роли в кинофильме на хинди или хиндустани за предыдущий год. Премией могут быть награждены актёры, уже сыгравшие несколько ролей в фильмах на других языках Индии.\\nНоминация была организована в 1989 году под названием Filmfare Award за лучший дебют без разделения по профессиям и половому признаку, параллельно с номинацией Filmfare Award for Lux New Face of the Year предназначенной для начинающих актрис. После того как в 1995 году премию за лучший дебют получила актриса Табу, номинации были переименованы в Filmfare Award за лучшую дебютную мужскую роль и лучшую дебютную женскую роль соответственно. А в 2010 году была учреждена премия за лучший режиссёрский дебют. С момента основания лауреаты премии награждались в безальтернативном порядке. Исключением являются 2006—2012 и 2020 годы, когда на премию были выдвинуты сразу несколько номинантов."},{"page_url":"https://hr.wikipedia.org/wiki/Turneja_%C4%8Detiriju_skakaonica","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Schattenberg20061230.jpg","page_title":"Turneja četiriju skakaonica","context_page_description":"Turneja četiriju skakaonica jedno je od najpoznatijih natjecanja u skijaškim skokovima. Održava se redovito od 1952.g. u Njemačkoj i Austriji.\\nNatjecanje se sastoji od četiri pojedinačna natjecanja koja se boduju i za Svjetski kup."},{"page_url":"https://en.wikipedia.org/wiki/Mahlon_Hamilton","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Mahlon_Hamilton_1.jpg","page_title":"Mahlon Hamilton","context_page_description":"Mahlon Preston Hamilton, Jr., was an American stage and screen actor. He was the son of a bartender born in Baltimore, Maryland, the eldest of four children, with the rest of the siblings being girls. Census records indicate his mother died sometime around 1899.\\nHamilton served with the Maryland National Guard and attended the Maryland Agricultural College before turning to acting.\\nFrom 1908 through 1914, Hamilton appeared in such plays as The Great Question, Israel, When Claudia Smiles, The Chaperon, and Overnight. He began his film career during the silent era, appearing in at least 92 films between 1914 and 1950."},{"page_url":"https://en.wikipedia.org/wiki/List_of_patriarchs_of_the_Bulgarian_Orthodox_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/%D0%A1%D1%82%D0%B5%D1%84%D0%B0%D0%BD_%28%D0%A8%D0%BE%D0%BA%D0%BE%D0%B2%29.jpg","page_title":"List of patriarchs of the Bulgarian Orthodox Church","context_page_description":"The following is a list of patriarchs of All Bulgaria, heads of the Bulgarian Orthodox Church. The Bulgarian Orthodox Church was recognized as an autocephalous archbishopric in 870. In 918 or 919 the Bulgarian monarch Simeon I summoned a church council to raise the Bulgarian Archbishopric to a completely independent patriarchate. With the Byzantine–Bulgarian Treaty of 927, which affirmed the Bulgarian victory over the Byzantine Empire in the War of 913–927, the ecumenical patriarch of Constantinople recognized the Bulgarian Patriarchate."},{"page_url":"https://fr.wikipedia.org/wiki/Calixar%C3%A8ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Calixarene.png","page_title":"Calixarène","context_page_description":"Un calixarène est un macrocycle issu de la réaction d'un phénol et d'un aldéhyde. Les calixarènes ont des cavités hydrophobiques qui peuvent inclure des petites molécules ou des ions. Les plus couramment rencontrés sont les calixarènes à 4, 5, 6 et 8 unités phénols. La cavité ainsi formée permet de complexer des ions ou des petites molécules. On peut accéder à des calixarènes hydrosolubles en ajoutant des motifs ioniques par exemple.\\nLe terme calixarène est l'assemblage des mots calice et d'hydrocarbure aromatique arène. Il a été inventé en 1975 par David Gutsche¹."},{"page_url":"https://it.wikipedia.org/wiki/Storia_di_Cassino","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Gabriel_Bucelin_Montecassino_aus_der_Vogelschau.jpg","page_title":"Storia di Cassino","context_page_description":"La Storia di Cassino è lunga millenni: reperti testimoniano la presenza dell'uomo già 80.000 anni fa.\\nDalla preistoria ad oggi la storia della è un susseguirsi di splendore, devastazione e rinascita: dal fiorente periodo romano, alle devastazioni longobarde, dall'Abbazia di Montecassino, faro di cultura nel Medio Evo, alla distruzione nella Seconda Guerra Mondiale, fino a giungere ai giorni nostri, passando per una lunga e faticosa ricostruzione."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Kladow","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Drosselstra%C3%9Fe_%28Berlin-Kladow%29.JPG","page_title":"Liste der Straßen und Plätze in Berlin-Kladow","context_page_description":"Die Liste der Straßen und Plätze in Berlin-Kladow beschreibt das Straßensystem im Berliner Ortsteil Kladow mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://sv.wikipedia.org/wiki/Siphona","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Siphona.pauciseta9.-.lindsey.jpg","page_title":"Siphona","context_page_description":"Siphona är ett släkte av tvåvingar. Siphona ingår i familjen parasitflugor."},{"page_url":"https://en.wikipedia.org/wiki/Edmonson_sisters","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/WeldPhoto.jpg","page_title":"Edmonson sisters","context_page_description":"Mary Edmonson and Emily Edmonson, \\"two respectable young women of light complexion\\", were African Americans who became celebrities in the United States abolitionist movement after gaining their freedom from slavery. On April 15, 1848, they were among the 77 slaves who tried to escape from Washington, DC on the schooner The Pearl to sail up the Chesapeake Bay to freedom in New Jersey.\\nAlthough that effort failed, they were freed from slavery by funds raised by the Congregational Church in Brooklyn, New York, whose pastor was Henry Ward Beecher, an abolitionist. After gaining freedom, the Edmonsons were supported to go to school; they also worked. They campaigned with Beecher throughout the North for the end of slavery in the United States."},{"page_url":"https://en.wikipedia.org/wiki/Elisabeth_of_Wied","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Queen_Elizabeth_of_Romania.jpg","page_title":"Elisabeth of Wied","context_page_description":"Pauline Elisabeth Ottilie Luise of Wied was the Queen of Romania as the wife of King Carol I, widely known by her literary name of Carmen Sylva."},{"page_url":"https://es.wikipedia.org/wiki/Costa_Rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/RealM-Shahter15_%289%29.jpg","page_title":"Costa Rica","context_page_description":"Costa Rica, oficialmente República de Costa Rica, es una nación soberana, organizada como una república presidencialista unitaria compuesta por 7 provincias. Ubicada en América Central, posee un territorio con un área total de 51 100 km². Limita con Nicaragua al norte, el mar Caribe al este, Panamá al sureste y el océano Pacífico al oeste. En cuanto a los bordes marítimos, colinda con Panamá, Nicaragua, Colombia y Ecuador.​​ Cuenta con 5 137 000 habitantes según su última proyección demográfica.​ Su capital, centro político y económico es San José, y su idioma oficial es el español.​\\nCon una sólida y longeva democracia, de entre las más funcionales del mundo, ​​​ y una eficaz capacidad de movilidad social que le permite alcanzar un elevado progreso general en relación a la distribución y tamaño de su economía, ​ Costa Rica es el quincuagésimo país más rico del mundo según datos del Fondo Monetario Internacional​ y uno de los más estables de América, obteniendo resultados generalmente favorables en todos los índices de desarrollo y competitividad.​​​​​​​"},{"page_url":"https://sv.wikipedia.org/wiki/Brassia_caudata","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Brassia_caudata.jpg","page_title":"Brassia caudata","context_page_description":"Brassia caudata är en orkidéart som först beskrevs av Carl von Linné, och fick sitt nu gällande namn av John Lindley. Brassia caudata ingår i släktet Brassia och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ro.wikipedia.org/wiki/Gara_Com%C4%83ne%C8%99ti","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Gara_Comanesti3.jpg","page_title":"Gara Comănești","context_page_description":"Gara din Comănești este un monument istoric aflat pe teritoriul orașului Comănești.\\nArhitectul italian Giulio Magni a primit, în același an 1898, o comandă pentru realizarea a două gări și a unei halte pe liniile Pitești–Curtea de Argeș și Adjud–Comănești–Ghimeș, ambele linii executate sub coordonarea inginerului român Elie Radu. Gările gemene din Curtea de Argeș și Comănești reprezintă o ilustrare a viziunii lui Magni asupra stilului național, el combinând elemente cu certe filiații în arhitectura romanică cu motive și materiale de tip oriental, asimilate pe filieră bizantină.\\nClădirea de călători a fost construită din cărămidă și piatră și a fost acoperită cu tablă în 1899. Aceasta avea subsol, parter și o locuință de serviciu la etaj. În interior era tencuit și văruit; dușumele erau din scândură, iar încălzirea era asigurată cu sobe din teracotă. Gara avea o singură casă de bilete și un automat cu bomboane. Peronul era acoperit cu pietriș și patrulau jandarmi însărcinați cu păzirea clădirii gării, oameni numiți de prințesa Ioana Ghika. În anul 1920 s-a construit un bufet din lemn și piatră, acoperit cu tablă."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%83%D1%81%D0%BB%D0%B0%D0%BD_%D0%B8_%D0%9B%D1%8E%D0%B4%D0%BC%D0%B8%D0%BB%D0%B0_(%D0%BE%D0%BF%D0%B5%D1%80%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Chaliapin_F._%28%D0%A8%D0%B0%D0%BB%D1%8F%D0%BF%D0%B8%D0%BD_%D0%A4._%D0%98.%29_1901_as_Farlaf_in_Ruslan_and_Lyudmila.jpg","page_title":"Руслан и Людмила (опера)","context_page_description":"«Руслан и Людмила» — опера Михаила Ивановича Глинки в 5 действиях. Либретто Валериана Ширкова, Константина Бахтурина и Михаила Глинки при участии Н. А. Маркевича, Н. В. Кукольника и М. А. Гедеонова по одноимённой поэме Александра Пушкина с сохранением стихов подлинника."},{"page_url":"https://no.wikipedia.org/wiki/Slaget_ved_Gettysburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/Gettysburg_Day2_Plan.png","page_title":"Slaget ved Gettysburg","context_page_description":"Slaget ved Gettysburg var et av de blodigste slagene i den amerikanske borgerkrigen og har blitt ansett som vendepunktet i krigen ved at sørstatene ble slått tilbake. Det stod ved byen Gettysburg, Pennsylvania mellom den 1. juli og 3. juli 1863. Nordstatene vant slaget. Abraham Lincoln holdt sin mest kjente tale her, rett etter slaget. Han skrev den kvelden før, mens hans sønn var dødssyk, den varte i kun to minutter og inneholdt kun 270 ord.\\nDe to hærene støtte første gang sammen 1. juli. Kampene ble da utkjempet like nord for byen, hvor kavaleri fra nordstatene forsøkte å forsvare noen høydedrag. Kavaleriet fikk etterhvert støtte fra to korps, men to store korps fra sørstatene angrep nordstatenes linjer fra nord og nordøst. Nordstatenes forsvarslinjer stod ikke imot dette angrepet og troppene måtte flykte gjennom byen og opp på noen åser like sør for byen.\\nNeste morgen hadde store deler av begge hærene blitt samlet i og rundt Gettysburg. Nordstatene hadde plassert styrkene langs høydedragene sør for byen, slik at frontlinjene fikk form av en fiskekrok. Gjennom hele dagen ble nordstatenes stillinger angrepet, men til tross for store tap holdt linjene stand."},{"page_url":"https://sv.wikipedia.org/wiki/Fr%C3%B6tuna_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Fr%C3%B6tuna_kyrka%2C_predikstolen%2C_2018b.jpg","page_title":"Frötuna kyrka","context_page_description":"Frötuna kyrka är en kyrkobyggnad i Frötuna och tillhör Frötuna församling i Uppsala stift. Kyrkan ligger strax söder om Norrtälje, på en stigning i terrängen vid norra änden av Frötuna kyrksjö. Kyrkogårdens mur byggdes av dalkarlar i början av 1800-talet och följer i stort sett den medeltida kyrkogårdens sträckning. Mot norr och öster finns två medeltida stigluckor bevarade. Norra stigluckan är sannolikt äldst. Stigluckorna mot söder och väster är numera rivna. Södra stigluckan kallades Ösbyholms stiglucka och var så stor att den användes som sockenmagasin. Västra stigluckan var till för de sockenbor som anlände med båt. Klockstapeln uppfördes 1812. Sydöst om kyrkan ligger prästgården."},{"page_url":"https://it.wikipedia.org/wiki/Giulio_di_Alessandro_de%27_Medici","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Giulio_di_alessandro_de%27_medici%2C_xvii_century_print.jpg","page_title":"Giulio di Alessandro de' Medici","context_page_description":"Giulio de' Medici è stato un ambasciatore e ammiraglio italiano, figlio illegittimo di Alessandro de' Medici e di una suora."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BD%90%E5%B7%9D%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Nishisakawa_station1.jpg","page_title":"佐川町","context_page_description":"佐川町是位於高知縣中部柳瀨川沿岸的一個城鎮。"},{"page_url":"https://sl.wikipedia.org/wiki/Celje","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Postcard_of_Celje_%2815%29.jpg","page_title":"Celje","context_page_description":"Celje [cêlje] je mesto in sedež mestne občine Celje v Republiki Sloveniji, ki leži ob sotočju rek Savinje in Voglajne v Spodnji Savinjski dolini in je središče savinjske statistične regije. Srednja nadmorska višina mesta je 238 m. Z 38.079 prebivalci je tretje največje slovensko mesto, tik pred Kranjem. Je tudi sedež rimskokatoliške škofije in več visokih šol. Največja znamenitost je stari Celjski grad, ki se prvič omenja leta 1322 in je bil sedež Celjskih grofov, najvplivnejše plemiške rodbine na Slovenskem. Mestu je Oto Pestner posvetil pesem Dober dan, knežje mesto."},{"page_url":"https://de.wikipedia.org/wiki/USS_Oldendorf_(DD-972)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/USS_Oldendorf_%28DD-972%29_port_bow_view.jpg","page_title":"USS Oldendorf (DD-972)","context_page_description":"Die USS Oldendorf war ein zur Spruance-Klasse gehörender Zerstörer der United States Navy, der im März 1978 in Dienst gestellt wurde. Das Schiff blieb bis Juni 2003 im aktiven Dienst und lag anschließend in der Reserveflotte, ehe es am 22. August 2005 als Zielschiff versenkt wurde."},{"page_url":"https://en.wikipedia.org/wiki/Neo-Riemannian_theory","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/TonnetzTorus.gif","page_title":"Neo-Riemannian theory","context_page_description":"Neo-Riemannian theory is a loose collection of ideas present in the writings of music theorists such as David Lewin, Brian Hyer, Richard Cohn, and Henry Klumpenhouwer. What binds these ideas is a central commitment to relating harmonies directly to each other, without necessary reference to a tonic. Initially, those harmonies were major and minor triads; subsequently, neo-Riemannian theory was extended to standard dissonant sonorities as well. Harmonic proximity is characteristically gauged by efficiency of voice leading. Thus, C major and E minor triads are close by virtue of requiring only a single semitonal shift to move from one to the other. Motion between proximate harmonies is described by simple transformations. For example, motion between a C major and E minor triad, in either direction, is executed by an \\"L\\" transformation. Extended progressions of harmonies are characteristically displayed on a geometric plane, or map, which portrays the entire system of harmonic relations. Where consensus is lacking is on the question of what is most central to the theory: smooth voice leading, transformations, or the system of relations that is mapped by the geometries."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%9D%D0%B0%D1%83%D0%BC_%D0%9E%D1%85%D1%80%D0%B8%D0%B4%D1%81%D0%BA%D0%B8%E2%80%9C_-_%D0%93%D0%B5%D1%87%D0%B5%D1%80%D0%BB%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Church_%28Ge%C4%8Derlija%29_%282%29.jpg","page_title":"Црква „Св. Наум Охридски“ - Гечерлија","context_page_description":"Свети Наум Охридски — православен храм кој се наоѓа во Гечерлија, Општина Босилово."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ussaramanna","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Map_of_comune_of_Ussaramanna_%28province_of_Medio_Campidano%2C_region_Sardinia%2C_Italy%29.svg","page_title":"Ussaramanna","context_page_description":"Ussaramanna sī Italia Sardinia Tōa-khu Medio Campidano Séng ê chi̍t-ê comune."},{"page_url":"https://en.wikipedia.org/wiki/Rank_Insignia_of_the_Islamic_Revolutionary_Guard_Corps","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/20-_Sepahbod-IRGC.png","page_title":"Rank Insignia of the Islamic Revolutionary Guard Corps","context_page_description":"This is a list of rank insignia used by the Islamic Revolutionary Guard Corps in Iran."},{"page_url":"https://ca.wikipedia.org/wiki/Oasi_de_Chebika","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Abandoned_and_New_Village_of_Chebika.jpg","page_title":"Oasi de Chebika","context_page_description":"L'oasi de Chebika és un oasi de muntanya de Tunísia a la governació de Tozeur, a uns 14 km de la frontera algeriana.\\nLa vella ciutat fou destruïda per les inundacions del 1967 i avui dia la gent viu en una nova ciutat construïda pel govern. La ciutat té uns mil habitants. La vella ciutat es mostra als turistes, ja que disposa d'un palmerar, una font, i conduccions de l'aigua.\\nA la muntanya hi ha un marabut, una figura d'una cabra muntanyenca feta pels turistes i un lloc anomenat la muntanya platejada que la llegenda diu que s'ha de creuar per ser feliç. La vista des de dalt es esplèndida i es dominen les muntanyes de tota la comarca.\\nA la rodalia, hi ha el lloc de la Gran Cascada, una cascada de certa importància enmig del desert que cau a un petit llac, amb un centenar de botigues de records a l'entrada."},{"page_url":"https://de.wikipedia.org/wiki/Geister_(Roman)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/0_Pygmalion_et_Galat%C3%A9e_-_A-L._Girodet_-_RF_2002-4_-_Louvre_2.JPG","page_title":"Geister (Roman)","context_page_description":"Geister ist ein Roman des Bookerpreisträgers John Banville aus dem Jahre 1993, der im Jahre 2000 auf Deutsch erschien.\\nDer Ich-Erzähler, ein Mörder, lebt nach verbüßter Strafe mit wenigen Menschen auf einer namenlosen Insel. Er hat im Hause eines Kunstprofessors Asyl gefunden, dessen Forschungen zu Vaublin er fortsetzt. Eines Tages strandet ein Ausflugsschiff und eine Gruppe von Menschen dringt in das Refugium ein.\\nDas Werk ist der zweite Teil einer Trilogie, deren erster Band, The Book of Evidence, 1989 erschien. Dort hatte die Hauptfigur Freddie Montgomery beim Versuch, das Porträt einer jungen Frau zu stehlen, vielleicht ein Bild von Vermeer, das lebende Ebenbild dieses Porträts, eine junge Hausangestellte des Besitzers, ermordet. Auch Athena, der dritte Band der sogenannten „Mördertrilogie“, liegt auf Deutsch vor."},{"page_url":"https://de.wikipedia.org/wiki/Joachim_Fischer_Nielsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Flickr_-_tpower1978_-_Yonex_Open_%282%29.jpg","page_title":"Joachim Fischer Nielsen","context_page_description":"Joachim Fischer Nielsen ist ein dänischer Badmintonspieler."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%BD%D0%B3%D0%B0%D0%BB%D1%81_(%D0%BB%D1%83%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BA%D1%80%D0%B0%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Ingalls_sattelite_craters_map.jpg","page_title":"Ингалс (лунный кратер)","context_page_description":"Кратер Ингалс — древний крупный ударный кратер в северном полушарии обратной стороны Луны. Название присвоено в честь американского астронома-любителя Альберта Грэма Ингаллса и утверждено Международным астрономическим союзом в 1970 г."},{"page_url":"https://cs.wikipedia.org/wiki/Okresn%C3%AD_soud_v_Opav%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/OS_Opava.PNG","page_title":"Okresní soud v Opavě","context_page_description":"Okresní soud v Opavě je okresní soud se sídlem v Opavě. Vznikl roku 1850 a až do roku 1949 spadal do obvodu opavského krajského soudu, poté byl přičleněn pod Krajský soud v Ostravě. Rozhoduje jako soud prvního stupně ve všech trestních a civilních věcech, ledaže jde o specializovanou agendu, která je svěřena krajskému soudu.\\nSoud se nachází v justičním paláci z roku 1888 na Olomoucké ulici, který je chráněn jako kulturní památka. Jde o historizující třípodlažní stavbu s vnitřním nádvořím, v průčelí s pětiosým rizalitem završeným trojúhelníkovitým štítem, která byla postavena podle projektu Ernsta Swobody. Na soud přímo navazuje areál Věznice Opava."},{"page_url":"https://el.wikipedia.org/wiki/%CE%86%CE%B3%CE%B9%CE%BF%CF%82_%CE%98%CF%89%CE%BC%CE%AC%CF%82_%CE%92%CE%BF%CE%B9%CF%89%CF%84%CE%AF%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/School_in_Agios_Thomas%2C_Boeotia.jpg","page_title":"Άγιος Θωμάς Βοιωτίας","context_page_description":"Ο Άγιος Θωμάς είναι χωριό στο νομό Βοιωτίας. Αποτελεί την ομώνυμη Τοπική Κοινότητα του Καλλικρατικού Δήμου Τανάγρας από το 2011. Από το 1997 έως το 2010 μαζί με το Κλειδί, τα Οινόφυτα και τμήμα του Δήλεσι αποτελούσαν το Δήμο Οινοφύτων. Το χωριό απέχει από την Αθήνα 70 χλμ. Προσεγγίζεται από την Εθνική Οδό Αθηνών-Θεσσαλονίκης στο ύψος του Αυλώνα ή από την Ελευσίνα, μέσω Στεφάνης, Σκούρτων, Κλειδίου."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Halifax_County,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Brooklyn_Store_and_Post_Office.jpg","page_title":"National Register of Historic Places listings in Halifax County, Virginia","context_page_description":"This is a list of the National Register of Historic Places listings in Halifax County, Virginia.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Halifax County, Virginia, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in an online map.\\nThere are 37 properties and districts listed on the National Register in the county, including 1 National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted March 1, 2019."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_postures_de_Hatha_Yoga","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Raja_vajrasana.jpg","page_title":"Liste de postures de Hatha Yoga","context_page_description":"Liste des postures les plus communes du Haṭhayoga."},{"page_url":"https://fr.wikipedia.org/wiki/Altichiero_da_Zevio","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Altichiero%2C_crocefissione%2C_basilica_del_santo%2C_cappella_di_san_felice%2C_padova%2C_1376_circa.jpg","page_title":"Altichiero da Zevio","context_page_description":"Altichiero da Zevio ou Aldighieri da Zevio est un peintre italien de style gothique du Trecento."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89lections_constituantes_est-timoraises_de_2001","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Mari_Bin_Amude_Alkatiri_2001.jpg","page_title":"Élections constituantes est-timoraises de 2001","context_page_description":"Les élections constituantes est-timoraises de 2001 se sont déroulées le 30 août 2001 afin de donner une assemblée constituante au Timor oriental suite à la victoire de l'option indépendantiste au référendum de 1999. Les élections ont ainsi lieu sous la tutelle d'une administration civile onusienne de transition. Elles sont remportées par le Front révolutionnaire pour l'indépendance du Timor oriental, dit Fretilin, avec 55 sièges sur 88."},{"page_url":"https://en.wikipedia.org/wiki/Chao_Samart%C3%ADn","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Chao_samartin_building.jpg","page_title":"Chao Samartín","context_page_description":"Chao Samartín is a Castro located in the municipality of Grandas. It was founded in the Bronze Age, around the year 800 BCE.\\nThe castro was discovered in 1977."},{"page_url":"https://sk.wikipedia.org/wiki/Surinam","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Suriname-CIA_WFB_Map.png","page_title":"Surinam","context_page_description":"Surinam je prímorský štát v Južnej Amerike pri pobreží Atlantického oceánu. Jeho susedmi sú Brazília, Francúzska Guyana a Guyana. Takmer polovica obyvateľstva krajiny žije v hlavnom meste Paramaribo. Prevažnú časť vnútrozemia vypĺňajú pralesy a savany."},{"page_url":"https://en.wikipedia.org/wiki/Ant%C3%B4nio_Martins","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Ant%C3%B4nio_Martins%2C_Rio_Grande_do_Norte_%28Brasil%29.jpg","page_title":"Antônio Martins","context_page_description":"Antônio Martins is a municipality in the state of Rio Grande do Norte in the Northeast region of Brazil."},{"page_url":"https://be.wikipedia.org/wiki/%D0%95%D1%9E%D1%80%D0%BE%D0%BF%D0%B0-%D0%BF%D0%B0%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Ep_eurosat.jpg","page_title":"Еўропа-парк","context_page_description":"Еўропа-парк — другі па наведвальнасці парк забаў у Еўропе пасля Дыснэйлэнда ў Парыжы. Знаходзіцца ў гарадку Руст у федэральнай зямлі Бадэн-Вюртэмберг на паўднёвым захадзе Германіі. Быў адкрыты ў 1975 годзе, у 2007 годзе яго наведвальнасць склала 4 мільёна чалавек.\\nШматлікія атракцыёны знаходзяцца ў розных тэматычных раздзелах парку, якія ўяўляюць дзяржавы Еўропы: Германію, Францыю, Швейцарыю, Італію, Галандыю, Расію, Іспанію, Грэцыю, Партугалію, Англію і скандынаўскія краіны."},{"page_url":"https://sl.wikipedia.org/wiki/Obala_Omaha","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Into_the_Jaws_of_Death_23-0455M_edit.jpg","page_title":"Obala Omaha","context_page_description":"Obala Omaha je kodno ime za enega od petih sektorjev, kjer so se zavezniki v času operacije Neptun izkrcali na obale Normandije. Operacija se je začela 6. junija 1944. Plaža se nahaja na obali Normandije v Franciji, ob Rokavskem prelivu vzhodno od občine Sainte-Honorine-des-Pertes, zahodno od Vierville-sur-Mer in desno od estuarija reke Douve."},{"page_url":"https://en.wikipedia.org/wiki/List_of_waterfalls","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/High_force.jpg","page_title":"List of waterfalls","context_page_description":"This list of notable waterfalls of the world is sorted by continent, then country, then province, state or territory. A waterfall is included if it has an existing article specifically for it on Wikipedia, and it is at least 15 m high, or the falls have some historical significance based on multiple reliable references.\\nThere is no standard way to measure the height or width of a waterfall. No ranking of waterfalls should be assumed because of the heights or widths provided in the list. Many numbers are estimated and measurements may be imprecise. See additional lists of waterfalls by height, flow rate and type."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%86%D9%82%D9%84%D8%A7%D8%A8_%D8%A8%D9%8A%D8%B1_%D9%87%D9%88%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Bundesarchiv_Bild_102-00344A%2C_M%C3%BCnchen%2C_nach_Hitler-Ludendorff_Prozess.jpg","page_title":"انقلاب بير هول","context_page_description":"انقلاب بير هول كانت محاولة انقلاب فاشله اتعملت بقيادة الحزب النازى و هيتلر عشان يستولوا على السلطه و يسطير على بافاريا فى جمهورية فايمار, الحركة ابتدت يوم 8 نوفمبر بليل و استمرت لحد ظهر اليوم التانى فى 9 نوفمبر من سنة 1923, هيتلر حب انه يستخدم اسم الجنرال اريش لودندورف اللى ضمه معاهم فى الانقلاب عشان يستغل اسمه المعروف عشان الناس تئييد الانقلاب. بس الانقلاب فشل و اتقبض على هيتلر و اتحاكم و اتسجن لفتره و بعدين افرج عنه, بعد ما شعبيته و افكاره زادت و انتشرت جامد فى المانيا."},{"page_url":"https://es.wikipedia.org/wiki/Produban","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Entrada_Produban_La_Finca.JPG","page_title":"Produban","context_page_description":"Produban es una empresa española, 100% propiedad del Banco Santander, cuya misión es gestionar y controlar toda la infraestructura IT del Grupo, proporcionando servicios de Infraestructura IT y Operación para todas sus Entidades:\\nBanca Retail\\nUnidades y Negocios Globales\\nUnidades Corporativas\\nProduban tiene su sede en el parque empresarial La Finca de Pozuelo de Alarcón, Madrid."},{"page_url":"https://fr.wikipedia.org/wiki/Bouilly-en-G%C3%A2tinais","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Bouilly-en-G%C3%A2tinais_%C3%A9glise_3.jpg","page_title":"Bouilly-en-Gâtinais","context_page_description":"Bouilly-en-Gâtinais est une commune française, située dans le département du Loiret en région Centre-Val de Loire."},{"page_url":"https://ceb.wikipedia.org/wiki/Lawalde_(kapital_sa_munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Wasserschloss_kleindehsa.jpg","page_title":"Lawalde (kapital sa munisipyo)","context_page_description":"Kapital sa munisipyo ang Lawalde sa Alemanya. Nahimutang ni sa estado pederal sa Saxony, sa sidlakang bahin sa nasod, 180 km sa habagatan-sidlakan sa Berlin ang ulohan sa nasod. 334 metros ibabaw sa dagat kahaboga ang nahimutangan sa Lawalde, ug adunay 2,131 ka molupyo.\\nAng yuta palibot sa Lawalde kay patag sa habagatang-sidlakan, apan sa amihang-kasadpan nga kini mao ang kabungtoran. Kinahabogang dapit sa palibot ang Kötzschauer Berg, 465 ka metros ni kahaboga ibabaw sa dagat, 1.9 km sa amihanan-kasadpan sa Lawalde. Dunay mga 207 ka tawo kada kilometro kwadrado sa palibot sa Lawalde medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Löbau, 5.0 km sa sidlakan sa Lawalde. Sa rehiyon palibot sa Lawalde, mga bungtod, ug mga lasang talagsaon komon.\\nHapit nalukop sa kaumahan ang palibot sa Lawalde. Ang klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Agosto, sa 18 °C, ug ang kinabugnawan Enero, sa -6 °C."},{"page_url":"https://sl.wikipedia.org/wiki/Kmetijska_raznovrstnost","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/GEM_corn.jpg","page_title":"Kmetijska raznovrstnost","context_page_description":"Kmetijska raznovrstnost pomeni genetsko raznolikost v kmetijstvu in se že tisočletja uporablja pri divjih in gojenih rastlinah. V živinoreji so v preteklosti s selekcijo pomembnih lastnosti posameznih pasem dosegli boljšo produktivnost živali. Danes zaradi napredka znanosti ustvarjajo nove pasme živali in vrste rastlin, ki so bolj prilagojene okolju. Kmetijstvo, kot ga poznamo danes, je povsem odvisno od popolne zamenjave zapletenih naravnih ekosistemov z enostavnejšimi, v katerih je mnogo manj vrst. Agroekosistemi so zato najbolj napredni produktivni sistemi, vendar so hkrati tudi najbolj ranljivi in občutljivi na spremembe podnebja, rastlinske škodljivce in bolezni, živalske bolezni itd."},{"page_url":"https://es.wikipedia.org/wiki/Ettersburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Neues_Schloss_Ettersburg_und_Schlo%C3%9Fkirche%2C_oberhalb_des_Landschaftsparks_%22P%C3%BCcklerschlag%22%2C_Weimarer_Land.JPG","page_title":"Ettersburg","context_page_description":"Ettersburg es un municipio situado en el distrito de Weimarer Land, en el estado federado de Turingia, a una altitud de 300 metros. Su población a finales de 2016 era de unos 640 habitantes y su densidad poblacional, 220 hab/km².​​​\\nSe encuentra ubicado cerca de las ciudades de Jena, Weimar y Erfurt —la capital del estado—."},{"page_url":"https://nl.wikipedia.org/wiki/Navailles-Angos","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Eglise_de_Navailles-Angos.JPG","page_title":"Navailles-Angos","context_page_description":"Navailles-Angos is een gemeente in het Franse departement Pyrénées-Atlantiques en telt 1304 inwoners. De plaats maakt deel uit van het arrondissement Pau."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_moulins_%C3%A0_vent_de_Gueldre","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Bronkhorst_-_Bronkhorster_Molen.jpg","page_title":"Liste des moulins à vent de Gueldre","context_page_description":"Cet article recense les moulins à vent de la province de Gueldre, aux Pays-Bas."},{"page_url":"https://pt.wikipedia.org/wiki/Lawrence_Alma-Tadema","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Tepidarium_Lawrence_Alma-Tadema_%281836-1912%29.jpg","page_title":"Lawrence Alma-Tadema","context_page_description":"Lawrence Alma-Tadema, nascido Lourens Alma Tadema foi um dos mais proeminentes pintores e desenhistas do neoclassicismo europeu. Ao longo de sua vida, Alma-Tadema também adquiriu cidadania na Bélgica, bem como no Reino Unido. Cursou a Real Academia de Belas Artes de Antuérpia, na Bélgica, tendo-se estabelecido em Inglaterra por boa parte da vida. Tornou-se famoso pelos seus trabalhos retratando o luxo e a decadência do Império Romano e Grécia Antiga, com retratos vívidos das construções em mármore, contrastando com o azul do mar Mediterrâneo e o céu. Muito admirado e apreciado em vida pelos seus retratos da Antiguidade clássica, seu trabalho caiu no ostracismo após a morte, tendo sido redescoberto na década de 1960 e reavaliado como um dos maiores expoentes da pintura inglesa do século XIX."},{"page_url":"https://en.wikipedia.org/wiki/William_Aiken_Jr.","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Harriet_Lowndes_Aiken_%28cropped%29.jpg","page_title":"William Aiken Jr.","context_page_description":"William Aiken Jr. was the 61st governor of South Carolina, serving from 1844 to 1846. He also served in the state legislature and the United States House of Representatives, running unsuccessfully for speaker of the House in 1856 in \\"the longest and most contentious Speaker election in House history.\\"\\nAiken was one of the state's wealthiest citizens, owner of the largest rice plantation in the state — Jehossee Island — with over 700 enslaved Blacks on 1,500 acres under cultivation, almost twice the acreage of the next largest plantation. By 1860, Aiken owned the entire Jehossee Island, and the plantation produced 1.5 million pounds of rice in addition to sweet potatoes and corn — in the middle of the 19th century, rice was king in South Carolina — of the 10 largest cash crops in 1850, seven were rice, two cotton and one sugar. After the Civil War, the plantation regained its preeminence, producing 1.2 million pounds of rice. Today, descendants of the Aiken family, the Maybanks, still own part of the island, having sold the remainder in 1992 to the U.S. as part of the ACE Basin National Wildlife Refuge."},{"page_url":"https://ast.wikipedia.org/wiki/Dirty_S%C3%A1nchez","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Dustin_Diamond.jpg","page_title":"Dirty Sánchez","context_page_description":"El Dirty Sánchez, Dirty Georg o Dirty Behrendt, tamién conocíu con otros nomes como Stinky Hitler, ye una práctica sexual de calter coprófilo consistente n'enllordiar con fieces enriba del llabiu cimeru de la pareya —de normal en calteniendo sexu añal—, de tala forma que aseméyese a un bigote, y la pareya tien que golelo. El motivu pal usu d'un apellíu hispánicu ye una referencia a un conocíu estereotipu mexicanu."},{"page_url":"https://en.wikipedia.org/wiki/Narsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/NarsdorfBf-alt2.JPG","page_title":"Narsdorf","context_page_description":"Narsdorf is a former municipality in the Leipzig district, in Saxony, Germany. As of 1 July 2017 Narsdorf has been incorporated into Geithain. The villages of Ossa, and Rathendorf had been incorporated administratively into Narsdorf in 1996, while nearby Seifersdorf had already been incorporated in 1934 and Dölitzsch in 1973."},{"page_url":"https://de.wikipedia.org/wiki/Las_Rozas_de_Madrid","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Escudo_de_Las_Rozas.jpg","page_title":"Las Rozas de Madrid","context_page_description":"Las Rozas ist eine der flächenmäßig größten Gemeinden der Autonomen Gemeinschaft Madrid und liegt etwa 18 km von Madrid entfernt im Nordwesten der Stadt. Seit 1991 hat sich die Einwohnerzahl von 35.000 auf 95.814 am 1. Januar 2019 mehr als verdoppelt.\\nAngebunden ist die Gemeinde über die A-6, die M-50 und die M-505, die nach El Escorial führt. Darüber hinaus bestehen einige Buslinien zur Metrostation Moncloa in Madrid: 621, 624, 622, 623, 626, 628, 629.\\nSchließlich gibt es noch eine Verbindung mit der Madrider S-Bahn, die an vier Stationen im Gebiet von Las Rozas hält: Las Rozas, Las Matas, Pinar und El Tejar.\\nIn Las Rozas liegt die Ciudad del Fútbol, das 2003 eröffnete Trainingsgelände und Sitz des Spanischen Fußballverbandes. Die Spanische Fußballnationalmannschaft der Frauen hat dort in den letzten Jahren einen Großteil ihrer Heimspiele ausgetragen."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%90%E1%83%A5%E1%83%90%E1%83%A0%E1%83%97%E1%83%95%E1%83%94%E1%83%9A%E1%83%9D%E1%83%A1_%E1%83%9B%E1%83%9D%E1%83%9C%E1%83%90%E1%83%A0%E1%83%A5%E1%83%94%E1%83%91%E1%83%98%E1%83%A1_%E1%83%9B%E1%83%94%E1%83%A3%E1%83%A6%E1%83%9A%E1%83%94%E1%83%94%E1%83%91%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Bagratuni_flag2.jpg","page_title":"საქართველოს მონარქების მეუღლეების სია","context_page_description":"1490 წელს საქართველო სამ დამოუკიდებელ სახელწიფოდ დაიშალა."},{"page_url":"https://cs.wikipedia.org/wiki/Heinrich_Baak","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Baak_Kriegertafel.jpg","page_title":"Heinrich Baak","context_page_description":"Heinrich Baak byl německý sochař."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Juden","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Simonino_Trento.jpg","page_title":"Geschichte der Juden","context_page_description":"Der Artikel gibt einen kurzen Abriss über mehr als 1200 Artikel in der Wikipedia zum engeren Thema Geschichte der Juden, wobei 9336 Artikel in der Kategorie „Jüdische Geschichte“, 9477 Artikel in der Kategorie „Israel“ und 24.851 Artikel, die im weitesten Sinne mit dem Thema zu tun haben, in der Kategorie „Judentum“ einsortiert sind. Er enthält Listen der Artikel zur Geschichte der Juden in Ländern, Städten, Gemeinden und spezifischen Themen.\\nJuden sind ein ursprünglich nach dem Stamm und späteren Königreich Juda benanntes Volk. Sie haben über lange Zeit weitgehend weltweit zerstreut außerhalb von Eretz Israel gelebt. Das jüdische Volk hat sich über 2000 Jahre hinweg als ein solches begriffen und wurde auch von außen als ein solches verstanden, obwohl ein jüdischer Staat in dieser Zeit bis 1948 nicht existierte. Die Geschichte der Juden ist sowohl von Unterdrückung, Verfolgung, Ermordung und Vertreibung als auch von Toleranz, friedlichem Miteinander und Gleichberechtigung geprägt. Sie beinhaltet die Geschichte der Juden in der Diaspora und die Gründung des Staates Israel."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E3%83%8F%E3%82%B3%E3%82%AC%E3%83%A1%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Eastern_Box_Turtle2.jpg","page_title":"アメリカハコガメ属","context_page_description":"アメリカハコガメ属は、カメ目ヌマガメ科に属する属。模式種はカロリナハコガメ。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%99%CE%B1%CF%80%CF%89%CE%BD%CE%B9%CE%BA%CE%AE_%CE%B3%CE%BB%CF%8E%CF%83%CF%83%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Japanese_dialects-en.png","page_title":"Ιαπωνική γλώσσα","context_page_description":"Η Ιαπωνική είναι γλώσσα που ομιλείται από 127 εκατ. ανθρώπους, κυρίως στην Ιαπωνία, αλλά και σε κοινότητες Ιαπώνων μεταναστών σε όλο τον κόσμο. Θεωρείται συγκολλητική γλώσσα και διακρίνεται για το σύνθετο πλέγμα εκφράσεων ευγενείας που απεικονίζουν την ιεραρχική φύση της ιαπωνικής κοινωνίας, με ρηματικούς τύπους και ιδιαίτερο λεξιλόγιο που υποδεικνύει τη σχετική θέση του ομιλητή και του ακροατή. Η δεξαμενή ήχων της Ιαπωνικής είναι σχετικά μικρή και διαθέτει ένα λεξικογραφικά διακριτό σύστημα τόνων. Το ιστορικό αρχείο της γλώσσας ανάγεται στον 8ο αιώνα, όταν συντέθηκαν τα τρία μείζονα έργα της αρχαίας ιαπωνικής.\\nΗ Ιαπωνική γράφεται με συνδυασμό τριών διαφορετικών τύπων χαρακτήρων: Οι κινεζικοί χαρακτήρες, ενώ οι δύο συλλαβικές γραφές, χιραγκάνα και κατακάνα. Το λατινικό αλφάβητο χρησιμοποιείται συχνά στη σύγχρονη Ιαπωνική, για ονόματα εταιρειών, διαφημιστικούς λόγους ή υπολογιστική χρήση. Η αραβική αρίθμηση χρησιμοποιείται εν γένει, αλλά επίσης κοινός τόπος είναι η παραδοσιακή Κινεζική/Ιαπωνική αρίθμηση.\\nΤο ιαπωνικό λεξιλόγιο έχει επηρεαστεί ιδιαίτερα από δάνεια άλλων γλωσσών."},{"page_url":"https://es.wikipedia.org/wiki/Robert_von_Greim","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Bundesarchiv_Bild_101I-401-0204-25%2C_Robert_Ritter_v._Greim.jpg","page_title":"Robert von Greim","context_page_description":"Robert Greim y luego de 1918 al ser nombrado caballero Robert Ritter von Greim, fue un piloto y comandante en jefe de la Luftwaffe durante la Segunda Guerra Mundial casi al finalizar ésta."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%88%D8%A8%D9%8A%D9%83_(%D9%87%D9%88%D9%84%D9%86%D8%AF%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Lopik_op_zijn_mooist_op_een_late_herfstdag_in_November.jpg","page_title":"لوبيك (هولندا)","context_page_description":"لوبيك Lopik هي مدينة وبلدية بمقاطعة أوترخت بهولندا."},{"page_url":"https://en.wikipedia.org/wiki/Multidimensional_Unit_(IDF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Establishment_ceremony_of_the_multidimensional_unit._V.jpg","page_title":"Multidimensional Unit (IDF)","context_page_description":"Multidimensional Unit is an elite unit in the Israeli Defense Force, subordinate to the IDF's 98th Paratroopers Division. The unit was established on 2019 by Israeli Chief of Staff Aviv Kokhavi, to prepare for battle on the battlefield of the future. The unit seeks to operate in all battle arenas to detect, attack and destroy the enemy in all theaters of operation and in all domains.\\nThe unit combines the capabilities of infantry, engineering, anti-tank warfare, air and Intelligence.\\nIn February 2020, the order of foundation of the unit was approved, and a symbol was discovered – a Sword, built into the number eight, with arrows nested in different directions."},{"page_url":"https://nl.wikipedia.org/wiki/Nationaal_park_Gran_Paradiso","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Autunno.jpg","page_title":"Nationaal park Gran Paradiso","context_page_description":"Het Nationaal park Gran Paradiso is het oudste nationaal park van Italië. Het ligt in de Grajische Alpen, in het noordwesten van het land, ten zuiden van Aosta en niet ver van de Mont Blanc.\\nDe hoogste top van het gebied is de gelijknamige 4061 meter hoge Gran Paradiso. Het gebied omvat verschillende dalen die bijna allemaal in noord-zuidriching lopen. Vittorio Emmanuele II had er in de 19de eeuw zijn jachtgebied.\\nGran Paradiso was het laatste gebied waar de alpensteenbok in het wild voorkwam, totdat het dier weer in andere natuurgebieden in de Alpen werd uitgezet. Ook komen er in het gebied gemzen voor.\\nOp de grens met Frankrijk grenst het park aan het Parc national de la Vanoise. In 1972 zijn beide landen een samenwerkingsverband aangegaan en beide parken beslaan nu samen een oppervlakte van 1250km²."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%A1%D5%AC%D5%B8%D5%B4%D5%A5%D5%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Kalomel_auf_Cinnabarit_-_Almaden%2C_Spanien.jpg","page_title":"Կալոմել","context_page_description":"Կալոմել, սնդիկի քլորիդ, Hg₂Cl₂, քլորաջրածնական թթվի սնդիկային աղը։ Անգույն փոշի է։ Կծու ալկալիների կամ ամոնիակի ազդեցությամբ սևանում է ։ Սևացման պատճառը շատ մանր վիճակում սնդիկի առաջացումն է.\\nHg₄Cl₂+ 2NaOH= Hg+HgO+2NaCl+H₂O\\nHg₂Cl₂+2NH₄OH= HgNH₂Cl+Hg+NH₄CI+2H₂O\\nԽտությունը 7160 կգ/մ3 է։ Գոլորշիանում է առանց հալվելու, գոլորշիացման ջերմաստիճանը՝ 383, 7 °C։ Զրում շատ քիչ է լուծվում։ Ստացվում է միարժեք սնդիկի աղերն աղաթթվով մշակելիս և այլ եղանակներով։ Կիրառվում է էլեկտրոդներ պատրաստելու համար, օրգանական սինթեզում, բժշկության մեջ ։ Բնության մեջ կալոմելը հազվադեպ հանդիպող միներալ է։ Առաջանում է սնդիկի հանքավայրերի օքսիդացման գոտում։ Ունի ալմաստի փայլ։ Կարծրությունը 1, 5 է՝ ըստ հանքաբանական սանդղակի։"},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9fugi%C3%A9s_de_la_guerre_civile_syrienne_en_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Refugees_welcome_%40Toulouse%2C_2015-09-05_%28372%29.jpg","page_title":"Réfugiés de la guerre civile syrienne en France","context_page_description":"Les réfugiés de la guerre civile syrienne en France ou réfugiés syriens en France sont des ressortissants syriens qui ont fui leur pays à la suite de l'escalade de la guerre civile. Pour échapper aux violences, environ quatre millions de Syriens ont fui le pays pour se rendre dans un pays voisin, des milliers d'autres fuyant à travers le monde, notamment en migrant en Europe, créant une inflexion de la politique d'Immigration en France.\\nLa France apparaît en quatrième position du nombre de demandes d'asile entre avril et juin 2015 de l'étude réalisée par l'agence Eurostat."},{"page_url":"https://fr.wikipedia.org/wiki/Nerf_sensitif_et_nerf_moteur","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Systeme_Nerveux_Central_%26_Peripherique_du_corps_Humain..png","page_title":"Nerf sensitif et nerf moteur","context_page_description":"Les nerfs sont des structures composées de fibres nerveuses, ces fibres sont des axones de neurones. Elles peuvent être motrices ou sensitives."},{"page_url":"https://de.wikipedia.org/wiki/Karasis_(Festung)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Karasis_Geschuetzturm.JPG","page_title":"Karasis (Festung)","context_page_description":"Die antike Festungsanlage von Karasis liegt auf dem bis zu gut 1000 m aufsteigenden isolierten Höhenrücken des Berges Karasis in den Ausläufern des östlichen Taurusgebirges in der historischen Region Kilikien, am nördlichen Rand der Çukurova nahe bei Kozan in der Provinz Adana. Sie wurde erst 1994 durch den Epigraphiker Mustafa H. Sayar entdeckt, der von Einheimischen aus den umliegenden Dörfern auf mächtige Ruinen auf dem Berggipfel hingewiesen worden war. Die aus einer Ober- und einer Unterburg bestehende Anlage wurde wahrscheinlich im 2. Jahrhundert v. Chr. von den makedonischen Seleukiden erbaut. Sowohl der eigentliche Name der Festungsanlage als auch ihr Zweck sind unklar. In antiken Schriften wird zwar eine im Taurusgebirge liegende Schatzburg namens Kyinda erwähnt, jedoch fehlen bisher die Belege dafür, dass es sich bei der Festung von Karasis um diese Anlage handelt."},{"page_url":"https://sv.wikipedia.org/wiki/Lawrence_Lasker","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Lawrence_Lasker_at_WarGames_25th_anniversary_showing.jpg","page_title":"Lawrence Lasker","context_page_description":"Lawrence C. Lasker, född 7 oktober 1949 i Los Angeles County, Kalifornien, är en amerikansk manusförfattare och producent. Hans debut på bioduken blev med filmen War Games från 1983."},{"page_url":"https://ceb.wikipedia.org/wiki/Amphisbaena_caeca","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Amphisbaena_caeca_%28Johana_Goyes-Vallejos%29.JPG","page_title":"Amphisbaena caeca","context_page_description":"Espesye sa reptil ang Amphisbaena caeca. Una ning gihulagway ni Georges Cuvier ni adtong 1829. Ang Amphisbaena caeca sakop sa kahenera nga Amphisbaena sa kabanay nga Amphisbaenidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://es.wikipedia.org/wiki/Irdjen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Mairie_de_Irdjen.JPG","page_title":"Irdjen","context_page_description":"Irdjen es un municipio de la provincia o valiato de Tizi Ouzou en Argelia. En abril de 2008 tenía una población censada de 13 149 habitantes.​\\nSe encuentra ubicado al norte del país, en la región de Cabilia, a poca distancia de la costa del mar Mediterráneo y al este de Argel."},{"page_url":"https://pt.wikipedia.org/wiki/Adamastor_(mitologia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Adamastor_in_sand_-_FIESA_2007.JPG","page_title":"Adamastor (mitologia)","context_page_description":"Adamastor é um mítico gigante da mitologia Sidónio Apolinário cita este gigante pela primeira vez como um dos filhos de Castelo Branco, que se rebelaram contra Zeus e por isso foram fulminados, ficaram dispersos e reduzidos a promontórios, ilhas e fraguedos. Também é citado por Fernando Pessoa no poema O Mostrengo e por Rabelais, em Gargantua e Pantagruel. Sua menção mais memorável, no entanto é feita por Luís de Camões no Canto V da epopeia portuguesa Os Lusíadas, como o gigante do Cabo das Tormentas, que afundava as naus. Como ele foi \\"jogado ao fundo dos mares\\", desfazia-se em lágrimas, as águas salgadas que banhavam a confluência dos oceanos Atlântico e Índico, e revoltava-se sob a forma de uma tempestade ameaçando a ruína daquele que tentasse dobrar o Cabo das Tormentas, os alegados domínios de Adamastor. O episódio do Adamastor representa, assim, em figuração grandiosa e comovente, as forças da natureza, a sua oposição à audácia dos navegadores portugueses comandados por Vasco da Gama e a predição da história trágico-marítima que se lhe seguiria."},{"page_url":"https://id.wikipedia.org/wiki/Asia_Timur_Laut","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Sea_of_Okhotsk_map_with_state_labels.png","page_title":"Asia Timur Laut","context_page_description":"Istilah mengenai Asia Timur Laut jelasnya mengacu terhadap sebagian daerah benua Asia yaitu daratan luas dan kepulauan yang berbatasan dengan Samudera Pasifik. Secara bertolak belakang dengan kenyataan, negara Asia Timur juga termasuk Asia Timur Laut.\\nIstilah ini mulai tenar sejak tahun 1930-an melalui seorang pakar sejarah dan ilmuwan politik berkebangsaan Amerika Serikat yaitu Robert Kerner. Berdasarkan ketetapan batasan terhadap \\"Asia Timur Laut\\" menurut beliau, istilah ini meliputi Dataran Tinggi Mongolia, Semenanjung Korea, Tanah Pamah Tiongkok Timur Laut atau Tanah Pamah Manchuria dan banyak wilayah pegunungan di Timur Jauh Rusia yang merentangkan antara Samudera Pasifik di sebelah timur dan Danau Baikal di sebelah barat."},{"page_url":"https://tr.wikipedia.org/wiki/Orchidaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Anacamptis_laxiflora_labellum.jpg","page_title":"Orchidaceae","context_page_description":"Orchidaceae veya Salepgiller, Asparagales takımına ait bir familyadır.\\nOrchidaceae familyası çiçekli bitkilerin ikinci büyük familyasıdır. Dünyada yaklaşık 880 cins ve 22 binden fazla tür ihtiva etmektedir. Geniş yayılışlıdır, çoğunluğu tropiklerde yayılmış, soğuk ılıman ve subarktik bölgelerde daha az yayılmıştır, tropiklerdeki türlerden bazıları epifittir.\\nTürkiye'de 24 cins ve 60'tan fazla türü bulunmaktadır."},{"page_url":"https://eo.wikipedia.org/wiki/Mahasthangarh","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/BD_Mahasthangarh1.JPG","page_title":"Mahasthangarh","context_page_description":"Mahasthangarh estas unu el la plej fruaj urbaj arkeologiaj lokoj ĝis nun malkovritaj en Bangladeŝo. La vilaĝo Mahasthan en la thana Shibganj de la Distrikto Bogra enhavas la restaĵojn de antikva urbo kiu estis nomata Pundranagara aŭ Paundravardhanapura en la teritorio de Pundravardhana. Kalkoŝtona bloko kiu montras ses liniojn en prakrito en Brahma skribmaniero, malkovrita en 1931, datigas Mahasthangarh en almenaŭ la 3a jarcento a.K. La fortifikita areo estis en uzado ĝis la 18a jarcento p.K."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_t%C3%B2a_nh%C3%A0_cao_nh%E1%BA%A5t_Th%C3%A0nh_ph%E1%BB%91_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/One_Madison%2C_New_York_City_in_2015.JPG","page_title":"Danh sách tòa nhà cao nhất Thành phố New York","context_page_description":"Thành phố New York, thành phố đông dân nhất tại Hoa Kỳ, là ngôi nhà của 6.154 tòa nhà cao tầng đã hoàn thành, 113 trong số đó có chiều cao từ 600 foot trở lên. Tòa nhà cao nhất tại New York là Trung tâm Thương mại Thế giới Một, cao 1.776 foot. Tòa nhà chọc trời 104 tầng này cũng là tòa nhà cao nhất Hoa Kỳ, tòa nhà cao nhất Bán cầu Tây, và là tòa nhà cao thứ sáu thế giới. Tòa nhà cao thứ nhì thành phố là tòa nhà 432 Đại lộ Park, cao 1.396 foot, và thứ ba là Tòa nhà Empire State cao 102 tầng tại Midtown Manhattan, được khánh thành vào năm 1931 và có chiều cao 1.250 foot, tính cả ăngten là 1.454 foot. Nó cũng là tòa nhà cao thứ năm tại Hoa Kỳ và là tòa nhà cao thứ 25 thế giới.\\nTòa nhà Empire State từng là tòa nhà cao nhất thế giới từ khi hoàn thành cho đến năm 1972, khi Tòa tháp Bắc cao 110 tầng của Trung tâm Thương mại Thế giới cũ được hoàn thành. Với độ cao 1.368 foot, Trung tâm Thương mại Thế giới giành danh hiệu tòa nhà cao nhất thế giới trong một khoảng thời gian ngắn tới khi Tòa tháp Sears cao 108 tầng hoàn thành tại Chicago năm 1974."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%98%89%E6%B9%96%E5%B1%B1%E8%8E%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/HK_Kingswood_Villas_Kenswood_Court_Garden2.jpg","page_title":"嘉湖山莊","context_page_description":"嘉湖山莊是一個大型私人住宅屋苑為香港十大藍籌屋苑之一，位於香港新界元朗區天水圍新市鎮，於1988年規劃，1991年至1998年間分7期發展58座住宅大廈，由樂湖居、賞湖居、翠湖居、麗湖居、景湖居、天水圍公園、美湖居、+WOO 嘉湖及嘉湖海逸酒店組合而成，屋苑總面積佔地400萬平方呎，而整體綠化空間為約360萬平方呎，所佔綠化空間的面積為全港屋苑之最。發展商為天水圍發展有限公司，嘉湖山莊為長江實業歷年來最大型的發展項目。以單位數目來看，嘉湖山莊是為全港最大型的私人屋苑。其單位數目亦多達15,880個，以單位數目而言，為香港住宅之最。位處本屋苑中心地帶的置富嘉湖，為區內大型商場和酒店項目。\\n嘉湖山莊所有期數樓宇均為三梯八伙設計，全部標準單位均設窗台、窗口式冷氣機，不設工人房、花園、露台、工作平台。本屋苑各期均植有大量綠化空間，每座大樓地面住客入口均採雙座式大堂設計，樓底挑高，在入伙當年屬於相當新穎而高貴的豪華設計賣點。雖然各住宅期數地底均設住客停車場，但住宅大樓之電梯並未能直達地庫停車場，住客需從後花園地面樓梯拾級而下。嘉湖山莊住宅單位與車位數量比例約7比1，車位可供自由買賣，現時除樂湖居外其餘期數停車場均不設時租。\\n嘉湖山莊各期樓宇圖則幾近相同，全部單位均設有鑽石形客飯廳和對流窗，優點為隱私度較高、景觀開揚、採光和通風效果優良；缺點則是難以擺放傢俬而且單位實用率稍低。本屋苑標準單位間隔分三大類，包括建築面積約820平方呎之三房大單位、建築面積約710平方呎之三房中單位和建築面積約580平方呎之二房細單位。每座最低樓層之A單位細房窗台採用內縮設計，故此批單位建築面積會比同座高樓層相同單位略小大約六平方呎。而無論各座樓宇高低樓層的大、中、小單位，客飯廳和廚廁面積均相約，各類別單位面積大小差異主要源於房間和廁所數量以及走廊長度。本屋苑各期均禁養狗隻。\\n特色單位方面，主要分為「相連單位」及「複式單位」。嘉湖山莊所有樓宇每組相鄰的兩個單位均可打通成相連單位，因為分隔兩個單位客廳之間的牆並不是主力牆，於較後期發售的期數，發展商已因應換樓需求提供一手出售的相連單位。無論新舊各期均有大量由小業主自行打通的相連單位，因區內大單位數目始終有限，這類單位可謂有價有市。另外，第五期及第七期每座頂層均有1,100百餘至1,700餘平方呎並附連天台的複式單位，名為「御景軒」，貨源稀罕，成交稀落。\\n嘉湖山莊各有兩間住客會所——嘉湖鄉村俱樂部及嘉湖會所，以及購物商場——嘉湖新北江商場及嘉湖銀座，並且設有一所五星級酒店暨服務式住宅──嘉湖海逸酒店。另外，天水圍公園位於整個嘉湖山莊的中央位置，佔地廣達200萬呎，比香港島的維多利亞公園更為遼闊。"},{"page_url":"https://es.wikipedia.org/wiki/Crep%C3%BAsculo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Redskyatnight.jpg","page_title":"Crepúsculo","context_page_description":"Se llama crepúsculo a cierto intervalo antes de la salida o después de la puesta del Sol, durante el cual el cielo se presenta iluminado. El crepúsculo se produce porque la luz del Sol ilumina las capas altas de la atmósfera. La luz se difunde en todas direcciones por las moléculas del aire, llega al observador e ilumina todo su entorno.\\nCrepúsculo matutino: ocurre antes de la salida del Sol y se llama también amanecer, aurora, alba, dilúculo, o lubricán.​\\nCrepúsculo vespertino: ocurre tras la puesta del Sol, también llamada atardecer, o arrebol."},{"page_url":"https://az.wikipedia.org/wiki/Fransa_q%C9%99srl%C9%99ri","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Fleckenstein.jpg","page_title":"Fransa qəsrləri","context_page_description":"Aşağı Reyn\\nAndlau •\\nBernstein •\\nBirkenfels •\\nFleckenstein •\\nFrankenbourg •\\nFrœnsbourg •\\nGrand-Geroldseck •\\nGreifenstein •\\nGuirbaden •\\nHaut-Barr or Hohbarr •\\nВерхний Кёнигсбург •\\nHerrenstein •\\nHohenbourg •\\nHohenfels •\\nHohenstein •\\nKintzheim •\\nLandsberg •\\nLichtenberg •\\nLœwenstein •\\nLutzelhardt •\\nNideck •\\nOchsenstein •\\nl’Ortenbourg •\\nPetit-Arnsberg •\\nPetite-Pierre •\\nPetit-Geroldseck •\\nRamstein •\\nRingelstein •\\nSalm •\\nSchœneck •\\nSpesbourg •\\nVieux-Windstein •\\nWangenbourg •\\nWasenburg •\\nWasigenstein •\\nWineck •\\nWittschloessel\\nYuxarı Reyn\\nAltkirch •\\nEchery •\\nFerrette •\\nGirsberg •\\nHaut-Ribeaupierre •\\nHohlandsbourg •\\nHugstein •\\nKaysersberg •\\nLandskron •\\nMorimont •\\nPflixbourg •\\nSaint-Ulrich •\\nWildenstein"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%BE%E5%B1%B1%E5%9F%8E%E3%83%AD%E3%83%BC%E3%83%97%E3%82%A6%E3%82%A7%E3%82%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Matsuyama_Catsle_Ropeway%2C_%E6%9D%BE%E5%B1%B1%E5%9F%8E_%E3%83%AD%E3%83%BC%E3%83%97%E3%82%A6%E3%82%A7%E3%82%A4_-_panoramio_%284%29.jpg","page_title":"松山城ロープウェイ","context_page_description":"松山城ロープウェイは、松山城への観光ルートを担う愛媛県松山市が所有する索道である。正式名称は松山城山ロープウエイ。\\n現在のゴンドラは5代目。かつては江戸時代の駕籠をモチーフにしたゴンドラで運行し、人気があった。"},{"page_url":"https://en.wikipedia.org/wiki/Rionansa","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Rionansa_%28Cantabria%29_Mapa.svg","page_title":"Rionansa","context_page_description":"Rionansa is a municipality located in the autonomous community of Cantabria, Spain."},{"page_url":"https://en.wikipedia.org/wiki/BT_tank","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Bt7a_1.jpg","page_title":"BT tank","context_page_description":"The BT tanks were a series of Soviet light tanks produced in large numbers between 1932 and 1941. They were lightly armoured, but reasonably well-armed for their time, and had the best mobility of all contemporary tanks. The BT tanks were known by the nickname Betka from the acronym, or its diminutive Betushka. The successor of the BT tanks was the famous T-34 medium tank, introduced in 1940, which would replace all of the Soviet fast tanks, infantry tanks, and medium tanks in service."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%83%D0%B3%D1%80%D0%BE%D0%B6%D0%B0%D0%B5%D0%BC%D1%8B%D1%85_%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2_%D1%80%D0%B0%D0%BA%D0%BE%D0%BE%D0%B1%D1%80%D0%B0%D0%B7%D0%BD%D1%8B%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Typhlocaris_ayyaloni_cropped.jpg","page_title":"Список угрожаемых видов ракообразных","context_page_description":"Список угрожаемых видов ракообразных содержит перечень видов членистоногих из классов высших раков, максиллопод, жаброногих и ракушковых рачков, объединяемых в подтип Crustacea, которым Международным союзом охраны природы и природных ресурсов присвоены охранные статусы «Уязвимый вид», «Вымирающий вид» либо «Вид на грани исчезновения». В настоящее время в Красный список угрожаемых видов МСОП занесено 732 редких и исчезающих вида и 21 подвид ракообразных, из них 413 видов — уязвимые, 179 видов — вымирающие и 140 видов — находящиеся на грани исчезновения. Ещё один вид равноногих рачков, Thermosphaeroma thermophilum, обитавший в геотермальном источнике на юго-западе Северной Америки, значится в данном списке как исчезнувший в дикой природе, а 11 видов — как уже полностью вымершие. Они также представлены в этом перечне."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D9%88%D8%A8%D8%B1%D8%AA_%D9%84%D9%8A%D9%88%D9%8A%D9%84%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Robert_Llewellyn_2004.jpg","page_title":"روبرت ليويلين","context_page_description":"روبرت ليويلين مخرج افلام من المملكه المتحده."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-Julien-l%C3%A8s-Gorze","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Eglise_St_Julien_Gorze.JPG","page_title":"Saint-Julien-lès-Gorze","context_page_description":"Saint-Julien-lès-Gorze is een gemeente in het Franse departement Meurthe-et-Moselle en telt 146 inwoners.\\nDe gemeente maakt deel uit van het arrondissement Briey en sinds 22 maart 2015 van het op die dag opgerichte kanton Jarny. Daarvoor hoorde het bij het kanton Chambley-Bussières, dat toen opgeheven werd."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%80_%D0%94%D0%BE%D0%B1%D1%80%D0%B8%D1%9B%D0%B5%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/%D0%9C%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%80_%D0%92%D0%B0%D0%B2%D0%B5%D0%B4%D0%B5%D1%9A%D0%B0_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D0%B5%2C_%D0%94%D0%BE%D0%B1%D1%80%D0%B8%D1%9B%D0%B5%D0%B2%D0%BE_%281%29.jpg","page_title":"Манастир Добрићево","context_page_description":"Манастир Добрићево је манастир Епархије захумско-херцеговачка и приморске Српске православне цркве који се налази у селу Орах, на 12 km од Билеће, општина Билећа. Манастир је саграђен у првој половини 13. вијека.\\nСтарешине манастира Добрићева били су: Воскресија Станојевић, Симеон Биберџић, Текла Даскалаки."},{"page_url":"https://es.wikipedia.org/wiki/Pont-Aven","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Blason_ville_fr_Pont-Aven_%28Finist%C3%A8re%29.svg","page_title":"Pont-Aven","context_page_description":"Pont-Aven es una población y comuna francesa, situada en la región de Bretaña, departamento de Finisterre, en el distrito de Quimper. Es el chef-lieu del cantón de su nombre. Pont-Aven es apodada \\"la ciudad de los pintores\\" debido a los numerosos pintores que han pasado por la localidad."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B0%D0%B3%D0%B0%D1%80%D0%B8%D0%BD,_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Gregor_Gagarin_by_Daffinger.jpg","page_title":"Гагарин, Григорий Григорьевич","context_page_description":"Князь Григо́рий Григо́рьевич Гага́рин — русский художник-любитель, иллюстратор, исследователь искусства, архитектор, обер-гофмейстер двора Его Императорского Величества, вице-президент Императорской Академии художеств, тайный советник."},{"page_url":"https://ceb.wikipedia.org/wiki/Forpus_modestus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/PsittaculaSclateriKeulemans.jpg","page_title":"Forpus modestus","context_page_description":"Espesye sa langgam nga una nga gihulagway ni Cabanis ni adtong 1848 ang Forpus modestus. Ang Forpus modestus sakop sa kahenera nga Forpus sa kabanay nga Psittacidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan."},{"page_url":"https://no.wikipedia.org/wiki/Fansipan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Fansipan_road.jpg","page_title":"Fansipan","context_page_description":"Fansipan er det høyeste fjellet i Vietnam på 3 143 meter over havet. Fjellet ligger i det nordvestre hjørnet av landet, nær grensen mot Laos og Kina, kun ni kilometer fra den gamle byen Sa Pa i provinsen Lao Cai.\\nDet er lettest å ta seg til fjellet med buss eller tog fra hovedstaden Hanoi."},{"page_url":"https://fr.wikipedia.org/wiki/Arsenal_de_Venise","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Arsenal_venice_bacini.png","page_title":"Arsenal de Venise","context_page_description":"L'arsenal de Venise, aussi appelé arsenal de la République Sérénissime, est construit en 1104 sur l'initiative du doge Ordelafo Faliero. Ce chantier naval joue un rôle déterminant dans la construction de l'empire vénitien en permettant la production rapide de nombreux navires. Ceint par 3 km de murailles crénelées de briques rouges, il emploie jusqu'à 16 000 personnes à son apogée et peut être considéré à la fois par sa taille, par son ancienneté ainsi que par l'ingéniosité de sa conception et de son fonctionnement comme l'un des premiers sites véritablement « industriels » apparus en Europe."},{"page_url":"https://fr.wikipedia.org/wiki/Archipel_de_Tavolara","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Scoglio_dei_Tre_Fratelli.jpg","page_title":"Archipel de Tavolara","context_page_description":"L'archipel de Tavolara est un groupe composé de trois îles principales et d'îlots et rochers, situé au large de la côte nord-est de la Sardaigne, au sud de l'archipel de La Maddalena."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%A5%E3%83%A1%E3%83%BC%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Stele_Naram_Sim_Louvre_Sb4.jpg","page_title":"シュメール","context_page_description":"シュメールは、メソポタミア南部を占めるバビロニアの南半分の地域、またはそこに興った最古の都市文明である。初期のメソポタミア文明とされ、チグリス川とユーフラテス川の間に栄えた。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D1%96%D1%81%D0%BA%D0%B0%D0%B2%D0%B5%D1%80%D0%B5%D1%80-18","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Thor_Agena_B_with_Discoverer_18_%28Dec_7%2C_1960%29_1.gif","page_title":"Діскаверер-18","context_page_description":"Діскаверер-18, інші назви КейЕйч-2 3, КейЕйч-2 9013, Корона 9013 — третій американський розвідувальний супутник серії КейЕйч-2, що запускались за програмою Корона. Перший супутник серії КейЕйч-2, що успішно виконав програму.\\nКосмічний апарат мав чорно-білу панорамну фотокамеру з низькою роздільною здатністю і спускну капсулу для повернення відзнятої плівки. Офіційно супутник виконував науково-дослідницький політ і мав випробувати технологію відокремлення капсули, проходження її крізь атмосферу, виловлювання в повітрі під час зниження.\\nАналіз шести блоків фотографічної емульсії виявив, що нижня межа внутрішнього радіаційного шару спускається до 290 км. Тому було вирішено для майбутніх польотів людини у космос використовувати орбіти з меншим нахилом, оскільки обмеження маси не дозволяло встановити захист від протонів."},{"page_url":"https://ceb.wikipedia.org/wiki/Karup_(lungsod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Karup_Kirke.jpg","page_title":"Karup (lungsod)","context_page_description":"Lungsod ang Karup sa Danismark. Nahimutang ni sa munisipyo sa Viborg Kommune ug rehiyon sa Region Midtjylland, sa sentro nga bahin sa nasod, 220 km sa kasadpan sa Copenhagen ang ulohan sa nasod. 39 metros ibabaw sa dagat kahaboga ang nahimutangan sa Karup, ug adunay 2,176 ka molupyo.\\nAng yuta palibot sa Karup kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 60 ka metro ug 2.1 km sa sidlakan sa Karup. Ang kinadul-ang mas dakong lungsod mao ang Ikast, 18.6 km sa habagatan sa Karup. Sa rehiyon palibot sa Karup, mga lasang talagsaon komon.\\nHapit nalukop sa lasang nga sagolsagol ang palibot sa Karup. Dunay mga 56 ka tawo kada kilometro kwadrado sa palibot sa Karup medyo hilabihan populasyon. Ang klima hemiboreal. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Enero, sa -4 °C."},{"page_url":"https://tl.wikipedia.org/wiki/Lalawigan_ng_Chieti","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Palazzo_del_Governo%2C_sede_della_Provincia_-2015.jpg","page_title":"Lalawigan ng Chieti","context_page_description":"Ang Lalawigan ng Chieti ay isang lalawigan sa rehiyon ng Abruzzo. Ang Lungsod ng Chieti ang kabisera ng lalawigang ito.\\nMay lawak itong 2,588 km², at 381,993 ang kabuuang populasyon noong 2001. Mayroon itong 104 na mga comune."},{"page_url":"https://es.wikipedia.org/wiki/Brizeaux","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Map_commune_FR_insee_code_55081.png","page_title":"Brizeaux","context_page_description":"Brizeaux es una población y comuna francesa, en la región de Lorena, departamento de Mosa, en el distrito de Bar-le-Duc y cantón de Seuil-d'Argonne."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Orte_im_Kreis_Cluj","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Harta_jud_Cluj.png","page_title":"Liste der Orte im Kreis Cluj","context_page_description":"Der Kreis Cluj in Rumänien besteht aus offiziell 435 Ortschaften. Davon haben 6 den Status einer Stadt, 75 den einer Gemeinde. Die übrigen sind administrativ den Städten und Gemeinden zugeordnet."},{"page_url":"https://sv.wikipedia.org/wiki/Richard_Reid","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Richard_Reid_explosive_shoe.jpg","page_title":"Richard Reid","context_page_description":"Richard Reid, även känd som \\"skobombaren\\", född 12 augusti 1973 i Bromley, London, är en brittisk medborgare som är dömd till livstids fängelse för terrorism. Han greps den 22 december 2001 sedan han försökt antända sprängmedel som fanns gömt i hans sko ombord på ett flygplan som gick från Paris till Miami. En flygvärdinna lyckades förhindra attentatet. 2003 dömdes han till livstids fängelse."},{"page_url":"https://de.wikipedia.org/wiki/Voigtl%C3%A4nder","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Ultramatic_CS_1966.jpg","page_title":"Voigtländer","context_page_description":"Voigtländer war ein bedeutendes Traditionsunternehmen der Fotoindustrie mit Gründungssitz in Braunschweig. Noch heute ist das Unternehmen eine Handelsmarke für hochwertige Festbrennweiten-Objektive.\\nSeit 2001 ist der Firmensitz in Fürth / Bayern."},{"page_url":"https://en.wikipedia.org/wiki/Thrillist","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Ben_Lerer%2C_Thrillist_%40_SXSW_2016.jpg","page_title":"Thrillist","context_page_description":"Thrillist is an online media website covering food, drink, travel and entertainment. The company was founded in 2004 and is based in New York City, United States. In October 2016, Thrillist merged with internet brands The Dodo, NowThis News, and Seeker to form the digital media holding company Group Nine Media."},{"page_url":"https://id.wikipedia.org/wiki/Taman_Organik_Zenxin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Zenxin_Organic_Park.jpg","page_title":"Taman Organik Zenxin","context_page_description":"Taman Organik Zenxin adalah sebuah taman organik di Distrik Kluang, Johor, Malaysia."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A2%D1%8A%D1%80%D0%BF%D0%B5%D0%B9%D1%86%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Trpeytsa-View-From-Galichitsa.jpg","page_title":"Търпейца","context_page_description":"Търпейца или Търпевица е село в Северна Македония с 358 жители."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Lohmen_(Sachsen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Wohnstallhaus_Am_Anger_12_Doberzeit.JPG","page_title":"Liste der Kulturdenkmale in Lohmen (Sachsen)","context_page_description":"In der Liste der Kulturdenkmale in Lohmen (Sachsen) sind sämtliche Kulturdenkmale der sächsischen Gemeinde Lohmen und ihrer Ortsteile im sächsischen Landkreis Sächsische Schweiz-Osterzgebirge verzeichnet. Die Gemeinde ist aufgegliedert in die Ortsteile Daube, Doberzeit, Lohmen, Mühlsdorf und Uttewalde. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Sächsische Schweiz-Osterzgebirge.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://kk.wikipedia.org/wiki/PGE_Arena","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/PGE_Arena.jpeg","page_title":"PGE Arena","context_page_description":"PGE Arena Gdańsk — Польшаның Гданьск қаласында орналасқан футбол стадионы. 2012 жылдың футболдан Еуропа чемпионатының матчтары өтетін ареналарының бірі. Стадионның сыйымдылығы шамамен 44 мың көрерменді құрайды."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B5%D1%81%D1%87%D1%8F%D0%BD,_%D0%90%D1%80%D1%82%D1%83%D1%80_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/%D0%9A%D0%BE%D0%BC%D0%B8%D1%82%D0%B0%D1%81_8.jpg","page_title":"Месчян, Артур Степанович","context_page_description":"Артур Степанович Месчян — армянский архитектор, музыкант, композитор, рок-музыкант, поэт, певец, художник. Основатель и лидер группы «Аракялнер». Награждён Орденом Святого Месропа Маштоца в 2011 году. В 2018 году назначен главным архитектором Еревана."},{"page_url":"https://be.wikipedia.org/wiki/%D0%AD%D1%9E%D1%80_(%D0%BC%D1%96%D1%84%D0%B0%D0%BB%D0%BE%D0%B3%D1%96%D1%8F)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/VarsaviaPalazzo4VentiVento3.jpg","page_title":"Эўр (міфалогія)","context_page_description":"Эўр — у старажытнагрэчаскай міфалогіі — ранішні вецер, брат Барэя, Зефіра і Нота, спачатку ўсходні, пасля паўднёва-ўсходні вецер, што дзьме падчас зімовага павароту сонца. Эўр, разам з Нотам і Зефірам часта выклікае буры, наносячы шкоду караблям\\nАпісанне бур у антычнай літаратуры часта выкарыстоўвае матыў барацьбы Эўра з іншымі вятрамі, напрыклад. У Вергілія замест сучаснай метафары «хутчэй вятры», часта выкарыстоўваецца «хутчэй за Эўра»\\nЮвенал перадае падданне пра тое, што цар Ксеркс I пасля паражэння пры Саламіне загадаў высекчы Эўра"},{"page_url":"https://sv.wikipedia.org/wiki/Lanrodec","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/Map_commune_FR_insee_code_22116.png","page_title":"Lanrodec","context_page_description":"Lanrodec är en kommun i departementet Côtes-d'Armor i regionen Bretagne i nordvästra Frankrike. Kommunen ligger i kantonen Plouagat som tillhör arrondissementet Guingamp. År 2009 hade Lanrodec 1 115 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Kanj%C5%ABr%C5%8D_Arashi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Kanj%C5%ABr%C5%8D_Arashi.jpg","page_title":"Kanjūrō Arashi","context_page_description":"Kanjūrō Arashi was a Japanese film actor. He entered the film industry in 1927 and came to fame playing Kurama Tengu, a character in the Bakumatsu era created by Jirō Osaragi in his novels. In the 1950s he portrayed the Emperor Meiji in several hit films and appeared in yakuza films in the 1960s. His nickname was \\"Arakan.\\""},{"page_url":"https://pl.wikipedia.org/wiki/Misje_dyplomatyczne_Japonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Embassy_of_Japan%2C_Washington%2C_D.C..jpg","page_title":"Misje dyplomatyczne Japonii","context_page_description":"Misje dyplomatyczne Japonii – przedstawicielstwa dyplomatyczne Państwa Japonia przy innych państwach i organizacjach międzynarodowych. Poniższa lista zawiera wykaz obecnych ambasad i konsulatów zawodowych. Nie uwzględniono konsulatów honorowych."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Navailles-Angos","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Map_commune_FR_insee_code_64415.png","page_title":"Navailles-Angos","context_page_description":"Navailles-Angos sī ūi-tī Hoat-kok Aquitaine toā-khu Pyrénées-Atlantiques koān ê chi̍t ê commune."},{"page_url":"https://it.wikipedia.org/wiki/Giochi_della_XIV_Olimpiade","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Medal_of_olympic_summer_games_1948.png","page_title":"Giochi della XIV Olimpiade","context_page_description":"I Giochi della XIV Olimpiade, noti anche come Londra 1948, si svolsero a Londra, capitale del Regno Unito, dal 29 luglio al 14 agosto 1948.\\nEssi furono i primi giochi olimpici a essere disputati dopo una sosta durata 12 anni a causa della seconda guerra mondiale: i Giochi della XII Olimpiade, inizialmente assegnati a Tokyo e poi riassegnati a Helsinki, e i Giochi della XIII Olimpiade, assegnati alla stessa Londra, erano stati cancellati.\\nLondra tornò a organizzare le Olimpiadi quarant'anni dopo i Giochi del 1908, diventando la seconda città dopo Parigi a ospitare due edizioni del Giochi."},{"page_url":"https://cs.wikipedia.org/wiki/Zden%C4%9Bk_Kolovrat-Krakovsk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Zdenek_Kolovrat_Krakovsky_death_record.jpg","page_title":"Zdeněk Kolovrat-Krakovský","context_page_description":"Zdeněk Kolovrat-Krakovský, v německých zdrojích uváděný jako Zdenko von Kollowrat-Krakowsky, byl český velkostatkář, dramatik, historik a politik z rodu Kolowrat Krakowský Liebsteinský. V letech 1870-75 psal divadelní hry, které byly uváděny mj. v Prozatímním divadle, a účastnil se činnosti archeologického sboru Národního muzea. Po smrti otce v roce 1875 převzal rodový majetek v Rychnově nad Kněžnou a Černíkovicích a většinu času věnoval jeho správě. Roku 1883 byl zvolen poslancem českého zemského sněmu za Stranu konzervativního velkostatku a potvrzen byl i ve volbách v roce 1889. Roku 1884 byl jmenován dědičným členem Panské sněmovny. Byl oceňován jako vzdělaný vlastenecký šlechtic a spisovatel."},{"page_url":"https://it.wikipedia.org/wiki/Cappella_dell%27Immacolata_Concezione_(Gaeta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Gaeta%2C_Cappella_d%27Oro_-_Portale.jpg","page_title":"Cappella dell'Immacolata Concezione (Gaeta)","context_page_description":"La cappella dell'Immacolata Concezione, anche detta \\"Cappella d'Oro\\" o \\"Grotta d'Oro\\" per la sua ricca decorazione interna lignea con rifiniture in oro zecchino, è un importante luogo di culto cattolico di Gaeta, situato nel centro storico della città, in via dell'Annunziata, all'interno dello Stabilimento dell'Annunziata."},{"page_url":"https://id.wikipedia.org/wiki/Pertanian","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Hubbert_peak_oil_plot.svg","page_title":"Pertanian","context_page_description":"Pertanian adalah kegiatan pemanfaatan sumber daya hayati yang dilakukan manusia untuk menghasilkan bahan pangan, bahan baku industri, atau sumber energi, serta untuk mengelola lingkungan hidupnya. Kegiatan pemanfaatan sumber daya hayati yang termasuk dalam pertanian biasa dipahami orang sebagai budidaya tanaman atau bercocok tanam serta pembesaran hewan ternak, meskipun cakupannya dapat pula berupa pemanfaatan mikroorganisme dan bioenzim dalam pengolahan produk lanjutan, seperti pembuatan keju dan tempe, atau sekadar ekstraksi semata, seperti penangkapan ikan atau eksploitasi hutan.\\nBagian terbesar penduduk dunia bermata pencaharian dalam bidang-bidang di lingkup pertanian, namun pertanian hanya menyumbang 4% dari PDB dunia. Sejarah Indonesia sejak masa kolonial sampai sekarang tidak dapat dipisahkan dari sektor pertanian dan perkebunan, karena sektor - sektor ini memiliki arti yang sangat penting dalam menentukan pembentukan berbagai realitas ekonomi dan sosial masyarakat di berbagai wilayah Indonesia."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%B8%D6%80%D5%A5%D5%A1%D5%AF%D5%A1%D5%B6_%D5%B6%D5%A5%D5%B2%D5%B8%D6%82%D6%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Korea_Strait.png","page_title":"Կորեական նեղուց","context_page_description":"Կորեական նեղուց, Կորեական թերակղզու և ճապոնական Իկի, Կյուսյու, Հոնսյու կղզիների միջև։ Միացնում է Ճապոնական և Արևելա-Չինական ծովերը։ Լայնությունը 180 կմ է, նվազագույն խորությունը՝ 115 մ։\\nՑուսիմայի կղզիներով բաժանվում է Արևելյան և Արևմտյան անցումների, Ռուս-ճապոնական պատերազմի ժամանակ Կորեական նեղուցում տեղի է ունեցել ռուս և ճապոնական հածանավային էսկադրաների խոշոր ծովամարտ ։"},{"page_url":"https://sv.wikipedia.org/wiki/Avatha_bipartita","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Avatha_bipartita_%2820575680621%29.jpg","page_title":"Avatha bipartita","context_page_description":"Avatha bipartita är en fjärilsart som beskrevs av Alfred Ernest Wileman 1915. Avatha bipartita ingår i släktet Avatha och familjen nattflyn. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/El_azar_y_la_necesidad","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/James_D_Watson.jpg","page_title":"El azar y la necesidad","context_page_description":"El azar y la necesidad es un ensayo del biólogo Jacques Monod publicado por primera vez en Francia en 1970, elaborado a partir de una serie de conferencias que el autor había pronunciado en febrero de 1969 en el Pomona College de Claremont y que, a su vez, habían sido el tema principal de un curso en el Collège de France entre 1969 y 1970.\\nEl título está inspirado en una cita atribuida a Demócrito, según la cual «todo cuanto existe es fruto del azar y la necesidad».\\nSe conoce una traducción al español, realizada por Francisco Ferrer Lerín y publicada por Barral Editores en 1971."},{"page_url":"https://vi.wikipedia.org/wiki/Ch%E1%BB%A3_Gi%C3%A1ng_sinh","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/ChristkindlmarketChicago.jpg","page_title":"Chợ Giáng sinh","context_page_description":"Chợ Giáng sinh là một chợ đường phố kiểu truyền thống được tổ chức vào dịp Giáng sinh, thường bắt đầu khoảng 1 tháng trước Lễ Giáng sinh và kéo dài đến ngày 23 tháng 12. Phong tục này có nguồn gốc tại vùng đất ngày nay là nước Đức và Đông Bắc nước Pháp và bắt đầu xuất hiện từ cuối thời Thời kỳ Trung Cổ, cho đến nay chợ Giáng sinh vẫn là nét văn hóa truyền thống đặc sắc của Đức, Áo và Đông Bắc Pháp trong dịp Giáng sinh cũng như được phổ biến đến nhiều quốc gia khác trên thế giới."},{"page_url":"https://ro.wikipedia.org/wiki/Hidraulic%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Hydraulics_and_other_studies_%28en%29.svg","page_title":"Hidraulică","context_page_description":"Hidraulica este știința care se ocupă cu studiul legilor de echilibru și de mișcare ale lichidelor - în particular a apei - din punctul de vedere al aplicațiilor tehnice.\\nDin aceasta definiție rezultă dublul caracter al studiilor și cercetărilor care se efectuează în domeniul hidraulicii: caracterul fundamental, în sensul că primul obiectiv îl constituie stabilirea legilor de bază, a modelelor teoretice și a relațiilor de calcul privind mișcarea și repausul fluidelor și caracterul aplicativ, în sensul că al doilea obiectiv, cel final, îl constituie aplicarea acestor legi, modele și relații de calcul la rezolvarea problemelor inginerești. Având în vedere acest ultim obiectiv, hidraulica este o disciplină tehnică, în sensul că problemele privind repausul și mișcarea fluidelor, precum și acțiunea fluidelor asupra corpurilor, sunt rezolvate de pe poziții tehnice, în limitele unor aproximații acceptate în tehnică.\\nSuportul teoretic al hidraulicii este dat de mecanica fluidelor.\\nPrincipalele aplicații ale hidraulicii se referă la curgerea în conducte, curgerea prin orificii, curgerea peste deversoare și baraje și curgerea lichidelor în jurul profilelor hidrodinamice."},{"page_url":"https://fr.wikipedia.org/wiki/Province_ottomane_d%27%C3%89gypte","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Shop_of_a_Turkish_Merchant_in_the_Soo%27ck_called_Kha%27n_El-Khalee%27lee._%281836%29_-_TIMEA.jpg","page_title":"Province ottomane d'Égypte","context_page_description":"La Province d'Égypte était une province de l'Empire ottoman. Conquise par Sélim Iᵉʳ en 1517, l’Égypte ottomane tient une place importante dans la stratégie et l'économie de l'Empire malgré les mutineries répétées des garnisons turques et des mamelouks, anciens maîtres du pays qui occupent encore une place importante dans le gouvernement local. Au XVIIIᵉ siècle, l'affaiblissement de l'autorité ottomane permet aux mamelouks de reprendre temporairement le pouvoir mais ils sont battus par les Français de Bonaparte lors de l'expédition d'Égypte. Au XIXᵉ siècle, l'Égypte redevient autonome puis quasiment indépendante, bien que nominalement vassale du sultan ottoman, sous la dynastie de Méhémet Ali."},{"page_url":"https://nl.wikipedia.org/wiki/San_Miguel_County_(New_Mexico)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/San_Miguel_County_New_Mexico_Court_House.jpg","page_title":"San Miguel County (New Mexico)","context_page_description":"San Miguel County is een county in de Amerikaanse staat New Mexico.\\nDe county heeft een landoppervlakte van 12.217 km² en telt 30.126 inwoners. De hoofdplaats is Las Vegas."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_de_Tormaleo","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Palacio_de_Tormaleo-Escudo.jpg","page_title":"Palacio de Tormaleo","context_page_description":"El palacio de Tormaleo, situado en el concejo de Ibias, es un palacio rural edificado en el siglo XVIII a partir de un núcleo anterior que sería la torre y la crujía oeste."},{"page_url":"https://en.wikipedia.org/wiki/Elk_(sculpture)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/08267-Portland%2C_Ore.-1906-Thompson_Fountain_and_County_Court_house-Br%C3%BCck_%26_Sohn_Kunstverlag.jpg","page_title":"Elk (sculpture)","context_page_description":"Elk, also known as the David P. Thompson Fountain, David P. Thompson Monument, Elk Fountain, or the Thompson Elk, was a historic outdoor fountain and bronze sculpture by American artist Roland Hinton Perry. The statue was donated to the city of Portland, Oregon, United States, in 1900 for display in Downtown Portland's Plaza Blocks. It is owned by Regional Arts & Culture Council. The monument became a gathering place for demonstrations by George Floyd protesters, who lit several fires in the troughs along the base in July 2020. The undamaged bronze elk statue was removed for cleaning and safekeeping on July 2, 2020. The stone fountain was removed on July 17, 2020 after RACC determined there was severe damage to the stone and basin of the fountain."},{"page_url":"https://en.wikipedia.org/wiki/Aerial_bomb","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/F-100D_308TFS_31TFW_TuyHoa_1966.jpg","page_title":"Aerial bomb","context_page_description":"An aerial bomb is a type of explosive or incendiary weapon intended to travel through the air on a predictable trajectory, usually designed to be dropped from an aircraft. Aerial bombs include a vast range and complexity of designs, from unguided gravity bombs to guided bombs, hand tossed from a vehicle, to needing a large specially built delivery vehicle; or perhaps be the vehicle itself such as a glide bomb, instant detonation or delay-action bomb. The act is termed aerial bombing. As with other types of explosive weapons, aerial bombs are designed to kill and injure people and destroy materiel through the projection of blast and fragmentation outwards from the point of detonation."},{"page_url":"https://sv.wikipedia.org/wiki/Angraecum_didieri","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Angraecum_didieri_Orchi_015.jpg","page_title":"Angraecum didieri","context_page_description":"Angraecum didieri är en orkidéart som först beskrevs av Henri Ernest Baillon och Achille Eugène Finet, och fick sitt nu gällande namn av Rudolf Schlechter. Angraecum didieri ingår i släktet Angraecum och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pt.wikipedia.org/wiki/Constantino_Constantinovich_da_R%C3%BAssia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Konsztantyin_Konsztantyinovics_id.jpg","page_title":"Constantino Constantinovich da Rússia","context_page_description":"Constantino Constantinovich da Rússia, foi um neto do czar Nicolau I da Rússia, poeta e dramaturgo de algum renome. Era mais conhecido pelo nome com que assinava as suas obras, “KR”, derivado das iniciais do seu nome e apelido em russo, Konstantín Romanov."},{"page_url":"https://fr.wikipedia.org/wiki/Kan%C5%8D_Motonobu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Painting_on_Zen_Enlightenment_%28Sanping_baring_his_chest_and_Shigong_stretching_his_bow%29%2C_attributed_to_Kano_Motonobu%2C_v2%2CMuromachi_period%2C_16th_century%2C_panel_from_Daisen-in_temple_-_Tokyo_National_Museum_-_DSC05824.JPG","page_title":"Kanō Motonobu","context_page_description":"Kanō Motonobu, nom familier: Shirojirō, nom de pinceau: Eisen, Gyokusen, né le 26 août 1476, mort le 5 novembre 1559. Peintre japonais."},{"page_url":"https://cs.wikipedia.org/wiki/Suka","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Porchsukka.jpg","page_title":"Suka","context_page_description":"Suka je dočasné obydlí, které židé používají během svátku Sukot. Společně se čtyřmi druhy se jedná o nejdůležitější a nedílnou součást tohoto svátku. Zákony o stavbě suky a o dodržování svátku Sukot obsahuje traktát Suka v Mišně a v Talmudu. V Bibli je suka zmíněna v Leviticu:\\nPodle přikázání Tóry musí všichni nábožensky plnoletí muži v suce sedět nebo pobývat. Na ženy a dívky se tato povinnost nevztahuje, ale pokud chtějí, tak mohou také v suce pobývat. Zbožní židé v suce nejen jedí, ale po dobu trvání svátku také spí. Nemocní, lidé na cestách, ženy a nezletilí jsou z plnění této micvy vyňati, i když ženy a nezletílí se běžně přidávají k mužům."},{"page_url":"https://qu.wikipedia.org/wiki/Amariti","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Athun_Ayllu_Amarete.jpeg","page_title":"Amariti","context_page_description":"Amariti nisqaqa Buliwya mama llaqtapi huk llaqtam, Chuqiyapu suyupi, Bautista Saavedra pruwinsyapi, Charasani munisipyupi."},{"page_url":"https://nl.wikipedia.org/wiki/Heilige_Apostel_Andreaskerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Pravoslavye_Gent.jpg","page_title":"Heilige Apostel Andreaskerk","context_page_description":"De Heilige Apostel Andreaskerk is een kerkgebouw in de Belgische stad Gent. De kerk is bestemd voor erediensten van orthodoxen en toegewijd aan apostel Andreas."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_svenska_bevarade_milit%C3%A4ra_luftfarkoster","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Fiat_CR42_%28J-11%29_2543_%288038993776%29.jpg","page_title":"Lista över svenska bevarade militära luftfarkoster","context_page_description":"Här listas flygplan och helikoptrar, som varit eller är i tjänst inom det svenska försvaret och som finns bevarade på olika platser i världen."},{"page_url":"https://az.wikipedia.org/wiki/Yakut_%C3%BCsyan%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Analolij_Piepielajew.jpg","page_title":"Yakut üsyanı","context_page_description":"Yakut üsyanı — Rusiya Vətəndaş müharibəsinin son epizodu sayılır. Hərbi əməliyyatlar 1921-ci ilin sentyabr ayından 1923-cü ilin iyun ayına qədər davam edib və hadisələr Uzaq Şərq vilayətinin Ayano-Mayski rayonunda baş verib."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B5%D0%BA%D0%BB%D0%B0%D1%80%D0%B0%D1%86%D1%96%D1%8F_%D0%BD%D0%B5%D0%B7%D0%B0%D0%BB%D0%B5%D0%B6%D0%BD%D0%BE%D1%81%D1%82%D1%96_%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/M%C9%99h%C9%99mm%C9%99d_M%C9%99h%C9%99rr%C9%99mov.jpg","page_title":"Декларація незалежності Азербайджану","context_page_description":"Декларація незалежності, або Акт про незалежність Азербайджану — документ, складений та підписаний Національною Радою Азербайджану 28 травня 1918 року в Тифлісі, в якому проголошено незалежність Азербайджанської Демократичної Республіки.\\nАзербайджанська Демократична Республіка проіснувала всього 23 місяці і впала в квітні 1920 року внаслідок радянізації країни. Утворена на її місці Азербайджанська РСР незабаром увійшла до складу Радянського Союзу. Вже після розпаду СРСР, 18 жовтня 1991 року Верховна Рада Азербайджанської Республіки, спираючись на Декларацію незалежності 1918 року, прийняла Конституційний акт «Про Державну незалежність Азербайджанської Республіки».\\nОригінальний рукопис Декларації незалежності, складений азербайджанською мовою, зберігається в Державному архіві Азербайджанської Республіки, оригінальні копії азербайджанською і французькою мовами — в Музеї історії Азербайджану Національної академії наук Азербайджану в Баку. День прийняття Декларації — 28 травня — святкується в Азербайджані як національне свято або День Республіки і є неробочим днем."},{"page_url":"https://ca.wikipedia.org/wiki/Museu_Nacional_(Rio_de_Janeiro)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Museu_de_Zoologia_da_USP_02.jpg","page_title":"Museu Nacional (Rio de Janeiro)","context_page_description":"El Museu Nacional, vinculat a la Universitat Federal de Rio de Janeiro, era la institució científica més antiga de Brasil i, fins a mitjans de 2018, va ser un dels museus més grans d'història natural i antropologia d'Amèrica. Es trobava dins del parc de Quinta da Boa Vista, a la ciutat de Rio de Janeiro, instal·lat al Paço de São Cristóvão. El palau va servir de residència per a la Família Reial portuguesa des de 1808 fins a 1821, va albergar la Família Imperial brasilera de 1822 a 1889, i va allotjar la primera Assemblea Constituent Republicana de 1889 a 1891, abans de passar a allotjar el museu des de 1892. L'edifici va ser declarat Patrimoni Nacional del Brasil per l'Instituto do Patrimônio Histórico e Artístico Nacional el 1938.\\nEl rei João VI va fundar el museu el 6 de juny de 1818. La institució estava al parc Campo de Santana, i presentava col·leccions provinents tant de la Casa dos Pássaros, l'antiga casa d'història natural creada l'any 1784 per Luís de Vasconcelos e Sousa, virrei del Brasil, així com col·leccions de mineralogia i zoologia."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B6%D5%A5%D5%B6%D5%B8%D5%B6_%D5%8A%D5%A5%D5%BF%D5%AF%D6%87%D5%AB%D5%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Zenon_Pietkiewicz.jpg","page_title":"Զենոն Պետկևիչ","context_page_description":"Զենոն Պետկևիչ, լեհ գրող, լրագրող, հրապարակախոս, ազգագրագետ:"},{"page_url":"https://de.wikipedia.org/wiki/Musikjahr_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Cooleridge_Goode.jpg","page_title":"Musikjahr 2015","context_page_description":"Dieser Artikel behandelt das Musikjahr 2015.\\nKommerziell erfolgreichster Künstler ist in Deutschland wie bereits im Vorjahr die Schlagersängerin Helene Fischer, die das Weihnachtsgeschäft mit ihrem Doppelalbum Weihnachten dominierte und damit die international erfolgreichste Sängerin Adele auf den zweiten Platz verdrängte. Ebenfalls sehr erfolgreich war Sarah Connors Album Muttersprache.\\nDas Musikjahr 2015 wurde überschattet durch zwei große Katastrophen gegen Jahresende. Am 30. Oktober kam es bei einem Konzert der Metalcore-Band Goodbye to Gravity im Nachtclub Colectiv in Bukarest zu einem Brandunglück und einer Massenpanik. 60 Menschen starben und etwa 180 wurden teilweise schwer verletzt. Am 13. November war ein Konzert der Eagles of Death Metal im Pariser Club Bataclan eines der Ziele der Terroranschläge am 13. November 2015 in Paris. 89 Konzertbesucher starben, weitere hunderte Menschen wurden teilweise schwer verletzt.\\nIm Jahr 2015 verstarben einige musikalische Legenden, so die beiden Blues-Musiker Ben E. King und B. B. King, der Soul-Sänger Percy Sledge und Rocksänger Lemmy Kilmister von der Gruppe Motörhead."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%87%E0%AE%B7%E0%AF%8D%E0%AE%A4%E0%AE%B0%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Seal_of_Inanna%2C_2350-2150_BCE.jpg","page_title":"இஷ்தர்","context_page_description":"இன்னன்னா அல்லது இஷ்தர் Inanna or Ishtar மெசொப்பொத்தேமியாவின் பண்டைய சுமேரியப் பெண் கடவுள் ஆவார். புது பாபிலோனியப் பேரரசில் இப்பெண் கடவுளை பின்னர் இஷ்தர் என அழைத்தனர். அன்பு, காதல், அழகு, செழிப்பு, போர் மற்றும் வீரத்திற்கு இப்பெண் கடவுளே அதிபதி ஆவார். எஸ்தர் எனும் பெண் கடவுளுக்கு நிகராக இந்து சமயத்தில் துர்கையும், பண்டைய கிரேக்கத்தில் அப்ரோடிட்டும் குறிக்கப்படுகிறது.\\nசுமேரியர்கள் இன்னன்னா எனும் பெயரில் வணங்கிய எஸ்தர் எனும் இப்பெண் கடவுளை, சுமேரியர்களுக்குப் பின்னர் மெசொப்பொத்தேமியாவை ஆண்ட அக்காடியர்களும், பாபிலோனியர்களும், அசிரியர்களும், இஷ்தர் தெய்வத்திற்கு கோயில்கள் கட்டி வழிபட்டனர்.\\nஎஸ்தர் எனும் பெண் கடவுள் சொர்க்கத்தின் அரசி என அழைக்கப்பட்டார். பண்டைய உரூக் நகரத்தில் எஸ்தர் வழிபாடு சிறப்புடன் விளங்கியது. எஸ்தர் கடவுள், வெள்ளி கோளுடன் தொடர்புறுத்தப்படுகிறார்.\\nஎஸ்தர் கடவுளின் சின்னங்களாக சிங்கம், எட்டு முனை நட்சத்திரம், சிங்கம் அறியப்படுகிறது. பெண் கடவுளான எஸ்தரின் கணவராக தம்முசும், மெய்காவலராக சுக்கலும் அறியப்படுகிறார்கள். மேலும் எஸ்தர் பெண் கடவுள் சொர்க்கத்தின் அரசி என்றும் நள்ளிரவின் இராணி என்றும் அறியப்படுகிறார்.\\nகிமு 4000 முதல் கிமு 3100 முடிய சுமேரியாவின் உரூக் நகரத்தில் இஷ்தர் தெய்வத்தை இன்னன்னா எனும் பெயரில் வணங்கினர்."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%81%93%E3%81%AE%E9%A7%85%E5%AF%8C%E5%A3%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/R001s-2020-082.jpg","page_title":"道の駅富士","context_page_description":"道の駅富士は、静岡県富士市にある国道1号の道の駅である。"},{"page_url":"https://en.wikipedia.org/wiki/Chamaita_ranruna","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Chamaita_ranruna.jpg","page_title":"Chamaita ranruna","context_page_description":"Chamaita ranruna is a moth of the subfamily Arctiinae first described by Shōnen Matsumura in 1927. It is found in China, Taiwan, Borneo and Japan.\\nThe wingspan is 20–25 mm. Adults are on wing in May."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%87%D9%8A%D8%AC%D9%88_%D9%88%D9%8A%D8%A8%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Bundesarchiv_Bild_183-1988-0827-012%2C_FC_Carl_Zeiss_Jena_-_FC_Hansa_Rostock_2-0.jpg","page_title":"هيجو ويبر","context_page_description":"هيجو ويبر ‏ هو مدرب كرة قدم ولاعب كرة قدم ألماني في مركز الهجوم. لعب مع كارل زايس يينا وZFC Meuselwitz ونادي بروسيا مونستر وSV Stahl Thale."},{"page_url":"https://hu.wikipedia.org/wiki/K%C3%B6z%C3%B6ns%C3%A9ges_mak%C3%A1k%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/MonkeyForestMotherAndChild.jpg","page_title":"Közönséges makákó","context_page_description":"A közönséges makákó vagy jávai makákó a makákók leggyakoribb, legnagyobb területen elterjedt faja, aminek a változatos élőhelyeken számos földrajzi változata alakult ki."},{"page_url":"https://pl.wikipedia.org/wiki/Suczawa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Scoala_nr._5_din_Burdujeni3.jpg","page_title":"Suczawa","context_page_description":"Suczawa – miasto w historycznej Mołdawii w Rumunii, stolica okręgu Suczawa oraz Bukowiny rumuńskiej.\\nWedług danych z 2002 w Suczawie mieszka 252 Polaków. Suczawa jest siedzibą Związku Polaków w Rumunii.\\nW pobliżu miasta znajduje się Dragomirna."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BF%A1%E7%BE%A9%E5%8D%80%E8%BC%95%E8%BB%8C%E6%8D%B7%E9%81%8B%E7%B3%BB%E7%B5%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Song_ren_Road%2C_Taipei.JPG","page_title":"信義區輕軌捷運系統","context_page_description":"信義區輕軌捷運系統，簡稱信義輕軌，又名新都心捷運線，原為預定建於臺北市信義區之磁懸浮自動旅客捷運系統，但興建計畫已遭否決。此線與臺北捷運其他路線不同，並非由臺北市政府官方單位營運、規劃，而是由民營的艾思博捷運股份有限公司提出。2004年送臺北市政府初審時規劃採用中運量膠輪路軌系統，2006年再次送審時改採用與日本愛知縣「東部丘陵線」相同的HSST磁懸浮系統。"},{"page_url":"https://cs.wikipedia.org/wiki/Obora_(okres_Tachov)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Obora_%28Tachov_District%29_Flag.jpg","page_title":"Obora (okres Tachov)","context_page_description":"Obora je obec nalézající se asi 6 km západně od okresního města Tachov. Obec je v průměrné nadmořské výšce okolo 620 metrů v pohoří Český les. Žije zde 156 obyvatel."},{"page_url":"https://de.wikipedia.org/wiki/Clementinenhaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Clementinenhaus_Hannover_Eingang_nachts.jpg","page_title":"Clementinenhaus","context_page_description":"Das DRK-Krankenhaus Clementinenhaus ist ein 195-Betten-Haus der Grund- und Regelversorgung im Stadtteil List der Landeshauptstadt Hannover. Träger ist eine Stiftung des bürgerlichen Rechts."},{"page_url":"https://eo.wikipedia.org/wiki/Striviza%C4%9Da_buntpego","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Downy_Woodpecker01.jpg","page_title":"Strivizaĝa buntpego","context_page_description":"La Strivizaĝa buntpego, Picoides pubescens, estas birdo de la genro Picoides kaj malgranda memrbo de la grupo de buntpegoj, tio estas pego, kie ĉefas la koloroj nigra supre kaj blanka sube, sed ankaŭ aliaj en markoj supre. Krome ĝi estas la plej malgranda pego en Nordameriko."},{"page_url":"https://en.wikipedia.org/wiki/Fort_Lauderdale,_Florida","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Race_and_ethnicity_2010-_Fort_Lauderdale_%285560418288%29.png","page_title":"Fort Lauderdale, Florida","context_page_description":"Fort Lauderdale is a city in the U.S. state of Florida, 25 miles north of Miami. It is the county seat of Broward County. As of the 2019 census, the city has an estimated population of 182,437. Fort Lauderdale is a principal city of the Miami metropolitan area, which was home to an estimated 6,198,782 people in 2018.\\nThe city is a popular tourist destination, with an average year-round temperature of 75.5 °F and 3,000 hours of sunshine per year. Greater Fort Lauderdale, encompassing all of Broward County, hosted 13 million overnight visitors in 2018. There were over 560 hotels, and nearly 36,000 hotel rooms. From that, the county collected nearly $87 million from its 5% hotel development tax it charges. Additionally, 3.89 million cruise passengers passed through its Port Everglades, making it the 3rd largest cruise port in the world. Greater Fort Lauderdale has over 4,000 restaurants, 63 golf courses, 12 shopping malls, 16 museums, 132 nightclubs, 278 parkland campsites, and 100 marinas housing 45,000 resident yachts.\\nFort Lauderdale is named after a series of forts built by the United States during the Second Seminole War."},{"page_url":"https://en.wikipedia.org/wiki/Outline_of_Italy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Alboreto_1985-08-02.jpg","page_title":"Outline of Italy","context_page_description":"The following outline is provided as an overview of and topical guide to Italy:\\nItaly is a unitary parliamentary republic in South-Central Europe, located primarily upon the Italian Peninsula. It is where Ancient Rome originated as a small agricultural community about the 8th century BC, which spread over the course of centuries into the colossal Roman empire, encompassing the whole Mediterranean Sea and merging the Ancient Greek and Roman cultures into one civilization. This civilization was so influential that parts of it survive in modern law, administration, philosophy and arts, providing the groundwork that the Western world is based upon."},{"page_url":"https://sk.wikipedia.org/wiki/B%C3%B4rik_(ulica)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/B%C3%B4rik_03.jpg","page_title":"Bôrik (ulica)","context_page_description":"Bôrik je ulica v Bratislave, v mestskej časti Staré Mesto. Je kolmá na Údolnú ulicu."},{"page_url":"https://ca.wikipedia.org/wiki/Parc_Natural_de_Somiedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Kopf_eines_Rehs_%28Capreolus_capreolus%29.jpg","page_title":"Parc Natural de Somiedo","context_page_description":"Amb 39.164 hectàrees, el Parc Natural de Somiedo es troba a l'àrea central de la Serralada Cantàbrica. Correspon geogràficament al municipi de Somiedo que queda completament a l'interior del parc i als municipis de Belmonte i Teberga, a Astúries.\\nTé les següents figures de protecció:\\nParc natural declarat el 1988\\nLloc d'importància comunitària de Somiedo\\nZona d'especial protecció per les aus de Somiedo\\nDeclarat Reserva de la Biosfera de Somiedo per la Unesco l'any 2000"},{"page_url":"https://hu.wikipedia.org/wiki/Magyarorsz%C3%A1g_legnagyobb_telep%C3%BCl%C3%A9sei_lak%C3%B3n%C3%A9pess%C3%A9g_szerint","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Szombathely_Montage.jpg","page_title":"Magyarország legnagyobb települései lakónépesség szerint","context_page_description":"Az alábbi lista Magyarország 50 legnagyobb lakónépességű településeit sorolja fel a 2011. évi népszámlálás és a KSH 2019. évi becsült adatai szerint. Ez a lista az egyes települések lakosságszámára, területére és népsűrűségére vonatkozik, a meghatározott településhatárokon belül."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B9%84%EB%A1%9C%EB%B9%84%ED%8B%B0%EC%B0%A8%ED%8F%AC%EB%93%9C%EB%9D%BC%EB%B9%84%EB%82%98%EC%A3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/CroatiaVirovitica-Podravina.png","page_title":"비로비티차포드라비나주","context_page_description":"비로비티차포드라비나 주는 크로아티아 슬라보니아 지방 북부에 위치한 주로 주도는 비로비티차이며 면적은 2,021km², 인구는 93,389명, 인구 밀도는 46.2명/km²이다.\\n북쪽으로는 헝가리와 국경을 접하며 북서쪽으로는 코프리브니차크리제브치 주, 서쪽으로는 벨로바르빌로고라 주, 남쪽으로는 포제가슬라보니아 주, 동쪽으로는 오시예크바라냐 주와 접한다. 주 안에는 드라바 강이 흐르며 '포드라비나'라는 이름도 여기서 유래된 이름이다. 3개 시와 13개 지방 자치체를 관할하며 주 의회는 42개 의석으로 구성되어 있다."},{"page_url":"https://da.wikipedia.org/wiki/Parson_Russell-terrier","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Parson_Russell_Terrier.jpg","page_title":"Parson Russell-terrier","context_page_description":"Parson Russell Terrier er en hunderace af typen terrier. Er den første variant af Jack Russell Terrier der er blevet anerkendt som hunderace."},{"page_url":"https://fr.wikipedia.org/wiki/Compresseur_G","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Two_moving_spirals_scroll_pump.gif","page_title":"Compresseur G","context_page_description":"Le Compresseur G, G-Lader ou compresseur à spirales est un compresseur de type rouleau utilisé dans divers modèles de voitures particulières Volkswagen. Son but est d'augmenter la puissance motrice produite par un moteur à combustion interne avec une cylindrée donnée. La majoration seule de l'injection de carburant produit un mélange air-carburant trop riche, qu'il faut compenser par une plus grande quantité d'air d'admission ajouté en même temps au mélange. Cet ajout d'air au mélange peut être réalisé avec un turbocompresseur entraîné par l'échappement ou un compresseur volumétrique entraîné par le vilebrequin. Le compresseur G est entraîné par vilebrequin et n'a pas le \\"lag\\" généralement associé aux moteurs turbocompressés."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_23_maart","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Schuyler_Colfax%2C_photo_portrait_seated%2C_c1855-1865.jpg","page_title":"Lijst van personen geboren op 23 maart","context_page_description":"Dit is een lijst van personen die geboren zijn op 23 maart.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n603 - Pacal de Grote, koning, Ahau bewerken\\n1338 - Go-Kogon, Japanse troonpretendent bewerken\\n1395 - Johan Jacob van Monferrato, markgraaf, condottiero uit het Byzantijnse Rijk bewerken\\n1430 - Margaretha van Anjou, Franse koningin-gemalin, politicus bewerken\\n1499 - Hendrik XXXII van Schwarzburg, graaf bewerken\\n1596 - Elizabeth of Hesse-Kassel, Duchess of Mecklenburg, Duitse hertogin en hertogin, dichter en schrijver bewerken\\n1607 - Giovanni Benedetto Castiglione, Italiaanse kunstschilder en graficus bewerken\\n1645 - Johannes Coymans, Nederlandse ondernemer bewerken\\n1651 - Jean-Baptiste Santerre, Franse kunstschilder bewerken\\n1690 - Casimir William of Hesse-Homburg, militair bewerken\\n1725 - Jean Henri Latude, Franse schrijver bewerken"},{"page_url":"https://lv.wikipedia.org/wiki/R%C4%ABgikogu","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Riigikogu_%282011%29.jpg","page_title":"Rīgikogu","context_page_description":"Rīgikogu ir Igaunijas likumdevējvara — vienpalātas parlaments. Tajā ir 101 deputāts, kas vispārējās vēlēšanās tiek ievēlēti uz 4 gadiem. Pēdējās vēlēšanas notika 2015. gada 1. martā.\\nRīgikogu ieceļ augstas amatpersonas, tai skaitā premjerministru un Augstākās tiesas priekšsēdētāju, ievēl valsts prezidentu, uzrauga izpildvaru, pieņem likumus, apstiprina valdības izstrādāto budžetu.\\nPirmās Rīgikogu vēlēšanas notika 1920. gadā. Sēdes notiek Tompea pilī Tallinas vecpilsētā. Kopš 2014. gada parlamenta spīkers ir Eiki Nestors."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Brandenburg_an_der_Havel","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/Brandenburg_Deutsches_Dorf_30.jpg","page_title":"Liste der Baudenkmale in Brandenburg an der Havel","context_page_description":"Die Liste der Baudenkmale in Brandenburg an der Havel führt alle Baudenkmale im inneren Teil des Stadtgebiets von Brandenburg an der Havel auf. Grundlage ist die Veröffentlichung der Landesdenkmalliste mit dem Stand vom 31. Dezember 2019.\\nDie Baudenkmale in den Außenbereichen der Stadt sind in der Liste der Baudenkmale in Brandenburg an der Havel enthalten. Die Baudenkmale in den eingemeindeten Orten befinden sich in der Liste der Baudenkmale in Brandenburg an der Havel. Die Bodendenkmale sind in der Liste der Bodendenkmale in Brandenburg an der Havel aufgeführt."},{"page_url":"https://sl.wikipedia.org/wiki/Pajazitovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Zapis-0128-Pajazitovo-Crkva_20150321_2029.JPG","page_title":"Pajazitovo","context_page_description":"Pajazitovo je naselje v Srbiji, ki upravno spada pod mesto Kragujevac; slednje pa je del Šumadijskega upravnega okraja."},{"page_url":"https://ca.wikipedia.org/wiki/Bluffy","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/%C3%89glise_Saint-Pierre_et_Saint-Paul_de_Bluffy_%2816.VII.14%29.JPG","page_title":"Bluffy","context_page_description":"Bluffy és un municipi francès, situat al departament de l'Alta Savoia i a la regió d'Alvèrnia-Roine-Alps. L'any 2007 tenia 333 habitants."},{"page_url":"https://sv.wikipedia.org/wiki/Khal%C4%ABl%C4%81b%C4%81d_(kommunhuvudort)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/K.sh.baran12.jpg","page_title":"Khalīlābād (kommunhuvudort)","context_page_description":"Khalīlābād är en kommunhuvudort i Iran. Den ligger i provinsen Khorasan, i den nordöstra delen av landet, 600 km öster om huvudstaden Teheran. Khalīlābād ligger 997 meter över havet och antalet invånare är 8 409.\\nTerrängen runt Khalīlābād är platt söderut, men norrut är den kuperad. Terrängen runt Khalīlābād sluttar söderut. Den högsta punkten i närheten är Sīāh Kūh, 1 931 meter över havet, 10,9 km norr om Khalīlābād. Runt Khalīlābād är det glesbefolkat, med 19 invånare per kvadratkilometer. Närmaste större samhälle är Kāshmar, 16,4 km öster om Khalīlābād. Omgivningarna runt Khalīlābād är i huvudsak ett öppet busklandskap.\\nEtt kallt stäppklimat råder i trakten. Årsmedeltemperaturen i trakten är 20 °C. Den varmaste månaden är juni, då medeltemperaturen är 34 °C, och den kallaste är januari, med 4 °C. Genomsnittlig årsnederbörd är 223 millimeter. Den regnigaste månaden är mars, med i genomsnitt 48 mm nederbörd, och den torraste är juli, med 1 mm nederbörd."},{"page_url":"https://en.wikipedia.org/wiki/Institute_of_Psychiatry,_Psychology_and_Neuroscience","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Henry_Wellcome_Building_at_the_Institute_of_Psychiatry%2C_London_UK_taken_by_Paul_Wicks_in_January_2006.jpg","page_title":"Institute of Psychiatry, Psychology and Neuroscience","context_page_description":"The Institute of Psychiatry, Psychology and Neuroscience is a research institution dedicated to discovering what causes mental illness and diseases of the brain. In addition, its aim is to help identify new treatments for them and ways to prevent them in the first place. The IoPPN is a school of King's College London, England, previously known as the Institute of Psychiatry.\\nThe Institute works closely with South London and Maudsley NHS Foundation Trust. Many senior academic staff also work as honorary consultants for the Trust in clinical services such as the National Psychosis Unit at Bethlem Royal Hospital.\\nThe impact of the Institute's work was judged to be 100% 'world-leading' or 'internationally-excellent' in the Research Excellence Framework. The research environment of the Institute was also rated 100% 'world-leading'. King's College London was rated the second for research in Psychology, Psychiatry and Neuroscience in REF 2014. According to the 2016 US News Ranking, King's College London was ranked second in the world in Psychiatry and Psychology."},{"page_url":"https://de.wikipedia.org/wiki/Katharine_Rhoades","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Artists_at_Mount_Kisco_1912-restored.jpg","page_title":"Katharine Rhoades","context_page_description":"Katharine Nash Rhoades war eine amerikanische Malerin, Dichterin, Illustratorin und Feministin."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%84%B8%EB%A5%B4%EA%B2%8C%EC%9D%B4_%EB%9D%BC%ED%9D%90%EB%A7%88%EB%8B%88%EB%85%B8%ED%94%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Rachmaninoff_Seated_at_Steinway_Bain.jpg","page_title":"세르게이 라흐마니노프","context_page_description":"세르게이 바실리예비치 라흐마니노프는 러시아계 미국인 작곡가, 피아노 연주가이자 지휘자이다."},{"page_url":"https://war.wikipedia.org/wiki/Roger_Staubach","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Staubach_cowboys_qb.jpg","page_title":"Roger Staubach","context_page_description":"Hi Roger Thomas Staubach in uska futbolista."},{"page_url":"https://sv.wikipedia.org/wiki/AFC_President%27s_Cup","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/AFC_President%27s_Cup.jpg","page_title":"AFC President's Cup","context_page_description":"AFC President's Cup är en årlig internationell fotbollscup mellan olika klubblag inom Asian Football Confederation.\\nTurneringen har arrangerats varje år sedan den startades år 2005. Från början var 8 lag med i turneringen, vilket successivt har ökat till att idag innefatta 12 lag. Från början bestod cupen av lag från 8 länder: Tadzjikistan, Nepal, Taiwan, Bhutan, Kirgizistan, Sri Lanka, Pakistan och Kambodja. I tävlingens upplaga år 2008 bjöds även klubbar Turkmenistan, Bangladesh och Burma in i tävlingen. År 2011 bjöds klubbar från Palestinska myndigheten in till tävlan. Generellt är klubbarna som tävlar i cupen regerande ligamästare i sitt land. Övriga länder som kan skicka in en klubb till cupen, men som ännu inte gjort detta är: Brunei, Östtimor, Laos, Filippinerna, Guam, Macao, Mongoliet, Nordkorea och Afghanistan. AFC President's Cup år 2011 och 2012 kommer att innefatta 12 lag indelade i tre grupper om fyra lag. De två bästa lagen från varje grupp kvalificerar sig till de tre lagfinalerna.\\nFrån och med år 2011 och framåt kommer klubbar från Palestinska myndigheten att kunna skicka en klubb till cupen."},{"page_url":"https://en.wikipedia.org/wiki/Griffith_College_Limerick","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Griffith_College_14.jpg","page_title":"Griffith College Limerick","context_page_description":"Griffith College Limerick is a private college in Limerick city, Ireland. The college was established in 2006 when the Mid West Business Institute was acquired by Griffith College. The college runs full-time and part-time courses in accountancy, business, law, engineering, computing, and information technology, and has a range of part-time courses available.\\nOriginally located in the Old Town Hall, Rutland Street, Limerick, it moved to a newer and larger premises on 31 / 32 Upper William Street, Limerick, on December 2008. The new building was officially opened by the Minister of Defence Willie O'Dea T.D. on 23 January 2009. In 2013 the college moved from Upper William Street to the site of the former HSI Limerick Business School on O Connell Avenue."},{"page_url":"https://vi.wikipedia.org/wiki/Ninh_Thu%E1%BA%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/G%E1%BB%91m_B%C3%A0u_Tr%C3%BAc.JPG","page_title":"Ninh Thuận","context_page_description":"Ninh Thuận là một tỉnh ven biển thuộc vùng Duyên hải Nam Trung Bộ của Việt Nam. Tỉnh lỵ của Ninh Thuận là thành phố Phan Rang - Tháp Chàm nằm cách Thành phố Hồ Chí Minh 340 km về phía Nam, cách thủ đô Hà Nội 1.380 km về phía Bắc và cách Nha Trang 100 km theo đường Quốc lộ 1A và cách Đà Lạt 110 km theo đường Quốc lộ 27, đồng thời nằm cách sân bay Cam Ranh khoảng 60 km, thuận tiện cho việc giao lưu phát triển kinh tế xã hội của tỉnh.\\nNăm 2018, Ninh Thuận là đơn vị hành chính Việt Nam đông thứ 58 về số dân, xếp thứ 57 về Tổng sản phẩm trên địa bàn, xếp thứ 45 về GRDP bình quân đầu người, đứng thứ 10 về tốc độ tăng trưởng GRDP. Với 611,8 nghìn dân, GRDP đạt 24.288 tỉ Đồng, GRDP bình quân đầu người đạt 39,7 triệu đồng, tốc độ tăng trưởng GRDP đạt 10,25%.\\nNgày 20 tháng 5 năm 1901, tỉnh Phan Rang được thành lập. Năm 1913, tỉnh Phan Rang bị xóa bỏ, phần phía bắc nhập vào tỉnh Khánh Hòa, còn phần phía nam thuộc tỉnh Bình Thuận. Sau ngày 30 tháng 4 năm 1975, tỉnh Ninh Thuận dự kiến sáp nhập với Bình Thuận, Tuyên Đức, Lâm Đồng để thành lập một tỉnh mới có tên là Thuận Lâm. Nhưng đến tháng 2 năm 1976, Chính phủ Cộng hòa Miền Nam Việt Nam đã điều chỉnh việc sáp nhập cho sát với thực tế."},{"page_url":"https://pl.wikipedia.org/wiki/Frauendorf_(Brandenburgia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Frauendorf_glockenturm2.JPG","page_title":"Frauendorf (Brandenburgia)","context_page_description":"Frauendorf - gmina w Niemczech w kraju związkowym Brandenburgia, w powiecie Oberspreewald-Lausitz, wchodzi w skład urzędu Ortrand."},{"page_url":"https://sv.wikipedia.org/wiki/Australopithecus_africanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Mrs_Ples.jpg","page_title":"Australopithecus africanus","context_page_description":"Australopithecus africanus är en förhistorisk art av sydapa, en förmänniska från Afrika. Dessa levde för cirka 2-3 miljoner år sedan."},{"page_url":"https://pt.wikipedia.org/wiki/Acherontia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Acherontia_atropos_MHNT.jpg","page_title":"Acherontia","context_page_description":"Acherontia é um gênero de mariposa pertencente à família Sphingidae."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_der_Stadt_Bayreuth","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Adolf-von-Gro%C3%9F-Stra%C3%9Fe_Bayreuth.JPG","page_title":"Liste der Straßen und Plätze der Stadt Bayreuth","context_page_description":"Die Liste der Straßen und Plätze der Stadt Bayreuth beschreibt das Straßensystem mit den entsprechenden historischen Bezügen. Sie erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://ca.wikipedia.org/wiki/Batalla_de_Guadalete","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Hispania_680-711Loc.png","page_title":"Batalla de Guadalete","context_page_description":"La batalla de Guadalete és una batalla que va tenir lloc l'any 711 entre els musulmans i els visigots, amb la derrota dels darrers, i com a conseqüència les tropes del Califat van expandir-se i conduïren la invasió musulmana d'Hispània."},{"page_url":"https://ceb.wikipedia.org/wiki/Galerida_malabarica","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/MalabarCrestedLark.jpg","page_title":"Galerida malabarica","context_page_description":"Espesye sa langgam nga una nga gihulagway ni Giovanni Antonio Scopoli ni adtong 1786 ang Galerida malabarica. Ang Galerida malabarica sakop sa kahenera nga Galerida sa kabanay nga Alaudidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/List_of_University_of_East_Anglia_alumni","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Tito_Mboweni_-_New_Champions_-_World_Economic_Forum_on_Africa_2011.jpg","page_title":"List of University of East Anglia alumni","context_page_description":"This List of University of East Anglia alumni includes graduates and non-graduate former students of the University of East Anglia. The list includes one current monarch and former Prime Minister, two de facto heads of state, two former Leaders of the House of Lords, two further Members of the House of Lords, nine Members of the House of Commons, and 28 Cabinet Ministers from 23 foreign nations, including one Vice President, one Deputy Prime Minister, four Foreign Ministers, four Finance Ministers, one Defence Minister, six Education Ministers, two Health Ministers, two Interior Ministers, and a Central Bank Governor. The list also includes one Nobel laureate in Physiology or Medicine and President of the Royal Society, two Lasker Award winners, and a further eight Fellows of the Royal Society. Literary alumni include one Nobel laureate in Literature, three Man Booker Prize winners, 11 Costa Book Award winners, and three Caine Prize winners."},{"page_url":"https://en.wikipedia.org/wiki/Jedynak","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Bydgoszcz-dawny_Dom_Towarowy%2Cozdoby_figuralne-ma%C5%82pka.JPG","page_title":"Jedynak","context_page_description":"The Jedynak in Bydgoszcz, Poland is a historical building at Gdańska Street N°15. The building stands at the corner where the Gdańska and Dworcowa streets meet."},{"page_url":"https://et.wikipedia.org/wiki/Ilmar_Raua_m%C3%A4lestusturniir","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Arturs_neiksans_2019.jpg","page_title":"Ilmar Raua mälestusturniir","context_page_description":"Ilmar Raua mälestusturniir males on Viljandis peetav Ilmar Raua mälestusele pühendatud malevõistlus, pikimate traditsioonidega maleturniir Eestis.\\nMälestusturniiri eesmärgiks on meenutada Viljandist pärit maletajat, kahekordset Eesti meistrit ja 1939. aastal Buenos Airese maleolümpial Eesti võistkonnas kolmanda koha saavutanud maleolümpiameeskonna liiget Ilmar Rauda.\\nEsimest korda korraldati Raua mälestusturniir 1966. aastal. Esimesele turniirile kogunesid ainuüksi kohalikud ja Jõgeva maletajad. Esimese meistrina tegi 1968. aastal kaasa Endel Kuuskmaa. Väljastpoolt vabariiki olid esimesed külalismängijad Riia maletajad.\\n1972. aastal peeti peaturniir ning vähemtugevamatele maletajatele nn kõrvalturniir.\\n1986. aastal võitis turniiri Gata Kamski, hilisem FIDE MM-i finalist.\\n2013. aastal peeti Ilmar Raua sajandale sünniaastapäevale pühendatud 70 osavõtjaga rahvusvaheline turniir Šveitsi süsteemis. Esikohta jagasid Uladzislaŭ Kavaljoŭ ja Mikael Agopov.\\n2018. aastal 52. Ilmar Raua mälestusturniiri raames peeti kaks turniiri: kiirturniir 6.–7. juulil ja välkturniir 8. juulil. Kiirturniir mängiti play-off süsteemis, millele lisandus Šveitsi süsteemis turniir."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D1%83%D0%BB%D0%B5%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Ploulec%27h_%2822%29_%C3%89glise_01.JPG","page_title":"Плулех","context_page_description":"Плуле́х — коммуна во Франции, находится в регионе Бретань. Департамент — Кот-д’Армор. Входит в состав кантона Ланьон. Округ коммуны — Ланьон.\\nКод INSEE коммуны — 22224."},{"page_url":"https://en.wikipedia.org/wiki/Martin_Township,_Crawford_County,_Illinois","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Map_of_Illinois_highlighting_Crawford_County.svg","page_title":"Martin Township, Crawford County, Illinois","context_page_description":"Martin Township is one of ten townships in Crawford County, Illinois, USA. As of the 2010 census, its population was 531 and it contained 231 housing units."},{"page_url":"https://pl.wikipedia.org/wiki/Yul_Brynner","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Yul_Brynner%27s_birthplace.jpg","page_title":"Yul Brynner","context_page_description":"Yul Brynner, właściwie Julij Borisowicz Brinier – amerykański aktor nagrodzony w 1957 Oscarem za najlepszą, pierwszoplanową rolę w filmie Król i ja."},{"page_url":"https://ceb.wikipedia.org/wiki/Manufahi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Flag_of_Manufahi.png","page_title":"Manufahi","context_page_description":"Distrito ang Manufahi sa Sidlakang Timor. Nahimutang ni sa sentro nga bahin sa nasod, 50 km sa habagatan sa Dili ang ulohan sa nasod. Adunay 48,894 ka molupyo. Naglangkob kin og 1,323 ka kilometro kwadrado. Manufahi mopakigbahin sa usa ka utlanan sa Manatuto, Ainaro, ug Aileu.\\nAng yuta sa Manufahi kay kabungtoran sa habagatang-sidlakan, apan sa amihang-kasadpan nga kini mao ang kabukiran.\\nManufahi may sa mosunod nga mga subdibisyon:\\nAlas\\nSame\\nFatuberliu\\nTuriscai\\nSa mosunod nga mga natural nga mga bahin makita sa Manufahi:\\nMga suba:\\nMota Abatalala\\nMota Ahangcain\\nMota Aibeli\\nMota Aicameli\\nMota Aicoeai\\nMota Aimea\\nMota Aimerfo\\nMota Airacalau\\nMota Airai\\nMota Aitoklaran\\nMota Aitoklaran\\nMota Aiweluli\\nMota Besusu\\nMota Bilai\\nMota Binglala\\nMota Blaro\\nMota Borok\\nMota Borok\\nMota Bubulau\\nMota Caisilah\\nMota Carbou\\nMota Comealala\\nMota Cotalaura\\nMota Cudai\\nMota Daramota\\nMota Daurofu\\nMota Deunai\\nMota Fahenuan\\nMota Fatohei\\nMota Faturai\\nMota Hastetutu\\nMota Ibuk\\nMota Kaimulik\\nMota Keleo\\nMota Keleo\\nMota Laclodosul\\nMota Lacue\\nMota Ladiou\\nMota Laklo\\nMota Laolo\\nMota Laruna\\nMota Lato\\nMota Launado\\nMota Lauro\\nMota Lauvero\\nMota Letaulo\\nMota Limelala\\nMota Lodalala\\nMota Lodalala\\nMota Lohulun\\nMota Manofoni"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BE%8E%E5%9B%BD%E9%99%86%E5%86%9B%E5%8F%82%E8%B0%8B%E9%95%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Gen_John_Bates.jpg","page_title":"美国陆军参谋长","context_page_description":"美国陆军参谋长为美国陆军中军阶最高的军官之一，亦为参谋长联席会议成员。1903年以前，陆军的军事主官是美国陆军总司令。\\n陆军参谋长受陆军部长直接领导，负责陆军事务并辅助部长的对外职责——颁布实施陆军政策、规划、项目。陆军参谋长向国防部长及其行政部门、国会提交陆军预算与计划。参谋长需按总监察长的要求协助其进行必要的监察和调查工作。另外参谋长还领导陆军参谋部，在各种三军论坛中代表着陆军的能力、需求、政策、规划和项目。在陆军部长的领导下，陆军参谋长还负责联合战斗司令部的人事和资源调配。他还有着美国法典第10编第3033节所规定的各项职责或者将这些职责委派给其下属军官。与其他参联会成员一样，陆军参谋长是一个行政职务，对美国陆军没有作战指挥权。\\n陆军参谋长由总统提名，在参议院获得多数同意方可就职。根据条令，陆军参谋长由一名四星上将担任。现任陆军参谋长为詹姆斯·麦康维尔上将。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%BC%E3%83%AB%E3%83%BB%E3%83%A9%E3%83%BC%E3%82%B7%E3%83%A7%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/V%C3%A5ren_%281907%29_av_Carl_Larsson.jpg","page_title":"カール・ラーション","context_page_description":"カール・ラーションは、スウェーデンの画家。油彩・水彩ともに多数の作品を残し、フランス印象派の画家に多大な影響を与えたとされる。自身の家族を題材として当時の中流階級の日常生活風景の作品を数多く残し、その情景から溢れ出す幸福感が人々の共感を呼び、大いに人気を集めた。"},{"page_url":"https://vi.wikipedia.org/wiki/Palystes_superciliosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Palystes_superciliosus%2C_a%2C_Pretoria.jpg","page_title":"Palystes superciliosus","context_page_description":"Palystes superciliosus là một loài nhện trong họ Sparassidae.\\nLoài này thuộc chi Palystes. Palystes superciliosus được Ludwig Carl Christian Koch miêu tả năm 1875."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Bonner_Ortsteil_Beuel-Mitte","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Bonn_Beuel_Combahn_55.jpg","page_title":"Liste der Baudenkmäler im Bonner Ortsteil Beuel-Mitte","context_page_description":"Die folgende Liste enthält in der Denkmalliste ausgewiesene Baudenkmäler auf dem Gebiet des Bonner Ortsteils Beuel-Mitte im Stadtbezirk Beuel.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Denkmalliste der Stadt Bonn, die von der Unteren Denkmalbehörde geführt wird. Grundlage für die Aufnahme in die Denkmalliste ist das Denkmalschutzgesetz Nordrhein Westfalens.\\nKarte mit allen Koordinaten des Ortsteils Beuel-Mitte: OSM | WikiMap"},{"page_url":"https://et.wikipedia.org/wiki/Ukmerg%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Flag_of_Ukmerg%C4%97.jpg","page_title":"Ukmergė","context_page_description":"Ukmergė on linn Leedus Vilniuse maakonnas, Ukmergė rajooni ja Pivonija valla halduskeskus. Asub Šventoji jõe kaldal merepinnast 64 m kõrgusel.\\nUkmergės kaevandatakse savi. Linnas on kaks gümnaasiumit ja viis põhikooli. Lisaks annavad seal haridust kunstikool, erikool vaimse puudega lastele ning IT- ja kaubanduskool. Vaatamisväärsusteks on vanalinn ja Ukmergė linnamägi, Dukstyna kivi, koduloomuuseum, kolm katoliku kirikud, aastal 1869 rajatud vanausuliste kirik ja aastal 1873 valminud õigeusu kirik, aastal 1835 ehitatud hobupostijaama hoone, endine suur sünagoog ja Vaižgantase kabel.\\nLeedu kõige väiksem aastane sademete hulk mõõdeti Ukmergės aastal 1964. Linnas eristatakse järgmisi linnaosi: keskel vanalinn, kaguosas Gėliai rajoon, Užupis ja Krekšliai, lõunaosas Pivonija ja Pašilė, edelas Smėliai ja Mirabalis, läänes sõjaväelinnak ja tööstusrajoon, loodes Dukstyna, põhjas Šlapiai.\\nLinna järgi on nimetatud Pirgu lademe Ukmerge kihistu."},{"page_url":"https://pl.wikipedia.org/wiki/Q%C3%BCx%C3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Bundesarchiv_Bild_135-S-15-07-22%2C_Tibetexpedition%2C_Ufer%2C_Wartende.jpg","page_title":"Qüxü","context_page_description":"Qüxü, Qushui – powiat w centralnej części Tybetańskiego Regionu Autonomicznego, w prefekturze Lhasa. W 1999 roku powiat liczył 32 150 mieszkańców."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%BDelezni%C4%8Dn%C3%AD_dvojkol%C3%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Instrum_wheelset.jpg","page_title":"Železniční dvojkolí","context_page_description":"Typické železniční dvojkolí se skládá ze dvou kol nalisovaných na nápravu. Obě kola jsou tak pevně mechanicky spojena s nápravou. V kolejovém vozidle je dvojkolí uloženo pomocí valivých nebo, dnes již zřídka, i kluzných ložisek v ložiskových skříních.\\nNáprava může být plná i dutá. U parních lokomotiv s vnitřními válci se používají nápravy zalomené – k excentrické části je připojena ojnice. Zejména u nízkopodlažních tramvají bývají použity krátké nápravy pro jednotlivá kola. To umožňuje snížit střední část podvozku na minimum a vozidlo opatřit nízkou podlahou i v oblasti podvozku. Stejné uspořádání mají z důvodu možnosti změny rozchodu i vlaky Talgo. Jiná konstrukce umožňující změnu rozchodu spočívá na kolech uložených na nápravě posuvně.\\nKola jsou provedena jako obručová nebo celistvá. Obručová kola jsou složena z disku nebo hvězdice, na které je za tepla natažená obruč. Celistvá kola, u kterých jsou disk a obruč tvořeny jedním dílem, postupně vytlačují kola skládaná. Jejich výhodou je především nižší hmotnost a nehrozí u nich nebezpečí uvolnění obruče. Po opotřebení je ovšem nutné vyměnit celé kolo."},{"page_url":"https://nl.wikipedia.org/wiki/Lopatyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/%D0%9A%D0%BE%D1%81%D1%82%D0%B5%D0%BB_%D0%9D%D0%B5%D0%BF%D0%BE%D1%80%D0%BE%D1%87%D0%BD%D0%BE%D0%B3%D0%BE_%D0%97%D0%B0%D1%87%D0%B0%D1%82%D1%82%D1%8F_%D0%94%D1%96%D0%B2%D0%B8_%D0%9C%D0%B0%D1%80%D1%96%D1%97_%28%D0%BC%D1%83%D1%80.%29%2C_%D1%81%D0%BC%D1%82.%D0%9B%D0%BE%D0%BF%D0%B0%D1%82%D0%B8%D0%BD..jpg","page_title":"Lopatyn","context_page_description":"De Oekraïense plaats Lopatyn is gelegen in de rayon Radehivski van de Oblast Lviv. Hemelsbreed ligt Lopatyn op een afstand van circa 72 kilometer van de regionale hoofdstad Lviv."},{"page_url":"https://ja.wikipedia.org/wiki/2%E6%9C%881%E6%97%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Fort_Zeelandia03.jpg","page_title":"2月1日","context_page_description":"2月1日はグレゴリオ暦で年始から32日目にあたり、年末まであと333日ある。\\n翌年の春分の日および秋分の日は、この日に発行される官報によって発表される。"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B6%81%E6%9E%B6%E5%95%8F%E9%A1%8C%E6%93%94%E7%95%B6%E5%A4%A7%E8%87%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Kaoru_Yosano_cropped_2_Timothy_Geithner_and_Kaoru_Yosano_20090424.jpg","page_title":"綁架問題擔當大臣","context_page_description":"綁架問題擔當大臣是，主管北朝鮮的綁架問題的解決的國務大臣。綁架問題對策本部的副本部長。"},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%A4%E0%B1%86%E0%B0%B2%E0%B1%81%E0%B0%97%E0%B1%81_%E0%B0%AA%E0%B0%95%E0%B1%8D%E0%B0%B7%E0%B1%81%E0%B0%B2_%E0%B0%AA%E0%B1%87%E0%B0%B0%E0%B1%8D%E0%B0%B2%E0%B1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Indian_Silverbill_%28South_India%29.jpg","page_title":"తెలుగు పక్షుల పేర్లు","context_page_description":"తెలుగు పక్షుల పేర్లు మరియు వాటి వ్యవహారిక నామములు."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%8A%E3%83%87%E3%82%A3%E3%82%A2%E3%83%B3_(%E5%88%97%E8%BB%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/The_Canadian%27s_observatory.jpg","page_title":"カナディアン (列車)","context_page_description":"カナディアンは、もともとカナダ太平洋鉄道が1955年から1978年にかけて運行していたカナダの大陸横断旅客列車である。現在は都市間旅客列車としてVIA鉄道により、オンタリオ州トロントのユニオン駅と、ブリティッシュコロンビア州バンクーバーのパシフィック・セントラル駅を結んで運転されている。1990年以降、カナダ太平洋鉄道時代の「カナディアン」とはまったく異なる、北にあるカナディアン・ナショナル鉄道の本線を経由して運行するようになり、レジャイナやカルガリーではなくサスカトゥーンやエドモントンを通るようになった。またカナダ太平洋鉄道時代に比べてかなり遅くなり、また1990年までのようにモントリオールやオタワへは運行されなくなった。1955年以前は、「カナディアン」の名はカナダ太平洋鉄道のモントリオールとシカゴを結ぶ夜行列車に使われていた。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%86%9C%E8%B0%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Nuon_Chea_on_31_October_2013.jpg","page_title":"农谢","context_page_description":"农谢是前柬埔寨共产党和红色高棉政权的“二号人物”，曾经担任党中央委员会副书记和政治局常委，地位仅次于总书记波尔布特。\\n农谢出生在马德望省，原名刘平坤。2003年农谢接受日本研究者采访时声称自己父亲是华人，母亲则是汕头华人移民与高棉族女性所生的混血儿。然而在2011年接受审判时，农谢声称自己仅有四分之一华裔血统，因为父亲是华裔混血儿。\\n在赤柬时代，农谢担任柬埔寨共产党中央委员会常委、副书记和民主柬埔寨全国人大常委会委员长。\\n2007年9月19日，农谢在家中遭柬埔寨当局以反人类罪的罪名逮捕。2011年6月28日，柬埔寨法院特别法庭开庭，农谢与前外交部长英沙里、英沙里夫人前内务部长英蒂迪、前国家主席团主席乔森潘出庭受审。2014年8月7日，农谢与乔森潘因危害人类罪被判处终身监禁。2019年8月4日傍晚6时于金边的柬苏友谊医院逝世。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%B1%D8%AC%D9%87%E2%80%8C%D9%87%D8%A7_%D9%88_%D9%86%D8%B4%D8%A7%D9%86%E2%80%8C%D9%87%D8%A7%DB%8C_%D9%86%D8%B8%D8%A7%D9%85%DB%8C_%D9%86%DB%8C%D8%B1%D9%88%DB%8C_%D8%B2%D9%85%DB%8C%D9%86%DB%8C_%D9%81%D8%AF%D8%B1%D8%A7%D8%B3%DB%8C%D9%88%D9%86_%D8%B1%D9%88%D8%B3%DB%8C%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/14podpol.png","page_title":"درجه‌ها و نشان‌های نظامی نیروی زمینی فدراسیون روسیه","context_page_description":"فدراسیون روسیه درجه‌های نظامی اتحاد جماهیر شوروی را به ارث برد اگرچه نشانه‌ها و لباس کمی تغییر کرد.\\nنیروهای مسلح روسیه دارای دو سبک درجه هستند: درجه به سبک نیروی زمینی و نیروی دریایی. نیروی زمینی و نیروی هوایی فقط از رده‌های نیروی زمینی استفاده می کنند."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%A6%99%E6%B8%AF%E9%83%B5%E6%94%BF%E5%B1%80%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/GloucesterRdPostoffice.JPG","page_title":"香港郵政局列表","context_page_description":"下列各表设于香港境内的邮政局。现时香港邮政在香港设置了129间邮政局，服务范围遍及港九新界及离岛各人口较密集的地区，向顾客提供“一般邮政服务”，如一般信件投寄、出售邮票、邮缴通服务等。此外，部分邮政局亦额外提供大量投寄服务及通函邮寄服务，亦有部分设置邮政信箱供市民租用；而亦有部分邮局属于“集邮局”，向集邮爱好者提供诸如发售海外邮品等服务，于下表以粉黄色背景显示。\\n下表提供各间邮政局的简单资料，包括名称、设立年份、图片及位置。须注意“设立年份”只供参考，部分曾经搬迁的邮政局所列出的设立年份为迁至现址之年份，其余则为该局在旧址首次投入服务的年份。\\n此外，香港邮政亦以两辆小巴改装成流动邮政局，以编定的班次路线服务若干较偏远地区，或未设固定邮政局的市民提供基本邮政服务；而该署亦在各区设置派递局，负责邮件之派递工作。"},{"page_url":"https://cs.wikipedia.org/wiki/Anglick%C3%A1_literatura","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Philip_Sidney_portrait.jpg","page_title":"Anglická literatura","context_page_description":"Anglická literatura byla dlouho synonymem pro literaturu Britských ostrovů vůbec. Byla do ní zahrnována jednak tvorba autorů působících na území Anglie a píšících i v jiných jazycích než je angličtina, jednak tvorba anglicky píšících autorů z Walesu, Skotska, Irska a z území britských kolonií. Díky postupnému národnímu sebeuvědomění v těchto zemích je v současnosti za anglickou literaturu považována jen ta, která nyní vzniká na území Anglie."},{"page_url":"https://ms.wikipedia.org/wiki/Karaage","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Geso_karaage_by_Atari%2C_Gracinha_%26_Marco.jpg","page_title":"Karaage","context_page_description":"Karaage bermaksud \\"goreng Tang\\" adalah teknik memasak Jepun di mana pelbagai makanan— yang paling sering ayam, tetapi juga daging dan ikan lain—digoreng jeluk dalam minyak. Proses ini melibatkan salutan nipis daging atau ikan kecil dengan tepung gandum berperisa atau campuran kanji kentang, dan menggoreng dalam minyak. Kadang-kadang, makanan diperap sebelum salutan dengan campuran perasa. Proses ini sama dalam teknik penyediaan tempura. Karaage sering dihidangkan secara bersendirian atau dengan nasi dan kubis yang dihiris nipis. Baru-baru ini, cara yang popular untuk makan Karaage adalah seperti hidangan Vietnam, Bánh Xèo, dan ia dalam dibalut dengan daun perilla hijau dan daun salad."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D1%80%D0%BC%D0%B5%D0%B7%D0%B8%D0%BD%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Igreja_de_S._Rita_1.jpg","page_title":"Эрмезинде","context_page_description":"Эрмезинде — город и район в Португалии, входит в округ Порту. Является составной частью муниципалитета Валонгу. Находится в составе крупной городской агломерации Большой Порту. По старому административному делению входил в провинцию Дору-Литорал. Входит в экономико-статистический субрегион Большой Порту, который входит в Северный регион. Население составляет 45 000 человек. Занимает площадь 7,42 км².\\nПокровителем района считается Святой Лоренсо."},{"page_url":"https://nl.wikipedia.org/wiki/Tuin_van_Kapitein_Rommel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/TvkR_MvH_Panorama_Tuin_P1190222_bw.jpg","page_title":"Tuin van Kapitein Rommel","context_page_description":"De Tuin van Kapitein Rommel is een natuurtuin met ontmoetingsruimte in Castricum in de Nederlandse provincie Noord-Holland. De tuin is eigendom van de gemeente Castricum en is in zijn huidige vorm aangelegd in 1994 met een ecologische en sociale functie. Hierbij werd voortgebouwd op de inrichting door de vorige eigenaar, kapitein Albert Rommel. De tuin was in zijn tijd al opengesteld voor de bewoners van Castricum en wordt nu grotendeels beheerd door vrijwilligers van de Stichting Tuin van Kapitein Rommel. De tuin en een replica van het oorspronkelijke tuinhuis staan op de lijst van gemeentelijke monumenten in Castricum."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9B%BE%E6%B3%A2%E5%88%97%E5%A4%AB%E5%85%AC%E5%8F%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/OKB-156.jpg","page_title":"图波列夫公司","context_page_description":"圖波列夫是俄羅斯一個從事航空器及武器研發、製造、維修的上市公司，當前為俄國聯合航空製造公司的一個子公司。其前身為蘇聯工程師安德烈·圖波列夫於1922年10月22日成立的「第156號實驗設計局」，或稱圖波列夫設計局，總部設於莫斯科。蘇聯解體後，圖波列夫經歷了私有化而成為一家股份有限公司；2006年2月，依據俄羅斯總統普亭簽署的行政命令，圖波列夫公司與俄國其他主要航空、航太設計或製造公司合併成立「聯合航空製造公司」。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B2%D1%81%D1%8F%D0%BD%D0%BE%D1%87%D0%BD%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/SCruzBird.JPG","page_title":"Овсяночники","context_page_description":"Овсяночники, Горные вьюрки — род воробьиных птиц из семейства овсянковых."},{"page_url":"https://ru.wikipedia.org/wiki/Nikon_D850","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Nikon_D850_digital_single-lens_reflex_camera.jpg","page_title":"Nikon D850","context_page_description":"Nikon D850 - профессиональная полнокадровая цифровая зеркальная камера, выпущенная компанией Nikon. Официально анонсирована 25 июля 2017 года на праздновании 100-летия основания Nikon, как преемник Nikon D810.\\nD850 первая цифровая зеркальная камера Nikon, имеющая сенсор с обратной подсветкой. Nikon D850 была первой зеркальной камерой, получившей 100 пунктов в обзоре DxOMark."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Niau-%C3%A1_ka-pi-thia%E2%81%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Catsrepublic.jpg","page_title":"Niau-á ka-pi-thiaⁿ","context_page_description":"Niau-á ka-pi-thiaⁿ iah-sī niau ka-pi sī lāi-té chhī niau-á, hō͘ lâng-kheh him-sióng--ê ka-pi-thiaⁿ. Thâu chi̍t keng sī tī 1998 nî Tâi-oân Tâi-pak-chhī Sū-lîm-khu--ê Niau Hoe-hn̂g. Tī 2004 nî tī Ji̍t-pún Ôsaka khui Niau-á--ê sî-kan í-āu, choân sè-kài ū bē-chió só͘-chāi ū chit khoán--ê ka-pi-koán."},{"page_url":"https://vi.wikipedia.org/wiki/Alchemilla_vulgaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Illustration_Alchemilla_vulgaris0_clean.jpg","page_title":"Alchemilla vulgaris","context_page_description":"Alchemilla vulgaris là loài thực vật có hoa trong họ Hoa hồng. Loài này được L. mô tả khoa học đầu tiên năm 1753."},{"page_url":"https://en.wikipedia.org/wiki/Melanie_Schultz_van_Haegen","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Melanie_Schultz_van_Haegen_2013_%282%29.jpg","page_title":"Melanie Schultz van Haegen","context_page_description":"Melanie Henriëtte Schultz van Haegen-Maas Geesteranus is a retired Dutch politician of the People's Party for Freedom and Democracy and businesswoman.\\nSchultz van Haegen attended a Gymnasium in Lisse from May 1982 until June 1988 and applied at the Leiden University in June 1988 majoring in Public administration obtaining an Bachelor of Public Administration degree in July 1990 before transferring to the Erasmus University Rotterdam and graduating with an Master of Public Administration degree in July 1994. Schultz van Haegen served on the Municipal Council of Leiden from May 1994 until June 1999 and served as an Alderperson in Leiden from June 1999 until July 2002. Schultz van Haegen worked as a management consultant for B&A Group in The Hague from January 1995 until April 1997 and as a civil servant for the department of Budgetary Affairs of the Ministry of Finance from April 1997 until June 1999.\\nAfter the election of 2002 Schultz van Haegen was appointed as State Secretary for Transport and Water Management in the Cabinet Balkenende I, taking office on 22 July 2002."},{"page_url":"https://de.wikipedia.org/wiki/Alfred_I._zu_Windisch-Graetz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Alfred_Windischgr%C3%A4tz.jpg","page_title":"Alfred I. zu Windisch-Graetz","context_page_description":"Alfred Candidus Ferdinand Fürst zu Windisch-Graetz war ein österreichischer Feldmarschall."},{"page_url":"https://de.wikipedia.org/wiki/Transcontinental_Race","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/TCR-2014_Start-London.JPG","page_title":"Transcontinental Race","context_page_description":"Das Transcontinental Race ist das längste Ultradistanz-Radrennen durch ganz Europa. Es wird seit dem Jahr 2013 organisiert. Bei dem Rennen gilt das Selbstversorgerprinzip: Die Teilnehmer sind unbegleitet und müssen sich auf der Strecke selbst versorgen. Bis auf mehrere Kontrollpunkte, die von allen passiert werden müssen, muss auch die Streckenplanung selbst organisiert werden. Das Spitzenfeld ist bei jährlichen Streckenlängen von 3200 bis 4000 Kilometern etwa 7 bis 10 Tage unterwegs.\\nFür Aufsehen sorgte 2019 die Langdistanzfahrerin Fiona Kolbinger, als sie als erste sowohl die Frauenwertung als auch die Gesamtwertung vor 264 Männern gewann."},{"page_url":"https://no.wikipedia.org/wiki/Rosemaling","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Acanthus_mollis5.jpg","page_title":"Rosemaling","context_page_description":"Rosemaling er en dekorativ, ornamental malestil på gjenstander, møbler og interiør som var vanlig i flere bygder i Norge fra rundt 1740 til 1860, særlig i Telemark og Hallingdal, men også i Numedal og Setesdal og i andre dalfører i Vest-Agder, Hordaland, Sogn og Fjordane og Rogaland. Navnet kommer av motivene som først og fremst er frie, svungne blomster og blader som fyller flatene i djerve linjer og sterke og ofte raffinerte fargekombinasjoner. Andre motiver forekommer også. Rankeornamentikken har historisk utgangspunkt i den svulmende, europeiske blomsterbarokken og rokokkoens lekende eleganse men utviklet som bondemaling særegne regionale stiltrekk. Dekorasjonsformen anses i dag som en del av norsk folkekunst og husflid. Håndverket er fremdeles levende i brukskunstmiljøer i flere bygder og i enkelte norsk-amerikanske miljøer. Rosemaling har også inspirert moderne norske kunstnere."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%B8%D1%84%D0%BB%D0%B8%D1%80%D1%82-%D0%BA%D0%BB%D1%83%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Anti-flirt.jpg","page_title":"Антифлирт-клуб","context_page_description":"Антифлирт-клуб — американский клуб, действовавший в Вашингтоне в начале 1920-х годов. Основной целью клуба была защита молодых женщин и девушек, получавших нежелательное внимание со стороны мужчин в автомобилях и на углах улиц. Члены «Антифлирт-клуба» провели «Антифлирт-неделю», которая началась 4 марта 1923 года. Возглавляла клуб его президент — Алис Рейли."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A3%D0%BE%D1%82%D1%81%D1%8A%D0%BD%D0%B2%D0%B8%D0%BB_(%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Flag_of_Watsonville%2C_California.png","page_title":"Уотсънвил (Калифорния)","context_page_description":"Уотсънвил е град в окръг Санта Круз, щата Калифорния. Уотсънвил е с население от 44 265 жители, а общата му площ е 16,70 км²."},{"page_url":"https://it.wikipedia.org/wiki/Nokia_N85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Nokia_N85_Aperto_1.jpg","page_title":"Nokia N85","context_page_description":"Il Nokia N85 è uno smartphone prodotto da Nokia, facente parte della Nseries, ovvero la serie dei cellulari Nokia interamente dedicati alla multimedialità.\\nLa vendita del Nokia N85 è cominciata nell'ottobre 2008."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D9%8A%D8%B1%D9%89_%D8%A8%D8%B1%D9%8A%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Hearing_of_Commissioner-designate_Thierry_Breton_%2849068069128%29_%28cropped%29.jpg","page_title":"تيرى بريتون","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nتيرى بريتون شخصيه اعمال و مهندس و سياسى و رجل اعمال و مسير اعمال من فرنسا."},{"page_url":"https://en.wikipedia.org/wiki/John_W._and_Erena_Alexander_Rogers_Keeney_Farm","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Keeney_Farm_Michigan.JPG","page_title":"John W. and Erena Alexander Rogers Keeney Farm","context_page_description":"The John W. Keeney and Erena Alexander Rogers Farm, commonly known simply as the Keeney Farm, is a historic district located at 5300 Monroe Street in Franklin Township in north-central Lenawee County, Michigan. It was designated as a Michigan Historic Site and added to the National Register of Historic Places on September 24, 2001. The apple orchard has been continuously operating since 1875, and is one of the oldest such orchards in Lenawee County."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B0%D0%B9%D1%80,_%D0%A2%D0%B0%D0%BB%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Talia_Shire_1976_edit.JPG","page_title":"Шайр, Талия","context_page_description":"Талия Шайр — американская актриса, наиболее известная ролями в фильмах «Крёстный отец» и «Рокки». Дважды номинировалась на «Оскар» — за роли Конни Корлеоне в «Крёстный отец 2» и Эдриан Пеннино в фильме «Рокки».\\nРодилась в семье аранжировщика и композитора Кармине Коппола и Италии Пеннино Коппола.\\nРодная сестра режиссёра Фрэнсиса Форда Копполы, мать актёра Джейсона Шварцмана, тётя Николаса Кейджа.\\nБыла женой композитора Дэвида Шайра, от которого у неё есть сын Мэтью Орландо Шайр. От второго брака с продюсером Джеком Шварцманом, скончавшимся 15 июня 1994 года, у Талии двое сыновей."},{"page_url":"https://en.wikipedia.org/wiki/Mustang_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Inside_the_walled_city_of_Lo_Manthang_%2815988238142%29.jpg","page_title":"Mustang District","context_page_description":"Mustang District is one of the seventy-seven districts of Nepal. It covers an area of 3,573 km² and has a population of 13,452. The headquarters is Jomsom.\\nThe district is in Dhawalagiri Zone and part of Gandaki Pradesh in northern Nepal, straddles the Himalayas and extends northward onto the Tibetan Plateau. The district is one of the remotest areas in Nepal and is second in terms of the sparsity of population. The elevation ranges from 1,372 to 8,167 meters, with several peaks above 7,000 meters.\\nMustang was an ancient forbidden kingdom, bordered by the Tibetan Plateau and sheltered by some of world's tallest peaks, including 8000-meter tall Annapurna and Dhaulagiri. Strict regulations of tourists here have aided in maintaining Tibetan traditions. Upper Mustang was a restricted demilitarized area until 1992, which makes it one of the most preserved regions in the world due to its relative isolation from the outside world, with a majority of the population still speaking traditional Tibetic languages. The name \\"Mustang\\" is derived from the Tibetan word meaning, \\"Plain of Aspiration.\\" Upper Mustang was only opened to foreigners in 1992."},{"page_url":"https://cs.wikipedia.org/wiki/Bombax","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Tussar_Silk_Moth_Caterpillar_-_Antheraea_mylitta_%288240520369%29.jpg","page_title":"Bombax","context_page_description":"Bombax je rod rostlin z čeledi slézovité. Jsou to opadavé stromy s dlanitě složenými listy a velkými pětičetnými květy s mnoha tyčinkami. Kmen a větve jsou často pokryté kuželovitými ostny. Plodem je tobolka se semeny obalenými hojnými vlákny. Květy se rozvíjejí v bezlistém stavu a jsou opylovány ptáky nebo netopýry. Rod zahrnuje 11 druhů a pochází z tropické Asie, Afriky a severní Austrálie.\\nNejvýznamnějším druhem je Bombax ceiba. Je znám též pod českým jménem cejba, bývá však zaměňován s americkým rodem vlnovec. Je poměrně často pěstován v tropech jako okrasná dřevina a má i jiné využití. Z plodů i kůry se získávají vlákna, na listech se chovají housenky martináčů z jejichž kokonů se získává hedvábí, poupata se používají k ochucování jídel. Dřevo je měkké, lehké a snadno opracovatelné. Má význam též v místní medicíně."},{"page_url":"https://hu.wikipedia.org/wiki/Apr%C3%B3_nefelejcs","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Duben_na_strazi_29.jpg","page_title":"Apró nefelejcs","context_page_description":"Az apró nefelejcs a borágófélék családjába tartozó növényfaj."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Baden-W%C3%BCrttemberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Mauerreste_Burg_Schiltach.JPG","page_title":"Liste von Burgen und Schlössern in Baden-Württemberg","context_page_description":"Auf dem Gebiet des deutschen Landes Baden-Württemberg befindet sich eine Vielzahl von Burgen und Schlössern. Diese zum Teil auf eine 1000-jährige Geschichte zurückblickenden Bauten waren Schauplatz historischer Ereignisse, Wirkungsstätte bekannter Persönlichkeiten und sind häufig noch heute imposante Gebäude. Nicht aufgeführt sind Zier- und Nachbauten, die nie als Wohngebäude oder zur Verteidigung genutzt wurden."},{"page_url":"https://de.wikipedia.org/wiki/Foster%E2%80%99s_Lager","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Foster%27s.jpg","page_title":"Foster’s Lager","context_page_description":"Foster’s Lager ist eine international vertriebene australische Biermarke. Es wird von der Foster’s Group hergestellt und unter Lizenz in vielen Ländern, einschließlich Brasilien, Kanada, der USA, und der Volksrepublik China gebraut.\\nDie europäischen Markenrechte sind im Besitz von Heineken. Sie brauen und vertreiben Foster’s in den meisten europäischen Ländern einschließlich Großbritannien, Griechenland, Frankreich, Belgien, Portugal, Finnland, Türkei, Spanien, Schweden, der Ukraine und der Republik Irland. In den Vereinigten Staaten und Indien sind die Markenrechte im Besitz von SABMiller."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%8A%E0%B8%B2%E0%B8%A7%E0%B9%82%E0%B8%9B%E0%B9%81%E0%B8%A5%E0%B8%99%E0%B8%94%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/1908-kl-t-zamenhof.jpg","page_title":"ชาวโปแลนด์","context_page_description":"ชาวโปแลนด์ หรือ ชาวโปล ชาวโปลเป็นกลุ่มชาติพันธุ์ในกลุ่มชนสลาฟตะวันตกที่ตั้งถิ่นฐานอยู่ในปัจจุบันคือโปแลนด์ ชาวโปแลนด์บางครั้งก็จะได้รับการบรรยายว่าเป็นผู้ที่มีวัฒนธรรมโปแลนด์ร่วมกัน และสืบเชื้อสายโปแลนด์ ศาสนาส่วนใหญ่เป็นโรมันคาทอลิก ชาวโปแลนด์อาจจะมหาหมายถึงทั้งผู้ที่ตั้งถิ่นฐานอยู่ในโปแลนด์เองที่มีเชื้อสายโปแลนด์หรือชาติพันธุ์อื่น นอกจากนั้นก็ยังมีกลุ่มชนชาวโปแลนด์พลัดถิ่น ที่ไปตั้งหลักแหล่งทั่วไปในยุโรปตะวันตก ยุโรปตะวันออก ทวีปอเมริกา และออสเตรลีย"},{"page_url":"https://sv.wikipedia.org/wiki/Slottet_i_Montsoreau","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Chateau_de_montsoreau_-_detail.JPG","page_title":"Slottet i Montsoreau","context_page_description":"Slottet i Montsoreau är ett renässansslott beläget i Montsoreau i Loiredalen i västra Frankrike, 250 kilometer från Paris.\\nI slottet finns sedan 2016 Château de Montsoreau – musée d'Art contemporain, Museet för samtidskonst, som grundades av den franske samtidskonstsamlaren Philippe Méaille och som innehåller världens största konstsamling av de radikala konceptkonstnärerna inom Art & Language.\\nSlottet har varit listat som ett historiskt monument hos det franska kulturdepartementet sedan 1862. Loiredalen mellan Sully-sur-Loire och Chalonnes-sur-Loire, inklusive Montsoreau och slottet i Montsoreau, lades till på UNESCOs världsarvslista år 2000."},{"page_url":"https://sv.wikipedia.org/wiki/Megachile_pugnata","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Megachile%2C_U%2C_SIde_of_head%2C_UTAH_2014-03-27-10.08.27_ZS_PMax_%2813705124545%29.jpg","page_title":"Megachile pugnata","context_page_description":"Megachile pugnata är en biart som beskrevs av Thomas Say 1837. Megachile pugnata ingår i släktet tapetserarbin, och familjen buksamlarbin. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%97%E1%83%9D%E1%83%9B%E1%83%90_%E1%83%9B%E1%83%9D%E1%83%AA%E1%83%98%E1%83%A5%E1%83%A3%E1%83%9A%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Nuremberg_chronicles_f_106v_2.png","page_title":"თომა მოციქული","context_page_description":"წმიდა მოციქული თომა — ქრისტეს თორმეტ მოციქულთაგანი, მარჩბივად წოდებული, დაიბადა გალილეის ქალაქ პანეადაში. ხსენება - 6 ოქტომბერი."},{"page_url":"https://ga.wikipedia.org/wiki/The_Sopranos","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Gandolfinigfdl.PNG","page_title":"The Sopranos","context_page_description":"Sraith theilifíse Mheiriceánach de chuid HBO is ea The Sopranos.\\nAn príomhcharachtar ná ar bhall den mhaifia i New Jersey, Tony Soprano. Dírítear an clár ar eachtraí a tharlaíonn i dteahlacht coiriúil agus i saol pearsanta Tony. Glacann an t-aisteoir James Gandolfini páirt sa chlár mar Tony Soprano."},{"page_url":"https://gl.wikipedia.org/wiki/Constantino_I_de_Escocia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Constantine_I_of_Scotland_%28Holyrood%29.jpg","page_title":"Constantino I de Escocia","context_page_description":"Causantín ou Constantín mac Cináeda finado en 877, foi un rei dos pictos. Tamén é coñecido como Constantino I en referencia á súa posición nas listas modernas de reis de Escocia, mais as fontes contemporáneas describiron a Causantín só como rei picto. Era fillo de Cináed mac Ailpín, e sucedeu ó seu tío Domnall mac Ailpín como rei dos pictos despois da morte deste o 13 de abril de 862."},{"page_url":"https://en.wikipedia.org/wiki/First_Unitarian_Church_(Milwaukee,_Wisconsin)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/First-Unitarian-Church_Milwaukee_Jul09.jpg","page_title":"First Unitarian Church (Milwaukee, Wisconsin)","context_page_description":"The First Unitarian Church is a historic Gothic Revival-styled church built in 1891-92 in Milwaukee, Wisconsin. It was added to the National Register of Historic Places in 1974.\\nFirst Unitarian's congregation hired the firm of Ferry & Clas of Milwaukee to design their new church building, and Ferry himself led the design - in reserved Gothic Revival style. Most walls are rock-faced Bedford limestone, rising to steep gable roofs with dormers. The general floor-plan is L-shaped, with a tower rising from one leg of the L.\\nInside, the auditorium has a hammerbeam ceiling resting on carved stone corbels. The chancel contains an organ, a pulpit, and a carved oak sedilia. The windows have abstract designs.\\nThe church is little changed from when it was built. First Unitarian was placed on the NRHP for its architectural significance, but it is also the oldest Unitarian church building in Milwaukee."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD%D0%B8%D1%82%D0%BA%D0%B0%D0%B1%D1%96%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Lions_Road_Anitkabir.JPG","page_title":"Аниткабір","context_page_description":"Аниткабір — мавзолей, усипальниця засновника та першого президента Турецької республіки Мустафи Кемаля Ататюрка.\\nМавзолей знаходиться в столиці Туреччини — Анкарі."},{"page_url":"https://en.wikipedia.org/wiki/Gartan_Lough","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Gartan_Lough_2012_09_19.jpg","page_title":"Gartan Lough","context_page_description":"Gartan Lough, also known as Lough Beagh South, is a freshwater lake in the northwest of Ireland. It is located in north County Donegal close to the eastern boundary of Glenveagh National Park."},{"page_url":"https://hu.wikipedia.org/wiki/K%C3%B6z%C3%B6ns%C3%A9ges_gy%C3%ADkf%C5%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Prunella_vulgaris_fructification.JPG","page_title":"Közönséges gyíkfű","context_page_description":"A közönséges gyíkfű, népies nevén toroköröme, torokgáncs, torokvillahin, patikai gyérfű, szilvafű, szilvalevelű fű, tűzfű, békavar, az ajakosvirágúak rendjébe az árvacsalánfélék családjába tartozó Prunella növénynemzetség tagja.\\nNevét onnan kapta hogy régen torokgyík ellen gargarizálásra használták."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%81%E5%8B%9D%E5%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Mount_Tokachi_from_Mount_Biei_1998-8-9.jpg","page_title":"十勝岳","context_page_description":"十勝岳は、北海道の中央部の上川管内の美瑛町・上富良野町、十勝管内の新得町にまたがる標高2,077 mの活火山。大雪山国立公園内の十勝岳連峰の主峰である。日本百名山及び花の百名山に選定されている。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8C%97%E4%BA%AC%E9%A6%96%E9%83%BD%E5%9B%BD%E9%9A%9B%E7%A9%BA%E6%B8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Beijing_Capital_International_Airport.jpg","page_title":"北京首都国際空港","context_page_description":"北京首都国際空港は、中華人民共和国北京市に位置する国際空港である。中国最大の空港であり、アジアでも最大の規模、世界第三の規模を持つ。中国国際航空が中国民航時代から同空港をハブ空港としている。"},{"page_url":"https://sv.wikipedia.org/wiki/Senapssl%C3%A4ktet","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Herik_17-10-2005_13.59.40.JPG","page_title":"Senapssläktet","context_page_description":"Senapssläktet är ett släkte av korsblommiga växter med cirka 10 arter. De förekommer naturligt i huvudsak i medelhavsområdet. Av vissa arters frön görs kryddsåsen senap. Dessa växter härstammar från medelhavsländerna, men odlas även i andra länder i Europa, bl a Sverige, samt i USA och Kanada.\\nSvartsenap och sareptasenap är inte Sinapis-arter, utan förs till kålsläktet och har de vetenskapliga namnet Brassica nigra respektive Brassica juncea."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%9C%E5%8C%97%E5%A4%A7%E5%AD%A6_(%E6%97%A5%E6%9C%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Atsuto_Suzuki_cropped_2_Atsuto_Suzuki_and_Piermaria_Oddone_201010.jpg","page_title":"东北大学 (日本)","context_page_description":"东北大学，简称“东北大”，是一所本部位于日本东北地区宫城县仙台市的国立研究型综合大学。同时也是日本东北地区的最高学府。它前身是创立于1907年的旧制东北帝国大学，起源于1736年的仙台藩藩校“明伦养贤堂”。2017年入选“指定国立大学法人”顶尖3校。2020年泰晤士高等教育世界大学排名日本排名第1名，QS世界大学排名全球79大。\\n东北大学是世界材料学中心，也是曾经接待爱因斯坦的物理学名校与光通信发祥之地。校友包括若干诺贝尔奖、拉斯克奖、IEEE爱迪生奖章、芥川赏及直木赏得主。文豪鲁迅以及复旦、台大校长皆为知名留学生。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AF%E3%83%AA%E3%83%B3%E3%83%88%E3%83%BB%E3%82%A4%E3%83%BC%E3%82%B9%E3%83%88%E3%82%A6%E3%83%83%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Almeria_3.jpg","page_title":"クリント・イーストウッド","context_page_description":"クリント・イーストウッドはアメリカ合衆国カリフォルニア州、サンフランシスコ出身の映画俳優、映画監督、映画プロデューサー、作曲家、政治活動家。公称身長193 cm。\\n俳優として数多くの西部劇やアクション映画に出演。自身最大の当たり役であるハリー・キャラハン役を演じた『ダーティハリー』シリーズでスーパースターの地位を不動のものとした。監督としても『許されざる者』『ミリオンダラー・ベイビー』でアカデミー作品賞とアカデミー監督賞を2度受賞するなど、ハリウッドで長年活躍してきた俳優、映画監督である。一方、カリフォルニア州カーメル市市長を1期務めた。"},{"page_url":"https://es.wikipedia.org/wiki/Violeta_Z%C3%BA%C3%B1iga","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Violeta_Z%C3%BA%C3%B1iga_bailado_la_Cueca_Sola_%28cropped%29.jpg","page_title":"Violeta Zúñiga","context_page_description":"Violeta Zúñiga Peralta fue una activista de los derechos humanos chilena que formó parte de la Agrupación de Familiares de Detenidos y Desaparecidos desde la Dictadura Militar de Chile hasta el día de su fallecimiento;​ a su vez fue miembro del conjunto folclórico de la misma agrupación. Participó más de cien veces en la presentación de la obra de arte La cueca sola, ​ en la que participó como bailarina.​​​​\\n​\\n​"},{"page_url":"https://fr.wikipedia.org/wiki/Pachydiplax_longipennis","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Male_blue_dasher_dragonfly_pachydiplax_longipennis.jpg","page_title":"Pachydiplax longipennis","context_page_description":"Le Pachydiplax est un odonate faisant partie de la famille des Libellulidae dans le sous-ordre des anisoptères. Il est présent sur l'ensemble des États continentales des États-Unis à l'exception du Montana, Dakota du Nord et du Wyoming. Au Canada, elle est mentionnée dans les provinces de la Colombie-Britannique, de l'Alberta, du Manitoba, de l'Ontario, du Nouveau-Brunswick et dans celle du Québec."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D1%80%D0%BA%D1%8E%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Mairie_de_Mercurey.JPG","page_title":"Меркюре","context_page_description":"Меркюре́ — муніципалітет у Франції, у регіоні Бургундія-Франш-Конте, департамент Сона і Луара. Населення — 1271 осіб.\\nМуніципалітет розташований на відстані близько 290 км на південний схід від Парижа, 60 км на південний захід від Діжона, 60 км на північ від Макона."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D8%B1%D8%AC%D8%B1%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Algeria_relief_location_map.jpg","page_title":"جرجره","context_page_description":"کوهستان جُرجُره نام زنجیره‌ای از کوه‌ها در سرزمین قبایلی الجزایر است. جرجره بخشی از کوهستان اطلس تلی است که خود جزئی از رشته‌کوه‌های بزرگ‌تر اطلس است.\\nبلندترین قله جرجره لاله خدیجه نام دارد که با بلندای آن ۲٬۳۰۸ متر در قسمت جنوبی جرجره واقع شده‌است."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%B5%D0%B2%D0%B8%D0%BD%D1%81%D0%BA%D0%B8_%D0%B7%D0%B0%D0%BC%D0%B0%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Devin02.jpg","page_title":"Девински замак","context_page_description":"Дјевински замак је једна од најстаријих замкова у Словачкој и представља један од три велика замка Нитранске кнежевине. Налази се у селу Девину, које се налази у Братислави. Замак је смештен на високој стени изнад ушћа Мораве у Дунав и поседује једну од најбољих стратегијских положаја у том делу Европе јер су се из ње могли контролисати важни трговачки путеви, као и део Ћилибарског пута. Данас је махом у рушевинама, али његова спектакуларна локација и изглед и даље остављају људе без даха. Неки њени делови су обновљени, а у њеном склопу се данас налази музеј."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1992","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Callum_Skinner_%286907739582%29.jpg","page_title":"Lijst van personen geboren in 1992","context_page_description":"Dit is een lijst van personen die geboren zijn in 1992.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://sv.wikipedia.org/wiki/Sveriges_herrlandskamper_i_fotboll_1950%E2%80%931959","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Sverige1950.JPG","page_title":"Sveriges herrlandskamper i fotboll 1950–1959","context_page_description":"Sveriges herrlandskamper i fotboll 1950–1959 omfattar även VM 1950 och VM 1958 samt OS 1952. 1950-talet var framgångsrikt för landslaget, som lyckades ta ett VM-silver, ett VM-brons och ett OS-brons.\\nI VM 1950 i Brasilien spelade Sverige i grupp 3 och mötte Italien och Paraguay. Sverige slog Italien med 3-2 och spelade lika mot Paraguary, 2-2. I slutspelet mötte Sverige Brasilien, Uruguay och Spanien. Sverige besegrades av Brasilien, 1-7, och Uruguary, 2-3, men slog Spanien, 3-1, och kunde därför ta brons. Svenska målskyttar var Hasse Jeppson 2, Sune Andersson 2, Stig Sundqvist 2, Calle Palmér 3 och Bror Mellberg.\\nI OS 1952 i Finland slog Sverige Norge i den första matchen, 4-1. I kvartsfinalen besegrades Österrike, 3-1. I semifinalen förlorade Sverige mot Ungern, 0-6 och ställdes i bronsmatchen mot Tyskland och vann, 2-0. Svenska målskyttar var Sylve Bengtsson, Ingvar Rydell 3, Yngve Brodd 3, Gösta Sandberg och Gösta Löfgren. Övriga spelare i bronslaget var \\"Rio-Kalle\\" Svensson, Lennart Samuelsson, Erik Nilsson, Holger Hansson, Bengt \\"Julle\\" Gustavsson, Gösta Lindh| och Olle Åhlund.\\nI VM 1958 i Sverige, bärgade landslaget silvermedaljerna."},{"page_url":"https://en.wikipedia.org/wiki/Sumatra_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Locomotive_Remains_on_the_Pekanbaru_Death_Railway.jpg","page_title":"Sumatra Railway","context_page_description":"The Sumatra Railway, also referred to as the Pekanbaru Death Railway, was a railway project of the Imperial Japanese army in Sumatra during the Second World War. It was designed to connect Pekanbaru to Muaro in an effort to strengthen the military and logistical infrastructure for coal and troop shipments. The 220 km long railway would connect the Strait of Malacca, via the Siak River to Pekanbaru, to Padang via an existing railway from Muaro.\\nThe railway was completed on Victory over Japan Day, 15 August 1945. It was only ever used to transport prisoners of war out of the area but quickly became overgrown by the jungle."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AC%E0%B4%BF%E0%B4%97%E0%B5%8D_%E0%B4%AC%E0%B5%86%E0%B4%A8%E0%B5%8D%E0%B4%B1%E0%B5%8D_%E0%B4%A6%E0%B5%87%E0%B4%B6%E0%B5%80%E0%B4%AF%E0%B5%8B%E0%B4%A6%E0%B5%8D%E0%B4%AF%E0%B4%BE%E0%B4%A8%E0%B4%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Waving_to_the_Sky.jpg","page_title":"ബിഗ് ബെന്റ് ദേശീയോദ്യാനം","context_page_description":"അമേരിക്കയിലെ ടെക്സസിൽ മെക്സിക്കൊ അതിർത്തിയോട് ചേർന്ന് സ്ഥിതിചെയ്യുന്ന ഒരു ദേശീയോദ്യാനമാണ് ബിഗ് ബെന്റ് ദേശീയോദ്യാനം. 1,200-ൽ അധികം ഇനം സസ്യങ്ങൾ, 450ലധികം ഇനം പക്ഷികൾ, 56 സ്പീഷീസ് ഉരഗങ്ങൾ, 75 സ്പീഷിസ് സസ്തനികൾ എന്നിവയെ ഇവിടെ കണ്ടുവരുന്നു.\\n801,163 acre ആണ് ഈ ദേശീയോദ്യാനത്തിന്റെ വിസ്തൃതി. ക്രിറ്റേഷ്യസ്, സീനോസോയിക് കാലഘട്ടങ്ങളിലെ ഫോസിലുകൾ ഇവിടെനിന്നും കണ്ടെത്തിയിട്ടുണ്ട്."},{"page_url":"https://ast.wikipedia.org/wiki/H%C3%A9rcules_dixebra_los_montes_Calpe_y_Abyla","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/H%C3%A9rcules_separa_los_montes_Calpe_y_Abyla%2C_por_Zurbar%C3%A1n.jpg","page_title":"Hércules dixebra los montes Calpe y Abyla","context_page_description":"Hércules dixebra los montes Calpe y Abyla ye una pintura al oliu de 1634 realizada pol pintor español Francisco de Zurbarán. Atópase espuesta na sala 26a del Muséu del Prado en Madrid, procedente de l'antigua Coleición Real del Palaciu del Bon Retiru."},{"page_url":"https://az.wikipedia.org/wiki/Kamal_Mahmudov","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Mahmudov_Kamal-.jpg","page_title":"Kamal Mahmudov","context_page_description":"Kamal Mahmudov; d. 1925 ö. 1962 — Böyük Vətən Müharibəsi iştirakçısı, müharibə veteranı."},{"page_url":"https://pl.wikipedia.org/wiki/Yerupaj%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Yerupaja_Grande.jpg","page_title":"Yerupajá","context_page_description":"Yerupajá, Nevado Yerupajá - szczyt w Andach w Kordylierze Huayhuash o wysokości 6635 m n.p.m. Yerupaya jest drugim co do wysokości szczytem w Peru oraz najwyższym szczytem w Kordylierze Huayhuash. Lokalna nazwa góry to El Carnicero, co oznacza Rzeźnik. Nazwa ta wynika z kształtu grani szczytowej, która przypomina ostrze noża. Ze szczytu Yerupaja opada stroma ściana o wysokości 1520 m.\\nPierwszego wejścia na szczyt dokonali w 1950 Jim Maxwell oraz Dave Harrah. Natomiast pierwszego wejścia na szczyt północny dokonali w 1965 Roger Bates oraz Graeme Dingle."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/WarsawFromTheISS.jpg","page_title":"Варшава","context_page_description":"Варшава е столицата на Полша и най-големият град в страната. Административно е обособен в отделен окръг с площ 517,24 km². Разположен е на река Висла, на приблизително 350 km от Балтийско море и Карпатите. Населението му е 1 764 615 души, а за цялата агломерация – около 3 100 000 души. Градът е осми по население в Европейския съюз.\\nВаршава е център на Мазовското войводство. В града има много индустрии, 66 висши училища и над 30 театъра."},{"page_url":"https://cs.wikipedia.org/wiki/Soln%C3%AD_(Prachatice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Soln%C3%AD_%28012%29.jpg","page_title":"Solní (Prachatice)","context_page_description":"Solní je název ulice v Prachaticích, která prochází Městskou památkovou rezervací Prachatice."},{"page_url":"https://fr.wikipedia.org/wiki/Bataille_de_Massacre_Canyon","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Massacre_Canyon_monument_and_marker.JPG","page_title":"Bataille de Massacre Canyon","context_page_description":"La bataille de Massacre Canyon est un affrontement qui opposa le 5 août 1873 plus d'un millier de guerriers lakotas à un groupe de Pawnees près de la ville actuelle de Trenton dans le Nebraska. Alors qu'ils étaient en train de chasser le bison, les Pawnees furent attaqués par les Lakotas et près d'une centaine d'entre eux furent tués, dont des femmes et des enfants. Cet affrontement est considéré comme le dernier affrontement majeur entre deux peuples amérindiens aux États-Unis.\\nUn monument a été érigé sur les lieux de la bataille en 1930."},{"page_url":"https://vi.wikipedia.org/wiki/Contopus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Contopus_virensAAP068B.jpg","page_title":"Contopus","context_page_description":"Contopus là một chi chim trong họ Tyrannidae."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BB%D1%83%D0%B5%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%91%D0%B0%D0%BB%D1%83%D0%B5%D0%B2_%28%D1%84%D0%BE%D1%82%D0%BE_%D0%98%D0%B3%D0%BE%D1%80%D1%8F_%D0%9C%D1%83%D1%85%D0%B8%D0%BD%D0%B0%2C_1997_%D0%B3%D0%BE%D0%B4%D0%B0%29_%281%29.jpg","page_title":"Балуев, Александр Николаевич","context_page_description":"Алекса́ндр Никола́евич Балу́ев — советский и российский актёр театра, кино и дубляжа."},{"page_url":"https://eu.wikipedia.org/wiki/Maiatzaren_23","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/El_CD_Legan%C3%A9s_a_Primera_%2826911425003%29_Guillermo_%28cropped%29.jpg","page_title":"Maiatzaren 23","context_page_description":"Maiatzaren 23a gregoriotar egutegiaren urteko ehun eta berrogeita hirugarren eguna da, 144garrena bisurteetan. 222 egun falta dira urtea amaitzeko."},{"page_url":"https://ja.wikipedia.org/wiki/JR%E5%8C%97%E6%B5%B7%E9%81%93H100%E5%BD%A2%E6%B0%97%E5%8B%95%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/JRHokkaido_H100_DECMO_20200228.jpg","page_title":"JR北海道H100形気動車","context_page_description":"H100形気動車は、北海道旅客鉄道の一般形気動車である。愛称は「DECMO」。"},{"page_url":"https://en.wikipedia.org/wiki/Villa_del_Poggio_Imperiale","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Villa_di_Poggio_Imperiale%2C_salone_bianco_01.JPG","page_title":"Villa del Poggio Imperiale","context_page_description":"Villa del Poggio Imperiale is a predominantly neoclassical former grand ducal villa in Arcetri, just to the south of Florence in Tuscany, central Italy. Beginning as a villa of the Baroncelli of Florence, it was seized by the Medici, became the home of a homicidal and unfaithful husband, and a lavish retreat for a Grand Duchess with imperial pretensions. Later given to Napoleon's sister, it was reclaimed by the hereditary rulers of Tuscany before being finally converted to a prestigious girls' school. During its long history, it has often been at the centre of Italy's turbulent history, and has been rebuilt and redesigned many times."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D8%A7%DB%8C%D8%AA%D8%A7%D9%85%D8%A7_(%D8%B4%D9%87%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Saitama-shintoshin-illumination.jpg","page_title":"سایتاما (شهر)","context_page_description":"سایتاما (شهر) ژاپون اؤلکه‌سینده یئر آلان بیر شهردیر و سایتاما اوستانینده یئرلشیب ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا 1,266,656 نفر دیر."},{"page_url":"https://an.wikipedia.org/wiki/Templers_en_a_Corona_d%27Arag%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/2007templar1--maxweb.jpg","page_title":"Templers en a Corona d'Aragón","context_page_description":"La Orden de lo Temple estió una institución medieval de caracter relichioso y militar naixida en la Primera Cruzada. Fue fundada en Cherusalem, en 1118 por nueu caballers franceses, con Hugo de Payens a la cabeza."},{"page_url":"https://cy.wikipedia.org/wiki/Apley_Forge","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Apley_Suspension_Bridge_-_geograph.org.uk_-_549006.jpg","page_title":"Apley Forge","context_page_description":"Pentref yn Swydd Amwythig, Gorllewin Canolbarth Lloegr, ydy Apley Forge.\\nTref weinyddol Swydd Amwythig ydy'r Amwythig. Llwyth y Cornovii oedd yma am ganrifoedd ond fe'u trechwyd tua 650 O.C. gan y goresgynwyr Sacsonaidd. Ceir gwreiddiau dyfnion yn y cysylltiad rhwng Cymru a Swydd Amwythig."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%88%A9%E5%A5%A5%E6%B3%A2%E5%BE%B7%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Place_du_Luxembourg_Panorama_889.jpg","page_title":"利奥波德区","context_page_description":"利奥波德区是比利时布鲁塞尔的一个区。今天，这个词有时与“欧洲区”混用，因为该区已经由欧盟的机构和相关组织主导，尽管这两个词实际上并不一样。利奥波德区是一个较小的更具体的地区。利奥波德区传统上是指直接位于内环路以南的区域，介于那慕尔门与鲁汶门之间。今天，它大致位于环路和利奥波德公园之间，以及约瑟夫二世街与 Rue du Trone/Troonstraat之间。\\n该区创建于1837年，以比利时国王利奥波德一世命名，涵盖的范围包括布鲁塞尔首都地区的城市布鲁塞尔市、埃特尔贝克、伊克塞尔和圣若斯-滕-诺德。\\n该区最初是在1830年代和1840年代，比利时独立之后不久设计和建造的，是新建国的比利时首都的精英们的享有盛誉的住宅区。此后这里长期是首都最享有盛誉的的居住地址，直到20世纪初，这里的许多居民开始搬迁到布鲁塞尔新发展的郊区。 从那时开始，但直到1950年代之后才迅速加速，它越来越成为一个商业/机构领域，今天以欧洲联盟的设施为主。\\n该区包含欧洲议会大厦和其他欧洲联盟办公室。它也是布鲁塞尔的一个主要金融区。布鲁塞尔-卢森堡火车站在进行重大重建之前，曾经称为利奥波德区车站。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B2%E3%82%A2%E3%83%8F%E3%83%AB%E3%83%88%E3%83%BB%E3%83%8F%E3%82%A6%E3%83%97%E3%83%88%E3%83%9E%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Hauptmann%27s_Signature.jpg","page_title":"ゲアハルト・ハウプトマン","context_page_description":"ゲアハルト・ハウプトマンは、ドイツの劇作家、小説家、詩人。1912年にノーベル文学賞を受賞した。ゲルハルト・ハウプトマンとも表記される。プロイセン王国・ニーダーシュレージエンのバート・オーバーザルツブリュン生まれ。"},{"page_url":"https://de.wikipedia.org/wiki/Foundling_Hospital","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Foundling_Hospital_Chapel_edited.jpg","page_title":"Foundling Hospital","context_page_description":"Das Foundling Hospital ist eine vom ehemaligen Kapitän Thomas Coram 1739 gegründete und 1741 eröffnete Findlingsanstalt in London. Sie diente vor allem der Aufnahme von Findel- und Waisenkindern sowie von Säuglingen armer, oft lediger Mütter, die nicht für den Lebensunterhalt ihres Nachwuchses sorgen konnten."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BF%D1%96%D1%81_%D0%B0%D0%B1%E2%80%99%D0%B5%D0%BA%D1%82%D0%B0%D1%9E_%D0%A1%D1%83%D1%81%D1%8C%D0%B2%D0%B5%D1%82%D0%BD%D0%B0%D0%B9_%D1%81%D0%BF%D0%B0%D0%B4%D1%87%D1%8B%D0%BD%D1%8B_%D0%AE%D0%9D%D0%AD%D0%A1%D0%9A%D0%9E_%D1%9E_%D0%A1%D0%B0%D1%83%D0%B4%D0%B0%D1%9E%D1%81%D0%BA%D0%B0%D0%B9_%D0%90%D1%80%D0%B0%D0%B1%D1%96%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Diriyahpic.jpg","page_title":"Сьпіс аб’ектаў Сусьветнай спадчыны ЮНЭСКО ў Саудаўскай Арабіі","context_page_description":"Сьпіс Сусьветнай спадчыны ЮНЭСКО ў Саудаўскай Арабіі складаецца з двух аб’ектаў, што складае каля 0,2% ад агульнай колькасьці. Акрамя гэтага, па стане на 2010 год, 1 аб’ект на тэрыторыі Саудаўскай Арабіі знаходзіцца ў ліку кандыдатаў на ўключэньне ў сьпіс Сусьветнай спадчыны."},{"page_url":"https://eu.wikipedia.org/wiki/Mahatma_Gandhi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Gandhi_and_Laxmidas_2.jpg","page_title":"Mahatma Gandhi","context_page_description":"Mahatma Gandhi abokatua, politikaria eta buruzagi erlijiosoa izan zen. Mahātmā Gandhi izenaz egin zen ezaguna. Indiako estatuaren sortzaileetariko bat izan zen, eta Bapu izena ere ematen diote han, gujarateraz બાપુ bāpu hitzak «aita» esan nahi baitu. Mahatmaren filosofiak bakezaletasuna iraultzarako bitarteko gisa aldarrikatzen du. Bizitza osoan, mota guztietako indarkeriaren aurka egin zuen. Ekonomiari buruz, uste zuen kapitala ez dela lanaren gainetik jarri behar, ezta alderantziz ere, bi ideiak arriskutsuak zirelako. Oreka aurkitu behar zen, biak zirelako garrantzi handikoak garapenerako. Oso bizimodu apala izan zuen, soinean zeramatzan arropak berak egiten zituen. Begetarianoa zen.\\nXIX. mendean erreforma garrantzitsuak gertatu ziren Indian. Mugimendu horiek hinduismo tradizionala, erreforma sozial eta ideia politiko berriekin elkartzea zuten helburu. Arlo horretan, Gandhik eragin handia izan zuen. 1918tik aurrera, indiar mugimendu nazionalistaren buruzagia izan zen. Borrokatzeko metodo berriak ezarri eta borroka armatuari uko egin zion, britainiar dominatzaileei eusteko bakezaletasuna bultzatuz."},{"page_url":"https://ceb.wikipedia.org/wiki/Wincham","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Vr_wincham.png","page_title":"Wincham","context_page_description":"Distrito ang Wincham sa Hiniusang Gingharian. Nahimutang ni sa kondado sa Cheshire West and Chester ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 250 km sa amihanan-kasadpan sa London ang ulohan sa nasod.\\nAng klima baybayon. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 15 °C, ug ang kinabugnawan Disyembre, sa -2 °C."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87_%D8%A8%DB%8C%D9%86%E2%80%8C%D8%A7%D9%84%D9%85%D9%84%D9%84%DB%8C_%D9%86%D8%A7%D8%B1%DB%8C%D8%AA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Air_India_Boeing_787-8_VT-ANA_NRT_%2816056992736%29.jpg","page_title":"فرودگاه بین‌المللی ناریتا","context_page_description":"فرودگاه بین‌المللی ناریتا در شهر چیبا واقع در قسمت جنوب شرقی استان چیبا قرار دارد. این فرودگاه همراه با فرودگاه بین‌المللی هانه دا دو فرودگاهی هستند که امور مربوط به پروازهای داخلی و خارجی توکیو پایتخت ژاپن در آنها انجام می‌شود. فرودگاه ناریتا در سال ۱۹۸۷ میلادی افتتاح شده‌است.\\nاین فرودگاه دارای دو ترمینال یک و دو است که از هم مجزا هستند. رفت‌وآمد مسافران بین این دو ترمینال توسط وسایل نقلیهٔ رایگان انجام می‌گیرد. زمان طی کردن فاصلهٔ بین این دو ترمینال با اتوبوس فرودگاه در حدود ۱۰ تا ۱۵ دقیقه است."},{"page_url":"https://uk.wikipedia.org/wiki/CPB2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/PBB_GE_CPB2_206651_s_at_fs.png","page_title":"CPB2","context_page_description":"CPB2 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 13-ї хромосоми. Довжина поліпептидного ланцюга білка становить 423 амінокислот, а молекулярна маса — 48 424.\\nКодований геном білок за функціями належить до гідролаз, протеаз, металопротеаз, карбоксипептидаз.\\nЗадіяний у таких біологічних процесах, як зсідання крові, гемостаз, фібриноліз, альтернативний сплайсинг.\\nБілок має сайт для зв'язування з іонами металів, іоном цинку.\\nСекретований назовні."},{"page_url":"https://de.wikipedia.org/wiki/Westtimor","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Westtimor_Land_4.jpg","page_title":"Westtimor","context_page_description":"Westtimor bildet den westlichen Teil der politisch geteilten Insel Timor. Dies kann im engeren Sinne sowohl den indonesischen Teil Timors bezeichnen, als auch im weiteren das indonesische Timor, zusammen mit der Exklave Oe-Cusse Ambeno, die zum Staat Osttimor gehört."},{"page_url":"https://da.wikipedia.org/wiki/Limousin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Les_Mon%C3%A9di%C3%A8res.jpg","page_title":"Limousin","context_page_description":"Limousin var en fransk region indtil 1. januar 2016, hvor den blev slået sammen med Aquitaine og Poitou-Charentes, for at danne den nye region Nouvelle-Aquitaine. Den er beliggende i den centrale del af landet omkring byen Limoges, som var hovedby i regionen. Regionen var sammensat af 3 departementer: Corrèze, Creuse og Haute-Vienne. Indbyggerne kaldes les limousins."},{"page_url":"https://pl.wikipedia.org/wiki/Jaz_zastawkowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Malenice%2C_stavidlo.jpg","page_title":"Jaz zastawkowy","context_page_description":"Jaz zastawkowy, stawidło – rodzaj jazu wyposażonego w zamknięcia płaskie, na tyle duże, że do ich przemieszczania niezbędne jest zastosowanie prostego mechanizmu, napędzanego najczęściej ręcznie. Stosowane jest przemieszczanie zamknięcia za pośrednictwem listew palczastych, łańcuchów, kół zębatych i ślimaków. Obsługa takiego zamknięcia wykonywana jest ręcznie za pomocą korby, rzadziej stosuje się napęd elektryczny. Jako zamknięcie tego rodzaju jazu stosuje się płaskie zastawki drewniane, zespolone kształtownikami stalowymi, lub zasuwy całkowicie stalowe. Stosowane są również zasuwy dwudzielne dla większych wysokości zamknięcia. Jaz zastawkowy jest więc stopniem wodnym większym od zastawki, w której niewielka wielkość zamknięcia pozwala na ręczne zakładanie i otwieranie zamknięcia, i mniejszym od innych jazów z zamknięciami, w których wielkość zamknięcia wymusza konieczność stosowania odpowiednich siłowników.\\nStawidło to nazwa zwyczajowa funkcjonująca potocznie, w nomenklaturze związanej z hydrotechniką stosuje się określenie jaz zastawkowy."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%98%84%EB%8C%80_%EB%B2%A0%EB%A5%B4%EB%82%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/20101106_hyundai_new_verna_sense_002.jpg","page_title":"현대 베르나","context_page_description":"현대 베르나는 현대자동차의 소형 세단이다. 차명인 베르나는 이탈리아어로 청춘, 열정을 의미한다. 현대자동차 울산1공장에서 생산되었다."},{"page_url":"https://ceb.wikipedia.org/wiki/Tassullo_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Tassullo_-_castello_-_01.JPG","page_title":"Tassullo (munisipyo)","context_page_description":"Munisipyo ang Tassullo sa Italya. Nahimutang ni sa lalawigan sa Provincia di Trento ug rehiyon sa Trentino-Alto Adige, sa amihanang bahin sa nasod, 500 km sa amihanan sa Rome ang ulohan sa nasod. Adunay 1,920 ka molupyo.\\nAng klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 19 °C, ug ang kinabugnawan Enero, sa -4 °C. Ang kasarangang pag-ulan 1,429 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 185 milimetro nga ulan, ug ang kinaugahan Disyembre, sa 73 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Aperture_card","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Aperture_card.JPG","page_title":"Aperture card","context_page_description":"An aperture card is a type of punched card with a cut-out window into which a chip of microfilm is mounted. Such a card is used for archiving or for making multiple inexpensive copies of a document for ease of distribution. The card is typically punched with machine-readable metadata associated with the microfilm image, and printed across the top of the card for visual identification; it may also be punched by hand in the form of an edge-notched card. The microfilm chip is most commonly 35mm in height, and contains an optically reduced image, usually of some type of reference document, such as an engineering drawing, that is the focus of the archiving process. Machinery exists to automatically store, retrieve, sort, duplicate, create, and digitize cards with a high level of automation.\\nAperture cards have several advantages and disadvantages when compared to digital systems. While many aperture cards still play an important role in archiving, their role is gradually being replaced by digital systems."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BF%D0%BE%D1%81%D0%BE%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%B0_%D0%B2_%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Rusemb_warsaw_main_building.jpg","page_title":"Здание российского посольства в Варшаве","context_page_description":"Здание российского посольства в Варшаве — здание в варшавском районе Стары Мокотув, между улицами Бельведерска и Спацерова, с почтовым адресом Бельведерска, 49. В здании находится официальная резиденция посла Российской Федерации в Польше. Консульство и торговое представительство размещены в другом здании по адресу Бельведерска, 25.\\nЗдание, воздвигнутое на искусственном холме, представляет собой дворец с двумя боковыми крыльями, обращённый фасадом к улице Бельведерской. Фасад имеет в оси классический портик, по склону холма к нему ведёт широкая лестница в несколько маршей. Над главной частью здания находится купол с флагштоком. На втором этаже залы образуют анфиладу. Вокруг дворца на площади 4 гектаров разбит парк, в котором было высажено около 8.000 деревьев, а также размещены теннисный корт и плавательный бассейн.\\nЗдание было построено в 1954—1956 гг. специально для посольства СССР. Авторами проекта выступили известные советские архитекторы И. Е. Рожин и А. П. Великанов. Строительные и отделочные материалы выписывались из разных районов СССР, а во внутренней отделке принимали участие польские художники и мастера."},{"page_url":"https://it.wikipedia.org/wiki/Unione_dei_comuni_Terre_dei_Peligni","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/AbrCorfinioSanPelino1.jpg","page_title":"Unione dei comuni Terre dei Peligni","context_page_description":"L'unione dei comuni Terre dei Peligni è una unione di comuni che nasce dall'accordo tra quattro comuni italiani della provincia dell'Aquila.\\nIl suo territorio comprende gran parte della Valle Peligna, area che anticamente ospitava l'omonimo popolo italico dei Peligni, fino ai confini con la provincia di Pescara. Ne fanno parte i comuni di Corfinio, Raiano, Roccacasale e Vittorito; l'unione comprende un'area di 78,44 km² nella quale risiedono 5 255 abitanti."},{"page_url":"https://fr.wikipedia.org/wiki/Crocothemis_erythraea","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Crocothemis_erythraea_%28Broad_Scarlet%29_-_immature_male.jpg","page_title":"Crocothemis erythraea","context_page_description":"Crocothemis erythraea, la Libellule écarlate ou Crocothémis écarlate, est un insecte odonate appartenant à la famille des libellulidés."},{"page_url":"https://en.wikipedia.org/wiki/First_responder","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Scottish_Ambulance_Service_First_Responder_vehicle.jpg","page_title":"First responder","context_page_description":"A first responder is a person with specialized training who is among the first to arrive and provide assistance at the scene of an emergency, such as an accident, natural disaster, or terrorism. First responders typically include law enforcement officers, healthcare workers and other trained members of organizations connected with this type of work. In some areas, emergency department personnel are also required to respond to disasters and critical situations, designating them first responders.\\nA certified first responder is one who has received certification to provide pre-hospital care in a certain jurisdiction, such as the Certified First Responder in France. A community first responder is a person dispatched to attend medical emergencies until an ambulance arrives. A wilderness first responder is trained to provide pre-hospital care in remote settings who has skills relevant to ad hoc patient packaging and transport by non-motorized means."},{"page_url":"https://ro.wikipedia.org/wiki/M%C4%83n%C4%83stirea_Sf%C3%A2nta_Ecaterina_din_Muntele_Sinai","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/%D0%9C%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8C_%D1%81%D0%B2.%D0%B5%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D1%8B.jpg","page_title":"Mănăstirea Sfânta Ecaterina din Muntele Sinai","context_page_description":"Mănăstirea Sfânta Ecaterina este un lăcaș de cult, astăzi greco-ortodox, în Sinai, în Egipt, fondat între 548 și 565 și este încă cea mai veche mănăstire creștină locuită. Mănăstirea este situată la picioarele Muntelui Sinai. A fost construit pe locul unde se crede că profetul Moise a văzut Rugul Aprins. Cu toate că este cunoscută sub numele de Sfânta Ecaterina, hramul mănăstirii este Schimbarea la Față. Uneori mai este cunoscută și sub numele de Mănăstirea Rugului Aprins. Așezământul monahal Sfânta Ecaterina este, probabil, cea mai veche mănăstire creștină în care viața monastică nu a fost întreruptă, cu o istorie de 17 secole. Mănăstirea se află sub autoritatea Bisericii ortodoxe autocefale a Sinaiului și este înscrisă din 2002 în Lista Patrimoniului Mondial UNESCO.\\nÎn prezent în Mănăstirea Sfânta Ecaterina trăiesc 25 de monahi de mai multe naționalități, iar slujbele se oficiază în greaca bizantină."},{"page_url":"https://mg.wikipedia.org/wiki/Almen_Abdi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Almen_Abdi.jpg","page_title":"Almen Abdi","context_page_description":"Almen Abdi dia mpilalao baolina kitra mizaka ny zom-pirenen'i Soisa teraka ny 21 Oktobra 1986"},{"page_url":"https://hr.wikipedia.org/wiki/Love%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Bulgaria-Lovech-03.jpg","page_title":"Loveč","context_page_description":"Loveč je grad na sjeveru središnje Bugarske sa 50 000 stanovnika. Loveč je upravno središte bugarske Oblasti Loveč, udaljen je oko 150 km od glavnog grada Sofije. Pored Loveča nalaze se gradovi; Pleven, Trojan i Teteven."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_im_Landkreis_Altenburger_Land","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Altenburg_Rote_Spitzen.jpg","page_title":"Liste der Kulturdenkmale im Landkreis Altenburger Land","context_page_description":"Die Liste der Kulturdenkmale im Landkreis Altenburger Land listet die Kulturdenkmale im Landkreis Altenburger Land, aufgelistet nach einzelnen Gemeinden. Die Angaben in den einzelnen Listen ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde."},{"page_url":"https://lb.wikipedia.org/wiki/Troms%C3%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Tromsogroussbr%C3%A9ck.jpg","page_title":"Tromsø","context_page_description":"Tromsø [ˈtrumsø] ass déi gréisst Stad am Norde vun Norwegen an d'Haaptstad vun der Regioun Troms."},{"page_url":"https://pl.wikipedia.org/wiki/Plac%C3%B3wka_Stra%C5%BCy_Celnej_%E2%80%9EAugust%C3%B3w%E2%80%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/%C5%9Aniaty%C5%84_komisariat_SC_1926.jpg","page_title":"Placówka Straży Celnej „Augustów”","context_page_description":"Placówka Straży Celnej „Augustów” – jednostka organizacyjna Straży Celnej pełniąca w okresie międzywojennym służbę ochronną na granicy polsko-rumuńskiej."},{"page_url":"https://en.wikipedia.org/wiki/Identification_badges_of_the_Uniform_Services_of_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/USCG_Auxiliary_National_Staff_Badge.png","page_title":"Identification badges of the Uniform Services of the United States","context_page_description":"Identification badges of the Uniformed Services of the United States are insignia worn by service members conducting special duties, many of which can be awarded as permanent decorations if those duties are performed successfully. There are a few identification badges that are awarded to all services, others are specific to a uniform service. The Office of the President and Vice President and department/service headquarters badges are permanent decorations for those who successfully serve in those assignments. Some of the service level identification badges can be permanent decorations and others are only worn by a service member while performing specific duties, such as the Military Police Badge.\\nCommand insignia/badges are another form of identification badge used to identify an officer or non-commissioned officer who is/was in command or in-charge of a unit. If the service member performs their leadership duties successfully, the command insignia/badge they wear can become a permanent uniform decoration regardless of their next assignment.\\nThe following is a list of identification badges currently in use by the uniformed services:"},{"page_url":"https://it.wikipedia.org/wiki/L%27arte_della_fuga","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Bach%2C_Johann_Sebastian%2C_Die_Kunst_der_Fuge%2C_BWV_1080%2C_7_revInc.jpg","page_title":"L'arte della fuga","context_page_description":"L'arte della fuga BWV 1080 è una raccolta di composizioni di Johann Sebastian Bach, senza indicazioni sulla strumentazione, formata da diciannove fughe a tre e quattro voci, quattro canoni a due voci e un corale a quattro voci.\\nIniziata intorno al 1740, o forse anche prima, ma portata avanti con assiduità solo a partire dal 1747, L'arte della fuga restò incompiuta a causa della morte di Johann Sebastian Bach, avvenuta nel 1750. Nonostante fosse incompleta, Carl Philipp Emanuel Bach, figlio di Johann Sebastian, la fece stampare nel 1751. A questa pubblicazione ne seguì una seconda, sempre in versione incompleta, nel 1752. In entrambi i casi, però, l'opera non destò l'interesse del pubblico, ormai orientato verso diverse mode musicali, e vendette solo poche copie.\\nLa raccolta, che costituisce un vero e proprio saggio di arte del contrappunto, esplora sistematicamente tutte le possibilità offerte da un semplice tema in re minore elaborato secondo diverse tecniche compositive, come, ad esempio, la variazione e il rovesciamento degli intervalli in maniera speculare."},{"page_url":"https://de.wikipedia.org/wiki/Barbour_Lewis","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/BarbourLewis.jpg","page_title":"Barbour Lewis","context_page_description":"Barbour Lewis war ein US-amerikanischer Politiker. Zwischen 1873 und 1875 vertrat er den Bundesstaat Tennessee im US-Repräsentantenhaus."},{"page_url":"https://la.wikipedia.org/wiki/La_Faurie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Blasonville_fr_La_Faurie_05.svg","page_title":"La Faurie","context_page_description":"La Faurie est commune Francicum 316 incolarum praefecturae Alpium Superiorum in regione Provincia et Alpis."},{"page_url":"https://da.wikipedia.org/wiki/Eyjafjallaj%C3%B6kulls_vulkanudbrud_i_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Eyjafjallaj%C3%B6kull_volcanic_ash_16_April_2010.png","page_title":"Eyjafjallajökulls vulkanudbrud i 2010","context_page_description":"I slutningen af 2009 blev der målt forøget seismisk aktivitet omkring vulkanen Eyjafjallajökull i Island, hvilket varslede det senere vulkanudbrud, der fandt sted den 20. marts 2010. Et senere udbrud, som startede den 14. april 2010, var årsag til store udslip af vulkansk aske, som lammede flytrafikken i store dele af Nordeuropa og Vesteuropa."},{"page_url":"https://en.wikipedia.org/wiki/Immaculate_Conception_Catholic_Church_(Botkins,_Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Site_of_the_Botkins_Elementary_School.jpg","page_title":"Immaculate Conception Catholic Church (Botkins, Ohio)","context_page_description":"Immaculate Conception Catholic Church is a Roman Catholic parish in Botkins, Ohio, United States. Erected in 1865, the parish owns a complex of buildings constructed in a wide range of years, including two that have been designated as historic sites."},{"page_url":"https://no.wikipedia.org/wiki/Quartiere_Ponte_Mammolo","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Roma_%28Q._Ponte_Mammolo%29_-_Sacro_Cuore_di_Ges%C3%B9_04_Facciata.JPG","page_title":"Quartiere Ponte Mammolo","context_page_description":"Ponte Mammolo er Romas 29. quartiere og har betegnelsen Q. XXIX. Quartiere Ponte Mammolo er oppkalt etter broen Ponte Mammolo. Quartiere Ponte Mammolo ble etablert i 1961."},{"page_url":"https://es.wikipedia.org/wiki/Colegio_San_Jos%C3%A9_de_los_Infantes","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Infantes1917.jpg","page_title":"Colegio San José de los Infantes","context_page_description":"El Colegio San José de los Infantes es la institución educativa de orientación católica más antigua de Guatemala. Fue fundado el 10 de junio de 1781 por el entonces arzobispo de la Capitanía General de Guatemala, Cayetano Francos y Monroy, y originalmente fue parte de la renovación educativa impulsada por el arzobispo para los estudiantes de primaria en la Nueva Guatemala de la Asunción.​ Francos y Monroy creó el Colegio de Infantes específicamente para atender el Coro de la Catedral Metropolitana.​ Su existencia se vio afectada por la Independencia de Centroamérica, la Guerra Civil Centroamericana y la Reforma Liberal, sucesos que cerraron temporalmente sus puertas. El último cierre que tuvo fue en 1887, cuando el entonces Presidente de Guatemala, general Manuel Lisandro Barillas Bercián expulsó al arzobispo de Guatemala Ricardo Casanova y Estrada, aunque continuó bajo la dirección del Dr. Alberto Rubio y Piloña a pesar del ambiente hostil de los regímenes liberales con la Iglesia Católica.​\\nEl arzobispo regresó en 1897 y el mismo año se incororó al colegio el sacerdote Ignacio Prado.​"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%87%BA%E7%81%A3%E5%BB%BA%E7%AF%89%E7%8D%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/First_Financial_Holding_headquarters_20160831.jpg","page_title":"臺灣建築獎","context_page_description":"台湾建筑奖旧称建筑师杂志奖，是一项由中华民国全国建筑师公会主办，旗下的全国联合会杂志社承办的一项优良建筑选拔活动，每年会从各建筑师与建筑领域相关单位所建设的新建物进行评选，并决定入围与最终获奖者。其用意就是鼓励各相关单位能提升建筑职业水准，进而对台湾社会文化或艺术进行贡献。截至2019年为止，此项评选目前已成功办理41届。"},{"page_url":"https://fr.wikipedia.org/wiki/La_Maternelle_(film,_1933)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/La_maternelle_scene.jpg","page_title":"La Maternelle (film, 1933)","context_page_description":"La Maternelle est un film français réalisé par Jean Benoit-Lévy et Marie Epstein, adapté du roman éponyme de Léon Frapié, et sorti en 1933."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%90%A8%E5%A7%86%E5%8D%9A%C2%B7%E5%87%AF%E9%9B%B7%E5%85%8B%E6%96%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Kerekes_Zsombor.jpg","page_title":"萨姆博·凯雷克斯","context_page_description":"萨姆博·凯雷克斯，马扎尔族，出生于南斯拉夫森塔，成长于阿达，匈牙利已退役足球运动员，曾效力天津泰达，2009年12月从职业足球退役。2015年夏，以教练身份加入德布雷森足球学院。"},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8Cejkovice_(Mlado%C5%88ovice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Mlado%C5%88ovice%2C_%C4%8Cejkovice%2C_n%C3%A1ves_%282018-07-04%3B_01%29.jpg","page_title":"Čejkovice (Mladoňovice)","context_page_description":"Čejkovice je malá vesnice, část obce Mladoňovice v okrese Chrudim. Nachází se asi 2,5 km na severovýchod od Mladoňovic. V roce 2009 zde bylo evidováno 29 adres. V roce 2001 zde trvale žilo 69 obyvatel.\\nČejkovice leží v katastrálním území Čejkovice u Mladoňovic o rozloze 2,08 km²."},{"page_url":"https://eo.wikipedia.org/wiki/Komunumaro_Schwansen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Schwansen_Amt_Wappen.png","page_title":"Komunumaro Schwansen","context_page_description":"Schwansen estas komunumaro en Germanio. Ĝi troviĝas en la distrikto Rendsburg-Eckernförde de la federacia lando Ŝlesvigo-Holstinio. La 31-an de decembro 2004 la komunumaro havis 7099 loĝantojn."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A7%D8%B1%D8%A9_%D8%A8%D8%B1%D8%A7%D9%8A%D8%AA%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Osaka07_Opening_Sarah_Brightman.jpg","page_title":"سارة برايتمان","context_page_description":"سارة برايتمان ‏ ولدت في 14 أغسطس 1960 مغنية وممثلة وراقصة إنكليزية من مواليد مدينة بيركاميستيد، هيرتفوردشير،المملكة المتحدة.\\nكان أول ظهور لها في مجموعة للرقص، على أنغام \\"ستارشيب تروبير،Starship Trooper\\" في 1978 كانت تبلغ 19 سنة وحطم الفريق الدرجة الأولى في تلك السنة.\\nفي 1980 شاركت في دور بسيط في المسرحية الغنائية،تزوجت من أندريو ويبير ملحن مسرحية كاتس في 1984.\\nتألق نجم سارة عالميا في 1986 عند مشاركتها في المسرحية العالمية ولعبها الادوار الرئيسية فيها في برودواي ولندن.\\nمن بعد طلاقها من أندريو ويبر، ساره أنتجت أول ألبوم لها \\"دايف، Dive\\" في 1992 ولم يلقى نجاحا.\\nو أطلقت الالبوم الثاني لها في 1995 باسم \\"فلاي، Fly \\" الذي حقق نجاحا ملحوطاً وغنت سارة فية مع الفنان الإيطالي المشهور أندريا بوتشللي وانتجت نسخة ثانية بنفس الاسم فلاي2 الذي وزع مجاناً في حفل لا لونا في أوروبا.\\nفازت أغنية سارة بايتمان time to say goodbye بجائزة الأسد الذهبى لأفضل أداء وأفضل لحن.كما عملت سارا مع الموسيقى الهندى آى آر رحمان مؤلف الموسيقى التصويرية وأغنية فيلم المليونير المتشرد وحصد بهما جائزتى أوسكار في أغنيتين هما you take my breath away وjourney home."},{"page_url":"https://fr.wikipedia.org/wiki/Ettore_Ferrari","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Sulmona0001.jpg","page_title":"Ettore Ferrari","context_page_description":"Ettore Ferrari est un sculpteur et homme politique italien."},{"page_url":"https://en.wikipedia.org/wiki/Sepahan_Oil_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Abadan_Petrochemical_Complex.jpg","page_title":"Sepahan Oil Company","context_page_description":"Sepahan Oil Company, established in 2002, is an oil refining independent company based in Tehran with its refining facilities located in Isfahan.\\nIn 2013, SOC began offering shares of stock on Tehran Stock Exchange.\\nWith the annual production capacity of more than 700,000 MT, SOC is now the largest producer of base oil in the Middle East. Under the brand name of Speedy, the company is one of the main producers of diesel and engine oils in the Mideast as well."},{"page_url":"https://de.wikipedia.org/wiki/Haus_des_Berliner_Verlages","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Berlin_-_Verlagshaus_Berliner_Zeitung2.jpg","page_title":"Haus des Berliner Verlages","context_page_description":"Das Haus des Berliner Verlages, während der Bauzeit kurzzeitig auch Haus der Berliner Verlage, nach der politischen Wende zeitweise auch Pressehaus Gruner & Jahr genannt, ist ein Gebäude in der Karl-Liebknecht-Straße 29 im Berliner Ortsteil Mitte nördlich vom Alexanderplatz aus der Zeit der DDR. Es war bis zum Jahr 2017 der Sitz des Berliner Verlags, zu dem die Berliner Zeitung und der Berliner Kurier gehörten. In dem vorgelagerten Flachbau war zu DDR-Zeiten das Pressecafé untergebracht. An dem Flachbau befindet sich der Fries Die Presse als Organisator des Malers Willi Neubert, der durch die Leuchtschrift des hier inzwischen befindlichen Restaurants verdeckt ist.\\nDas Gebäude steht seit 2015 unter Denkmalschutz. Derzeit wird das Gebäude hergerichtet für eine Nutzung als Sitz verschiedener Unternehmen."},{"page_url":"https://de.wikipedia.org/wiki/Wildschaden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Schutzwaldsanierung_Hinterstein.JPG","page_title":"Wildschaden","context_page_description":"Als Wildschaden werden durch Wild verursachte Schäden bezeichnet, insbesondere solche in der Land-, Forst- und Fischereiwirtschaft.\\nDer bei der Kollision eines Fahrzeugs mit einem Wildtier entstehende Schaden ist im juristischen Sinne kein Wildschaden, sondern wird als Wildunfall bezeichnet. Der dabei entstehende Schaden am Fahrzeug ist ein Unfallschaden, der im Regelfall durch die Fahrzeug-Teilkasko-Versicherung abgedeckt ist. Ebenso ist Wildschaden nicht mit Jagdschaden zu verwechseln, der anlässlich der Jagdausübung entstehen kann."},{"page_url":"https://de.wikipedia.org/wiki/Volksmiliz_(Ukraine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/2015-05-05._%D0%A0%D0%B5%D0%BF%D0%B5%D1%82%D0%B8%D1%86%D0%B8%D1%8F_%D0%BF%D0%B0%D1%80%D0%B0%D0%B4%D0%B0_%D0%9F%D0%BE%D0%B1%D0%B5%D0%B4%D1%8B_101.jpg","page_title":"Volksmiliz (Ukraine)","context_page_description":"Volksmiliz ist die Eigenbezeichnung paramilitärischer Truppen in der Ostukraine. Sie wurden gleichzeitig in verschiedenen Städten aktiv, nachdem sich Präsident Wiktor Janukowytsch aus der Hauptstadt abgesetzt hatte. Seit dem April 2014 kämpfen sie für die Volksrepubliken Donezk und Lugansk, und damit gegen regierungstreue Einheiten im Ukrainekrieg.\\nWie auf der Krim waren aus Russland eindringende bewaffnete Sondertruppen beteiligt. Im November 2014 sagte Igor Girkin, dass der Krieg in der Ostukraine von ihm und seiner Einheit ausgelöst worden sei: „Den Auslöser zum Krieg habe ich gedrückt. Wenn unsere Einheit nicht über die Grenze gekommen wäre, wäre alles so ausgegangen wie in Charkiw und in Odessa“. Girkin, zeitweilig Verteidigungsminister der Volksrepublik Donezk, hatte im Mai 2014 erklärt, zwei Drittel der Rebellen seien Ukrainer.\\nRussland unterstützt die Milizen durch das Einsickernlassen von Freischärlern und durch Lieferungen von schweren Waffen bis hin zu Kampfpanzern: Anführer der Kämpfer bestätigten im Sommer 2014 die Anwesenheit aktiver russischer Soldaten „auf Urlaub“. Deren Ausrüstung verrät immer wieder, dass sie aktive russische Soldaten sind."},{"page_url":"https://en.wikipedia.org/wiki/List_of_German_inventions_and_discoveries","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Magnavox-Odyssey-Console-Set.jpg","page_title":"List of German inventions and discoveries","context_page_description":"German inventions and discoveries are ideas, objects, processes or techniques invented, innovated or discovered, partially or entirely, in Germany or abroad by a person from Germany. Often, things discovered for the first time are also called inventions and in many cases, there is no clear line between the two.\\nGermany has been the home of many famous inventors, discoverers and engineers, including Carl von Linde, who developed the modern refrigerator; Paul Nipkow, who laid the foundation of the television with his Nipkow disk; Hans Geiger, the creator of the Geiger counter; and Konrad Zuse, who built the first fully automatic digital computer and the first commercial digital computer. Such German inventors, engineers and industrialists as Count Ferdinand von Zeppelin, Otto Lilienthal, Gottlieb Daimler, Rudolf Diesel, Hugo Junkers and Karl Benz helped shape modern automotive and air transportation technology. Aerospace engineer Wernher von Braun developed the first space rocket at Peenemünde and later on was a prominent member of NASA and developed the Saturn V Moon rocket."},{"page_url":"https://en.wikipedia.org/wiki/The_Bank_Dick","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/The_Bank_Dick_%281940_poster_-_Style_D%29.jpg","page_title":"The Bank Dick","context_page_description":"The Bank Dick, released as The Bank Detective in the United Kingdom, is a 1940 comedy film starring W.C. Fields. Set in Lompoc, California, Fields plays Egbert Sousé who accidentally thwarts a bank robbery and ends up a bank security guard as a result. The character is a drunk who must repeatedly remind people in exasperation that his name is pronounced \\"Sousé—accent grave over the 'e'!\\", because people keep calling him \\"Souse\\", slang for drunkard. In addition to bank and family scenes, it features Fields pretending to be a film director and ends in a chaotic car chase. The Bank Dick is considered a classic of his work, incorporating his usual persona as a drunken henpecked husband with a shrewish wife, disapproving mother-in-law, and savage children.\\nThe film was written by Fields, using the alias \\"Mahatma Kane Jeeves\\", derived from the Broadway drawing-room comedy cliche, \\"My hat, my cane, Jeeves!\\", and directed by Edward F. Cline. The featured actors were Una Merkel, Richard Purcell, Shemp Howard, Franklin Pangborn, Grady Sutton, Jessie Ralph, and Cora Witherspoon."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%DB%8C%D9%84%D9%86%D8%AF%D8%8C_%D9%85%DB%8C%D8%B4%DB%8C%DA%AF%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Leland_Michigan_aerial_view.jpg","page_title":"لیلند، میشیگان","context_page_description":"لیلند یک منطقهٔ مسکونی در ایالات متحده آمریکا است که در شهرستان لیلانائو واقع شده‌است. لیلند ۲٬۰۳۳ نفر جمعیت دارد و ۱۷۷٫۰۹ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://ceb.wikipedia.org/wiki/F%C3%A1rsala","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/2011_Dimos_Farsalon.png","page_title":"Fársala","context_page_description":"Kapital sa munisipyo ang Fársala sa Gresya. Nahimutang ni sa prepektura sa Nomós Larísis ug rehiyon sa Thessaly, sa sentro nga bahin sa nasod, 190 km sa amihanan-kasadpan sa Athens ang ulohan sa nasod. 145 metros ibabaw sa dagat kahaboga ang nahimutangan sa Fársala, ug adunay 10,380 ka molupyo.\\nAng yuta palibot sa Fársala kay patag sa amihanan, apan sa habagatan nga kini mao ang kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 311 ka metro ug 1.1 km sa habagatan-sidlakan sa Fársala. Dunay mga 38 ka tawo kada kilometro kwadrado sa palibot sa Fársala medyo gamay nga populasyon. Fársala ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kaumahan ang palibot sa Fársala. Sa rehiyon palibot sa Fársala, mga bungtod talagsaon komon.\\nAng klima mediteranyo. Ang kasarangang giiniton 16 °C. Ang kinainitan nga bulan Hulyo, sa 29 °C, ug ang kinabugnawan Disyembre, sa 5 °C. Ang kasarangang pag-ulan 668 milimetro matag tuig. Ang kinabasaan nga bulan Pebrero, sa 96 milimetro nga ulan, ug ang kinaugahan Agosto, sa 9 milimetro."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B4%BE%E0%B5%BB%E0%B4%B9%E0%B4%BE_%E0%B4%95%E0%B4%9F%E0%B5%81%E0%B4%B5_%E0%B4%B8%E0%B4%82%E0%B4%B0%E0%B4%95%E0%B5%8D%E0%B4%B7%E0%B4%BF%E0%B4%A4%E0%B4%95%E0%B5%87%E0%B4%A8%E0%B5%8D%E0%B4%A6%E0%B5%8D%E0%B4%B0%E0%B4%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Hard_ground_barasingha.jpg","page_title":"കാൻഹാ കടുവ സംരക്ഷിതകേന്ദ്രം","context_page_description":"ഇന്ത്യയിലെ കടുവ സംരക്ഷിതപ്രദേശങ്ങളിലൊന്നും മദ്ധ്യപ്രദേശിലെ ഏറ്റവും വലിയ ദേശീയോദ്യാനവുമാണ് കാൻഹാ കടുവ സംരക്ഷിതകേന്ദ്രം അഥവാ കാൻഹാ ദേശീയോദ്യാനം. ഏകദേശം 940 ചതുരശ്ര കിലോമീറ്റർ വിസ്തൃതിയുള്ള ഈ വനപ്രദേശത്തെ 1955-ൽ ദേശീയോദ്യാനമായും 1973-ൽ കടുവ സംരക്ഷണകേന്ദ്രമായും പ്രഖ്യാപിച്ചു. ബംഗാൾ കടുവ, ഇന്ത്യൻ പുള്ളിപ്പുലി, തേൻകരടി, ബാരസിംഗ മാൻ, ഇന്ത്യൻ കാട്ടുനായ എന്നിവയുടെ ആവാസകേന്ദ്രമാണ് ഇവിടം. റുഡ്യാർഡ് കിപ്ലിംഗിന്റെ ദി ജംഗിൾ ബുക്ക് എന്ന കൃതിക്കു പശ്ചാത്തലമായ വനപ്രദേശം കൂടിയാണിത്. ഇന്ത്യയിലാദ്യമായി ഔദ്യോഗിക ചിഹ്നമുള്ള കടുവ സംരക്ഷണകേന്ദ്രം എന്ന പ്രത്യേകതയും കാൻഹയ്ക്കുണ്ട്. 'ബൂർസിംഗ് ദ ബാരസിംഗ' ആണ് ഔദ്യോഗിക ചിഹ്നം."},{"page_url":"https://it.wikipedia.org/wiki/Daniel_Agger","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Daniel_Agger_20120613.jpg","page_title":"Daniel Agger","context_page_description":"Daniel Munthe Agger è un ex calciatore danese, di ruolo difensore."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%98%E3%83%83%E3%82%BB%E3%83%B3%E6%80%A5%E4%BD%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Hambacher_Fest_1832.jpg","page_title":"ヘッセン急使","context_page_description":"『ヘッセン急使』は、ゲオルク・ビューヒナーとフリードリヒ・ルートヴィヒ・ヴァイディヒによって1834年に執筆、頒布された、8ページの政治的パンフレット。彼らはこの文書で、貧困にあえいでいた農民や手工業者に蜂起を促し、当時のヘッセン大公国の旧体制を覆そうとしたが、この試みは失敗に終わった。ヴィルヘルム・ヴァイトリングの『人類の現状と理想』と並び19世紀ドイツにおける革命思想の出発点に位置する著作であり、またマルクス＝エンゲルスの『共産党宣言』に次いで翻訳されることの多い政治的パンフレットとも評されている。"},{"page_url":"https://en.wikipedia.org/wiki/La_Chiffonni%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/La_Chiffonni%C3%A8re_%2822750217568%29.jpg","page_title":"La Chiffonnière","context_page_description":"La Chiffonnière is a stainless steel sculpture by French artist Jean Dubuffet, installed in Justin Herman Plaza, in San Francisco's Financial District, in the U.S. state of California. The 22-foot tall, 4,500 pound artwork was conceived in 1972 and completed in 1978. It was displayed in Manhattan's Doris C. Freedman Plaza from March 20 to December 12, 1979."},{"page_url":"https://it.wikipedia.org/wiki/Fossa_Magna","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Mulini_04.jpg","page_title":"Fossa Magna","context_page_description":"La Fossa Magna è un canale della Lombardia che scorre nella provincia di Brescia.\\nCostruito da Bernabò Visconti in origine partiva dal fiume Chiese, passando per Lonato, per ricongiungersi al fiume dopo 15 km.\\nNasce dal Fontanone di Sant'Apollonia ed è alimentato da due affluenti, la Seriola Lametta e il Fontanone della Scala.\\nIl percorso della Fossa Magna all'interno dell'abitato di Carpenedolo è stato parzialmente coperto nell'Ottocento ed in alcuni tratti è a secco."},{"page_url":"https://de.wikipedia.org/wiki/Lachterkette","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Fotothek_df_tg_0000236_Geometrie_%5E_Vermessung_%5E_Instrument.jpg","page_title":"Lachterkette","context_page_description":"Die Lachterkette ist eine Messkette. Sie gehörte zum historischen Werkzeug des Markscheiders. Die Teilung erfolgte in Lachtern oder „Kugeln“, später Metern."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BC%D0%B8%D0%BB%D0%BB%D0%B8%D0%B0%D1%80%D0%B4%D0%B5%D1%80%D0%BE%D0%B2_(2006)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/RomanAbramovic.jpg","page_title":"Список миллиардеров (2006)","context_page_description":"Список людей, состояние которых превышает 1 млрд долл. на февраль 2006 года по версии журнала Forbes.\\nСовокупное состояние участников рейтинга составляет 2,6 трлн долларов.\\nПо количеству миллиардеров, живущих в одном городе, на первом месте находится Нью-Йорк, на втором — Москва."},{"page_url":"https://fr.wikipedia.org/wiki/Sylv%C3%A8re_Maes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Sylv%C3%A8re_Maes_-_2.jpg","page_title":"Sylvère Maes","context_page_description":"Sylvère Maes, né le 27 août 1909 à Zevekote et mort le 5 décembre 1966 à Ostende, est un coureur cycliste belge. Il a notamment remporté le Tour de France en 1936 et 1939, et Paris-Roubaix en 1933. Il n'a aucun lien de parenté avec Romain Maes qui a remporté le Tour de France 1935."},{"page_url":"https://cy.wikipedia.org/wiki/Teyrn_du_piglas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Knipolegus_cyanirostris_-Reserva_Guainumbi%2C_Sao_Luis_do_Paraitinga%2C_Sao_Paulo%2C_Brasil-8.jpg","page_title":"Teyrn du piglas","context_page_description":"Aderyn a rhywogaeth o adar yw Teyrn du piglas a adnabyddir hefyd gyda'i enw gwyddonol Knipolegus cyanirostris; yr enw Saesneg arno yw Blue-billed black-tyrant. Mae'n perthyn i deulu'r Teyrn-wybedogion sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn K. cyanirostris, sef enw'r rhywogaeth."},{"page_url":"https://cs.wikipedia.org/wiki/Zem%C4%9B_Erika_Rud%C3%A9ho","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/EricTheRedsLand.gif","page_title":"Země Erika Rudého","context_page_description":"Země Erika Rudého je označení, které používali Norové pro oblast na východě Grónska, na kterou si činili nárok."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%81%B0%E6%9E%97%E9%B8%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Tawny_wiki_edit1.jpg","page_title":"灰林鸮","context_page_description":"灰林鸮是林鸮属的一种中型猫头鹰，普遍分布在欧亚大陆的林地。下身淡色及有深色的条纹，上身呈褐色或灰色，已知11个亚种中有几种不同的色型。一般会在树孔中筑巢，并会保护鸟蛋及雏鸟。灰林鸮不迁徙，有高度的区域性，雏鸟若离开父母后若不能找到领土就要面对捱饿的可能。\\n灰林鸮是夜间活动的猛禽，主要猎食啮齿目动物。灰林鸮会从高处俯冲下来捉住猎物，并将之整个吞下。夜间以视觉及听觉捕捉猎物，飞行时几乎没有声音。灰林鸮能够捕捉较小的猫头鹰，但年轻的灰林鸮有可能反被雕鸮、苍鹰或狐狸等猎杀。虽然灰林鸮的夜间视觉很强，但对颜色的分辨却没有人类的灵敏。灰林鸮的夜间习性及怪异的叫声，使人往往将其与死亡及不幸相联系。"},{"page_url":"https://nl.wikipedia.org/wiki/Thyle","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Thyle-Villers2.jpg","page_title":"Thyle","context_page_description":"De Thyle is een rivier gelegen in de provincie Waals-Brabant in België. Het is een zijrivier van de Dijle en maakt via de Dijle en de Rupel deel uit van het stroomgebied van de Schelde. Vlak voor de monding in de Dijle, net ten zuiden van Ottignies-Louvain-la-Neuve, vloeit de Thyle eerst nog samen met de Orne. Beide rivieren hebben een diep dal uitgesneden in het Brabants plateau.\\nDeze rivier stroomt dwars door de abdij van Villers in Villers-la-Ville. Zoals bijna alle cisterciënzerabdijen gebruikte ook deze abdij het water voor zijn economische activiteiten. Het is trouwens opmerkelijk vast te stellen dat de latrines in de abdij zich stroomopwaarts bevonden van de brouwerij."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D1%80%D0%B0_(%D0%BF%D1%80%D0%B8%D1%82%D0%BE%D0%BA_%D0%92%D0%B8%D0%B4%D0%BB%D0%B8%D1%86%D1%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/%D0%9A%D1%83%D1%80%D0%B0_%28%D0%BF%D1%80%D0%B8%D1%82%D0%BE%D0%BA_%D0%92%D0%B8%D0%B4%D0%BB%D0%B8%D1%86%D1%8B%29_2.jpg","page_title":"Кура (приток Видлицы)","context_page_description":"Кура — река в России, протекает по Пряжинскому району Карелии."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_Vua_Abydos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Abydos_Koenigsliste_20-25.jpg","page_title":"Danh sách Vua Abydos","context_page_description":"Danh sách Vua Abydos là một danh sách liệt kê tên gọi, niên hiệu của 76 vị vua Ai Cập cổ đại, được tìm thấy trên các bức tường đền thờ của Pharaon Seti I ở Abydos, Ai Cập. Nó gồm có 3 hàng và 38 chữ tượng hình trên mỗi hàng. Hai hàng đầu chứa tên các vị vua, trong khi hàng thứ ba chỉ đơn thuần lặp đi lặp lại tên ngai và tên của Seti I, praenomen. Bên cạnh việc cung cấp thứ tự các vị vua thời Cổ Vương quốc, danh sách này còn nêu tên vài vị vua cai trị của Vương triều thứ 7 và Vương triều thứ 8. Ngoài ra, nó còn đã lượt bỏ bớt tên các pharaon như Hatshepsut, Akhenaten, Smenkhkare, Tutankhamen và Ay."},{"page_url":"https://en.wikipedia.org/wiki/Paul_Poani%C3%A9wa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Paul_Poaniewa_en_1976_%28JO%29%2C_%27Montreal_76%27%2C_Panini_figurina_n%C2%B0129.jpg","page_title":"Paul Poaniéwa","context_page_description":"Paul Poaniéwa is a retired French athlete. He competed in the men's high jump at the 1976 Summer Olympics."},{"page_url":"https://fr.wikipedia.org/wiki/Moussy-Verneuil","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Moussy-Verneuil_limite_Soupir_%28Aisne%29_Canal_de_l%27Oise_%C3%A0_l%27Aisne%2C_%C3%A9cluse_nr_12_de_Moussy-Soupir_%2802%29.JPG","page_title":"Moussy-Verneuil","context_page_description":"Moussy-Verneuil est une commune française située dans le département de l'Aisne, en région Hauts-de-France."},{"page_url":"https://de.wikipedia.org/wiki/Rienzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Illustrirte_Zeitung_%281843%29_07_013_4_Adriano_-_Mad_Schr%C3%B6der-Devrient.PNG","page_title":"Rienzi","context_page_description":"Rienzi, der letzte der Tribunen ist eine große tragische Oper in fünf Akten mit sechzehn Nummern von Richard Wagner. Sie wurde 1842 uraufgeführt. Auch das Libretto stammt, wie bei allen Opern Wagners, vom Komponisten. Die Oper handelt in freien Zügen vom Leben des spätmittelalterlichen römischen Staatsmanns und Volkstribuns Cola di Rienzo.\\nRienzi gilt als Adolf Hitlers Lieblingsoper und spielte während der Zeit des Nationalsozialismus eine zentrale Rolle, unter anderem auf den Reichsparteitagen in Nürnberg."},{"page_url":"https://en.wikipedia.org/wiki/Antti_H%C3%A4kk%C3%A4nen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/2017-10_Antti_H%C3%A4kk%C3%A4nen_1_%28cropped%29.jpg","page_title":"Antti Häkkänen","context_page_description":"Antti Edvard Häkkänen is a Finnish politician, representing the National Coalition Party. He has served as a Member of Parliament since 22 April 2015. From 2017 to 2019, Häkkänen served as the Minister of Justice in Sipilä Cabinet."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%88%D6%82%D6%80%D5%AE_(%D5%AC%D5%A5%D5%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Mount_Urtc%2C_summit%2C_2014.06.17_-_panoramio.jpg","page_title":"Ուրծ (լեռ)","context_page_description":"Ուրծ, Սարայբուլագ, Սարայբուլախ, Սարայբուլաղ, լեռ Հայաստանի Արարատի մարզում, Ուրծի լեռներում, Լանջառ գյուղից 5 կմ հարավ–արևմուտք։ Բարձրությունը 2446 մ է։\\nՈւրծի լեռնաշղթան բուսականությունից զուրկ է, ձգվում է Արարատյան դաշտի եզրով՝ կենտրոնական մասում հասնելով 2446 մետր բարձրության։"},{"page_url":"https://tr.wikipedia.org/wiki/Oryantal_Ortodoksluk","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Oriental_Orthodoxy_by_country.png","page_title":"Oryantal Ortodoksluk","context_page_description":"Oryantal Ortodoksluk Birinci İznik Konsili, Birinci Konstantinopolis Konsili ve Birinci Efes Konsili'nden oluşan ilk üç ekümenik konsili tanıyan Ortodoks Doğu Hristiyan inancı. Dünya çapında yaklaşık 84 milyon inananı vardır.\\n451 yılında Kalkedon'da icra edilen konsilin tanımlamalarını reddederler. Bu yüzden Eski Oryantal olarak da adlandırılan miafizit ya da Kalkedon olmayan Oryantal Ortodoks Kiliseler Batı Hristiyanlığı ve birçok Doğu Ortodoks Kilisesi tarafından monofizit kabul edilir. Bu kiliseler birbirleri arasında tam komünyon olmalarına rağmen Doğu Ortodoks Kilisesi ile böyle bir bağları yoktur. 20. yüzyılın ortalarından beri komünyonu restore etmek için diyaloglar yapılmaktadır.\\nAdlandırılmasındaki karmaşıklığa rağmen Oryantal Ortodoks kiliseleri Doğu Ortodoks Kilisesi'nden farklıdır. Oryantal Ortodoks komünyonu altı kiliseden meydana gelir: Kıpti, Etiyopya, Eritre, Süryani, Malankara Ortodoks Süryani Kilisesi ve Ermeni Apostolik kiliseleri. Bu kiliseler birbirleriyle tam komünyon içinde ve hiyerarşik olarak birbirine bağlıdır. Bu kiliselerin hepsi II. Tavadros'u Primus inter pares olarak kabul eder."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Horn_(Nieder%C3%B6sterreich)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/GuentherZ_2011-05-14_0037_Horn_Wiener_Strasse_Statue_Johannes_Nepomuk.jpg","page_title":"Liste der denkmalgeschützten Objekte in Horn (Niederösterreich)","context_page_description":"Die Liste der denkmalgeschützten Objekte in Horn enthält die 95 denkmalgeschützten, unbeweglichen Objekte der niederösterreichischen Bezirkshauptstadt Horn."},{"page_url":"https://la.wikipedia.org/wiki/Ouilly-le-Tesson","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Ouilly_Chateau_Assy.JPG","page_title":"Ouilly-le-Tesson","context_page_description":"Ouilly-le-Tesson est commune Francicum 532 incolarum praefecturae Calvorum Dorsorum in regione Normannia Inferiori."},{"page_url":"https://es.wikipedia.org/wiki/Campeonato_Descentralizado_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/600px_Giallo2.PNG","page_title":"Campeonato Descentralizado 2010","context_page_description":"El Campeonato Descentralizado de la Primera División de fútbol profesional del Perú 2010, fue 94º edición de la Liga Peruana y la \\"cuadragésima quinta\\" que se realiza bajo la denominación de Descentralizado. Comenzó el sábado 13 de febrero y finalizó el domingo 12 de diciembre. Participaron 16 equipos y se otorgaron tres cupos tanto para la Copa Libertadores 2011 como para la Copa Sudamericana 2011."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%90%D0%97-1118","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Lada_Kalina.JPG","page_title":"ВАЗ-1118","context_page_description":"ВАЗ-1118 — перший автомобіль сімейства «Лада Калина», поставлений на конвеєр ВАТ «АвтоВАЗ» 18 листопада 2004 року. Має кузов типу седан. Основним розробником є Віктор Ничипрук."},{"page_url":"https://de.wikipedia.org/wiki/Air_Division","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/USAF_-_8th_Air_Division.png","page_title":"Air Division","context_page_description":"Air Division war die Bezeichnung für Großverbände der US Air Force, die in der militärischen Hierarchie zwischen den Numbered Air Forces und den Wings eingeordnet waren. Im Normalfall war eine Air Division einer Numbered Air Force unterstellt und umfasste wiederum mehrere Wings und selbstständige Elemente. Das Konzept der Air Divisions wurde während bzw. nach dem Zweiten Weltkrieg geschaffen; Anfang der 1990er-Jahre wurden die letzten Verbände dieser Art dann durch Umstrukturierung aufgelöst.\\nJe nach Einsatzzweck wurden auch die alternativen Bezeichnungen Airlift Division, Strategic Aerospace Division, Strategic Missile Division und Space Division verwendet. Insgesamt existierten 101 Verbände.\\nIn etwa vergleichbar sind die Luftwaffendivisionen der Bundeswehr. Nur Namensähnlichkeit und kein organisatorischer Zusammenhang besteht hingegen zu den Airborne Divisions und Air Assault Divisions der US Army."},{"page_url":"https://fr.wikipedia.org/wiki/Picus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Gr%C3%BCnspecht_Picus_viridis.jpg","page_title":"Picus","context_page_description":"Le genre Picus regroupe 13 espèces d'oiseaux appartenant à la famille des Picidae."},{"page_url":"https://fr.wikipedia.org/wiki/Mus%C3%A9e_national_du_Soudan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/SUDAN_NATIONAL_MUSEUM.JPG","page_title":"Musée national du Soudan","context_page_description":"Le musée national du Soudan de Khartoum, la capitale, possède la plus vaste collection archéologique du pays.\\nLe projet de construction du musée, ébauché dans les années 1950, est achevé dans les années 1960 avec l’aide de l’UNESCO et à la suite de la création du lac Nasser en 1964 qui mettait en danger un vaste patrimoine archéologique. L’inauguration a lieu en 1971.\\nLe musée inclut un bâtiment principal d’exposition, trois petits temples déplacés avant l’inondation des terres par le lac Nasser et protégés dans des hangars, et un jardin avec une reproduction miniature du Nil. Les pièces exposées proviennent notamment de la Préhistoire, l’Égypte antique, le royaume de Koush, la période post-méroïtique, auxquelles il faut ajouter des fresques chrétiennes de la cathédrale de Faras."},{"page_url":"https://pl.wikipedia.org/wiki/Szczupak_amurski","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/%D0%A1%D0%B2%D0%B5%D0%B6%D0%B5%D0%B2%D1%8B%D0%BB%D0%BE%D0%B2%D0%BB%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B0%D0%BC%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D1%89%D1%83%D0%BA%D0%B0.JPG","page_title":"Szczupak amurski","context_page_description":"Szczupak amurski – gatunek drapieżnej ryby z rodziny szczupakowatych, opisany po raz pierwszy przez polskiego przyrodnika Benedykta Dybowskiego w 1869 roku."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_weermannen_en_weervrouwen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Gerrit_Hiemstra.png","page_title":"Lijst van weermannen en weervrouwen","context_page_description":"Weermannen en -vrouwen presenteren het weerbericht op de televisie.\\nSommige meteorologen worden bekend als weerman of weervrouw, maar niet elke weerman of weervrouw is meteoroloog."},{"page_url":"https://en.wikipedia.org/wiki/Beechcraft_King_Air","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/N350TJ.JPG","page_title":"Beechcraft King Air","context_page_description":"The Beechcraft King Air family is part of a line of American utility aircraft produced by Beechcraft. The King Air line comprises a number of twin-turboprop models that have been divided into two families. The Model 90 and 100 series developed in the 1960s are known as King Airs, while the later T-tail Model 200 and 300 series were originally marketed as Super King Airs, with the name \\"Super\\" being dropped by Beechcraft in 1996.\\nThe King Air was the first aircraft in its class and has been in continuous production since 1964. It has outsold all of its turboprop competitors combined. It now faces competition from jet aircraft such as the Embraer Phenom 100, Honda HA-420 HondaJet and Cessna Citation Mustang; as well as from newer turboprop aircraft including the Piaggio P180 Avanti, and single-engine Piper Malibu Meridian, Pilatus PC-12, and Socata TBM."},{"page_url":"https://pt.wikipedia.org/wiki/Lavera%C3%ABt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Lavera%C3%ABt_%28Gers%2C_Fr%29_%C3%A9glise.JPG","page_title":"Laveraët","context_page_description":"Laveraët é uma comuna francesa na região administrativa de Occitânia, no departamento de Gers. Estende-se por uma área de 11,86 km². Em 2010 a comuna tinha 121 habitantes."},{"page_url":"https://ca.wikipedia.org/wiki/Stonarov","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Stona%C5%99ov%2C_road_No_38.jpg","page_title":"Stonarov","context_page_description":"Stonarov és una vila del districte de Jihlava, a la regió de Vysočina, a la República Txeca. La seva població s'elevava a 1.075 habitants l'any 2018."},{"page_url":"https://es.wikipedia.org/wiki/Llanos_de_Chiquitos","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Chiquitos_map_1789.jpg","page_title":"Llanos de Chiquitos","context_page_description":"Los Llanos de Chiquitos o Chiquitania es el nombre de una extensa llanura de América del Sur en Bolivia ubicada en la zona transicional ecotónica entre el Gran Chaco y la Amazonia. En líneas generales en los Llanos de Chiquitos predominan aspectos del bioma chaqueño."},{"page_url":"https://en.wikipedia.org/wiki/%27s-Hertogenbosch_Oost_railway_station","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Stationoostdenbosch05jan2007.JPG","page_title":"'s-Hertogenbosch Oost railway station","context_page_description":"'s-Hertogenbosch Oost railway station serves the city of 's-Hertogenbosch in the North Brabant province of the Netherlands."},{"page_url":"https://es.wikipedia.org/wiki/Salina_Cruz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/SalinaCruz.png","page_title":"Salina Cruz","context_page_description":"Salina Cruz es una ciudad y puerto del Estado de Oaxaca. Ubicada en el Golfo de Tehuantepec, en el sureste de México. Salina Cruz posee una refinería, varias salineras, un astillero y es uno de los 10 puertos más importantes de México.​ Según el conteo de población y vivienda de 2010, la ciudad tiene 76 596 habitantes; como ciudad se coloca como la tercera más poblada del estado y el sexto a nivel municipal con una población de 89 211 habitantes detrás de Oaxaca de Juárez, San Juan Bautista Tuxtepec y Juchitán de Zaragoza. La edad media de la población municipal es de 28 años, la edad media de los hombres es de 27 años y la edad media de las mujeres es de 29 años."},{"page_url":"https://it.wikipedia.org/wiki/Natalino_Balasso","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Natalino_Balasso_-_Pordenonelegge_2013.jpg","page_title":"Natalino Balasso","context_page_description":"Natalino Balasso è un attore, comico e scrittore italiano. Autore e attore di teatro, cinema, radio e televisione, ha debuttato in teatro nel 1991, in televisione a fine anni novanta, al cinema nel 2007 e ha scritto alcuni libri di narrativa."},{"page_url":"https://tr.wikipedia.org/wiki/Kompozit_Z%C4%B1rhlar","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Plasan_SandCat.jpg","page_title":"Kompozit Zırhlar","context_page_description":"Kompozit Zırhlar günümüzde metaller gibi klasik malzemelerin birçok özellikleri gelişen teknolojinin ihtiyaçları için yeterli olamayınca, daha üstün özelliklere sahip olan kompozit malzemeler üretilmeye başlanarak bu konuda hızlı bir gelişme sürecine girilmiştir. Klasik malzemelere göre kompozit malzemelerin en belirgin özellikleri hafiflik ve sağlamlıklarıdır. Yapılan araştırma ve geliştirmeler neticesinde, bu malzemelerin çekme, darbe dayanımlarının artırılması; yorulma, kimyasal direnç ve elektrik özelliklerinin iyileştirilmesi mümkün olmuş ve kompozit malzemeler yaygın şekilde havacılık, deniz taşıtları, otomotiv, makine, inşaat, askeri ve uzay teknolojisi alanlarında kullanılmaya başlanmıştır."},{"page_url":"https://zh.wikipedia.org/wiki/%E3%80%8C%E8%AD%B4%E8%B2%AC%E9%8E%AE%E5%A3%93%EF%BC%8C%E6%92%A4%E5%9B%9E%E6%83%A1%E6%B3%95%E3%80%8D%E5%A4%A7%E9%81%8A%E8%A1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Hong_Kong_Demonstration_20190616_Causeway_Bay-1.jpg","page_title":"「譴責鎮壓，撤回惡法」大遊行","context_page_description":"「譴責鎮壓，撤回惡法」大遊行，通稱「616大遊行」，由民間人權陣線於2019年6月16日舉辦，是6月9日遊行後再一次同類遊行。由於6月15日政府宣告暫緩修法，關於修法本身的民情已降溫，但追究警察在6月12日街道佔領時濫權的呼聲令運動遲遲不能收場。由此，本遊行提出五大要求：撤回《逃犯條例修訂草案》、不檢控示威者、追究6月12日街道佔領時警方以催淚彈和橡膠子彈濫用武力執法及向醫院索閱示威者資料，以檢控示威者的責任、撤銷6月12日衝突的暴動定性，以及林鄭月娥下台。遊行後政府對示威者訴求毫無回應，令運動膠著。後續有6月21日圍堵行政機關與警察總部。\\n國際廣泛關注此遊行，翌日登《紐約時報》與《華盛頓郵報》美國印刷版頭版。此遊行的人數是國際焦點，香港遊行的主辦方與警方公布人數一向相差數倍，主辦單位公布遊行有200萬零1人參與，是香港史上主辦方公布最多人參加的遊行；而警方宣稱遊行人數僅有33.8萬人，警方計算遊行人數的方法令一部分外媒如路透社、BBC、天下雜誌等提出質疑。由於本遊行倉促成行，不像6月9日與7月1日的遊行有人工智慧客觀統計，加上這次大遊行中人流不斷溢出多條原定遊行路線以外的街道，令統計人數工作更困難，本遊行雙方差距甚大的人數統計令到人工智慧取代傳統點算之議方興未艾。眾多第三方統計之中，路透社與一眾日本傳媒僅引用了在現場調試人工智慧系統的葉兆輝所提供的估算「50－80萬人」。"},{"page_url":"https://nl.wikipedia.org/wiki/Heideplatlijfje","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Depressaria_badiella.JPG","page_title":"Heideplatlijfje","context_page_description":"Het heideplatlijfje is een vlinder uit de familie grasmineermotten. De wetenschappelijke naam is voor het eerst geldig gepubliceerd in 1796 door Hübner.\\nDe soort komt voor in Europa."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_prot%C3%A9g%C3%A9s_en_1915","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Halles_de_Plouescat.jpg","page_title":"Liste des monuments historiques protégés en 1915","context_page_description":"Cet article recense les monuments historiques français classés en 1915."},{"page_url":"https://pl.wikipedia.org/wiki/Kandydaci_Partii_Demokratycznej_w_wyborach_prezydenckich_w_Stanach_Zjednoczonych","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/John_Nance_Garner.jpg","page_title":"Kandydaci Partii Demokratycznej w wyborach prezydenckich w Stanach Zjednoczonych","context_page_description":"To jest pełna lista kandydatów na urząd prezydenta Stanów Zjednoczonych i wiceprezydenta Stanów Zjednoczonych, którzy startowali z ramienia Partii Demokratycznej. Z wyjątkiem Andrew Jacksona w 1828 roku wszyscy kandydaci zostali wyłonieni przez głosowanie na Konwencji Partii Demokratycznej."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%84%DB%8C%D8%B3%D8%A7%DB%8C_%D9%85%D8%B9%D9%84%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Hanging_Church-inside.JPG","page_title":"کلیسای معلق","context_page_description":"کلیسای معلق در کوی مصر باستان در منطقه قاهره قبطی‌های باستان‌شناسی مهم واقع شده‌است، که در نزدیک مسجد عمروعاص و معبد عزرا یهودی و کلیسای قدیس مینا در همسایگی قلعه بابل و کلیسای مرقوریوس ابوسیفین و کلیساهای بسیار دیگر می‌باشد. این شهر به این دلیل معلق نامگذاری شد که بر روی دو برج از قلعه‌های باستانی قلعه روم ساخته شده‌است که توسط امپراتور تراژان در قرن دوم میلادی ساخته شده‌است و قدیمی‌ترین کلیسا در مصر است."},{"page_url":"https://vi.wikipedia.org/wiki/Wilhelm_I,_Ho%C3%A0ng_%C4%91%E1%BA%BF_%C4%90%E1%BB%A9c","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Schlacht-bei-k%C3%B6niggr%C3%A4tz.jpg","page_title":"Wilhelm I, Hoàng đế Đức","context_page_description":"Wilhelm I, là quốc vương Phổ từ ngày 2 tháng 1 năm 1861, chủ tịch Liên bang Bắc Đức từ ngày 1 tháng 7 năm 1867, và trở thành hoàng đế đầu tiên của đế quốc Đức vào ngày 18 tháng 1 năm 1871. Triều đại ông đánh dấu một bước ngoặt quan trọng trong lịch sử Đức, khi đất nước được thống nhất và trở thành một cường quốc lớn mạnh nhất châu Âu. Mặc dù thành tựu này có được nhờ những thành tựu chính trị của Thủ tướng Otto von Bismarck cũng như những thắng lợi quân sự của Helmuth von Moltke trong chiến tranh thống nhất nước Đức hơn là ông, vai trò của vị hoàng đế được thể hiện qua sự tin tưởng và trọng dung của ông đối với hai người này.\\nThời trẻ, trên cương vị là một sĩ quan quân đội Phổ, Wilhelm đã thể hiện lòng dũng cảm trong các cuộc chiến tranh chống Napoléon. Ông được phong cấp tướng lúc mới 21 tuổi. Sau khi vua cha Friedrich Wilhelm III mất, ông được anh là Friedrich Wilhelm IV phong làm Thái đệ kế vị. Tuy là một người bảo thủ, ông nhận thấy triều đình cần phải tiến hành một số nhượng bộ với phong trào tự do chủ nghĩa đương thời."},{"page_url":"https://sv.wikipedia.org/wiki/Victoria_(biograf,_Stockholm)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Victoria_aug_2009.jpg","page_title":"Victoria (biograf, Stockholm)","context_page_description":"Victoria är en biograf på Södermalm i Stockholm, belägen på hörnet Åsögatan / Götgatan 67. Den första filmen visades den 18 september 1936."},{"page_url":"https://pt.wikipedia.org/wiki/O_Homem_do_Dia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Alves_Barbosa_no_filme_Homem_do_Dia.PNG","page_title":"O Homem do Dia","context_page_description":"O Homem do Dia é um filme português do género drama musical, realizado por Henrique Campos e Teresita Miranda e escrito por José Maud e António Ferrão Lopes. Foi protagonizado por Maria Dulce, Alves Barbosa, Costinha, e Elita Martos e lançado nos cinemas de Portugal a 21 de fevereiro de 1958 pela Internacional Filmes."},{"page_url":"https://es.wikipedia.org/wiki/Pempheris","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/TsumaguroHP.jpg","page_title":"Pempheris","context_page_description":"Pempheris es un género de peces de la familia Pempheridae, del orden Perciformes. Este género marino fue descrito científicamente en 1829 por Georges Cuvier.​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Kitzingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Kitzingen%2C_Luitpoldstra%C3%9Fe_2_20170227_002.jpg","page_title":"Liste der Baudenkmäler in Kitzingen","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Großen Kreisstadt Kitzingen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 8. Mai 2020 wieder und enthält 238 Baudenkmäler."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%95%E0%A7%87%E0%A6%A8%E0%A7%8D%E0%A6%A6%E0%A7%8D%E0%A6%B0%E0%A7%80%E0%A6%AF%E0%A6%BC_%E0%A6%97%E0%A6%A3%E0%A6%97%E0%A7%8D%E0%A6%B0%E0%A6%A8%E0%A7%8D%E0%A6%A5%E0%A6%BE%E0%A6%97%E0%A6%BE%E0%A6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Public_Library_4_.A.M.R.jpg","page_title":"কেন্দ্রীয় গণগ্রন্থাগার","context_page_description":"সুফিয়া কামাল জাতীয় গণগ্রন্থাগার বা কেন্দ্রীয় গণগ্রন্থাগার বাংলাদেশের সবচেয়ে বড় পাঠাগার। এই গ্রন্থাগারটি ১৯৫৩ খ্রিষ্টাব্দে প্রতিষ্ঠিত হয়। এটি ঢাকার শাহবাগে অবস্থিত। অধিকন্তু এই গ্রন্থাগারটির প্রত্যক্ষ সহযোগিতায় বাংলাদেশের বিভিন্ন স্থানে সরকারি ও বেসরকারি গ্রন্থাগার পরিচালিত হচ্ছে।"},{"page_url":"https://id.wikipedia.org/wiki/Kentang_goreng","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Pommes-1.jpg","page_title":"Kentang goreng","context_page_description":"Kentang goreng adalah hidangan yang dibuat dari potongan-potongan kentang yang digoreng dalam minyak goreng panas. Di dalam menu rumah-rumah makan, kentang goreng yang dipotong panjang-panjang dan digoreng dalam keadaan terendam di dalam minyak goreng panas disebut French fries.\\nKentang goreng bisa dimakan begitu saja sebagai makanan ringan, atau sebagai makanan pelengkap hidangan utama seperti bistik, hamburger, fish and chips dan currywurst.\\nDi Britania Raya dan Negara-negara Persemakmuran, kentang goreng yang mirip french fries disebut chips. Di Amerika Utara, istilah \\"chips\\" berarti keripik kentang, sedangkan di Australia, Selandia Baru dan Afrika Selatan, \\"chips\\" bisa berarti kentang goreng atau keripik kentang."},{"page_url":"https://vo.wikipedia.org/wiki/Julian_(Pens%C3%BClv%C3%A4n)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Map_of_Julian%2C_Centre_County%2C_Pennsylvania_Highlighted.png","page_title":"Julian (Pensülvän)","context_page_description":"Julian binon zif in komot: Centre, in tat: Pensülvän, in Lamerikän."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D1%80%D0%BE%D0%BA%D0%BE%D0%B4%D0%B8%D0%BB_%D0%BD%D0%B0_%D0%94%D0%B6%D0%BE%D0%BD%D1%81%D1%82%D1%8A%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Crocodylus_johnstoni.jpg","page_title":"Крокодил на Джонстън","context_page_description":"Крокодилът на Джонстън, наричан още австралийски сладководен крокодил, е вид крокодил, разпространен в северните части на Австралия и в Нова Гвинея. Наименованието му е по името на неговия откривател Робърт Джонстън, който открил и описал влечугото през 1899 г.\\nТози вид е по-дребен в сравнение с други видове от този регион. Възрастните индивиди достигат дължина 4 метра. Продължителността на живота при този вид е около 80 години."},{"page_url":"https://fr.wikipedia.org/wiki/Ficimia_streckeri","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Ficimia_streckeri_distribution.png","page_title":"Ficimia streckeri","context_page_description":"Ficimia streckeri est une espèce de serpents de la famille des Colubridae."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Bern/Innere_Stadt_(Ost)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Bern_Tscharnerhaus_Kramgasse-1.jpg","page_title":"Liste der Kulturgüter in Bern/Innere Stadt (Ost)","context_page_description":"Die Liste der Kulturgüter in Bern/Innere Stadt (Ost) enthält alle Objekte im östlichen Teil des Stadtteil I, der Inneren Stadt von Bern, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nVerzeichnet werden Objekte im Grünen, Schwarzen und Weissen Quartier. Objekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind Objekte zu finden, die im Bauinventar der Stadt Bern als «schützenswert» verzeichnet sind.\\nViele der schützenswerten Bauten der östlichen Altstadt werden zurzeit im Bauinventar lediglich summarisch und ohne weitere Details aufgelistet, weshalb sie hier noch nicht berücksichtigt sind."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9F%83%E5%8F%8A%E6%B3%95%E8%80%81%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Abydos_Koenigsliste_39.jpg","page_title":"埃及法老列表","context_page_description":"這是一份古埃及統治者的列表。該表中列出的君主始自約前31世紀的第一王朝，結束於希臘人建立的托勒密王朝。這段時期中埃及的最高君主的稱號是人們熟知的法老。\\n同時請參見：\\n埃及前王朝時期統治者列表：前王朝時期上埃及和下埃及統治者列表\\n埃及統治者列表：阿拉伯征服埃及之後的統治者列表\\n埃及現代君主列表：拿破崙入侵埃及至今的君主列表\\n在使用此表時，請注意以下幾個問題：\\n表中沒有列出各法老的在位時期。這是因為第二十六王朝之前，法老的確切統治時期根本無法確定。關於古埃及歷史事件的年代問題，考古學界建立了許多不同的時間系統。例如，蘇聯考古學家和西方考古學家採取的時間體系相差約100年。\\n表中包含3位實際沒有採用法老稱號的女性統治者。\\n通常法老具有多個用途不同的名字。例如，第一王朝的法老有王銜和王名。在這個表中，只列出其中最通用的名字。如果您知道的某位法老在表中查不到，請嘗試在其所屬王朝的條目中查找，那裡列出了法老的所有名字。\\n很多法老名字的翻譯源自俄語資料，可能與其英語轉寫的讀音不符。"},{"page_url":"https://da.wikipedia.org/wiki/Gr%C3%B8nlandshaj","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Somniosus_microcephalus_distmap.png","page_title":"Grønlandshaj","context_page_description":"Grønlandshaj er også kendt under navnet havkal eller havkarl. På engelsk kaldes den bl.a. for sleeper shark pga. sit ry for at optræde særdeles sløvt og bevæge sig langsommeligt; maksimal hastighed anslås til 2,7 kilometer i timen. Inuitterne kalder den eqalussuaq."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AA%E3%83%83%E3%82%B8%E3%83%AA%E3%83%BC%E7%A0%A6%E3%81%AE%E6%88%A6%E3%81%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Fort_Ridgely.png","page_title":"リッジリー砦の戦い","context_page_description":"リッジリー砦の戦いは、アメリカ合衆国の南北戦争中に起きたインディアンとの闘争であるダコタ戦争の戦闘である。リッジリー砦は1853年から1855年に当時のミネソタ準州南部に建設され、サンティ・スー族インディアン居留地と開拓地の間では唯一の軍事基地だった。\\n1862年8月20日、大挙して押し寄せたインディアンに対し、急遽集められた志願兵を含む部隊が砦を守り抜いた。"},{"page_url":"https://pt.wikipedia.org/wiki/Pr%C3%ADncipe_do_Sacro_Imp%C3%A9rio_Romano-Germ%C3%A2nico","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Princely_Hat.svg","page_title":"Príncipe do Sacro Império Romano-Germânico","context_page_description":"Príncipe do Sacro Império Romano-Germânico foi um título atribuído a um Príncipe, Nobre ou Prelado hereditário reconhecido como tal pelo Sacro Imperador Romano."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D8%A8%D9%88%D9%86%D8%A7%D8%AA_%D8%A7%D9%84%D8%B1%D8%B5%D8%A7%D8%B5_%D8%A7%D9%84%D8%AB%D9%86%D8%A7%D8%A6%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Uhli%C4%8Ditan_olovnat%C3%BD.PNG","page_title":"كربونات الرصاص الثنائي","context_page_description":"كربونات الرصاص الثنائي مركب كيميائي له الصيغة PbCO₃، ويكون على شكل مسحوق بلورات أبيض. تجدر الإشارة إلى أن عدد أكسدة الرصاص في هذا المركب +2 كما يظهر الاسم. تعرف كربونات الرصاص القاعدية باسم أبيض الرصاص أو إسبيداج."},{"page_url":"https://hu.wikipedia.org/wiki/Franz_Overbeck","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Franz_Overbeck_by_H%C3%B6flinger.png","page_title":"Franz Overbeck","context_page_description":"Franz Camille Overbeck német protestáns teológus."},{"page_url":"https://it.wikipedia.org/wiki/Guglionesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Guglionesi.JPG","page_title":"Guglionesi","context_page_description":"Guglionesi è un comune italiano di 5 148 abitanti della provincia di Campobasso in Molise, il più esteso della regione con poco più di 100 km² di superficie."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%8E%AB%E4%BA%A8%E5%B7%B4%E6%A0%B9%E7%AB%B6%E6%8A%80%E4%BF%B1%E6%A8%82%E9%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Mohun_Bagan_1911_IFA_shield_winning_team.jpg","page_title":"莫亨巴根競技俱樂部","context_page_description":"莫亨巴甘竞技俱乐部简称莫亨巴甘，是一家设于印度西孟加拉邦加尔各答体育俱乐部，其下属部门包括足球、板球、曲棍球、网球等竞赛项目，其中最著名的是参加印度足球甲级联赛的职业足球队，球队在印度国内重大足球锦标赛多次夺得冠军，其中包括印度联合会杯、印度盾锦标赛、杜兰德杯等，为印度最成功的足球俱乐部。\\n莫亨巴甘于1889年建立，是印度历史最悠久，亚洲历史第二悠久的足球俱乐部，在1911年时，球队于印度盾锦标赛决赛以2-1击败东约克郡团，成为印度足球史上首支以印度人组成并夺得重大锦标赛冠军的球队。除了在印度联合会杯等重大足球锦标赛有优良表现外，莫亨巴甘并在流浪者杯、加尔各答足球联赛、国家足球联盟等，皆多次夺得冠军。1989年，莫亨巴甘成立100周年时，印度政府发行莫亨巴甘于1911年印度盾锦标赛胜利的纪念邮票，来庆祝这支印度足球史上最重要的一支球队。由于莫亨巴甘的历届球员大多表现不凡，因此许多球员经常被印度国家足球队征招，这些球员在国家队同样表现出色，其中在1951年与1962年亚洲运动会足球锦标赛上，皆夺冠军而回。\\n由于莫亨巴甘的不凡表现，球队在印度足球甲级联赛上拥有众多支持者，在印甲每场平均有众多观众前来观赛。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%82%B8%E3%83%A3%E3%83%BC%E3%83%BB%E3%83%A0%E3%83%BC%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Roger_Moore_-_Monte-Carlo_Television_Festival.JPG","page_title":"ロジャー・ムーア","context_page_description":"サー・ロジャー・ジョージ・ムーアは、イギリス出身の俳優。1973年から1985年の間に、映画『007』シリーズで、7作にわたってジェームズ・ボンドを演じた。身長は185cm。"},{"page_url":"https://uk.wikipedia.org/wiki/185-%D0%B9_%D0%B2%D0%B0%D0%B6%D0%BA%D0%B8%D0%B9_%D0%B1%D0%BE%D0%BC%D0%B1%D0%B0%D1%80%D0%B4%D1%83%D0%B2%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%B0%D0%B2%D1%96%D0%B0%D1%86%D1%96%D0%B9%D0%BD%D0%B8%D0%B9_%D0%BF%D0%BE%D0%BB%D0%BA_(%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/%D0%9C%D0%B5%D0%B4%D0%B0%D0%BB%D1%8C_55%D1%80%D0%BE%D0%BA%D1%96%D0%B2_185%D0%92%D0%91%D0%90%D0%9F.jpg","page_title":"185-й важкий бомбардувальний авіаційний полк (Україна)","context_page_description":"185-й гвардійський важкий бомбардувальний авіаційний полк — військове формування Повітряних сил України, що існувало в 1992—2007 роках. Полк мав на озброєнні надзвукові стратегічні реактивні бомбардувальники Ту-22М3."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%A0%ED%94%84%ED%84%B0%EC%8A%A4%EC%BF%A8%EC%9D%98_%EC%88%98%EC%83%81_%EB%B0%8F_%ED%9B%84%EB%B3%B4_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/After_School_Guess_party01.jpg","page_title":"애프터스쿨의 수상 및 후보 목록","context_page_description":"다음은 대한민국의 걸 그룹 애프터스쿨의 경력과 수상 내역 목록이다."},{"page_url":"https://fr.wikipedia.org/wiki/Montignac-de-Lauzun","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Montignac-de-Lauzun_village.jpg","page_title":"Montignac-de-Lauzun","context_page_description":"Montignac-de-Lauzun est une commune du Sud-Ouest de la France, située dans le département de Lot-et-Garonne."},{"page_url":"https://en.wikipedia.org/wiki/U.S._Route_18_in_Iowa","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/MarquetteJolietBridge.jpg","page_title":"U.S. Route 18 in Iowa","context_page_description":"U.S. Highway 18 is the northernmost east–west U.S. Highway in the state of Iowa. As with all state highways in Iowa, it is maintained by the Iowa Department of Transportation. It enters the state by crossing the Big Sioux River between Inwood and Canton, South Dakota. It travels 311 miles and connects Spencer, Mason City and Charles City. The highway leaves the state via the Marquette–Joliet Bridge over the Mississippi River at Marquette. Prior to becoming a U.S. Highway, the route US 18 follows was known as Primary Road No. 19 and the National Parks Pike."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CF%80%CE%AF%CF%81%CE%B3%CE%BA%CE%B9%CF%84_%CE%88%CE%B9%CE%B3%CE%BA%CE%B5%CE%BC%CE%B5%CE%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Birgit_%C3%95igemeel_20130225_by_Ahsoous.jpg","page_title":"Μπίργκιτ Έιγκεμελ","context_page_description":"Η Birgit Sarrap, επίσης γνωστή ως απλώς Birgit, είναι Εσθονή τραγουδίστρια. Η Õigemeel απέκτησε αναγνωρισιμότητα το 2007 μετά την νίκη της στην πρώτη σεζόν του Eesti otsib superstaari, την εσθονική έκδοση του Idol. Ο πρώτος ομώνυμος δίσκος της κυκλοφόρησε το 2008. Η Õigemeel έχει κυκλοφορήσει μέχρι σήμερα τέσσερις δίσκους.\\nΗ Õigemeel εκπροσώπησε την Εσθονία στον Διαγωνισμό Τραγουδιού της Eurovision 2013 με το τραγούδι \\"Et uus saaks alguse\\" μετά την νίκη της στο Eesti Laul 2013. Προκρίθηκε στον τελικό της διοργάνωσης, όπου κατέλαβε την 20η θέση."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BD%D0%B3%D0%B0%D0%BB%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Distribution_of_Languages_and_Religious_groups_of_Sri_Lanka_1981.jpg","page_title":"Сингали","context_page_description":"Сингали — один з двох народів, які проживають на території Шрі-Ланки. Самоназва — сінхала, буквально «левовий рід».\\nЧисельність — понад 12 млн. Ще близько 60 тис. живе в Індії, Австралії, Сінгапурі та Новій Зеландії. Мова — сингальська. Основна релігія — буддизм, почасти — християнство."},{"page_url":"https://it.wikipedia.org/wiki/Sabrina_Claudio","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Sabrina_Claudio_08_27_2018_-19_%2844687178811%29_%28cropped%29.jpg","page_title":"Sabrina Claudio","context_page_description":"Sabrina Claudio è una cantautrice statunitense."},{"page_url":"https://sv.wikipedia.org/wiki/Diplectanidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Calydiscoides_euzeti.jpg","page_title":"Diplectanidae","context_page_description":"Diplectanidae är en familj av plattmaskar. Diplectanidae ingår i ordningen Monopisthocotylea, klassen sugmaskar, fylumet plattmaskar och riket djur. Enligt Catalogue of Life omfattar familjen Diplectanidae 7 arter.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://pl.wikipedia.org/wiki/Ajos_Nikolaos_(Grecja)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Laden_Agios_Nikolaos.JPG","page_title":"Ajos Nikolaos (Grecja)","context_page_description":"Ajos Nikolaos – miasto w Grecji, na północno-wschodnim wybrzeżu Krety, w administracji zdecentralizowanej Kreta, w regionie Kreta, w jednostce regionalnej Lasiti. Siedziba gminy Ajos Nikolaos. W 2011 roku liczyło 11 421 mieszkańców.\\nNazwa miasta pochodzi od cerkwi św. Mikołaja z X wieku. Jest to jedna z najstarszych świątyń na Krecie. Cerkiew znajduje się na położonym w kierunku północno-wschodnim od miasta półwyspie na obszarze należącym obecnie do właścicieli pobliskiego luksusowego hotelu."},{"page_url":"https://ca.wikipedia.org/wiki/Sardana","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Sardana_Ceramic_Tiles.JPG","page_title":"Sardana","context_page_description":"La sardana és una dansa popular catalana considerada el ball nacional de Catalunya. És una dansa col·lectiva que ballen homes i dones agafats de les mans formant una rotllana, i puntejant amb els peus els compassos de la música interpretada per la cobla. El nom pot fer referència tant al ball com a la música.\\nPer a ballar la sardana, un nombre indeterminat de dansaires formen una rotllana agafats per les mans i mirant al centre, ballant cap a dreta i esquerra amb un tempo bastant estable, amb un aire sovint lent i concentrat, en alguns moments més animat. Els components de la rotllana han de ser preferiblement parelles formades per home-dona, però només cal un mínim de dues persones agafades de les mans per a considerar que ja han creat una rotllana. La sardana és una dansa no excloent, de manera que qualsevol persona i en qualsevol moment del ball pot afegir-se individualment o en parella a la rotllana. Tanmateix, existeix la colla sardanista organitzada com a grup estable, semblant a l'esbart dansaire.\\nEl ball és més complicat que no sembla. La sardana s'estructura en diverses parts, anomenades tirades, de les quals n'hi ha de dos tipus, curts i llargs."},{"page_url":"https://en.wikipedia.org/wiki/Aurora,_Oregon","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/Marion_County_Oregon_Incorporated_and_Unincorporated_areas_Aurora_Highlighted.svg","page_title":"Aurora, Oregon","context_page_description":"Aurora is a city in Marion County, Oregon, United States. Before being incorporated as a city, it was the location of the Aurora Colony, a religious commune founded in 1856 by William Keil who named the settlement after his daughter. The population was 918 at the 2010 census. It is part of the Salem Metropolitan Statistical Area."},{"page_url":"https://ko.wikipedia.org/wiki/2010%EB%85%84_FIFA_%EC%9B%94%EB%93%9C%EC%BB%B5_%EA%B2%B0%EC%84%A0_%ED%86%A0%EB%84%88%EB%A8%BC%ED%8A%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Brazil_%26_Chile_match_at_World_Cup_2010-06-28_5.jpg","page_title":"2010년 FIFA 월드컵 결선 토너먼트","context_page_description":"2010년 FIFA 월드컵 결선 토너먼트는 조별 리그 이후에 진행되는 FIFA 월드컵 본선의 2번째이자 최종 라운드이다. 결선 토너먼트의 일정은 6월 26일에 16강전 경기로 시작해서, 7월 11일에 요하네스버그의 사커 시티에서 열리는 결승전으로 막을 내렸는데, 여기서 스페인이 네덜란드와 연장전까지 접전을 벌여 1-0으로 이겨 첫 FIFA 월드컵 우승을 차지했다. 각 조의 상위 2개국 이 결선 토너먼트에 진출하여 싱글 엘리미네이션 방식의 토너먼트전을 치렀다. 준결승전에서 패한 2개국은 3위 결정전에서 맞대결을 펼쳤다.\\n결선 토너먼트 는 90분의 경기를 치르고 동률을 이루었을 때, 연장전 전후반으로 치렀다. 그렇게 연장전을 치르고도 동률을 이루면 승부차기를 통해 승자가 결정되었다.\\n모든 시간은 남아프리카 표준시를 따른다."},{"page_url":"https://nl.wikipedia.org/wiki/Schaaktoernooi_Hoogeveen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Eerste_prijs_Essent_2004_%2833%25%29.JPG","page_title":"Schaaktoernooi Hoogeveen","context_page_description":"Het Schaaktoernooi Hoogeveen is een schaaktoernooi dat sinds 1997 jaarlijks in oktober in Hoogeveen wordt gehouden. Zoals gebruikelijk in de schaaksport is het toernooi vernoemd naar de sponsor: de eerste drie jaren heette het toernooi het VAM-toernooi naar de Drentse afvalverwerker VAM, van 2000 tot en met 2008 was de naam het Essent-toernooi en vanaf 2009 was Univé enige jaren de hoofdsponsor. Tegenwoordig heeft het toernooi geen naamgevend sponsor.\\nHet Schaaktoernooi Hoogeveen vond voor de eerste keer plaats in 1997. David Bronstein speelde toen een van zijn laatste toernooien. Sinds die tijd heeft het toernooi zich opgewerkt naar een van de sterkste toernooien ter wereld en het in sterkte tweede schaaktoernooi van Nederland, na het Tata Steel-toernooi dat elk jaar in januari in Wijk aan Zee wordt gehouden.\\nHet Schaaktoernooi Hoogeveen bestaat uit drie afzonderlijke toernooien: een amateurtoernooi, een open groep en een kroongroep. Het amateurtoernooi en de open groep bestaan uit 9 rondes, waarin wordt gespeeld volgens het Zwitsers systeem."},{"page_url":"https://es.wikipedia.org/wiki/Reyna_Hamui","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/2012_WFSC_03d_088_Reyna_Hamui.JPG","page_title":"Reyna Hamui","context_page_description":"Reyna Hamui es una patinadora artística sobre hielo mexicana. Ganadora del Campeonato Nacional de Patinaje de México en 2012 y medallista de plata del Abierto de Sarajevo de 2013.​​"},{"page_url":"https://pt.wikipedia.org/wiki/Liliya_Shobukhova","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Liliya_Shobukhova%2C_London_Marathon_2011_%28cropped%29.jpg","page_title":"Liliya Shobukhova","context_page_description":"Liliya Bulatovna Shobukhova é uma corredora de longa distância russa. Depois de vencer por três vezes a Maratona de Chicago e a Maratona de Londres de 2010, tornando-se uma das maiores maratonistas do mundo, teve todas suas vitórias cassadas desde 2009 e foi banida por três anos do atletismo por doping de sangue."},{"page_url":"https://fr.wikipedia.org/wiki/TVP_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Tvp1_hdv.png","page_title":"TVP 1","context_page_description":"TVP 1 est une chaîne de télévision publique polonaise. Lancée au mois d'octobre 1952, cette chaîne généraliste diffuse essentiellement des séries, des informations, des variétés et du sport. Les grands événements nationaux sont également repris à l'antenne.\\nAppartenant au groupe de télévision Telewizja Polska, elle est diffusée sur le réseau hertzien, par câble et par satellite, couvrant ainsi l'ensemble du territoire national.\\nUne partie des émissions sert à alimenter la grille des programmes de la chaîne de télévision satellitaire TVP Polonia. Les émissions de TVP 1 sont diffusées exclusivement en polonais."},{"page_url":"https://sv.wikipedia.org/wiki/Umma_(djur)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Map_Umma_Louvre_AO5677.jpg","page_title":"Umma (djur)","context_page_description":"Umma är ett släkte av trollsländor. Umma ingår i familjen jungfrusländor.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://es.wikipedia.org/wiki/Juan_Bautista_L%C3%A1zaro_de_Diego","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Juan_Bautista_L%C3%A1zaro%2C_en_La_Ilustraci%C3%B3n_Espa%C3%B1ola_y_Americana.jpg","page_title":"Juan Bautista Lázaro de Diego","context_page_description":"Juan Bautista Lázaro de Diego fue un arquitecto español."},{"page_url":"https://en.wikipedia.org/wiki/Awards_and_decorations_of_the_Ukrainian_Armed_Forces_(before_2012)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/UKR-MOD_%E2%80%93_15_Years_Of_Armed_Forces_Medal.jpg","page_title":"Awards and decorations of the Ukrainian Armed Forces (before 2012)","context_page_description":"Awards and decorations of the Ukrainian Army are those military awards including decorations which are issued to members of the Ukrainian Army under the authority of the Minister of Defence. Together with military badges such awards provide an outward display of a service member's accomplishments.\\nThese awards were approved since 1999. On May 30, 2012 President of Ukraine Viktor Yanukovych issued a decree enacted new regulations on departmental awards. During 2012-2013 the Ministry of Defence of Ukraine has developed a new system of incentive awards that contains no listed awards."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D0%BF%D1%82%D0%BE%D0%B3%D1%80%D0%B0%D0%BC%D0%BC%D1%8B_%D0%91%D0%B5%D0%B9%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Beale_1.svg","page_title":"Криптограммы Бейла","context_page_description":"Криптограммы Бейла — три зашифрованных сообщения, предположительно несущих в себе информацию о местонахождении клада из золота, серебра и драгоценных камней, зарытого якобы на территории Виргинии неподалеку от Линчберга партией золотоискателей под предводительством Томаса Джефферсона Бейла. Цена не найденного доныне клада в пересчёте на современные деньги должна составлять около 30 млн долларов. Загадка криптограмм не раскрыта до сих пор, в частности, спорным остается вопрос о реальном существовании клада."},{"page_url":"https://en.wikipedia.org/wiki/Idaho_Batholith_ecoregion","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Level_IV_ecoregions%2C_Blue_Mountains.png","page_title":"Idaho Batholith ecoregion","context_page_description":"The Idaho Batholith ecoregion is a Level III ecoregion designated by the United States Environmental Protection Agency in the U.S. states of Idaho and Montana. It is contained within the following biomes designated by the World Wild Fund for Nature: temperate coniferous forests; temperate grasslands, savannas, and shrublands; and deserts and xeric shrublands."},{"page_url":"https://en.wikipedia.org/wiki/HSPC159","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Protein_HSPC159_PDB_2JJ6.png","page_title":"HSPC159","context_page_description":"Galectin-related protein, also known as HSPC159, is a human gene."},{"page_url":"https://fr.wikipedia.org/wiki/S%C3%A9lestat","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Rue_du_Pr%C3%A9sident_Poincar%C3%A9%2C_S%C3%A9lestat.JPG","page_title":"Sélestat","context_page_description":"Sélestat est une commune française, dans le département du Bas-Rhin, en Alsace.\\nChef-lieu d'arrondissement et de canton, siège de la communauté de communes de Sélestat, elle comptait 19 794 habitants au dernier recensement en 2012, ce qui en fait la cinquième commune bas-rhinoise et la huitième commune alsacienne en nombre d'habitants. Ses habitants sont appelés les Sélestadiens et Sélestadiennes. La commune est située dans la plaine d'Alsace, au pied des Vosges. Elle est traversée par l'Ill et son territoire est en grande partie couvert par les zones humides du Grand Ried. Elle est sous l'influence directe de la métropole de Strasbourg, distante d'à peine trente kilomètres.\\nSélestat est mentionnée pour la première fois au VIIIᵉ siècle. Ville libre du Saint-Empire, membre de la Décapole, Sélestat connaît un développement très rapide à la fin du Moyen Âge et au cours de la Renaissance. Elle devient d'ailleurs un foyer de l'humanisme. C'est alors la troisième ville alsacienne, dotée d'un port sur l'Ill et d'une ceinture de remparts."},{"page_url":"https://en.wikipedia.org/wiki/Koneswaram_Temple","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Bocarro17thcenturyTrincomaleemap.png","page_title":"Koneswaram Temple","context_page_description":"Koneswaram temple of Trincomalee or Thirukonamalai Konesar Temple – The Temple of the Thousand Pillars and Dakshina-Then Kailasam is a classical-medieval Hindu temple complex in Trincomalee, a Hindu religious pilgrimage centre in Eastern Province, Sri Lanka. The most sacred of the Pancha Ishwarams of Sri Lanka, it was built significantly during the reign of the early Cholas and the Five Dravidians of the Early Pandyan Kingdom atop Konesar Malai, a promontory overlooking Trincomalee District, Gokarna bay and the Indian Ocean. Its Pallava, Chola, Pandyan and Jaffna design reflect a continual Tamil Saivite influence in the Vannimai region from the classical period. The monument contains its main shrine to Shiva in the form Kona-Eiswara, shortened to Konesar and is a major place for Hindu pilgrimage, at its height of fame labelled the \\"Rome of the Gentiles/Pagans of the Orient\\". Connected at the mouth of the Mahavilli Ganga River to the footprint of Shiva at Sivan Oli Padam Malai at the river's source, the temple symbolically crowns the flow of the Ganges River from Shiva's head of Mount Kailash to his feet."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B4%D8%B1%D9%83%D8%A9_%D8%B4%D8%A7%D8%AD%D9%86%D8%A7%D8%AA_%D9%85%D8%A7%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Mack_TerraPro_LE.jpg","page_title":"شركة شاحنات ماك","context_page_description":"شركة شاحنات ماك شركة تصنيع شاحنات أمريكية، ومنتج سابق للحافلات وعربات ترولي باص. تأسست الشركة عام 1900 بأسم وانتجت أول حافلاتها عام 1907 وتبنت أسمها الحالي عام 1922.. وحالياً شركة ماك شركة تابعة تابعة لشركة فولفو التي اشترت شركة ماك مع شركة رينو للشاحنات عام 2000.. تأسست الشركة في بروكلين نيويورك ثم انتقلت الإدارة إلى مدينة ألينتاون من عام 1905 إلى 2009.ثم انتقلت إلى مدينة غرينزبورو، كارولاينا الشمالية .]]. بينما يقع خط تجميع الشاحنات في مدينة بولاية بنسيلفانيا, مع معامل تجميع إضافية في بنسيلفانيا, ماريلاند, أستراليا وفنزويلا.\\nوتُباع شاحنات ماك في 45 بلداً حول العالم."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%B0%E7%95%8C%E5%8D%80%E5%B0%88%E7%B7%9A%E5%B0%8F%E5%B7%B4481%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/UF2136_New_Territories_481_17-10-2019.jpg","page_title":"新界區專線小巴481線","context_page_description":"新界區專線小巴481線為香港的一條來往火炭至荃灣街市街的小巴路線，為進智公交首條新界區路線，擁有高客量。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D8%B2%DB%8C%D8%B1%D9%87_%D9%BE%D8%A7%DB%8C%D8%AF%D8%A7%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/fa/8/83/Island_O_S.jpg","page_title":"جزیره پایداری","context_page_description":"عنصرهای سنگین‌تر از اورانیم به صورت طبیعی در زمین وجود ندارند. این عنصرهای فرااورانیمی به وسیلهٔ واکنش‌های هسته‌ای در آزمایشگاه‌ها ساخته می‌شوند. آن‌ها همگی پرتوزا و ناپایدارند و به‌طور کلی هرچه سنگین‌تر می‌شوند، نیمه‌عمرشان کوتاه‌تر می‌شود. برای مثال نیمه‌عمر عنصر ۱۱۵ ۰/۸ ثانیه، عنصر ۱۱۶ ۶۰ میلی‌ثانیه و عنصر ۱۱۸ تنها ۰/۷ میلی‌ثانیه است. اما طبق برخی نظریه‌ها در فیزیک هسته‌ای، دانشمندان حدس می‌زنند در محدوده‌ای از تعداد نوترون‌ها و پروتون‌ها، دوباره به عنصرهایی با پایداری بالا دست یابند. به این محدوده در اصطلاح جزیره پایداری گفته می‌شود. برای نمونه پیش‌بینی می‌شود عنصری با ۱۱۴ پروتون و ۱۸۴ نوترون، پایداری بالاتری نسبت به عنصرهای مجاورش داشته باشد و به اصطلاح در جزیرهٔ پایداری قرار داشته باشد.\\nمنظور از دستیابی به جزیرهٔ پایداری، ساخت عنصر فوق سنگینی است که برخلاف عنصرهای فوق سنگینی که تاکنون ساخته شده‌اند، از پایداری بالایی برخوردار باشد. هرچند در عمل هنوز کسی موفق به انجام این کار نشده، ولی شواهدی از آزمایش‌های مختلف به دست آمده که امکان چنین کاری را تأیید می‌کنند. کشف جزیرهٔ پایداری یک هدف مهم در علم تلقی می‌شود، چنان‌که فیزیک‌دان روس ویتالی گینزبورگ این موضوع را یکی از ۳۰ مسئلهٔ مهم فیزیک برای قرن بیست و یکم می‌داند."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%B2%E0%B1%87%E0%B0%AF%E0%B0%B0%E0%B1%8D%E0%B0%B2%E0%B1%81_(%E0%B0%A1%E0%B0%BF%E0%B0%9C%E0%B0%BF%E0%B0%9F%E0%B0%B2%E0%B1%8D_%E0%B0%87%E0%B0%AE%E0%B1%87%E0%B0%9C%E0%B1%8D_%E0%B0%8E%E0%B0%A1%E0%B0%BF%E0%B0%9F%E0%B0%B0%E0%B1%8D%E0%B0%B2%E0%B1%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Layer-masks.jpg","page_title":"లేయర్లు (డిజిటల్ ఇమేజ్ ఎడిటర్లు)","context_page_description":"లేయర్లు అంటే ఒక దానిక్రింద ఒకటిగా ఉన్న వస్తువులసమూహం. ఉదా: వుల్లిగడ్డ కాని కాబేజీ కాని అడ్డంగా కొస్తే మనకు కనిపించే పొరలు లాగ అన్నమాట.ఈ లేయర్ల వలననే మాకు కావలసినట్టు ఒక చిత్రాని కాని కొన్ని చిత్రాలని కాని మార్పులు చేర్పులు సులభంగా చేయగలం.లేయర్ల గురించి తెలీకపోతే ఇమేజ్ ఎడిటింగ్ చేయటం చాలా గందరగోళంగా ఉంటుంది.\\nఅడోబ్ కంపెని 1994 నుండి తన ఫోటోషాప్ లో లేయేర్ల ఫీచర్ ని ప్రవేశపెట్టింది.ఇప్పుడు ఇంచుమించు అన్ని ఇమేజ్ ఎడిటింగ్ సాఫ్టువేరు లలో లేయేర్ల ఫీచర్ వాడుతున్నారు.\\nఇప్పుడు సచిత్రంగా వివరంగా తెలిసికుందాం."},{"page_url":"https://en.wikipedia.org/wiki/Rodovia_dos_Bandeirantes","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Rodovia_Bandeirantes_SAO_2008_06.jpg","page_title":"Rodovia dos Bandeirantes","context_page_description":"Rodovia Bandeirantes is a highway in the state of São Paulo, Brazil.\\nOnce the traffic capacity of Anhangüera Highway was exceeded in the 1960s, the state government decided to build another highway, with a much higher capacity and modern design, directly connecting São Paulo City to Jundiaí, Campinas and merging into the Anhangüera just after Campinas. Among the first six-lane highways in Brazil, it opened to traffic in 1978.\\nIt has always been a toll road, and since 1998, the highway is managed by a state contract with a private company, AutoBan.\\nSubsequently, in 2001 it was extended to Santa Bárbara d'Oeste merging with the Washington Luis Highway, to Rio Claro, São Carlos, Araraquara and São José do Rio Preto. In 2006, it was widened to 4 lanes each way between São Paulo and Jundiaí. It is today the major thoroughfare between several mighty industrial cities around São Paulo and Campinas, and the Viracopos Airport, the second busiest cargo airport in the country."},{"page_url":"https://el.wikipedia.org/wiki/%CE%97%CE%BC%CE%B5%CF%81%CE%BF%CE%BB%CF%8C%CE%B3%CE%B9%CE%BF_%CF%84%CF%89%CE%BD_%CE%91%CE%B3%CE%AF%CF%89%CE%BD_(%CE%9B%CE%BF%CF%85%CE%B8%CE%B7%CF%81%CE%B1%CE%BD%CE%B9%CF%83%CE%BC%CF%8C%CF%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/San_Clemente%2C_Papa%2C_por_Juan_Correa_de_Vivar.jpg","page_title":"Ημερολόγιο των Αγίων (Λουθηρανισμός)","context_page_description":"Το Λουθηρανικό Ημερολόγιο των Αγίων είναι μια λίστα που καθορίζει τα πρωταρχικά ετήσια φεστιβάλ, γιορτές και εκδηλώσεις που γιορτάζονται λειτουργικά από μερικές Λουθηρανικές Εκκλησίες στις Ηνωμένες Πολιτείες. Τα ημερολόγια της Ευαγγελικής Λουθηρανικής Εκκλησίας στην Αμερική και της Λουθηρανικής Εκκλησίας – Σύνοδος του Μιζούρι προέρχονται από το Λουθηρανικό Βιβλίο Λατρείας του 1978 και τη Λουθηρανική Λατρεία του 1982. Στοιχεία μοναδικά για την ELCA έχουν ενημερωθεί από το Λουθηρανικό Βιβλίο Λατρείας για να αντικατοπτρίζουν τις αλλαγές που προκύπτουν από τη δημοσίευση της Ευαγγελικής Λουθηρανικής Λατρείας το 2006. Τα στοιχεία του ημερολογίου που είναι μοναδικά για την LCMS έχουν επίσης ενημερωθεί από τη Λουθηρανική Λατρεία και το Λουθηρανικό Βιβλίο Λατρείας ώστε να αντικατοπτρίζει τη δημοσίευση του Λουθηρανικού Βιβλίου Υπηρεσίας του 2006.\\nΚάθε εορταστικό συμβάν παρατίθεται με τον τύπο του συμβάντος στη συνέχεια σε παρένθεση καθώς και τη χώρα όπου παρατηρείται. Για τα άτομα, η ημερομηνία που δίνεται είναι η ημερομηνία του θανάτου τους ή αλλιώς «ουράνιων γενεθλίων» τους."},{"page_url":"https://et.wikipedia.org/wiki/V%C3%A4rvisafloor","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Carthamus_tinctorius_050709b.JPG","page_title":"Värvisafloor","context_page_description":"Värvisafloor, vanema nimetusega värvohakas, on korvõieliste hulka kuuluv õli- ja värvitaim. Sõna safloor on kasutatud ka värvisafloorist saadava värvaine kohta, millega värvitakse tekstiili ja mida kasutatakse toidule värvi andmiseks. Värvisafloori kasvatatakse ka ilutaimena."},{"page_url":"https://pl.wikipedia.org/wiki/El_Chorro","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/El_Chorro_01.JPG","page_title":"El Chorro","context_page_description":"El Chorro jest miejscowością położoną w południowej części Hiszpanii w andaluzyjskiej prowincji Malaga u wylotu wapiennego wąwozu Desfiladero de los Gaitanes. Dnem wąwozu przepływa rzeka Guadalhorce. Ze względu na bogactwo okolicznych skał, miejscowość ta jest często odwiedzana przez wspinaczy i turystów. Na jej terenie znajduje się camping, hotel, schronisko turystyczne, kilka domów, stacja kolejowa i elektrownia wodna o charakterze szczytowo - pompowym."},{"page_url":"https://cs.wikipedia.org/wiki/Zoologick%C3%A1_zahrada_v_D%C3%A1rd%C5%BEilingu","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Padmaja_Naidu_Himalayan_Zoological_Park.JPG","page_title":"Zoologická zahrada v Dárdžilingu","context_page_description":"Zoologická zahrada v Dárdžilingu se nachází ve městě Dárdžiling v indickém státu Západní Bengálsko. Má rozlohu 27 hektarů. Zoologická zahrada byla otevřena v roce 1958. Nachází se v nadmořské výšce 2134 m. Je to nejvýše položená zoo v Indii. Specializuje se na chov horských zvířat a úspěšně chová v zajetí sněžné leopardy, kriticky ohrožené tibetské vlky a pandy červené. Má návštěvnost asi 300 000 návštěvníků za rok. Zoologická zahrada je dnes pojmenována po bývalé guvernérce státu Západní Bengálsko.\\nPředmětná zoologická zahrada slouží pro program pandy červené v Indii jako ústřední orgán. Je také členem Světové asociace zoologických zahrad a akvárií."},{"page_url":"https://en.wikipedia.org/wiki/Marvin_Gaye","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Cardozo2014.jpg","page_title":"Marvin Gaye","context_page_description":"Marvin Gaye was an American singer, songwriter, and record producer. He helped to shape the sound of Motown in the 1960s, first as an in-house session player and later as a solo artist with a string of hits, earning him the nicknames \\"Prince of Motown\\" and \\"Prince of Soul\\".\\nGaye's Motown hits include \\"Ain't That Peculiar\\", \\"How Sweet It Is\\", and \\"I Heard It Through the Grapevine\\". Gaye also recorded duets with Mary Wells, Kim Weston, Tammi Terrell, and Diana Ross. During the 1970s, Gaye recorded the albums What's Going On and Let's Get It On and became one of the first artists in Motown to break away from the reins of a production company. His later recordings influenced several contemporary R&B subgenres, such as quiet storm and neo soul. He was a tax exile in Europe in the early 1980s, he then released \\"Sexual Healing\\" the 1982 hit which won his first two Grammy Awards on the album Midnight Love. Gaye's last televised appearances were at the 1983 NBA All-Star Game, where he sang \\"The Star-Spangled Banner\\"; Motown 25: Yesterday, Today, Forever; and Soul Train."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D1%80%D0%B8%D0%B9%D0%BD_%D0%9C%D0%B0%D1%83%D0%BD%D1%82%D1%8A%D0%BD%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Greenmountains.jpg","page_title":"Грийн Маунтънс","context_page_description":"Грийн Маунтънс или Зелени планини е планинска верига в САЩ в щата Върмонт, част от планинската верига на Апалачите. Те се простират предимно от юг на север на около 250 mi от границата на Масачузетс, почти до Квебек, Канада. Част от планините, които се намират в щата Масачузетс са известни като Бъркшир, а в Квебек се наричат Сътън, или Монт Сътън.\\nВсички планини на щата Върмонт често са наричани „зелени планини“. Освен Грийн Маунтънс други планини във Върмонт са Таконикс в крайната югозападна част на щата и Североизточните възвишения, които не са геоложка част от Грийн Маунтънс."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_R%C3%BCttenscheid","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Ehemalige_Staatsanwaltschaft_Essen_01.jpg","page_title":"Liste der Baudenkmäler in Rüttenscheid","context_page_description":"Die Liste der Baudenkmäler in Rüttenscheid enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Essen-Rüttenscheid, Stadtbezirk II, in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Essen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen.\\nKarte mit allen Koordinaten: OSM"},{"page_url":"https://it.wikipedia.org/wiki/Formula_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/MossLotusClimax19610806.jpg","page_title":"Formula 1","context_page_description":"La Formula 1, in sigla F1, ufficialmente in inglese FIA Formula One World Championship e indicata in italiano come Formula Uno, è la massima categoria di vetture monoposto a ruote scoperte da corsa su circuito definita dalla Federazione Internazionale dell'Automobile.\\nLa categoria è nata nel 1948, diventando poi a carattere mondiale nella stagione 1950. Inizialmente definita dalla Commissione Sportiva Internazionale dell'Associazione Internazionale degli Automobil Club Riconosciuti, associazione antesignana della Federazione Internazionale dell'Automobile, oggi la Formula Uno è regolata dal Consiglio Mondiale degli Sport Motoristici della FIA.\\nIl termine \\"formula\\", presente nel nome, fa riferimento a un insieme di regole alle quali tutti i partecipanti, le macchine e i piloti, devono adeguarsi; esse introducono un numero di restrizioni e specifiche nelle auto, al fine di evitare le eccessive disparità tecniche tra le auto, di porre dei limiti al loro sviluppo e di ridurre i rischi di incidenti. La formula ha avuto molti cambiamenti durante la sua storia."},{"page_url":"https://no.wikipedia.org/wiki/Minute_Maid","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Minute_Maid_Park.jpg","page_title":"Minute Maid","context_page_description":"Minute Maid er et amerikansk merke for juiceprodukter som også har etablert seg i Norge. Selskapet har eksistert siden 1946 og har hovedkontor i Houston, Texas og har 2600 ansatte. The Coca-Cola Company overtok aksjemajoriteten i firmaet i 1960."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Eitting_(Laberweinting)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Eitting-sankt-johannes-baptist.jpg","page_title":"Schloss Eitting (Laberweinting)","context_page_description":"Das abgegangene Schloss Eitting befand sich im Ortsteil Eitting der niederbayerischen Gemeinde Laberweinting im Landkreis Straubing-Bogen von Bayern."},{"page_url":"https://ro.wikipedia.org/wiki/Cronologia_chimiei","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Zosimosapparat.jpg","page_title":"Cronologia chimiei","context_page_description":"Cronologia chimiei enumeră lucrările, descoperirile, ideile, invențiile și experimentele importante care au schimbat în mod semnificativ înțelegerea de către umanitate a științei moderne, cunoscută sub numele de chimie, definită ca studiul științific al compoziției materiei și a interacțiunilor sale. Istoria chimiei, în forma sa modernă a început, fără îndoială, cu omul de știință irlandez Robert Boyle, cu toate că rădăcinile sale pot fi urmărite înapoi în timp, încă de la primele mărturii istorice existente.\\nIdei anterioare, care mai târziu au fost încorporate în știința modernă a chimiei provin din două surse principale. Filosofii naturii au folosit raționamentul deductiv, într-o încercare de a explica comportamentul lumii din jurul lor. Alchimiștii, au fost oameni care au folosit tehnici experimentale în încercarea de a prelungi durata de viață a oamenilor sau de a obține transformări de materiale, cum ar fi transformarea metalelor comune în aur.\\nÎn secolul al XVII-lea, o sinteză a ideilor acestor două metode, cea deductivă și cea experimentală, duce la dezvoltarea unui proces de gândire cunoscut ca metoda științifică."},{"page_url":"https://gl.wikipedia.org/wiki/Elefante","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Moeritherium_NT_small.jpg","page_title":"Elefante","context_page_description":"Os elefantes son grandes mamíferos da familia Elephantidae e da orde Proboscidea. No presente, recoñécense tres especies: o elefante africano de sabana, o elefante africano de bosque e o elefante asiático. Os elefantes distribúense pola África subsahariana, sur de Asia e o sueste asiático. Elephantidae é a única familia sobrevivente da orde Proboscidea, e outros membros da orde, agora extintos, inclúen deinotheriidae, gomphotheriidae, mamuts e mastodontes.\\nOs elefantes son os maiores animais terrestres que existen, pesando até 12 toneladas e medindo por termo medio catro metros de altura. As súas características máis distintivas son os cabeiros de marfil. O macho de elefante africano, o maior animal terrestre, pode acadar unha altura de 4 m e pesar 7000 kg. Estes animais teñen numerosos elementos distintivos, como a súa longa trompa, que empregan con numerosos fins e particularmente para coller obxectos. Os seus cabeiros teñen gran tamaño, e úsanos para mover obxectos, escavar e como armas para loitar. As súas grandes orellas axúdanlles a controlar a temperatura do seu corpo."},{"page_url":"https://sl.wikipedia.org/wiki/Ora%C5%A1ac,_Aran%C4%91elovac","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Orasac_Countryside.jpg","page_title":"Orašac, Aranđelovac","context_page_description":"Orašac je naselje v Srbiji, ki upravno spada pod Občino Aranđelovac; slednja pa je del Šumadijskega upravnega okraja."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%92._%D0%92._%D0%9C%D0%B0%D1%8F%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/ru/5/5e/Mayakovsky%283%29.JPG","page_title":"Государственный музей В. В. Маяковского","context_page_description":"Госуда́рственный музе́й Влади́мира Маяко́вского — музей Владимира Маяковского, основанный в 1937 году по инициативе Лили Брик как библиотека-музей. Изначально располагался в Гендриковом переулке, где поэт проживал вместе с Лилей и Осипом Бриками с 1926 по 1930 год. В 1972-м музей был перемещён в бывшую коммунальную квартиру в Лубянском проезде, где Маяковский покончил жизнь самоубийством. В 1989-м по проекту музееведа Тараса Полякова экспозиция была модернизирована в конструктивистском стиле, создано четырёхэтажное выставочное пространство, посвящённое не только памяти поэта, но русскому авангарду.\\nС 2013 года основное здание закрыто на капитальный ремонт."},{"page_url":"https://en.wikipedia.org/wiki/Biodiversity_reserves_of_Quebec","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Relief_du_mont_Harfang.jpg","page_title":"Biodiversity reserves of Quebec","context_page_description":"A biodiversity reserve of Quebec is a protected area established to promote maintenance of biodiversity in the terrestrial environment and more specifically to maintain representatives of the various natural regions of Quebec, Canada.\\nThere are five biodiversity reserves in Quebec with permanent protection status."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC66%E5%9B%9E%E8%8F%8A%E8%8A%B1%E8%B3%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Kikka_Sho_2005_01.jpg","page_title":"第66回菊花賞","context_page_description":"第66回菊花賞は、2005年10月23日に京都競馬場で施行された競馬競走である。ディープインパクトが皐月賞、東京優駿に続き優勝し、無敗でクラシック三冠を達成した。"},{"page_url":"https://en.wikipedia.org/wiki/Diver_communications","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Dive_hand_signal_Bubbles.png","page_title":"Diver communications","context_page_description":"Diver communications are the methods used by divers to communicate with each other or with surface members of the dive team. In professional diving, communication is usually between a single working diver and the diving supervisor at the surface control point. This is considered important both for managing the diving work, and as a safety measure for monitoring the condition of the diver. The traditional method of communication was by line signals, but this has been superseded by voice communication, and line signals are now used in emergencies when voice communications have failed. Surface supplied divers often carry a closed circuit video camera on the helmet which allows the surface team to see what the diver is doing and to be involved in inspection tasks. This can also be used to transmit hand signals to the surface if voice communications fails. Underwater slates may be used to write text messages which can be shown to other divers, and there are some dive computers which allow a limited number of pre-programmed text messages to be sent through-water to other divers or surface personnel with compatible equipment."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%8C%D0%B1%D1%96%D0%BE%D0%BD_(%D0%9F%D0%B5%D0%BD%D1%81%D0%B8%D0%BB%D1%8C%D0%B2%D0%B0%D0%BD%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Albion%2C_Pennsylvania_%2815828752049%29.jpg","page_title":"Альбіон (Пенсильванія)","context_page_description":"Альбіон — місто в США, в окрузі Ері штату Пенсильванія. Населення — 1516 осіб."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D1%84%D1%8B_%D0%BE_%D0%BF%D1%80%D0%BE%D0%B8%D1%81%D1%85%D0%BE%D0%B6%D0%B4%D0%B5%D0%BD%D0%B8%D0%B8_%D1%8F%D0%B7%D1%8B%D0%BA%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Confusion_of_Tongues.png","page_title":"Мифы о происхождении языков","context_page_description":"В мифах народов мира распространён ряд сюжетов, касающихся происхождения и развития национальных языков и причин, лежащих в основе современного разнообразия языков.\\nЭти мифы имеют как ряд общих черт, так и существенные различия, обусловленные особенностями этногенеза различных народов. Мифы о происхождении языков, как правило, относятся к более общим, креационистским мифам, в то же время имеются и различия в мифологических сюжетах: некоторые мифы утверждают, что язык был дан творцом людям с самого момента их сотворения, другие — что язык был дан людям позднее как некий «особый дар»."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B0%D0%B2%D0%B8%D0%BB%D0%BE%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%B2%D0%B5%D0%B6%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Babel_900.jpg","page_title":"Вавилонська вежа","context_page_description":"Вавилонська вежа — символ сум'яття і безладу. Згадується у Книзі Буття в 11 главі. На думку сучасних вчених, таких, як Стівен Л. Гарріс, на біблійну історію про Вавилонську вежу ймовірно вплинув зикурат Етеменанкі під час вавилонського полону євреїв."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%9A%8C%E5%9F%A0%E5%85%AC%E4%BA%A4109%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Bengbu_Bus_No.109%26119%26135_at_S.Passenger_Station.jpg","page_title":"蚌埠公交109路","context_page_description":"蚌埠公交109路，是中国安徽省蚌埠市的一条公交线路，由客运北站开往客运南站，由蚌埠市公共交通集团有限公司运营、管理。"},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Zlodica","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Biserica_de_lemn_din_Zlodica4.jpg","page_title":"Biserica de lemn din Zlodica","context_page_description":"Biserica de lemn cu hramul Sfinții Arhangheli Mihail și Gavriil din Zlodica a fost construită în secolul al XVII-lea în satul Zlodica din comuna Ceplenița. Ea se află localizată în cimitirul satului.\\nBiserica de lemn din Zlodica a fost inclusă pe Lista monumentelor istorice din județul Iași din anul 2015, având codul de clasificare cod LMI IS-II-m-B-04273."},{"page_url":"https://fi.wikipedia.org/wiki/Korean_tasavalta","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Korean_Gimchi01b.jpg","page_title":"Korean tasavalta","context_page_description":"Korean tasavalta, epävirallisesti Etelä-Korea on Korean niemimaan eteläosassa sijaitseva valtio. Sillä on yhteinen maaraja Korean demokraattisen kansantasavallan eli Pohjois-Korean kanssa sekä merialueraja lännessä Kiinan ja idässä Japanin kanssa. Etelä-Korean pinta-ala on 100 210 km² ja siellä on noin 50 miljoonaa asukasta, joten se on yksi maailman tiheimmin asutuista valtioista. Maan suurin kaupunki on pääkaupunki Soul, jonka asukasluku on yli 10 miljoonaa.\\nMaan länsimainen nimi tulee Goryeo-dynastiasta, joka hallitsi niemimaata vuosina 918–1392. Arkeologisten löytöjen perusteella maan ensiasutus ajoittuu varhaispaleoliittiselle kaudelle. Korean historian katsotaan alkavan legendaarisen Dangunin perustamasta Gojoseonin kuningaskunnasta 2333 eaa. Kun Sillan johdolla Korean niemimaan kolme kuningaskuntaa yhdistyivät, Koreaa ryhtyi hallitsemaan Koryŏ-dynastia, jolta maa sai nimensä, ja sen jälkeen Joseon-dynastia. Korean itsenäisyys ja viimeinen dynastia päättyivät Japanin keisarikunnan liitettyä maan itseensä vuonna 1910. Toisen maailmansodan päätyttyä ja Japanin antauduttua Korean niemimaa jaettiin Neuvostoliiton ja Yhdysvaltain johtamiin miehitysvyöhykkeisiin."},{"page_url":"https://zh.wikipedia.org/zh-tw/1905%E5%B9%B4%E5%A4%A7%E8%A5%BF%E6%B4%8B%E9%A3%93%E9%A3%8E%E5%AD%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/1905_Atlantic_tropical_storm_2_track.png","page_title":"1905年大西洋飓风季","context_page_description":"1905年大西洋颶風季確定存在五個熱帶氣旋，其中兩個曾登陸美國。第一個天氣系統最初於9月6日在向風群島附近出現，第四號熱帶風暴於10月11日在紐芬蘭與拉布拉多較遠處海域轉變成溫帶氣旋，都在大西洋盆地每年絕大多數熱帶天氣活動的時間範圍內。10月5至10日間，第四和第五個熱帶氣旋曾同時存在。\\n全季五個熱帶氣旋中只有第四個達到颶風強度，是1890年後最少的一年。不過，這場颶風的最高風速達每小時195公里，不但是本季最強風暴，而且達到現代薩菲爾-辛普森颶風等級下的三級颶風標準，屬大型颶風。氣旋產生的瘋狗浪導致「坎帕尼亞號」汽船至少六人遇難。此外，本季首場風暴還在巴貝多致使一艘雙桅縱帆船沉沒，船上兩人喪生。\\n這年颶風季的低迷活躍程度還經累積氣旋能量指數反映出來，數值僅28，是1864年後新低。大致來說，氣旋能量指數通過颶風強度和持續時間計算，強度越高、持續時間越長的風暴，其指數也相應越高。只有在熱帶天氣系統風速達到或超過每小時63公里或熱帶風暴強度時才會計算該指數，並納入全面的氣象公告，並且亞熱帶氣旋的指數不會計入累積數值。"},{"page_url":"https://it.wikipedia.org/wiki/Museo_dell%27Opera_del_Duomo_(Pisa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/XIII-sec-marble-intarsia-museo-opera-pisa.jpg","page_title":"Museo dell'Opera del Duomo (Pisa)","context_page_description":"Il Museo dell'Opera del Duomo di Pisa si trova in Piazza del Duomo, nel palazzo che fu sala del Capitolo della Primaziale, risalente al XIII secolo, seminario, accademia di belle arti e convento.\\nFu inaugurato nel 1986 per ospitare il tesoro della cattedrale, i reperti rimossi dai monumenti sacri per ragioni di restauro e salvaguardia, e tutte quelle opere non più presenti dei vari edifici del complesso monumentale, ma che richiedevano uno spazio espositivo pubblico. Il museo prende nome dall'ente che gestisce il complesso monumentale, ovvero l'Opera del Duomo di Pisa.\\nNel 2019, dopo alcuni anni di chiusura, ha riaperto i battenti rinnovato nell'esposizione. In questa seconda veste si privilegia la valorizzazione delle opere esposte e una selezione delle stesse. Alcune opere precedentemente esposte sono state movimentate in altri spazi, ad esempio le stampe colorate ad acquerello sugli affreschi del Camposanto ad opera di Carlo Lasinio sono state spostate al Museo delle sinopie, mentre diversi dipinti sono stati spostati presso le sale del palazzo arcivescovile."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B6%B8%E0%B7%92%E0%B6%B1%E0%B7%92%E0%B7%83%E0%B7%94%E0%B6%B1%E0%B7%8A_%E0%B6%B1%E0%B7%9C%E0%B7%80%E0%B6%B1_%E0%B6%B4%E0%B7%8A%E2%80%8D%E0%B6%BB%E0%B7%92%E0%B6%B8%E0%B7%9A%E0%B6%A7%E0%B7%8F%E0%B7%80%E0%B7%94%E0%B6%B1%E0%B7%8A_%E0%B6%B4%E0%B7%92%E0%B7%85%E0%B7%92%E0%B6%B6%E0%B6%B3%E0%B7%80_%E0%B6%9A%E0%B7%99%E0%B6%BB%E0%B7%99%E0%B6%B1_%E0%B6%B4%E0%B6%BB%E0%B7%93%E0%B6%9A%E0%B7%8A%E0%B7%82%E0%B6%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Chimpanzee_Enos_before_the_flight_of_Mercury-Atlas_5.jpg","page_title":"මිනිසුන් නොවන ප්‍රිමේටාවුන් පිළිබඳව කෙරෙන පරීක්ෂණ","context_page_description":"වෛද්‍ය හා වෛද්‍ය නොවන ද්‍රව්‍ය වල විෂ පරීක්ෂාවට;එච්.අයි.වී සහ හෙපටයිටිස් වැනි බෝවන රෝග පිළිබඳ අධ්‍යයන; ස්නායු පිළිබඳ අධ්‍යයන; හැසිරීම සහ සංජානනය; ප්‍රජනනය; ජාන විද්‍යාව; සහ xenotransplantation වැනි පර්යේෂණ සඳහා අත්හදා බැලීම් වලට මානව නොවන ප්‍රිමේටාවුන් Non-Human Primates යොදා ගනු ලැබේ. එක්සත් ජනපදයේ සෑම වසරකම NHPs 65,000 ක් පමණ භාවිතා වන අතර යුරෝපා සංගමයට අයත් රටවල් පුරා සතුන් 7,000 ක් පමණ භාවිතා වේ. බොහෝමයක් මේ සඳහා හිතාමතාම අභිජනනය කරන අතර සමහර සතුන් කැලයෙන් හසුකර ගනී.\\nඑම භාවිතය මතභේදාත්මක ය. ජෛව විද්‍යාව පිළිබඳ නෆීල්ඩ් කවුන්සිලයට අනුව, මානව නොවන ප්‍රිමේටාවුන් භාවිතා කරනුයේ ඔවුන්ගේ මොළය මිනිස් මොළය සමඟ ව්‍යුහාත්මක හා ක්‍රියාකාරී ලක්ෂණ බෙදා හදා ගන්නා බැවිනි, නමුත් “මෙම සමානතාවයට විද්‍යාත්මක වාසි ඇති අතර, එය දුෂ්කර ආචාරධාර්මික ගැටලු කිහිපයක් ඇති කරයි. මන්ද යත් ඔවුන්ට ද මිනිසුන්ට මෙන්ම වේදනාව දැනෙන බැවිනි.\\"සත්ව අයිතිවාසිකම් වෙනුවෙන් හඩ නගන කන්ඩායම් විසින් සත්ව පර්යේෂණ සඳහා ඇති පහසුකම් වලට විරුද්ධව ප්‍රසිද්ධියේ ප්‍රහාර එල්ල කරන ලද්දේ මෙම හේතුව පදනම් කර ගෙනයි. ප්‍රිමේටාවුන් පිළිබඳ පර්යේෂණ කරන සමහර පර්යේෂකයන් තර්ජන හෝ පහරදීම් හේතුවෙන් සිය පර්යේෂණ කටයුතු අතරමග අතහැර දමා ඇත."},{"page_url":"https://ms.wikipedia.org/wiki/Kimberley_(Australia_Barat)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Fitzroy_River_Willare_Bridge.JPG","page_title":"Kimberley (Australia Barat)","context_page_description":"Kimberley adalah yang paling utara dari sembilan wilayah Australia Barat. Ia bersempadan di sebelah barat oleh Lautan Hindi, di utara oleh Laut Timor, di selatan oleh Pasir Besar dan padang pasir Tanami di wilayah Pilbara, dan di sebelah timur oleh Wilayah Utara.\\nWilayah ini dinamakan pada tahun 1879 oleh juruukur kerajaan Alexander Forrest setelah Setiausaha Negara untuk Jajahan John Wodehouse, Earl 1 Kimberley."},{"page_url":"https://fr.wikipedia.org/wiki/Skull_Valley_(Utah)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Iosepa_Welcome_Sign.jpg","page_title":"Skull Valley (Utah)","context_page_description":"La Skull Valley est une vallée de 64 km de long située dans l'est du Comté de Tooele au sud-ouest du Grand Lac Salé dans l'Utah aux États-Unis. La vallée est orientée nord-sud, mais tourne doucement au nord-est pour rejoindre la Stansbury Bay au sud du Grand Lac Salé.\\nLe sud et le sud-ouest de la Skull Valley bordent le sud-est du Désert du Grand Lac Salé au niveau de Dugway et au niveau d'une ligne de crêtes sud-est des Cedar Mountains.\\nLa Réserve indienne de la Skull Valley est située au sud de la vallée au sud-ouest du pied des Stansbury Mountains. Au sud-est, la vallée se rétrécit entre les Stansbury Mountains et les Cedar Mountains et à l'ouest, entre Willow Patch Springs et Scribner Spring, une région de ruisseaux, venant des Stansburys Mountains, et de sources issues de la vallée. Les ruisseaux et les sources provenant des Onaqui Mountains au nord-ouest alimentent également le sud-est de la vallée."},{"page_url":"https://en.wikipedia.org/wiki/Cercocarpus_traskiae","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Cercocarpus_traskiae_range_map_2.png","page_title":"Cercocarpus traskiae","context_page_description":"Cercocarpus traskiae, known by the common names Santa Catalina Island mountain-mahogany and Catalina mahogany, is a rare species of plant in the rose family."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BB%D0%B3%D0%BE%D1%80%D1%83%D0%BA%D0%BE%D0%B2,_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Dolgoruky_v1_p7.png","page_title":"Долгоруков, Василий Владимирович","context_page_description":"Васи́лий Влади́мирович Долгору́ков — князь из рода Долгоруковых, российский генерал-фельдмаршал, участник Северной войны и Русско-турецкой войны 1710—1713 годов, член Верховного тайного совета, президент Военной коллегии, кавалер орденов Святого апостола Андрея Первозванного, Святого Александра Невского, польского Белого орла и датского Слона."},{"page_url":"https://it.wikipedia.org/wiki/Joshua_Lanier_Martin","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Gov._Joshua_L._Martin.jpg","page_title":"Joshua Lanier Martin","context_page_description":"Joshua Lanier Martin è stato un politico statunitense, fu il 12º governatore dell'Alabama dal 1845 al 1847.\\nSi presentò da indipendente alle elezioni per la carica a governatore, in contrasto con repubblicani ma anche con quello che era stato il suo partito, ossia il Partito Democratico, per gli appoggi che continuava a dare alla banca centrale dello Stato. Riuscì a farsi eleggere e durante il suo mandato sciolse la banca statale dell'Alabama. Spostò poi la capitale da Tuscaloosa alla sua attuale posizione, Montgomery."},{"page_url":"https://pl.wikipedia.org/wiki/Rejon_starodubowski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Coat_of_Arms_of_Starodubsky_rayon_%28Bryansk_oblast%29.png","page_title":"Rejon starodubowski","context_page_description":"Rejon starodubowski – rejon w Rosji, w obwodzie briańskim, ze stolicą w Starodubiu."},{"page_url":"https://vi.wikipedia.org/wiki/Platonia_insignis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Bacurirebrotaraiz.jpg","page_title":"Platonia insignis","context_page_description":"Platonia insignis là một loài thực vật có hoa trong họ Bứa. Loài này được Mart. miêu tả khoa học đầu tiên năm 1832."},{"page_url":"https://nl.wikipedia.org/wiki/Steve_Olfers","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Steve_Olfers_PSV_2010.jpg","page_title":"Steve Olfers","context_page_description":"Steve Olfers is een voormalig Nederlands profvoetballer die bij als middenvelder en verdediger uit de voeten kon."},{"page_url":"https://es.wikipedia.org/wiki/Oxalis_stricta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/20140511Oxalis_stricta3.jpg","page_title":"Oxalis stricta","context_page_description":"Oxalis stricta, la acederilla, es una especie herbácea perteneciente a la familia de las oxalidáceas."},{"page_url":"https://es.wikipedia.org/wiki/Cettia_cetti","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Cettia_cetti_MHNT_232_RdN_Oued_Lucus_Maroc.jpg","page_title":"Cettia cetti","context_page_description":"El cetia ruiseñor o ruiseñor bastardo ​ es una especie de ave paseriforme de la familia Cettiidae propia de Europa, el suroeste de Asia y el norte de África."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A5%D0%B5%D1%80%D0%B5%D1%84%D0%BE%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/HerefordSkyline.jpg","page_title":"Херефорд","context_page_description":"Херефорд је град у Уједињеном Краљевству у Енглеској. Према процени из 2007. у граду је живело 59.092 становника."},{"page_url":"https://en.wikipedia.org/wiki/Mary_Robinson_(poet)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Hoppner%2C_attributed_-_Mrs_Mary_Robinson_as_Perdita.jpg","page_title":"Mary Robinson (poet)","context_page_description":"Mary Robinson was an English actress, poet, dramatist, novelist, and celebrity figure. She lived in England, in the cities of Bristol and London; she also lived for a time in France and Germany. She enjoyed poetry from the age of seven and started working, first as a teacher and then as actress, from the age of fourteen. She wrote many plays, poems and novels. She was a celebrity, gossiped about in newspapers, famous for her acting and writing. During her lifetime she was known as \\"the English Sappho\\". She earned her nickname \\"Perdita\\" for her role as Perdita in 1779. She was the first public mistress of King George IV while he was still Prince of Wales."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E7%81%BD%E9%9B%A3%E6%8C%87%E4%BB%A4%E7%B3%BB%E7%B5%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/ICS_gaa_kau%281%29.png","page_title":"災難指令系統","context_page_description":"災難指令系統係一個響災難發生之後用嚟指揮救災嘅指令系統。佢唔係電腦系統，而係人員調用嘅系統。\\n災難指揮系統已經喺美國標準化咗。喺二十世紀七十年代，佢嘅開發係根據消防服務嘅需要開始嘅，後尾牽涉到其他行政機關並且逐步擴大，最後重標準化埋。呢個系統已經用咗喺各種危機管理嗰喥，譬如恐怖襲擊同埋颱風災害等等。另外，獨立嘅防災組織同地方災害管理，核應急準備等等亦會用到呢個系統，包括音樂會同活動，遊行等等。災難指令系統係國家災難管理系統（NIMS）嘅一個子系統，由美國國土安全部喺2004年發布。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%BF%CF%85%CF%83%CE%B5%CE%AF%CE%BF_%CE%95%CE%BB%CE%BB%CE%B7%CE%BD%CE%B9%CE%BA%CF%8E%CE%BD_%CE%9B%CE%B1%CF%8A%CE%BA%CF%8E%CE%BD_%CE%9C%CE%BF%CF%85%CF%83%CE%B9%CE%BA%CF%8E%CE%BD_%CE%9F%CF%81%CE%B3%CE%AC%CE%BD%CF%89%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/%22Floyera%22_%281-5._Cane_flutes%29%2C_Museum_of_Greek_Folk_Musical_Instruments.jpg","page_title":"Μουσείο Ελληνικών Λαϊκών Μουσικών Οργάνων","context_page_description":"Το Μουσείο Ελληνικών Λαϊκών Μουσικών Οργάνων είναι μουσείο και Ερευνητικό Κέντρο Εθνομουσικολογίας στο Αρχοντικό Λασσάνη, στην Πλάκα της Αθήνας στη Ελλάδα. Εκτίθονται περίπου 600 ελληνικά μουσικά όργανα από τα τελευταία 300 χρόνια και έχει πολλά περισσότερα στην αποθήκη του."},{"page_url":"https://ms.wikipedia.org/wiki/1986","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Brittany_Snow.jpg","page_title":"1986","context_page_description":"1986 merupakan tahun biasa yang bermula pada hari Rabu. Ia berlangsung dari 19 Rabiulakhir 1406 hingga 28 Rabiulakhir 1407."},{"page_url":"https://sv.wikipedia.org/wiki/Munidopsis_serricornis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Munidopsis_tridentata.jpg","page_title":"Munidopsis serricornis","context_page_description":"Munidopsis serricornis är en kräftdjursart som först beskrevs av Loven 1852. Munidopsis serricornis ingår i släktet Munidopsis och familjen trollhumrar. Enligt den svenska rödlistan är arten starkt hotad i Sverige. Arten förekommer i Götaland. Artens livsmiljö är havet. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Victory_Road_(2004)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Petey_Williams_Bloomington_062408.jpg","page_title":"Victory Road (2004)","context_page_description":"Victory Road (2004) was a professional wrestling pay-per-view event produced by Total Nonstop Action Wrestling, which took place on November 7, 2004 at the TNA Impact! Zone in Orlando, Florida. It was the first event under the Victory Road chronology, which became an annual event in 2006. Nine matches were featured on the event's card.\\nThe main event was a Ladder match for the NWA World Heavyweight Championship, in which the champion, Jeff Jarrett, defeated the challenger, Jeff Hardy, by climbing a ladder and retrieving the championship. America's Most Wanted defeated Triple X in another featured match contested under Elimination Last Team Standing rules. The event's undercard featured different varieties of matches. One match on the undercard was contested for the TNA X Division Championship, in which Petey Williams successfully defended it against A.J. Styles. Also a match that was held under no disqualification rules called a Monster's Ball match was won by Monty Brown by defeating Raven and Abyss.\\nThe event is remembered as being TNA's first monthly three-hour PPV event. Before Victory Road, TNA only hosted weekly two-hour PPV events."},{"page_url":"https://en.wikipedia.org/wiki/Indian_armour","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Helmet%2C_Arm_Guard%2C_and_Shield_MET_36.25.64_006mar2015.jpg","page_title":"Indian armour","context_page_description":"Armour in the Indian subcontinent was used since antiquity. Its earlier reference is found in the vedic period. Armour has been described in religious texts; including the Itihasa epics Ramayana and Mahabharat, as well as in the Puranas."},{"page_url":"https://ro.wikipedia.org/wiki/Martin_Gemeinhardt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Palat%2C_str_Gen_Henri_Berthelot_7%2C_Timisoara.jpg","page_title":"Martin Gemeinhardt","context_page_description":"Martin Gemeinhardt a fost un arhitect care între anii 1902–1913 a proiectat în Timișoara clădiri în stil Secession."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%A1%D5%B4%D5%BA%D5%A5%D6%80%D5%A9%D5%A1%D5%B5%D5%B4_(%D5%8D%D5%BF%D5%B8%D6%80%D5%AB%D5%B6_%D5%80%D5%BC%D5%A5%D5%B6%D5%B8%D5%BD%D5%AB_%D5%A3%D5%A1%D5%BE%D5%A1%D5%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Lampertheim_Mairie.jpg","page_title":"Լամպերթայմ (Ստորին Հռենոսի գավառ)","context_page_description":"Լամպերթայմ, համայնք Ֆրանսիայի Գրանդ Էստ մարզի Ստորին Հռենոս գավառում:\\nԲնակչությունը 2006 թվականի դրությամբ կազմում է 3120 մարդ, բնակչության խտությունը\` 474.16 մարդ/կմ²: Բնակավայրը զբաղեցնում է 6.58 կմ² տարածք:"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A7%D9%84%D9%85%D9%8A%D8%A7%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/2013-02-23_03_59_28_Graupel_%28snow_pellets%29_in_Elko%2C_Nevada.JPG","page_title":"قائمة المياه","context_page_description":"هذه قائمة بأنواع المياه مصنّفة حسب النوع والاستعمال. تتعدد أساليب استعمال البشر للمياه، مما يُعدد من الأنواع والتصنيفات التي تندرج من تحتها."},{"page_url":"https://it.wikipedia.org/wiki/Primula","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Primula_clusiana01.jpg","page_title":"Primula","context_page_description":"Primula L. è un genere di piante della famiglia delle Primulaceae, originario delle zone temperate di Europa, Asia e America.\\nIl nome deriva dal latino primus per indicare la precocità di fioritura che avviene subito dopo la scomparsa della neve, quando nei prati comincia a comparire l'erba."},{"page_url":"https://de.wikipedia.org/wiki/Christian_Daniel_Rauch","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/13-06-22-schwerin-50mm-by-RalfR-010.jpg","page_title":"Christian Daniel Rauch","context_page_description":"Christian Daniel Rauch war ein deutscher Bildhauer des deutschen Klassizismus. Er war ein Schüler von Johann Gottfried Schadow und zählt zur Berliner Bildhauerschule. Wichtige Rauch-Gedenkstätten sind das Geburtshaus des Künstlers und das Christian-Daniel-Rauch-Museum, beide in Arolsen."},{"page_url":"https://pl.wikipedia.org/wiki/Grabowo_(powiat_kamie%C5%84ski)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Wolin-Topomap.png","page_title":"Grabowo (powiat kamieński)","context_page_description":"Grabowo – wieś w Polsce położona w województwie zachodniopomorskim, w powiecie kamieńskim, w gminie Kamień Pomorski.\\nW latach 1975–1998 miejscowość należała administracyjnie do województwa szczecińskiego."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Grade-I-Baudenkm%C3%A4ler_in_Cornwall","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Wendron_Parish_Church.JPG","page_title":"Liste der Grade-I-Baudenkmäler in Cornwall","context_page_description":"Die Liste der Grade-I-Baudenkmäler in Cornwall nennt diejenigen der rund 6000 als Grade I eingestuften Bauwerke in England, die in der Grafschaft Cornwall liegen. Die Liste ist nach den bis 2009 existierenden Bezirken unterteilt. In Cornwall befinden sich 216 als Grade I eingestufte Baudenkmäler."},{"page_url":"https://ceb.wikipedia.org/wiki/Despotovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Despotovo%2C_Orthodox_church.jpg","page_title":"Despotovo","context_page_description":"Lungsod ang Despotovo sa Serbiya. Nahimutang ni sa amihanan-kasadpang bahin sa nasod, 100 km sa amihanan-kasadpan sa Belgrade ang ulohan sa nasod. 82 metros ibabaw sa dagat kahaboga ang nahimutangan sa Despotovo, ug adunay 2,077 ka molupyo.\\nAng yuta palibot sa Despotovo kay daghan kaayong patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 85 ka metro ug 1.8 km sa sidlakan sa Despotovo. Dunay mga 86 ka tawo kada kilometro kwadrado sa palibot sa Despotovo medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Vrbas, 15.2 km sa amihanan-sidlakan sa Despotovo. Hapit nalukop sa kaumahan ang palibot sa Despotovo. Sa rehiyon palibot sa Despotovo, mga kanal talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 13 °C. Ang kinainitan nga bulan Hulyo, sa 24 °C, ug ang kinabugnawan Enero, sa -2 °C. Ang kasarangang pag-ulan 947 milimetro matag tuig. Ang kinabasaan nga bulan Mayo, sa 160 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 44 milimetro."},{"page_url":"https://es.wikipedia.org/wiki/Academia_de_Artiller%C3%ADa_de_Segovia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Segovia_-_Academia_de_Artilleria.JPG","page_title":"Academia de Artillería de Segovia","context_page_description":"La Academia de Artillería de Segovia es una institución académica militar de España fundada el 16 de mayo de 1764 como Real Colegio de Artillería en el Alcázar de Segovia, en tiempos del rey Carlos III a iniciativa de Félix Gazzola, su primer director. Es la Academia militar más antigua del mundo en activo.​\\nEl acto conmemorativo del 250.º aniversario de la Academia, celebrado el 16 de mayo de 2014, estuvo presidido por el rey Juan Carlos I, siendo el último acto militar al que asistió, antes de anunciar su abdicación.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8B%E3%83%A5%E3%83%BC%E3%83%88%E3%83%B3%E5%BC%8F%E6%9C%9B%E9%81%A0%E9%8F%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Newton01.png","page_title":"ニュートン式望遠鏡","context_page_description":"ニュートン式望遠鏡は、アイザック・ニュートンにより考案された反射望遠鏡の一形式であり、筒の一方には何もなく開放状態で、反対側にガラスを磨いて凹面にした鏡があり、主鏡で反射され集められた光が焦点を結ぶ少し手前に斜めに配置した平面的な鏡を置き、光を直角方向に筒の外に出し、接眼レンズで拡大して目で見る方式の望遠鏡。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%87%91%E9%99%B5%E5%8D%81%E4%BA%8C%E9%92%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/%E9%87%91%E9%99%B5%E5%8D%81%E4%BA%8C%E9%92%97%E6%AD%A3%E5%86%8C_17.jpg","page_title":"金陵十二钗","context_page_description":"金陵十二釵，是中國古典小說《紅樓夢》中最優秀的十二位女兒。金陵是中國江蘇省南京市，「釵」指女兒，太虛幻境薄命司以十二為一組將賈府上、中、下三等女子編成正、副、又副三冊」。警幻仙子道：「即貴省中十二冠首女子之冊，故為正冊」，「則又次之」。第五回完整出示了林黛玉、薛寶釵、賈元春、賈探春、史湘雲、妙玉、賈迎春、賈惜春、王熙鳳、巧姐、李紈、秦可卿十二位正冊女性名單。"},{"page_url":"https://az.wikipedia.org/wiki/Otto_fon_Bismark","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Bimarck_und_Friedrich_Wilhelm_IV_1848.jpg","page_title":"Otto fon Bismark","context_page_description":"Otto Eduard Leopold fon Bismark-Şönhauzen — görkəmli alman dövlət xadimi və XIX əsr dünya siyasətinə ciddi təsir etmiş şəxs. 1862-1890-cı illərdə Prussiyanın əvvəlcə nazir-prezidenti olmuş, sonra isə kansleri kimi Almaniyanın birləşdirilməsi məsələsi ilə məşğul olmuşdur.\\n1867-ci ildə Şimali Alman İttifaqının, 1871-ci ildə isə birləşmiş Almaniya İmperiyasının ilk kansleri olmuş və yeni dövlətin möhkəmlənməsi üçün mühüm işlər görmüşdür. Bismark Şönhauzen qrafı, Lauenburq hersoqu, Bismark şahzadəsi titullarını daşımış, general-feldmarşal statusunda general-polkovnik rütbəsinə layiq görülmüşdür. Sərt diplomatiyası və güclü idarəçiliyinə görə ona \\"dəmir kansler\\" ləqəbi vermişlər."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%98%D7%95%D7%A1%D7%98%D7%A8%D7%90%D7%95%D7%92%D7%A8%D7%9E%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Stereogram_Tut_Rectangles.png","page_title":"אוטוסטראוגרמה","context_page_description":"אוטוסטראוגרמה הוא אשליה אופטית הגורמת למוח האנושי להבחין בצורה תלת-ממדית אשר מסתתרת בתוך תמונה דו-ממדית.\\nהסוג הפשוט ביותר של אוטוסטראוגרמה, המכונה \\"Wallpaper autostereogram\\", מורכב מתבניות החוזרות על עצמן. כאשר מביטים בתמונה מסוג זה עם מיקוד נכון בעיניים, נדמה כי התבניות באזור בו מופיעה הצורה התלת-ממדית צפות באוויר מעל הרקע. בסדרת ספרי \\"העין המופלאה\\" נעשה שימוש בסוג נוסף של אוטוסטראוגרמה המכונה \\"Random dot autostereogram\\". בסוג זה בדרך כלל ניתן יהיה להבחין בצורה התלת-ממדית רק אם מביטים בתמונה בטכניקה הנכונה.\\nישנן שתי טכניקות לתמונות אוטוסטראוגרמה, המחייבות צפייה שונה כדי לראות את הצורה התלת-ממדית הנסתרת:\\nהטכניקה הראשונה, הנפוצה יותר, מכונה \\"wall-eyed\\" מכיוון שיש להתבונן בתמונה במבט בוהה שממוקד במישור מרוחק. כלומר, כדי לראות את הצורה התלת-ממדית יש למקד את העיניים בנקודה רחוקה יותר ממישור התמונה. כדי לתרגל את העיניים מומלץ להניח את התמונה מאחורי זגוגית ולהביט בהשתקפות העצמית, מכיוון שההשתקפות נמצאת מאחורי מישור התמונה.\\nהטכניקה השנייה מכונה \\"cross-eyed\\", וכדי לראות תלת-ממד בתמונות שנוצרה בה יש למקד את הראייה בתמונה באופן בו העיניים פוזלות."},{"page_url":"https://fi.wikipedia.org/wiki/Orb%C3%A1nin_III_hallitus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/BalogZoltanFotoThalerTamas_%28crop%29.JPG","page_title":"Orbánin III hallitus","context_page_description":"Orbánin III hallitus on Unkarin 71. hallitus. Vuoden 2014 parlamenttivaalien jälkeen istuva pääministeri Viktor Orbán valittiin jälleen pääministeriksi ja hän pääsi muodostamaan kolmannen hallituksensa, joka astui virkaan 6. kesäkuuta 2014. Hallituksen muodostavat Fidesz ja sen yhteistyöpuolue Kristillisdemokraattinen kansanpuolue, joista ensin mainitulla on seitsemän ministeriä ja jälkimmäisellä kolme ministeriä. Hallituksessa on myös kolme sitoutumatonta ministeriä."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%A7%D7%99%D7%A8%D7%94_%D7%91%D7%A9%D7%A0%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/A_study_in_scarlet%2C_Plate_1.png","page_title":"חקירה בשני","context_page_description":"חקירה בשני הוא סיפור בלשי שנכתב על ידי סר ארתור קונאן דויל ופורסם לראשונה ב-1887. בספר זה מוצגת לראשונה דמותו של הבלש הפרטי הידוע שרלוק הולמס, שמאוחר יותר יהפוך לאחת הדמויות החשובות ביותר בספרות הבלשית.\\nקונאן דויל כתב את הרומן בגיל 27. במהלך התקופה שבה התמחה ברפואה באנגליה הוא הספיק לפרסם מספר סיפורים קצרים במגזינים של אותה תקופה, כגון \\"לונדון סוסייטי\\". הסיפור נקרא במקור \\"סליל החוטים המסובך\\", ולבסוף פורסם על ידי הוצאת וורד, לוק ושות' ב-1887, לאחר שנדחה מספר פעמים.\\nקונאן דויל קיבל 25 לירות שטרלינג עבור זכויות היוצרים שלו. הסיפור יצא כספר ביולי 1888 ואביו של קונאן דויל, צ'ארלס, היה המאייר. המהדורה השנייה של הספר הופיעה שנה אחת לאחר מכן ואוירה על ידי ג'ורג' האצ'ינסון. ב-1890 יצאה לאור המהדורה האמריקנית של הסיפור בהוצאת ג'יי. בי. ליפינקוט. במשך השנים שעברו מאז הספר פורסם במהדורות ותרגומים רבים נוספים.\\nהסיפור, והדמות הראשית בו, לא זכו בהתחלה לתשומת לב מהציבור. כיום ידוע על קיומם של עשרה עותקים בלבד של המהדורה הראשונה ומחירם גבוה ביותר. למרות שדויל כתב 56 סיפורים קצרים שהולמס כיכב בהם, חקירה בשני הוא אחד מארבעה רומנים ארוכים בלבד שנכללים בקאנון המקורי.\\nבעקבות הרומן הזה פורסם ב-1890 רומן נוסף בשם חותם הארבעה."},{"page_url":"https://sv.wikipedia.org/wiki/Xinhairevolutionen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/2ndPrinceChun1.jpg","page_title":"Xinhairevolutionen","context_page_description":"Xinhairevolutionen var den revolution i Kina år 1911 som störtade den sista kejsardynastin Qing och upprättade Republiken Kina. Revolutionskriget började den 10 oktober 1911 och slutade med grundandet av republiken den 12 februari 1912. Namnet kommer från den kinesiska 60-årscykeln, i vilken året 1911 har namnet Xinhai."},{"page_url":"https://fr.wikipedia.org/wiki/Lemme_d%27Urysohn","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Urysohn-Diff%C3%A9rentiel-%282%29.jpg","page_title":"Lemme d'Urysohn","context_page_description":"Le lemme d'Urysohn est un résultat de topologie, qui établit que pour deux fermés disjoints F et G d'un espace normal X, il existe une fonction continue de X dans l'intervalle [0, 1] qui vaut 0 sur F et 1 sur G.\\nCe lemme permit d'étendre aux espaces normaux le théorème de prolongement de Tietze, initialement démontré en 1914 par Heinrich Tietze pour les espaces métriques. Pavel Urysohn trouve une nouvelle démonstration et énonce son lemme un peu plus tard, dans un texte mathématique dont l'objectif est la démonstration des théorèmes sur l'invariance de la dimension d'un espace topologique localement homéomorphe à un espace euclidien."},{"page_url":"https://es.wikipedia.org/wiki/Sighetu_Marma%C8%9Biei","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Zentrum_Sighet_3.jpg","page_title":"Sighetu Marmației","context_page_description":"Sighetu Marmației es una ciudad situada en el norte de Rumania, en el distrito Maramureș. Actualmente tiene una población de 41.220 habitantes."},{"page_url":"https://de.wikipedia.org/wiki/Pfarrkirche_Sipbachzell","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Pfarrkirche_Sipbachzell_Stichzeichnung.jpg","page_title":"Pfarrkirche Sipbachzell","context_page_description":"Die der Hl. Margareta geweihte römisch-katholische Kirche am Sipbach wurde 1478 im spätgotischen Stil als Wehrkirche erbaut und liegt im Zentrum der Gemeinde Sipbachzell ca. 6 km vom zuständigen Stift Kremsmünster entfernt."},{"page_url":"https://eu.wikipedia.org/wiki/Accipiter_erythronemius","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Accipiter_erythronemius_Horto_Florestal_de_Sao_Paulo%2C_Brazil_2-crop.jpg","page_title":"Accipiter erythronemius","context_page_description":"Accipiter erythronemius Accipiter generoko animalia da. Hegaztien barruko Accipitridae familian sailkatua dago."},{"page_url":"https://nl.wikipedia.org/wiki/Konstantinos_Mitroglou","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/20130814_AT-GR_Kostas_Mitroglou_2795.jpg","page_title":"Konstantinos Mitroglou","context_page_description":"Konstantinos Mitroglou is een Grieks voetballer die doorgaans als aanvaller speelt. Hij tekende in augustus 2017 een contract tot medio 2021 bij Olympique Marseille, dat circa €15.000.000, - voor hem betaalde aan Benfica. Mitroglou debuteerde in 2009 in het Grieks voetbalelftal.\\nOlympique Marseille verhuurde Mitroglou gedurende het seizoen 2019/20 aan PSV."},{"page_url":"https://fr.wikipedia.org/wiki/Pedro_Gonz%C3%A1lez_de_Mendoza","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Pediment_CoA_cardinal_Pedro_Gonzales_de_Mendoza_Monastery_San_Hieronimo%2C_Granada%2C_Andalusia%2C_Spain.jpg","page_title":"Pedro González de Mendoza","context_page_description":"Pedro González de Mendoza est un ecclésiastique et une personnalité politique espagnole, le cinquième enfant de Íñigo López de Mendoza, premier marquis Santillana, et Catalina de Figueroa."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Kokinu","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Kanto-railway-Kokinu-station-building.jpg","page_title":"Stazione di Kokinu","context_page_description":"La stazione di Kokinu è una stazione ferroviaria di Tsukubamirai, città della prefettura di Ibaraki e servita dalla linea Jōsō delle Ferrovie del Kantō."},{"page_url":"https://es.wikipedia.org/wiki/J%C3%A1vea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Golfo_de_J%C3%A1vea-X%C3%A1via.jpg","page_title":"Jávea","context_page_description":"Jávea es un municipio de la Comunidad Valenciana, España. Situado en la costa norte de la provincia de Alicante, en la comarca de la Marina Alta. Cuenta con una población de 27.225 habitantes, de los cuales un 53,1% es de nacionalidad extranjera."},{"page_url":"https://de.wikipedia.org/wiki/Chitwan-Nationalpark","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Sal_forest_leofleck.jpg","page_title":"Chitwan-Nationalpark","context_page_description":"Der Chitwan-Nationalpark ist ein Nationalpark in Nepal, der 1973 als erster Nationalpark des Landes unter dem Namen Royal Chitwan National Park gegründet wurde.\\nEr nimmt eine Fläche von 932 km² ein und liegt im Terai, den südlichen Vorbergen des Himalaya. Die südliche Grenze des Nationalparks ist zugleich die Landesgrenze zu Indien. Im Osten schließt sich das Parsa-Wildreservat an. Im Norden bildet der Fluss Rapti und im Westen der Fluss Narayani eine natürliche Begrenzung zu besiedelten Gebieten. Zusammen mit dem Parsa Wildlife Reserve und dem in Indien gelegenen Valmiki-Nationalpark bildet das Gebiet die über 2000 km² große Tiger Conservation Unit Chitwan."},{"page_url":"https://zh.wikipedia.org/zh-tw/PET%E9%85%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/PETase_5XH3_with_HEMT-cartoon.png","page_title":"PET酶","context_page_description":"PET酶是由2016年在日本堺市的一處垃圾掩埋場之中所發現的大阪堺菌製造出來的一種水解酶。PET酶能將PET塑膠降解為其單體單-2-羥乙基對苯二甲酸分子。MHET在細菌體內會進一步被MHET酶降解為羥乙基對苯二甲酸，接著在水中分解為對環境友善的對苯二甲酸與乙二醇，並且可為其他細菌利用，最終產生二氧化碳與水。\\nPET酶催化的反應式可簡單表示為：\\nn + H₂O ⇌ n-1 + MHET\\n直至2018年，已經有數種立體結構被解析出來，包括5XH3、5XH2、5XG0、5XFZ、5XFY、5YNS 、5XJH等。"},{"page_url":"https://it.wikipedia.org/wiki/Teoria_della_correlazione_di_Orione","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Cygnus_constellation_map.png","page_title":"Teoria della correlazione di Orione","context_page_description":"La teoria della correlazione di Orione è un'ipotesi presente nella piramidologia.\\nLa sua principale rivendicazione sta nel fatto che vi sarebbe appunto una voluta correlazione tra la posizione delle principali piramidi della Necropoli di Giza e le stelle centrali della costellazione di Orione, dal momento che queste erano associate dagli antichi egizi ad Osiride, dio della rinascita e dell'oltretomba. A seconda della versione possono essere incluse anche altre Piramidi per la ricostruzione della costellazione, mentre il fiume Nilo rappresenterebbe la Via Lattea.\\nQuesta teoria fu pubblicata per la prima volta nel 1989 all'interno del tredicesimo volume dell'opera Discussions in Egyptology, mentre nel 1994 fu il soggetto del libro di Robert Bauval e Adrian Gilbert The Orion Mystery e del documentario della BBC The Great Pyramid: Gateway to the Stars. L'ipotesi è inoltre contemplata in alcuni libri New Age e nel film Stargate."},{"page_url":"https://nl.wikipedia.org/wiki/Piaseczno","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/POL_Piaseczno3.jpg","page_title":"Piaseczno","context_page_description":"Piaseczno is een stad in het Poolse woiwodschap Mazovië, gelegen in de powiat Piaseczyński. De oppervlakte bedraagt 16,33 km², het inwonertal 35.665."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%DB%87_%D8%AA%D8%B1%D9%87%E2%80%8C%D8%B3%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Watercress_%282%29.JPG","page_title":"سۇ تره‌سی","context_page_description":"سۇ تره‌سی بیر نؤع بیتکی."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%82%D0%BE%D0%BD_(%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%B0-%D0%BD%D0%BE%D1%81%D0%B8%D1%82%D0%B5%D0%BB%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Proton-K-Zarya.jpg","page_title":"Протон (ракета-носитель)","context_page_description":"«Прото́н» — ракета-носитель тяжёлого класса, предназначенная для выведения автоматических космических аппаратов на орбиту Земли и далее в космическое пространство. Способна выводить на геостационарную орбиту грузы до 3,3 т. Разработана в 1961—1967 годах в подразделении ОКБ-23, являвшемся частью ОКБ-52 В. Н. Челомея.\\nИсходный двухступенчатый вариант носителя «Протон» стал одним из первых носителей средне-тяжёлого класса, а трёхступенчатый «Протон-К» — тяжёлого.\\nРН «Протон» явилась средством выведения всех советских и российских орбитальных станций «Салют-ДОС» и «Алмаз», модулей станций «Мир» и МКС, планировавшихся пилотируемых космических кораблей ТКС и Л-1/«Зонд», а также тяжёлых ИСЗ различного назначения и межпланетных станций.\\nС середины 2000-х годов основной модификацией ракеты-носителя «Протон» стала РН «Протон-М», используемая для запуска как федеральных российских, так и коммерческих иностранных космических аппаратов."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Schlachtschiffe_und_Schlachtkreuzer","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/SMS_Kaiserin_stbd_view.jpeg","page_title":"Liste der Schlachtschiffe und Schlachtkreuzer","context_page_description":"Diese Liste der Schlachtschiffe und Schlachtkreuzer umfasst alle von 1905 bis zum Ende des Zweiten Weltkriegs nach dem Muster der HMS Dreadnought als „All-big-gun“-Schiff erbauten Schlachtschiffe und Schlachtkreuzer sowie vergleichbare Schiffe des gleichen Zeitabschnitts.\\nDie Liste enthält folgende Schiffstypen:\\nD – Dreadnought: Schlachtschiffe mit acht bis vierzehn schweren Geschützen und starkem Panzerschutz, aber vergleichsweise moderater Geschwindigkeit.\\nBC – Battlecruiser: Schlachtkreuzer mit sechs bis zwölf schweren Geschützen, mit geringerem Panzerschutz, aber höherer Geschwindigkeit als Schlachtschiffe.\\nB – Battleship: Schnelle Schlachtschiffe mit acht bis zehn schweren Geschützen, starkem Panzerschutz und hoher Geschwindigkeit; mit diesem Schiffstyp wurden Schlachtschiff und Schlachtkreuzer zusammengeführt.\\nC – Coastal defence ship: die skandinavischen und thailändischen Küstenpanzerschiffe, die als für den küstennahen Einsatz verkleinerte Schlachtschiffe angesehen werden können."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%90%D0%BD%D0%B0-%D0%9C%D0%B0%D1%80%D0%B8%D1%98%D0%B0_%D0%88%D0%BE%D0%BF%D0%B5%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Anna_Maria_Jopek_20080706.jpg","page_title":"Ана-Марија Јопек","context_page_description":"Ана-Марија Јопек е полска џез и поп-пејачка."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%83%D1%80%D1%83%D1%80%D0%B0%D0%B2%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Urvashi-Pururavas_by_RRV.jpg","page_title":"Пуруравас","context_page_description":"Пурура́вас — в индийской мифологии первый царь Лунной династии.\\nСо времён Вед Пуруравас считается сыном Илы и Будхи. В «Махабхарате» он назван сыном Илы, которая одновременно была ему и отцом, и матерью.\\nИз историй, связанных с этим царём, наиболее известен миф о нём и апсаре Урваши. Эта история является разработкой сюжета о любви смертного к богине. Сам миф частично зафиксирован в «Ригведе», подробно изложен в «Шатапатха-брахмане» и многих пуранах, особенно в «Вишну», «Матсья» и «Падма-пуранах». Также отдельные моменты зафиксированы в «Махабхарате», «Рамаяне» и «Хариванше». Данный сюжет был обработан Калидасой в его драме «Викраморваши».\\nКак рассказывается в «Шатапатха-брахмане», Пуруравас полюбил апсару Урваши и захотел, чтобы она жила с ним на земле. Апсара согласилась, но поставила одно условие — она не должна увидеть его обнажённым. Сначала всё у Пурураваса и Урваши складывалось хорошо, но частые спутники апсар гандхарвы стали беспокоиться, что одна из дев чересчур долго находится в обществе людей. Чтобы прервать это, гандхарвы придумали хитрый план. Для этого они похитили двух любимых овец Урваши, привязанных к её ложу."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8B%E3%82%B3%E3%83%B3%E3%83%BBCOOLPIX","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Nikon_COOLPIX_8800l.jpg","page_title":"ニコン・COOLPIX","context_page_description":"ニコン・COOLPIXは、ニコンの発売してきたデジタルコンパクトカメラである。"},{"page_url":"https://de.wikipedia.org/wiki/Tael","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/%E5%BE%8C%E8%97%A4%E5%88%86%E9%8A%851.jpg","page_title":"Tael","context_page_description":"Tael ist die Bezeichnung für eine heute nicht mehr gebräuchliche chinesische Währungseinheit. Ursprünglich war das Tael oder Liang eine Maßeinheit für Silber, die je nach Zeit und Ort stark schwankte. Das Tael wird heute noch in verschiedenen südostasiatischen Ländern als Gewichtseinheit verwendet."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mountains_and_hills_of_the_Black_Forest","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Feldberg_Berge_4024.jpg","page_title":"List of mountains and hills of the Black Forest","context_page_description":"The list contains a selection of the mountains and hills in the Black Forest, in order of their height."},{"page_url":"https://en.wikipedia.org/wiki/Epilobium_obcordatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Rock_Fringe.jpg","page_title":"Epilobium obcordatum","context_page_description":"Epilobium obcordatum is a species of perennial plant in the evening-primrose family, known by the common name rockfringe willowherb and rock fringe. It is native to the western United States from California to Idaho, where it is found in rocky mountainous areas, at altitudes of 7,000 ft to 13,000 ft. This small perennial is clumpy to mat-forming and spreads from a woody caudex, especially in nooks between rocks. It has stems lined with oval or rounded leaves which spread parallel to the ground or ascend somewhat. At the tips of the thin stems are flowers each with four petals. The petals are magenta to purple, rounded and notched, often in a perfect heart shape, and are one or two centimeters long. The glandular, club-like, ridged fruit is a capsule two to four centimeters long growing on a short stalk."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D1%83%D0%B3%D1%83%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2%D0%B0,_%D0%A4%D0%BB%D1%8E%D1%80%D0%B0_%D0%93%D0%B0%D0%BB%D0%B8%D0%BC%D1%8C%D1%8F%D0%BD%D0%BE%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/%D0%91%D0%B0%D1%88%D0%BA%D0%B8%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_%D0%BE%D0%BF%D0%B5%D1%80%D1%8B_%D0%B8_%D0%B1%D0%B0%D0%BB%D0%B5%D1%82%D0%B0%2C_%D0%A3%D1%84%D0%B0%2C_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%BC_%D0%A1.%D0%A2._%D0%90%D0%BA%D1%81%D0%B0%D0%BA%D0%BE%D0%B2%D0%B0.jpg","page_title":"Нугуманова, Флюра Галимьяновна","context_page_description":"Нугуманова Флюра Галимьяновна- советская, российская певица. Педагог-вокалист. Народная артистка Башкирской ССР, заслуженная артистка Башкирской АССР."},{"page_url":"https://sv.wikipedia.org/wiki/Liparis_hawaiensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Starr_051030-5114_Liparis_hawaiensis.jpg","page_title":"Liparis hawaiensis","context_page_description":"Liparis hawaiensis är en orkidéart som beskrevs av Horace Mann. Liparis hawaiensis ingår i släktet gulyxnen, och familjen orkidéer.\\nArtens utbredningsområde är Hawaii. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://nl.wikipedia.org/wiki/Flaxweiler","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Coat_of_arms_flaxweiler_luxbrg.png","page_title":"Flaxweiler","context_page_description":"Flaxweiler is een gemeente in het Luxemburgse Kanton Grevenmacher.\\nDe gemeente heeft een totale oppervlakte van 30,17 km² en telde 1715 inwoners op 1 januari 2007."},{"page_url":"https://en.wikipedia.org/wiki/Hla_Moe","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Dr_Hla_Moe.jpg","page_title":"Hla Moe","context_page_description":"Hla Moe is a Burmese politician currently serving as a House of Representatives MP for Aungmyethazan Township. He is a member of the National League for Democracy."},{"page_url":"https://la.wikipedia.org/wiki/Donzenac","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Ruelle_de_Donzenac.JPG","page_title":"Donzenac","context_page_description":"Donzenac est commune 2'545 incolarum Franciae praefecturae Curretiae in provincia Lemovicensi."},{"page_url":"https://ru.wikipedia.org/wiki/Ford_Escort_(%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/1981-1987_Ford_Escort.jpg","page_title":"Ford Escort (Северная Америка)","context_page_description":"Весной 1981 году компания Ford представила Escort для американского рынка, автомобиль был похож на европейскую модель, но с существенной разницей. Сначала предлагался только трехдверный хэтчбек. В начале 1982 года представлен пятидверный хэтчбек и универсал. Программа была разделена на базовую модель, L, GL, GLX и спортивный SS. Весной 1982 года спортивную модификацию SS переименована в GT. В 1985 году модель обновили. Весной 1988 года, модель обновили изменив переднюю часть и задние фонари. В 1990 году производство первого поколения было прекращено."},{"page_url":"https://en.wikipedia.org/wiki/Salzburg_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Burg_Salzburg_6.jpg","page_title":"Salzburg Castle","context_page_description":"Salzburg Castle stands on the edge of a plateau above the town of Bad Neustadt an der Saale in Lower Franconia in southern Germany. The large Ganerbenburg is still partly occupied today and not all areas are accessible to the public."},{"page_url":"https://fr.wikipedia.org/wiki/Hen_Ogledd","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Yr.Hen.Ogledd.550.650.Koch.jpg","page_title":"Hen Ogledd","context_page_description":"Yr Hen Ogledd est une région historique de Grande-Bretagne.\\nIl correspond aux régions du Nord de l'Angleterre et du Sud de l'Écosse qui sont occupées par des peuples de langue brittonique dans les premiers siècles de la période post-romaine de l'histoire de l'île, par opposition aux Pictes, aux Scots du Dal Riada et aux Anglo-Saxons de Northumbrie. Il ne subsiste que quelques termes et toponymes de leur langue, le cambrien.\\nLe qualificatif de « Nord » pour désigner cette région est utilisé dès le Moyen Âge par les Gallois, par exemple dans les généalogies réunies sous le titre de Bonedd Gwŷr y Gogledd, « Ascendance des Hommes du Nord »."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A5%D1%8E%D0%BB%D0%B5%D1%82-%D0%9F%D0%B0%D0%BA%D0%B0%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/HP_Headquarters_Palo_Alto.jpg","page_title":"Хюлет-Пакард","context_page_description":"Hewlett-Packard Company, произнася се Хюлет-Пакард е била една от най-големите световни корпорации в сферата на информационните технологии, известна със своите принтери, персонални компютри и сървъри. Тя е била и четвъртият по големина доставчик на хардуер и услуги в областта на информационните технологии с обем на продажбите в този сектор от 13,84 милиарда евро и общ обем на продажбите от 69,05 милиарда евро.\\nКомпанията е основана през 1939 г. от Бил Хюлет и Дейв Пакард. Корпоративното седалище се намира в Пало Алто, Калифорния, САЩ. Президент и главен изпълнителен директор е Маргарит Уитман.\\nПрез 2002 г. придобива Compaq в сделка на стойност 25 млрд. долара.\\nПрез 2015 се разделя на две нови компании – HP Inc. и Hewlett Packard Enterprise. Първата наследява бизнеса по производство на персонални компютри и принтери. Неин ръководител е Дион Уайзлър, който преди разделянето е бил начело на поделението „Printing and Personal Systems“. Hewlett Packard Enterprise предлага корпоративни IT системи. Компанията се управлява от досегашния главен изпълнителен директор на HP – Мег Уитман."},{"page_url":"https://pl.wikipedia.org/wiki/Barbara_Fijewska","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Barbara_Fijewska_-_Film_nr_31-32_-_1947-12-24.JPG","page_title":"Barbara Fijewska","context_page_description":"Barbara Fijewska – polska choreograf teatralny i filmowy, reżyser teatralny, aktorka filmowa, tancerka, pedagog. Siostra aktora Tadeusza Fijewskiego oraz reżysera i aktora Włodzimierza Fijewskiego.\\nAbsolwentka Prywatnej Szkoły Tańca Scenicznego Tacjanny Wysockiej i Studium Iwo Galla w Warszawie. W latach 1932–1939 występowała jako tancerka estradowa. W czasie II wojny światowej wojny pracowała w Fabryce Kabli w Ożarowie. Brała udział w powstaniu warszawskim"},{"page_url":"https://de.wikipedia.org/wiki/Rolf_Caroli","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Bundesarchiv_Bild_183-74502-0004%2C_Rolf_Caroli%2C_Osorski.jpg","page_title":"Rolf Caroli","context_page_description":"Rolf Caroli war ein deutscher Boxer. Er gewann bei den Europameisterschaften der Amateurboxer 1955, 1957 und 1959 jeweils die Bronzemedaille im Halbmittelgewicht."},{"page_url":"https://ru.wikipedia.org/wiki/KJ-200","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/KJ-200H_9371_20160131.jpg","page_title":"KJ-200","context_page_description":"При разработке самолёта ДРЛО KJ-2000 на базе Ил-76 возникли перебои с поставками самолёта-носителя РЛС. Это побудило разработать в 2002 г. чисто свой самолёт того же назначения - KJ-200.\\nДля установки радиолокатора был выбран самолёт Shaanxi Y-8, производство Shaanxi Aircraft Company. На самолёте установлено 4 шестилопастных турбовинтовых двигателя Pratt & Whitney Canada PW150B, изготавливаемые канадским подразделением американской компании Пратт энд Уитни, и авионику производства Honeywell. Главный конструктор Оуян Шаосю заявил, что по сравнению с базовым вариантом, новый самолёт был переработан на 80%. В частности, для отображения информации в кабине пилотов установили специальные дисплеи.\\nНа самолёт установили радиолокатор с фазированной антенной решёткой над задней частью фюзеляжа. Использован радиолокатор Erieye компании Saab AB.\\nПо оценкам её дальность действия составит 300-450 км.\\nС 2011г модифицированный вариант самолёта стал поставляться в Пакистан. Модификация вылилась в приспособление его к совместным действиям с самолётами F-16 и Chengdu FC-1 Xiaolong, стоящими на вооружении этой страны. В 2011 г. ВВС Пакистана эксплуатировали 4 машины."},{"page_url":"https://fr.wikipedia.org/wiki/Emma_Watson","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Emma_Watson_2013.jpg","page_title":"Emma Watson","context_page_description":"Emma Watson [ˈɛmə ˈwɒtsən], née le 15 avril 1990 à Paris, en France, est une actrice britannique. Elle est devenue célèbre en jouant, de son enfance en 2001 à l'âge adulte en 2011, le rôle d'Hermione Granger, l'un des trois rôles principaux dans la série des films Harry Potter. Elle est nommée pour de nombreuses récompenses pour son rôle, et en remporte plusieurs.\\nCe n’est qu’après avoir tourné tous les opus de Harry Potter que l’actrice s’attaque à des rôles très différents. En 2012, elle incarne une des costumières de Marilyn Monroe dans le film My Week with Marilyn de Simon Curtis. On la retrouve également à l’affiche du Monde de Charlie de Stephen Chbosky et de The Bling Ring, réalisé par Sofia Coppola, sorti en 2013, où elle tient l'un des rôles principaux. En 2014, elle tient le rôle d'Ila dans le péplum américain Noé réalisé par Darren Aronofsky. On peut aussi la retrouver dans le film Regression de Alejandro Amenabar en 2015, et dans des films engagés comme Colonia sur la dictature chilienne, ou The Circle, d'après le roman homonyme, dénonçant le « système Google »."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%91%D7%99_%D7%9E%D7%90%D7%99%D7%A8_%D7%91%D7%A2%D7%9C_%D7%94%D7%A0%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Flickr_-_Government_Press_Office_%28GPO%29_-_Tomb_of_Rabbi_Meir_Baal_Haness.jpg","page_title":"רבי מאיר בעל הנס","context_page_description":"רבי מאיר בעל הנס הוא כינויו של עושה נפלאות הקבור בטבריה. הכינוי מופיע החל מהמאה ה-18, ובאופן מסורתי מקובל לזהות אותו עם התנא רבי מאיר, אך יש השוללים זיהוי זה. קברו, קבר רבי מאיר בעל הנס, הוא מוקד עלייה לרגל."},{"page_url":"https://fr.wikipedia.org/wiki/Parc_national_Sundown","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Sundown_National_Park_2.jpg","page_title":"Parc national Sundown","context_page_description":"Le parc national Sundown est un parc national situé à 250 km au sud-ouest de Brisbane à la frontière de la Nouvelle-Galles du Sud. Il abrite la source da la Severn River du Queensland."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%86%D5%A5%D5%BD%D5%BF%D5%B8%D6%80_%D4%BF%D5%B8%D6%82%D5%AF%D5%B8%D5%AC%D5%B6%D5%AB%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Nestor_Kukolnik_Ruka_Vsevyshnego.JPG","page_title":"Նեստոր Կուկոլնիկ","context_page_description":"Նեստոր Վասիլևիչ Կուկոլնիկ, ռուս արձակագիր, բանաստեղծ, թարգմանիչ, դրամատուրգ, 19-րդ դարի առաջին կեսի հայտնի ռոմանսների տեքստերի հեղինակ:"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B3%B6%E5%B6%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Dent_Island.jpg","page_title":"島嶼","context_page_description":"島嶼或島是指於海洋中或湖泊中被水體圍繞的陸地區域。世界上面積最大的島嶼是格陵蘭島。面積更大的則不被視為島嶼，而叫做「大陸」，地球上共有四個大陸：亞歐非大陸、美洲大陸、南極大陸以及澳大利亞大陸，其中澳大利亞大陸被視為大洋洲的主要部分。另外格陵蘭島由於面積龐大，常被稱為格陵蘭次大陸。 在狹小的地域集中2個或以上的島嶼，即成「島嶼群」，大規模的島嶼群稱作「群島」或「諸島」，列狀排列的群島即為「列島」。而如果一個國家的整個國土都坐落在一個或數個島之上，則此國家可以被稱為島嶼國家，簡稱「島國」。"},{"page_url":"https://eo.wikipedia.org/wiki/Regiono_Dodomao","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Tanzania_Dodoma.png","page_title":"Regiono Dodomao","context_page_description":"Dodomao estas unu el la centraj regionoj de Tanzanio. Ĝia ĉefurbo, Dodomao, estas ankaŭ la ĉefurbo de la regno.\\nLa regiono havas ĉirkaŭ 1,7 milionojn da loĝantoj kaj areon de 41.310 km². Ĝi estas administre dividita al kvin distriktoj:"},{"page_url":"https://fr.wikipedia.org/wiki/Bronzes_chinois","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Bronze_tiger_on_top_of_water_buffalo%2C_Zhou_Dynasty.JPG","page_title":"Bronzes chinois","context_page_description":"Les bronzes chinois sont universellement admirés comme des chefs-d’œuvre de l'art du bronze, tout particulièrement ceux réalisés au cours des deux premiers millénaires avant notre ère. Les bronzes des dynasties Shang et Zhou, depuis le XVIᵉ siècle et jusqu’à 221 avant notre ère, aux formes et décors étonnants, témoignent de l’esprit créatif et de la remarquable maîtrise technique des bronziers chinois au cours de l’âge du bronze. L'art des dynasties royales de l'Antiquité, fondement essentiel de l'art chinois, est en majorité un art du bronze.\\nBien que la valeur de ces chefs-d’œuvre ait été reconnue en Chine par les lettrés dès le XIᵉ siècle, les sculpteurs sur pierre ou dans le bronze, n'étaient pas considérés comme « artistes » mais comme artisans dans la Chine ancienne. Il s'agit cependant d'une véritable pratique artistique, reconnue comme telle en Chine comme ailleurs aujourd’hui.\\nDès l'époque Shang le bronze est associé aux rites funéraires."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Manzac-sur-Vern","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Manzac-sur-Vern_village_%281%29.JPG","page_title":"Manzac-sur-Vern","context_page_description":"Manzac-sur-Vern sī ūi-tī Hoat-kok Aquitaine tōa-khu Dordogne séng ê chi̍t-ê commune."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B4%D0%B8%D0%BF%D0%BB%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%BD%D0%B8%D1%85_%D0%BC%D1%96%D1%81%D1%96%D0%B9_%D1%83_%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Portuguese_Consulate_in_Geneva.JPG","page_title":"Список дипломатичних місій у Швейцарії","context_page_description":"Нижче наведено список дипломатичних місій в Швейцарії. В столиці Швейцарія Берні знаходяться 87 посольств, окрім того в Женеві знаходяться ще 30 посольств країн світу, суміщених із представництвами цих країн в женевському офісі ООН. Ще 54 країни мають акредитованих послів, які перебувають за межами Швейцарії, в основному в Берліні, Парижі та Брюсселі. Почесні консульства в цьому списку не наведені."},{"page_url":"https://pt.wikipedia.org/wiki/Isorno","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Auressio.jpg","page_title":"Isorno","context_page_description":"Isorno é uma comuna da Suíça, no Cantão Tessino, com cerca de 380 habitantes. Estende-se por uma área de 17,28 km², de densidade populacional de 22 hab/km². Confina com as seguintes comunas: Cavigliano, Intragna, Maggia, Mosogno, Onsernone.\\nA língua oficial nesta comuna é o Italiano."},{"page_url":"https://cs.wikipedia.org/wiki/Ji%C5%99%C3%AD_Kornatovsk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/08._Ji%C5%99%C3%AD_Kornatovsk%C3%BD_Style_declarative%2C_Galerie_modern%C3%ADho_um%C4%9Bn%C3%AD_v_Hradci_Kr%C3%A1lov%C3%A9%2C_2017-2018.jpg","page_title":"Jiří Kornatovský","context_page_description":"Jiří Kornatovský je český malíř, kreslíř a grafik."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%BE%E6%9C%AC%E5%B8%82%E7%AB%8B%E5%A4%A7%E9%87%8E%E5%B7%9D%E5%B0%8F%E5%AD%A6%E6%A0%A1%E3%83%BB%E4%B8%AD%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Ohnogawa_school4.JPG","page_title":"松本市立大野川小学校・中学校","context_page_description":"松本市立大野川小学校・中学校は長野県松本市安曇宮の原にある市立小学校・中学校。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B5%B5%E6%9C%88%E6%9E%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Yuezhi_Zhao_-_2019_%28cropped%29.jpg","page_title":"赵月枝","context_page_description":"赵月枝加拿大华裔社会学家，传播政治经济学者，西门菲沙大学传播学院副院长。"},{"page_url":"https://de.wikipedia.org/wiki/Rifugio_Garzonera","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Rifugio_Garzonera_TI_02.jpg","page_title":"Rifugio Garzonera","context_page_description":"Das Rifugio Garonzera ist eine Schutzhütte im oberen Valle Leventina, auf dem Gebiet der Gemeinde Quinto im Kanton Tessin. Sie steht auf einer Höhe von 1973 m ü. M. in den Lepontinischen Alpen."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%A4%AA%E9%98%B3%E8%83%BD%E7%94%B5%E6%B1%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Solar_cells%2CTurfan%2C2012.jpg","page_title":"太阳能电池","context_page_description":"太阳能电池是一种将太阳光通过光生伏打效应转成电能的装置。太阳能电池事实上并不是电池，这是翻译名词，原意为太阳能单元。\\n在常见的半导体太阳能电池中，透过适当的能阶设计，便可有效的吸收太阳所发出的光，并产生电压与电流。这种现象又被称为太阳能光伏。\\n太阳能发电是一种可再生的环保发电方式，其发电过程中不会产生二氧化碳等温室气体，因此不会对环境造成污染；但太阳能电池板的生产过程会产生大量有毒废水，需另行处置。另外弃置的太阳能电池也是问题，若没有妥善的回收机制，会对环境造成污染。\\n按照制作材料分为硅基半导体电池、CdTe薄膜电池、CIGS薄膜电池、染料敏化薄膜电池、有机材料电池等。其中硅电池又分为单晶硅电池、多晶硅电池和无定形体硅薄膜电池等。对于太阳能电池来说最重要的参数是转换效率，目前在实验室所研发的硅基太阳能电池中，单晶硅电池效率为25.0%，多晶硅电池效率为20.4%，CIGS薄膜电池效率达19.8%，CdTe薄膜电池效率达19.6%，非晶硅薄膜电池的效率为10.1%。"},{"page_url":"https://gl.wikipedia.org/wiki/Escola_de_Kerala","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Caminho_maritimo_para_a_India.png","page_title":"Escola de Kerala","context_page_description":"A Escola de astronomía e matemáticas de Kerala foi unha escola de matemáticas e astronomía fundada por Madhava de Sangamagrama en Kerala, no sur da India, que incluía entre os seus membros a Parameshvara, Neelakanta Somayaji, Jyeshtadeva, Achyuta PisharatiNeelpathur Narayana Bhattathiri e Achyuta Panikkar, e súas raíces intelectuais remóntanse o século V, cos traballos de Aryabhata."},{"page_url":"https://fr.wikipedia.org/wiki/Don_Mattingly","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Don_Mattingly_playing_for_the_New_York_Yankees_at_Yankee_Stadium_on_August_19%2C_1988.jpg","page_title":"Don Mattingly","context_page_description":"Donald Arthur Mattingly est un ancien joueur de baseball et l'actuel gérant des Marlins de Miami de la Ligue majeure de baseball.\\nAncien joueur de premier but, il passe toute sa carrière de joueur chez les Yankees de New York, de 1982 à 1995.\\nDon Mattingly dirige les Dodgers de Los Angeles de 2011 à 2015."},{"page_url":"https://pl.wikipedia.org/wiki/Paul_Storr","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Gilt_Memorial_Urn%2C_Paul_Storr%2C_British%2C_1805-1806%2C_silver_-_Huntington_Museum_of_Art_-_DSC05419.JPG","page_title":"Paul Storr","context_page_description":"Paul Storr – angielski rzeźbiarz, złotnik i projektant.\\nWspółpracował najpierw z Andrew Fogelbergiem, złotnikiem szwedzkiego pochodzenia. Po 1807 związał się z firmą królewskich złotników Rundell and Bridge. W projektowaniu zastawy wzorował się m.in. na sztuce rzymskiej, jego dzieła noszą też piętno stylu rokoko. W 1822 założył własną firmę, która istniała do 1838."},{"page_url":"https://lv.wikipedia.org/wiki/%C5%BDemaitijas_valdnieku_uzskait%C4%ABjums","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/JRadziwi%C5%82%C5%82.JPG","page_title":"Žemaitijas valdnieku uzskaitījums","context_page_description":"Šajā uzskaitījumā apkopoti Žemaitijas valdnieki, kas bija Žemaitijas kunigaitijas valsts valdnieki. 1409. gadā pēc Žemaitijas iekļaušanas Lietuvas dižkunigaitijā tā saglabāja daļēju autonomiju un to pārvaldīja Žemaitijas vecākais. Savukārt pēc Polijas-Lietuvas kopvalsts izveidošanās, visu Polijas-Lietuvas kopvalsts valdnieku pilnajā titulā tika iekļauts arī pārmantojams tituls \\"Žemaitijas lielhercogs\\", kas norādīja uz to kā būtisku kopvalsts sastāvdaļu. Uz vietas formālo valdnieku aizvietoja viņa pārstāvis — Žemaitijas ģenerālstārasts."},{"page_url":"https://de.wikipedia.org/wiki/Gutskirche_Gro%C3%9F_Bartensleben","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Dorfkirche_Gro%C3%9F_Bartensleben.jpg","page_title":"Gutskirche Groß Bartensleben","context_page_description":"Die Gutskirche Groß Bartensleben ist die evangelische Kirche im zur Gemeinde Erxleben gehörenden Dorf Groß Bartensleben in Sachsen-Anhalt.\\nSie gehört zum Kirchenkreis Haldensleben-Wolmirstedt der Evangelischen Kirche in Mitteldeutschland."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Makaryevsky_Ko%C4%81n","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Kostroma-oblast-Makariev.png","page_title":"Makaryevsky Koān","context_page_description":"Makaryevsky Koān sī Lō͘-se-a Kostroma Chiu ê chi̍t ê koān.\\nPang-bô͘:Kostroma Chiu"},{"page_url":"https://en.wikipedia.org/wiki/Bra%C8%99ov_metropolitan_area","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Brasov_Metropolitan_Area_jud_Brasov.jpg","page_title":"Brașov metropolitan area","context_page_description":"The Brașov metropolitan area is a metropolitan area in Brașov County, Romania, that includes the municipality of Brașov and 12 other nearby communities. It was constituted in 2007 with the aim of creating business opportunities, building and administering of living spaces and recreational areas, to attract more consistent investment, and to coordinate better environment and infrastructure projects. As of 2011, the area has a population of 369,896. The total area is 1,368.5 km².\\nAs defined by Eurostat, the Brașov functional urban area has a population of 398,953 residents."},{"page_url":"https://en.wikipedia.org/wiki/Gothenburg_Botanical_Garden","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Botaniska.svg","page_title":"Gothenburg Botanical Garden","context_page_description":"The Gothenburg Botanical Garden is located in Gothenburg, Sweden, and is one of the larger botanical gardens in Europe."},{"page_url":"https://de.wikipedia.org/wiki/SU-23","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/ZUR-23-2S_Jod_NTW_9_93.jpg","page_title":"SU-23","context_page_description":"Bei der SU-23 handelt es sich um eine gezogene Flugabwehrkanone aus sowjetischer Produktion."},{"page_url":"https://de.wikipedia.org/wiki/Magda_Irschick","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/MagdaIrschick.jpg","page_title":"Magda Irschick","context_page_description":"Magdalena Irschick, verehelichte Magda Freiin von Perfall war eine österreichisch-deutsche Theaterschauspielerin."},{"page_url":"https://en.wikipedia.org/wiki/Christie-Parsels_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/ChristieParsilsHouse.jpg","page_title":"Christie-Parsels House","context_page_description":"The Christie-Parsels House is located in Tenafly, Bergen County, New Jersey, United States. The house was built in 1804 by William P. Christie. In 1836 Samuel Parsels erected a large wing on the eastern side of the original house. The house was added to the National Register of Historic Places on January 10, 1983."},{"page_url":"https://no.wikipedia.org/wiki/Heidrun","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/S%C3%81M_66%2C_73r%2C_Valh%C3%B6ll.jpg","page_title":"Heidrun","context_page_description":"Heidrun er navnet på ei geit i norrøn mytologi. Heiðrun står på taket av Bilskirne, Tors hall i Truðheim. Hjorten Eiktyrne står oppå Valhall, og fra hver sin kant beiter de på treet Lærads limum, som trolig er greinene på Yggdrasil. Heidrun forsyner einherjene i Valhall med mjød; fra spenene hennes renner det mjød ned i et stort drikkekar som står i hallen, og mengden er stor nok til å gjøre alle einherjene drukne."},{"page_url":"https://fr.wikipedia.org/wiki/Nogentel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/%C3%89glise_de_nogentel.jpg","page_title":"Nogentel","context_page_description":"Nogentel est une commune française située dans le département de l'Aisne, en région Hauts-de-France.\\nSes habitants sont appelés les Nogentellois."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%88%D8%A8%D9%8A_%D8%A5%D9%8A%D8%B1%D9%84_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%87%D9%88%D9%83%D9%8A_%D8%A7%D9%84%D8%AC%D9%84%D9%8A%D8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Robbie_Earl_preseason_07-08.jpg","page_title":"روبي إيرل (لاعب هوكي الجليد)","context_page_description":"روبي إيرل ‏ هو لاعب هوكي الجليد أمريكي، ولد في 2 يونيو 1985 في شيكاغو في الولايات المتحدة."},{"page_url":"https://en.wikipedia.org/wiki/Prince_Philippe,_Duke_of_Orl%C3%A9ans_(1869%E2%80%931926)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Marie-Doroth%C3%A9e-duchesse-d%27Orleans.jpg","page_title":"Prince Philippe, Duke of Orléans (1869–1926)","context_page_description":"Philippe, Duke of Orléans was the Orléanist claimant to the throne of France from 1894 to 1926."},{"page_url":"https://en.wikipedia.org/wiki/Condom","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/El_Paral%C2%B7lel_1894-1939-_exhibit_at_CCCB_in_Barcelona_%2878%29.JPG","page_title":"Condom","context_page_description":"A condom is a sheath-shaped barrier device used during sexual intercourse to reduce the probability of pregnancy or a sexually transmitted infection. There are both male and female condoms. With proper use—and use at every act of intercourse—women whose partners use male condoms experience a 2% per-year pregnancy rate. With typical use the rate of pregnancy is 18% per-year. Their use greatly decreases the risk of gonorrhea, chlamydia, trichomoniasis, hepatitis B, and HIV/AIDS. They also to a lesser extent protect against genital herpes, human papillomavirus, and syphilis.\\nThe male condom is rolled onto an erect penis before intercourse and works by forming a physical barrier which blocks semen from entering the body of a sexual partner. Male condoms are typically made from latex and, less commonly, from polyurethane, polyisoprene, or lamb intestine. Male condoms have the advantages of ease of use, easy to access, and few side effects. In those with a latex allergy a polyurethane or other synthetic version should be used. Female condoms are typically made from polyurethane and may be used multiple times.\\nCondoms as a method of preventing STIs have been used since at least 1564."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B9%D1%85%D0%B5,_%D0%9C%D0%B0%D1%80%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Maria_Reiche_1910_%28cropped%29.jpeg","page_title":"Райхе, Мария","context_page_description":"Мария Райхе — немецкая исследовательница, известная изучением геоглифов Наски в Перу, начатым в 1940 году. Геоглифы Наски признаны объектом всемирного наследия ЮНЕСКО в 1994 году."},{"page_url":"https://de.wikipedia.org/wiki/Dux-Kino","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Dux_MM44.jpg","page_title":"Dux-Kino","context_page_description":"Das Dux-Kino war ein Spielzeugprodukt von Markes & Co aus Lüdenscheid. Neben Blechspielzeug und Metallbaukästen machte sich dieses Unternehmen mit den Spielzeug-Filmprojektoren unter dem Markennamen DUX Kino seit den 1930er-Jahren einen Namen."},{"page_url":"https://fr.wikipedia.org/wiki/Yvrench","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Yvrench_3.JPG","page_title":"Yvrench","context_page_description":"Yvrench est une commune française située dans le département de la Somme, en région Hauts-de-France.\\nDepuis le 13 février 2020, la commune fait partie du parc naturel régional Baie de Somme - Picardie maritime."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%98%E1%83%A2%E1%83%A0%E1%83%9D%E1%83%A4%E1%83%90%E1%83%9C%E1%83%94_%E1%83%92%E1%83%A0%E1%83%94%E1%83%99%E1%83%9D%E1%83%95%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%90%E1%83%AE%E1%83%9A-%E1%83%9B%E1%83%A3%E1%83%96%E1%83%94%E1%83%A3%E1%83%9B%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/%D0%94%D0%BE%D0%BC-%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%9C.%D0%91._%D0%93%D1%80%D0%B5%D0%BA%D0%BE%D0%B2%D0%B0%2C_%D0%9D%D0%BE%D0%B2%D0%BE%D1%87%D0%B5%D1%80%D0%BA%D0%B0%D1%81%D1%81%D0%BA.jpg","page_title":"მიტროფანე გრეკოვის სახლ-მუზეუმი","context_page_description":"მიტროფანე გრეკოვის სახლ-მუზეუმი — სახლ-მუზეუმი ნოვოჩერკასკში, როსტოვის ოლქი, რუსეთის ფედერაცია. სახლში 14 წელი ცხოვრობდა საბჭოთა მხატვარი მიტროფანე გრეკოვი. სახლ-მუზეუმი არის ნოვოჩერკასკის დონის კაზაკთა ისტორიის მუზეუმის ფილიალი. შენობა არის რუსეთის ფედერაციის ფედერალური მნიშვნელობის კულტურული მემკვიდრეობის ძეგლი.\\nმუზეუმის მისამართი: რუსეთი, როსტოვის ოლქი, ნოვოჩერკასკი, გრეკოვის ქუჩა № 124."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%82%A4%E3%83%A0%E3%83%99%E3%82%AF%E5%9C%B0%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/KZ_Almaty_Region_Relief.png","page_title":"ライムベク地区","context_page_description":"ライムベク地区 はカザフスタン共和国アルマトイ州にある地区である。中心都市はケゲンである。人口は2013年時点で推定79,624人、2009年時点で80,377人、1999年時点で83,093人であった。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Alpine_Line_ouvrages","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Alpine_Line_10_June_1940.svg","page_title":"List of Alpine Line ouvrages","context_page_description":"This is the list of all ouvrages of the Alpine Line or Little Maginot Line along the Franco-Italian border, organized by sector and type of fortification. Ouvrage translates as \\"works\\" in English; publications in both English and French refer to these fortifications in this manner, rather than as \\"forts\\". An ouvrage typically consists of a distributed series of concrete-encased strongpoints defending a region, linked by tunnels, as opposed to a fort, which typically refers to a defended surface enclosure, which may have underground galleries as an adjunct.\\nFor a list of the ouvrages of the main Maginot Line, refer to List of Maginot Line ouvrages."},{"page_url":"https://it.wikipedia.org/wiki/Berga/Elster","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Berga-Elster_in_GRZ.png","page_title":"Berga/Elster","context_page_description":"Berga/Elster è una città di 3 258 abitanti della Turingia, in Germania. Appartiene al circondario di Greiz.\\nBerga/Elster svolge il ruolo di \\"comune amministratore\\" nei confronti dei comuni di Mohlsdorf e Teichwolframsdorf."},{"page_url":"https://en.wikipedia.org/wiki/List_of_paintings_by_Paul_C%C3%A9zanne","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Cezanne_-_Selbstbildnis_mit_M%C3%BCtze.jpg","page_title":"List of paintings by Paul Cézanne","context_page_description":"This list of paintings by the French painter Paul Cézanne is incomplete.\\nThe artistic career of Cézanne spanned more than forty years, from roughly 1860 to 1906. A prolific artist, he produced more than 900 oil paintings and 400 watercolours, including many incomplete works. This list is a selection of Cézanne's better-known paintings, or includes those for which images are available."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%8A%9D%EC%8A%A4%EB%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%E7%86%8A%E5%8D%81%E5%8A%9B_1960s.jpg","page_title":"슝스리","context_page_description":"슝스리는 중국 현대 신유학의 대표적인 학자 중 한 사람이다."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AE%E0%B4%B2%E0%B5%87%E0%B4%B7%E0%B5%8D%E0%B4%AF%E0%B4%AF%E0%B4%BF%E0%B4%B2%E0%B5%86_%E0%B4%B5%E0%B4%BF%E0%B4%A6%E0%B5%8D%E0%B4%AF%E0%B4%BE%E0%B4%AD%E0%B5%8D%E0%B4%AF%E0%B4%BE%E0%B4%B8%E0%B4%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Nilai_University.JPG","page_title":"മലേഷ്യയിലെ വിദ്യാഭ്യാസം","context_page_description":"മലേഷ്യയിലെ വിദ്യാഭ്യാസം വിദ്യാഭ്യാസമന്ത്രാലയം ആണു കൈകാര്യം ചെയ്യുന്നത്. ഫെഡറൽ സർക്കറിനാണ് വിദ്യാഭ്യാസച്ചുമതലയുള്ളതെങ്കിലും പ്രാദേശികസർക്കാറുകൾക്കും വിദ്യാഭ്യാസ മന്ത്രാലയമുണ്ട്. ആ പ്രാദേശികസർക്കാറുകൾ അവരുടെ നിയന്ത്രിതപ്രദേശങ്ങളിലെ വിദ്യാഭ്യാസകാര്യങ്ങളെ നിയന്ത്രിക്കുവാൻ അധികാരമുണ്ട്. 1996ലെ വിദ്യാഭ്യാസനിയമം ആണ് പ്രധാനപ്പെട്ട ഭരണഘടനാനിയമം\\nവിദ്യാഭ്യാസ സംവിധാനം പ്രീസ്കൂൾ വിദ്യാഭ്യാസം, പ്രാഥമികവിദ്യാഭ്യാസം, സെക്കണ്ടറി വിദ്യാഭ്യാസം, പോസ്റ്റ് സെക്കണ്ടറി വിദ്യാഭ്യാസം, തൃതീയ വിദ്യാഭ്യാസം എന്നിങ്ങനെ തിരിച്ചിട്ടുണ്ട്. മലേഷ്യയിൽ വിദ്യാഭ്യാസം ഒന്നുകിൽ പൊതുവിദ്യാലയങ്ങളിൽ നിന്നു എല്ലാ മലേഷ്യക്കാർക്കും ലഭ്യമായ സൗജന്യമായ ബഹുഭാഷാവിദ്യാഭ്യാസമോ സ്വകാര്യ സ്കൂളുകളിൽനിന്നും ലഭ്യമായ സ്വകാര്യവിദ്യാഭ്യാസമോ വീടുകളിൽ ഇരുത്തി പടിപ്പിക്കുന്ന ഹോം സ്കൂളിങ്ങോ ആകാം. നിയമപരമായി, പ്രാഥമികവിദ്യാഭ്യാസം സൗജന്യമാണ്. റിപ്പബ്ലിക് ഓഫ് കൊറിയ, ജപ്പാൻ, സിങ്കപ്പൂർ തുടങ്ങിയ ഏഷ്യൻ രാജ്യങ്ങളിലെപോലെ സ്റ്റാൻഡഡൈസ് ചെയ്ത് മൂല്യനിർണ്ണയന പ്രവർത്തനങ്ങൾ ഇവിടെ പൊതുവേ നടത്തിവരുന്നുണ്ട്. ഇപ്പോൾ, 37 സ്വകാര്യ സർവ്വകലാശാലകളും 20 സർവ്വകലാശാലാ കോളജുകളും 9 വിദേശ സർവ്വകലാശാലാശാഖകളും ചേർന്ന് 414 സ്വകാര്യ കോളജുകൾ പ്രവർത്തിക്കുന്നു."},{"page_url":"https://simple.wikipedia.org/wiki/Oxalidales","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Ceratopetalum_apetalum.jpg","page_title":"Oxalidales","context_page_description":"The Oxalidales is a group of six families of flowering plants. This family has about 1300 species. These include some herbs, shrubs and trees."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%82%D0%B5%D0%BB%D1%8C%D0%B6%D0%B8%D0%BD%D0%B5%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Castelginest_-_Parc_Mauvezin_-_Pigeonnier.jpg","page_title":"Кастельжинес","context_page_description":"Кастельжине́с, Кастельжінес — муніципалітет у Франції, у регіоні Південь-Піренеї, департамент Верхня Гаронна. Населення — 9048 осіб.\\nМуніципалітет розташований на відстані близько 580 км на південь від Парижа, 11 км на північ від Тулузи."},{"page_url":"https://en.wikipedia.org/wiki/Robert_Henryson","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Dunfermline_Abbey_by_John_Slezer.jpg","page_title":"Robert Henryson","context_page_description":"Robert Henryson was a poet who flourished in Scotland in the period c. 1460–1500. Counted among the Scots makars, he lived in the royal burgh of Dunfermline and is a distinctive voice in the Northern Renaissance at a time when the culture was on a cusp between medieval and renaissance sensibilities. Little is known of his life, but evidence suggests that he was a teacher who had training in law and the humanities, that he had a connection with Dunfermline Abbey and that he may also have been associated for a period with Glasgow University. His poetry was composed in Middle Scots at a time when this was the state language. It is one of the most important bodies of work in the canon of early Scottish literature.\\nHis writing consists mainly of narrative works highly inventive in their development of story-telling techniques. He generally achieved a canny balance of humour and high seriousness which is often multi-layered in its effects. This is especially so in his Morall Fabillis, in which he expresses a consistent but complex world view that seems standard, on the surface, vis a vis the major ruling power of the church, while containing critical and questioning elements."},{"page_url":"https://en.wikipedia.org/wiki/Yuta_Watanabe","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Takahashi_michael_%28cropped%29.jpg","page_title":"Yuta Watanabe","context_page_description":"Yuta Watanabe is a Japanese professional basketball player for the Memphis Grizzlies of the National Basketball Association, on a two-way contract with the Memphis Hustle of the NBA G League. He played college basketball in the United States for the George Washington Colonials after becoming the first Japan-born student athlete to secure an NCAA Division I basketball scholarship. He was named the Atlantic 10 Conference's defensive player of the year in 2018. He has also represented Japan internationally and helped the team win the bronze medal at the 2013 East Asia Basketball Championship.\\nBefore moving to the collegiate level, Watanabe attended Jinsei Gakuen High School in Zentsūji, Kagawa. He later transferred to St. Thomas More Preparatory School in Oakdale, Connecticut in 2013. Watanabe rose to fame with this high school program, and was one of their most valuable players in the National Prep School Invitational as a senior in 2014. In college, he became the fourth Japanese-born Division I basketball player of all-time."},{"page_url":"https://ceb.wikipedia.org/wiki/Prunus_domestica","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Bluebyrd_plum.jpg","page_title":"Prunus domestica","context_page_description":"Espesye sa rosa ang Prunus domestica. Ang Prunus domestica sakop sa kahenera nga Prunus sa kabanay nga Rosaceae."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%89%BE%E6%B2%99%E5%9F%BA%E6%9E%97%E6%B8%85%E7%9C%9F%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/As_Syakirin_Mosque%2C_Kuala_Lumpur.jpg","page_title":"艾沙基林清真寺","context_page_description":"艾沙基林清真寺，或一般大眾稱為Masjid KLCC，是一座位處吉隆坡城中城的清真寺，其阿拉伯語名稱之意為「感恩的人」，於1998年開幕。在1999年7月，此清真寺管理權轉交至聯邦直轄區回教理事會，在之前，清真寺內的禮拜堂僅開放給馬來西亞國家石油的員工使用。"},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A3%AF%E5%A1%9A%E5%B8%82%E3%82%B3%E3%83%9F%E3%83%A5%E3%83%8B%E3%83%86%E3%82%A3%E3%83%90%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/KahoKanko_Iiduka_City_CommunityBus_33.jpg","page_title":"飯塚市コミュニティバス","context_page_description":"飯塚市コミュニティバスは、福岡県飯塚市にて運行しているコミュニティバスである。\\n市内を11か所の地区に分け、各地区相互間を定時に運行する飯塚市コミュニティバス、地区内でのみ利用できる飯塚市予約乗合タクシーがある。\\nいずれも実際の運行業務は市内のバス・タクシー事業者が行う。\\n運賃はコミュニティバスが200円均一、乗合タクシーが300円均一。\\nいずれも小学生以下は無料、障害者手帳は100円引。\\nコミュニティバス、予約乗合タクシーのどれにも使える回数券がある。\\n土曜日、日曜日・祝日・旧盆・年末年始は全種類・全路線運休する。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%9A%E4%BD%99%E6%97%A0%E7%BA%BF%E7%94%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Montreal-tower-top.thumb2-crop.jpg","page_title":"业余无线电","context_page_description":"業餘無線電，也被稱作火腿電台是一種供業餘無線電愛好者進行相互通訊、無線通訊技術實驗、自我訓練、個人娛樂、無線電運動、競賽以及應急通訊的一項使用無線電頻率頻譜的無線電業務。其中「業餘無線電愛好者」指「經正式批准的、對無線電技術有興趣的人，其興趣純系個人愛好而不涉及謀取利潤」。業餘無線電與商業廣播、安全業務無線電或者其他專業雙向無線電業務存在區別，業餘無線電並非這些專業無線電業務的業餘形式，也不是有關這些業務的業餘愛好，而是一項獨立的無線電業務。\\n業餘無線電業務由國際電信聯盟通過《無線電規則》設立。在國家層面上，政府對業餘無線電業務進行管理，並為每一個獨立的業餘電台指配呼號 。「准」業餘無線電愛好者將接受考試，以檢測其對無線電技術和所在國無線電法規的掌握。\\n業餘無線電愛好者使用語音、文字、圖像和數據等形式，藉助無線電波，跨越城市、國家和大洲的距離相互通訊，甚至與太空站和衛星建立通訊鏈路。\\n在國際上，業餘無線電業務由國際業餘無線電聯盟代表和協調，國際業餘無線電聯盟由全國性業餘無線電協會組成。\\n根據2011年美國無線電中繼聯盟的統計，全球共有約200萬人參與業餘無線電活動。其中約有83萬業餘業務電台位於IARU區域2，約75萬位於IARU區域3，約40萬位於IARU區域1。"},{"page_url":"https://en.wikipedia.org/wiki/Barkley-Grow_T8P-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Barkley-Grow_T8P-1_floatplane.jpg","page_title":"Barkley-Grow T8P-1","context_page_description":"The Barkley-Grow T8P-1 was an airliner developed in the United States shortly before the Second World War. Although it saw limited production, the type was well-received as a bush plane in Canada."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%B0%D1%81%D1%86%D0%B5%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Korosten1.JPG","page_title":"Корасцень","context_page_description":"Корасцень ці Корастэнь — горад у Жытомірскай вобласці Украіны, на р. Уж. Вузел аўтадарог і чыгунак. 64 тыс. жыхароў. Адзін з прамысловых гарадоў Украінскага Палесся. Заводы дарожных машын, хімічнага машынабудавання."},{"page_url":"https://fr.wikipedia.org/wiki/John_Ingleby","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/View_near_Tal_y_cafn%2C_looking_towards_Llanrwst.jpg","page_title":"John Ingleby","context_page_description":"John Ingleby, né en 1749 et mort en 1808, est un peintre britannique d'origine galloise dont la spécialité était la peinture de petite dimension, notamment de paysages."},{"page_url":"https://vi.wikipedia.org/wiki/Vladimir_Vladimirovich_Nabokov","image_url":"https://upload.wikimedia.org/wikipedia/vi/7/75/Nabokov_time_may_23_1969.jpg","page_title":"Vladimir Vladimirovich Nabokov","context_page_description":"Vladimir Vladimirovich Nabokov là một nhà văn, nhà thơ Nga, sáng tác bằng tiếng Nga và tiếng Anh. Nabokov là tác giả của nhiều tiểu thuyết nổi tiếng thế giới, trong đó, tiểu thuyết Lolita được quay thành nhiều bộ phim nổi tiếng. Ngoài văn xuôi và thơ, ông còn là dịch giả, dịch những tác phẩm kinh điển từ tiếng Nga sang tiếng Anh và ngược lại."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%A5%BF%E5%B1%B1%E7%8E%84%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Noma_Taki.png","page_title":"西山玄道","context_page_description":"西山 玄道は江戸時代後期の尾張藩の医師。美濃国久々利村出身。兼山村で西山家養子として医業を始め、名古屋に出て尾張藩御目見・御用懸医師を務めた。隠居後、久々利村旗本千村平右衛門家侍医。藩奥医師大河内存真、東京大学教授伊藤圭介の実父。晩年西山本家に不幸が続き、家名存続に奔走した。"},{"page_url":"https://cs.wikipedia.org/wiki/Kanton_Joigny","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Yonne_-_Canton_Joigny_2015.svg","page_title":"Kanton Joigny","context_page_description":"Kanton Joigny je francouzský kanton v departementu Yonne v regionu Burgundsko-Franche-Comté. Skládá se z 15 obcí. Před reformou kantonů 2014 ho tvořilo 10 obcí."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%9A%E1%83%94%E1%83%95%E1%83%9D%E1%83%9C_%E1%83%A2%E1%83%94%E1%83%A0-%E1%83%9E%E1%83%94%E1%83%A2%E1%83%A0%E1%83%9D%E1%83%A1%E1%83%98%E1%83%90%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Levon_ter-petrosian.jpg","page_title":"ლევონ ტერ-პეტროსიანი","context_page_description":"ლევონ ტერ-პეტროსიანი — სომხეთიშ პოლიტიკური დო ოჯარალე მოღალე. ქიანაშ მაართა პრეზიდენტი 1991-1998 წანეფს.\\nლევონ ტერ-პეტროსიანქ დებადჷ სირიაშ ნოღა ალეპოს. მუამუში აკოფ ტერ-პეტროსიანი სირიაშ დოა ლიბანიშ კომუნისტური პარტიეფიშ ართ-ართი დჷმარსხუაფალი რე. 1946 წანას ფანიაქ გეგნიხორჷ სომხეთიშ სსრ-შა. 1963 წანას გემშართჷ დო 1968 წანას გათუ ერევანიშ სახენწჷფო უნივერსიტეტიშ ფილოლოგიაშ ფაკულტეტი. 1989 წანას გეგშაგორეს სომხეთიშ უჟინაში სხუნუშ დეპუტატო, 1990 წანას — უჟინაში სხუნუშ მადუდეთ.\\n1991 წანაშ 16 გჷმთუთას გეგშაგორეს ზოხორინელი სომხეთიშ მაართა პრეზიდენტო. თის ხუჯ დუკინჷ გიშმაგორალეფიშ 83,4 %-იქ. 1996 წანას, მაჟირა ხანით გეგშაგორეს პრეზიდენტო დო ხონარეფიშ 51,75% მიპალუ. პრეზიდენტიშ პოსტიშე გეგნოდირთჷ 1998 წანაშ ფურთუთას. გინორინაშ ბაძაძი რდჷ დება სომხეთიშ თარობას. თიმბორჯიან პრემიერ-მინისტრ რობერტ ქოჩარიანქ, დუდთხილუაშ მინისტრ ვაზგენ სარქისიანქ დო დინოხოლენი საქვარეფიშ დო ერუანული უშქურანჯობაშ მინისტრ სერჟ სარქისიანქ ხუჯი ვადუკინეს თიშ გეგმას გვალამი ყარაბაღიშ კონფლიქტიშ დორეგულირაფაშ გეშა, ნამუთ ითოლიშწორენდჷ კონფლიქტიშ ზონაშ დემილიტარიზაციას დო აზერბაიჯანალეფიშ დორთინაფა ნთელ რანწკი დოხორელ პუნქტეფშა.\\nგინორინაშ უკული მუშენდჷ მატენადარანს."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%86%D8%AA%D8%B1%DB%8C%D9%85%D8%8C_%D9%86%DB%8C%D9%88%D9%87%D9%85%D9%BE%D8%B4%D8%A7%DB%8C%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Mill_Pond%2C_Antrim%2C_NH.jpg","page_title":"انتریم، نیوهمپشایر","context_page_description":"انتریم شهری در ایالت نیوهمپشایر کشور ایالات متحده آمریکا است که جمعیت آن در سرشماری سال ۲۰۱۰ میلادی، ۱٬۳۹۷ نفر بوده‌است."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%85%D0%B8%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%BD%D0%BE%D0%B5_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D0%B8%D0%B5_%D0%9B%D0%B5_%D0%9A%D0%BE%D1%80%D0%B1%D1%8E%D0%B7%D1%8C%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Corbusierhaus_B-Westend_06-2017.jpg","page_title":"Архитектурное наследие Ле Корбюзье","context_page_description":"Архитектурное наследие Ле Корбюзье — серия памятников архитектурного наследия французского архитектора Ле Корбюзье насчитывающая 17 объектов в семи странах мира, среди которых Аргентина, Бельгия, Германия, Индия, Франция, Швейцария и Япония.\\nВ 2016 году по инициативе Франции 17 объектов архитектора Ле Корбюзье, решением ЮНЕСКО были объединены в международный единый объект наследия ЮНЕСКО. Среди вошедших в список зданий — капелла Нотр-Дам-дю-О в Роншане, Вилла Савой и марсельская Жилая единица. Всего в список вошли объекты из семи стран, большая часть которых представляет Европу. Из других регионов мира в список включены Дом Куручета в Аргентине, здание Ассамблеи в индийском Чандигархе и Национальный музей западного искусства в Японии.\\nЭти памятники свидетельствуют о возникновении решительно нового архитектурного стиля, знаменующего собой полный отход от прошлого. Строительство этих сооружений приходится на полвека, период, который Ле Корбюзье назвал временем «терпеливого поиска»."},{"page_url":"https://be.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D1%8B%D1%81_%D0%86%D0%B2%D0%B0%D0%BD%D0%B0%D0%B2%D1%96%D1%87_%D0%90%D1%80%D0%BB%D0%BE%D1%9E%D1%81%D0%BA%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Bust_of_tsar_alexander.jpg","page_title":"Барыс Іванавіч Арлоўскі","context_page_description":"Барыс Іванавіч Арлоўскі — рускі скульптар эпохі ампіру, вучань і паслядоўнік Б. Торвальдсэна бел.."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D8%A8%D8%AF_%D8%A7%D9%84%D9%83%D8%B1%D9%8A%D9%85_%D9%81%D8%B1%D8%AD%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Bundesarchiv_B_145_Bild-F018012-0008%2C_Bonn%2C_Empfang_f%C3%BCr_Informationsminister_von_Irak.jpg","page_title":"عبد الكريم فرحان","context_page_description":"اللواء الركن عبد الكريم فرحان هو سياسي عراقي قومي ناصري راحل، ولد في الصويرة في لواء الكوت عام 1922.امضى حياته بين السلكين العسكري والمدني وشغل عده مناصب مهمة في الجيش العراقي ووزارة الدفاع كان آخرها منصب قائد الفرقة الأولى.\\nتخرج من الكلية العسكرية وكلية الأركان وكلية الحقوق.\\nكان أحد أعضاء اللجنة العليا في تنظيم الضباط الوطنيين الذي قاد ثورة 14 تموز 1958، وكان حينها برتبة عقيد، ويعد آخر من توفي من قادة تنظيم الضباط الوطنيين.\\nشغل منصب الأمين العام في حزب الاتحاد الاشتراكي العربي العراقي وهو فرع حزب الاتحاد الاشتراكي العربي الذي أسسه الرئيس جمال عبد الناصر في مصر، كما عين عضوا في القيادة السياسية المشتركة لمصر والعراق.\\nوكانت آخر مسؤولية عسكرية تولاها هي قيادة الفرقة الأولى في الجيش العراقي. ومع تطورات أحداث ما بعد ثورة تموز تولى وزارة الثقافة والإرشاد القومي عام 1963.، لكنه قدم استقالته من حكومة طاهر يحيى في في 23 حزيران 1965، ثم لحق به وزراء آخرين من ذوي التوجه الناصري في 10 تموز 1965 نتيجة اعتراضاتهم على رئيس الجمهورية عبد السلام عارف.\\nشغل منصب وزير الإصلاح الزراعي عام 1967، وكذلك وزير الزراعة بالوكالة. وفي 1 نيسان 1968، صدر مرسوم جمهوري بتعيينه وزيرا للزراعة والإصلاح الزراعي بعد صدور قانون دمجت فيه وزارتي الزراعة والإصلاح الزراعي بوزارة واحدة."},{"page_url":"https://ja.wikipedia.org/wiki/XP-60_(%E8%88%AA%E7%A9%BA%E6%A9%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Curtiss_YP-60E_061024-F-1234P-019.jpg","page_title":"XP-60 (航空機)","context_page_description":"XP-60 / YP-60は、アメリカ合衆国のカーチス・ライト社が開発した試作戦闘機。\\n当初XP-53として開発されたが、名称を変えて試作機が製作された。YP-60として増加試作が行われた型もあったが、開発時のトラブルが多く、性能も同時期に開発されたP-47やP-51に及ばず採用されなかった。"},{"page_url":"https://pt.wikipedia.org/wiki/Penacova_(freguesia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Penacova_30.PNG","page_title":"Penacova (freguesia)","context_page_description":"Penacova é uma freguesia portuguesa do concelho de Penacova, com 31,75 km² de área e 3 254 habitantes. A sua densidade populacional é de 102,5 hab/km². Tem a sua sede na vila de Penacova."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%EB%A7%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/PatrickStewart2004-08-03.jpg","page_title":"이마","context_page_description":"인체 해부학에서 이마는 사람의 눈 위의 머리뼈 부분을 뜻한다. 한국의 국어사전에서는 \\"얼굴의 눈썹 위로부터 머리털이 난 아래까지의 부분\\"으로 정의하고 있다. 비슷한 말로는 마빡, 이마빡 등이 있으며 반대말은 '뒤통수'이다."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%B8%D0%BC%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Antimony_spectrum_visible.png","page_title":"Антимон","context_page_description":"Антимонът е химичен елемент, означаван със символа Sb и притежаващ атомен номер 51 в периодичната система на елементите. По химични и физични свойства принадлежи към групата на металоидите. Притежава три алотропни модификации – стабилната бледосиня модификация е металоид, а жълтият и черният антимон са неметали. Антимонът се използва за производството на огнеустойчиви покрития, емайли, керамика, сплави, както и в състава на различни бои, лакове и гуми."},{"page_url":"https://fr.wikipedia.org/wiki/Parc_national_au_Japon","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Mt.Aso_and_caldera01.jpg","page_title":"Parc national au Japon","context_page_description":"Les parcs nationaux du Japon sont au nombre de 34. Il existe également 56 « parcs quasi nationaux », et 311 parcs naturels préfectoraux.\\nLes parcs nationaux au Japon sont régis légalement par la Loi sur les Parcs Nationaux adopté en 1931. L'objectif de cette loi est triple : protéger des paysages et des écosystèmes à forte valeur patrimoniale, promouvoir l'utilisation de ces paysages, et de promouvoir auprès de la population l'accès à l'éducation à l'environnement, au tourisme et aux loisirs de pleine nature. Les premiers parcs nationaux seront désignés en 1934 avec les parcs nationaux de Setonaikai, d'Unzen-Amakusa et de Kirishima Kinkōwan.\\nLa loi sera modifié à plusieurs reprises et la liste des parcs nationaux subira régulièrement des changements comme en 2017 avec l'ajout du parc national Amami-Guntō."},{"page_url":"https://sk.wikipedia.org/wiki/Lanh%C3%A9lin","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Map_commune_FR_insee_code_35147.png","page_title":"Lanhélin","context_page_description":"Lanhélin je francúzska obec, ktorá sa nachádza v departemente Ille-et-Vilaine, v regióne Bretónsko."},{"page_url":"https://de.wikipedia.org/wiki/Janusz_Skowron","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Janusz_Skowron.jpg","page_title":"Janusz Skowron","context_page_description":"Janusz Skowron war ein polnischer Jazzmusiker."},{"page_url":"https://fr.wikipedia.org/wiki/LeRoy_Butler","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/LeRoy_Butler.jpg","page_title":"LeRoy Butler","context_page_description":"LeRoy Butler III, né le 19 juillet 1968 à Jacksonville, est un joueur de football américain ayant évolué au poste de safety."},{"page_url":"https://en.wikipedia.org/wiki/Minnesota_Public_Radio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Minnesota_Public_Radio_Logo.png","page_title":"Minnesota Public Radio","context_page_description":"Minnesota Public Radio, is a public radio network for the state of Minnesota. With its three services, News & Information, Classical Music and The Current, MPR operates a 46-station regional radio network in the upper Midwest.\\nMinnesota Public Radio has won more than 875 journalism awards, including the Peabody Award, both the RTNDA Edward R. Murrow Award and the Corporation for Public Broadcasting award of the same name, and the Alfred I. duPont-Columbia University Gold Baton Award.\\nMinnesota Public Radio, operating as American Public Media, is the nation's second-largest producer and distributor of national public radio programs, reaching 18 million listeners nationwide each week. It is the largest producer and distributor of classical music programming in the country.\\nMinnesota Public Radio's 1,058-seat Fitzgerald Theater and 100-seat UBS Forum provide a venue for live remote broadcasts, discussion forums, political debates, cultural programming and more.\\nAs of September 2011, MPR was equal with WNYC for most listener support for a public radio network, and had the highest level of recurring monthly donors of any public radio network in the United States."},{"page_url":"https://pnb.wikipedia.org/wiki/%DA%A9%D8%A7%D9%86%D8%B3%DB%8C_%D8%B1%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Calopteryx_Luc_Viatour.JPG","page_title":"کانسی رن","context_page_description":"کانسی رن اڈدی سہنپ دے ٹبر دی اک ونڈ اے۔ ایہ یورپ دی واسی اے۔"},{"page_url":"https://ro.wikipedia.org/wiki/Limoges","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Centre-ville_et_champ_de_Juillet.JPG","page_title":"Limoges","context_page_description":"Limoges este un oraș în Franța, prefectura departamentului Haute-Vienne, în regiunea Noua Aquitania."},{"page_url":"https://sv.wikipedia.org/wiki/Edith_Erastoff","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Erastoff_och_B%C3%A6ckstr%C3%B6m_i_Den_inbillade_sjuke.jpg","page_title":"Edith Erastoff","context_page_description":"Edith Alma Frederika Erastoff, född 18 april 1887 i Helsingfors, död 28 augusti 1945 i Hedvig Eleonora församling i Stockholm, var en finlandssvensk skådespelare, känd för sina roller i svenska stumfilmer under 1910-talet och för sitt äktenskap med filmregissören Victor Sjöström."},{"page_url":"https://en.wikipedia.org/wiki/Romford_Market","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Havering_romford_welcome_sign.jpg","page_title":"Romford Market","context_page_description":"Romford Market is a large open market with 270 stalls, located in Romford in the London Borough of Havering, England. The market is open on Wednesdays, Fridays and Saturdays from 8.30 am to 4.30 pm."},{"page_url":"https://de.wikipedia.org/wiki/U-20-Fu%C3%9Fball-Weltmeisterschaft_der_Frauen_2010/Finalrunde","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Esther_Sundays_2._kick_from_the_penalty_mark_USA-NIG_U-20_Women_2010.jpg","page_title":"U-20-Fußball-Weltmeisterschaft der Frauen 2010/Finalrunde","context_page_description":"Die Spiele der Finalrunde der U-20-Fußball-Weltmeisterschaft der Frauen 2010 waren:"},{"page_url":"https://nl.wikipedia.org/wiki/Panorama_van_Ca%C3%AFro","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Ca%C3%AFro_bij_de_brug_van_Kasr-el-Nil.png","page_title":"Panorama van Caïro","context_page_description":"Het Panorama van Caïro, ook wel Caïro en de oevers van de Nijl, is een panorama uit 1881 van de Belgische schilder Émile Wauters."},{"page_url":"https://sv.wikipedia.org/wiki/Labastide-Rouairoux","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Map_commune_FR_insee_code_81115.png","page_title":"Labastide-Rouairoux","context_page_description":"Labastide-Rouairoux är en kommun i departementet Tarn i regionen Occitanien i södra Frankrike. Kommunen ligger i kantonen Saint-Amans-Soult som tillhör arrondissementet Castres. År 2009 hade Labastide-Rouairoux 1 587 invånare."},{"page_url":"https://sv.wikipedia.org/wiki/Wenshan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Location_of_Wenshan_Prefecture_within_Yunnan_%28China%29.png","page_title":"Wenshan","context_page_description":"Wenshan är en autonom prefektur för zhuang- och miao-folken i Yunnan-provinsen i sydvästra Kina."},{"page_url":"https://de.wikipedia.org/wiki/Ag2r_La_Mondiale","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Dunkerque_-_Quatre_jours_de_Dunkerque%2C_%C3%A9tape_1%2C_d%C3%A9part_%28175%29_%281er_mai_2013%29.JPG","page_title":"Ag2r La Mondiale","context_page_description":"ag2r La Mondiale oder kurz ag2r ist ein französisches Radsportteam, das eine Lizenz als WorldTeam besitzt.\\nDas Team ist Mitglied im Mouvement Pour un Cyclisme Crédible. Hauptsponsor ist seit dem Jahr 2000 der Versicherer AG2R La Mondiale. Seinen Sitz hat es in La Motte-Servolex."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Einstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Ronja_Prinz.JPG","page_title":"Schloss Einstein","context_page_description":"Schloss Einstein ist eine deutsche Fernsehserie in Form einer Seifenoper für Kinder und Jugendliche, die das Leben von Jugendlichen auf dem fiktiven Internat Schloss Einstein schildert. Dabei werden Geschichten aus den Bereichen Comedy, Action, Drama und Infotainment in verschiedenen Handlungssträngen miteinander verwoben. Zielgruppe der Serie sind die 8- bis 14-Jährigen.\\nMit bislang 974 produzierten Folgen in 23 Staffeln gilt Schloss Einstein weltweit als längste fiktionale Fernsehserie mit Kindern für Kinder. Die Dreharbeiten für Staffel 24 haben am 6. Juli 2020 begonnen."},{"page_url":"https://nn.wikipedia.org/wiki/%C3%85lesund_kommune","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/General_view%2C_Alesund%2C_Norway.jpg","page_title":"Ålesund kommune","context_page_description":"Ålesund er ein kommune på Sunnmøre i Møre og Romsdal. Byen Ålesund er i dag regionssenter for heile Sunnmøre, han er kjend for sine mange bygningar i jugendstil, bygde i attreisinga etter bybrannen i 1904. Ålesund kommune fekk sine noverande grenser etter kommunereforma 2020 då dei tidlegare kommunane Ålesund, Ørskog, Skodje, Haram og det meste av Sandøy kommune blei slåtte saman til nye Ålesund kommune.\\nHeile landarealet inkludert innsjøar er no ca. 632 km²., meir enn det femdoble av arealet før år 2020, av dette er i dag 41 km² jordbruksareal.\\nÅlesund ligg ytst ved fjordsystema på Sunnmøre og inkluderer øyane Hessa i vest, Aspøya og Nørvøya i midten, og halvdelen av Oksnøya i aust. I nord ligg Ellingsøya åtskilt frå dei førstnemnde øyane ved Ellingsøyfjorden, men det er tunnelsamband under fjorden frå byen. Hamna i Ålesund er stoppestad for Hurtigruta og tek òg imot ferjer og lasteskip frå mellom anna Hamburg, Newcastle og Kingston upon Hull.\\nByen ligg nær både rike fiskebankar og kystleia mellom nord og sør, og har lenge vore ei viktig fiskehamn. I 1824 vart han eksportsenter for klippfisk til Spania, noko som førte til stor vekst og bystatus i 1848."},{"page_url":"https://it.wikipedia.org/wiki/Borgio_Verezzi","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Borgio-municipio2.jpg","page_title":"Borgio Verezzi","context_page_description":"Bórgio Verèzzi è un comune italiano di 2 147 abitanti della provincia di Savona in Liguria. La sede comunale è situata presso la frazione di Borgio."},{"page_url":"https://de.wikipedia.org/wiki/Mathis_Orgelbau","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Orgel_Leonhardskirche_Feldbach.JPG","page_title":"Mathis Orgelbau","context_page_description":"Die Mathis Orgelbau AG ist ein Orgelbauunternehmen in Näfels im Schweizer Kanton Glarus."},{"page_url":"https://no.wikipedia.org/wiki/Sykkelorientering","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Wilimy.jpg","page_title":"Sykkelorientering","context_page_description":"Sykkelorientering er en utholdenhetsidrett og form for orientering, der utøverne sykler og navigerer i et nettverk av stier og veier. I motsetning til orientering til fots, har utøverne ikke lov til å forlate stiene og veiene."},{"page_url":"https://en.wikipedia.org/wiki/October_13_(Eastern_Orthodox_liturgics)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/%D0%95%D0%BF%D0%B8%D1%81%D0%BA%D0%BE%D0%BF_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE-%D0%92%D0%BE%D0%BB%D1%8B%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%A4%D0%B0%D0%B4%D0%B4%D0%B5%D0%B9_%28%D0%A3%D1%81%D0%BF%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9%29.jpg","page_title":"October 13 (Eastern Orthodox liturgics)","context_page_description":"October 12 - Eastern Orthodox liturgical calendar - October 14\\nAll fixed commemorations below celebrated on October 26 by Eastern Orthodox Churches on the Old Calendar.\\nFor October 13th, Orthodox Churches on the Old Calendar commemorate the Saints listed on September 30."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%B4%E3%82%A1%E3%83%AB%E3%82%AB%E3%83%B3%E3%83%B4%E3%82%A3%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Valcanville_-_Ancienne_commanderie_des_Templiers.JPG","page_title":"ヴァルカンヴィル","context_page_description":"ヴァルカンヴィル は、フランス、ノルマンディー地域圏、マンシュ県のコミューン。"},{"page_url":"https://de.wikipedia.org/wiki/Piz_Mez","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Summit_cross_on_Piz_Mez.jpg","page_title":"Piz Mez","context_page_description":"Der Piz Mez ist ein Berg südlich des Skigebiets Savognin im Kanton Graubünden in der Schweiz mit einer Höhe von 2718,1 m. Dank der Nähe zum Skigebiet und dank dem langen und breiten Nordhang mit regelmässiger Neigung ist er ein beliebter Skiberg. Oft wird er fälschlicherweise auch als Murter bezeichnet. Murter ist jedoch der Grat, der die Val Curtegns von der Val Schmorras trennt, und dessen nördlicher Eckpunkt der Piz Mez ist."},{"page_url":"https://en.wikipedia.org/wiki/Curt_Weldon","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Curt_Weldon.jpg","page_title":"Curt Weldon","context_page_description":"Wayne Curtis Weldon is an American politician. He served as a Republican member of the United States House of Representatives from 1987 to 2007, representing the 7th district of Pennsylvania. He was defeated in November 2006 for reelection by Joe Sestak. Weldon was vice-chair of the Armed Services Committee and the House Homeland Security Committee. He was also the co-chair of the Duma-Congress Study Group, the official inter-parliamentary relationship between the United States and Russia."},{"page_url":"https://gl.wikipedia.org/wiki/%C3%81ngel_Javier_Arizmendi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Javier_Arizmendi_2009.jpg","page_title":"Ángel Javier Arizmendi","context_page_description":"Ángel Javier Arizmendi de Lucas, nado en Madrid o 3 de marzo de 1984, é un futbolista español. Pode xogar de segundo dianteiro ou de interior."},{"page_url":"https://pl.wikipedia.org/wiki/Polskie_okr%C4%99ty_desantowe","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/ORP_Pozna%C5%84_DN-SD-05-02984.JPEG","page_title":"Polskie okręty desantowe","context_page_description":"Polskie okręty, barki i kutry desantowe.\\nNa uzbrojeniu polskiej Marynarki Wojennej jednostki desantowe pojawiły się dopiero po II wojnie światowej, a siły desantowe utworzono w latach 50. XX wieku. W przypadku Polski, posiadanie licznych sił desantowych, będących co do zasady siłami ofensywnymi, związane było z planami tworzonymi w ramach Układu Warszawskiego, na wypadek konfrontacji zbrojnej między Układem Warszawskim a państwami NATO w Europie. Według tych planów, tworzonych od 1962 roku, polska Marynarka Wojenna miała wraz z radzieckimi i wschodnioniemieckimi siłami morskimi uczestniczyć w desancie morskim na Półwysep Jutlandzki. Według jednakże oficjalnej doktryny wojennej, kładącej nacisk na obronny charakter sił zbrojnych, siły desantowe miały służyć przede wszystkim do kontrdesantów.\\nWszystkie okręty desantowe używane przez polską Marynarkę Wojenną były klasycznymi jednostkami, średnich lub małych rozmiarów, przystosowanymi do dokonywania desantu żołnierzy, czołgów i pojazdów bojowych, bezpośrednio przez podejście do brzegu, przez furtę dziobową."},{"page_url":"https://no.wikipedia.org/wiki/Aleksej_Savrasov","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/RooksBackOfSavrasov.jpg","page_title":"Aleksej Savrasov","context_page_description":"Aleksej Kondratjevitsj Savrasov var en russisk kunstmaler, foregangsmann i bruken av den såkalte lyriske landskapsstilen.\\nSavrasov var av kjøpmannsslekt. Han begynte tidlig å tegne. I 1838 skrev han seg inn som elev ved Moskvas skole i maling, skulptur og arkitektur. Her begynte han omgående å spesialisere seg i landskapsmaling.\\nI 1852, to år etter han avla eksamen ved malerskolen i Moskva, reiste han til Ukraina. Savrasov ble i 1854 invitert av lederen i Det keiserlige kunstakademiet, storhertuginne Maria Nikolajevna, til St. Petersburg. Tre år senere, i 1857, flyttet han til Moskva, ettersom han fikk en lærerstilling på kunstskolen der han selv hadde studert. Hans fremste elever, Isaak Levitan og Konstantin Korovin, husket læreren sin med både beundring og takknemlighet.\\nSavrasov giftet seg i 1857 med Sofija Hertz. Hjemmet deres ble et samlingspunkt for kunstnere og kunstsamlere, blant annet Pavel Tretjakov. Savrasov og særlig Vasilij Perov utviklet et nært vennskap. Perov hjalp Sarasov med å tegne figurer på hans bilde «Volga nær Jurjevets», og Savrasov malte landskapene på Perovs malerier «Fuglefangeren» og «Jegere i bivuakk»."},{"page_url":"https://en.wikipedia.org/wiki/Peter_Henlein","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/German_-_Spherical_Table_Watch_%28Melanchthon%27s_Watch%29_-_Walters_5817_-_View_C.jpg","page_title":"Peter Henlein","context_page_description":"Peter Henlein, a locksmith and clockmaker of Nuremberg, Germany is the inventor of the world's first watch. He was the first craftsmen to make small ornamental watches which were often worn as pendants or attached to clothing, known as pomander watches, which are regarded as the first watches in history of timekeeping."},{"page_url":"https://id.wikipedia.org/wiki/Ekstraklasa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Ernest_Pohl_Stadium_-_Zabrze_2.jpg","page_title":"Ekstraklasa","context_page_description":"Ekstraklasa adalah liga sepak bola utama di Polandia. Didirikan tahun 1926, liga ini secara teratur mengadakan kompetisi musiman. Pada saat ini ada 16 kesebelasan yang tergabung di dalamnya."},{"page_url":"https://en.wikipedia.org/wiki/Keith_Acton","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/20140927-KeithActon.jpg","page_title":"Keith Acton","context_page_description":"Keith Edward Acton is a Canadian former professional ice hockey centre who played 15 seasons in the National Hockey League, with the Montreal Canadiens, Minnesota North Stars, Edmonton Oilers, Philadelphia Flyers, Washington Capitals and New York Islanders between 1980 and 1994. In his NHL coaching career he has been an assistant coach with the Columbus Blue Jackets, the Philadelphia Flyers, the New York Rangers, the Toronto Maple Leafs and most recently the Edmonton Oilers, who released Acton and fellow assistant Craig Ramsay on June 4, 2015.\\nActon ran for mayor of Whitchurch-Stouffville in the 2018 elections."},{"page_url":"https://it.wikipedia.org/wiki/492nd_Special_Operations_Wing","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/371_Special_Operations_Combat_Training_Sq_emblem.png","page_title":"492nd Special Operations Wing","context_page_description":"Il 492nd Special Operations Wing è uno stormo operazioni speciali dell'Air Force Special Operations Command. Il suo quartier generale è situato presso Duke Field, in Florida."},{"page_url":"https://it.wikipedia.org/wiki/Juraj_Sagan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/600px_Giallo_e_Grigio.png","page_title":"Juraj Sagan","context_page_description":"Juraj Sagan è un ciclista su strada slovacco che corre per il team Bora-Hansgrohe. Professionista dal 2010, è il fratello maggiore di Peter Sagan, anch'egli ciclista."},{"page_url":"https://en.wikipedia.org/wiki/J%C3%B3zsef_Madaras","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Madaras_J%C3%B3zsef_fortepan_147845.jpg","page_title":"József Madaras","context_page_description":"József Madaras was a Hungarian film actor. He appeared in 85 films between 1958 and 2006."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%BE%D0%BD%D0%B0_%D0%91%D0%B0%D0%B2%D0%B0%D1%80%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Schatzkammer_Residenz_Muenchen_Krone_des_Koenigreichs_Bayern2.jpg","page_title":"Корона Баварии","context_page_description":"Корона королевства Бавария — часть королевских регалий Баварии, корона, изготовленная для монархов Баварии в связи с приданием Баварии статуса королевства."},{"page_url":"https://fr.wikipedia.org/wiki/Joinville_(Haute-Marne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/26%2C_rue_des_Marmouzets_-_Etat_avant_retrait_de_l%27enduit_du_XIXe_si%C3%A8cle.jpg","page_title":"Joinville (Haute-Marne)","context_page_description":"Joinville, appelée également Joinville-en-Vallage ou encore Joinville en Champagne, est une commune française située dans le département de la Haute-Marne, en région Grand Est.\\nLa commune est labellisée « Village étape » depuis 2014 et « Petite cité de caractère » depuis 2015.\\nSes habitants sont appelés les Joinvillois."},{"page_url":"https://pl.wikipedia.org/wiki/Gwiazdozbi%C3%B3r_Lwa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Dibuix_de_Leo.png","page_title":"Gwiazdozbiór Lwa","context_page_description":"Lew – 12. co do wielkości konstelacja będąca jednym z 12 gwiazdozbiorów zodiaku. Słońce wędruje na tle tego gwiazdozbioru od 10 sierpnia do 16 września. W naszych czasach przez gwiazdozbiór Lwa przebiega 35,8° ekliptyki: 2/5 znaku Lwa 4/5 znaku Panny. Liczba gwiazd widoczna nieuzbrojonym okiem: około 70. W Polsce widoczny wiosną."},{"page_url":"https://it.wikipedia.org/wiki/Bertschikon","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Karte_Gemeinde_Bertschikon_2013.png","page_title":"Bertschikon","context_page_description":"Bertschikon è una frazione di 1 091 abitanti del comune svizzero di Wiesendangen, nel Canton Zurigo."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%8A%E5%87%A1%E4%B8%89%E4%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Ivan_III_of_Russia.jpg","page_title":"伊凡三世","context_page_description":"伊凡三世·瓦西里耶维奇，通称为伊凡大帝，莫斯科大公，在世期间被称为全罗斯的伟大凯撒，他本人并未以此作为头衔，由孙儿伊凡四世在1547年改称为沙皇。伊凡三世的正式头衔为全俄罗斯的君主及大公，是莫斯科公国统一罗斯的首任君主。祖父是莫斯科大公瓦西里一世，父亲是大公瓦西里二世，母亲是加利奇—兹韦尼哥罗德大公国的公主玛丽娅·雅罗斯拉夫娜大公妃。\\n1472年娶末代拜占庭皇帝君士坦丁十一世的侄女索菲娅·帕列奥罗格，并且宣称自身继承拜占庭帝国。伊凡三世一生征服了雅罗斯拉夫尔、诺夫哥罗德、特维尔等十数个罗斯公国、收彼尔姆、梁赞大公国、普斯科夫共和国等国为附庸，强迫喀山汗国纳贡。1478年，伊凡三世攻陷基辅罗斯最后一个独立政权诺夫哥罗德封建共和国，将诺夫哥罗德置于莫斯科大公的冠冕之下。伊凡三世在1480年停止对金帐汗国的主系大帐汗国的纳贡，从而结束了两个半世纪的金帐汗国统治。1502年克里米亚汗国灭掉了大帐汗国。伊凡三世当时由瓦西里三世以及诸臣尊称伟大者，全称为：“蒙上帝洪福，罗斯的解放者，全罗斯的伟大凯撒与统治者，全罗斯、莫斯科、基辅、弗拉基米尔、诺夫哥罗德、特维尔的大公......。”等32个头衔。汉语通称为伊凡大帝。他在位晚期大量引进火绳枪和青铜炮的技师，他发动对喀山汗国与立陶宛大公国的战争割取领土。\\n1497年，伊凡大帝颁布了1497法典，建立了莫斯科大公国的政府机构。在这部法典中，规定了拜占廷的双头鹰国徽为俄罗斯国徽，并且将其图案刻在了俄国国玺上。同年，一面镀金的双头鹰徽记被安放在了克里姆林宫的斯巴斯基塔楼上。俄罗斯获得了象征自己国家的标志。同样在这部法典中，他还限制了农民的流动，规定只有在圣尤里节前后两周期间，农民要还清债务才可离开土地四处走动，如地主不愿放行，就会避开，农民要再等一年。开辟了莫斯科公国的农奴化进程。伊凡大帝也确立了莫斯科大公国的贵族体系，分为八个阶级，分别是波雅尔、朝臣、杜马贵族、执事、侍从官，侍讼官，服役贵族，贵族臣下。波雅尔到执事四级是杜马贵族，可以进入杜马议政，波雅尔甚至职位和领地都世袭罔替。伊凡大帝将罗斯贵族们凝聚在莫斯科大公的冠冕之下，为后来的俄罗斯沙皇国进一步改革提供了基础。\\n伊凡大帝早年御下严苛，动辄杀戮，后期因为年老体衰逐渐宽容，贵族势力不受控制，扶植大帝诸子进行宫廷斗争。最后在1502年4月11日，伊凡大帝决定任命儿子瓦西里为共治者，是为瓦西里三世，结束继承人之争。1504年开始，大帝隐居于谢尔盖圣三一修道院，1505年10月2日，大帝病重，被瓦西里三世下令送返莫斯科治疗，27日伊凡大帝去世。谢尔盖圣三一修道院敲钟99下致哀，大帝遗体以金线编制的衣服隆重地入殓，莫斯科八千城民为大帝送终，隆重地安葬于天使长主教座堂。"},{"page_url":"https://pl.wikipedia.org/wiki/Ulica_Podmurna_w_Toruniu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Torun_spichrz_ul_Podmurna_13.JPG","page_title":"Ulica Podmurna w Toruniu","context_page_description":"Ulica Podmurna w Toruniu – ulica na Starym Mieście, przecinająca je z południa na północ, najdłuższa ulica w toruńskim zespole staromiejskim. Biegnie wzdłuż linii wschodniego odcinka dawnych murów obronnych Starego Miasta, po ich wewnętrznej stronie."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BF%E3%83%BC%E3%83%9F%E3%83%8A%E3%83%AB%E9%A7%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/BlnHauptbahnhof28.jpg","page_title":"ターミナル駅","context_page_description":"ターミナル駅とは、鉄道路線の末端に位置する鉄道駅である。終点・終端・端末を意味する単語「ターミナル」 に由来する。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B1%D1%80%D0%B5%D1%80%D0%B0_(%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Localitzaci%C3%B3_de_Cabrera.png","page_title":"Кабрера (остров)","context_page_description":"Кабре́ра — небольшой остров в Средиземном море, один из Балеарских островов. Вместе с рядом более мелких островков входит в состав архипелага Кабрера. Административно относится к муниципии Пальма-де-Мальорка.\\nПлощадь острова — 1154,75 га. Наивысшая точка — холм На-Пикамоскес высотой 172 м."},{"page_url":"https://ceb.wikipedia.org/wiki/Westbourne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Westbourne_church.JPG","page_title":"Westbourne","context_page_description":"Parokya ang Westbourne sa Hiniusang Gingharian. Nahimutang ni sa kondado sa West Sussex ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 90 km sa habagatan-kasadpan sa London ang ulohan sa nasod. Naglangkob kin og 7.5 ka kilometro kwadrado.\\nAng yuta sa Westbourne kay patag.\\nAng klima kasarangan. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Disyembre, sa 1 °C."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%B1%D1%88%D0%B0%D1%80%D1%81%D1%8C%D0%BA%D0%B0_%D0%9C%D0%B0%D1%80%D1%96%D1%8F_%D0%93%D0%BD%D0%B0%D1%82%D1%96%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/%D0%9E%D0%B1%D1%88%D0%B0%D1%80%D1%81%D1%8C%D0%BA%D0%B0_%D0%9C%D0%B0%D1%80%D1%96%D1%8F_%D0%93%D0%BD%D0%B0%D1%82%D1%96%D0%B2%D0%BD%D0%B0.jpg","page_title":"Обшарська Марія Гнатівна","context_page_description":"Народилася 04 грудня 1930 року. Родом з Харківщини. Нелегке життя випало їй, юність - каліцтво, війна, голод, бідність. Про те закінчила, семирічку та Харківське педучилище. По направленню поїхала в Західну Україну. Працювала три роки піонервожатою в с. Підгайчики Глинянського району. Там керувала гуртком юних поетів. Корегувала дитячі вірші, записували їх в альбом. Про це писали в газеті \\" Вільна Україна \\".\\nПоступила у Львові до педінституту на заочне відділення філфаку і її перевели працювати вчителем молодших класів Ганачівської середньої школи. По закінченню педінституту Обшарська Марія Гнатівна там же працювала учителькою старших класів. Викладала українську мову та література, а у вечірній школі ще й історію.\\nВ Ганачівці познайомилась Марія Гнатівна зі своїм чоловіком, де працювала до декрету і чоловік забрав її до Червонограда в 1963, де вона проживаєпроживаю й досі.\\nСпочатку була домогосподаркою, доглядала двох донечок. Потім працювала в молодших класах в школі № 1, 10, а в 12 школі викладала українську мову та літературу звідти і пішла на пенсію.\\nМає трьох донечок."},{"page_url":"https://fi.wikipedia.org/wiki/R%C3%B6yhel%C3%B6pyy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Grouseeggsinnest.jpg","page_title":"Röyhelöpyy","context_page_description":"Röyhelöpyy on Pohjois-Amerikassa elävä pienikokoinen kanalintu ja aitokanojen heimoon kuuluvan Bonasa-sukunsa ainoa laji. Se on yksi laajimmalle levinneistä ja pienimmistä pohjoisamerikkalaisista metsäkanalinnuista – kooltaan tuskin kyyhkystä suurempi."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B0%D1%81%D0%B8%D1%84%D0%B8%D0%BA%D0%B0%D1%86%D0%B8%D1%8F_%D0%BD%D0%B0_%D0%B4%D0%B8%D0%BD%D0%BE%D0%B7%D0%B0%D0%B2%D1%80%D0%B8%D1%82%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Gastonia_burgei_dinosaur.png","page_title":"Класификация на динозаврите","context_page_description":"Класификацията на динозаврите е започната през 1842 г., когато Ричард Оуен е отделил различните родове влечуги, като Игуанодони, Мегалозаври и Hylaeosaurus в отделни подраздели. През 1887 – 1888 г. Хари Сийли разделя динозаврите в зависимост от тяхната тазобедрена структура на два големи разреда Saurischia и Ornithischia. По-долу е показана пълната класификация на надразред Динозаври до ниво род."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D8%B1%D8%A7%D9%84%D9%8A%D8%AF%D8%A7_%D8%AF%D9%8A_%D9%84%D8%A7_%D9%85%D8%A7%D8%AA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Iglesia_Peraleda.jpg","page_title":"بيراليدا دي لا ماتا","context_page_description":"بلدية بيراليدا دي لا ماتا، هي بلدية تقع في مقاطعة قصرش والتي تقع في منطقة إكستريمادورا، غرب إسبانيا.\\nيبلغ عدد سكانها 1.506 نسمة وفقاً لإحصائية سنة."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%83%D0%BB%D0%B0%D1%82%D0%BE%D0%B2,_%D0%A0%D1%83%D1%81%D1%82%D0%B5%D0%BC_%D0%91%D0%B0%D1%8F%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/2013-12-13._Lumen_%D0%B2_%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA%D0%B5_134.jpg","page_title":"Булатов, Рустем Баянович","context_page_description":"Русте́м Бая́нович Була́тов — вокалист и автор текстов группы «Lumen». С 2014 года вокалист и автор текстов группы \\"23\\"."},{"page_url":"https://en.wikipedia.org/wiki/Gunnar_von_Heijne","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Gunnar_von_Heijne_ISMB_2012_%287803463978%29.jpg","page_title":"Gunnar von Heijne","context_page_description":"Professor Nils Gunnar Hansson von Heijne, born June 10, 1951 in Gothenburg, is a Swedish scientist working on signal peptides, membrane proteins and bioinformatics at the Stockholm Center for Biomembrane Research at Stockholm University."},{"page_url":"https://en.wikipedia.org/wiki/Wytheville_Raid","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Mountains_North_of_Wytheville.jpg","page_title":"Wytheville Raid","context_page_description":"The Wytheville Raid or Toland's Raid was an attack by an undersized Union brigade on a Confederate town during the American Civil War. Union Colonel John Toland led a brigade of over 800 men against a Confederate force of about 130 soldiers and 120 civilians. The location of Wytheville, the county seat of Wythe County in southwestern Virginia, had strategic importance because of a nearby lead mine and the railroad that served it. This mine supplied lead for about one third of the Confederate Army's munitions, while the Virginia & Tennessee Railroad transported Confederate troops and supplies; plus telegraph wires along the railroad line were vital for communications. In addition to logistics of moving the lead to bullet manufacturing facilities, this rail line also connected an important salt works of an adjacent county with the wider Confederacy.\\nToland's entire brigade was mounted, and consisted of a mounted infantry regiment plus eight companies of cavalry. It approached the small town of Wytheville on the evening of July 18."},{"page_url":"https://es.wikipedia.org/wiki/Cartagena_de_Indias","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Cartagena_at_night.png","page_title":"Cartagena de Indias","context_page_description":"Cartagena de Indias, oficialmente Distrito Turístico y Cultural de Cartagena de Indias abreviado Cartagena de Indias, D. T. y C., es la capital del departamento de Bolívar, al norte de Colombia.​ Fue fundada el 1 de junio de 1533 por Pedro de Heredia.​ Desde 1991 Cartagena es un Distrito Turístico y Cultural.​ La ciudad está localizada a orillas del mar Caribe.\\nA partir de su fundación en el siglo xvi y durante toda la época virreinal española, Cartagena de Indias fue uno de los puertos más importantes de la América española.​ De esta época procede la mayor parte de su patrimonio artístico y cultural. El 11 de noviembre de 1811, Cartagena se declaró independiente de España. Este día es fiesta nacional en Colombia y en la ciudad se celebra durante cuatro días conocidos como las \\"Fiestas de Independencia\\".​"},{"page_url":"https://ga.wikipedia.org/wiki/Donal_Lunny","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Lunny_irvine_o_flynn_glackin.jpg","page_title":"Donal Lunny","context_page_description":"Ceoltóir Éireannach é Donal Lunny, a saolaíodh ar an 10 Márta, 1947 agus a tógadh sa Droichead Nua i gCill Dara. Tá go leor ceoltóirí faoi chomaoin mhór aige de bharr a ndearna sé chun a gcuid ceoil a chur os comhair an tsaoil mhóir."},{"page_url":"https://sv.wikipedia.org/wiki/Bielefeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Bielefeld_Altes_Rathaus.jpg","page_title":"Bielefeld","context_page_description":"Bielefeld är en kreisfri industri- och universitetsstad i den tyska delstaten Nordrhein-Westfalen vid nordvästra änden av Teutoburgerskogen, ett cirka 150 kilometer långt skogstäckt bergsområde. I staden, som hade 328 314 invånare i slutet av 2012, finns bland annat maskin- och textilindustri."},{"page_url":"https://ca.wikipedia.org/wiki/South_Palm_Beach","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Seal_of_South_Palm_Beach%2C_Florida.png","page_title":"South Palm Beach","context_page_description":"South Palm Beach és una població dels Estats Units a l'estat de Florida. Segons el cens del 2000 tenia una població de 699 habitants."},{"page_url":"https://de.wikipedia.org/wiki/Aunette","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Senlis_%28Oise%29%2C_l%27Aunette_%C3%A0_Villevert_%282%29.jpg","page_title":"Aunette","context_page_description":"Die Aunette ist ein Fluss in Frankreich, der im Département Oise in der Region Hauts-de-France verläuft. Sie entspringt im Gemeindegebiet von Rully, entwässert generell Richtung West bis Südwest durch den Regionalen Naturpark Oise-Pays de France und mündet nach rund 14 Kilometern an der Gemeindegrenze von Senlis und Courteuil als rechter Nebenfluss in die Nonette und gehört somit zum Einzugsgebiet der Seine."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B0%D0%BD%D1%82%D0%B5%D1%81,_%D0%96%D0%BE%D1%80%D0%B6_%D0%A8%D0%B0%D1%80%D0%BB%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Ekaterina_Goncharova_baronessa_Gekkern.jpg","page_title":"Дантес, Жорж Шарль","context_page_description":"Жорж Шарль Данте́с, после усыновления носил фамилию Ге́ккерн — французский монархист, офицер-кавалергард, по вероисповеданию католик. В 1830-е годы служил в России в Кавалергардском полку. Приёмный сын голландского дипломата Луи Геккерна. Был женат на сестре Н. Н. Пушкиной. Известен прежде всего как человек, смертельно ранивший на дуэли А. С. Пушкина. После дуэли был лишён чинов, российского дворянского достоинства и выслан из России. Впоследствии занимался политикой, был сенатором Второй империи."},{"page_url":"https://pl.wikipedia.org/wiki/Jab%C5%82onka_(stacja_kolejowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/KKD-jablonka.jpg","page_title":"Jabłonka (stacja kolejowa)","context_page_description":"Jabłonka – stacja Kijowskiej Kolei Dziecięcej utrzymywana przez Kolej Południowo-Zachodnią. Do początku lat 60. nazywała się \\"Sportowa\\"."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BF%E3%83%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Gomadare.jpg","page_title":"タレ","context_page_description":"タレとは、料理に使う液状の合わせ調味料の一種のこと。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_people_burned_as_heretics","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/HooperBurning.jpg","page_title":"List of people burned as heretics","context_page_description":"This is a list of people burned after being deemed heretics by different Christian Churches. The list does not attempt to encompass the list of those executed by burning for other reasons. The Catholic Encyclopedia states that \\"with the formal recognition of the Church by the State and the increase of ecclesiastical penalties proportioned to the increase of ecclesiastical offences, came an appeal from the Church to the secular arm for aid in enforcing the said penalties, which aid was always willingly granted...deviations from the Catholic Faith, were by the State made punishable in civil law and secular penalties were attached to them.\\" Canon 3 of the Ecumenical Fourth Council of the Lateran, 1215 required secular authorities to \\"exterminate in the territories subject to their jurisdiction all heretics\\" pointed out by the Catholic Church, resulting in the inquisitor executing certain people accused of heresy. Some laws allowed the civil government to employ punishment. After they were convicted by the Church, they were turned over to the local government for execution because of religious restrictions that kept ecclesial clergy from actually carrying out the executions."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%B8%D5%AC%D5%B8%D6%84%D5%B8%D5%BD%D5%BF%D5%A8_%D4%B4%D5%A1%D5%B6%D5%AB%D5%A1%D5%B5%D5%B8%D6%82%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Bundesarchiv_Bild_183-B22627%2C_Dr._Werner_Best.jpg","page_title":"Հոլոքոստը Դանիայում","context_page_description":"Հոլոքոստը Դանիայում, Դանիայի հրեաների հալածանքներն ու ոչնչացումը գերմանացի նացիստների կողմից Երկրորդ համաշխարհային պատերազմի ժամանակ: Դանիայի իշխանությունների ու հասարակության դիրքորոշման, ինչպես նաև տեղում կազմակերպված դիմադրության շնորհիվ երկրի գրեթե բոլոր հրեաները փրկվել են:"},{"page_url":"https://fr.wikipedia.org/wiki/Isabelle_Choini%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Isabelle_Choini%C3%A8re_2.jpeg","page_title":"Isabelle Choinière","context_page_description":"Isabelle Choinière, né en 1963 est une chorégraphe, performeuse, danseuse et spécialiste des arts numériques québécoise, résidant et travaillant à Montréal.\\nReconnue par la presse locale et internationale comme performeuse-visionnaire et pionnière de la « cyber-modernité », Isabelle Choinière propose, depuis 1994, des œuvres fortes et originales où se fondent la danse et les arts électroniques.\\nChorégraphe, performeuse, analyste et directrice artistique de la compagnie de danse et arts numériques Le Corps Indice, Isabelle Choinière explore les limites physiques et psychiques du corps naturel et du corps synthétique. Son langage chorégraphique moderne va puiser dans une multitude de sources gestuelles et intègre une réflexion sur le temps et l’espace d’où émerge une conception élargie et inédite du corps."},{"page_url":"https://el.wikipedia.org/wiki/%CE%93%CE%BF%CF%85%CE%BB%CE%B9%CE%AD%CE%BB%CE%BC%CE%BF%CF%82_%CE%A4%CE%AD%CE%BB%CE%BB%CE%BF%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Tell_Deutsch_M%C3%BCnster_1554.jpg","page_title":"Γουλιέλμος Τέλλος","context_page_description":"Ο Γουλιέλμος Τέλλος είναι ένας θρυλικός λαϊκός και εθνικός ήρωας της Ελβετίας. Ο θρύλος του καταγράφεται σε ένα ελβετικό χρονικό των τελών του 15ου αιώνα, και διηγείται περιστατικά που τοποθετούνται χρονικά στην περίοδο της ιδρύσεως της Παλαιάς Ελβετικής Συνομοσπονδίας, στις αρχές του 13ου αιώνα μ.Χ..\\nΣύμφωνα με τον θρύλο ο Τέλλος ήταν ένας εξαιρετικός σκοπευτής με τόξο-βαλλίστρα, ο οποίος σκότωσε τον τύραννο Άλμπρεχτ Γκέσλερ, έναν ηγεμόνα της Αυστρίας των Αψβούργων που είχε έδρα το Άλτντορφ της Ελβετίας, στο Καντόνι Ούρι.\\nΜαζί με τον Άρνολντ φον Βίνκελριντ, ο Γουλιέλμος Τέλλος είναι μια κεντρική μορφή του ελβετικού πατριωτισμού, όπως αυτός διαμορφώθηκε μετά τους πολέμους του Μεγάλου Ναπολέοντα."},{"page_url":"https://pt.wikipedia.org/wiki/Slavinja","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/%D0%A1%D0%B5%D0%BB%D0%BE_%D0%A1%D0%BB%D0%B0%D0%B2%D0%B8%D1%9A%D0%B0%2C_%D1%86%D0%B5%D0%BD%D1%82%D0%B0%D1%80.jpg","page_title":"Slavinja","context_page_description":"Slavinja é uma vila da Sérvia localizada no município de Pirot, pertencente ao distrito de Pirot, na região de Visok. A sua população era de 41 habitantes segundo o censo de 2011."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_27_maart","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Thomas_Ethelbert_Page_%281850%E2%80%931936%29%2C_Classical_Scholar_and_Schoolmaster.jpg","page_title":"Lijst van personen geboren op 27 maart","context_page_description":"Dit is een lijst van personen die geboren zijn op 27 maart.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n487 - Machutus, bisschop, priester uit Wales bewerken\\n972 - Robert II van Frankrijk, Franse hertog, koning der Franken bewerken\\n974 - Constance van Arles, Franse koningin bewerken\\n1220 - Paus Martinus IV, Franse paus, diplomaat, klerk en rooms-katholiek priester bewerken\\n1306 - Filips III van Navarra, graaf en Koning jure uxoris van Navarra, heerser bewerken\\n1323 - Anna van Luxemburg, hertogin bewerken\\n1347 - Ruprecht I van Legnica, hertog van Liegnitz bewerken\\n1401 - Albrecht III van Beieren, Duitse hertog, hertog van Beieren bewerken\\n1416 - Franciscus van Paola, monnik en heremiet bewerken\\n1457 - Juan de Aragón y de Jonqueras, 2nd count of Ribagorza, Spaanse graaf, President van de Generaliteit van Catalonië, militair bewerken"},{"page_url":"https://en.wikipedia.org/wiki/Trenitalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Trenitalia_D445_1141_with_IC_1542_at_Bova_Marina.jpg","page_title":"Trenitalia","context_page_description":"Trenitalia is the primary train operator in Italy. A subsidiary of Ferrovie dello Stato Italiane, itself owned by the Italian government, the company was established in 2000 following a European Union directive on the deregulation of rail transport."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%90%8D%E5%8F%A4%E5%B1%8B%E5%B8%82%E7%AB%8B%E8%A5%BF%E9%83%A8%E5%8C%BB%E7%99%82%E3%82%BB%E3%83%B3%E3%82%BF%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Nagoya_City_West_Medical_Center01.jpg","page_title":"名古屋市立西部医療センター","context_page_description":"名古屋市立西部医療センターは、愛知県名古屋市北区にある市立の病院。\\n名古屋市立城北病院を母体とし名古屋市立城西病院の一部を組み入れ、2011年5月に現在地に新築移転し開院した。愛称は「じょうほく」である。地域周産期母子医療センターや赤ちゃんにやさしい病院などの認定を受けている。\\n2021年4月に名古屋市立東部医療センターとともに名古屋市立大学に移管され同大学の付属病院となる予定になっている。"},{"page_url":"https://en.wikipedia.org/wiki/Pyramid_of_Khentkaus_II","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Abousir_KhentkaousII_01_b.jpg","page_title":"Pyramid of Khentkaus II","context_page_description":"The Pyramid of Khentkaus II is a queen's pyramid in the necropolis of Abousir in Egypt, which was built during the Fifth dynasty of Ancient Egypt. It is attributed to the queen Khentkaus II, who may have ruled Egypt as a reigning queen after the death of her husband Neferirkare Kakai. The pyramid is now a heavily damaged ruin, which only stands 4 metres high."},{"page_url":"https://sv.wikipedia.org/wiki/Liza_falcipinnis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Liza_falcipinnis.jpg","page_title":"Liza falcipinnis","context_page_description":"Liza falcipinnis är en fiskart som först beskrevs av Valenciennes, 1836. Liza falcipinnis ingår i släktet Liza och familjen multfiskar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pt.wikipedia.org/wiki/V%C3%AAnus_de_Milo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Vindplaats_venus_van_milo.jpg","page_title":"Vênus de Milo","context_page_description":"A Vênus de Milo ou Vénus de Milo é uma estátua da Grécia Antiga pertencente ao acervo do Museu do Louvre, situado em Paris, França.\\nA história de sua descoberta em 1820 na ilha de Milo, então parte do Império Otomano, e a forma como perdeu os braços foram narradas pelas fontes primitivas em versões contraditórias que nunca puderam ser de todo esclarecidas, mas depois de sua aquisição pela França foi imediatamente exposta no Louvre, oficialmente como uma obra-prima da prestigiosa geração clássica e atribuída ao círculo de Praxíteles, tornando-se uma celebridade instantânea e um motivo de orgulho nacionalista. Mas logo se criou uma polêmica, pois segundo alguns eruditos havia evidências para se acreditar que de fato fora produzida no período helenístico, na época desprezado como uma fase decadente na tradição artística grega, e esta possibilidade não interessava politicamente ao governo francês. O debate se estendeu por muito tempo, mas mesmo assim seu valor estético não foi posto em séria dúvida, sendo elogiada em altos termos por muitos artistas e intelectuais e mesmo pelo público leigo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BB%D0%BE%D0%B4%D0%BE%D0%B9_%D0%B8%D0%B3%D1%80%D0%BE%D0%BA_%D0%B3%D0%BE%D0%B4%D0%B0_%D0%BF%D0%BE_%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D0%B8_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D0%B8%D1%81%D1%82%D0%BE%D0%B2_%D0%A8%D0%9F%D0%A4%D0%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Stiliyan_Petrov.JPG","page_title":"Молодой игрок года по версии футболистов ШПФА","context_page_description":"Молодой игрок года по версии футболистов Шотландской профессиональной футбольной ассоциации — ежегодная награда, присуждаемая лучшему молодому футболисту года в шотландском футболе. Награда была впервые вручена по итогам сезона 1977/78. Лауреат определяется путём голосования среди членов профсоюза футболистов Шотландии — Шотландской профессиональной футбольной ассоциации.\\nПервым обладателем награды стал полузащитник клуба «Данди Юнайтед» Грэм Пейн, первым не шотландским футболистом, получившим этот приз, является Стилиян Петров — на тот момент хавбек «Селтика». Текущий владелец награды — защитник «Селтика» Киран Тирни."},{"page_url":"https://en.wikipedia.org/wiki/Galilee","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Petri_Fischzug_Raffael.jpg","page_title":"Galilee","context_page_description":"Galilee is a region mainly located in northern Israel. Galilee traditionally refers to the mountainous part, divided into Upper Galilee and Lower Galilee.\\nIn modern, common usage, as well at different times in history, Galilee referred and refers to all of the area that is north of the Mount Carmel-Mount Gilboa ridge. In this sense, it extends from the Israeli coastal plain and the shores of the Mediterranean Sea with Acre in the west, to the Jordan Rift Valley to the east; and from the Lebanese border in the north plus a piece bordering on the Golan Heights all the way to Dan at the base of Mount Hermon in the northeast, to Mount Carmel and Mount Gilboa in the south. This definition includes the plains of the Jezreel Valley north of Jenin and the Beth Shean Valley, the valley containing the Sea of Galilee, and the Hula Valley, although it usually does not include Haifa's immediate northern suburbs. By this definition it overlaps with much of the administrative Northern District of the country."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D1%87%D0%B4%D0%B5%D0%B9%D0%BB%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Deansgate_Locks_-_geograph.org.uk_-_1352312.jpg","page_title":"Рочдейлский канал","context_page_description":"Рочдейлский канал — судоходный канал в Северной Англии между Сауэрби-Бридж и Манчестером. Входит в общую сеть каналов Великобритании. Название дано по городу Рочдейл в Большом Манчестере, через который проходит канал.\\nШлюзы канала способны пропускать суда шириной до 4,3 м. Длина канала 51 км. Он проходит через Пеннинские горы и соединяет реку Колдер в Сауэрби-Бридж в Западном Йоркшире и Бриджуотерский канал в районе Каслфилд в Манчестере.\\nИзначально на канале было 92 шлюза. После ремонта или перемещения их осталось 91, но все шлюзы сохранили свои номера, за исключением шлюзов 3 и 4, которые были заменены на один шлюз, получивший номер 3/4. Этот шлюз, названный Тьюл-Лейн, имеет один из самых больших перепадов уровня воды в Великобритании."},{"page_url":"https://simple.wikipedia.org/wiki/Yorktown,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/YorktownHeightsNYOfficialFlag.jpg","page_title":"Yorktown, New York","context_page_description":"Yorktown is a town on the northern border of Westchester County, New York. It is a suburb of the New York City metropolitan area. It is about 38 miles north of midtown Manhattan. The population was 36,081 at the 2010 U.S. Census."},{"page_url":"https://fr.wikipedia.org/wiki/Jeliou_Jelev","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Signature_of_Zhelyu_Zhelev.png","page_title":"Jeliou Jelev","context_page_description":"Jeliou Mitev Jelev, né le 3 mars 1935 et mort le 30 janvier 2015, est un homme d'État bulgare, ex-dissident, président de la République entre 1990 et 1997."},{"page_url":"https://eo.wikipedia.org/wiki/Jen%C5%91_Huszka","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Huszka_Jen%C5%91-001.jpg","page_title":"Jenő Huszka","context_page_description":"Jenő HUSZKA [huska], hungare Huszka Jenő estis hungara komponisto.\\nJenő Huszka naskiĝis la 24-an de aprilo 1875 en Szeged. Li mortis la 2-an de februaro 1960 en Budapeŝto."},{"page_url":"https://fr.wikipedia.org/wiki/Bergerac_(Dordogne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Carte_ville_france_Bergerac.jpg","page_title":"Bergerac (Dordogne)","context_page_description":"Bergerac est une commune française située dans le département de la Dordogne, en région Nouvelle-Aquitaine. Classée ville d'art et d'histoire, c'est la deuxième ville du département en population, légèrement moins peuplée que la préfecture Périgueux. Chef-lieu de l'arrondissement de Bergerac et bureau centralisateur de deux cantons : Bergerac-1 et Bergerac-2, c'est l'une des trois sous-préfectures du département."},{"page_url":"https://fr.wikipedia.org/wiki/Volvo_FH","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Volvo_FH%2C_Koopman.JPG","page_title":"Volvo FH","context_page_description":"Le Volvo FH est un véhicule du type poids lourd, produit par le constructeur suédois AB Volvo.\\nApparu dès la fin de l'année 1993, en tant que modèles FH12 et FH16, sa production continue toujours, avec maintenant la seconde génération de la lignée. FH désigne en-fait Forward control High cab, les nombres désignant eux la cylindrée du moteur en litres. La série FH est l'une des gammes de camions ayant eu les plus grands succès au monde, le chiffre de vente dépassant les 400 000 unités pouvant en attester."},{"page_url":"https://en.wikipedia.org/wiki/Golden_Grove,_South_Australia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Golden_Grove_Greenwith.jpg","page_title":"Golden Grove, South Australia","context_page_description":"Golden Grove is an outer north-eastern suburb of Adelaide, South Australia and is within the City of Tea Tree Gully local government area. It is adjacent to Wynn Vale, Surrey Downs, Greenwith, Yatala Vale, Fairview Park, and Salisbury East."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_der_Neundorfer_Vorstadt_(Plauen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Plauen%2C_Pestalozzistra%C3%9Fe_27.JPG","page_title":"Liste der Kulturdenkmale in der Neundorfer Vorstadt (Plauen)","context_page_description":"In der Liste der Kulturdenkmale in der Neundorfer Vorstadt sind die Kulturdenkmale des Plauener Stadtteils Neundorfer Vorstadt verzeichnet, die bis Januar 2020 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale in Plauen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Stuttgart-Mitte","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/20170326_Stuttgart_-_Torstra%C3%9Fe_19.jpg","page_title":"Liste der Kulturdenkmale in Stuttgart-Mitte","context_page_description":"In der Liste der Kulturdenkmale in Stuttgart-Mitte sind alle unbeweglichen Bau- und Kunstdenkmale in Stuttgart-Mitte aufgelistet, die in der Liste der Kulturdenkmale. Unbewegliche Bau- und Kunstdenkmale der Unteren Denkmalschutzbehörde für diesen Stadtbezirk Stuttgarts verzeichnet sind. Stand dieser Liste ist der 25. April 2008.\\nDiese Liste ist nicht rechtsverbindlich. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Stadt Stuttgart erhältlich."},{"page_url":"https://sv.wikipedia.org/wiki/Leucochimona","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Macrolepidoptera15seit_0279.jpg","page_title":"Leucochimona","context_page_description":"Leucochimona är ett släkte av fjärilar. Leucochimona ingår i familjen Riodinidae.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://sv.wikipedia.org/wiki/Hannibal_Sehested_(riksr%C3%A5d)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Hannibal_Sehested.jpg","page_title":"Hannibal Sehested (riksråd)","context_page_description":"Hannibal Sehested, född 1609 på Ösel, död 23 september 1666 i Paris, Frankrike, dansk statsman och diplomat; danskt riksråd 1640, ståthållare i Norge 1642 till 1651. Gift 1642 med den danske kungen Kristian IV:s dotter Christiane."},{"page_url":"https://ca.wikipedia.org/wiki/Foals","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/2016_RiP_Foals_-_by_2eight_-_DSC9165.jpg","page_title":"Foals","context_page_description":"Foals és una banda musical originària d'Oxford, Anglaterra. La banda publica amb Transgressive Records a Europa i Sub Pop als EUA. Van publicar un àlbum complet—titulat Antidotes—el 24 de març de 2008 al Regne Unit, i el 8 d'abril als EUA. Anava a ser produït originalment per Dave Sitek de TV on the Radio però la banda va rebutjar la mescla final de Sitek i van remesclar el disc sencer ells mateixos a causa de l'excessiu ús de l'efecte reverb que li donava un so espacial."},{"page_url":"https://nl.wikipedia.org/wiki/Hermannsh%C3%B6hle","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Hermannshoehle_sintergang-ausschnitt_200402.jpg","page_title":"Hermannshöhle","context_page_description":"De Hermannshöhle is een voor het publiek opengestelde druipsteengrot in Rübeland vlak bij Wernigerode in de Harz. De grot werd in 1866 bij wegwerkzaamheden ontdekt en werd genoemd naar zijn ontdekker: Hermann Grotrian.\\nDe grot is met name bekend geworden dankzij de vondst van botten van de uitgestorven holenbeer. Ook is het de enige plek in Duitsland waar grottenolmen voorkomen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Zeppelin_NT_im_Flug.jpg","page_title":"Дирижабль","context_page_description":"Дирижа́бль, или управляемый аэростат — вид воздушных судов: аэростат, снабжённый силовой установкой и способный передвигаться в заданном направлении со значительной скоростью в большом диапазоне высот. Корпус дирижабля представляет собой тело удобно обтекаемой формы, объёмом от 2000 до 200000 м³, снабжённое стабилизаторами, вертикальными и горизонтальными рулями, в составе системы управления ориентацией, обеспечивающей возможность передвигаться в любом направлении независимо от направления воздушных потоков. На дирижаблях устанавливаются мощные моторы, приводящие во вращение воздушные винты, создающие тягу. По конструкции корпуса дирижабли делятся на три типа: нежёсткие, жёсткие и полужёсткие. Строившиеся в 1930-х годах жёсткие дирижабли представляли собой гигантские воздушные корабли с дальностью беспосадочного полёта 10000-15000 км, с полезной нагрузкой до 90 тонн. По сравнению с самолётами дирижабли обладают одним преимуществом — возможностью долго оставаться над определённым районом, так как в тихую погоду они могут держаться в воздухе без затраты горючего. Поэтому дирижабли целесообразно использовать для дальней разведки над океанами, для сопровождения караванов судов и т. п."},{"page_url":"https://sh.wikipedia.org/wiki/Tahiridska_Monarhija","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Saffarids_900ad.jpg","page_title":"Tahiridska Monarhija","context_page_description":"Tahiridska Monarhija je naziv za iransku državu koja je u 9. vijeku obuhvaćala sjeveroistočna područja Velikog Irana: današnji Iran, Afganistan, Tadžikistan, Turkmenistan i Uzbekistan. Prijestolnica je prvotno bila smještena u Mervu, a potom je prebačena u Nišapur. Taharidi se uz Samanide smatraju prvom nezavisnom iranskom dinastijom nakon Sasanidske Monarhije.\\nTahiridi su kao abasidski vazali prvotno vladali u Horasanu, no s vremenom su ostvarivali sve veći stupanj samostalnosti. Osnivač Taharidske Monarhije bio je Tahir ibn Husein, general koji je u početku karijere služio abasidskog kalifa iz Bagdada, a potom je zbog zasluga dobio velike dijelove zemlje u istočnom Iranu. Tahiridi su ubrzo proširili utjecaj i do Indije, a igrali su važnu vojnu ulogu i u samom Bagdadu budući da su bili cijenjeni kao vrsni ratnici. Taharidska država nestala je 873. godine kada je pripojena Safaridskoj Monarhiji."},{"page_url":"https://gl.wikipedia.org/wiki/Gran_Teatro_da_Habana","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Havana_-_Cuba_-_4023.jpg","page_title":"Gran Teatro da Habana","context_page_description":"O Gran Teatro da Habana é unha das principais institucións culturais da capital cubana, icona arquitectónica da cidade, e sede do Ballet Nacional de Cuba. Está situado ó lado do Capitolio.\\nO edificio foi inaugurado en 1838 como Palacio do Centro Galego da Habana, xa que servía como lugar de reunión para os emigrantes galegos da cidade. En 1908 comezaron as obras do novo edificio neobarroco, que foi rematado en 1915. Nel foi interpretado por primeira vez o himno galego e a primeira versión musical de Negra sombra.\\nA sala principal do edificio é o Auditorio García Lorca, con capacidade para 1.500 persoas."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B5%D0%BC%D1%87%D1%83%D0%BA_%D0%90%D0%BD%D0%B4%D1%80%D1%96%D0%B9_%D0%91%D0%BE%D0%B3%D0%B4%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Paralympic_2016_ua_20.jpg","page_title":"Демчук Андрій Богданович","context_page_description":"Андрій Богданович Демчук — український науковець і фехтувальник. Чемпіон літніх Паралімпійських ігор. Заслужений майстер спорту України. Кандидат технічних наук."},{"page_url":"https://en.wikipedia.org/wiki/Traffic_flow","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Case_2_Flow-Density_Diagram_for_VSL.png","page_title":"Traffic flow","context_page_description":"In mathematics and transportation engineering, traffic flow is the study of interactions between travellers and infrastructure, with the aim of understanding and developing an optimal transport network with efficient movement of traffic and minimal traffic congestion problems."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%B0%E1%83%94%E1%83%A2%E1%83%94%E1%83%A0%E1%83%9D%E1%83%AA%E1%83%98%E1%83%99%E1%83%9A%E1%83%A3%E1%83%A0%E1%83%98_%E1%83%9C%E1%83%90%E1%83%94%E1%83%A0%E1%83%97%E1%83%94%E1%83%91%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Oxepan.png","page_title":"ჰეტეროციკლური ნაერთები","context_page_description":"ჰეტეროციკლური ნაერთები — ციკლური ორგანული ნაერთები, რომლებიც ორზე მეტ განსხვავებულ ელემენტის ატომს შეიცავენ ციკლში. ჰეტეროციკლური ქიმია არის ორგანული ქიმიის უმნიშვნელოვანესი დარგი, რადგან ასეთი ორგანული ნაერთების გავრცელება ბინარულ ორგანულ ნაერთებზე ბევრად მეტია. ჰეტეროციკლური ქიმია შეისწავლის ჰეტეროციკლური ნაერთების სინთეზს, თვისებებს და მათ გამოყენებას. FDA-ის მონაცემებით წამლების 59% შეიცავს აზოტის რომელიმე ჰეტეროციკლს. ჰეტეროციკლურ ნაერთებში შეიძლება შედიოდეს ბორი, აზოტი, გოგირდი, ჟანგბადი, ფოსფორი და სხვა ელემენტები."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturschutzgebiete_im_Kreis_Borken","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Naturschutzgebiet_Heubachwiesen.jpg","page_title":"Liste der Naturschutzgebiete im Kreis Borken","context_page_description":"Die Liste der Naturschutzgebiete im Kreis Borken enthält die Naturschutzgebiete des Landkreises Kreis Borken in Nordrhein-Westfalen."},{"page_url":"https://pt.wikipedia.org/wiki/Sert%C3%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Casario.jpg","page_title":"Sertã","context_page_description":"A Sertã é uma vila portuguesa pertencente ao distrito de Castelo Branco, na província da Beira Baixa. Integrando a Região do Centro e sub-região do Médio Tejo. Faz parte da diocese de Portalegre-Castelo Branco e conta com cerca de 5 500 habitantes,\\nÉ sede de um município com 453,13 km² de área e 6 196 habitantes, subdividido em 10 freguesias."},{"page_url":"https://gl.wikipedia.org/wiki/Mar_Interior_de_Seto","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/De_Japanse_Binnenzee.png","page_title":"Mar Interior de Seto","context_page_description":"O mar Interior de Seto', mar de Seto ou Setouchi separa as illas de Honshu, Shikoku e Kyūshū, tres das catro illas principais no sur do Xapón. Este mar está conectado co mar do Xapón, ao oeste, e co mar de Filipinas, ao leste.\\nA rexión que inclúe o Mar Interior de Seto e as zonas costeiras de Honshū, Shikoku e Kyūshū é coñecida como a Rexión de Setouchi. Serve como unha vías navegables, conectando o Océano Pacífico ao Mar do Xapón. Conecta a Baía Osaca e ofrece unha conexión de transporte marítimo a centros industriais na rexión de Kansai, incluíndo Osaca e Kōbe. Antes da construción da Liña Principal San'yō, era a principal conexión de transporte entre Kansai e Kyūshū.\\nAs prefecturas de Yamaguchi, Hiroshima, Okayama, Hyōgo, Osaca, Wakayama, Prefectura de Kagawa, Prefectura de Ehime, Prefectura de Tokushima, Prefectura de Fukuoka e Ōita teñen todas litoral no mar interior de Seto; As cidades de Hiroshima, Iwakuni, Takamatsu, e Matsuyama tamén localízanse nel.\\nA rexión de Setouchi é coñecida polo seu clima moderado, cunha temperatura estable durante todo o ano e os niveis de choiva relativamente baixos."},{"page_url":"https://id.wikipedia.org/wiki/IAI_Harpy","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Paris_Air_Show_2007-06-24_n25.jpg","page_title":"IAI Harpy","context_page_description":"IAI Harpy adalah kendaraan tempur udara tak berawak yang diproduksi oleh Israel Aerospace Industries. Harpy dirancang untuk sistem radar menyerang dan dioptimalkan untuk peran SEAD. Ini membawa hulu ledak tinggi. Harpy telah dijual ke beberapa negara asing, termasuk Korea Selatan, Turki, India, dan China.\\nPada tahun 2004, Harpy menjadi fokus dari upaya oleh Amerika Serikat untuk membatasi transfer senjata dan penjualan teknologi militer canggih ke Cina. Dijual ke Cina pada tahun 1994 untuk sekitar $ US 55 juta, UAV dikembalikan ke Israel pada tahun 2004 di bawah kontrak untuk ditingkatkan. Amerika Serikat menuntut agar Israel merebut UAV dan membatalkan kontrak. Menurut Israel, Harpy adalah UAV dirancang pribumi. Ini tidak berisi sub-sistem diproduksi AS. Pada tahun 2005, UAV dikembalikan ke China tanpa upgrade. Kejadian ini dingin hubungan antara Amerika Serikat dan Israel, dengan Israel diskors dari statusnya sebagai Security Koperasi Peserta dalam program Joint Strike Fighter. Seperti tanggal 6 November 2005, namun, Israel telah menyatakan bahwa ia telah kembali mengakui ke dalam program."},{"page_url":"https://de.wikipedia.org/wiki/Egelsee_(Stuttgart)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Wartberg%2C_131.jpg","page_title":"Egelsee (Stuttgart)","context_page_description":"Der Egelsee ist ein künstlicher See, eingebettet in eine „Kunst-Garten-Landschaft“ am Wartberg in Stuttgart. Die Wasserspiele des Sees wurden von dem Bildhauer Hans Dieter Bohnet entworfen, die landschaftsarchitektonische Ausgestaltung des Geländes erfolgte nach den Plänen des Landschaftsarchitekten Hans Luz."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%8A%E6%9D%89%E8%AC%99%E4%BF%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Uesugi_Kenshin.jpg","page_title":"上杉謙信","context_page_description":"上杉谦信是一名活跃于日本战国时代的大名，后世誉为越后之虎、越后之龙、战国军神。越后守护代长尾为景幼子，幼名“虎千代”，成年后称长尾景虎。\\n由于继承了关东管领“上杉”的姓氏，并先后得到关东管领上杉宪政和室町幕府将军足利义辉的偏讳，故又称上杉政虎、上杉辉虎，笃信佛教，法名谦信，号宗心，斋号不识庵。官位为“从五位下弹正少弼”，死后由明治天皇追赠从二位。\\n任内终结内乱频仍的越后国，除了政务与军事外，也致力于经济产业的复兴。另由于救援盟国及关东秩序的回复屡次出兵，在48年的生涯中，分别与武田信玄、北条氏康、织田信长、越中一向一揆、芦名盛氏、能登畠山氏、佐野昌纲、神保长职、椎名康胤等大名频频作战，尤其5度与武田信玄在川中岛地区作战最为著名，广为后世描述。之后应足利将军家邀请而上洛，从越后国经北陆路西进越中国、能登国及加贺国等扩大势力，但壮志未酬而去世。作战的战兜为饭纲明神前立铁锖地张兜。\\n谦信共有四名养子，为上杉景胜、上杉景虎、上条政繁和山浦景国。"},{"page_url":"https://de.wikipedia.org/wiki/Bockwindm%C3%BChle_Fermersleben","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Windm%C3%BChle_Fermersleben.JPG","page_title":"Bockwindmühle Fermersleben","context_page_description":"Die Bockwindmühle Fermersleben ist eine im Magdeburger Stadtteil Fermersleben befindliche Bockwindmühle. Sie ist nur in Resten erhalten."},{"page_url":"https://es.wikipedia.org/wiki/Casta%C3%B1as_asadas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Casta%C3%B1as_asadas_en_Murcia_por_aabrilru.jpg","page_title":"Castañas asadas","context_page_description":"Las castañas asadas es una preparación simple de los meses de otoño que consiste en castañas expuestas a un foco calorífico con la intención de ser preparadas mediante asado. En algunas ciudades, durante el periodo invernal, se preparan asadores portátiles con la intención de vender las castañas asadas en puestos callejeros. En este caso las castañas se venden en cucuruchos de papel.​ Es tradición en la península ibérica la tradición del Magosto.​"},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%AF%E1%83%9D%E1%83%9C_%E1%83%99%E1%83%A3%E1%83%98%E1%83%9C%E1%83%A1%E1%83%98_%E1%83%90%E1%83%93%E1%83%90%E1%83%9B%E1%83%A1%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/John_Quincy_Adams.jpeg","page_title":"ჯონ კუინსი ადამსი","context_page_description":"ჯონ კუინსი ადამსი — ამერიკალი დიპლომატი დო პოლიტიკოსი, ააშ-იშ რიგით მა-6 პრეზიდენტი 1825-1829 წანეფს. ადამსი შხვადოშხვა ბორჯის რდჷ ფედერალისტური პარტიაშ, დემოკრატიულ-რესპუბლიკური პარტიაშ, ნაციონალ-რესპუბლიკური პარტიაშ, ანტიმასონური პარტიაშ დო ვიგეფიშ პარტიაშ მაკათური."},{"page_url":"https://en.wikipedia.org/wiki/Jameh_Mosque_of_Gonabad","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/%D9%85%D8%B3%D8%AC%D8%AF_%D8%AC%D8%A7%D9%85%D8%B9_%D9%82%D8%B5%D8%A8%D9%87_%D8%B4%D9%87%D8%B1%D8%8C_%DA%AF%D9%86%D8%A7%D8%A8%D8%A7%D8%AF.jpg","page_title":"Jameh Mosque of Gonabad","context_page_description":"The Jameh Mosque of Gonabad is related to Khwarazmian dynasty and is located in Gonabad."},{"page_url":"https://ast.wikipedia.org/wiki/La_Roche-sur-Yon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Map_commune_FR_insee_code_85191.png","page_title":"La Roche-sur-Yon","context_page_description":"La Roche-sur-Yon ye un conceyu y ciudá de Francia, que ye prefeutura del departamentu de la Vandea y na rexón de País del Loira. Los sos habitantes llámense, en francés, Yonnais."},{"page_url":"https://pl.wikipedia.org/wiki/Montamy","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/FranceNormandieMontamyEglise.jpg","page_title":"Montamy","context_page_description":"Montamy – miejscowość i dawna gmina we Francji, w regionie Normandia, w departamencie Calvados. W dniu 1 stycznia 2016 roku z połączenia 20 ówczesnych gmin – Beaulieu, Le Bény-Bocage, Bures-les-Monts, Campeaux, Carville, Étouvy, La Ferrière-Harang, La Graverie, Malloué, Montamy, Mont-Bertrand, Montchauvet, Le Reculey, Saint-Denis-Maisoncelles, Sainte-Marie-Laumont, Saint-Martin-des-Besaces, Saint-Martin-Don, Saint-Ouen-des-Besaces, Saint-Pierre-Tarentaine oraz Le Tourneur – powstała nowa gmina Souleuvre en Bocage. W 2013 roku populacja Montamy wynosiła 91 mieszkańców."},{"page_url":"https://de.wikipedia.org/wiki/Hochschule_Trier","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/HochschuleGebBundCNachts.jpg","page_title":"Hochschule Trier","context_page_description":"Die Hochschule Trier ist mit fast 8000 Studierenden und 160 Professoren eine der größten Fachhochschulen in Rheinland-Pfalz. Sie verteilt sich auf mehrere Standorte in Trier, Birkenfeld und Idar-Oberstein. Sie ist Mitglied in der European University Association."},{"page_url":"https://fr.wikipedia.org/wiki/Ir%C3%A9n%C3%A9e_Cros","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Ir%C3%A9n%C3%A9e_Cros.jpg","page_title":"Irénée Cros","context_page_description":"Irénée Cros, est un fonctionnaire et résistant français, Compagnon de la Libération. Agent voyer et architecte réalisant quasiment toute sa carrière au service du département de l'Ariège, il s'engage dans la résistance en 1941 et devient responsable départemental pour les Mouvements unis de la Résistance. C'est à ce poste qu'il est dénoncé et assassiné par la Gestapo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%B8%D1%85%D0%B2%D0%BE%D1%81%D1%82%D0%BA%D0%B0-%D1%87%D0%B5%D1%80%D0%BD%D1%83%D1%88%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/PhoenicurusOchrurosGuntherHasler01.jpg","page_title":"Горихвостка-чернушка","context_page_description":"Горихво́стка-черну́шка — мелкая певчая птица из семейства мухоловковых, распространённая в Европе и Центральной Азии. Несколько меньше воробья, выделяется прежде всего тёмным оперением большей части тела и ржавчато-оранжевым хвостом. Может зависать в воздухе, подобно колибри. Некогда обитательница исключительно высокогорья, начиная примерно с середины XVII века часто селится далеко за пределами первоначального природного ареала, в том числе и рядом с жильём человека. На территории России 3 изолированные друг от друга области распространения: горные районы Южной Сибири, Большого Кавказа, а также равнины запада европейской части, где птица начала гнездиться относительно недавно.\\nПитается в основном мелкими беспозвоночными, которых ловит на земле и на лету, а также их личинками и ягодами. В дикой природе гнездится в горах: в скалистых нишах, на уступах обрывов, на склонах с россыпью гальки. В населённых пунктах отдаёт предпочтение промышленным и строительным зонам, открытым местностям с отдельными постройками вроде заводских труб или куполов церквей."},{"page_url":"https://et.wikipedia.org/wiki/Konstant%C3%ADnos_Volan%C3%A1kis","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Konstantinos_Bolanakis.JPG","page_title":"Konstantínos Volanákis","context_page_description":"Konstantínos Volanákis või Volonákis oli üks 19. sajandi hinnatumaid kreeka maalikunstnikke."},{"page_url":"https://en.wikipedia.org/wiki/Philadelphia_Koreatown","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/From-upper-darby-koreatown.jpg","page_title":"Philadelphia Koreatown","context_page_description":"The first Philadelphia Koreatown is located around the Olney section of the city of Philadelphia, United States. Since the late 1980s, the Korean community has expanded northward, and it now straddles the border between North Philadelphia in Philadelphia proper and the northern suburb of Cheltenham, although many Korean-American businesses and organizations and some residents remain in Olney and adjoining neighborhoods. Upper Darby Township, bordering West Philadelphia, also has a large Korean-American population; meanwhile, a rapidly growing Korean population and commercial presence has emerged in suburban Cherry Hill, New Jersey since 2010, centered along Marlton Pike, attracted to the Cherry Hill Public Schools. Signage in Hangul is ubiquitous in some neighborhoods in these areas."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BE%BE%E5%B0%94%E6%96%87%E8%82%96%E5%83%8F%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Charles_Darwin_photograph_by_Ernest_Edwards%2C_circa_1866.jpg","page_title":"达尔文肖像列表","context_page_description":"达尔文肖像列表列出查尔斯·达尔文的历年肖像。达尔文出身富裕家庭，是著名的博物学学家，出版过多种重要著作，自童年、成年和晚年都有肖像留下。达尔文早年肖像为粉笔画或彩画，晚年肖像为黑白相片。1859年当时非常有争议的《物种起源》出版和广为传播之后，达尔文成为无数讽刺画的嘲讽对象。\\n达尔文的容貌，尤其是其标志性胡子，直到21世纪依然有重要文化意义和有辨识度。根据历史学家珍妮特·布朗的说法，达尔文授权了大量自己的肖像供人使用，这些肖像被广泛制作为橱柜像和肖像名片，这有助于在大众中强化达尔文与进化论二者之间的联系，原因在于其他为进化论发展做出贡献的人被排除在肖像之外，特别是这些肖像又被讽刺画重新解读。在19世纪，大部分科学家还不能像达尔文那样有财力拍摄照片。。\\n在达尔文生命的最后十年，随着病情恶化，他对坐着拍照感到厌倦。1869年，他婉拒了一次与阿尔弗雷德·拉塞尔·华莱士一起坐着拍照的机会，达尔文解释说，坐着拍照“是平生最厌恶的事情，与他人一起坐着拍照只会带来更多麻烦和耽误时间”。但是，据达尔文肖像专家基因·克里茨基的说法，达尔文至少留下53张照。"},{"page_url":"https://es.wikipedia.org/wiki/Aitxuri","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Urbia_2.JPG","page_title":"Aitxuri","context_page_description":"El Aitxuri, Atxurri o Aitz txuri es una montaña de 1551 metros de altitud perteneciente a los montes vascos. Está situado en Guipúzcoa, País Vasco.\\nSituado en la sierra de Aizkorri es el pico más alto de la misma. A mediados de los años 1980 estaba considerado como el techo de este macizo el vecino Aketegi, pero las mediciones realizadas en esa época dieron como resultado que el Aitxuri le ganaba por unos escasos 3 metros.\\nLa cota de 1551 m es la más alta de todo Euskadi, desde las estribaciones de la cordillera Cantábrica hasta los Pirineos. La importancia de este pico viene dada por su prominencia, que es de 943 m y lo califican como el número 36 de los montes peninsulares."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%87%BA%E4%B8%AD%E6%B0%B4%E6%B9%B3%E6%A9%9F%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/2008_Taichung_IT_Month_Day2_Old_Taichung_Shuinan_Airport.jpg","page_title":"臺中水湳機場","context_page_description":"臺中水湳機場是位於中華民國臺中市西屯區已拆除的機場，總面積約250公頃。水湳機場之名取自場址東方1公里處的水湳。其功能已被鄰近軍民合用的清泉崗機場取代。"},{"page_url":"https://cs.wikipedia.org/wiki/1942","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Bob_hoskins_filming_ruby_blue_cropped.jpg","page_title":"1942","context_page_description":"1942 byl rok, který dle gregoriánského kalendáře započal čtvrtkem."},{"page_url":"https://de.wikipedia.org/wiki/Br%C3%B6mserburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Br%C3%B6mserburg_Weinmuseum_Burggarten.JPG","page_title":"Brömserburg","context_page_description":"Die Brömserburg liegt in Rüdesheim am Rhein im Rheingau-Taunus-Kreis in Hessen in der Nähe des Rheinufers. Sie gehört in ihren Ursprüngen wohl zu den ersten festen Burgen im UNESCO-Welterbe Oberes Mittelrheintal."},{"page_url":"https://ca.wikipedia.org/wiki/Calitja","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Calina_en_el_este_de_Caracas.jpg","page_title":"Calitja","context_page_description":"La calitja o calima és un fenomen meteorològic consistent en la presència a l'atmosfera terrestre de partícules molt petites provinents de regions seques, o de sal, pols, cendres, argila, sorra o similar en suspensió, produint una lleu opacitat de l'aire. És produïda per la mescla i agitació dels corrents d’aire de diferent densitat, en ser escalfada la capa d’aire en contacte amb el sòl, per radiació de la mateixa superfície. L’augment de la temperatura afavoreix l’ascensió i, per tant, la mescla ja esmentada.\\nLa calitja estén un vel uniforme sobre el paisatge i n’entela la coloració, donant a l’aire un aspecte tèrbol i opac, en el qual es difuminen les formes dels objectes i obstacles i l’horitzó apareix borrós.\\nVist sobre un fons fosc, aquest vel té un to blavós, i sobre un fons clar la seva tonalitat és d’un groc brut o roig-groguenc. Visualment, aquest és el tret que la diferencia de la boirina, que és grisenca."},{"page_url":"https://lt.wikipedia.org/wiki/Hai%C4%8Dio_v%C4%97liava","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Flag_of_Haiti_%281964%E2%80%931986%29.svg","page_title":"Haičio vėliava","context_page_description":"Dabartinė Haičio vėliava buvo įteisinta 1986 metų vasario 25 dieną, kuomet po valstybinio perversmo buvo nuversta 22 metus trukusi diktatoriaus Fransua Diuvalje ir jo sūnaus Žano Klodo Diuvalje diktatūra.\\nŠios vėliavos pagrindą sudaros mėlynos ir raudonos spalvų horizontali dvispalvė su baltame stačiakampyje esančiu šalies herbu, kuris yra vėliavos centre. Mėlyna bei raudona yra nacionalinės Haičio Respublikos spalvos. Haičio vėliavoje esantys simboliai parodo: karališkoji palmė – Haičio, pirmosios juodųjų valstybės – karalystės, įkūrimo simbolis, kepurė virš jos – revoliucijos ir laisvės simbolis, naudotas Prancūzijos didžiosios revoliucijos metu. Kiti simboliai: patrankos ir ietys – šalies stiprybė, žalia žemė – sala bei valstybė. Taip pat vaizduojami būgnai bei vėliavos. Vėliavos herbo apačioje yra šūkis: „Sąjunga stiprina“."},{"page_url":"https://ro.wikipedia.org/wiki/Pachydactylus_oshaughnessyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Pachydactylus_oshaughnessyi.jpg","page_title":"Pachydactylus oshaughnessyi","context_page_description":"Pachydactylus oshaughnessyi este o specie de șopârle din genul Pachydactylus, familia Gekkonidae, descrisă de Boulenger 1885."},{"page_url":"https://en.wikipedia.org/wiki/Vlkol%C3%ADnec","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Vlkol%C3%ADnec_-_socha.JPG","page_title":"Vlkolínec","context_page_description":"Vlkolínec is a village under the administration of the town of Ružomberok in Slovakia. Historically, however, it was a separate village. The first written mention of the village came from 1376 and after 1882 it became part of Ružomberok. Its name is probably derived from the Slovak word \\"vlk\\", i. e. wolf.\\nVlkolínec has been listed as a UNESCO World Heritage site since 1993, and is one of ten Slovak villages that have been given the status of a folk architecture reservations. This status was granted because the village is an untouched and complex example of folk countryside architecture of the region of the Northern Carpathians.\\nVlkolínec, situated in the centre of Slovakia, is a remarkably intact settlement with the traditional features of a Central European village. It is the region’s most complete group of these kinds of traditional log houses, often found in mountainous areas. The village consists of more than 45 log houses each of them made up of two or three rooms. A wooden belfry from the 18th century as well as the baroque chapel has also been preserved. Houses No. 16 and 17 are turned into a folk museum with all the instruments of daily life and work."},{"page_url":"https://ca.wikipedia.org/wiki/Torre_de_don_Carles","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Porta_inferior.jpg","page_title":"Torre de don Carles","context_page_description":"La Torre de don Carles, també coneguda com a Torre de la Presó, és una torre situada entre la Plaça Major i el carrer de Vic de Taradell, a la comarca d'Osona, Catalunya. Tot i haver-se edificat durant el segle XVI, encara mostra una clara fesomia medieval."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AF%81%E0%AE%B3%E0%AE%BF%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Ayyanar_Temple_3.jpg","page_title":"குளிச்சப்பட்டு","context_page_description":"குளிச்சப்பட்டு, இந்தியாவின் தமிழ்நாடு மாநிலத்தில் அமைந்துள்ள தஞ்சாவூர் மாவட்டத்தில் இருக்கும் ஒரு சிற்றூர் ஆகும்."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%80%D1%88%D0%BD%D0%B5%D0%B2%D0%BE%D0%B9_%D0%B7%D0%B0%D1%82%D0%B2%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/D1_Saint_Petersburg_19.jpg","page_title":"Поршневой затвор","context_page_description":"Поршневой затвор — механизм артиллерийского орудия, обеспечивающий открывание и закрывание канала ствола благодаря сцеплению нарезки поршня и нарезной части казенного среза ствола. В зависимости от конструкции поршня поршневые затворы разделяются на цилиндрические, со сплошной или секторной нарезкой и конические. В зависимости от движения поршня при открывании поршневые затворы разделяются на однотактные, двухтактные и трёхтактные."},{"page_url":"https://de.wikipedia.org/wiki/Cixi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Prince_Gong.jpg","page_title":"Cixi","context_page_description":"Cixi war eine Nebenfrau des chinesischen Kaisers Xianfeng und wurde zur einflussreichsten Persönlichkeit der späten Qing-Dynastie."},{"page_url":"https://en.wikipedia.org/wiki/List_of_county_courthouses_in_Illinois","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Douglas_County_Illinois_Courthouse.jpg","page_title":"List of county courthouses in Illinois","context_page_description":"This list of county courthouses in Illinois provides information about each current Illinois county courthouse: name, photograph, city, construction year, and further comments.\\nEach of the 102 county governments in the U.S. state of Illinois operates out of a building or complex of buildings known as the county's courthouse. The community in which the courthouse is located is known as the county seat. The oldest current courthouse is the Putnam County Courthouse, built in 1839, while other courthouses have been built since 2010. Many courthouses were built following the destruction of previous buildings, either planned or unplanned; however, some former courthouses still stand, many of which have been repurposed as museums or as offices for other governmental agencies.\\nFifty-seven of these courthouses were constructed between the end of the Civil War and American entry into the First World War; extant courthouses from this period tend to reflect the Romanesque Revival, Second Empire, and Neoclassical architectural styles, while several older courthouses are Greek Revival buildings, and many twentieth-century courthouses are modernist structures."},{"page_url":"https://pl.wikipedia.org/wiki/Polskie_Stowarzyszenie_Flisak%C3%B3w_Pieni%C5%84skich_na_Rzece_Dunajec_w_Sromowcach_Ni%C5%BCnych","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Przewoznicy_w_Pieninach.jpeg","page_title":"Polskie Stowarzyszenie Flisaków Pienińskich na Rzece Dunajec w Sromowcach Niżnych","context_page_description":"Polskie Stowarzyszenie Flisaków Pienińskich na rzece Dunajec w Sromowcach Niżnych – stowarzyszenie powołane do życia w roku 1934, zrzeszające pienińskich flisaków. Stowarzyszenie organizuje spływy przełomem Dunajca po polskiej stronie granicy. Na dzień 14 kwietnia 2014 roku stowarzyszenie miało 942 członków zrzeszonych w 5 kołach."},{"page_url":"https://de.wikipedia.org/wiki/Peckensen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Peckensen_Kirche.JPG","page_title":"Peckensen","context_page_description":"Peckensen ist ein Ortsteil des Fleckens Diesdorf im Altmarkkreis Salzwedel in Sachsen-Anhalt."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%A7%D8%B3%D8%A8%D9%88%D8%B1%D8%AA%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Ukrainian_passport_2015.jpg","page_title":"باسبورتات","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D1%84%D0%BE%D1%80%D0%BC%D0%B0%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80_(%D0%94%D0%B5%D0%B1%D1%80%D0%B5%D1%86%D0%B5%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Debreceni_reform%C3%A1tus_nagytemplom.jpg","page_title":"Реформатский собор (Дебрецен)","context_page_description":"Реформатский собор Дебрецена — здание площадью 1500 м² крупнейшая в стране протестантская церковь. Обладает самым большим колоколом среди все венгерских протестантских церквей. Собор символ венгерской реформатской церкви, поэтому Дебрецен часто называют «кальвинистским Римом». Собор был построен между 1805 и 1824 годами в неоклассическом стиле, между площадью Кошута и площадью Кальвина, в центре города."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Romain_de_Targon","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Targon_%C3%A9glise_St_Romain_Fen%C3%AAtre_Sud_S1_a.JPG","page_title":"Église Saint-Romain de Targon","context_page_description":"L'église Saint-Romain est une église catholique située sur la commune de Targon, dans le département de la Gironde, en France."},{"page_url":"https://en.wikipedia.org/wiki/Russian_Museum_of_Ethnography","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Russian_Ethnographic_Museum_16.JPG","page_title":"Russian Museum of Ethnography","context_page_description":"The Russian Museum of Ethnography is a museum in St. Petersburg that houses a collection of about 500,000 items relating to the ethnography, or cultural anthropology, of peoples of the former Russian Empire and the Soviet Union.\\nThe museum was set up in 1902 as the ethnographic department of the Russian Museum. It is housed in a purpose-built Neoclassical building erected between 1902 and 1913 to Vasily Svinyin's design in the proximity of the Mikhailovsky Palace. It occupies the place of the eastern service wing, the stables and the laundry of the palace.\\nThe museum's first exhibits were the gifts received by the Russian Tsars from peoples of Imperial Russia. These were supplemented by regular expeditions to various parts of the Russian Empire which began in 1901. Further exhibits were purchased by Nicholas II of Russia and other members of his family. A collection of Buddhist religious objects was acquired for the museum by Prince Esper Ukhtomsky. Prince Tenishev, a wealthy industrialist, donated to the museum the archives of his private ethnographic bureau that had been documenting the life of Russian peasants since the 19th century."},{"page_url":"https://de.wikipedia.org/wiki/Osttimor","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/2015_East_Timor_municipalities_numbers.png","page_title":"Osttimor","context_page_description":"Die Demokratische Republik Timor-Leste, im Deutschen auch als Osttimor bezeichnet, ist ein Inselstaat in Südostasien. Es war der erste Staat, der im 21. Jahrhundert unabhängig wurde. Die einzige Landgrenze trennt Osttimor vom indonesischen Westteil der Insel Timor, der zu der Provinz Ost-Nusa Tenggara gehört. Nördlich liegen die zu Indonesien gehörenden Inseln Alor, Wetar und Liran und nordöstlich weitere Inseln der indonesischen Provinz Maluku. Australien liegt südlich, jenseits der Timorsee. Neben dem Ostteil Timors gehören zum Staat Osttimor auch die Exklave Oe-Cusse Ambeno in Westtimor und die Inseln Atauro und Jaco."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D8%BA%D8%AA%D9%8A%D8%A7%D9%84_%D8%B9%D9%84%D9%8A_%D8%A8%D9%86_%D8%A3%D8%A8%D9%8A_%D8%B7%D8%A7%D9%84%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Mazar-e_sharif_-_Steve_Evans.jpg","page_title":"اغتيال علي بن أبي طالب","context_page_description":"اُغتيل علي بن أبي طالب على يد أحد الخوارج يُدعى عبد الرحمن بن ملجم في 21 رمضان 40 هـ/ 27 يناير 661 م. علي بن أبي طالب هو رابع الخلفاء الراشدين عند السنة وأحد العشرة المبشرين بالجنة وأوّل الأئمّة عند الشيعة. اُغتيل في المسجد الكبير بالكوفة في العراق الحالي، كان يبلغ من العمر 62 أو 63 عاماً، توفي متأثراً بجراحه بعد يومين من إصابة ابن ملجم على رأسه بسيف مطلي بالسموم، في 21 أو 19 رمضان 40 هـ. وكان الخليفة الثالث الذي تم اغتياله، بعد عمر وعثمان.\\nأصبح علي الخليفة بعد اغتيال عثمان عام 35 هـ / 656 م. ومع ذلك واجه معارضة من البعض في المشرق بما في ذلك حاكم بلاد الشام، معاوية بن أبي سفيان. اندلعت فتنة سُميت بالفتنة الأولى، داخل الدولة الإسلامية المبكرة مما أدى إلى إسقاط الخلفاء الراشدين وإنشاء الدولة الأموية. بدأ الأمر عندما اُغتيل الخليفة عثمان بن عفان عام 35 هـ / 656 م واستمر حتى أربع سنوات في عهد علي. بعد أن وافق علي على التحكيم مع معاوية الأول بعد وقعة صفين، حدثت ثورة ضده من قبل بعض أفراده، والمعروفين فيما بعد باسم الخوارج. قتلوا بعض أنصار علي، ولكن تم سحقهم من قبل قوات علي في معركة النهروان في 658.\\nالتقى ابن ملجم مع خوارج آخرين وهما الحجاج التميمي البرك بن عبد الله وعمرو بن بكر التميمي في مكة، وخلص إلى أن وضع المسلمين في ذلك الوقت كان بسبب أخطاء علي ومعاوية وعمرو بن العاص."},{"page_url":"https://it.wikipedia.org/wiki/Ex_chiesa_di_San_Romano_(Ferrara)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Ferrara%2C_ex_chiesa_di_San_Romano_-_panoramio.jpg","page_title":"Ex chiesa di San Romano (Ferrara)","context_page_description":"La ex chiesa di San Romano a Ferrara è stata uno dei primi luoghi di culto cittadini, costruita molto prima della vicina cattedrale di San Giorgio."},{"page_url":"https://no.wikipedia.org/wiki/Rein%C3%B8ya","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Norway_-_Rein%C3%B8ya%2C_Troms.png","page_title":"Reinøya","context_page_description":"Reinøya er ei øy som ligger i Karlsøy kommune i Troms og Finnmark fylke. Øya ligger øst for Ringvassøya. Den har et areal på 148,62 km². Det høyeste punktet på øya er Reinskartinden.\\nDet er fergeforbindelse fra Reinskar til kommunesenteret Hansnes på Ringvassøya. Det er vedtatt av å bygge undersjøisk tunnel under Langsundet mellom Ringvassøya og Reinøya.\\nFram til 1. januar 2008 var den sørlige delen av øya en del av Tromsø kommune.\\nReinøy har fire bygder, hvor størstedelen av befolkningen bor: Nordeidet, Finnkroken, Grøtnesdalen og Stakkvik. Sistnevnte regnes som øyas hovedsenter og øyas skole ligger der. Navnet Reinøy kommer av ordet Rein eller Reina; «øya med fjellkantene».\\nMaleren Einar Berger var herfra."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%8B%D1%81%D0%BE%D1%82%D0%BD%D0%B0%D1%8F_%D0%B1%D0%BE%D0%BB%D0%B5%D0%B7%D0%BD%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/LhotseMountain.jos.500pix.jpg","page_title":"Высотная болезнь","context_page_description":"Высо́тная боле́знь — болезненное состояние, связанное с кислородным голоданием вследствие понижения парциального давления кислорода во вдыхаемом воздухе, которое возникает высоко в горах, а также при полётах на летательных аппаратах, не оснащённых герметичной кабиной, в которой поддерживается давление воздуха близкое или немного ниже нормальному атмосферному давлению, начиная примерно с 2000 метров и выше над уровнем океанов.\\nРазновидностью высотной болезни является го́рная боле́знь, в возникновении которой наряду с недостатком кислорода играют также роль такие усугубляющие факторы, как физическое утомление, охлаждение, обезвоживание организма, ультрафиолетовая радиация, тяжёлые погодные условия, резкие перепады температур в течение дня и т. д. Но основным патологическим фактором горной болезни является гипоксия.\\nЧеловек способен адаптироваться к высотной гипоксии, спортсмены специально тренируют свою способность к адаптации для того, чтобы повысить спортивные достижения. Предельно возможными для длительной адаптации к гипоксии считаются высоты на уровне около 10000 метров."},{"page_url":"https://nv.wikipedia.org/wiki/Naakaii_Doot%C5%82%CA%BCizhii_Bik%C3%A9yahd%C4%99%CC%81%C4%99%CC%81%CA%BC_na%CA%BCash%C7%AB%CC%81%CA%BCii_%C5%82ahgo_an%C3%AD%CA%BCdooln%C3%ADi%C5%82ii","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Chamaeleo_zeylanicus.jpg","page_title":"Naakaii Dootłʼizhii Bikéyahdę́ę́ʼ naʼashǫ́ʼii łahgo aníʼdoolníiłii","context_page_description":"Naakaii Dootłʼizhii Bikéyahdę́ę́ʼ naʼashǫ́ʼii łahgo aníʼdoolníiłii éí naʼashǫ́ʼii łahgo aníʼdoolníiłii dah yikahjí atah yisdzoh, áádóó éí Naakaii Dootłʼizhii Bikédaayahdi hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Chamaeleo zeylanicus\\" deiłníigo dayózhí."},{"page_url":"https://ro.wikipedia.org/wiki/David_Ben_Gurion","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/David_Ben-Gurion_%28D597-087%29.jpg","page_title":"David Ben Gurion","context_page_description":"David Ben Gurion a fost un politician și om de stat social democrat israelian, evreu originar din Polonia, unul din principalii conducători și ideologi ai mișcării sioniste, de autodeterminare a poporului evreu, și ctitor al Statului Israel. A fost cel dintâi prim ministru al Israelului. A prezidat guvernul israelian în două perioade: 14 mai 1948 — 26 ianuarie 1954 și 3 noiembrie 1955 — 26 iunie 1963. A fost și cel dintâi ministru al apărării al Israelului și unul din conducătorii mișcării muncitorești sioniste, de orientare social-democrată.\\nBen Gurion a stat în fruntea luptei politice și militare pentru crearea statului evreiesc modern în Palestina, chiar cu prețul împărțirii țării, și a fost cel care a proclamat întemeierea Israelului la 14 mai 1948.\\nA fost lider al mișcării sioniste și președinte al conducerii Agenției Evreiești la Ierusalim, și apoi a condus Israelul în primii săi ani de existență. A apărat cu hotărâre autoritatea statului creat și a reprimat din fașă încercări de dreapta și de stânga de a prezerva entități militare alternative armatei naționale unice."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AE%E0%AE%B2%E0%AE%AA%E0%AE%BE%E0%AE%B0%E0%AF%8D_%E0%AE%AA%E0%AF%81%E0%AE%A9%E0%AF%81%E0%AE%95%E0%AF%81%E0%AE%AA%E0%AF%8D_%E0%AE%AA%E0%AF%82%E0%AE%A9%E0%AF%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Malabar_Large-spotted_Civet_area.png","page_title":"மலபார் புனுகுப் பூனை","context_page_description":"மலபார் புனுகு பூனை என்பது இந்தியாவில் வாழும் புனுகு பூனை இனங்களில் மிக அரிய விலங்கினமாகும். இதனை மலையாளத்தில் சாவாதி வெருகு - ജാവാദി വെരുകു് என்றும் கன்னடத்தில் சிரதே பெக்கு என்றும் அழைப்பர். மேற்குத் தொடர்ச்சி மலைகளுக்குத் தனிச் சிறப்பான மலபார் புனுகு பூனைகள் ஒரு காலத்தில் தென்னிந்தியாவின் கேரள, கர்னாடக மாநிலங்களின் தாழ்நிலக் கரையோரப் பகுதிகளில் நிறைந்து காணப்பட்டன. இருபதாம் நூற்றாண்டின் தொடக்கத்திலேயே இவ்வினம் அருகிவிட்ட போதும் 1960கள் வரையில் இவ்வினத்திலிருந்து புனுகு பெறப்பட்டது. 1990 இல் தென் மலபார் பகுதியில் இவை சிறிய எண்ணிக்கையில் வாழ்ந்தன. 1999 இல் இவ்வினத்தில் வெறுமனே 250க்கும் குறைவான விலங்குகளே இயலிடத்தில் வாழ்வதாகக் கணிக்கப்பட்டது."},{"page_url":"https://en.wikipedia.org/wiki/Arc_de_Triomphe","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Batailles_grav%C3%A9es_sous_grandes_arcades.jpg","page_title":"Arc de Triomphe","context_page_description":"The Arc de Triomphe de l'Étoile is one of the most famous monuments in Paris, France, standing at the western end of the Champs-Élysées at the centre of Place Charles de Gaulle, formerly named Place de l'Étoile—the étoile or \\"star\\" of the juncture formed by its twelve radiating avenues. The location of the arc and the plaza is shared between three arrondissements, 16th, 17th, and 8th. The Arc de Triomphe honours those who fought and died for France in the French Revolutionary and Napoleonic Wars, with the names of all French victories and generals inscribed on its inner and outer surfaces. Beneath its vault lies the Tomb of the Unknown Soldier from World War I.\\nAs the central cohesive element of the Axe historique, the Arc de Triomphe was designed by Jean Chalgrin in 1806; its iconographic programme pits heroically nude French youths against bearded Germanic warriors in chain mail. It set the tone for public monuments with triumphant patriotic messages. Inspired by the Arch of Titus in Rome, Italy, the Arc de Triomphe has an overall height of 50 metres, width of 45 m and depth of 22 m, while its large vault is 29.19 m high and 14.62 m wide."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_guardonats_amb_el_Premi_Nobel_de_F%C3%ADsica","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Richard_E._Taylor.jpg","page_title":"Llista de guardonats amb el Premi Nobel de Física","context_page_description":"El Premi Nobel de Física és lliurat anualment per l'Acadèmia Sueca a «científics que sobresurten per les seves contribucions en el camp de la física». És un dels cinc premis Nobel establerts en el testament d'Alfred Nobel, el 1895, i que són donats a tots aquells individus que realitzen contribucions notables en la química, la física, la literatura, la pau i la fisiologia o medicina.\\nSegons el que diu el testament de Nobel, aquest reconeixement és administrat directament per la Fundació Nobel i concedit per un comitè conformat per cinc membres que són triats per la Reial Acadèmia Sueca de Ciències. El primer Premi Nobel de Física va ser atorgat el 1901 a Wilhelm Conrad Röntgen, d'Alemanya. Cada destinatari rep una medalla, un diploma i un premi econòmic que ha variat al llarg dels anys. El 1901, Röntgen va rebre 150.782 corones sueques, equivalents a 7.731.004 corones de 2007; en comparació, el 2008 el premi va ser atorgat a Makoto Kobayashi, Toshihide Maskawa i Yoichiro Nambu, que van compartir la quantitat de 10.000.000 de corones sueques."},{"page_url":"https://war.wikipedia.org/wiki/Camallanida","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Dracunculus_medinensis_larvae.jpg","page_title":"Camallanida","context_page_description":"An Camallanida in uska ordo han Nematoda. An Camallanida in nahilalakip ha classis nga Secernentea, phylum nga Nematoda, ngan regnum nga Animalia. An ordo nga Camallanida in naglalakip hin 38 ka mga species, sumala ha Catalogue of Life.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BD%D0%B5%D0%B2%D1%8B%D0%BD%D0%BE%D1%81%D0%BB%D0%B8%D0%B2%D1%8B%D0%B5_%D1%81%D0%B0%D0%B4%D0%BE%D0%B2%D1%8B%D0%B5_%D0%B4%D0%B5%D0%BA%D0%BE%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D1%8B%D0%B5_%D1%80%D0%B0%D1%81%D1%82%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Falscher_Jasmin_IMG_5357.JPG","page_title":"Теневыносливые садовые декоративные растения","context_page_description":"В списке представлены декоративные растения, выращиваемые в садах и парках в открытом грунте и обладающие теневыносливостью. Следует иметь в виду, что представленные растения обладают этим свойством в различной степени. Звёздочкой отмечены виды, изображённые на иллюстрации."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A9%D0%B8%D0%BF%D1%86%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Zaagzettang1.JPG","page_title":"Щипці","context_page_description":"Щи́пці — загальна назва столярного, слюсарно-монтажного, перукарського інструменту у вигляді двох з'єднаних на шарнірі плоских або напівкруглих стержнів з руків'ям. Використовується для стискання, схоплення, висмикування."},{"page_url":"https://en.wikipedia.org/wiki/Rufous-backed_fantail","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Naturalis_Biodiversity_Center_-_RMNH.AVES.135495_1_-_Rhipidura_rufidorsa_rufidorsa_Meyer%2C_1874_-_Monarchidae_-_bird_skin_specimen.jpeg","page_title":"Rufous-backed fantail","context_page_description":"The rufous-backed fantail is a species of bird in the family Rhipiduridae.\\nIt is found in New Guinea.\\nIts natural habitat is subtropical or tropical moist lowland forests."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E7%A5%90%E6%BC%A2%E5%B8%82%E6%94%BF%E7%B6%9C%E5%90%88%E9%AB%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Iao_Hon_Hawker_Building.jpg","page_title":"祐漢市政綜合體","context_page_description":"祐漢市政綜合體（葡萄牙文：Mercado Municipal do Bairro Iao Hon），俗稱祐漢街市，位於澳門祐漢市場街，響1994年1月28號起好，由當時嘅澳督韋奇立主持揭幕儀式。\\n成個市政綜合體包含街市、固定小販區、市政公園、體育中心、停車場同社區活動中心。"},{"page_url":"https://en.wikipedia.org/wiki/Blanca,_Colorado","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Blanca%2C_Colorado.JPG","page_title":"Blanca, Colorado","context_page_description":"The Town of Blanca is a Statutory Town in Costilla County, Colorado, United States. The town population was 385 at the 2010 census."},{"page_url":"https://vi.wikipedia.org/wiki/Chi%E1%BA%BFn_d%E1%BB%8Bch_Blau","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Ww2_map22_May7_July_1942.jpg","page_title":"Chiến dịch Blau","context_page_description":"Chiến dịch Blau là mật danh của Kế hoạch tổng tấn công từ mùa hè năm 1942 của quân đội Đức Quốc xã trên toàn bộ cánh Nam của mặt trận Xô-Đức trong Chiến tranh thế giới thứ hai. Ban đầu tên dự định của chiến dịch này là Siegfried, đặt theo tên của một người anh hùng trong thần thoại German. Tuy nhiên Adolf Hitler nhớ đến chiến dịch tấn công trước đó với cái tên hoành tráng, chiến dịch Barbarossa, với kết quả không như mong đợi của nó nên đã đặt một cái tên vừa phải hơn là Blau. Do đó \\"Chiến dịch Blau\\" thực chất là tổ hợp các chiến dịch mang tên Blau.\\nTrong lịch sử quân sự Liên Xô và Nga, nó còn được biết đến với tên gọi Chiến cục 1942 - 1943. Đây là một tổ hợp hoạt động quân sự rất lớn gồm hàng loạt chiến dịch song song và nối tiếp nhau tương tự như Chiến dịch Barbarossa một năm trước đó."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AF%8C%E9%83%BD%E5%95%86%E8%B2%BF%E5%A4%A7%E5%BB%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Canton_Fu_Dou_Commercial_Building.jpg","page_title":"富都商貿大廈","context_page_description":"富都商貿大廈是一棟爛尾建築，位於中國廣東省廣州市越秀區解放中路421-459號。設計為1棟27層綜合樓，設地下室3層，裙樓5層，建築面積為45786平方米，首至五層裙樓為商業區，六層以上為辦公區。由廣州市富都房地產開發有限公司於1995年開發，2000年因資金問題爛尾至今。2002年裙樓被開發為新陶街電器城，2014年關停。"},{"page_url":"https://pt.wikipedia.org/wiki/Cr%C3%B4nica_Ilustrada_de_Iv%C3%A3,_o_Terr%C3%ADvel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Facial_Chronicle_pages2.jpeg","page_title":"Crônica Ilustrada de Ivã, o Terrível","context_page_description":"A Crônica Ilustrada de Ivã, o Terrível é a maior compilação de informações históricas da Rússia medieval. Cobre o período da criação do mundo até o ano 1567. é tambem conhecido, informalmente, como o Livro do Czar, em analogia com Sino Tsar e Canhão do Tsar\\nO conjunto de manuscritos foi encomendado por Ivã, o Terrível especificamente para a sua biblioteca real. A tradução literal do título russo é \\"Crônica Facial,\\" em alusão as numerosas miniaturas pintadas a mão. A compilação consiste em 10 volumes, contendo cerca de 10 mil folhas de papel de algodão. É ilustrada com mais de 16 mil miniaturas."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B5%D0%B2%D0%BE%D0%B4%D0%BD%D0%B8%D1%86%D1%8F-%D0%9A%D0%BE%D1%81%D1%8C%D1%86%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Podlaskie_-_Turo%C5%9B%C5%84_Ko%C5%9Bcielna_-_Niewodnica_Ko%C5%9Bcielna_-_Ko%C5%9Bcielna_3_-_Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Antoniego_20110827_02.JPG","page_title":"Неводниця-Косьцельна","context_page_description":"Неводниця-Косьцельна — село в Польщі, у гміні Туроснь-Косьцельна Білостоцького повіту Підляського воєводства.\\nНаселення — 686 осіб.\\nУ 1975-1998 роках село належало до Білостоцького воєводства."},{"page_url":"https://en.wikipedia.org/wiki/United_Nations_Security_Council_Resolution_1906","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/MONUC_deployments_Dec_2009.png","page_title":"United Nations Security Council Resolution 1906","context_page_description":"United Nations Security Council Resolution 1906, adopted unanimously on December 23, 2009, after reaffirming previous resolutions on the topic and noting the situation in the Democratic Republic of the Congo, the Council decided to extend the mandate of the United Nations Mission in the Democratic Republic of Congo until 31 May 2010. The resolution therefore allowed 21,000 police and domestic and international troops to remain the country.\\nThe resolution assigned the mission with three main tasks, to:\\nensure the effective protection of civilians, humanitarian and UN personnel and facilities;\\ncarry out disarmament, demobilisation and reintegration of foreign and Congolese troops;\\nsupport government efforts to improve security and stability in the country.\\nThe Council also reiterated its concern about continued violations of human rights in the conflict zones, urging the Congolese government \\"to effectively protect the civilian population, to develop sustainable security sector institutions which fully respect the rule of law and to ensure respect for human rights and the fight against impunity.\\""},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%9F%E0%A5%89%E0%A4%B5%E0%A4%B0_%E0%A4%AC%E0%A5%8D%E0%A4%B0%E0%A4%BF%E0%A4%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Tower_Bridge%2CLondon_Construction_photo_1.jpg","page_title":"टॉवर ब्रिज","context_page_description":"टॉवर ब्रिज हा लंडन शहरातील थेम्स नदीवरील एक ऐतिहासिक व प्रसिद्ध पुल आहे. ह्या पुलाच्या बांधकामाला १८८६ साली सुरुवात झाली व ३० जुन १८९४ रोजी पुलाचे उद्घाटन करण्यात आले."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%9C%96%E7%93%A6%E7%9B%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Nui_atoll.jpg","page_title":"圖瓦盧","context_page_description":"图瓦卢是一个由九个环形珊瑚岛群组成的岛国，位于南太平洋。由于地势极低，最高点仅海拔四米，因此温室效应造成的海平面上升对图瓦卢造成严峻威胁，是全球遭受全海平面上升威胁最严重的国家。图瓦卢是世界上最不发达国家之一。图瓦卢面积狭小，仅有二十六平方公里的国土，位居全球主权国家中倒数第四，仅大于瑙鲁、摩纳哥与梵蒂冈。由于地方偏僻且缺乏旅游资源，图瓦卢是全世界最少游客到访的国家。"},{"page_url":"https://hr.wikipedia.org/wiki/Mali_vodenjak","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Schwanheim_fg16.JPG","page_title":"Mali vodenjak","context_page_description":"Mali vodenjak, vrsta iz porodice daždevnjaka."},{"page_url":"https://pl.wikipedia.org/wiki/Aloes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Aloe_vera_MHNT.BOT.2011.3.95.jpg","page_title":"Aloes","context_page_description":"Aloes – rodzaj jednoliściennych sukulentów liściowych. Liczy ok. 550 gatunków. Należą do niego formy drzewiaste, krzewiaste, byliny, niekiedy liany. Zasięg występowania roślin z tego rodzaju obejmuje Półwysep Arabski, Afrykę i Madagaskar. Gatunkiem typowym jest Aloë perfoliata L."},{"page_url":"https://sv.wikipedia.org/wiki/Lamenay-sur-Loire","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Map_commune_FR_insee_code_58137.png","page_title":"Lamenay-sur-Loire","context_page_description":"Lamenay-sur-Loire är en kommun i departementet Nièvre i regionen Bourgogne-Franche-Comté i de centrala delarna av Frankrike. Kommunen ligger i kantonen Dornes som tillhör arrondissementet Nevers. År 2009 hade Lamenay-sur-Loire 61 invånare."},{"page_url":"https://hu.wikipedia.org/wiki/F%C3%BCl%C3%B6p_orl%C3%A9ans-i_herceg_(1674%E2%80%931723)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Fran%C3%A7oise-Marie_de_Bourbon%2C_L%C3%A9gitim%C3%A9e_de_France%2C_%27duchesse_de_Chartres%27_par_Pierre_Gobert.jpg","page_title":"Fülöp orléans-i herceg (1674–1723)","context_page_description":"Fülöp francia királyi herceg, Orléans hercege röviden Orléans-i Fülöp, a Bourbon-ház Orléans-i ágából származó francia királyi herceg, Fülöp orléans-i herceg fia, XIV. Lajos király unokaöccse, születésétől fogva Chartres címzetes hercege, Valois, Nemours és Montpensier hercege, Joinville fejedelme, Beaujolais grófja, Franciaország pair-je. Apjának elhunytától, 1701-től II. Fülöp néven Orléans hercege. 1715–1723 között kiskorú kis-unokaöccse, XV. Lajos király mellett Franciaország régense. Apja, I. Fülöp herceg megalapította a Bourbon-ház orléans-i ágát. Egyenes ági leszármazottai között találhatók például Égalité Fülöp, Lajos Fülöp király és az orléans-i ágból származó francia trónkövetelők sora. Személyét történelmi, irodalmi munkák gyakran csak a Régensként említik, az 1715–1723 közötti régens-kormányzati időszak neve la Régence."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%88%D9%BE%D8%B4%D8%A7_%D9%85%DB%8C%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Copsa_Mica_jud_Sibiu.jpg","page_title":"کوپشا میکا","context_page_description":"شهر کوپشا میکا در شهرستان سیبیو در کشور رومانی واقع شده‌است. جمعیت این شهر ۵٬۱۵۷ نفر است."},{"page_url":"https://gl.wikipedia.org/wiki/Heinz-Harald_Frentzen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Frentzen_2003.jpg","page_title":"Heinz-Harald Frentzen","context_page_description":"Heinz-Harald Frentzen, tamén coñecido como 'HHF', é un piloto de carreiras profesional alemán retirado. Foi o subcampión no campionato do mundo de pilotos da fórmula un de 1997, pilotando para Williams."},{"page_url":"https://de.wikipedia.org/wiki/Lu%C3%ADs_Castro_(Fu%C3%9Fballtrainer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Lu%C3%ADs_Manuel_Ribeiro_de_Castro_%28%D0%9B%D1%83%D1%97%D1%88_%D0%9A%D0%B0%D1%88%D1%82%D1%80%D1%83%29_%28cropped%29.jpg","page_title":"Luís Castro (Fußballtrainer)","context_page_description":"Luís Manuel Ribeiro Castro ist ein portugiesischer Fußballtrainer.\\nLuís Castro wurde am 5. März 2014 vom Präsidenten des FC Porto, Jorge Nuno Pinto da Costa, zum Interimstrainer der ersten Mannschaft nominiert, nachdem der bisherige Leiter Paulo Fonseca von sich aus zurückgetreten war. Luís Castro hat als Trainer bisher nur eine Erfahrung in der Primeira Liga, als er zwischen 2004 und 2006 beim FC Penafiel Übungsleiter war. In der Saison 2013/14 war er zuvor beim FC Porto als Trainer der zweiten Mannschaft und im Jugendbereich tätig.\\nLuís Castro war in seiner Kindheit und Jugend durch eine Krankheit schwer beeinträchtigt, spielte aber als Verteidiger bei Vieirense, gefolgt von União Leiria, Sport Lisboa e Elvas, AD Fafe und RD Agueda. In Águeda begann er auch seine Trainerkarriere bevor er zum FC Penafiel ging. Castro studierte Physik und hat ein Diplom von der Universität Coimbra."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B5%D0%BA%D1%82%D0%BE%D1%85%D0%B8%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/SL_Sinharaja_Forest_asv2020-01_img04.jpg","page_title":"Анектохил","context_page_description":"Анектохил — род многолетних травянистых растений семейства Орхидные. В литературе встречают и другие русские названия: Анектохилус, Анектохилюс.\\nАббревиатура родового названия в любительском и промышленном цветоводстве — Anct.\\nВ цветоводстве виды этого рода относят к группе так называемых «драгоценных орхидей». Их ценность основана не на красоте цветков, а на особенностях окраски листьев. Помимо представителей рода Anoectochilus к этой группе относятся другие представители подтрибы Goodyerinae: Macodes, Ludisia, Dossinia, Goodyera, Zeuxcine и другие.\\nВсе виды рода Anoectochilus входят в Приложение II Конвенции CITES. Цель Конвенции состоит в том, чтобы гарантировать, что международная торговля дикими животными и растениями не создаёт угрозы их выживанию."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0_%D0%93%D0%B5%D1%80%D0%BE%D1%97%D0%B2_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D1%97_%D0%92%D1%96%D1%82%D1%87%D0%B8%D0%B7%D0%BD%D1%8F%D0%BD%D0%BE%D1%97_%D0%B2%D1%96%D0%B9%D0%BD%D0%B8_(%D0%9B%D1%83%D0%B3%D0%B0%D0%BD%D1%81%D1%8C%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/%D0%91%D1%83%D0%B4%D0%B8%D0%BD%D0%BE%D0%BA_%D0%A0%D0%B0%D0%B4_%D0%9B%D1%83%D0%B3%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_1939.jpg","page_title":"Площа Героїв Великої Вітчизняної війни (Луганськ)","context_page_description":"Площа Героїв Великої Вітчизняної війни — центральна площа Луганська з 1950-х років."},{"page_url":"https://sv.wikipedia.org/wiki/Fem%C3%B6resbron","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Fem%C3%B6resbron_%C3%B6ver_Motala_str%C3%B6m_2007.jpg","page_title":"Femöresbron","context_page_description":"Femöresbron var en gångbro som gick över Motala ström i Kneippen i Norrköping.\\nBron var en bågbro gjord i trä och stål och byggdes för att låta kurgästerna i Kneippen ta sig över till Folkparken. Femöresbron invigdes 1901. Bron stängdes 2016 då en rutininspektion visat att bron höll på att rosta sönder. 2017 lyftes bron slutligen bort.\\nNamnet kommer från den avgift man betalade för att nyttja bron. Vid det norra brofästet byggdes en stuga för brovaktaren, som tog emot avgiften på fem öre fram till 1948. Idag disponeras stugan med tomt av föreningen Brostugans Örtagård som har förvandlat den till en örtagård."},{"page_url":"https://en.wikipedia.org/wiki/Pacific_Crest_Trail","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Mulkey_Meadows_on_the_way_back_to_Trail_Pass_%2844536422422%29.jpg","page_title":"Pacific Crest Trail","context_page_description":"The Pacific Crest Trail, officially designated as the Pacific Crest National Scenic Trail, is a long-distance hiking and equestrian trail closely aligned with the highest portion of the Cascade and Sierra Nevada mountain ranges, which lie 100 to 150 miles east of the U.S. Pacific coast. The trail's southern terminus is just south of Campo, California by the U.S. border with Mexico, and its northern terminus is on the Canada–US border on the edge of Manning Park in British Columbia; it passes through the states of California, Oregon, and Washington.\\nThe Pacific Crest Trail is 2,653 mi long and ranges in elevation from just above sea level at the Oregon–Washington border to 13,153 feet at Forester Pass in the Sierra Nevada. The route passes through 25 national forests and 7 national parks. Its midpoint is near Chester, California, where the Sierra and Cascade mountain ranges meet.\\nIt was designated a National Scenic Trail in 1968, although it was not officially completed until 1993. The PCT was conceived by Clinton Churchill Clarke in 1932. It received official status under the National Trails System Act of 1968."},{"page_url":"https://fr.wikipedia.org/wiki/Jardin_japonais","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Saihouji-kokedera01.jpg","page_title":"Jardin japonais","context_page_description":"Le jardin japonais est issu de la tradition antique japonaise. Il se trouve aussi bien dans les demeures privées que dans les parcs des villes comme dans les lieux historiques : temples bouddhistes, tombeaux shintoïstes, châteaux.\\nAu Japon, l’aménagement de jardins est un art important et respecté, partageant des codes esthétiques avec la calligraphie et le lavis. Le jardin japonais cherche à interpréter et idéaliser la nature en limitant les artifices. Certains des jardins les plus connus en Occident comme au Japon sont des jardins secs ou « jardins zen », composés de rochers, mousses et graviers."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%B8%D0%B3%D0%B5%D0%BD-%D0%B0%D0%BD%D1%82%D0%B8%D1%82%D0%B5%D0%BB%D0%BE_%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D0%B0%D0%BA%D1%86%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Immune_Response_to_Exotoxins.png","page_title":"Антиген-антитело интеракција","context_page_description":"Антиген-антитело интеракција, или антиген-антитело реакција је специфична хемијска интеракција између антителаАнтитело и антигенa у току имуне реакције. То је основна реакција у телу којом је тело заштићено од сложених страних молекула, као што су патогени молекули и њихових хемијски токсини. У крви антигени су специфично везани антителима како би формирали антиген-антитело комплекс. Имуни комплекс се затим транспортује до ћелијских система где се може уништени или деактивирати.\\nПрви тачан опис антиген-антитело интеракције дао је Ричард Ј. Голдберг на Универзитету Висконсин у 1952. Постао је познат под називом \\"Голдберг теорија\\"."},{"page_url":"https://en.wikipedia.org/wiki/Seppe_Baetens","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Paris_Volley_-_Nantes_R%C3%A9z%C3%A9_VB%2C_Championnat_de_France_-_23_February_2017_-_39.jpg","page_title":"Seppe Baetens","context_page_description":"Seppe Baetens is a Belgian male volleyball player. He is currently part of the Belgium men's national volleyball team. On club level he plays for Axis Shanks Guibertin."},{"page_url":"https://no.wikipedia.org/wiki/Ekeberg_g%C3%A5rd_(Oslo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/OB.Z17490_Ekeberg_g%C3%A5rd_Oslo.jpg","page_title":"Ekeberg gård (Oslo)","context_page_description":"Ekeberg gård også omtalt som Store Ekeberg, Stamhuset Ekeberg og Ekeberg hovedgård er en av urgårdene i Oslo-området. Det er nylig avdekket rundt 3000 år gamle hustufter på Ekeberg gård. Fra gammelt av har gården hett Eikaberg med alternative skrivemåter som bl.a. Egeberg, Eegeberg, Eikeberg, Ekeber og Ekeberg. Betegnelsen Store Ekeberg, er trolig brukt for å skille den fra Lille Ekeberg, en plass/gård noe lenger øst i området som også omtales som «Egeberg» o.l. i kildematerialet. I dag er Ekeberg gård mest kjent som Ekeberg hovedgård. Lokalt blir den i dagligtale omtalt som Hovedgården.\\nGårdsanlegget ble plassert nærmest balanserende på toppen av den nordvendte Ekebergskrenten. Det siste uthuset på gården ble revet i forbindelse med anleggingen av Ekeberg Camping i 1964. Våningshuset fra 1771/77 som står noen få meter inn på Ekebergplatået er freda.\\nDet er gjort flere arkeologiske funn i området som peker mot en anseelig alder. Like sørvest for gårdens våningshus er det registrert et gravfelt fra jernalderen. Det er dessuten gjort helleristningsfunn i området rundt hovedbølet."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_de_Navarre","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Plaque_%C3%89mile_M%C3%A2le.JPG","page_title":"Rue de Navarre","context_page_description":"La rue de Navarre est une voie située dans le quartier Saint-Victor du 5ᵉ arrondissement de Paris."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A5%D0%B8%D0%BC%D0%B0%D0%BB%D0%B0%D1%98%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Himalaya-formation.gif","page_title":"Хималаји","context_page_description":"Хималајски масив или Хималаји су планински венац у Азији, који раздваја Индијски подконтинент од платоа Тибета. На Хималајима се налази највиши планински врх на Земљи Монт Еверест. Такође, то је назив великог планинског система који укључује Каракорум, Хиндукуш, као и друге, мање, венце који се протежу из Памирског чвора. Заједно, хималајски планински систем је уједно највиши на планети и дом највиших светских врхова, међу којима су Монт Еверест и К2. Како би се схватила огромна размера овог планинског венца, треба се присетити да је Аконкагва у Андима са 6.962 m највиши врх ван Азије, док хималајски систем обухвата преко 100 планинских врхова изнад 7.200 м, односно свих 14 изнад 8.000 м.\\nПодигнут услед субдукције индијске тектонске плоче под евроазијску плочу, хималајски планински венац се простире у правцу од запада-северозапада до истока-југоистока у луку дугом 2400 km. Његова западни крај, Нанга Парбат, лежи непосредно јужно од најсевернијег савијања реке Инд. Његов источно крај, Намча Барва, је непосредно западно од великог савијања реке Јарлунг Цангпо."}]`),L={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},F={class:"search-container"},T={class:"card-container"},G